INSERT INTO `Users` VALUES (-1,1,'2012-10-23T17:38:16.027','Community',NULL,'2012-10-23T17:38:16.027','http://meta.stackexchange.com/','on the server farm',NULL,'<p>Hi, Im not really a person.</p>\n\n<p>Im a background process that helps keep this site clean!</p>\n\n<p>I do things like</p>\n\n<ul>\n<li>Randomly poke old unanswered questions every hour so they get some attention</li>\n<li>Own community questions and answers so nobody gets unnecessary reputation from them</li>\n<li>Own downvotes on spam/evil posts that get permanently deleted</li>\n<li>Own suggested edits from anonymous users</li>\n<li><a href=\"http://meta.stackexchange.com/a/92006\">Remove abandoned questions</a></li>\n</ul>\n',0,56,310,-1,NULL),(1,101,'2012-10-23T19:10:10.287','Geoff Dalgas',NULL,'2015-04-27T16:23:58.567','http://stackoverflow.com','Corvallis, OR',40,'<p>Developer on the Stack Overflow team.  Find me on</p>\n\n<p><a href=\"http://www.twitter.com/SuperDalgas\" rel=\"nofollow\">Twitter</a>\n<br><br>\n<a href=\"http://blog.stackoverflow.com/2009/05/welcome-stack-overflow-valued-associate-00003/\">Stack Overflow Valued Associate #00003</a></p>\n',28,0,0,2,NULL),(2,101,'2012-10-23T19:15:42.877','Nick Craver',NULL,'2013-09-24T13:21:52.557','https://nickcraver.com/blog/','Winston-Salem, NC',32,'<p>I am the <a href=\"http://stackoverflow.com/company/team#Engineering\">Architecture Lead for Stack Overflow</a>. My day job consists of being a Developer, Site Reliability Engineer, and DBA. I design and build very fast things in hopes of making life easier for millions of developers.</p>\n\n<p>Blog: <a href=\"https://nickcraver.com/blog/\" rel=\"nofollow\">nickcraver.com/blog</a><br>\nTwitter: <a href=\"http://twitter.com/Nick_Craver\" rel=\"nofollow\">@Nick_Craver</a><br>\nMy Developer Story: <a href=\"https://stackoverflow.com/story/ncraver\">stackoverflow.com/story/ncraver</a></p>\n\n<p><sub>Disclaimer: I have <em>no idea</em> what Im talking about, all my answers are guesses!</sub></p>\n',5,0,0,7598,'https://i.stack.imgur.com/nGCYr.jpg?s=128&g=1'),(3,101,'2012-10-23T19:24:56.817','JavaCake',NULL,'2017-03-15T09:33:00.717',NULL,NULL,NULL,NULL,1,5,3,252872,NULL),(4,101,'2012-10-23T19:25:19.157','Taylor',NULL,'2012-11-15T21:25:20.757','http://www.taylortjohnson.com','Arlington, TX',31,'<p>...</p>\n',1,0,0,936717,NULL),(5,1,'2012-10-23T19:25:50.373','Jint',NULL,'2012-11-07T19:48:52.147',NULL,NULL,NULL,NULL,2,0,0,281381,NULL),(6,101,'2012-10-23T19:26:20.357','Rebecca Chernoff',NULL,'2012-10-25T16:48:22.777','http://rebecca.chernoff.com','St Louis, MO',33,'<p>Former Stack Exchange Community/Dev Team Member.</p>\n\n<p>Im <a href=\"http://twitter.com/rchern\" rel=\"nofollow\">@rchern</a> on Twitter.</p>\n\n<p>You can email me at rebecca.chernoff on gmail.</p>\n',1,0,0,60791,NULL),(7,101,'2012-10-23T19:26:21.073','Justin C',NULL,'2015-01-30T17:50:39.317',NULL,'Harrisonburg, VA, United States',35,'<p>Justin is the lead developer at SpedWare LLC. He oversees development of all databases and Web applications. While in college, Justin was recognized in national and international competitions for embedded software architecture and mathematical modeling.\n<br/><br/>\nJustin is active in the community, serving as both a United Way Campaign Account Manager and a Healthy Community Council member since 2007. As part of JMUs College for Kids, Justin has taught Video Game Design courses for 10-13 years olds.\n<br/><br/>\nWhen hes not programming, Justin enjoys listening to all forms of music and spending as much time outdoors as possible, an interest he developed while earning his Eagle Scout award.</p>\n',1,0,0,77099,'https://i.stack.imgur.com/tgVqN.jpg?s=128&g=1'),(8,101,'2012-10-23T19:26:35.333','Jaydles',NULL,'2015-02-25T22:28:42.490','https://blog.stackexchange.com/authors/jhanlon/','New York, NY, United States',42,'<p>I am:  </p>\n\n<ul>\n<li><strong><a href=\"https://imgur.com/9k3OF\" rel=\"nofollow noreferrer\">Griffin</a> and <a href=\"https://i.imgur.com/7ukhBjd.jpg\" rel=\"nofollow noreferrer\">Maeves</a> dad.</strong></li>\n<li><strong>Not tall.</strong>  </li>\n<li>Pretty much always <em>trying</em> to be helpful.  If Im not <em>succeeding</em>, just let me know.  (Okay, so maybe I wasnt trying that hard in <a href=\"http://meta.stackexchange.com/questions/46433/france-is-not-within-30-miles-of-london/56138#56138\">this question</a>.  But usually.  </li>\n</ul>\n\n<p><a href=\"http://stackexchange.com/users/140824\">\nprofile for Jaydles on Stack Exchange, a network of free, community-driven Q&amp;A sites http://stackexchange.com/users/flair/140824.png\n</a></p>\n',1,0,0,140824,'https://i.stack.imgur.com/BT5ZS.png?s=128&g=1'),(9,101,'2012-10-23T19:26:57.020','Anon',NULL,'2014-09-14T03:29:26.500',NULL,NULL,NULL,NULL,1,0,0,44715,'https://www.gravatar.com/avatar/abc7cbe9d190a379d2dda8c05d47310a?s=128&d=identicon&r=PG&f=1'),(10,111,'2012-10-23T19:26:58.360','LoveMeSomeCode',NULL,'2017-01-18T19:40:09.177','http://www.hotbarspot.com','Columbus, OH',38,'<p>I just love code.</p>\r\n<p> I will keep loving code until the day I build an AI and it kills us all. </p>\r\n<p>\r\nThen Ill probably rethink this whole <i>code</i> thing.\r\n</p>',2,1,0,19303,NULL),(11,1,'2012-10-23T19:27:09.857','Miguel Prada',NULL,'2012-10-23T19:27:09.857','http://twitter.com/migueluli','San Sebasti n, Spain',35,'<p>Robotics researcher at Tecnalia, Spain, focusing on assistive robotics application.</p>\n',1,0,0,442518,NULL),(12,183,'2012-10-23T19:27:18.247','Khrob',NULL,'2014-08-30T22:30:31.237','http://www.khrob.com','Melbourne, Australia',NULL,'<p>Part of the iPhone crew at Melbournes premiere enterprise iOS house - <a href=\"http://www.intunity.com.au/\" rel=\"nofollow\">Intunity</a></p>\n',2,4,0,237452,NULL),(13,431,'2012-10-23T19:27:20.620','giogadi',NULL,'2014-10-02T07:24:39.077','http://cs.unc.edu/~luis','Chapel Hill, NC',29,'<p>Grad student researcher in motion planning algorithms and medical robotics.</p>\n',6,18,10,408733,NULL),(14,101,'2012-10-23T19:27:31.637','Floern',NULL,'2017-08-26T15:50:37.910',NULL,'Switzerland',26,'<p>One may find my primary area of activity on <a href=\"https://stackoverflow.com/users/559745/floern\">Stack Overflow</a>.</p>\n\n<p><br>\nMember of <a href=\"https://chat.stackoverflow.com/rooms/111347/sobotics\">SOBotics</a> and owner of <a href=\"https://stackapps.com/q/7337/37543\">Generic Bot</a>.</p>\n\n<p>Author of the <a href=\"https://stackapps.com/q/7173/37543\">userscript for a network-wide flag summary</a>.</p>\n\n<p><br>\n<sup><em>&ast;void&ast;</em></sup></p>\n',0,0,0,270038,'https://i.stack.imgur.com/qBy4H.png?s=128&g=1'),(15,1,'2012-10-23T19:27:36.363','stephan mantler',NULL,'2012-10-25T21:03:25.567','http://www.stephanmantler.com/',NULL,NULL,NULL,1,0,0,1945655,NULL),(16,171,'2012-10-23T19:27:45.090','Chris Laplante',NULL,'2014-02-18T20:14:14.170','http://www.mostthingsweb.com/','0x77CCFA53',NULL,'<p>Previously active as \"SimpleCoder\".</p>\n\n<p>Please see the <a href=\"http://www.mostthingsweb.com/about-me/\" rel=\"nofollow\">About Me page</a> on <a href=\"http://www.mostthingsweb.com/\" rel=\"nofollow\">my blog</a>.<br/></p>\n',1,9,1,77466,NULL),(17,101,'2012-10-23T19:27:49.730','alcor',NULL,'2016-10-13T14:36:14.780','http://www.wikijava.org','Turin, Italy',39,'<p>Hi all :)</p>\n',0,4,0,239756,NULL),(18,101,'2012-10-23T19:27:57.823','Aarthi',NULL,'2013-03-28T19:46:08.393','http://blog.aarthid.me/','New York, United States',28,'<p>Im a former Stack Exchange employee. </p>\n\n<p>For all site support issues, please <a href=\"http://meta.stackoverflow.com/help\">contact the team</a>.</p>\n',0,0,0,453252,NULL),(19,101,'2012-10-23T19:28:13.740','jamuraa',NULL,'2013-02-28T01:31:31.643','http://base0.net','San Francisco, CA, United States',37,'<p>I work to make Bluetooth better at Google.</p>\n\n<p>Previous lives had me working on tiny robots and larger robots. My Ph.D involved working with those as well as Augmented Reality interfaces and simulating a bunch of robots using Qt GUIs, ROS, Player/Stage, and Android.</p>\n\n<p>I also develop Ruby on Rails applications and gems for fun and profit, tinker with electronics and blinky LED things.</p>\n\n<p>My current learning is Elixir &amp; Phoenix.</p>\n',0,0,0,5940,NULL),(20,156,'2012-10-23T19:29:34.120','Joe',NULL,'2015-02-25T20:53:50.070',NULL,NULL,NULL,NULL,2,5,0,46957,NULL),(21,323,'2012-10-23T19:30:27.567','Miro Markaravanes',NULL,'2017-01-06T23:35:08.380',NULL,'Glendale, CA',21,'<p>A computers enthusiast...</p>\n',10,10,1,430350,NULL),(22,186,'2012-10-23T19:30:51.430','mjcarroll',NULL,'2013-02-19T20:11:11.753','http://www.google.com/profiles/carroll.michael','Arlington, MA',30,'<p>Hi, Im Michael.  I build robots.</p>\n',0,6,0,209175,NULL),(23,101,'2012-10-23T19:31:25.080','Eric Perko',NULL,'2014-08-05T21:01:01.437','http://ericperko.com','Cleveland, OH',30,NULL,0,0,0,44384,NULL),(24,101,'2012-10-23T19:32:06.713','Nick Hawes',NULL,'2013-06-24T21:04:01.247','http://nickhaw.es','Birmingham, United Kingdom',39,'<p>AI and robotics researcher, Mac user, music maker and fan.</p>\n',0,0,0,45932,NULL),(25,104,'2012-10-23T19:32:09.883','Max',NULL,'2014-12-15T00:14:37.163',NULL,NULL,NULL,NULL,0,2,0,249430,NULL),(26,1,'2012-10-23T19:32:33.300','savant',NULL,'2013-01-12T06:38:16.173','http://www.ee.iitb.ac.in/student/~sksavant','Mumbai, India',24,'',0,0,0,961880,NULL),(27,101,'2012-10-23T19:34:28.477','ArthurGuy',NULL,'2012-11-08T21:08:42.097','https://arthurguy.co.uk/','Brighton, United Kingdom',NULL,NULL,0,0,0,229044,NULL),(28,128,'2012-10-23T19:35:38.273','Thomas Moulard',NULL,'2016-07-25T23:41:42.880','https://www.linkedin.com/in/moulard','Tokyo, Japan',32,NULL,1,4,0,1549857,NULL),(29,103,'2012-10-23T19:35:41.837','rabbidrabbit',NULL,'2013-04-15T12:03:34.257',NULL,NULL,NULL,NULL,1,6,0,1159322,NULL),(30,170,'2012-10-23T19:36:08.647','Zetta Suro',NULL,'2013-07-31T18:31:17.797','','New York, United States',NULL,'',1,6,0,1122690,'https://i.stack.imgur.com/MAKmC.jpg'),(31,231,'2012-10-23T19:36:49