:15.490','https://bungeshea.com','Tasmania, Australia',19,NULL,3,26,0,888488,'https://www.gravatar.com/avatar/d76f7151c84de25fb74e670f64e8d670?s=128&d=identicon&r=PG&f=1'),(39,183,'2012-10-23T19:42:32.980','Crake',NULL,'2013-04-22T13:13:45.113',NULL,NULL,NULL,NULL,2,5,1,468655,NULL),(40,4235,'2012-10-23T19:43:59.430','Rocketmagnet',NULL,'2017-05-12T18:39:07.043','http://www.shadowrobot.com','London, United Kingdom',40,'<p>Senior Robotics Design Engineer at the Shadow Robot Company, where I have worked for about 20 years now.<br>\nAuthor of <a href=\"http://freespace.virgin.net/hugo.elias/\" rel=\"nofollow\">The good-looking textured light-sourced bouncy fun smart and stretchy page</a>.</p>\n',74,531,1,22610,NULL),(41,101,'2012-10-23T19:44:20.507','Annath',NULL,'2013-05-28T02:27:16.360',NULL,'United States',27,'<p>Im just a hobbyist programmer working on an Computer Engineering degree. Programming is fun, but engineering is where my heart is at.</p>\n',0,0,0,35225,NULL),(42,464,'2012-10-23T19:48:10.900','Chris Mansley',NULL,'2016-02-08T01:38:47.187','http://chrismansley.com','Mountain View, CA',36,'<p>I am finishing my PhD in computer science, while I work as a research engineer in industry</p>\n',9,23,2,1084785,NULL),(43,101,'2012-10-23T19:49:52.433','Doug Blank',NULL,'2013-02-08T16:40:24.643','http://cs.brynmawr.edu/~dblank/','Bryn Mawr, PA USA 19010',54,'<p>Associate Professor of Computer Science, Bryn Mawr College</p>\n',0,0,0,73145,NULL),(44,1,'2012-10-23T19:50:48.563','cr2017',NULL,'2013-01-12T23:52:00.250',NULL,NULL,30,NULL,0,0,0,421928,'https://www.gravatar.com/avatar/94e5030245c3900ee372857fb4234d6c?s=128&d=identicon&r=PG&f=1'),(45,31,'2012-10-23T19:52:09.243','roboticsmeche',NULL,'2012-12-01T16:47:29.833',NULL,'Albuquerque, NM',30,'<p>I am a Mechanical Engineering grad student at the University of New Mexico in the field of robotics. I have many questions and some answers. </p>\n',0,1,0,1862567,NULL),(46,311,'2012-10-23T19:52:36.573','Njdart',NULL,'2012-12-