y Development for the Stack Exchange Network.</p>\n\n<p>I can be reached at<br>\n<b>&#114;&#99;&#97;&#114;&#116;&#97;&#105;&#110;&#111;&#64;&#115;&#116;&#97;&#99;&#107;&#101;&#120;&#99;&#104;&#97;&#110;&#103;&#101;&#46;&#99;&#111;&#109;</b></p>\n',1,9,4,34933,NULL),(54,191,'2012-10-23T20:02:53.960','Ian Danforth',NULL,'2017-04-23T05:43:40.437','http://fetchrobotics.com','Menlo Park, CA',37,'<p>Python and JavaScript programmer. Robotics enthusiast. Specific interests include simulation for machine learning, mechanoreceptors and proprioception in general.</p>\n',3,6,0,1935329,NULL),(55,11,'2012-10-23T20:07:58.760','surtur',NULL,'2014-06-10T19:50:02.977',NULL,'USA',NULL,NULL,0,1,0,75774,NULL),(56,363,'2012-10-23T20:08:32.370','sylvain.joyeux',NULL,'2017-04-03T00:33:03.607',NULL,NULL,37,NULL,8,2,1,364963,NULL),(57,1,'2012-10-23T20:12:11.457','nivensd',NULL,'2012-10-24T01:36:49.240','',NULL,27,'<p>A student interested in robotics, specifically humanoids.</p>\n',0,0,0,291898,NULL),(58,353,'2012-10-23T20:12:44.470','ViennaMike',NULL,'2016-12-02T22:56:37.113','http://McGurrin.com','Vienna, Virginia',61,'<p>I started my career developing software for the space shuttle mission simulator (in Fortran and a bit of assembler, no less), but these days I mostly manage projects and my coding is for fun (except for the occasional script to help at work).  Started playing around with robotics as a hobby around 2012 and most recently Ive gotten into machine learning. Ive got an occasional blog on my robotics and computer activities: <a href=\"http://mcgurrin.com/robots/\" rel=\"nofollow\">The Aspiring Roboticist</a>.</p>\n\n<p><a href=\"http://www.linkedin.com/pub/mike-mcgurrin-pmp/7/845/451\" rel=\"nofollow\">Professionally</a>, Im a consultant and senior level manager working in the area of applications of information technology to transportation systems (especially <a href=\"http://www.its.dot.gov\" rel=\"nofollow\">Intelligent Transportation Systems</a> and transportation operations. </p>\n\n<p>Specialties: applications of information and communications technology, program strategy, program management, technical management, federal government programs, intelligent transportation systems, modeling and simulation</p>\n',4,19,0,249679,NULL),(59,101,'2012-10-23T20:16:37.320','jonsca',NULL,'2014-09-09T19:52:08.947','','United States',NULL,'<p>I have been reading the site with great interest.  I regret that I havent had the time to really dig in and ask questions yet, but I will hopefully be doing so soon.</p>\n',2,64,1,325297,NULL),(60,190,'2012-10-23T20:18:59.870','IsaacS',NULL,'2017-06-19T14:42:33.507',NULL,'Sacramento, CA, United States',NULL,'<p>Robotics Software Engineer</p>\n',3,32,0,280968,NULL),(61,302,'2012-10-23T20:19:16.967','Nis',NULL,'2013-09-25T14:48:39.563','http://nis.sarup.dk/','Denmark',39,'<p>Studying to get my Master in Robotics at University of Southern Denmark.</p>\n',3,8,1,367215,NULL),(62,1,'2012-10-23T20:19:34.750','Mani M',NULL,'2014-03-16T04:55:40.110',NULL,NULL,NULL,NULL,0,0,0,1247230,NULL),(63,26,'2012-10-23T20:21:30.667','Jeff Records',NULL,'2012-11-09T05:08:03.687','http://olymega.org','Washington',35,'',0,0,0,1882367,NULL),(64,101,'2012-10-23T20:26:52.643','mike',NULL,'2017-02-06T19:56:28.413',NULL,'Laguna Niguel, CA',NULL,'<p>Interested in making stuff, physical computing, motion control, robots, juggling... Oh, and javascript &amp; node.js!</p>\n',0,1,0,292355,NULL),(65,2041,'2012-10-23T20:30:14.583','user65',NULL,'2013-12-10T06:13:50.693',NULL,NULL,NULL,NULL,9,10,1,1252101,NULL),(66,101,'2012-10-23T20:33:32.957','Aritz Lopez',NULL,'2013-09-10T13:52:24.837',NULL,'Spain',21,'<p>Computer engineering student who loves to code on his free time.</p>\n\n<p>I specially love Java, for its simplicity and standard library, although I have become\nvery used to C through my degree.</p>\n',1,1,0,1783687,NULL),(67,116,'2012-10-23T20:36:04.903','Rory Alsop',NULL,'2017-01-11T11:36:27.800',NULL,'Scotland, United Kingdom',46,'<p>Information Security, Risk and Governance Specialist.</p>\n\n<p>Heavily involved in information security and risk solutions for the last 16 years in the UK, US and throughout Europe. </p>\n\n<ul>\n<li>Scottish Chairman of the <a href=\"http://www.instisp.org\" rel=\"nofollow noreferrer\">Institute of Information Security Professionals</a></li>\n<li>President of <a href=\"http://www.isaca.org\" rel=\"nofollow noreferrer\">ISACA Scotland</a></li>\n<li>Full Member of the IISP (M.Inst.ISP)</li>\n<li>Security mentor and evangelist</li>\n<li>Moderator of the Security and Personal Productivity Stack Exchange sites and Administrator for the <a href=\"http://security.blogoverflow.com/\" rel=\"nofollow noreferrer\">Security Stack Exchange Blog</a></li>\n<li>Contributor to the Open Web Application Security Project (OWASP)</li>\n<li>Certified Information Security Manager (CISM)</li>\n<li><p>Certified Information Systems Security Professional (CISSP)</p></li>\n<li><p>was a member of the Standards and Operations Committees for the <a href=\"http://crest-approved.org\" rel=\"nofollow noreferrer\">Council of Registered Ethical Security Testers (CREST)</a> for 2 years, and a CLAS Consultant for 2 years.</p></li>\n</ul>\n\n<p>Extensive experience in Enterprise Risk and Security, from a deep technical grounding in application, network and platform security, as well as over 10 years working with global banking clients helping them identify, evaluate and mitigate information risks from a business and governance perspective.</p>\n\n<p>Key roles in integration programmes, aligning security policies and business risk appetites across divisions in order to provide pragmatic security solutions.</p>\n\n<p>Has created the security development pathways and managed large scale security programmes, including global attack &amp; penetration engagements, privacy and security assessments, incident response and fraud and forensic investigations.</p>\n\n<p>Core clients have included global and UK banks, government departments as well as organisations in the Energy, Telecomms and other markets.</p>\n\n<p>Acts as a mentor and coach for numerous security professionals in Scotland, providing career guidance as well as promoting a passion for the industry.</p>\n\n<p>Provides subject matter experience at both strategic and technical levels, defining, reviewing and assessing enterprise level information security strategy, policies and standards for clients, incorporating the ISO 27000 series, COBIT, ITIL and other industry recognised baselines.</p>\n\n<p>Presented at the inaugural <a href=\"http://www.ecrimescotland.org.uk/\" rel=\"nofollow noreferrer\">e-Crime Scotland Summit</a> and presents regularly on aspects of Information Security at various events in the UK, especially on the business implications of security issues.</p>\n\n<p>Published in the Financial Times and other journals.</p>\n',0,7,0,251740,'https://i.stack.imgur.com/XDBbz.png'),(68,131,'2012-10-23T20:36:22.753','lyncas',NULL,'2016-09-23T15:04:42.117','http://alynch.org',NULL,33,NULL,0,15,0,412870,NULL),(69,51,'2012-10-23T20:37:30.163','johnmcd',NULL,'2017-06-12T14:36:12.773',NULL,NULL,NULL,NULL,0,0,0,425317,NULL),(70,101,'2012-10-23T20:38:03.607','dario111cro',NULL,'2014-12-20T09:46:01.490',NULL,NULL,NULL,NULL,1,0,0,1297652,NULL),(71,101,'2012-10-23T20:46:33.130','George Sapkin',NULL,'2015-10-06T21:25:04.933',NULL,'Netherlands',NULL,NULL,0,0,0,103960,'https://i.stack.imgur.com/QYb5Z.jpg?s=128&g=1'),(72,101,'2012-10-23T20:53:33.827','Zak Kus',NULL,'2012-10-23T20:53:33.827',NULL,'San Francisco',NULL,'<p>Front end engineer and 3D printing enthusiast.</p>\n',0,0,0,232790,NULL),(73,437,'2012-10-23T21:01:26.947','Felix',NULL,'2017-07-21T18:55:05.930',NULL,NULL,NULL,NULL,2,9,0,93953,NULL),(74,640,'2012-10-23T21:04:41.673','berry120',NULL,'2017-04-22T16:30:31.460','http://berry120.blogspot.com','United Kingdom',28,'<p>Im an avid programmer, enjoy creating things, enjoy a good puzzle and especially enjoy foxing p