</p>\n\n<hr>\n\n<p>I am a generalist, currently working at Eidos Montreal on game engines. Previously, I was a Roboticist working on embedded and realtime systems.</p>\n\n<p>I got my PhD working on robotic skins, both their firmware and their real-time driver/software. My bachelors has been in Software Engineering with a personal focus on algorithms.</p>\n\n<p>Feel free to check out my <a href=\"https://github.com/ShabbyX\" rel=\"nofollow noreferrer\">github</a> account for some goodies, like tutorials on Vulkan, data structures in C, C bindings for pandoc and more!</p>\n',69,188,23,543107,NULL),(159,1,'2012-10-25T09:39:50.430','Emanuele Baglini',NULL,'2014-01-03T00:11:11.470',NULL,NULL,NULL,NULL,0,0,0,1851734,NULL),(160,1,'2012-10-25T10:17:46.783','FDC',NULL,'2012-11-29T12:40:41.543',NULL,'Belgium',35,NULL,2,0,0,321310,NULL),(161,121,'2012-10-25T11:03:33.873','Tully',NULL,'2017-06-21T00:57:43.093',NULL,NULL,NULL,NULL,1,5,0,298201,NULL),(162,1,'2012-10-25T16:41:28.347','RabtFt',NULL,'2012-10-25T17:15:32.153',NULL,'South Africa',23,'<p>public static void\n{</p>\n\n<p>Im just this guy you know...</p>\n\n<p>}</p>\n',0,0,0,1669372,NULL),(163,3960,'2012-10-25T16:58:01.187','Josh Vander Hook',NULL,'2017-08-26T08:24:01.827','http://josh.vanderhook.info','Minneapolis, MN',NULL,'<p>I currently work at the NASA Jet Propulsion Lab in Pasadena California.  Though my posts are my own personal communication and do not represent NASA, Caltech or the US Gov in any way.</p>\n\n<p>My interests are in decision, tracking, and estimation problems, especially exploiting the mobility of the robot to improve estimates. I also study Pursuit Evasion games under sensing uncertainty and the use of robots in environmental monitoring tasks such as precision agriculture.</p>\n\n<p>In my free time I love boxing, camping, sailing, and travelling around.</p>\n',110,196,25,165844,'https://i.stack.imgur.com/0cprk.jpg'),(164,85,'2012-10-25T17:17:35.350','zSt',NULL,'2017-06-27T19:18:13.890','',NULL,NULL,'',0,0,0,955885,NULL),(165,1,'2012-10-25T18:04:42.753','Tekin Meri li',NULL,'2015-08-10T15:04:00.867','http://tekin.mericli.com',NULL,35,'<p>Currently I am a Senior Robotics Engineer at the National Robotics Engineering Center (NREC) of the Robotics Institute at Carnegie Mellon University. Prior to that, I was a Postdoctoral Fellow at the Human-Computer Interaction Institute at Carnegie Mellon University. I had been leading the efforts on building intuitive and expressive interfaces to interact with semi-autonomous robotic systems that are intended to assist elderly and disabled.</p>\n\n<p>Before joining the Human-Computer Interaction Institute, I was a Postdoctoral Fellow at the Robotics Institute at Carnegie Mellon University. My primary affiliation was with the National Robotics Engineering Center (NREC) as a member of the Tartan Rescue Team working on the CHIMP robot for the DARPA Robotics Challenge. I was also affiliated with the Personal Robotics Lab, leading the Assistive Dexterous Arm (ADA) project in the assistive robotics domain.</p>\n\n<p>I received my Ph.D. from the Department of Computer Engineering at Bo azi i University, Istanbul, Turkey in 2014. My thesis work contributed a case-based mobile manipulation framework. I was supervised by Prof. H. Levent Akin from Bo azi i University and Prof. Manuela Veloso from Carnegie Mellon University.</p>\n\n<p>I got my MSCS degree from the Department of Computer Sciences at The University of Texas at Austin, and my BS degree from the Department of Computer Engineering at Marmara University, Turkey. During the period July 2011 - January 2012, I was a visiting scholar in the Computer Science Department at Carnegie Mellon University, working under the supervision of Prof. Manuela Veloso as a member of the CORAL research group.</p>\n\n<p>Ive been an active member of the RoboCup society since 2004 and in particular I contributed to research and development pursued within Cerberus (team captain in 2009 and 2010) and UT Austin Villa RoboCup Standard Platform League robot soccer teams. Ive also been a member of the technical and organizing committees of several RoboCup events since 2008. I was also one of the co-chairs of the RoboCup 2011 Istanbul event. I also have experience in developing autonomous vehicles. I was a member of the UT - Austin Robot Technology DARPA Urban Challenge team, and Team Cappadocia, which got the 4th place in the MAGIC 2010 competition.</p>\n\n<p>For more information on my projects and publications, please visit my website at <a href=\"http://tekin.mericli.com\" rel=\"nofollow\">http://tekin.mericli.com</a></p>\n',0,0,0,1042616,NULL),(166,188,'2012-10-25T20:31:19.370','hAcKnRoCk',NULL,'2016-12-18T14:05:04.257',NULL,NULL,NULL,'<p>An aspiring programmer and a budding researcher :-)</p>\n',1,2,0,282660,'https://www.gravatar.com/avatar/43a616b52b616fe00a44b54abfa5d02c?s=128&d=identicon&r=PG&f=1'),(167,472,'2012-10-25T20:44:09.830','kaliatech',NULL,'2017-08-23T19:30:37.407','http://www.jgstechnical.com',NULL,NULL,'<p>A major interest in building things. And learning. And applying what Ive learned to what Im building. And finding time to do more of all three.</p>\n',1,65,0,42361,NULL),(168,138,'2012-10-26T00:13:51.283','DogEatDog',NULL,'2013-01-10T19:34:39.017','http://www.kickinespresso.com','New Jersey',NULL,'<p>Lots of information that i dont want to provide</p>\n',0,4,0,360892,NULL),(169,1,'2012-10-26T17:26:25.103','osmaneralp',NULL,'2013-11-12T05:21:03.013',NULL,NULL,NULL,NULL,0,0,0,410375,NULL),(171,101,'2012-10-27T03:08:45.103','Daniel Vogelnest',NULL,'2012-11-08T01:32:23.703','http://daniel-vogelnest.tk','Lismore, New South Wales, Australia',27,'<h1>Daniel Vogelnest</h1>\n\n<hr>\n\n<p>Inspired to design and develop innovative solutions.</p>\n',0,3,0,1538007,NULL),(172,1,'2012-10-27T03:10:21.563','Alan Williams',NULL,'2012-10-28T01:27:45.420',NULL,'Tallahassee, FL, United States',NULL,'<p>By day: student, programmer</p>\n\n<p>By night: biologist, activist, researcher</p>\n',0,2,0,291972,NULL),(173,1,'2012-10-27T03:13:29.373','user173',NULL,'2012-10-27T03:13:29.373',NULL,NULL,NULL,NULL,0,0,0,1748898,NULL),(174,101,'2012-10-27T03:19:29.740','Chris Edwards',NULL,'2012-10-27T03:19:29.740','http://chrisedwards.dreamhosters.com/','Austin, TX',NULL,'<p>My name is Chris Edwards and I am a software developer with 15 years of professional experience writing software, plus many more prior to that as a hobbyist. I love software design and development. I consider myself blessed to love what I do for a living.</p>\r\n\r\n<p>I am married to the woman of my dreams (Niki), and we have two sons: Hayden (6) and Parker (2). I truly don t deserve the family God has given me, and I am thankful for them.</p>\r\n\r\n<p>When I was a kid, I saw the movie  Wargames  with Matthew Broderick. I was fascinated by computers and made up my mind then and there that I wanted to be a programmer. So, here I am, doing what I love.</p>\r\n\r\n<p>I also serve as an elder at Hill Country Bible Church, Hutto. My life was radically changed in 2004 when I really came to know who Jesus Christ was, and I understood how God sent him to die in my place, to pay for my sins, so that I would not have to pay for them myself. I accepted Christ s payment for my sins, and my life is forever changed. I can t help but serve God in any way I can out of gladness and thankfulness for how good of a God He is.</p>',0,0,0,535271,NULL),(175,1,'2012-10-27T03:21:56.820','Surya2089',NULL,'2013-03-11T13:57:01.647','http://www.asprl.com','India',28,'<p>I am a programmer</p>\n',0,0,0,1581770,'https://i.stack.imgur.com/IAzuk.jpg?s=128&g=1'),(176,562,'2012-10-27T03:30:36.690','Chris',NULL,'2014-08-04T16:08:30.067','http://stringtheorysoftware.com','Denver, CO',NULL,NULL,5,29,2,91770,NULL),(177,3321,'2012-10-27T03:32:21.820','DaemonMaker',NULL,'2017-03-23T19:31:56.960','http://www.cs.utah.edu/~dustin','University of Utah, UT',40,'<p>I am graduate student at the University of Utah though I am currently visiting Universit  de Montr al under the supervision of Dr. Yoshua Bengio. My focus is on the application of machine learning to robotics. Namely techniques like Deep Learning and Reinforcement Learning. My wife, Darliegh Webb, and I have been together over a decade and we have two children, a son and a daughter.</p>\n',54,612,17,1613333,NULL),(178,1,'2012-10-27T03:32:25.113','yasser',NULL,'2012-10-27T03:32:25.113','http://www.ii.ist.i.kyoto-u.ac.jp/~yasser','Egypt',41,NULL,0,0,0,1775095,NULL),(179,101,'2012-10-27T03:57:08.047','Oztaco',NULL,'2013-12-21T17:21:57.157','http://www.efehq.com','United States',20,'<p>19 year old programmer, been programming for ~7 years. I like desktop programming most but Ive recently been focusing on HTML5 apps. Check out my website to see some of my work</p>\n',0,0,0,1274295,'https://i.stack.imgur.com/cLMGg.jpg?s=128&g=1'),(180,101,'2012-10-27T04:08:21.643','zklapow',NULL,'2013-04-06T14:47:05.603','http://zklapow.com',NULL,NULL,NULL,0,0,0,72343,NULL),(181,954,'2012-10-27T04:16:09.700','Robz',NULL,'2017-02-04T07:34:35.033',NULL,'Austin, TX',26,'<p>If I had money to waste, Id waste it on art.</p>\n',9,43,0,140473,NULL),(182,1,'2012-10-27T04:53:42.837','user182',NULL,'2012-11-07T19:57:25.843',NULL,NULL,NULL,NULL,0,2,0,1926044,NULL),(183,101,'2012-10-27T04:56:45.163','Mihai Iorga',NULL,'2013-12-16T07:01:21.950','http://mihai.iorga.eu','Bucharest, Romania',33,'<p>Simple guy in a complicated world. I love PHP.</p>\n\n<p>Check my <a href=\"http://careers.stackoverflow.com/mihai-iorga\">CV</a> on Careers.</p>\n',0,0,0,70661,'https://i.stack.imgur.com/tPN8z.jpg?s=128&g=1'),(184,2621,'2012-10-27T07:27:05.007','hauptmech',NULL,'2017-07-25T20:41:49.637','','New Zealand',NULL,'<p>Ive been designing and deploying hardware and software in a professional capacity for robotics research since 2002.</p>\n',31,55,9,380404,'https://i.stack.imgur.com/s5KLN.png?s=128&g=1'),(185,101,'2012-10-27T08:30:01.210','Justin808',NULL,'2012-10-27T08:3