ULL,NULL,NULL,NULL,0,0,0,457023,NULL),(193,101,'2012-10-27T18:24:25.913','Everett',NULL,'2014-11-25T22:33:21.827','http://www.linkedin.com/profile/view?id=36266251&trk=tab_pro','Denver, CO',43,'<p>First used an Atari when I was 4 years old.  At age 7 I learned to program in turtle Logo on a Commodore 64.  When I was 11 I learned BASIC on the Apple II family.  At 12 I carried that over to the IBM PC.  At 18 I was trained to do Radio Repair in the Army, and at 20 I worked for AOL.</p>\n\n<p>17 years later I have taught A+, Network+, held a JNCIA in routing, a JNCIS in Security, and currently hold Security+, CEH, CISSP, CCNA, CCNA Sec, and CCNP Sec certifications.</p>\n\n<p>Im also an avid amateur radio operator (WN7ANT).  73</p>\n',0,3,0,242865,NULL),(194,101,'2012-10-27T23:01:34.890','Vivek Gani',NULL,'2013-08-18T23:28:08.853','http://vivekgani.com',NULL,NULL,'<p>More info at vivekgani.com</p>\n',0,0,0,121585,NULL),(195,1,'2012-10-27T23:05:05.853','Stewart Leicester',NULL,'2013-01-27T02:41:24.283',NULL,NULL,NULL,NULL,0,0,0,1899454,NULL),(196,101,'2012-10-27T23:47:49.313','Joel',NULL,'2013-07-04T03:57:08.063','http://joelhoskin.co.uk','UK',24,NULL,0,0,0,376154,NULL),(197,33,'2012-10-28T01:18:40.857','Giovanni Saponaro',NULL,'2017-03-27T18:07:42.730',NULL,NULL,NULL,NULL,2,14,0,1751583,'https://i.stack.imgur.com/c7YqK.jpg'),(198,101,'2012-10-28T08:43:00.810','Brandon Fosdick',NULL,'2012-10-28T08:43:00.810','http://bfoz.net','Santa Clara, CA',40,NULL,0,0,0,19196,NULL),(199,101,'2012-10-28T18:33:03.567','enobayram',NULL,'2013-01-29T05:05:45.183','http://www.mategames.com','Ankara, Turkey',34,'<p>Programmers who trade abstraction for minor conveniences deserve neither and will lose both.</p>\n\n<h1>SOreadytohelp</h1>\n',0,6,0,1113824,NULL),(200,101,'2012-10-28T19:16:16.783','Reto Aebersold',NULL,'2012-11-07T19:42:34.323','http://substyle.ch/','Le n, Nicaragua',36,'<p><img src=\"https://www.atizo.com/docs/aeby/tags.png\"></p>\n',1,0,0,107789,NULL),(201,188,'2012-10-28T20:43:14.323','ApockofFork',NULL,'2015-01-09T19:06:35.647','',NULL,30,'',0,13,0,974006,NULL),(202,1,'2012-10-29T02:06:41.093','Younghun Ju',NULL,'2013-02-06T05:15:23.963',NULL,NULL,NULL,NULL,0,0,0,1749253,NULL),(203,1,'2012-10-29T07:46:47.800','DrAuguste',NULL,'2012-10-29T07:46:47.800','http://www.medizintechnik-fraunhofer.de/','Germany',NULL,'<p>Im a researcher at the Fraunhofer Institute for Process Automation. Naturally this involves robot systems and my group develops robot solutions for medical interventions and diagnostics. My background in mechanical engineering and my doctorate research focussed on control systems. In my line of work I get to model the robot system, develop a control algorithm, and program a microcontroller to do the job.</p>\n',0,0,0,1765080,NULL),(204,101,'2012-10-29T08:32:50.683','Ragunath Jawahar',NULL,'2012-11-08T03:01:26.643',NULL,'India',30,'<p><strong>Avid Android Developer and Entrepreneur</strong>\n<br/>Ive been working on Android since August 2010.</p>\n\n<p><strong>Latest Android Application</strong>\n<br/> <a href=\"https://play.google.com/store/apps/details?id=com.mobsandgeeks.ape\" rel=\"nofollow\">A Photo Editor</a> - APE is A Photo Editor, its amazingly simple to use. Now available on Google Play!</p>\n\n<p><strong>Android Open Source Projects</strong>\n<br/>  <a href=\"https://github.com/ragunathjawahar/android-saripaar\" rel=\"nofollow\">Android Saripaar</a> - The SIMPLEST annotation powered rule-based UI validation library for Android.</p>\n\n<p><br/>  <a href=\"https://github.com/mobsandgeeks/adapter-kit\" rel=\"nofollow\">Adapter Kit</a> - Set of predefined adapters to make life easier.</p>\n\n<p><br/>  <a href=\"https://github.com/ragunathjawahar/instant-adapter\" rel=\"nofollow\">Instant Adapter</a> - Create your Custom Adapters almost instantly.</p>\n\n<p><br/>  <a href=\"https://github.com/ragunathjawahar/simple-section-adapter\" rel=\"nofollow\">Simple Section Adapter</a> - This is the SIMPLEST section adapter available for Androids ListView as on date.</p>\n\n<p><br/>  <a href=\"https://github.com/ragunathjawahar/circular-list-adapter\" rel=\"nofollow\">Circular List Adapter</a> - Circular List Adapter for Androids ListView. Make your list appear infinite with a single argument constructor.</p>\n\n<p><br/>  <a href=\"https://github.com/ragunathjawahar/deselectable-radio-button\" rel=\"nofollow\">Deselectable Radio Button</a> for Android.</p>\n',0,0,0,184962,NULL),(205,1,'2012-10-29T09:38:30.193','Jake',NULL,'2012-11-08T15:14:00.427','http://www.iit.it/en/advanced-robotics/hyq.html','Italy',36,'<p>I have been working in Robotics since I graduated from university. For 6 years I worked at The Shadow Robot Company in London and was involved in all aspects of the design work from Programming, electronics and mechanical design. I truly believe that the successful development any part of a robotic systems requires a thorough overview of all these elements. In recent years I have begun to specialise in the mechanical design aspect. For the last year and a half I have been working in the Advanced Robotics Lab at the IIT (www.IIT.it) in Italy. My current project is to redesign their hydraulic quadruped robot (HyQ) from the ground up.   </p>\n',0,0,0,1744796,NULL),(206,101,'2012-10-29T11:47:02.373','Sumit Singh',NULL,'2013-12-16T05:35:31.923','http://www.sumitsingh.in','Bangalore, India',27,'<p>Currently a software engineer at <strong><a href=\"http://www.infineon.com/\" rel=\"nofollow\">Infineon Technologies</a></strong>, India.<br>\nIm specialized in Java and eclipse plugin development.<br>\nI like Ubuntu, open source philosophy, knowledge sharing, finding innovative solutions, continuous improvement.</p>\n\n<p>I tweet <a href=\"https://twitter.com/su__mit\" rel=\"nofollow\">here</a>, blog <a href=\"http://javaandeclipse.blogger.com\" rel=\"nofollow\">here</a>, and <a href=\"https://in.linkedin.com/in/sumitprofile\" rel=\"nofollow\">Linkedin Profile</a>.</p>\n\n<p>Thanks for visiting my Profile.</p>\n\n<h1>SOreadytohelp</h1>\n',0,0,0,907854,'https://i.stack.imgur.com/GRoza.jpg?s=128&g=1'),(207,1,'2012-10-29T14:00:21.977','Serge Stinckwich',NULL,'2013-07-28T16:17:38.927','http://doesnotunderstand.org','France',NULL,'',0,1,0,1487896,NULL),(208,176,'2012-10-29T15:16:28.513','Great Turtle',NULL,'2015-10-15T13:16:18.900','http://projecteuler.net/','Michigan',42,'I love to tackle interesting problems. Primarily related to scaling and mobile data collection and synchronization.  \r\n\r\nLately Ive been working with gps, serial, USB mapping stuff using python or c#.  Lots of amazon ec2 and s3 projects too. \r\n\r\nPicked up django in august. Looking at changing it into something like ms access perhaps. \r\n\r\n',0,0,0,33316,NULL),(209,1,'2012-10-30T03:49:38.877','Vaibhav Ghadiok ',NULL,'2012-11-07T20:55:01.177',NULL,NULL,NULL,NULL,0,0,0,1811695,NULL),(210,1,'2012-10-30T07:04:22.270','user210',NULL,'2012-10-30T07:04:22.270',NULL,NULL,NULL,NULL,0,0,0,1752777,NULL),(211,101,'2012-10-30T13:15:04.740','Kortuk',NULL,'2014-03-05T21:01:17.983',NULL,'Oklahoma',31,'<p>  Community moderator on <a href=\"http://electronics.stackexchange.com/\">Electrical Engineering</a>.\n<br/>\n<br/>\nI have three years of experience at a small start-up company which I would not suggest to everyone, but for those willing to teach themselves, it is an excellent opportunity.\n<br/>\n<br/>\nI do not speak on behalf of my company, all views I express are my own.</p>\n',0,10,0,145149,NULL),(212,1,'2012-10-31T16:47:42.020','Juxi',NULL,'2012-10-31T16:47:42.020','http://Juxi.net',NULL,NULL,NULL,0,0,0,324155,NULL),(213,101,'2012-10-31T20:24:40.190','Sednus',NULL,'2013-02-23T17:17:01.947','http://pr.linkedin.com/pub/wilberto-lopez/23/7b7/b6','Melbourne, FL',28,'<p>I am a Computer Engineer graduate.  Currently working as a Software Engineer. My main programming experience is working with Java.</p>\n',0,1,0,317594,NULL),(214,101,'2012-10-31T23:12:48.073','tyjkenn',NULL,'2013-01-13T21:09:16.680','