https://i.stack.imgur.com/9sSD3.jpg'),(220,1,'2012-11-06T16:10:09.090','Josh Caputo',NULL,'2012-11-06T16:53:19.007',NULL,NULL,NULL,NULL,0,0,0,1811644,NULL),(221,101,'2012-11-06T22:53:19.550','Bill the Lizard',NULL,'2013-10-21T12:46:36.257','http://www.BillTheLizard.com','Charlotte, NC',43,'<p><strong>Java</strong>, <strong>Android</strong>, <strong>Python</strong>, etc. developer living in Charlotte, NC.<br/></p>\n\n<p><strong>My Android apps on Google Play:</strong></p>\n\n<ul>\n<li><a href=\"https://play.google.com/store/apps/details?id=com.billthelizard.threeofakind&amp;hl=en\" rel=\"nofollow noreferrer\"><strong>Three of a Kind</strong></a> - A fun, fast-paced strategy card game. Match any three symbols to win.</li>\n<li><a href=\"https://play.google.com/store/apps/details?id=com.billthelizard.sketchboard&amp;hl=en\" rel=\"nofollow noreferrer\"><strong>Sketchboard</strong></a> - Sketch drawings on your mobile device.</li>\n<li><a href=\"https://play.google.com/store/apps/details?id=com.billthelizard.serpent&amp;hl=en\" rel=\"nofollow noreferrer\"><strong>Serpent</strong></a> - An Android version of the classic mobile game Snake.</li>\n<li><a href=\"https://play.google.com/store/apps/details?id=com.billthelizard.mathblitz&amp;hl=en\" rel=\"nofollow noreferrer\"><strong>Math Blitz!</strong></a> - A fast-paced flashcard game to help students practice their arithmetic skills.</li>\n<li><a href=\"https://play.google.com/store/apps/details?id=com.billthelizard.linearinterpolator&amp;hl=en\" rel=\"nofollow noreferrer\"><strong>Linear Interpolator</strong></a> - Fill in the gaps in your data using linear interpolation.</li>\n<li><a href=\"https://play.google.com/store/apps/details?id=com.billthelizard.kitchencalculator&amp;hl=en\" rel=\"nofollow noreferrer\"><strong>Kitchen Calculator</strong></a> - A simple unit converter for common units used in cooking and homebrewing.</li>\n</ul>\n\n<p>If you use any of these apps, please leave me a rating and any feedback for improvement.</p>\n\n<p>I also wrote <a href=\"https://twitter.com/BountyBot\" rel=\"nofollow noreferrer\"><strong>@BountyBot</strong></a>, a Twitter bot that posts new and interesting bounty questions from Stack Overflow. You can <a href=\"https://github.com/BillCruise/BountyBot\" rel=\"nofollow noreferrer\">view the source on GitHub</a>.</p>\n',0,2,0,970,NULL),(222,36,'2012-11-07T00:50:29.780','schinoy',NULL,'2013-01-09T00:25:50.030','http://www.cse.iitb.ac.in/~schinoy','Tokyo, Japan',28,'<ul>\n<li>Computer Science and Engineering  graduate</li>\n<li>Working as a Software Engineer (Home Networking/Automation solutions for Audio devices)</li>\n<li>Robotics Enthusiast</li>\n<li>DIY Enthusiast (Electronics, home fabrication)</li>\n</ul>\n',0,1,0,1312158,NULL),(223,244,'2012-11-07T02:13:44.837','Theran',NULL,'2013-12-17T17:02:13.830',NULL,'Tucson, AZ',35,NULL,3,2,0,17789,NULL),(225,101,'2012-11-07T03:52:48.313','icarus74',NULL,'2013-07-02T03:49:04.690',NULL,NULL,NULL,NULL,0,3,0,177733,NULL),(226,101,'2012-11-07T03:53:26.387','Arpith',NULL,'2012-11-07T03:53:26.387','http://www.cisco.com','Bangalore, India',28,'<p>Software Developer with Cisco Systems, Inc.\nPreviously, Software Developer with Frog Design, Inc.</p>\n',0,0,0,1147692,NULL),(227,101,'2012-11-07T04:34:11.983','kenny',NULL,'2012-11-07T04:34:11.983','http://twitter.com/kenny','Madison, WI',NULL,NULL,0,0,0,338779,NULL),(228,1,'2012-11-07T08:00:03.240','Ioannis G. Kontolatis',NULL,'2012-11-07T21:23:25.487','http://users.ntua.gr/ikontol/','Greece',37,'',0,0,0,1765623,NULL),(229,31,'2012-11-07T08:06:17.063','geez',NULL,'2013-02-26T14:52:22.793',NULL,NULL,NULL,NULL,0,0,0,1337761,NULL),(230,101,'2012-11-07T09:19:30.930','Jim Fred',NULL,'2017-03-30T00:27:03.997',NULL,'Temecula, CA',58,'<p>Embedded programmer, Electrical Engineer, Videographer</p>\n',0,0,0,35715,NULL),(231,101,'2012-11-07T09:38:31.713','Till B',NULL,'2017-07-13T10:44:42.570',NULL,NULL,NULL,NULL,0,7,0,282002,NULL),(232,101,'2012-11-07T10:08:09.760','Excitin