=\"https://brave.com\" rel=\"nofollow noreferrer\">Brave Software</a>.</p>\n\n<p>Im a huge advocate of community, and open-source software. I had the great honor of being a community moderator on Stack Overflow from <a href=\"http://blog.stackoverflow.com/2010/02/stack-overflow-2010-moderator-election-results/\">February 2010</a> to <a href=\"http://meta.stackexchange.com/questions/171547/spring-2013-stack-overflow-community-moderator-election-results\">March 2013</a>. Additionally, I try to give back when and where I can through <a href=\"http://github.com/jonathansampson\" rel=\"nofollow noreferrer\">GitHub</a>.</p>\n\n<p>I recently did walkthroughs on the HTML, and CSS2.1 Specifications. These can be found online at <a href=\"http://youtube.com/jjdsampson\" rel=\"nofollow noreferrer\">http://youtube.com/jjdsampson</a>. Id like to kick off more regular hangouts discussing JavaScript, JavaScript frameworks, and modern CSS.</p>\n\n<p>Im also available to help with open-web issues and cross-browser compatibility. Feel free to reach out to me on <a href=\"https://twitter.com/jonathansampson\" rel=\"nofollow noreferrer\">twitter</a>, and Ill gladly assist to the best of my ability.</p>\n',2,8,0,22243,NULL),(251,101,'2012-11-07T19:24:57.697','mjcopple',NULL,'2016-02-01T18:10:54.620','http://stackoverflow.com/users/279999/mjcopple','Texas',30,'<h1>SOreadytohelp</h1>\n',0,2,0,104801,NULL),(252,101,'2012-11-07T19:25:09.630','David',NULL,'2012-11-07T19:25:09.630','https://plus.google.com/112955041989864870898/posts','Maryland',45,'<p>Im a software engineer and system administrator at the University of Maryland.</p>\n',0,0,0,4779,NULL),(253,101,'2012-11-07T19:25:44.787','slf',NULL,'2015-01-23T17:13:13.473','http://imgur.com/a/RP3OK','United States',37,'<p>\"When the going gets tough, the tough get empirical\"</p>\n\n<p>-- Jon Carroll</p>\n',0,0,0,7607,NULL),(254,1,'2012-11-07T19:26:35.170','mvr',NULL,'2012-11-08T14:38:25.230',NULL,NULL,NULL,NULL,0,0,0,262018,NULL),(255,101,'2012-11-07T19:26:47.007','Dan',NULL,'2012-11-07T19:26:47.007',NULL,NULL,NULL,'<p>I used to do systems programming when the code was in Pascal and Assembly, on a Mac...  Anyone remember what Apples Book 1 was?  Okay that dates me.  Oh yeah, learned that upstart language, C.\nNowadays, since \"programmer\" became \"Oh, you can make me a website, then?\"\nI have taken on a few extra languages, Python (still my fav scripting lang), Perl, Java, and the obligatory web \"languages\" HTML/CSS/JavaScript also, server-side PHP and C#, latest is F# (very fun).\nCoding is fun, period.  When it pays the bills, it is a blast!  :)</p>\n',0,0,0,172871,NULL),(256,1,'2012-11-07T19:28:30.447','Chini',NULL,'2012-11-07T19:28:30.447',NULL,NULL,NULL,NULL,0,0,0,403020,NULL),(257,1,'2012-11-07T19:30:24.767','Aaron Kalair',NULL,'2012-11-07T19:30:24.767',NULL,NULL,NULL,NULL,0,0,0,457466,NULL),(258,1,'2012-11-07T19:30:44.690','user258',NULL,'2012-11-08T08:36:00.777',NULL,NULL,NULL,NULL,0,0,0,1745198,NULL),(259,101,'2012-11-07T19:30:57.653','nabeelmukhtar',NULL,'2013-09-09T06:38:51.207',NULL,NULL,NULL,NULL,0,0,0,180751,NULL),(260,1,'2012-11-07T19:34:15.327','iano',NULL,'2013-03-11T03:45:51.143',NULL,NULL,NULL,NULL,0,0,0,1752308,NULL),(261,101,'2012-11-07T19:34:45.327','Jon Schoning',NULL,'2012-11-07T19:34:45.327','http://www.twitter.com/jonschoning','Chicago, IL',36,'<p>@jonschoning</p>\n',0,0,0,59109,NULL),(262,101,'2012-11-07T19:34:55.330','frank hadder',NULL,'2012-11-07T19:34:55.330','http://frankhadder.com','Seattle, WA',34,'<p>Front end developer/prototyper</p>\n\n<p>Interested in css3, html5, javascript and jquery, node.js, mongodb, and whatever new fad comes along.</p>\n\n<p>#SOreadytohelp</p>\n',0,1,0,2592,NULL),(263,101,'2012-11-07T19:35:09.833','skelly',NULL,'2012-11-07T19:35:09.833','http://log.samuelkelly.net','Tijuana, Mexico',31,NULL,0,0,0,401833,NULL),(264,101,'2012-11-07T19:36:13.717','Some Guy',NULL,'2016-01-13T14:08:20.307','http://whatthedude.com','Mumbai, India',NULL,'<p>Int