'Europe, somewhere',NULL,'<p>I dont have a robot.</p>\n\n<p><p> </p><p> </p><p> </p><p> </p><p> </p></p>\n\n<p>Kryten doesnt count.</p>\n',1,1,0,1002072,NULL),(389,101,'2012-11-09T19:18:11.010','Oleksiy',NULL,'2012-11-09T19:18:11.010',NULL,NULL,NULL,NULL,0,0,0,93320,NULL),(390,104,'2012-11-09T20:19:38.740','Alex Stone',NULL,'2012-11-10T19:25:43.970','http://www.luciddreamingapp.com','Ko Pha-ngan Surat Thani Thailand',31,'<p><strong>Im currently looking for part time remote work - iOS development and related technologies.</strong></p>\n\n<p>===</p>\n\n<p>When people asked me what I wanted to do for work 10 years ago, I did not know too well, so I just said <strong>\"Something to do with computers\"</strong>.</p>\n\n<p>As I look at the last 10 years, I see that I did quite a lot of work all kinds of computers. From fiddling with microcontrollers and assembler code to writing data processing scripts to physically assembling computer consoles.</p>\n\n<p>The big step forward came when I <strong>learned to think about software in a structured, object-oriented way</strong>, as this allowed me to make software do things that I want it to do. Right now Im <strong>proficient in two high level programming languages</strong> - Objective-C and Java and have touched just about every framework available for iOS. Ive also became a hacker/maker and have completed a number of projects involving software and hardware.</p>\n\n<p>Right now Im in my early 30s and when I ask myself <strong>\"What would I like to do in the next 10 years?\"</strong>, my answer is \"something with the human brain\". The seeds are already there - Ive picked up an interest in biology, cognitive science and neuroscience, enough to converse with real people. Ive done first-hand research into sleep and made discoveries. Ive taken classes in synthetic biology, performing manipulations on the bacteria genome. Ive learned a lot about the neurotransmitter systems of the human brain, as well as how a biological organism develops.</p>\n\n<p>It seems like there are a lot of similarities between the object-oriented concepts I use in the daily programming tasks and how biological organisms operate. This makes me hopeful that by the time Im in my late 30s, I would be able to work and program some form of biological computer or just plain hack the human brain.</p>\n',0,1,0,939070,'https://i.stack.imgur.com/nBS9m.jpg'),(391,101,'2012-11-09T22:46:08.190','sabbir',NULL,'2012-11-24T21:47:49.220',NULL,'Dhaka, Bangladesh',NULL,NULL,0,0,0,2008472,'https://i.stack.imgur.com/LC2jl.png'),(392,1,'2012-11-10T07:23:36.793','AndroidME',NULL,'2012-11-10T07:23:36.793','http://www.dishatechnology.com/','India',28,'<p><strong>Fulltime:</strong> Android, iOS, Unity 3D, Php, Website, Wordpress developer.</p>\n\n<blockquote>\n  <h1>SOreadytohelp</h1>\n</blockquote>\n\n<pre><code>Thank You\n</code></pre>\n',0,0,0,1160934,'https://i.stack.imgur.com/lXWzq.jpg?s=128&g=1'),(394,49,'2012-11-10T19:00:26.780','Joe Mann',NULL,'2014-08-04T21:29:51.843','http://www.RobotAppStore.com','San Francisco',NULL,'<p>Roboticist, managing the developers program at the <a href=\"http://www.robotAppStore.com\" rel=\"nofollow\">Robot App Store</a></p>\n',0,1,0,2031399,NULL),(395,101,'2012-11-10T20:32:13.340','Nicos Karalis',NULL,'2013-12-26T10:50:01.613','http://nicoskaralis.me','Brazil',27,'<p>Just a developer</p>\n\n<p><code>#SOreadytohelp</code></p>\n',0,0,0,446168,NULL),(396,1,'2012-11-11T11:22:00.083','Suhail cholassery',NULL,'2012-11-13T13:44:02.450',NULL,NULL,NULL,NULL,0,0,0,1864539,NULL),(397,1,'2012-11-11T11:25:04.323','borys86',NULL,'2012-11-11T11:25:04.323',NULL,'Copenhagen, Denmark',31,NULL,0,0,0,322860,NULL),(398,101,'2012-11-11T14:26:27.747','yoyoyoyosef',NULL,'2012-11-11T14:26:27.747',NULL,NULL,NULL,NULL,0,0,0,12874,NULL),(399,103,'2012-11-11T14:55:03.050','Atilla Ozgur',NULL,'2015-01-02T19:14:35.987',NULL,'Ankara, Turkey',NULL,'<p>I started programming in 1991. I consider myself a web application programmer, a da