ou include a URL in a stackexchange post.</p>\n',22,483,4,445412,NULL),(479,658,'2012-11-21T18:53:07.150','WildCrustacean',NULL,'2013-08-26T15:20:58.813',NULL,NULL,NULL,NULL,18,56,0,70291,NULL),(480,101,'2012-11-22T11:42:41.150','Visruth CV',NULL,'2014-09-24T18:31:30.367',NULL,'India',NULL,'<p>Im also a Java Full stack Engineer with focus on the whole stack from back end to front-end since 2008! </p>\n\n<p>Im surfing stackoverflow from its beginning. It gave me a chance to learn a lot of technical &amp; non-technical things, even I could improve my attitude, mentality, behavior, professionality, work culture, analysis, way of development, way of thought etc.. etc.. etc... with the interaction of community members via forum post/comment &amp; via private chats. Thanks to stackoverflow!</p>\n\n<p>I have no commitment with any agencies/companies and Im not available through any of the agencies/companies. What to <a href=\"https://calendly.com/visruth\" rel=\"nofollow noreferrer\">check my availability</a>?</p>\n\n<p><a href=\"https://calendly.com/visruth\" rel=\"nofollow noreferrer\">Want to contact me?</a></p>\n\n<p>Some of my blogs : <a href=\"http://vaadintutorial.blogspot.in/2014/03/how-to-download-file-from-server-in.html\" rel=\"nofollow noreferrer\">vaadin AdvancedFileDownloader</a>, <a href=\"http://hibernatevisruth.blogspot.in/2012/07/sql-error-1064-sqlstate.html\" rel=\"nofollow noreferrer\">Hibernate Solutions</a>, <a href=\"http://androidvisruth.blogspot.in/2012/09/how-to-make-request-to-web-application.html\" rel=\"nofollow noreferrer\">Java Code For Android</a>, <a href=\"http://practical-j2ee.blogspot.com/\" rel=\"nofollow noreferrer\">practical j2ee</a>, <a href=\"http://architectural-solutions.blogspot.in/2015/10/configure-server-with-tomcat-8-for-high.html\" rel=\"nofollow noreferrer\">load balancing with tomcat 8</a></p>\n\n<p>Forum interactions :- <a href=\"http://forum.openkm.com/viewtopic.php?t=5364#p13090\" rel=\"nofollow noreferrer\">openkm</a>, <a href=\"https://vaadin.com/forum/#!/thread/8725134/8748115\" rel=\"nofollow noreferrer\">vaadin</a></p>\n',0,0,0,1645087,'https://i.stack.imgur.com/pEoC0.jpg?s=128&g=1'),(481,101,'2012-11-23T07:36:16.193','zb',NULL,'2012-11-23T07:36:16.193',NULL,NULL,NULL,'<ul>\n<li><a href=\"http://segfault.kiev.ua/smart-questions-ru.html\" rel=\"nofollow noreferrer\">       </a> \n\n<ul>\n<li><a href=\"http://tonguc.wordpress.com/2006/12/27/how-to-answer-questions-the-smart-way/\" rel=\"nofollow noreferrer\">     </a></li>\n</ul></li>\n</ul>\n\n<h2>   </h2>\n\n<ul>\n<li><a href=\"http://google.com/\" rel=\"nofollow noreferrer\">google.com</a>  -  </li>\n<li><a href=\"http://plnkr.co\" rel=\"nofollow noreferrer\">plunker</a> - javascript</li>\n<li><a href=\"http://jsfiddle.net/\" rel=\"nofollow noreferrer\">jsfiddle</a>  - javascript</li>\n<li><a href=\"http://ideone.com/\" rel=\"nofollow noreferrer\">ideone.com</a> php,c,python  </li>\n<li><a href=\"http://sqlfiddle.com/\" rel=\"nofollow noreferrer\">sqlfiddle</a> SQL</li>\n<li><a href=\"https://placehold.it/\" rel=\"nofollow noreferrer\"><img src=\"https://placehold.it/100x25/FF0000\" alt=\" \">   </a></li>\n<li><a href=\"http://debuggex.com\" rel=\"nofollow noreferrer\">regexp</a></li>\n</ul>\n\n<p><img src=\"https://ru.stackoverflow.com/users/flair/11304.png\" alt=\"\"></p>\n\n<p>You can thank me via bitcoin: 1Hg7SvYqRXj8rCuV5PygZAZpHb3Lq194Jx</p>\n',0,0,0,431378,NULL),(482,567,'2012-11-23T15:18:47.350','cube',NULL,'2017-08-25T05:22:19.563','https://github.com/bluecube','Czech Republic',NULL,'<p><a href=\"http://factorio.com\" rel=\"nofollow\">Factorio</a> code monkey.</p>\n\n<p>Programming in C++, python and Rust.\nMy laptop runs Funtoo and is always messed up in some way.</p>\n\n<p>I love playing with robots, but they dont like playing with me.</p>\n',9,60,10,32298,NULL),(483,26,'2012-11-23T18:51:44.423','Ze Nog',NULL,'2012-11-25T10:30:02.750','',NULL,NULL,'',0,0,0,2074580,NULL),(484,54,'2012-11-23T21:00:21.837','amine23',