Since Ive left thats grown to about 350M users.</p>\n\n<p>I studied computer science and worked in Texas for many years.  I also wrote a couple of computer books.</p>\n\n<p>feel free to drop me a line if youve got any feedback on stuff Ive posted here!</p>\n\n<p>marhar@gmail.com</p>\n',3,4,0,97,'https://i.stack.imgur.com/f6flX.jpg'),(555,101,'2012-12-05T03:54:03.083','Tivie',NULL,'2012-12-05T03:54:03.083','http://www.ci2.pt','Portugal',32,'<p>Just a random guy, with random programming knowledge!</p>\n',0,0,0,111892,'https://i.stack.imgur.com/TTuvz.jpg'),(556,101,'2012-12-05T05:15:58.820','buruzaemon',NULL,'2016-08-29T06:34:37.050','https://github.com/buruzaemon','Japan',51,'<p>Professional typist, unrepentant caffeine addict, closet robot scientist, and flaming manga freak.</p>\n\n<p><a href=\"http://stackexchange.com/users/357628\">\n<img src=\"http://stackexchange.com/users/flair/357628.png\" width=\"208\" height=\"58\" alt=\"profile for buruzaemon on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for buruzaemon on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n',0,1,0,357628,NULL),(557,1,'2012-12-05T07:47:46.833','Wesley Chang',NULL,'2012-12-05T07:47:46.833',NULL,NULL,NULL,NULL,0,0,0,2113497,NULL),(558,53,'2012-12-05T09:05:24.040','Atir',NULL,'2013-02-15T07:02:05.940',NULL,NULL,NULL,NULL,0,0,0,1130337,NULL),(559,201,'2012-12-05T18:37:43.333','Jason Sperske',NULL,'2017-06-06T18:02:42.783','http://jason.sperske.com','Livermore, CA',39,'<p>I write software mostly as an excuse to not have a real job.  Along the way Ive built some things that others have found fun like:</p>\n\n<ul>\n<li><a href=\"http://jason.sperske.com/wad/\" rel=\"nofollow noreferrer\">A Python Script that converts DOOM WADs into SVG</a></li>\n<li><a href=\"http://jason.sperske.com/grp/\" rel=\"nofollow noreferrer\">And a Duke Nukem 3D version of the same thing</a></li>\n<li><a href=\"http://jason.sperske.com/adventure/\" rel=\"nofollow noreferrer\">The beginnings of Sierra Style adventure game engine in JavaScript</a></li>\n<li><a href=\"http://sndtst.com/\" rel=\"nofollow noreferrer\">A Sound Test for as many games as I can find</a></li>\n<li><a href=\"https://randomvictory.com/\" rel=\"nofollow noreferrer\">A collection of random video game victories that anyone can contribute to</a></li>\n<li><a href=\"http://crowpedia.com/\" rel=\"nofollow noreferrer\">An archive of AOL and Newsgroup posts from Counting Crows from the mid to late 90s</a></li>\n</ul>\n',1,4,0,9226,NULL),(560,101,'2012-12-05T18:42:15.533','Craig',NULL,'2014-05-16T17:30:02.980',NULL,NULL,NULL,NULL,0,0,0,12898,NULL),(562,1,'2012-12-05T22:09:44.077','school',NULL,'2012-12-05T22:09:44.077',NULL,'Princeton, NJ',NULL,'<p>Studies mathematics, statistics, and physics</p>\n',0,0,0,2116389,NULL),(563,101,'2012-12-06T00:38:40.707','ikku',NULL,'2013-01-18T01:17:10.130','http://www.hollandsystemdesign.com','Santiago, Chile',45,'<p>I am a micro-electronics system designer, I design Hardware and Software because I like to do that and for a living.</p>\n',0,1,0,1738988,NULL),(564,101,'2012-12-06T02:01:23.857','Gordon Gustafson',NULL,'2012-12-14T22:31:31.713','http://gordongustafson.me','Cleveland, OH',23,'<p>Avid Emacs and Vim hacker; I use Emacs with <strong><a href=\"http://www.emacswiki.org/emacs/Evil\" rel=\"nofollow\">Evil</a></strong> to get the best of both worlds.</p>\n\n<p>I write mostly in Java, Python, Javascript, and C, but I dabble in Clojure in my free time. I specialize in distributed systems like Hadoop, HBase, and Cassandra. Im of the firm belief that code is meant to be <em>read</em> rather than written, and try to make my code and commit history as maintainable as possible.</p>\n',0,0,0,32417,NULL),(565,38,'2012-12-06T04:37:29.833','Jon Wilhelm',NULL,'2013-01-22T21:48:59.563',NULL,NULL,NULL,NULL,1,0,0,1562952,NULL),(566,1,'2012-12-06T06:30:05.193','Hapjake',NULL,'2012-12-06T06:30:05.193',NULL,NULL,24,'<p>Im a kid look