c',NULL,'<p><b>Mobile Application Developer / FrontEnd Developer</b></p>\n\n<p>Android, Bada, Blackberry, iOS, J2ME, Javascript, AngularJS, Protractor</p>\n',0,2,0,339866,'https://i.stack.imgur.com/wxf3D.png?s=128&g=1'),(611,101,'2012-12-14T16:55:38.813','Ambo100',NULL,'2017-04-17T20:29:45.363','http://www.flickr.com/photos/ambo100/','England, United Kingdom',22,'<p>Pro-Tem Moderator at <strong><a href=\"http://bricks.stackexchange.com/\">Bricks Stack Exchange</a></strong> (previously known as LEGO Answers).</p>\n',0,6,0,292874,NULL),(612,101,'2012-12-14T16:57:02.183','MatsT',NULL,'2012-12-17T13:03:12.590',NULL,NULL,NULL,NULL,0,0,0,100575,NULL),(613,101,'2012-12-14T17:26:02.250','designerWhoCodes',NULL,'2013-04-03T21:41:10.810',NULL,'Texas',NULL,'<p>Sr. UX Architect</p>\n',0,2,0,476074,NULL),(614,101,'2012-12-14T17:50:50.733','TRiG',NULL,'2013-12-09T17:26:45.433','http://timothy.green.name',NULL,NULL,'<p>A qualified chemist who somehow drifted into web development. Ive learned (to a greater or lesser degree of accuracy) PHP and JavaScript, and would like to learn something completely different for the sake of it. Im a weirdo who actually enjoys reading (and sometimes writing) technical documentation.</p>\n',0,0,0,72444,NULL),(615,101,'2012-12-14T18:04:43.583','Mark Adler',NULL,'2016-10-13T13:24:14.127',NULL,'Southern California',NULL,'<p>Mostly harmless.</p>\n',4,1,0,1136690,'https://i.stack.imgur.com/FXaAg.jpg'),(616,101,'2012-12-14T18:47:37.393','Ilmari Karonen',NULL,'2016-11-07T16:28:52.710','http://vyznev.net/','Helsinki, Finland',37,'<p>Im a PhD student in biomathematics, working on stochastic individual-based models of evolution in spatially structured populations.  My other interests include cryptography, programming games and puzzles, photography and graphic design.</p>\n\n<hr>\n\n<p>Im the main author and maintainer of the <a href=\"http://stackapps.com/questions/4486/stack-overflow-unofficial-patch\">Stack Overflow Unofficial Patch (SOUP)</a>, a user script for browsers with GreaseMonkey-compatible user script support (Firefox, Chrome, Opera, possibly Safari) that fixes or works around a number of outstanding issues with the Stack Exchange user interface.</p>\n\n<p>I tend to answer a lot more questions than I ask.  Some answers Im rather proud of:</p>\n\n<ul>\n<li><a href=\"http://physics.stackexchange.com/questions/111006/how-does-light-bend-around-my-finger-tip/111238#111238\">How does light bend around my finger tip?</a> &mdash; my first ever 100+ score answer!</li>\n<li><a href=\"http://stackoverflow.com/questions/14420754/isaac-cipher-in-php/14428399#14428399\">An implementation of the ISAAC cipher in PHP</a></li>\n<li><a href=\"http://crypto.stackexchange.com/questions/2700/galois-fields-in-cryptography/2718#2718\">Galois fields in cryptography</a>, or, \"what is that GF(<em>p<sup>n</sup></em>) thing anyway?\"</li>\n<li><a href=\"http://graphicdesign.stackexchange.com/questions/5446/making-the-background-of-an-image-transparent-in-gimp/5454#5454\">Making the background of an image transparent in Gimp</a></li>\n<li><a href=\"http://gamedev.stackexchange.com/questions/15708/how-can-i-implement-gravity/41917#41917\">Improve your game physics with Velocity Verlet</a></li>\n<li><a href=\"http://math.stackexchange.com/questions/101125/how-to-compute-the-pareto-frontier-intuitively-speaking/101141#101141\">Computing the Pareto frontier when you can choose multiple options</a></li>\n<li><a href=\"http://math.stackexchange.com/questions/84719/why-is-h-used-for-entropy/84743#84743\">Why is the letter  h  used to denote entropy?</a></li>\n<li><a href=\"http://stackoverflow.com/questions/23431621/extending-the-damm-algorithm-to-base-32/23433934#23433934\">Damm check digit algorithm for base 2<sup><em>n</em></sup> (2 &le; <em>n</em> &le; 32)</a></li>\n<li><a href=\"http://stackoverflow.com/questions/23615974/estimating-rate-of-occurrence-of-an-event-with-exponential-smoothing-and-irregul/23617678#23617678\">Estimating a variable event rate using exponential smoothing</a></li>\n</ul>\n\n<p><a href=\"//creativecommons.org/publicdomain/zero/1.0/\" rel=\"nofollow\"><img src=\"//upload.wikimedia.org/wikipedia/commons/thumb/f/f9/CC-Zero-badge.svg/88px-CC-Zero-badge.svg.png\" alt=\"CC-Zero\"></a> Please consider any (original) code I post to Stack Overflow and other Stack Exchange sites to be released under <a href=\"//creativecommons.org/publicdomain/zero/1.0/\" rel=\"nofollow\">CC-Zero</a> unless stated otherwise.  You may do whatever you want with it and dont have to credit me in any way, although of course that would be nice.</p>\n',0,9,0,178805,NULL),(617,101,'2012-12-14T18:58:50.263','Christopher Galpin',NULL,'2012-12-14T18:58:50.263','http://codeoptimism.com','Montana',NULL,'<p>&lt;This field intentionally left blank.&gt;</p>\n',0,3,0,668,NULL),(618,101,'2012-12-14T19:14:55.707','Michael Kj rling',NULL,'2016-01-14T12:08:36.260','https://michael.kjorling.se/',NULL,NULL,NULL,0,1,0,225818,'https://www.gravatar.com/avatar/ee0eacb6ba6653b249c6d1f6399b78ee?s=128&d=identicon&r=PG&f=1'),(619,101,'2012-12-14T19:38:32.757','Rusty',NULL,'2016-11-02T06:20:34.143','http://www.flickr.com/photos/rmayhew/','Texas',50,'<p>I design hardware and software for automation systems used in live theatre.</p>\n\n<p><a href=\"http://www.flickr.com/photos/rmayhew/\" rel=\"nofollow\">Astrophotography</a> is a current hobby.</p>\n',0,0,0,128616,NULL),(620,123,'2012-12-14T19:47:47.917','PearsonArtPhoto',NULL,'2013-03-30T00:33:27.297','http://www.kd7uiy.com','Ashburn, VA',33,'<p>Im an systems engineer, with some focus on complex systems, signal processing and a bit of control systems. My current job title is \"Senior Systems Engineer\". I am also a hobby photographer, and avid Android and Unity programmer. I am the programmer of the Android app <a href=\"https://play.google.com/store/apps/details?id=com.pearsonartphoto.psychictester&amp;feature=search_result#?t=W251bGwsMSwyLDEsImNvbS5wZWFyc29uYXJ0cGhvdG8ucHN5Y2hpY3Rlc3RlciJd\" rel=\"nofollow noreferrer\">Psychic Tester</a>, <a href=\"https://play.google.com/store/apps/details?id=com.kd7uiy.hamfinder\" rel=\"nofollow noreferrer\">Ham Finder</a>, <a href=\"https://play.google.com/store/apps/details?id=com.kd7uiy.qslmapper\" rel=\"nofollow noreferrer\">Qsl Mapper</a>, and the game <a href=\"https://play.google.com/store/apps/details?id=com.kd7uiy.bowling\" rel=\"nofollow noreferrer\">Rocket Bowl</a>. I am also the author of the blog, <a href=\"http://www.kd7uiy.com/\" rel=\"nofollow noreferrer\">The Making of a Ham</a>, and the photographer on <a href=\"http://www.pearsonartphoto.com\" rel=\"nofollow noreferrer\">PearsonArtPhoto.com</a>.</p>\n\n<p>To see some of my photography, check out the following sites:</p>\n\n<ul>\n<li><a href=\"http://www.pearsonartphoto.com/Professional/Packages/8369038_JhqkY#697978880_qDwrc-A-LB\" rel=\"nofollow noreferrer\">Portrait Portfolio</a></li>\n<li><a href=\"http://www.pearsonartphoto.com/Professional/Southwest-Desert-Photos-for/10070463_6xnnL#712011934_uHtJC\" rel=\"nofollow noreferrer\">Landscape Portfolio</a> (Hosted by <a href=\"https://www.smugmug.com/\" rel=\"nofollow noreferrer\">Smugmug</a>) (25% off using code Stack)</li>\n<li><a href=\"http://www.shutterstock.com/g/tuvas?rid=380785\" rel=\"nofollow noreferrer\">Shutterstock</a></li>\n<li><a href=\"http://www.bigstockphoto.com/search/photographer/pearsonartphoto/?refid=D9fk3hvJXb\" rel=\"nofollow noreferrer\">Bigstockphoto</a></li>\n<li><a href=\"http://us.fotolia.com/p/201103219/partner/201103219\" rel=\"nofollow noreferrer\">Fotolia</a></li>\n<li><a href=\"http://www.dreamstime.com/Pearsonartphoto_info-resi1484412\" rel=\"nofollow noreferrer\">Dreamstime</a></li>\n</ul>\n',0,14,0,260566,NULL),(621,101,'2012-12-14T21:07:49.480','Lukas Kabrt',NULL,'2014-02-04T09:52:53.870','http://blog.kabrt.cz','Czech Republic',NULL,'<p>I started with programming as a child on the old Atari XE computer because it seemed like an amazing adventure and 20 years later I still feel the same.</p>\n\n<p>I have tried various programming languages, the traditional ones - BASIC, Pascal, C++, Java, as well as the more exotic ones - LISP, Prolog but my programming language of choice is C# which I have been following since the introduction of .NET 2.0</p>\n',0,1,0,89854,'https://i.stack.imgur.com/9Yhq3.png?s=128&g=1'),(622,101,'2012-12-14T21:13:27.510','Kreiri',NULL,'2016-10-04T15:19:55.030',NULL,'Ukraine',NULL,NULL,0,1,0,965231,NULL),(623,101,'2012-12-14T21:20:25.277','Foo Bar',NULL,'2012-12-14T21:20:25.277',NULL,'United States',46,'<p>Im just this guy, you know?</p>\n',0,0,0,389478,NULL),(624,101,'2012-12-14T21:23:35.707','Roddy of the Frozen Peas',NULL,'2014-09-26T03:57:40.743',NULL,'Rocky Mountain Empire',NULL,'<p>Software engineer and mountain climber from the Rocky Mountains. And a girl.</p>\n\n<p>I primarily contribute on StackOverflow but Im inherently curious about most things and will sometimes show up on other StackExchange sites as well.</p>\n',0,2,0,183966,NULL),(625,101,'2012-12-14T22:50:35.630','marcus erronius',NULL,'2012-12-14T22:50:35.630','http://stackoverflow.com/users/1864513/mark-hubbart','Oakland, CA',38,'<p>Most fluent in Ruby and Javascript but I work with whatever language suits my task best. I especially like working with interesting algorithms and information theory stuff :)</p>\n',0,0,0,2095683,NULL),(627,101,'2012-12-15T05:32:49.413','ZJR',NULL,'2013-09-03T01:08:23.930',NULL,'Genoa, Italy',36,'<p>Im here to fine tune my common sense. I like llamas.</p>\n\n<p><img src=\"http://i.stack.imgur.com/cumUC.gif\" alt=\"Fabulous\"></p>\n\n<pre><code>:wa\n</code></pre>\n',0,2,0,56726,'https://i.stack.imgur.com/pPdiD.jpg'),(628,101,'2012-12-15T19:30:55.137','Inquisitive',NULL,'2012-12-15T19:30:55.137',NULL,NULL,NULL,'<p>Under graduate in Electronics and Communication Engineering.</p>\n',0,0,0,1225008,NULL),(630,101,'2012-12-15T23:58:50.883','yydl',NULL,'2012-12-15T23:58:50.883',NULL,'New York, United States