2-12-19T14:50:54.297','http://www.jphellemons.nl','Netherlands',33,'<p>C# .Net (web) developer.</p>\n\n<p>twitter: jphellemons</p>\n\n<p><a href=\"http://twitter.com/jphellemons\" rel=\"nofollow\"><img src=\"http://a0.twimg.com/a/1270575596/images/twitter_logo_header.png\" alt=\"JPHellemons on twitter\" ></a></p>\n\n<p><a href=\"http://feeds.feedburner.com/JpHellemons\" rel=\"nofollow\"><img src=\"http://feeds.feedburner.com/~fc/JpHellemons?bg=252525&amp;fg=ffffff&amp;anim=0\" /></a></p>\n\n<p><a href=\"http://nl.linkedin.com/in/hellemons\" rel=\"nofollow\" >\n    <img src=\"http://www.linkedin.com/img/webpromo/btn_myprofile_160x33.png\" width=\"160\" height=\"33\" alt=\"View JP Hellemons profile on LinkedIn\">\n</a></p>\n\n<p>My blog: <a href=\"http://www.jphellemons.nl/\" rel=\"nofollow\">http://www.jphellemons.nl/</a></p>\n\n<h1>SOreadytohelp</h1>\n',0,0,0,56646,NULL),(648,101,'2012-12-19T18:40:05.917','Unsigned',NULL,'2012-12-19T18:40:05.917',NULL,'West Coast, USA',NULL,'<p>Non-exhaustive list of my favorite languages, in no particular order:</p>\n\n<ul>\n<li>Golang, Scala, C#, x86 ASM (Intel syntax), .NET CIL/MSIL</li>\n</ul>\n\n<p>Experience in compiler development, build systems, SOAs, web applications and crawlers, data mining, 3D raytracing, and data compression algorithms.</p>\n\n<blockquote>\n  <p>\"I want my ER doctor to understand anatomy, even if all she has to do is put the computerized defibrillator nodes on my chest and push the big red button, and I want programmers to know programming down to the CPU level, even if Ruby on Rails does read your mind and build a complete Web 2.0 social collaborative networking site for you with three clicks of the mouse.\" -- <a href=\"http://stackexchange.com/users/4/joel-spolsky\">Joel Spolsky</a></p>\n</blockquote>\n\n<p><a href=\"https://stackexchange.com/users/314364/unsigned\"><img src=\"https://stackexchange.com/users/flair/314364.png\" width=\"208\" height=\"58\" alt=\"profile for Unsigned on Stack Exchange,