alerque\" rel=\"nofollow\">frequent contributor</a> to open source software. I transitioned to programming from other work because I was too busy automating my own work environment to actually do the other work. I have a hobby interest in <a href=\"http://wiki.openstreetmap.org/wiki/User:Alerque\" rel=\"nofollow\">cartography</a>. For more <strong>see my <a href=\"http://alerque.com\" rel=\"nofollow\">personal site</a></strong>. Most importantly, my life is defined by the grace of God given to men through Jesus Christ. It is my ambition that everything I do would reflect His glory and point people towards Him.</p>\n',1,2,0,120635,'https://i.stack.imgur.com/cw79u.jpg?s=128&g=1'),(729,101,'2013-01-10T14:16:53.907','William',NULL,'2013-01-10T14:16:53.907','http://www.williamtdr.com','Bloomington, MN',19,'<p>I use Ubuntu Server on a dedicated server farm with 400+ physical machines. Self-taught programmer. Web programming / Design / Game Backends</p>\n',0,1,0,995847,NULL),(730,1,'2013-01-10T15:49:42.797','HeWhoProtects',NULL,'2013-01-10T15:49:42.797',NULL,NULL,NULL,'<p>(your about me is currently blank)</p>\n',0,0,0,1093891,NULL),(731,101,'2013-01-10T17:07:57.950','stardiviner',NULL,'2017-08-05T14:05:30.447','https://stardiviner.github.io/','Yunnan, China',27,'<p><strong>Linux</strong> ==></p>\n\n<ul>\n<li><p>Emacs</p></li>\n<li><p>Languages</p>\n\n<ul>\n<li>Python, Clojure, Lisp, Go, C, JavaScript, HTML, CSS</li>\n</ul></li>\n</ul>\n',0,0,0,366399,NULL),(732,58,'2013-01-10T21:39:16.640','Dr D',NULL,'2013-01-22T17:31:28.147','http://www.drdacademy.com',NULL,NULL,'',0,0,0,2230474,'https://i.stack.imgur.com/VN2wz.png'),(733,133,'2013-01-11T02:17:57.770','Rob Napier',NULL,'2015-08-23T16:16:44.033','http://robnapier.net','Raleigh, NC',45,'<p>Rob is a builder of treehouses, hiker, proud father, and in his spare 50-60 hours a week, a Mac and iPhone developer. Hes coauthor of <a href=\"http://robnapier.net/book\" rel=\"nofollow\">iOS 6 Programming Pushing the Limits</a>. <a hr