ef=\"http://sscce.org/\" rel=\"nofollow\">SSCCE</a> and wrote the initial draft of the <a href=\"http://stackoverflow.com/help/mcve\">MCVE</a> at SO.  Also seen at <a href=\"http://www.youtube.com/user/DrewTubeish\" rel=\"nofollow\">DrewTubeish</a>, <a href=\"http://au.linkedin.com/in/andrewthommo\" rel=\"nofollow\">LinkedIn</a> &amp; <a href=\"http://www.facebook.com/profile.php?id=100003737007365\" rel=\"nofollow\">Facebook</a>.</p>\n\n<p>Some of the tools formerly available at my pscode.org domain can be downloaded from my <a href=\"https://drive.google.com/folderview?id=0B5B9wDXIGw9lUnJaUjA2cmlVRE0\" rel=\"nofollow\">Google Share Drive</a>.</p>\n\n<p><strong>At StackExchange:</strong>\nCompleted the <a href=\"http://stackoverflow.com/tags/java-web-start/info\">Java Web Start</a>, <a href=\"http://stackoverflow.com/tags/jnlp/info\">JNLP</a>, <a href=\"http://stackoverflow.com/tags/applet/info\">Applet</a> &amp; <a href=\"http://stackoverflow.com/tags/javasound/info\">Java Sound</a> tag information pages.  Top user in same tags. Asked the <a href=\"http://meta.stackexchange.com/questions/99734/how-do-i-create-a-screenshot-to-illustrate-a-post\">How to create screenshots?</a> FAQ &amp; wrote the <a href=\"http://programmers.blogoverflow.com/2013/05/why-cs-teachers-should-stop-teaching-java-applets/\" rel=\"nofollow\">Why CS teachers should stop teaching Java applets</a> blog post.</p>\n\n<p>Most active on <a href=\"http://stackoverflow.com/\">StackOverflow</a> but also seen at other places around StackExchange such as <a href=\"http://space.stackexchange.com/\">Space Exploration</a>, <a href=\"http://scifi.stackexchange.com/\">Sci-Fi &amp; Fantasy</a> &amp; <a href=\"http://movies.stackexchange.com/\">Movies &amp; TV</a>.</p>\n',0,5,0,183279,'https://i.stack.imgur.com/yOfDr.png?s=128&g=1'),(806,101,'2013-01-26T07:09:09.260','Kevin Chen',NULL,'2013-05-22T06:36:49.693','http://kevinchen.co','SF and NYC',NULL,NULL,0,1,0,1468904,NULL),(807,4,'2013-01-26T08:25:07.833','