Gv.jpg?s=128&g=1'),(833,1,'2013-01-30T19:38:15.030','Calin Floare',NULL,'2013-01-30T19:38:15.030',NULL,NULL,NULL,NULL,0,0,0,2307816,NULL),(834,101,'2013-01-30T20:37:32.910','Uwe Keim',NULL,'2014-08-09T05:29:33.860','https://www.zeta-producer.com','G ppingen, Germany',44,'<p>German developer. Some of my apps:</p>\n\n<ul>\n<li><a href=\"https://www.zeta-producer.com/de/index.html\" rel=\"nofollow noreferrer\">Eigene Homepage erstellen</a></li>\n<li><a href=\"https://www.zeta-producer.com/de/online-shop.html\" rel=\"nofollow noreferrer\">Eigenen Onlineshop erstellen</a></li>\n<li><a href=\"https://www.zeta-test.com\" rel=\"nofollow noreferrer\">Test Management Software</a></li>\n<li><a href=\"https://blog.zeta-producer.com/lizenzfreie-bilder/\" rel=\"nofollow noreferrer\">Kostenlose, lizenzfreie Bilder</a></li>\n<li><a href=\"https://www.zeta-uploader.com\" rel=\"nofollow noreferrer\">Gro e Dateien kostenlos senden</a></li>\n</ul>\n\n<p>Very proud father of <a href=\"http://felix.bz\" rel=\"nofollow noreferrer\">Felix</a> (2012) and <a href=\"http://ina.la\" rel=\"nofollow noreferrer\">Ina</a> (2014). Loves running, climbing and Indian food. Code Project member #234. <a href=\"http://uwe.co\" rel=\"nofollow noreferrer\">Office webcam</a> of my dog.</p>\n',0,6,0,37624,NULL),(835,101,'2013-01-30T23:11:52.027','hlovdal',NULL,'2013-01-30T23:11:52.027','http://stackoverflow.com/users/23118/hlovdal','Norway',44,'<p>Linux user since 1994. Main programming language: C.</p>\n',0,0,0,11881,NULL),(836,101,'2013-01-30T23:40:12.040','Nate',NULL,'2013-05-05T04:25:18.750','http://stackoverflow.com/users/119114/nate','United States',42,'<p>Freelance software developer in the US, specializing in embedded and distributed systems, intelligence and defense domains, and smartphone apps.</p>\n\n<p>You can reach me at: <code>natron-alias</code> at <code>hot mail</code>, but please do not email me asking to <strong>privately</strong> answer your question for free.  Just post it online.</p>\n\n<hr>\n\n<p>First Stack Overflow user to <a href=\"http://data.stackexchange.com/stackoverflow/query/134153/users-with-a-combination-of-3-badges?BadgeName1=ios&amp;BadgeName2=blackberry&amp;BadgeName3=android\" rel=\"nofollow\">earn an iOS, BlackBerry and Android badge</a> ... <br/>... and the <a href=\"http://data.stackexchange.com/stackoverflow/query/121280/users-with-a-combination-of-badges?BadgeName1=ios&amp;BadgeName2=android\" rel=\"nofollow\">13th to hold iOS+Android</a></p>\n\n<p><a href=\"http://stackoverflow.com/badges/2821/jailbreak\">First user to earn a Jailbreak (iOS) badge</a></p>\n\n<p><a href=\"http://stackoverflow.com/help/badges/190/blackberry\">4th to the silver BlackBerry badge</a> and <a href=\"http://stackoverflow.com/badges/1317/ios?userid=119114\">95th to the silver iOS badge</a>.</p>\n\n<hr>\n\n<p>Sorry, but I dont do <strong>chat</strong>.  Software development is a knowledge exercise, that requires concentration, and a lack of interruptions, to do well.  <em>Chat</em> forces constant context-switching, and loss of efficiency as a result of these interruptions.  I post on Stack Overflow in my free time, when Ive already been interrupted for other reasons, but I cant spare the time to hang around in chat rooms.  Thanks for your understanding.</p>\n',0,0,0,41016,'https://i.stack.imgur.com/ccv87.png?s=128&g=1'),(837,101,'2013-01-31T04:31:28.680','Joshua Whitley',NULL,'2015-02-12T21:28:47.647',NULL,'Springfield, IL, United States',33,'<p>I am a software developer and general IT services guy. I have experience in C++, ROS, CVS, web development (Server[ASP/PHP] and Client[JS/JQuery]), network administration, server administration, database administration, and have touched just about all parts of SMB IT infrastructure.</p>\n',0,0,0,2306950,'https://i.stack.imgur.com/rF2Yc.jpg'),(838,118,'2013-01-31T10:34:07.567','Stephane Rolland',NULL,'2013-02-07T19:25:22.360','http://xn--vod-0ma.blogspot.com/','Paris, France',41,'<p>Everyday experience: \n - C+