etwork of free, community-driven Q&amp;A sites\" title=\"profile for iProgrammed on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n',0,0,0,2177135,'https://i.stack.imgur.com/l7Y6s.jpg'),(843,1,'2013-02-01T10:13:10.213','Michele Angelo',NULL,'2013-02-01T10:13:10.213',NULL,NULL,NULL,NULL,0,0,0,1503729,NULL),(844,101,'2013-02-01T17:02:21.960','agweber',NULL,'2016-03-15T23:55:05.413','http://agweber.net/','Indiana',30,'<p>A bored kid</p>\n',0,1,0,291,NULL),(845,101,'2013-02-01T18:42:22.480','Rachel',NULL,'2013-02-01T18:42:22.480','http://rachel53461.wordpress.com/','New York, United States',32,'<p><em>\"The three chief virtues of a programmer are: Laziness, Impatience and Hubris.\"</em> - Larry Wall</p>\n\n<p><strong>Laziness</strong>: Im too lazy to do the same task repeatedly so write scripts to do that task for me. This makes people think I am intelligent.</p>\n\n<p><strong>Impatience</strong>: Im too impatient to wait for my code to run so rewrite the code to improve performance. This makes people think I am a good programmer.</p>\n\n<p><strong>Hubris</strong>: When someone asks if I can do something I just say Yes, then go find out how to do it (Google!). This makes people think I can do anything.</p>\n\n<p>Ultimately, it means I can make a career out of being Lazy, Impatient, and Hubristic(?).</p>\n',0,0,0,115236,NULL),(846,101,'2013-02-01T22:55:26.200','Fraser',NULL,'2013-02-19T00:45:23.650','http://maidsafe.net/','Troon, Scotland',44,'<p>Laphroaig.  No ice.  Absolutely no Coke.</p>\n',0,0,0,186835,NULL),(847,101,'2013-02-02T22:37:14.023','Hermann Ingjaldsson',NULL,'2014-05-29T15:08:00.163','http://SynOdins.com',NULL,NULL,'<p>my website: <a href=\"https://synodins.com\" rel=\"nofollow\">https://synodins.com</a></p>\n',0,1,0,126199,'https://i.stack.imgur.com/TMSvO.jpg?s=128&g=1'),(848,101,'2013-02-02T23:29:34.027','whostolemyhat',NULL,'2014-09-16T14:01:38.153','http://www.jamestease.co.uk','United Kingdom',30,'<p>Full-stack web dev