tackexchange.com/proposals/65896/healthcare-it</a></p>\n\n<p>Google Plus Meta Site for Healthcare IT: </p>\n\n<p><a href=\"https://plus.google.com/u/0/communities/100724098264509320986\" rel=\"nofollow\">https://plus.google.com/u/0/communities/100724098264509320986</a></p>\n',1,1,0,62967,NULL),(948,101,'2013-02-26T15:34:48.397','Dilip',NULL,'2013-02-26T15:34:48.397','http://about.me/dilip.manek','Ahmedabad,Gujarat,India',28,'<p>I am a computer Engineer from Ahmedabad, Gujarat, India. Working as a freelancer. And I like to work in iOS.</p>\n\n<p><strong>APPLE ROCK</strong></p>\n',0,0,0,2145340,NULL),(950,101,'2013-02-26T17:50:00.647','Tim Post',NULL,'2013-11-29T13:09:49.707','https://keybase.io/tpost','Mandaluyong, Philippines',42,'\n\n<p>Hello there, curious passer-by! Im Tim, and I work here. Im the Director Of Community Management for Stack Overflow. </p>\n\n<p>If you need to reach me, Im tpost@stackoverflow.com.  </p>\n\n<p><a href=\"https://keybase.io/tpost\" rel=\"nofollow\">My Public Key</a></p>\n',0,1,0,20808,'https://i.stack.imgur.com/cKhkz.jpg?s=128&g=1'),(951,101,'2013-02-26T18:32:17.633','Remy Blank',NULL,'2017-06-19T22:02:00.013','http://c-space.org/',NULL,NULL,NULL,0,1,0,24044,NULL),(952,101,'2013-02-26T23:05:27.367','miku',NULL,'2014-01-29T16:26:20.960',NULL,'Germany',NULL,'<blockquote>\n  <p>Each working data pipeline is designed like a log; each broken data pipeline is broken in its own way.</p>\n</blockquote>\n',0,0,0,32277,NULL),(953,6,'2013-02-27T14:12:58.267','user1551103',NULL,'2016-06-10T10:21:54.553',NULL,NULL,NULL,NULL,1,0,0,1688244,NULL),(954,101,'2013-02-27T14:26:43.760','Giorgi Butbaia',NULL,'2017-06-30T08:07:44.580',NULL,'Georgia',18,'<p>Hello my name is Gigi Butbaia, Im 17 years old, I live in Georgia, Tbilisi.</p>\n\n<p><a href=\"http://physics.stackexchange.com/users/21420/gigi-butbaia\">\n<img src=\"http://physics.stackexchange.com/users/flair/21420.png?theme=dark\" width=\"208\" height=\"58\" alt=\"profile for Gigi Butbaia at Physics Stack Exchange, Q&amp;A for active researchers, academics and students of physics\" title=\"profile for Gigi Butbaia at Physics Stack Exchange, Q&amp;A for active researchers, academics and students of physics\">\n</a></p>\n',0,0,0,2406943,'https://i.stack.imgur.com/2G6jO.png?s=128&g=1'),(955,101,'2013-02-28T02:47:38.443','Makoto',NULL,'2013-02-28T03:18:24.210',NULL,'Denver, CO, United States',29,'<p>Hi!  Nice to meet you.</p>\n\n<p>I am <strong>always happy to help you</strong>.  I will share what knowledge I have of whatever language or tools Im familiar with.</p>\n\n<p>I am a <strong>Software Engineer</strong>.</p>\n\n<p>I am comfortable with:</p>\n\n<ul>\n<li>Java (Core, Spring)</li>\n<li>JSP (JSTL)</li>\n<li>Python (2.x and 3.x)</li>\n<li>Ruby</li>\n<li>SQL (MySQL, SQLite)</li>\n</ul>\n\n<p>I have used these tools:</p>\n\n<ul>\n<li>IntelliJ IDEA</li>\n<li>0xDBE</li>\n<li>DB Visualizer</li>\n<li>Git</li>\n</ul>\n\n<p>I am a <strong>Linux Enthusiast</strong>.</p>\n\n<ul>\n<li>Full-time Xubuntu user</li>\n<li>Used Linux in general for over 14 years - Debian and RPM-based</li>\n</ul>\n\n<p>I am an <strong><a href=\"http://anime.stackexchange.com\">Anime and Manga</a> Enthusiast</strong>.</p>\n\n<p>To name a few of my favorite series...</p>\n\n<ul>\n<li>Outlaw Star</li>\n<li>Last Exile</li>\n<li>RahXephon</li>\n<li>Sword Art Online</li>\n<li>Cowboy Bebop</li>\n<li>Samurai Champloo</li>\n<li>Time of Eve</li>\n<li>...and many, many others</li>\n</ul>\n\n<p>I am an <strong>Open Source Advocate</strong>.</p>\n\n<ul>\n<li>Author and maintainer of <a href=\"https://github.com/MakotoTheKnight/codeschool-intellij\" rel=\"nofollow\">codeschool-intellij</a> - a dark theme inspired by AstonJs original work for IntelliJ (and most JetBrains IDEs)</li>\n</ul>\n',0,0,0,1082858,NULL),(957,1,'2013-02-28T19:52:14.027','codegeek511',NULL,'2013-02-28T19:52:14.027',NULL,NULL,NULL,'<p>\"Intelligent people solve problems, Geniuses prevent them.\"\n-Albert Einstein </p>\n',0,0,0,2425395,'https://www.gravatar.com/avatar/5929c0cf715e7418e3aa3b522bccb938?s=128&d=identicon&r=PG'),(958,101,'2013-03-01T01:17:46.987','Robert Yi Jiang',NULL,'2013-03-01T01:17:46.987',NULL,'Australia',36,NULL,0,0,0,2364440,NULL),(959,166,'2013-03-01T03:30:08.057','Damien',NULL,'2017-01-12T07:50:47.830',NULL,NULL,NULL,NULL,0,4,0,504772,NULL),(960,1,'2013-03-01T14:46:49.120','Ramesh Murthi',NULL,'2013-08-31T04:54:43.767',NULL,'Pune, India',27,NULL,0,0,0,2433509,NULL),(961,101,'2013-03-01T17:02:32.543','merosss',NULL,'2014-04-26T12:26:19.370','http://webground.altervista.org','Italy',NULL,NULL,0,0,0,2258088,'https://i.stack.imgur.com/9Osup.png?s=128&g=1'),(962,101,'2013-03-01T19:29:07.440','Shotgun Ninja',NULL,'2013-06-24T14:16:51.027','http://nickonsoftware.wordpress.com/','Milwaukee, WI',26,'<p> </p>\n\n<p><strong>What I do</strong></p>\n\n<p>Im a professional Web Application developer for a consulting company in the SE Wisconsin/NE Illinois area. On my own time, Im a hobbyist game developer, working on a visual novel project using Unity.</p>\n\n<p><strong>Competencies</strong></p>\n\n<ul>\n<li>Currently, Im working with Angular, Node.js, DynamoDB, Less, and Jade.</li>\n<li>For my hobby project, Im working with Unity and C#.</li>\n<li>Ive worked with JBoss, JAX-WS, RESTEasy, and Angular.</li>\n<li>Ive worked with Struts 1 and 2, Tomcat and IBM WebSphere, Oracle SQL (10g/11g), JSP, and HTML/CSS/Javascript/jQuery on a regular basis in my last job.</li>\n<li>Im teaching myself Ruby, and I know a bit of C#, C/C++ and PHP.</li>\n<li>Ive done work in Arduino development and robotics, and dabbled in Nintendo DS homebrew development.</li>\n<li>Ive done undergraduate research into computer graphics, AI, and game design.</li>\n<li>Ive worked with the Selenium WebDriver web automation framework, Google Analytics and ReCaptcha v2, Amazon S3, Constant Contact, and various other APIs.</li>\n<li>Im familiar with a number of version control systems and software process tools, though Id like to use them more in my daily development process.</li>\n</ul>\n\n<p><strong>Education</strong></p>\n\n<ul>\n<li>I hold a Bachelors of Science in Software Engineering from the Milwaukee School of Engineering, class of 2014.</li>\n<li>I was a member of several student organizations, including MAGE, Theater Troupe, and the MSOE Jazz Band at various points</li>\n<li>I was the co-founder and founding vice president of the FIRST Collegiate Robotics Organization.</li>\n</ul>\n\n<p><strong>Passions</strong></p>\n\n<ul>\n<li>Good food</li>\n<li>FIRST Robotics Competition</li>\n<li>Indie-rock</li>\n<li>Anime and anime conventions</li>\n<li>Pragmatic software development</li>\n<li>Video games</li>\n<li>Rocky Horror Picture Show</li>\n<li>Haunted houses</li>\n<li>Disney theme parks</li>\n<li>Contemporary American history of the mid-to-late 20th century.</li>\n</ul>\n\n<p>#SOreadytohelp</p>\n\n<p>Without SO, Id be lost. I started developing right as it was starting up, and Ive been growing alongside it almost every day.</p>\n',0,1,0,178394,NULL),(963,1,'2013-03-01T20:03:39.093','Loris Fichera',NULL,'2013-03-01T20:03:39.093',NULL,NULL,NULL,NULL,0,0,0,1956711,NULL),(964,138,'2013-03-01T22:17:03.267','hexafraction',NULL,'2017-05-02T21:04:02.730','https://akhmetov.me','Upstate New York',NULL,'<p>Avid hackathon participant, student (Cooper Union EE 2020), and aspiring software engineer. Always interested in learning by teaching, learning by doing, and experimenting to uncover new insights.</p>\n\n<p><a href=\"https://www.codementor.io/aakhmetov?utm_source=github&amp;utm_medium=button&amp;utm_term=aakhmetov&amp;utm_campaign=github\" rel=\"nofollow noreferrer\"><img src=\"https://cdn.codementor.io/badges/contact_me_github.svg\" alt=\"Contact me on Codementor\"></a></p>\n',0,1,0,1394089,NULL),(965,1,'2013-03-02T07:45:44.167','ShAil LaLaji',NULL,'2013-03-02T07:45:44.167',NULL,NULL,NULL,NULL,1,0,0,2436322,NULL),(966,101,'2013-03-02T09:36:38.190',' ',NULL,'2014-12-22T17:56:09.643','http://w