,NULL),(987,101,'2013-03-07T21:57:15.780','JaredH',NULL,'2013-03-07T21:57:15.780',NULL,'New York, NY, United States',NULL,'<p></p>\n',0,0,0,475078,NULL),(988,121,'2013-03-08T05:30:50.617','Scott Stensland',NULL,'2017-02-05T09:16:06.980','https://github.com/scottstensland','New York, United States',97,'<p>currently building a gas dynamics physics engine in c++ using OpenGL for visualization ...\nstreaming media software engineer - update inserted - now Im using Web Audio API / WebGL / web sockets / nodejs for my sound synthesis engine - upon listening to a sample of sound it dynamically evolves a genome / gene regulatory network which can recreate the source sound, now with a genetic representation of the sound I am able to grow very interesting compositions</p>\n',0,7,0,49433,'https://i.stack.imgur.com/PyWe3.jpg?s=128&g=1'),(990,1,'2013-03-08T08:08:49.667','mayhem1990',NULL,'2013-03-08T08:08:49.667','','Bangalore, India',27,'',0,0,0,2464085,NULL),(991,101,'2013-03-08T09:54:17.270','Abimaran Kugathasan',NULL,'2013-05-24T04:34:24.257','http://www.lkabimaran.blogspot.com','Colombo, Sri Lanka',31,'<p>Currently working for <a href=\"/questions/tagged/wso2\" class=\"post-tag\" title=\"show questions tagged &#39;wso2&#39;\" rel=\"tag\">wso2</a>, an Open Source JVM based Middleware Service provider.</p>\n\n<p>Familiar Languages  : <a href=\"/questions/tagged/java\" class=\"post-tag\" title=\"show questions tagged &#39;java&#39;\" rel=\"tag\">java</a> <a href=\"/questions/tagged/scala\" class=\"post-tag\" title=\"show questions tagged &#39;scala&#39;\" rel=\"tag\">scala</a> <a href=\"/questions/tagged/clojure\" class=\"post-tag\" title=\"show questions tagged &#39;clojure&#39;\" rel=\"tag\">clojure</a> </p>\n\n<p>Database            : <a href=\"/questions/tagged/mysql\" class=\"post-tag\" title=\"show questions tagged &#39;mysql&#39;\" rel=\"tag\">mysql</a> <a href=\"/questions/tagged/mongo\" class=\"post-tag\" title=\"show questions tagged &#39;mongo&#39;\" rel=\"tag\">mongo</a> </p>\n\n<p>source code control tools : <a href=\"/questions/tagged/svn\" class=\"post-tag\" title=\"show questions tagged &#39;svn&#39;\" rel=\"tag\">svn</a> <a href=\"/questions/tagged/git\" class=\"post-tag\" title=\"show questions tagged &#39;git&#39;\" rel=\"tag\">git</a></p>\n\n<p><a href=\"/questions/tagged/jaxb\" class=\"post-tag\" title=\"show questions tagged &#39;jaxb&#39;\" rel=\"tag\">jaxb</a> <a href=\"/questions/tagged/jaxp\" class=\"post-tag\" title=\"show questions tagged &#39;jaxp&#39;\" rel=\"tag\">jaxp</a> <a href=\"/questions/tagged/xml\" class=\"post-tag\" title=\"show questions tagged &#39;xml&#39;\" rel=\"tag\">xml</a> <a href=\"/questions/tagged/json\" class=\"post-tag\" title=\"show questions tagged &#39;json&#39;\" rel=\"tag\">json</a> <a href=\"/questions/tagged/jax-rs\" class=\"post-tag\" title=\"show questions tagged &#39;jax-rs&#39;\" rel=\"tag\">jax-rs</a> <a href=\"/questions/tagged/jax-ws\" class=\"post-tag\" title=\"show questions tagged &#39;jax-ws&#39;\" rel=\"tag\">jax-ws</a> <a href=\"/questions/tagged/cxf\" class=\"post-tag\" title=\"show questions tagged &#39;cxf&#39;\" rel=\"tag\">cxf</a> <a href=\"/questions/tagged/axis2\" class=\"post-tag\" title=\"show questions tagged &#39;axis2&#39;\" rel=\"tag\">axis2</a> <a href=\"/questions/tagged/rest\" class=\"post-tag\" title=\"show questions tagged &#39;rest&#39;\" rel=\"tag\">rest</a> <a href=\"/questions/tagged/soap\" class=\"post-tag\" title=\"show questions tagged &#39;soap&#39;\" rel=\"tag\">soap</a> <a href=\"/questions/tagged/spring\" class=\"post-tag\" title=\"show questions tagged &#39;spring&#39;\" rel=\"tag\">spring</a> <a href=\"/questions/tagged/struts2\" class=\"post-tag\" title=\"show questions tagged &#39;struts2&#39;\" rel=\"tag\">struts2</a>  <a href=\"/questions/tagged/jsp\" class=\"post-tag\" title=\"show questions tagged &#39;jsp&#39;\" rel=\"tag\">jsp</a> <a href=\"/questions/tagged/servlet\" class=\"post-tag\" title=\"show questions tagged &#39;servlet&#39;\" rel=\"tag\">servlet</a> <a href=\"/questions/tagged/hadoop\" class=\"post-tag\" title=\"show questions tagged &#39;hadoop&#39;\" rel=\"tag\">hadoop</a> <a href=\"/questions/tagged/hive\" class=\"post-tag\" title=\"show questions tagged &#39;hive&#39;\" rel=\"tag\">hive</a></p>\n\n<p><strong><em>DataExplorer Query</em></strong>\n<a href=\"http://data.stackexchange.com/stackoverflow/query/87307/top-n-users-in-the-country\" rel=\"nofollow noreferrer\">Top N StackOverFlow Users in a Country</a></p>\n',0,1,0,243084,'https://i.stack.imgur.com/sMWI1.jpg?s=128&g=1'),(992,1,'2013-03-08T12:57:16.097','Subhani',NULL,'2013-04-30T07:31:06.400',NULL,'United States',37,'<p>Learning...</p>\n\n<h1>SOreadytohelp</h1>\n',0,0,0,66457,NULL),(993,101,'2013-03-08T16:04:49.930','Geerten',NULL,'2013-03-08T16:04:49.930',NULL,NULL,30,NULL,0,0,0,539722,NULL),(994,121,'2013-03-08T18:22:59.987','orad',NULL,'2014-08-06T22:57:51.860',NULL,NULL,NULL,'<p>Developers rule!... or they should if they dont.</p>\n',0,1,0,203322,NULL),(996,101,'2013-03-08T22:57:24.153','1ace',NULL,'2013-03-08T22:57:24.153','https://eric.engestrom.ch','London, UK',28,NULL,0,0,0,86122,'https://i.stack.imgur.com/gzv9u.jpg'),(998,3,'2013-03-09T10:57:38.550','user998',NULL,'2013-03-09T13:10:26.283',NULL,NULL,NULL,NULL,0,0,0,2468898,NULL),(999,1,'2013-03-09T11:37:32.197','Shekhar',NULL,'2013-03-11T08:51:30.497','http://bhardwajgroup.blogspot.in','India',27,'<p> The three chief virtues of a programmer are: Laziness, Impatience and Hubris.    Larry Wall</p>\n\n<p>Laziness: I m too lazy to do the same task repeatedly so write scripts to do that task for me. This makes people think I am intelligent.</p>\n\n<p>Impatience: I m too impatient to wait for my code to run so rewrite the code to improve performance. This makes people think I am a good programmer.</p>\n\n<p>Hubris: When someone asks if I can do something I just say Yes, then go find out how to do it (Google!). This makes people think I can do anything.</p>\n',0,0,0,2145652,'https://i.stack.imgur.com/Tg9Pz.jpg'),(1000,230,'2013-03-09T15:37:12.320','Ayberk  zg r',NULL,'2017-03-28T17:50:16.410','http://ayberkozgur.com','Lausanne, Switzerland',27,'',0,18,0,1655582,NULL),(1001,1,'2013-03-09T18:54:44.447','FinalistBeel',NULL,'2014-01-17T22:27:03.597',NULL,NULL,NULL,NULL,0,0,0,2470103,NULL),(1002,101,'2013-03-10T18:36:57.247','murat',NULL,'2013-09-01T20:39:59.513',NULL,NULL,NULL,NULL,0,0,0,262208,NULL),(1004,101,'2013-03-11T01:07:31.280','James Black',NULL,'2016-03-08T09:15:22.850',NULL,'Knoxville, TN',NULL,'<p>I have been programming since I was in high school, and my favorite computer was my Amiga 2000, as that is what I learned to program in C on, and was just a great computer.</p>\n\n<p>I have been an advocate about unit testing since 1999, and believe we can get better code by getting before the user more frequently so we can narrow the solution to what they really want, as users dont really know what they want, initially.</p>\n\n<p>I am comfortable with many languages, but am trying to understand how to program in functional languages, giving up while loops is very difficult for me in designing applications. :)</p>\n\n<p>I am living in Knoxville, TN.</p>\n',0,0,0,26075,'https://i.stack.imgur.com/9d0Vk.jpg'),(1005,31,'2013-03-11T07:24:01.253','orangenarwhals',NULL,'2017-05-25T22:10:29.160','http://orangenarwhals.blogspot.com','Cambridge, MA',NULL,'<p>Open source hardware evangelist. I like hexapods, nyancake, vending machines, motes, and MITERS. MIT MechE 13.</p>\n',0,4,0,453925,NULL),(1006,101,'2013-03-11T07:48:52.267','Oki',NULL,'2016-06-02T17:48:57.503',NULL,'Istanbul, Turkey',NULL,NULL,0,0,0,50389,NULL),(1007,168,'2013-03-11T09:11:50.597','Johnner',NULL,'2016-12-20T22:38:38.603','http://twitter.com/johnner','Moscow, Russia',30,'<p>Passionate about Front-end, Android development and Robotics.\nMastering JavaScript, Java, Python and working on creation of the small network of smart robots.\n<br/></p>\n\n<p><strong>Languages:</strong></p>\n\n<ul>\n <li>JavaScript</li>\n <li>Python</li>\n <li>Java</li>\n</ul>\n\n<p><strong>Technologies:</strong></p>\n\n<ul>\n <li>JS MVC frameworks (Backbone, Spine, JavaScript MVC)</li>\n <li>Django</li>\n <li>CSS</li>\n <li>Android</li>\n <li>Bluetooth</li>\n</ul>\n',0,9,0,160111,NULL),(1008,1,'2013-03-11T13:26:38.143','Liam',NULL,'2013-03-11T13:26:38.143',NULL,'South Africa',NULL,NULL,0,0,0,261521,NULL),(1009,101,'2013-03-11T14:42:36.110','Elasticboy',NULL,'2014-11-21T14:34:31.990','http://www.essaion-soft.com/','France',30,'<p>C++/Java Software developer, fond of programming and robotic.<br />\nCurrently working as Android developer at Molotov in Paris.</p>\n',0,0,0,368144,NULL),(1010,46,'2013-03-11T17:28:07.687','Ben',NULL,'2017-03-08T13:57:09.003',NULL,NULL,NULL,NULL,0,0,0,544895,NULL),(1011,101,'2013-03-11T18:23:38.960','Rob Avery IV',NULL,'2013-03-11T18:23:38.960','https://github.com/javaknight1','United States',27,'<p>I writes the codes.</p>\n',0,0,0,1444109,'https://i.stack.imgur.com/01dbx.jpg'),(1012,97,'2013-03-11T21:36:58.520','josh131',NULL,'2013-08-13T09:03:07.917','',NULL,NULL,'',1,2,0,2097150,NULL),(1013,125,'2013-03-12T00:13:20.353','Assad Ebrahim',NULL,'2013-05-01T06:30:31.587','https://plus.google.com/u/0/+assadebrahim/about','London, United Kingdom',NULL,'<p>Im <strong>an applied mathematician &amp; engineer</strong>, living &amp; working just outside the London metro area.</p>\n\n<p>Over the years and on both sides of the Atlantic, Ive led a variety of quantitative &amp; operational challenges across intelligent systems &amp; software engineering, sonar, defense, environmental technology, robotics, and most recently the complex world of multi-channel retail.</p>\n\n<p>The common thread that links passion, profession, and play is applying technology, good design, and quantitative modelling and simulation, to build better products, enable better decisions, and optimise performance.</p>\n\n<p><em>Im always experimenting and tinkering, so fe