=\"http://iwavesystems.com\" rel=\"nofollow noreferrer\">iWave Systems Homepage</a></p>\n\n<p>From <a href=\"http://en.wikipedia.org/wiki/Sullia\" rel=\"nofollow noreferrer\">Sullia, D.K</a> and now in <a href=\"http://en.wikipedia.org/wiki/Bangalore\" rel=\"nofollow noreferrer\">Bangalore, India</a>.\nMy B.E. degree was from <a href=\"http://www.kvgengg.com/\" rel=\"nofollow noreferrer\">KVGCE</a>, Sullia. (<a href=\"http://vtu.ac.in/\" rel=\"nofollow noreferrer\">V.T.U</a>).</p>\n\n<p>Network Profile:</p>\n\n<p><a href=\"http://stackexchange.com/users/2281340\">\nprofile of Keshava on Stack Exchange http://stackexchange.com/users/flair/2281340.png\n</a></p>\n\n<p><strong><a href=\"https://kn.wikisource.org/wiki/%E0%B2%95%E0%B2%A8%E0%B3%8D%E0%B2%A8%E0%B2%A1%E0%B2%B5%E0%B3%87_%E0%B2%B8%E0%B2%A4%E0%B3%8D%E0%B2%AF_-_%E0%B2%8E%E0%B2%B2%E0%B3%8D%E0%B2%B2%E0%B2%BE%E0%B2%A6%E0%B2%B0%E0%B3%81_%E0%B2%87%E0%B2%B0%E0%B3%81_%E0%B2%8E%E0%B2%82%E0%B2%A4%E0%B2%BE%E0%B2%A6%E0%B2%B0%E0%B3%81_%E0%B2%87%E0%B2%B0%E0%B3%81\" rel=\"nofollow noreferrer\">       ,      !    ,    !!</a></strong></p>\n\n<p><a href=\"http://liveembedded.wordpress.com\" rel=\"nofollow noreferrer\">And this is just another wordpress blog!!</a> :P</p>\n\n<p>Im #SOreadytohelp</p>\n',0,0,0,2281340,'https://i.stack.imgur.com/nEOGM.jpg?s=128&g=1'),(1024,111,'2013-03-13T14:06:06.963','tmwoods',NULL,'2016-08-23T21:14:28.000',NULL,'Canada',34,'<p>Worked primarily in OO (C, C#, VB) writing software and firmware, as well as extensive SQL database administration. </p>\n\n<p>My education is from Simon Fraser University in the Mechatronics Systems Engineering program.</p>\n',0,0,0,2048629,'https://www.gravatar.com/avatar/d1c33b5212cd795da1f7ab47f532f18b?s=128&d=identicon&r=PG&f=1'),(1025,101,'2013-03-13T16:19:00.050','RQDQ',NULL,'2014-08-28T17:08:18.360','http://www.richquackenbush.com','Raleigh, NC',41,'<p>Im a coder.  Well, at least I think of myself as a coder.  If I really thought about it, it would probably occur to m