epts or fixes.</p>\n\n<p>So, if I include basic things in an answer to your question, it does not reflect my opinion of you nor is it an attempt to belittle you.</p>\n\n<p>Be Well</p>\n',0,0,0,391125,NULL),(1041,155,'2013-03-15T13:19:07.773','ivymike',NULL,'2014-12-16T17:52:09.570',NULL,NULL,NULL,NULL,1,8,0,66302,NULL),(1042,101,'2013-03-15T14:42:38.677','Eric',NULL,'2017-05-22T18:55:21.850','http://ericwieser.me/','United Kingdom',24,'<p>Roboticist, engineer, and web developer</p>\n\n<p>Part of the NumPy development team</p>\n',0,0,0,36018,NULL),(1043,101,'2013-03-15T20:02:01.903','MrZander',NULL,'2013-10-09T22:08:46.883',NULL,'California',24,NULL,0,0,0,367769,'https://i.stack.imgur.com/SUcUE.png'),(1044,1,'2013-03-15T22:48:19.567','user1426996',NULL,'2015-09-10T21:56:56.733',NULL,NULL,NULL,NULL,0,0,0,1529390,NULL),(1045,101,'2013-03-16T01:28:42.753','Alexan',NULL,'2017-07-14T20:06:40.833','https://signalrtc.com/','Austin, TX, United States',NULL,'<p>.NET Developer</p>\n',0,0,0,86534,'https://i.stack.imgur.com/U17en.png?s=128&g=1'),(1046,101,'2013-03-16T12:56:08.747','Anonymous Mohit',NULL,'2014-09-26T19:38:04.350',NULL,'Allahabad, India',29,'<blockquote>\n  <h3>Know Me, Know Life</h3>\n  \n  <h3>No Me, No Life</h3>\n</blockquote>\n\n<hr>\n\n<p>Working as a <code>ASP.NET</code> and <code>Android Developer</code>, Have reasonable experience with <code>PHP web development.</code></p>\n\n<p><code>Coding is my passion</code>, whether it is hardware or software.</p>\n\n<p>I am for sustainability, trying as best as possible to create and innovate to make how I live productive so the future generations can live without fear of a non sustainable future.</p>\n\n<p>Stack Overflow makes me a better programmer while I can offer my own help to make others better programmers.</p>\n\n<hr>\n\n<p>Last but not the least</p>\n\n<ul>\n<li>I am a common man. Just, another common man. And now, </li>\n<li>I wont sit quiet, I will do whatever I can...</li>\n<li>I cannot reach publications