opment_of_Exceptional_Talents\" rel=\"nofollow\">NODET</a>). I like programming and circuit designing for autonomous robots. I worked on different branch of robotics fields like micro-controller based circuits for mobile robots, machine learning and AI, Multi-Agent systems and autonomous agent. I have experience in teaching robotics and electronic designing and programming to students.</p>\n',1,0,0,2190758,'https://i.stack.imgur.com/Ly3YG.jpg?s=128&g=1'),(1072,101,'2013-03-24T23:49:09.657','Ernest3.14',NULL,'2017-01-23T12:20:33.217',NULL,'Seattle, WA',21,'<p>I like robots (specifically quadrotors), Kerbal Space Program, and food.</p>\n\n<p>Im most familiar with C++, although its such a gigantic beast theres still lots of it I dont understand :)</p>\n',0,0,0,1353159,NULL),(1073,101,'2013-03-25T00:38:35.653','tsbertalan',NULL,'2017-07-27T01:18:22.377','http://TomBertalan.com','New Jersey, USA',28,'<p>Im a PhD candidate in Chemical and Biological Engineering, but I do computational research that frequently only tenuously could be linked to ChBE.</p>\n',0,0,0,1268024,NULL),(1074,101,'2013-03-25T20:43:46.010','Hair_of_the_Dog',NULL,'2013-03-25T20:43:46.010','http://jeremyveleber.com','Lynnwood, WA',41,'<p>Question authority, respect individuals.</p>\n',0,0,0,460967,NULL),(1075,886,'2013-03-25T23:33:03.387','Octopus',NULL,'2017-08-22T19:11:44.593','http://goocto.com','Calgary',51,'<p>Been programming applications since 80s and websites since 90s. </p>\n\n<p>Photography, electronics, and RC hobbyist.</p>\n\n<p>Additional interests in robotics, graphic design.</p>\n\n<p>All around experimenter.</p>\n\n<p>Formal training in linguistics.</p>\n',11,119,6,1592532,'https://i.stack.imgur.com/09sbK.jpg'),(1076,101,'2013-03-26T08:07:37.193','Batsu',NULL,'2013-03-26T08:07:37.193',NULL,'Italy',NULL,NULL,0,0,0,1018509,NULL),(1077,101,'2013-03-26T09:49:57.273','Frederiek',NULL,'2013-03-26T09:49:57.273',NULL,'Belgium',28,NULL,0,0,0,351082,NULL),(1078,1,'2013-03-26T19:13:39.860','patmacs