e risk of a comment from my side like:</p>\n\n<blockquote>\n  <p>We dont want questions like: \"What is the colour of a dollar bill, the ones that have a $ like the Unix user prompt\" either.</p>\n</blockquote>\n\n<p><a href=\"https://stackexchange.com/users/1373414/anthon\"><img src=\"https://stackexchange.com/users/flair/1373414.png\" width=\"208\" height=\"58\" alt=\"profile for Anthon on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Anthon on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a></p>\n',2,2,0,1373414,NULL),(1118,101,'2013-04-03T18:15:06.477','GnrlBzik',NULL,'2013-06-15T19:33:28.140','http://www.bzik.net','Chicago, IL, United States',33,'<p>short to none</p>\n',0,2,0,69102,NULL),(1119,1,'2013-04-03T21:20:35.433','Ross Hunter',NULL,'2014-07-06T12:44:14.043',NULL,'United Kingdom',19,'<p>Programming enthusiast. Knows:</p>\n\n<ul>\n<li>Python</li>\n<li>C</li>\n<li>C++</li>\n<li>Java</li>\n<li>HTML</li>\n<li>XML</li>\n<li>CSS</li>\n<li>JavaScript</li>\n<li>SQL</li>\n</ul>\n\n<p>Wants to know:</p>\n\n<ul>\n<li>Perl</li>\n<li>Ruby</li>\n<li>C#</li>\n<li>Visual Basic</li>\n<li>Delphi</li>\n</ul>\n\n<p>Completed Projects:</p>\n\n<ul>\n<li>FakeBook (Website with SQL Database)</li>\n<li>SmarterPlanet (Website with SQL Database)</li>\n<li>SilverSurfers(Website with SQL Database)</li>\n<li>Multiple basic IDE Programs using C, C++ and Python</li>\n<li>Maze game with Java</li>\n</ul>\n\n<p>In Progress Projects:</p>\n\n<ul>\n<li>Codify (Android App)</li>\n</ul>\n\n<p>Future Projects:</p>\n\n<ul>\n<li>Codify for iOS (When I get am mac!)</li>\n<li>Other Android and iOS apps</li>\n<li>Websites for those apps</li>\n</ul>\n',0,0,0,2580766,NULL),(1120,1,'2013-04-03T21:30:11.600','oturw',NULL,'2013-04-03T21:30:11.600',NULL,NULL,NULL,NULL,0,0,0,1849609,NULL),(1121,16,'2013-04-03T23:22:43.713','Daniel Ferguson',NULL,'2013-04-03T23:22:43.713',NULL,NULL,NULL,NULL,0,0,0,2587212,NULL),(1122,101,'2013-04-03T23:58:1