0','Jon Ericson',NULL,'2015-08-07T15:54:10.930','http://jericson.github.io/','Downtown Burbank',44,'<p>Stack Exchange employs me as a <a href=\"http://blog.stackoverflow.com/2013/08/please-welcome-jon-ericson-community-manager/\">Community Manager</a>.  Ive been known to respond to <code>jericson@stackexchange.com</code>. Alternatively, I maintain an <a href=\"http://chat.meta.stackexchange.com/rooms/738/jons-java-jitter-joint\">office on chat</a>. (Please ignore the meta cruft.) </p>\n\n<p>I write about my experience as a community manager at <a href=\"http://jericson.github.io/\" rel=\"nofollow noreferrer\">jericson.github.io</a>. You can read about what Ive done over the years in my <a href=\"http://careers.stackoverflow.com/jericson\" title=\"Not guaranteed to be current.\"><em>curriculum vitae</em></a>.</p>\n\n<p>On a personal note, Im married and have three children.  Our oldest son loves school, friends, games, and music. Two of my children happen to have been born on the same day.  I <a href=\"http://taking1and1.wordpress.com/\" rel=\"nofollow noreferrer\" title=\"Yet another half-assed blog.\">sometimes write</a> about that experience. My wife loves taking care of people as a registered nurse.</p>\n\n<p>Dont have time for a full review of something?  Why not try <a href=\"http://fivesecondreview.wordpress.com/\" rel=\"nofollow noreferrer\" title=\"All reviews accurate and helpful or your money back.\">my 5-second reviews</a>?</p>\n\n<p>I once wrote for <a href=\"http://christianity.blogoverflow.com/author/jonericson/\" rel=\"nofollow noreferrer\" title=\"I haven&#39;t been on the rotation for a while, however.\">Eschewmenical</a>, which was an experiment of <a href=\"http://christianity.stackexchange.com/\">Christianity Stack Exchange</a>. For <em>a lot more</em> writing about the Bible, see <a href=\"https://hermeneutics.stackexchange.com/users/68/jon-ericson?tab=summary\">my Biblical Hermeneutics posts</a>.</p>\n\n<p>This is my corner of the company:</p>\n\n<p><a href=\"https://stackoverflow.com/company/team\"><img src=\"https://i.stack.imgur.com/4JlSbm.png\" alt=\"Up and to the right.\"></a></p>\n',0,0,0,1083,NULL),(1132,101,'2013-04-05T18:58:13.823','David Starkey',NULL,'2016-10-04T14:53:00.103','http://steamcommunity.com/id/godrox3','Illinois',28,'<p>programmer, gamer, geek</p>\n\n<p>A few incremental games Ive made:</p>\n\n<ul>\n<li><a href=\"http://www.gdriv.es/ClickCraft\" rel=\"nofollow\">ClickCraft</a></li>\n<li><a href=\"http://www.gdriv.es/clickmin\" rel=\"nofollow\">Clickmin</a></li>\n<li><a href=\"https://batophobia.github.io/ClickerDefense/index.html\" rel=\"nofollow\">ClickerDefense</a></li>\n</ul>\n\n<p>and some Ive helped with:</p>\n\n<ul>\n<li><a href=\"http://mamota.net/incraftmental/\" rel=\"nofollow\">incraftmental</a></li>\n</ul>\n',0,7,0,1153750,'https://i.stack.imgur.com/EVtKF.jpg?s=128&g=1'),(1133,101,'2013-04-06T11:49:00.793','Baard Kopperud',NULL,'2014-07-30T12:18:49.843','http://None','Lillehammer, Norway',43,'<p>38 yo male from Lillehammer in Norway.  Interested in computers, Internet, programming, web-design and electronics.  Watch lots of TV.  Love to read fanfiction.</p>\n',0,0,0,1776182,NULL),(1134,1,'2013-04-06T16:10:59.327','freakmeout',NULL,'2013-04-06T16:10:59.327',NULL,NULL,NULL,NULL,0,0,0,2599853,'https://i.stack.imgur.com/Rxs3m.jpg'),(1135,101,'2013-04-07T12:58:27.333','Hitesh Patel',NULL,'2013-04-07T12:58:27.333','https://www.facebook.com/hitesh24365','Ahmadabad, India',29,'<p>I have been developing wide range of mobile games, applications, websites and desktop applications for over 4.6 years in Android Platforms.</p>\n',0,0,0,480390,'https://i.stack.imgur.com/ggSox.jpg?s=128&g=1'),(1136,1,'2013-04-08T05:50:08.417','KrisTheBadAss',NULL,'2013-04-08T05:50:08.417',NULL,'Houston',35,NULL,0,0,0,1374526,'https://i.stack.imgur.com/pQH6Y.jpg'),(1137,211,'2013-04-08T09:11:17.533','Michel Gokan',NULL,'2015-09-24T23:13:53.630',NULL,NULL,28,'<p>A brown hair hacker with so many hopes.</p>\