ineer with a PhD in Mathematical Engineering and Simulation. Currently working as a researcher in Robotics.</p>\n',0,0,0,2381403,NULL),(1179,101,'2013-04-18T12:49:10.063','Sarfraz Ahmed',NULL,'2013-04-18T12:49:10.063',NULL,'Islamabad, Pakistan',28,'<p>Senior Software Engineer</p>\n',0,0,0,336272,NULL),(1180,101,'2013-04-18T12:58:35.917','Ivaylo Slavov',NULL,'2013-12-02T20:08:43.740',NULL,'Bulgaria',30,'<p>I am a self-taught developer (with high-school informatics background). I have experience primarily with the C# and Java languages, as well as web oriented technologies. Currently I work as a senior developer at Cayetano Gaming, where I employ my Java and JavaScript skills.</p>\n\n<p>In the area of software development, I am interested in enterprise solutions, distributed systems, modular software architectures and scalable cloud solutions. GUI and user experience is one of my recent points of interest.</p>\n\n<p>Alongside the fields in my professional orientation I am interested in psychology, which my current field of study at Sofia University. </p>\n\n<p>My hobby interests include marketing and finances, social relations, physics, biology, health and fitness, and religion. Sometimes I am composing music in my free time using audio software, as unfortunately, I am not good at playing any music instrument.</p>\n',0,0,0,418541,'https://i.stack.imgur.com/46saQ.jpg'),(1181,101,'2013-04-18T15:07:21.517','Unavailable',NULL,'2015-04-25T19:54:29.447',NULL,'Unavailable',NULL,'<p>Temporarily unavailable information.</p>\n',0,0,0,179005,NULL),(1182,101,'2013-04-18T18:04:46.983','Wing Tang Wong',NULL,'2016-08-01T20:03:33.087','http://wingtangwong.com/','Cupertino, CA',NULL,'<p><em>\"Operations Engineer by day, photographer, designer, programmer and tech tinkerer by night!\"</em></p>\n\n<p>I spend my days(and some nights) leveraging my experience in ensuring uptime and in helping to improve productivity! Operations Engineering work is a nice overlap of operational responsibilities and software design and engineering approaches. Being able to work with individuals from both backgrounds provides daily insights into how to make things better.</p>\n\n<p>My day to day tech oriented work is balanced by my personal explorations into illustration, photography, and 3d printing. Not surprisingly, I find ways in which to leverage my tech background in those expressive fields.</p>\n\n<p>Currently, Im very interested in 3d printing and 3d printers. Building and designing printers, writing the firmware, and designing the electronics to turn an idea into a real functioning machine is amazing and extremely rewarding.</p>\n',0,0,0,2461692,'https://i.stack.imgur.com/Pa5oO.jpg'),(1183,21,'2013-04-19T03:42:53.730','SRobertJames',NULL,'2013-05-07T23:56:03.293',NULL,NULL,NULL,NULL,0,0,0,2657257,NULL),(1184,11,'2013-04-19T06:25:31.523','user2298012',NULL,'2016-10-12T17:02:32.593',NULL,NULL,NULL,NULL,1,0,0,2657671,NULL),(1185,1,'2013-04-19T11:47:53.750','sanches',NULL,'2013-04-19T11:47:53.750',NULL,'honolulu',NULL,NULL,0,0,0,398504,NULL),(1186,1,'2013-04-19T17:49:00.123','ScoffingCoder',NULL,'2015-06-24T23:26:02.387','http://www.intelli-scarves.com','Plainfield, NJ',32,'<p>I am simply learning programming to create even more interesting things. So, in a nutshell, I am a Coder, Philosopher, Toastmaster, Writer , Engineer , and soon I will be a Pianist. My dream is invent something new to change this complicated world. its not easy, but I just have the idea to be there one day.</p>\n',0,0,0,2167497,'https://i.stack.imgur.com/kpK7K.png'),(1187,41,'2013-04-19T17:55:26.907','Jaeger0',NULL,'2013-04-19T17:55:26.907',NULL,NULL,NULL,NULL,2,0,0,2660448,NULL),(1188,101,'2013-04-19T18:10:43.143','AGS',NULL,'2014-01-22T03:58:40.467','http://stackoverflow.com','Brooklyn, NY',38,'<p>I am interested in Biology, Evolution, Genetics/Genomics, Machine Learning and Bayesian statistics.</p>\n',0,2,0,1710978,NULL),(1189,101,'2013-04-19T19:44:42.360','Juha Syrj l ',NULL,'2016-07-21T