g on personal electronics and robotics projects, I spend my free time hiking or biking.</p>\n',4,6,0,2132704,NULL),(1198,148,'2013-04-22T11:37:00.990','Nicolas Raoul',NULL,'2015-08-27T08:09:38.090','http://nrw.free.fr',NULL,NULL,'<p>I am <a href=\"http://nicolas-raoul.blogspot.com\" rel=\"nofollow\">Nicolas Raoul</a>, IT consultant in Tokyo.</p>\n\n<p>Feel free to copy/paste the source code from my StackExchange answers, I release it to the public domain.</p>\n',0,3,0,80211,NULL),(1199,101,'2013-04-22T13:12:15.730','Stephan Schielke',NULL,'2014-09-30T16:20:22.927','http://blog.schielke.it','North Rhine-Westphalia, Germany',19,'<p>Hi my name is Stephan and I am interested in mathematics, physics, computer science, politics, philosophy, cosmology and music.</p>\n',0,0,0,179206,'https://i.stack.imgur.com/5yh88.jpg?s=128&g=1'),(1200,101,'2013-04-22T14:51:09.467','user2307487',NULL,'2013-05-03T14:11:32.277','http://www.linkedin.com/pub/walter-guy/75/610/a0a','Czech Republic',28,'<p>I am an American expat in the Czech Republic. I am a part-time ESL teacher, and a full-time staff researcher for the Academy of Sciences of the Czech Republic, Institute of Physics. I specialize in HR-S/TEM and computer simulation thereof.</p>\n\n<p>As an aside, my favorite website is <a href=\"http://ocw.mit.edu/courses/find-by-topic/\" rel=\"nofollow\">MITs OpenCourseWare</a>, which I use extensively to learn as much as I can in my spare time and I highly recommend it for other people to do the same.</p>\n',0,0,0,2669850,NULL),(1201,101,'2013-04-22T19:27:12.433','Yuriy Nazarov',NULL,'2013-04-22T19:27:12.433','http://strangeway.org/','Russia',26,'<p>Software developer.</p>\n',0,0,0,1155460,NULL),(1203,101,'2013-04-23T12:34:45.003','florian.isopp',NULL,'2013-10-01T19:52:08.180',NULL,'Matrix2',29,'<p>...</p>\n',0,0,0,1814694,NULL),(1204,138,'2013-04-23T15:48:07.857','Gus',NULL,'2017-06-28T00:05:12.110',NULL,'Massachusetts',24,NULL,0,2,0,68071,NULL),(1205,101,'2013-04-23T23:18:45.740','Givi',NUL