d, I talked like a child, I thought like a child, I reasoned like a child. But when I became an adult, I set aside childish ways. For now we see in a mirror indirectly, but then we will see face to face. Now I know in part, but then I will know fully, just as I have been fully known. And now these three remain: faith, hope, and love. But the greatest of these is love. </p>\n\n<p>1 Corinthians 13</p>\n',0,6,0,1054692,NULL),(1208,1,'2013-04-24T14:41:27.943','Courtney',NULL,'2013-04-24T19:26:13.763',NULL,NULL,NULL,NULL,0,0,0,2350206,NULL),(1209,1,'2013-04-24T19:05:05.110','futuristixa',NULL,'2015-02-08T09:20:48.477',NULL,NULL,NULL,'<p>  am an amateur: android, artificial intelligence, java, future...   try to understand life only...</p>\n',0,0,0,1642678,NULL),(1210,1,'2013-04-24T19:12:41.927','Fnareva',NULL,'2013-05-02T15:37:30.560','',NULL,NULL,'',0,0,0,1782365,NULL),(1211,101,'2013-04-24T19:59:01.770','Anton Semenov',NULL,'2013-04-24T19:59:01.770','http://stackoverflow.com','Moscow, Russia',31,NULL,0,0,0,290969,'https://i.stack.imgur.com/rrxAO.jpg?s=128&g=1'),(1212,101,'2013-04-25T01:03:06.877','mote',NULL,'2013-06-02T14:04:30.493',NULL,'Toronto, Canada',42,NULL,0,0,0,7723,NULL),(1213,455,'2013-04-25T02:43:17.803','Chandough',NULL,'2017-06-28T14:49:13.280',NULL,'West Lafayette, IN',23,'<p>A hopeful Engineer.</p>\n',2,13,0,2615062,'https://i.stack.imgur.com/zi9aj.jpg'),(1214,101,'2013-04-25T15:08:50.513','LB--',NULL,'2013-04-25T15:08:50.513','http://www.LB-Stuff.com/','Richardson, TX',22,'<p>I primarily prefer C++ but I know Java just as well. I am also trying to learn and use other languages, such as Python.</p>\n',0,0,0,2220508,'https://i.stack.imgur.com/Hwttw.png?s=128&g=1'),(1215,101,'2013-04-25T17:27:54.610','Chris Masterton',NULL,'2013-04-25T17:27:54.610','http://www.xseedgames.com','Irvine, CA',42,'<p>Programmer of video game entertainments.</p>\n',0,0,0,61875,NULL),(1216,101,'2013-04-25T22:02:49.007','Robert Harvey',NULL,'2015-08-20T14:39:31.993','https://www.