everb, and other Real-Time randomness.</em></p>\n\n<p><a href=\"http://i.stack.imgur.com/sMiVH.png\" rel=\"nofollow\"><img src=\"http://i.stack.imgur.com/sMiVH.png\" alt=\"&quot;I have the power!&quot;\"></a></p>\n',0,5,0,6227,NULL),(1246,1,'2013-05-02T09:22:12.623','CenTauR',NULL,'2013-05-02T09:22:12.623','','Thiruvananthapuram, India',27,'',0,0,0,2484996,NULL),(1247,101,'2013-05-02T14:02:03.217','Jonathan',NULL,'2013-05-02T14:02:03.217','http://www.toolan.net','United Kingdom',44,'<ul><li>Started programming with Visual Basic 3.0, through 4-6 for the past fifteen years.</li>\n<li>Started using C# in a professional capacity in 2008.</li> \n<li>Started VB.NET 3.5 mid-2011</li>\n<li>MSSQL 6.5 through all versions to SQL 2008, and a bit of Oracle, MySql, PostgreSQL</li>\n<li>Dabbled with web design on and off.</li>\n<li>Have played with Linux boxes for the last five years.</li>\n<li>Wrote a game in Objective-C to see if I could (yes)</li>\n<li>Started programming for iOS in 2011</li>\n</ul>\n',0,0,0,4559,NULL),(1248,1,'2013-05-02T16:12:44.140','ebresie',NULL,'2015-08-18T22:32:47.257',NULL,NULL,NULL,NULL,0,0,0,74766,NULL),(1249,1,'2013-05-02T22:00:14.123','MayorAwesome',NULL,'2013-05-02T22:00:14.123','http://MayorAwesome.com','Chicago, IL',39,NULL,0,0,0,876582,'https://i.stack.imgur.com/nqYUX.gif'),(1250,101,'2013-05-02T22:34:02.020','Jane Panda',NULL,'2013-05-02T22:34:02.020',NULL,NULL,27,NULL,0,0,0,160262,'https://i.stack.imgur.com/DevgZ.jpg'),(1251,156,'2013-05-02T23:19:01.617','ott--',NULL,'2016-10-11T21:12:01.450','http://www.nop0.org/','Berlin / Germany',62,'<p>totally empty</p>\n',3,58,1,379210,NULL),(1252,101,'2013-05-02T23:42:09.900','Richard T',NULL,'2013-05-02T23:42:09.900',NULL,'Oakland, CA',NULL,'Ive been coding since 1977 when I got a Commodore Pet 32Kb, complete with double sided, double-density dual disk drive and tractor feed, programmable dot matrix printer. I created hardware for it, too - my own pixel addressable video, memory expansion, sound, etc... And I invented a small navigational computer for light aircraft, but found it impossible to certify with the FAA...<p>\r\n<p>\r\nI wrote (by myself) a complete real-time, multi-tasking operating system in Motorola 6809 that (even 25 years later) controls oil pipelines, ships, and refineries.<p>\r\n<p>\r\nI wrote device drivers for VMS, did crash dump analysis... invented products for Ingres - and literally wrote the book on performance tuning the Ingres RDBMS. I led a large research team in UC Berkeleys ERL, founded three software companies ... <p>\r\n<p>\r\nAll that and I <i>still</i> love to write code.<p>\r\n<p>\r\nBesides that, Im a New Orleanian, a pilot, play trumpet, sculpt in metal...<br>',0,0,0,13432,NULL),(1253,118,'2013-05-03T07:41:10.480','awiebe',NULL,'2015-08-02T03:30:17.660',NULL,NULL,NULL,NULL,0,1,0,795711,NULL),(1254,101,'2013-05-03T09:15:39.220','Manish Agrawal',NULL,'2013-05-03T09:15:39.220','http://www.codeslay.com','Noida, India',25,'<ul>\n<li>Having experience of more than <strong>6 years</strong> in iPhone Development.   </li>\n<li><strong>Obsession</strong>: Swift, Objective, OpenCV </li>\n<li><strong>Verticals</strong>: OTT, VR, E-commerce based apps</li>\n<li><strong>Interests</strong>: Meditation, Technology</li>\n</ul>\n',0,0,0,948703,NULL),(1255,101,'2013-05-03T14:56:39.643','Ron Smith',NULL,'2017-08-10T03:31:06.210','http://www.thataintworking.com','Flower Mound, TX',50,'<p>I started my first software development company when I was 16. That was over 25 years ago. Now I just have to do that all over again and I can retire.</p>\n\n<p>I am really getting into Python these days, especially since Java has turned into nothing but frameworks and XML Hell.</p>\n',0,4,0,67136,NULL),(1256,1,'2013-05-03T15:45:01.810','jodi',NULL,'2013-05-03T15:45:01.810',NULL,NULL,NULL,NULL,0,0,0,2721266,NULL),(1257,101,'2013-05-03T17:31:40.147','avakar',NULL,'2013-05-03T17:31:40.147','http://ratatanek.cz','Czech Republic',31,'My pet peeve: people who dont know