rols : <a href=\"https://www.cocoacontrols.com/authors/DipenPanchasara\" rel=\"nofollow\">https://www.cocoacontrols.com/authors/DipenPanchasara</a></li>\n</ul>\n\n<p>Keep in touch with me on my Professional &amp; Social networks</p>\n\n<ul>\n<li>LinkedIn : <a href=\"https://in.linkedin.com/in/dipen-panchasara-24a87126\" rel=\"nofollow\">https://in.linkedin.com/in/dipen-panchasara-24a87126</a></li>\n<li>SO Profile : <a href=\"https://careers.stackoverflow.com/DipenPanchasara\">https://careers.stackoverflow.com/DipenPanchasara</a></li>\n<li>Twitter : <a href=\"https://twitter.com/dipenpanchasara\" rel=\"nofollow\">https://twitter.com/dipenpanchasara</a></li>\n</ul>\n',0,0,0,966752,'https://i.stack.imgur.com/x5mAb.jpg'),(1280,8,'2013-05-08T18:50:56.500','user1669089',NULL,'2017-06-27T13:24:57.277',NULL,NULL,NULL,NULL,0,0,0,1839351,NULL),(1281,163,'2013-05-08T20:51:17.910','Ess Kay',NULL,'2017-08-23T14:41:00.463','http://www.globeprofit.com','New York, United States',97,'<p>You are what you eat.</p>\n\n<p>I eat knowledge</p>\n',3,6,0,2619138,'https://i.stack.imgur.com/cVfy5.jpg'),(1282,113,'2013-05-09T03:40:49.843','Shawn Le',NULL,'2017-07-14T02:58:10.153',NULL,'Taipei',NULL,'<p>Mechatronics Engineer</p>\n',0,0,0,1024015,NULL),(1283,101,'2013-05-09T04:55:18.013','Wayne Tun',NULL,'2013-05-09T04:55:18.013','http://www.waynetunmyint.blogspot.com','Yangon, Myanmar',33,'<p>Hi , I am Wai Lin Tun @ Wayne Tun Myint. I am a web developer from Myanmar. I have knowledge and experience on C#,Asp.net , PHP, Java ,EJB, MySQL, MSSQL and Oracle DB.</p>\n',0,0,0,74461,NULL),(1284,101,'2013-05-09T11:48:18.387','MadManMonty',NULL,'2013-05-09T11:48:18.387','https://github.com/MadmanMonty','London, United Kingdom',38,'<p>Dabble in lots of development languages, PHP - Symfony2 being my core (right now!)</p>\n',0,0,0,231783,NULL),(1285,103,'2013-05-09T12:44:14.427','Oszkar',NULL,'2017-08-18T07:50:11.143','http://oszkar.me','Tokyo, Japan',31,'<p>I am a robotics engineer at the AI/robotics company Ascent Robotics in Tokyo, Japan. I am also an online masters (OMSCS) student in Computer Science at Georgia Tech where I am specializing in robotics and machine learning.</p>\n',0,1,0,343865,NULL),(1286,101,'2013-05-09T15:53:42.193','Dan D.',NULL,'2014-09-09T16:24:51.627',NULL,'Clemson, SC',30,'<p><em>for unless what we do is useful, the glory of it is vain</em></p>\n\n<p><a href=\"http://stackexchange.com/users/165387\">\n<img src=\"http://stackexchange.com/users/flair/165387.png\" width=\"208\" height=\"58\" alt=\"profile for Dan D.\">\n</a></p>\n\n<p>For those that were wondering my picture is from the painting<br>\n<a href=\"http://en.wikipedia.org/wiki/Wanderer_above_the_Sea_of_Fog\" rel=\"nofollow\"><strong>Wanderer above the Sea of Fog</strong> by <em>Caspar David Friedrich</em> (1818)</a>. <a href=\"http://en.wikipedia.org/wiki/File%3aCaspar_David_Friedrich_032.jpg\" rel=\"nofollow\"> </a></p>\n',0,3,0,165387,NULL),(1287,131,'2013-05-09T17:09:46.793','J3RN',NULL,'2014-09-18T04:22:33.640','http://www.j3rn.com',NULL,NULL,NULL,1,0,0,1138947,NULL),(1288,101,'2013-05-09T18:26:41.753','Zeta.Investigator',NULL,'2017-08-09T16:40:34.003',NULL,NULL,NULL,NULL,0,2,0,1621785,'https://www.gravatar.com/avatar/804daf70079b8efe061c3c06b1b4b6f7?s=128&d=identicon&r=PG&f=1'),(1289,44,'2013-05-09T21:07:36.140','Haider',NULL,'2017-06-30T21:48:09.237',NULL,NULL,NULL,NULL,2,0,0,1813785,NULL),(1290,101,'2013-05-09T21:09:41.993','Cody Smith',NULL,'2017-08-26T12:44:30.950',NULL,NULL,26,NULL,0,0,0,1593496,NULL),(1291,101,'2013-05-10T12:06:38.280','onemanstartup',NULL,'2013-05-10T12:06:38.280',NULL,NULL,NULL,NULL,0,0,0,401603,NULL),(1292,121,'2013-05-10T18:12:58.117','redreggae',NULL,'2014-06-01T21:33:45.087','http://www.bitworking.de/','Cologne, Germany',NULL,'<p>Im a self-employed software developer located in cologne germany. My main skills are PHP, MySql, Javascript, Actionscript, HTML and CSS. My other programming languages are C#, C, C++ and Java. I like to work with Zend Framework, Wordpress, Flex, jQuery and my own MVC framework.</p>\n\n<p>In my free time I do a lot of 3D and sound programming and also play music by my own. I have a small music studio where I do beats (reggae, hiphop, soul, jazz etc.) and write some texts.</p>\n\n<p>Another hobby is building robots and other electronic stuff with microcontrollers or fully analog. My latest project this year was a boombox in a beer crate that I built with my brother.</p>\n',1,0,0,2205225,'https://i.stack.imgur.com/AkYlI.png?s=128&g=1'),(1293,1,'2013-05-10T19:07:08.137','Bruno',NULL,'2016-04-18T14:30:58.823','https://www.facebook.com/barrud5','S o Paulo, Brazil',29,NULL,0,0,0,2082669,'https://i.stack.imgur.com/tJrcl.jpg'),(1294,101,'2013-05-10T20:00:54.600','Adrian',NULL,'2013-08-06T01:29:28.867',NULL,NULL,NULL,'<p>Im a C/C++ contractor with 12+ years of experience.  Currently, I am trying to break into the hardware/firmware development world.  I just <em>love</em> pushing the boundaries of languages and hardware.</p>\n\n<p>I know a variety of languages, as esoteric as <a href=\"http://en.wikipedia.org/wiki/Prolog\" rel=\"nofollow\">prolog</a> and as recent as <a href=\"http://en.wikipedia.org/wiki/C_Sharp_%28programming_language%29\" rel=\"nofollow\">C#</a> and as difficult as <a href=\"http://www.boost.org/doc/libs/1_53_0/libs/preprocessor/doc/index.html\" rel=\"nofollow\">C/C++ macro</a> and <a href=\"http://www.boost.org/doc/libs/1_53_0/libs/mpl/doc/index.html\" rel=\"nofollow\">C++ template</a> <a href=\"http://en.wikipedia.org/wiki/Metaprogramming\" rel=\"nofollow\"><em>meta programming</em></a>, which are more like libraries to manipulate code generation.</p>\n\n<p>Sometimes I find that employers fail to realize is that learning languages is easy, libraries a little more difficult, but learning how to learn is something that most people dont have.  Being able to break down a system into its components and building it up again is a critical skill that should be recognised.</p>\n',0