,'2016-08-02T13:53:03.453',NULL,'Coralville, IA',36,'<p>Hard worker.  Smart guy.</p>\n',0,0,0,1629516,NULL),(1445,414,'2013-06-07T21:04:32.140','Demetris',NULL,'2017-08-24T20:45:20.750','http://psychoul.com','Nicosia, Cyprus',37,'<p>Overall enthusiast about electronics, robotics, programming, 3D printing ...</p>\n',4,28,2,856075,'https://www.gravatar.com/avatar/a376fc430fcbbc49a8c456ab12864014?s=128&d=identicon&r=PG&f=1'),(1447,101,'2013-06-08T04:23:55.027','mitchfish36',NULL,'2013-06-08T04:23:55.027',NULL,'Indianapolis, IN',NULL,NULL,0,0,0,2484426,NULL),(1448,101,'2013-06-08T12:13:14.827','Irvin Dominin',NULL,'2013-06-08T12:13:14.827','http://irvindev.wordpress.com','Turin, Italy',34,'<p>Im a technology and coding passionate from Italy (Turin).</p>\n\n<p>#SOreadytohelp</p>\n\n<p><a href=\"http://www.linkedin.com/pub/irvin-dominin/28/777/406\" rel=\"nofollow noreferrer\"></p>\n\n<p><img src=\"http://www.linkedin.com/img/webpromo/btn_viewmy_160x33.png\" width=\"160\" height=\"33\" alt=\"View Irvin Dominins profile on LinkedIn\"></p>\n\n<p></a></p>\n\n<p>Personal Email: irvin.dominin at gmail dot com; if you want to mail me about StackOverflow write StackOverflow in the subject.</p>\n\n<p>Thanks for supporting Firefox and the Mozilla mission to build a better Web for all!\n<a href=\"https://affiliates.mozilla.org/referral/68975/\" rel=\"nofollow noreferrer\">\n    <img src=\"https://affiliates.mozilla.org/media/uploads/image_banners/c02fc7194d4fff8d1d221b098d67900118900685.png\" alt=\"\">\n</a></p>\n\n<p>Anti-IF Campaign:</p>\n\n<p><a href=\"http://www.antiifcampaign.com\" rel=\"nofollow noreferrer\">\n  <img src=\"http://antiifcampaign.com/assets/banner_ive-joined.gif\" width=\"120\" height=\"60\" alt=\"I have joined Anti-IF Campaign\">\n</a></p>\n\n<p>Im working, or have worked, with:</p>\n\n<ul>\n<li>VB6</li>\n<li>VB .NET</li>\n<li>ASP .NET</li>\n<li>C#</li>\n<li>Javascript (+ jQuery)</li>\n<li>HTML &amp; CSS</li>\n<li>TSQL</li>\n<li>ASP NET MVC</li>\n</ul>\n\n<p>My current OSs are: Windows 10, Windows 7, OSX El-Capitan, iOS 9, Android 4.3</p>\n\n<p>Learning:</p>\n\n<ul>\n<li>Objective-C</li>\n<li><s>Angular Js</s></li>\n<li>React</li>\n</ul>\n\n<p>(I know is too much for my spare time!!)</p>\n\n<p>I really dislike:</p>\n\n<ul>\n<li>questions on JavaScript, answered with use jQuery or solved using jQuery when its not needed</li>\n<li>People treating StackOverflow as a code farm</li>\n<li>No acceptance or UP-votes for people and questions/answers that deserved it</li>\n</ul>\n',0,0,0,337653,'https://i.stack.imgur.com/PoAXM.jpg?s=128&g=1'),(1449,111,'2013-06-09T06:07:36.820','Ritesh',NULL,'2013-10-27T14:27:06.727','http://www.codingdash.com','Bangalore, India',26,'<p>A thinker and learner, love to surrounded by the machines and binaries. I started programming about 6 years ago. My fields of interest are Web Development, experimenting with CUI, and game programming.</p>\n\n<p>Find me on <a href=\"https://twitter.com/codingdash\" rel=\"nofollow\">twitter</a> or see my <a href=\"http://www.codingdash.com\" rel=\"nofollow\">personal website</a>.</p>\n',0,0,0,2372692,NULL),(1450,101,'2013-06-09T06:14:22.360','ElektroStudios',NULL,'2013-06-09T06:14:22.360','http://foro.elhacker.net/profiles/elektrohcker-u436313.html','Valencia, Spain',31,NULL,0,0,0,1297653,'https://i.stack.imgur.com/g9kGm.png'),(1452,103,'2013-06-09T13:12:53.463','kaiser',NULL,'2016-09-20T05:43:35.817','http://unserkaiser.com','Vienna, Austria',37,'<p>Hi fellow reader,</p>\n\n<p>if you want to get in touch with me, then go with <code>[wecodemore](at)[gmail]</code>. Note, that isnt an additional support route and I wont answer such requests.</p>\n\n<h3><img src=\"https://i.imgur.com/79rN1dF.png\" width=\"16\" height=\"16\" /> Twitter</h3>\n\n<blockquote>\n  <p>  Its time to meet me on <a href=\"https://twitter.com/unserkaiser\" rel=\"nofollow noreferrer\"><img src=\"https://i.imgur.com/79rN1dF.png\" width=\"12\" height=\"12\" /> Google+</a>.</p>\n</blockquote>\n\n<h3>