2013-06-12T20:36:50.067','http://stephenashelton.com','Colorado Springs, CO',33,'<p>Full-stack software engineer with 10+ years of programming experience, offering a diverse range of engineering talent. Extensive experience designing C++ products on embedded Linux systems. Comfortable with entire product lifecycle from design to support.</p>\n',0,2,0,508778,'https://i.stack.imgur.com/fo9SZ.jpg?s=128&g=1'),(1473,513,'2013-06-12T23:15:42.260','foobarbecue',NULL,'2017-01-09T05:51:43.230',NULL,'Socorro, NM',NULL,'<p>Im an early-career volcano technologist with interests including speleology and astrobiology. I play cello, build flying robots, and enjoy <a href=\"http://mountainproject.com/u/aaron-curtis/108689768\" rel=\"nofollow\">sport climbing</a>.</p>\n\n<p>At the moment I am in northern Chile with the <a href=\"http://trailbyfire.org\" rel=\"nofollow\">Trail by Fire</a> project.</p>\n\n<p>I have experience with:</p>\n\n<ul>\n<li>Programming languages: Python, Javascript / CSS / HTML5, Matlab, Java, C and C++ and one time I got stuck in Antarctica so I learned brainfuck</li>\n<li>Web frameworks: Django, Meteor</li>\n<li>Unmanned aerial vehicles (<a href=\"https://www.youtube.com/watch?v=gMh8kM4o6tk\" rel=\"nofollow\">demo video</a>): Many ardupilot-based systems, recently builds based on Turboace Matrix and FireFLY6. Also lots of stick time on DJI Phantom 3 pro, DJI Matrice 100</li>\n<li>Laser scanning: Ive operated Optech, Riegl, and Leica systems and am competent in processing data from all of these. In addition to manufacturers software, I use Blender, Polyworks, Meshlab, and CloudCompare extensively.</li>\n<li>Multi-view stereophotogrammetry: Made <a href=\"https://www.youtube.com/watch?v=hz2ZRb-2tXg\" rel=\"nofollow\">some stuff</a> for NASA JPL and <a href=\"https://www.youtube.com/watch?v=R7vtnCOkifQ\" rel=\"nofollow\">some</a> for a National Geographic expedition.</li>\n<li>Geophysical hardware: Fiber-optic distributed temperature sensing systems, Onset dataloggers, Campbell dataloggers, Quanterra Q330, ancient Guralp seismometers and digitizers, Trimble GPS things</li>\n<li>Geophysical software: Im good with Earthworm.</li>\n</ul>\n\n<p>Some of my creations on the web are:</p>\n\n<ul>\n<li><a href=\"https://github.com/foobarbecue/afterflight\" rel=\"nofollow\">AfterFlight</a>: Browser-based UAV log and video analysis</li>\n<li><a href=\"http://climbshare.com\" rel=\"nofollow\">climbshare.com</a>: 3D interactive multiplayer climbing guides (early development)</li>\n<li><a href=\"http://erebuscaves.nmt.edu\" rel=\"nofollow\">Erebus Cave and Fumarole Database</a>: Database of Erebus fumarolic ice caves including timeseries data</li>\n<li><a href=\"http://gottafix.it\" rel=\"nofollow\">gottafix.it</a>:  Edit the web</li>\n<li>Kicksnorter: publicly report success / failure of crowdfund projects (retired since its against Kickstarter policy)</li>\n<li>quirktonomicon.com: Alternative interface to quirky.com (retired)</li>\n</ul>\n',2,13,1,306152,'https://i.stack.imgur.com/HRl3V.jpg'),(1474,31,'2013-06-13T00:01:34.813','Jean-Baptiste',NULL,'2013-07-19T04:09:14.250','http://www.buildamulticopter.com','Brisbane, Australia',NULL,'<p>Founder and President of the South East Queensland Drone Users Group.</p>\n\n<p>Currently developing a website and instructional e-book to help beginners design, build and safely fly their own multicopter.</p>\n\n<p>The website will include free tutorial videos, and software to calculate and evaluate components for multicopter designs.  It also includes a comprehensive FAQ section written by various experts in the field.</p>\n\n<p>Register your interest at www.buildamulticopter.com, or drop me an email.</p>\n',0,3,0,2891748,NULL),(1476,101,'2013-06-13T05:24:12.213','Gangadhar',NULL,'2013-06-13T05:24:12.213','http://stackoverflow.com/users/1885193/gangadhar','India',NULL,'<p>Developer works with C &amp; C++, Unix &amp; Windows and some libraries.</p>\n\n<h2>#SOreadytohelp</h2>\n\n<hr>\n\n<p> The first