rel=\"nofollow\">Google+</a>, <a href=\"http://www.linkedin.com/in/mikebd\" rel=\"nofollow\">LinkedIn</a>, <a href=\"http://answers.splunk.com/users/160112/mikebd\" rel=\"nofollow\">Splunk Answers</a>, <a href=\"https://twitter.com/mikebd\" rel=\"nofollow\">Twitter</a></p>\n',0,0,0,59811,'https://i.stack.imgur.com/7nLYR.png'),(1542,121,'2013-06-24T12:31:22.347','Hjulle',NULL,'2014-07-27T17:14:38.583',NULL,NULL,NULL,'<p>Todo: <a href=\"http://groups.google.com/group/haskell-charts/browse_thread/thread/e94741badb508553?pli=1\" rel=\"nofollow\">http://groups.google.com/group/haskell-charts/browse_thread/thread/e94741badb508553?pli=1</a></p>\n',1,0,0,903673,NULL),(1543,101,'2013-06-24T12:58:53.273','medivh',NULL,'2013-08-15T09:42:02.847','http://afconsult.com','Novo Nordisk, Kalundborg, Denmark',NULL,'<p>Electronics engineer and embedded programmer.</p>\n\n<p>Currently employed as Automation Engineer.</p>\n',0,4,0,356720,NULL),(1544,101,'2013-06-24T14:29:42.847','Yehuda Shapira',NULL,'2015-02-16T09:11:24.037','https://developerthingsblog.wordpress.com/','Israel',31,'<p>Programmer, aspiring writer, hobbyist game-designer.<br>\nTends to be tired.<br>\nAvid coffee-drinker.</p>\n',0,0,0,284506,'https://i.stack.imgur.com/yoqj6.jpg?s=128&g=1'),(1545,101,'2013-06-24T19:25:00.123','ComFreek',NULL,'2014-09-24T17:08:44.977',NULL,'Germany',NULL,'<blockquote>\n  <p> Measuring programming progress by lines of code is like measuring\n    aircraft building progress by weight. <br>\n  &mdash; <strong>Bill Gates</strong>\n  </blockquote></p>\n\n\n<p>Twitter: @comfreek</p>\n\n<p>I love <a href=\"/questions/tagged/javascript\" class=\"post-tag\" title=\"show questions tagged &#39;javascript&#39;\" rel=\"tag\">javascript</a> (also <a href=\"/questions/tagged/typescript\" class=\"post-tag\" title=\"show questions tagged &#39;typescript&#39;\" rel=\"tag\">typescript</a>) and <a href=\"/questions/tagged/php\" class=\"post-tag\" title=\"show questions tagged &#39;php&#39;\" rel=\"tag\">php</a>! </p>\n\n<h2>Nice quotes</h2>\n\n<h3>Downvote taxes</h3>\n\n<blockquote>\n  <p>Following that it is 1 of 7 (15%) I assume it was taxes.<br>\n  &mdash;  <a href=\"http://stackoverflow.com/users/251311/zerkms\">zerkms</a> in <a href=\"http://stackoverflow.com/questions/19234709/javascript-strange-function-arrangement-dont-understand#comment28470076_19234767\">this comment</a>\n  </blockquote></p>\n\n\n<h3>Asking for a PHP book</h3>\n\n<p><p>Gordons comment about code principles: <a href=\"http://chat.stackoverflow.com/transcript/message/5565018#5565018\">StackOverflow chat message</a></p>\n\n<h3>Not enough jQuery</h3>\n\n<p>Image: <a href=\"http://www.doxdesk.com/img/updates/20091116-so-large.gif\" rel=\"nofollow noreferrer\">http://www.doxdesk.com/img/updates/20091116-so-large.gif</a></p>\n\n<h3>R.I.P. SOAP</h3>\n\n<p>&rarr; <a href=\"http://stackoverflow.com/a/77018/603003\">SOAP vs. REST</a> (might be not 100% true though!)<br>\n&rarr; <a href=\"http://stackoverflow.com/a/8983122/603003\">SOAP Overhead explained by Martin Lawrence &amp; Big Mama</a></p>\n\n<hr>\n\n<h2>Misc.</h2>\n\n<h3>Common wrong assumptions</h3>\n\n<ul>\n<li>No one needs syntax highlighting or indentions</li>\n<li>Beta status is an excuse for security vulnerabilities</li>\n<li>Screenshots of code are valid code snippets</li>\n</ul>\n\n<h3>Favorite series of questions/answers</h3>\n\n<p>Regex series: <a href=\"http://meta.stackexchange.com/q/62695/191400\">http://meta.stackexchange.com/q/62695/191400</a></p>\n\n<p>Incl. this question: <a href=\"http://stackoverflow.com/questions/2795065/how-to-determine-if-a-number-is-a-prime-with-regex?lq=1\">http://stackoverflow.com/questions/2795065/how-to-determine-if-a-number-is-a-prime-with-regex?lq=1</a></p>\n\n<h3>Common mistakes Ive encountered on SO</h3>\n\n<ul>\n<li>SO as your personal debug console.</li>\n<li><p>The old MySQL extension is deprecated (read loud: \"<strong>OUTDATED</strong>, <strong>DEPRECATED</strong> AND <strong>OBSOLETE</strong>)<br>\n&rarr; MySQLi (with Prepared Statements) or PDO (and be sure to deactivate emulated Prepared Statements there: deactivate <code>PDO::ATTR_EMULATE_PREPARES</code>).\n<br>\nMore information @ <a href=\"http://stackoverflow.com/questions/134099/are-pdo-prepared-statements-sufficient-to-prevent-sql-injection/12202218#12202218\">http://stackoverflow.com/questions/134099/are-pdo-prepared-statements-sufficient-to-prevent-sql-injection/12202218#12202218</a></p></li>\n<li><p>Not using <a href=\"http://php.net/htmlspecialchars&quot;\" rel=\"nofollow noreferrer\"><code>htmlspecialchars()</code></a> for outputting user-edited HTML code</p></li></p></li>\n<li><p><code>mysql(i)_real_escape_string()</code> is not 100% safe when used wrong<br>\n&rarr;See this question: <a href=\"http://stackoverflow.com/q/5741187/603003\">http://stackoverflow.com/q/5741187/603003</a></p></li>\n</ul>\n\n<h2>If youre that far: here are some nice code snippets Ive written</h2>\n\n<ul>\n<li><p>JS (&amp; jQuery): searchFirstTextOccurence() in DOM: <a href=\"http://stackoverflow.com/a/19523124/603003\">http://stackoverflow.com/a/19523124/603003</a></p></li>\n<li><p>PHP: addQueryParameters() for adding query parameters to an existing URI string: <a href=\"http://stackoverflow.com/a/19984204/603003\">http://stackoverflow.com/a/19984204/603003</a></p></li>\n</ul>\n\n<h2>Some funny names other people gave me</h2>\n\n<ul>\n<li>ComFreak (with \"ae\")</li>\n<li>CompFreek</li>\n<li>ComicFreek</li>\n<li>CornFreek</li>\n<li>ComFreeh</li>\n</ul>\n',0,0,0,297461,NULL),(1546,1,'2013-06-25T11:53:12.390','C2Call',NULL,'2013-06-25T11:53:12.390','http://www.c2call.com/','Werl, Germany',NULL,'<p>C2Call GmbH has been developing video chat, voice calling and messaging solutions for the computing cloud since 2008. Our SDK is available for mobile app developers free of charge. By integrating C2Calls technology into their mobile apps, developers can now have their users communicate across multiple apps, on multiple platforms. App users can then use video chat, rich media messaging, group audio and video calls and share location info with other users, all within one app!</p>\n',0,0,0,2965814,'https://i.stack.imgur.com/uc2Fb.jpg?s=128&g=1'),(1547,1,'2013-06-25T12:47:50.140','Eric',NULL,'2013-06-25T12:47:50.140',NULL,NULL,NULL,NULL,0,0,0,1563220,NULL),(1548,1,'2013-06-26T06:20:15.327','Anwar Asseef',NULL,'2013-08-21T10:41:40.147','http://anwarasseef.com','Kochi, India',25,'<p>Lifelong student</p>\n',0,0,0,2970617,'https://i.stack.imgur.com/DrAD6.jpg?s=128&g=1'),(1549,101,'2013-06-26T12:23:12.940','PriestVallon',NULL,'2013-06-26T13:56:19.317','http://cs1.ucc.ie/~es1','Ireland',28,'<p>Computer Science graduate from Dungarvan in Ireland.</p>\n',0,3,0,1279834,NULL),(1550,101,'2013-06-26T12:44:31.433','0decimal0',NULL,'2013-06-26T12:44:31.433',NULL,'India',27,NULL,0,0,0,1641397,'https://i.stack.imgur.com/S45L5.jpg?s=128&g=1'),(1551,101,'2013-06-26T13:26:38.410','Pip',NULL,'2017-08-06T16:44:14.567',NULL,'United States',18,'<p>Hey!</p>\n\n<p>Im a hobby game developer, currently working on an experimental C# game framework called Flare, which aims to automate the tasks that I and others commonly do for every project, such as opening a window or getting input in a platform-independent way. Flare provides OpenGL 3+ core bindings, but not compatibility bindings so supports OpenGL 3.0 and upwards, with the default context being 3.2 core. It also provides an optional XNA-like sprite rendering system as well as a 2D text rendering system.</p>\n\n<p>I have experience with programming languages including C#, C/C++, Ruby, Java, and Python, and a passing acquaintance with several others. I also have experience with technologies including XNA/MonoGame, Unity, Ruby on Rails, FRC/FTC robotics libraries (WPILib and the FTC SDK), as well as the afore-mentioned OpenGL and some mobile development.</p>\n\n<p>I currently attend high school in the United States.</p>\n\n<hr>\n\n<h2>Links</h2>\n\n<ul>\n<li><p><a href=\"https://github.com/WardBenjamin\" rel=\"nofollow\">Github</a>: WardBenjamin</p></li>\n<li><p><a href=\"https://twitter.com/TheProgramm3r\" rel=\"nofollow\">Twitter</a>: TheProgramm3r</p></li>\n<li><p><a href=\"http://benjaminward.herokuapp.com\" rel=\"nofollow\">Website</a>: Benjamin Ward</p></li>\n</ul>\n',0,2,0,2601267,'https://i.stack.imgur.com/iIz8r.png?s=128&g=1'),(1552,1,'2013-06-26T18:02:11.730','Byron Sanchez',NULL,'2013-06-26T18:02:11.730','http://hackbytes.com','Philadelphia, PA',27,'<p>My name is <a href=\"http://hackbytes.com\" rel=\"nofollow\" title=\"hackBytes\">Byron Sanchez</a>. I am a mobile and web application developer living in in Philadelphia, PA. I have been studying development for about three years now, and have a strong interest in programming, computer science, as well as graphic design. I love working with others in creating great products and applications.</p>\n\n<p>Websites:</p>\n\n<ul>\n<li><a href=\"http://hackbytes.com\" rel=\"nofollow\" title=\"hackBytes\">hackBytes</a></li>\n<li><a href=\"http://www.linkedin.com/in/byronsanchez/\" rel=\"nofollow\" title=\"Byron Sanchezs LinkedIn Profile\">LinkedIn</a></li>\n<li><a href=\"https://github.com/byronsanchez\" rel=\"nofollow\" title=\"Byron Sanchezs Github Profile\">Github</a></li>\n<li><a href=\"https://twitter.com/byronsanchez\" rel=\"nofollow\" title=\"@byronsanchez\">Twitter (@byronsanchez)</a></li>\n<li><a href=\"https://plus.google.com/105947647411091420403\" rel=\"nofollow\" title=\"Byron Sanchezs Google Plus Profile\">Google Plus</a></li>\n</ul>\n\n<p>Email: bfs5030@gmail.com</p>\n',0,0,0,2133100,NULL),(1553,101,'2013-06-26T20:37:19.157','laktak',NULL,'2013-07-03T13:08:52.230','https://github.com/laktak',NULL,43,'<p>My backslash escaped!</p>\n',0,0,0,21653,'https://i.stack.imgur.com/ERr4H.png?s=128&g=1'),(1555,118,'2013-06-26T22:21:19.833','nwellnhof',NULL,'2013-06-27T20:59:11.910','http://aevum.de/','Munich, Germany',NULL,'<h3>About</h3>\n\n<ul>\n<li>Software developer and owner at <a href=\"http://aevum.de/\" rel=\"nofollow\">aevum</a> in beautiful Munich, Germany, famous for its <a href=\"http://www.munichbeergardens.com/\" rel=\"nofollow\">beer gardens</a>, <a href=\"http://www.muenchenkotzt.de/\" rel=\"nofollow\">Oktoberfest</a> and <a href=\"http://www.reddit.com/r/fcbayern\" rel=\"nofollow\">FC Bayern</a>.</li>\n<li>Likes to hack on open source projects such as <a href=\"http://lucy.apache.org/\" rel=\"nofollow\">Apache Lucy</a> or <a href=\"http://xmlsoft.org/XSLT/\" rel=\"nofollow\">libxslt</a> and has published some Perl modules on <a href=\"https://metacpan.org/author/NWELLNHOF\" rel=\"nofollow\">CPAN</a>.</li>\n<li>Good in C, Perl, and JavaScript but likes to dabble in many things.</li>\n</ul>\n\n<h3>Profiles on other websites</h3>\n\n<ul>\n<li><a href=\"https://github.com/nwellnhof\" rel=\"nofollow\">GitHub</a></li>\n<li><a href=\"https://metacpan.org/author/NWELLNHOF\" rel=\"nofollow\">CPAN</a></li>\n<li><a href=\"http://www.linkedin.com/in/nwellnhof\" rel=\"nofollow\">LinkedIn</a></li>\n</ul>\n',1,1,0,2214003,NULL),(1556,104,'2013-06-27T00:01:15.823','Gatis',NULL,'2015-07-21T23:08:35.313',NULL,'Brazil',NULL,NULL,1,2,0,113380,NULL),(1557,36,'2013-06-27T01:28:53.837','Crunchy',NULL,'2013-07-02T23:05:17.343',NULL,'Campbell, CA',NULL,'<p>EE newbie here. Please excuse my newb-ish questions.</p>\n',0,0,0,2974994,NULL),(1558,99,'2013-06-27T04:36:48.227',' pak Sh rm ',NULL,'2013-07-29T09:52:20.417','http://depthgr8.wordpress.com','India',26,'<p><em><strong>Language</strong> is my love.<br>\n<strong>Programs</strong> are my friends.<br>\nI love to <strong>code</strong> them.</em>\nI also love to help my friends at <a href=\"/questions/tagged/stackoverflow\" class=\"post-tag\" title=\"show questions tagged stackoverflow\" rel=\"tag\">stackoverflow</a></p>\n\n<p>Would you like to work and fork with me - Email_me : depthgr8@yahoo.in<br>\nFind me at <a href=\"https://github.com/Depthgr8\" rel=\"nofollow\">https://github.com/Depthgr8</a>