" width=\"165\" height=\"64\" alt=\"HTML5 Powered with CSS3 / Styling, and Semantics\" title=\"HTML5 Powered with CSS3 / Styling, and Semantics\">\n</p>\n\n<p>\n<img src=\"http://www.php.net//images/logos/php-med-trans-light.gif\" width=\"95\" height=\"51\" alt=\"PHP Development\" title=\"PHP Development\">\n</p>\n\n<p><a href=\"http://about.me/marafee\" rel=\"nofollow\">\n<img src=\"http://upload.wikimedia.org/wikipedia/commons/f/f3/Adobe_ColdFusion_Builder_v3.0_icon.png\" width=\"95\" height=\"95\" alt=\"ColdFusion Development\" title=\"ColdFusion Development\" >\n</a></p>\n\n<p><a href=\"http://twitter.com/marafee1243\" rel=\"nofollow\">tweet him</a></p>\n',0,0,0,314871,NULL),(1622,11,'2013-07-10T12:50:20.317','Vignesh Vicky',NULL,'2017-01-27T19:38:20.670',NULL,NULL,NULL,NULL,0,0,0,2985228,NULL),(1623,101,'2013-07-10T12:55:56.780','Guglie',NULL,'2017-06-25T14:23:25.187','http://www.inrainbow.it',NULL,30,'<p>I study Computer Science and I do web developing, but I like to call myself a <strong>creative</strong>.</p>\n',0,0,0,326332,'https://i.stack.imgur.com/j1O1I.png'),(1624,123,'2013-07-10T14:17:59.943','user1146334',NULL,'2013-08-09T17:23:18.457',NULL,NULL,NULL,NULL,0,2,0,1168627,'https://i.stack.imgur.com/cL3do.png'),(1625,269,'2013-07-10T16:50:52.803','JoeFromOzarks',NULL,'2013-09-15T02:56:35.457','','Southwest Missouri USA',64,'<p>Retired EE, programmer and general violator of the \"No User Serviceable Parts Inside\" rules.</p>\n\n<p>If we choose, we can learn so much from others:</p>\n\n<p>\"A mans [person] got to know his limitations.\" Harry Callahan (Magnum Force 1973) Clint Eastwood</p>\n\n<p>\"We [I] dont know a millionth of one percent about anything.\" Thomas Edison. (Golden Book April 1931)</p>\n\n<p>Regarding limitations, my doctor called, he read on an internet forum he could speed up his computer by manually cleaning the registry but now his computer won t boot.    I m so glad you called!   I replied.   I m about to give myself a vasectomy, will a #11 Exacto blade do?     Some projects are best left to those with the knowledge and experience.</p>\n\n<p>Regarding Mr. Edison s quote, some of that 1% is  eyes on, hands on.   Two people, in face to face conversation, rarely speak their minds logically and thoroughly.  Typing on an internet forum compounds the lack of useful information.   Many times, the person asking the question doesn t understand enough of the fundamentals to properly ask a question!   Dialog is critical to sharing information.</p>\n\n<p>\"I do not know.\"  Spock (Star Trek 2009) Zachary Quinto</p>\n\n<p>\"We learn by doing.\" Captain Kirk (Star Trek II: The Wrath of Khan 1982) William Shatner</p>\n\n<p>Nothing  goes without saying  but we all assume it.  I must assume you have the physical dexterity, adequate acuity and the proper tools to perform the task at hand.   I must assume you know better than to thread the sewing machine needle while running!</p>\n\n<p>Thank you for allowing my participation.</p>\n\n<p>:) joe</p>\n',0,1,0,3001862,NULL),(1626,1,'2013-07-10T18:16:35.367','user26220',NULL,'2013-08-28T16:23:27.737',NULL,NULL,NULL,NULL,0,0,0,3030018,NULL),(1627,101,'2013-07-10T21:23:07.383','Timtianyang',NULL,'2014-07-09T03:00:07.210',NULL,'Pittsburgh, PA, USA',NULL,'<p>Just a student.</p>\n',0,0,0,1539404,NULL),(1628,101,'2013-07-11T07:51:25.597','R.Falque',NULL,'2016-09-28T05:16:04.393',NULL,'Sydney, New South Wales, Australia',NULL,NULL,0,0,0,3021863,'https://www.gravatar.com/avatar/2178336b4831e3b87e6039547a33968a?s=128&d=identicon&r=PG&f=1'),(1629,18,'2013-07-11T15:19:47.430','Anura',NULL,'2013-07-12T16:01:16.277',NULL,NULL,NULL,NULL,1,0,0,3034967,NULL),(1630,101,'2013-07-11T20:43:28.610','Zurechtweiser',NULL,'2013-07-12T14:36:00.427','http://goo.gl/EqzCV','Germany',37,'<p>I. am.</p>\n',0,0,0,428012,'https://i.stack.imgur.com/a8RfY.png'),(1631,101,'2013-07-12T05:22:32.323','natchiketa',NULL,'2015-01-05T03:56:40.053','http://github.com/natchiketa','Eugene, OR, United States',NULL,NUL