ibrary within Java?</p>\n',0,0,0,24530,NULL),(1667,360,'2013-07-18T02:23:27.423','daweim0',NULL,'2017-07-21T02:11:13.477','',NULL,NULL,'',0,8,0,1177513,'https://i.stack.imgur.com/LVfDZ.jpg'),(1668,101,'2013-07-18T02:39:39.460','tstew',NULL,'2015-01-24T16:24:07.343',NULL,NULL,NULL,NULL,0,0,0,2534945,NULL),(1669,1,'2013-07-18T02:52:51.673','user2259',NULL,'2013-07-18T02:52:51.673',NULL,NULL,NULL,NULL,0,0,0,3061124,NULL),(1670,139,'2013-07-18T04:41:31.080','Sigurd V',NULL,'2017-08-08T12:04:20.833',NULL,'Aalborg, Denmark',NULL,NULL,0,0,0,2199439,'https://i.stack.imgur.com/S7MXr.jpg'),(1671,101,'2013-07-18T10:38:23.333','Jan Vladimir Mostert',NULL,'2013-07-18T15:41:42.793','http://janvladimirmostert.com','Cape Town, South Africa',NULL,'<p>Use the right tool for the job.</p>\n',0,0,0,250668,NULL),(1672,101,'2013-07-18T10:49:03.910','Areeb Gillani',NULL,'2015-05-24T12:42:52.680',NULL,'Lahore, Pakistan',26,'<blockquote>\n  <p>I am a computer scientist. I love to think, I love to create, and I\n  love to fail.</p>\n</blockquote>\n',1,0,0,1804616,NULL),(1673,101,'2013-07-18T12:39:03.637','Hesham Eraqi',NULL,'2016-09-20T13:07:05.647',NULL,'Egypt',29,'<p>TA, RA, PhD Student</p>\n',1,5,0,1783655,'https://i.stack.imgur.com/nb5fo.jpg'),(1674,1,'2013-07-18T18:25:38.150','chuzo',NULL,'2013-07-25T14:15:06.633','http://blog.dbx.cl','Chile',42,'<p>Hi. I studied Electrical Engineering at Universidad de Chile. My first program was written for my Atari 65XE (in Basic:) ) when I was 11 (1987). That program was a simple cash register (yeah! similar to classical checking account) with a \"menu\" (nobody uses that term nowadays :) ) to choose alternatives from, used for fun with my friends while playing  groceries store . The program was used till the audio cassette employed for storage last (some months). Even a friend requested a  copy  of the software to run it into his Atari 800XL. I was really proud of it at that time. (Btw a copy was done  using  double cassette  radio). </p>\n\n<p>Nowadays I m still marveled by computers, impressed of everyday forward steps both in Hardware and Software. Nobody can tell you where we are heading to... but thats what makes it special...isnt it?. Anyway this is not the only thing I do. I play tennis regularly and I like to ride my motorcycle (BMW F650GS) to commute around the city.</p>\n\n<p>I m a loving husband, father of two children (Catalina and Mateo).</p>\n\n<p>You can follow me on twitter pablo__burgos</p>\n',0,0,0,234969,NULL),(1675,101,'2013-07-18T19:22:34.167','Peaches491',NULL,'2017-06-17T03:41:07.580',NULL,'New Hampshire',26,'<p>Professional Student, Intern and Nerd.</p>\n\n<p>Student- Worcester Polytechnic Institute, Class of 2013</p>\n\n<p>Major- Robotics Engineering &amp;&amp; Computer Science</p>\n\n<p>Languages- C/C++, Java, Lisp, Assembly and English. And a little French.</p>\n\n<p>Hobbies- Programming, RC Vehicles, Computers, Networking, Video Games and many other (less nerdy) things.</p>\n\n<p>Nerd Cred: I have a favorite Sorting Algorithm (Merge Sort) I have an unhealthy yearning to be more like fictional spaceship captains (Picard, Reynolds) And I can solve a 7x7x7 Rubiks Cube (Usually)</p>\n\n<h1>SOreadytohelp</h1>\n',0,0,0,311451,NULL),(1676,133,'2013-07-19T01:54:03.657','Erik  Reppen',NULL,'2015-06-20T02:43:06.433',NULL,NULL,NULL,NULL,0,2,0,202891,NULL),(1677,1,'2013-07-19T09:00:19.107','mChad',NULL,'2013-07-22T21:00:01.607','http://www.azoteq.com','South Africa',NULL,NULL,0,0,0,1800344,'https://graph.facebook.com/100000213514885/picture?type=large'),(1678,101,'2013-07-19T09:45:26.900','Christian Mark',NULL,'2013-07-19T09:45:26.900','http://www.thepiratebay.se','Fiji',26,'<p>Mastering C/C++ is like sharpening sticks with a stone.</p>\n',0,0,0,2231202,'https://i.stack.imgur.com/WiZdp.png'),(1679,1,'2013-07-19T13:33:27.707','Davide Faconti',NULL,'2017-02-21T13:19:07.483',NULL,NULL,39,'<p>My name is Davide Faconti, former Project Leader of Pal Robotics, a company which developed 4 generations o