ult, I have developed an interest in how software engineering best practices can be applied to multidisciplinary teams, as well as to the development of software whose behaviour is specified in statistical terms. (I.e. software that is both hard-to-specify &amp; hard-to-verify).</p>\n',0,0,0,249576,NULL),(1711,101,'2013-07-25T23:53:37.357','Mert Akcakaya',NULL,'2013-07-25T23:53:37.357','http://makcakaya.github.io/',NULL,29,NULL,0,0,0,1331739,'https://i.stack.imgur.com/BJYMs.png'),(1712,101,'2013-07-26T00:45:28.753','Chris Mills-Price',NULL,'2013-07-26T00:45:28.753','http://spacerobotgames.com','Portland, OR',35,'<p>Indie game developer (<a href=\"http://spacerobotgames.com\" rel=\"nofollow\">http://spacerobotgames.com</a>) and blogger thereof.</p>\n\n<p>Also a Java developer working primarily on a custom text search solution built using Lucene (<a href=\"https://lucene.apache.org/\" rel=\"nofollow\">https://lucene.apache.org/</a>).</p>\n\n<p>Many of my various gaming, webdev, and AI/machine-learning projects are hosted on GitHub (<a href=\"https://github.com/futurechris\" rel=\"nofollow\">https://github.com/futurechris</a>).</p>\n',0,0,0,1815194,'https://i.stack.imgur.com/IuGOa.png?s=128&g=1'),(1713,101,'2013-07-26T05:48:44.643','Chankey Pathak',NULL,'2013-07-26T05:48:44.643','https://tutswiki.com/','Bangalore, Karnataka, India',26,'<p><strong>Project:</strong></p>\n\n<ul>\n<li><a href=\"https://tutswiki.com\" rel=\"nofollow noreferrer\">TutsWiki</a> - An open source platform to provide collaborative tutorials.</li>\n</ul>\n\n<p><strong>Find me:</strong></p>\n\n<ul>\n<li><a href=\"https://plus.google.com/111047291269906896798\" rel=\"nofollow noreferrer\">Google+</a></li>\n<li><a href=\"http://www.twitter.com/chankeypathak\" rel=\"nofollow noreferrer\">Twitter</a></li>\n<li><a href=\"http://in.linkedin.com/in/chankeypathak\" rel=\"nofollow noreferrer\">LinkedIn</a></li>\n<li><a href=\"https://github.com/chankeypathak\" rel=\"nofollow noreferrer\">GitHub</a></li>\n</ul>\n\n<p><strong>Email:</strong> chankey@cpan.org</p>\n',0,0,0,94344,'https://i.stack.imgur.com/El2tc.jpg?s=128&g=1'),(1715,1,'2013-07-26T11:11:24.670','Tommy beee',NULL,'2013-09-14T09:00:12.043',NULL,NULL,NULL,NULL,0,0,0,3065781,NULL),(1716,101,'2013-07-26T18:17:49.050','Ali Abbasinasab',NULL,'2013-07-26T18:17:49.050','http://www.abbasinasab.com/','California, United States',NULL,'<p>I   C.</p>\n\n<p>I code and care. I use X for Y</p>\n\n<ul>\n<li>X           :        Y</li>\n<li>Python      : quick stuffs</li>\n<li>Perl        : data mining, niftiness</li>\n<li>C           : performance</li>\n<li>C++         : performance + OO</li>\n<li>Go          : C w/o segfaults</li>\n<li>Lisp        : machine learning, AI</li>\n<li>Java        : Android and BIG projects</li>\n<li>C#          : OOO + pointers to function</li>\n<li>R           : stats, data, cool graphs</li>\n<li>MATLAB      : computational visualization</li>\n<li>HTML/CSS    : my aunts website maintenance </li>\n<li>JavaScript  : when HTML is not enough (future of programing)</li>\n<li>PHP         : code-&amp;-run, mess w/o maintenance, practicing my horrible programming habits</li>\n<li>Ruby        : no idea -- only touched it once or two</li>\n<li>Objective-C : made few stupid apps for my buddies BD</li>\n<li>Brainfuck   : esotericism</li>\n<li>whitespace  : sadomasochism</li>\n<li>Shell       : System level, automation, scripting and wrappers</li>\n<li>Assembly    : hack/crack</li>\n<li>System-C    : hardware/software codeisgn</li>\n<li>Verilog/VHDL: when software is too slow!</li>\n</ul>\n',0,0,0,1891131,'https://i.stack.imgur.com/YdwB1.jpg?s=128&g=1'),(1717,113,'2013-07-26T18:36:20.437','Reacen',NULL,'2013-10-15T04:49:49.653',NULL,NULL,NULL,NULL,0,1,0,465888,NULL),(1719,101,'2013-07-27T13:23:51.980','Hern n Eche',NULL,'2013-07-27T13:23:51.980','http://www.cird.com.ar','Argentina',NULL,'<pre><code>void openEnding()\n{\n</code></pre>\n',0,0,0,82234,NULL),(1720,101,'2013-07-27T15:20:13.107','tomh',NULL,'2013-07-30T14:34:46.967','http://vimeo.com/tomhannen','London, UK',NULL,'<p>Work as Senior Innovations Producer for BBC Global News.  Produce videos in After Effects, Cinema 4D, and in the real world by flying small helicopters with cameras on them.</p>\n',0,0,0,523903,'https://i.stack.imgur.com/mAzme.jpg'),(1722,101,'2013-07-27T19:02:09.317','Kami',NULL,'2014-10-24T16:19:02.960','http://www.bleachtactics.com',NULL,NULL,'<h1>SOreadytohelp</h1>\n',0,0,0,1755028,NULL),(1723,196,'2013-07-27T20:08:21.270','Aerophilic',NULL,'2017-08-24T18:11:43.250','','San Mateo, CA',NULL,'<p>I have been designing, building, and troubleshooting robotics projects since 2000. My projects have ranged from the small (about the size of a CD), all the way to the size of a hummer (<a href=\"http://redteamracing.org/\" rel=\"nofollow\">http://redteamracing.org/</a>). </p>\n\n<p>These days I mostly focus in Systems Engineering, but I dabble in all aspects of robot design, including mechanical design, controls, sensors and algorithms.</p>\n',2,13,0,175157,'https://graph.facebook.com/4801751/picture?type=large'),(1724,131,'2013-07-28T22:57:19.187','Zuu',NULL,'2016-02-26T20:26:22.053','http://zuu.dk','Denmark',NULL,NULL,0,0,0,26103,NULL),(1725,101,'2013-07-29T09:07:38.603','Goran Horia Mihail',NULL,'2014-10-30T07:35:58.473',NULL,NULL,NULL,'<p></p>\n',0,0,0,1944316,'https://www.gravatar.com/avatar/9184b509b41fb3620e2d88592de5148b?s=128&d=identicon&r=PG&f=1'),(1726,11,'2013-07-29T11:19:13.423','user142030',NULL,'2013-07-29T11:19:13.423',NULL,NULL,NULL,NULL,0,0,0,2521651,NULL),(1727,101,'2013-07-29T16:54:15.163','Dimensionless',NULL,'2014-01-06T14:04:06.750',NULL,'India',23,'<p>I am a Undergraduate student currently doing bachelor in Mechanical Engineering . I also have keen interest in computer programming and web designing.\nClap for me <img src=\"http://i.stack.imgur.com/1i6AG.jpg\" alt=\"enter image description here\"></p>\n',0,0,0,1460587,NULL),(1728,1,'2013-07-29T17:18:28.493','Mahesh Mohan',NULL,'2013-12-30T15:14:24.573','http://techworldofmahe.webs.com','Palakkad, India',24,'<p>Hi all. Im Mahesh, an engineering student from Palakkad,Kerala. Im really much interested in the latest technology and love to see the future with a better technology. I love robotics though i havent done much work in the area. I know programming microcontrollers and am trying to apply my knowledge by making something..:)</p>\n',0,0,0,1920312,NULL),(1729,1,'2013-07-29T17:32:50.503','rcroote',NULL,'2013-07-29T18:28:37.950','http://ryancroote.com','Grand Rapids, MI',31,NULL,0,0,0,279355,NULL),(1731,101,'2013-07-30T05:14:24.863','Bull',NULL,'2016-09-20T13:13:46.867',NULL,'Canberra, Australia',24,NULL,0,1,0,2469101,NULL),(1732,101,'2013-07-30T10:54:38.870','yossale',NULL,'2013-07-30T10:54:38.870','http://www.yossale.com','Israel',35,'<p>Ive had my B.Sc in software engineering at 2008, and since then had the privlige to work at big corportaes (Intel Research, Thomson Reuters), build the backbones of amazing startups (Outbrain, Ginger), complete my thesis, and keep learning new stuff all the time. Ive done research in c and Java, backend in Java and Node, NLP in Groovy, scala and some C# (Hate it, sorry), some web in Angular, toyed around with native android apps and was a part of building an ionic cross-platform app. </p>\n\n<p>I love tera-incognita, and rather walk the bleeding cutting edge. </p>\n\n<p>As Plutarch said    The mind is a fire to be kindled , not a vessel to be filled.  . So far , I ve never been cold.</p>\n',0,0,0,2848,NULL),(1733,11,'2013-07-30T13:27:09.137','user1733',NULL,'2013-07-31T10:06:58.130',NULL,NULL,NULL,NULL,1,0,0,3112896,NULL),(1734,1,'2013-07-30T14:49:43.607','Kevin J F',NULL,'2016-11-02T08:10:20.030',NULL,NULL,NULL,NULL,0,0,0,1698368,NULL),(1735,101,'2013-07-30T15:12:02.550','SteveKB',NULL,'2013-07-30T15:12:02.550','http://www.stevekbgames.com',NULL,NULL,NULL,0,0,0,3109135,NULL),(1736,1,'2013-07-30T15:38:54.257','Onam Portal',NULL,'2013-08-01T05:04:14.787','