n</a>.</p>\n',0,0,0,382109,'https://i.stack.imgur.com/677eb.png?s=128&g=1'),(1775,395,'2013-08-07T10:26:55.267','EDDY74',NULL,'2017-06-30T08:52:43.230',NULL,NULL,NULL,NULL,1,151,4,2257369,NULL),(1776,101,'2013-08-07T12:10:41.800','Lucius II.',NULL,'2013-08-08T06:13:15.863',NULL,NULL,NULL,NULL,1,0,0,3034234,NULL),(1777,180,'2013-08-07T14:10:42.690','Michele',NULL,'2016-10-14T09:28:57.217',NULL,'Italy',29,'<p>I like robotics and computer vision.</p>\n',1,5,0,1136213,NULL),(1778,101,'2013-08-07T15:46:17.380','Andrey Chevozerov',NULL,'2016-08-03T07:43:43.597','https://www.facebook.com/plushcube','Saint Petersburg, Russia',33,'<p>iOS Developer at Mail.ru Group</p>\n',0,1,0,1659166,'https://graph.facebook.com/100002442560680/picture?type=large'),(1779,21,'2013-08-07T16:29:50.787','cburf',NULL,'2017-05-19T20:41:42.940',NULL,'Middleton, WI',NULL,'<p>My current role is an Electrical Quality Engineer.  Ive also previously spent time as a software engineer, software/electronic test expert, and electronic repair tech.</p>\n\n<p>I like tinkering with electronics, motorcycles, and computers.  Also enjoy the outdoors, beer and wine, gardening, and cooking.</p>\n',0,1,0,3147325,'https://i.stack.imgur.com/dsGPc.png?s=128&g=1'),(1780,1,'2013-08-07T21:27:51.173','Ithamar Diaz',NULL,'2013-08-07T21:27:51.173',NULL,NULL,NULL,'<p>I love to code, that is all.</p>\n\n<p>The traveling salesman had a family; wife, two kids, and total of 4 grandchildren.\nThey are all traveling salesmen.\nLets help them traverse the universe and get back in time to spend some family time together.</p>\n',0,0,0,3142163,'https://www.gravatar.com/avatar/de8eb711cc0dd6efbd46f26d6e8ddf3a?s=128&d=identicon&r=PG&f=1'),(1782,26,'2013-08-08T03:40:20.787','Chris',NULL,'2013-08-11T22:30:04.723',NULL,NULL,NULL,NULL,0,0,0,3149248,NULL),(1783,118,'2013-08-08T11:37:03.960','C_Beginner_Learner',NULL,'2014-12-29T04:44:04.353',NULL,'United States',21,'<p>I am taking a course in C and is currently in the second part of the course</p>\n',0,2,0,2996004,NULL),(1784,101,'2013-08-08T13:14:20.007','Mart Oruaas',NULL,'2013-08-08T13:14:20.007',NULL,'Tallinn, Estonia',41,NULL,0,0,0,24210,NULL),(1785,1,'2013-08-08T18:45:59.840','Saqib Ahmed',NULL,'2013-08-08T18:45:59.840','https://about.me/saqib_ahmed','Pakistan',24,'<p>Im an Electrical Engineer pursuing career in embedded systems design. I have expertise in various fields of computing and electronics. I have an immense experience of porting and development on different embedded devices. I have worked on RTOS based environments as well as bare metal devices. I have particular experience in ARM cortex-M devices. Nucleus (Mentors proprietary RTOS) and Embedded Linux are my basic areas of interest in RTOS development. I also have an experience of writing device drivers on various hardware platforms.</p>\n\n<p>Besides electronics and computing, I also like to study imaginative and expository literature, philosophy, history and geography. I love to be a globe rotter and spend considerable time with atlas.</p>\n',0,0,0,3102828,'https://i.stack.imgur.com/fpJSY.jpg?s=128&g=1'),(1786,101,'2013-08-08T21:10:28.237','Jonathan Root',NULL,'2013-08-08T21:10:28.237','http://non_existend','neighborhood of 48  09 xx\" N, 11  34 xx\" E',31,'<p>Those who believe to be something have stopped becoming something.</p>\n',1,0,0,3005825,'https://i.stack.imgur.com/cLSom.jpg'),(1788,101,'2013-08-09T12:57:41.063','Tom Wuyts',NULL,'2015-11-20T12:52:35.960','http://www.wuyts.org/tom/blog','Antwerp, Belgium',29,'<p>Ive been a long term dev, both from hobby projects and work. </p>\n\n<p>Used to do PHP, now only does C# and other stuff on the .NET stack. And sometimes some C or Lua, depending on what  C Im tinkering with.</p>\n',0,0,0,1820533,'https://i.stack.imgur.com/pLerp.jpg?s=128&g=1'),(1789,1,'2013-08-10T07:07:54.217','Marco Blauth',NULL,'2013-08-10T07:07:54.217',NULL,NULL,NULL,NULL,0,0,0,2013367,NULL),(1790,101,'2013-08-10T20:10:11.893','Jake Byman',NULL,'2016-12-07T07:57:01.