</a> || <a href=\"http://cirosantilli.com/r/n\" rel=\"nofollow noreferrer\">Necromancer #2 in 2016-06</a> || <a href=\"http://cirosantilli.com/r/v\" rel=\"nofollow noreferrer\">Vote Fraud Script</a></p>\n\n<p>The Chinese characters on my username and profile picture are censored by the Chinese government:</p>\n\n<ul>\n<li><a href=\"http://cirosantilli.com/r/d\" rel=\"nofollow noreferrer\"><strong>Profile picture</strong></a>: satirical photoshopped picture of Chinas president that got artist Dai Jianyong arrested</li>\n<li><strong> </strong>: <a href=\"https://www.nytimes.com/2017/07/17/world/asia/liu-xiaobo-censor.html\" rel=\"nofollow noreferrer\">https://www.nytimes.com/2017/07/17/world/asia/liu-xiaobo-censor.html</a></li>\n<li><strong> </strong>: <a href=\"http://cirosantilli.com/r/t\" rel=\"nofollow noreferrer\">Tiananmen square protests of 1989</a></li>\n<li><strong> </strong>: <a href=\"https://en.wikipedia.org/wiki/Falun_Gong\" rel=\"nofollow noreferrer\">Falun Gong</a>, 70M follower religion banned in 1999. <a href=\"http://cirosantilli.com/r/c\" rel=\"nofollow noreferrer\">Christians also persecuted</a>. Im agnostic. <a href=\"http://cirosantilli.com/r/g\" rel=\"nofollow noreferrer\">Gay rights</a>? No minority is safe.</li>\n</ul>\n\n<p>Censorship circumvention: <a href=\"https://cc.greatfire.org/en\" rel=\"nofollow noreferrer\">https://cc.greatfire.org/en</a></p>\n\n<p>Why Im doing this:</p>\n\n<ul>\n<li>spark: in March 2015 <a href=\"http://cirosantilli.com/r/i\" rel=\"nofollow noreferrer\">my girlfriends mother was kept 15 days in jail for doing Falun Gong</a>.</li>\n<li>fuel: censorship aversion</li>\n</ul>\n\n<p>Goals:</p>\n\n<ul>\n<li>increase the cost of censorship. Using the <a href=\"https://en.wikipedia.org/wiki/Great_Firewall\" rel=\"nofollow noreferrer\">Great Firewall GFW</a> to block political keywords? Then lose money with worse IT. If you know better words tell me. <a href=\"http://cirosantilli.com/r/w\" rel=\"nofollow noreferrer\">Good word lists</a>.</li>\n<li>promote freedom of speech, religion and politics</li>\n<li>meet more Chinese to better understand China. Contact me on <a href=\"https://twitter.com/cirosantilli/\" rel=\"nofollow noreferrer\">Twitter</a> or <a href=\"http://www.weibo.com/p/1005055601627311\" rel=\"nofollow noreferrer\">Weibo</a> or <a href=\"https://github.com/cirosantilli/chat/issues\" rel=\"nofollow noreferrer\">GitHub</a>. Public contact preferred, even if anonymous. Read the <a href=\"http://cirosantilli.com/r/f\" rel=\"nofollow noreferrer\">FAQ</a> first. If you really need privacy, ciro.santilli.contact [at] gmail.com</li>\n</ul>\n\n<p>I am <em>against</em> violence. I love China.</p>\n\n<p>Anti-commie info:</p>\n\n<ul>\n<li><a href=\"https://www.reddit.com/r/China\" rel=\"nofollow noreferrer\">https://www.reddit.com/r/China</a></li>\n<li><a href=\"https://github.com/cirosantilli/china-dictatorship\" rel=\"nofollow noreferrer\">https://github.com/cirosantilli/china-dictatorship</a></li>\n</ul>\n\n<p><a href=\"http://cirosantilli.com/r/u\" rel=\"nofollow noreferrer\">Other dissident users</a>.</p>\n\n<p>Can I do this?</p>\n\n<ul>\n<li><a href=\"http://meta.stackoverflow.com/questions/349131\">http://meta.stackoverflow.com/questions/349131</a></li>\n<li><a href=\"http://meta.stackoverflow.com/questions/298950\">http://meta.stackoverflow.com/questions/298950</a></li>\n<li><a href=\"http://meta.stackoverflow.com/questions/267368\">http://meta.stackoverflow.com/questions/267368</a></li>\n<li><a href=\"http://meta.stackoverflow.com/questions/299882\">http://meta.stackoverflow.com/questions/299882</a></li>\n<li><a href=\"http://meta.stackexchange.com/questions/286082\">http://meta.stackexchange.com/questions/286082</a></li>\n</ul>\n\n<p>But <a href=\"http://cirosantilli.com/r/a\" rel=\"nofollow noreferrer\">not in China</a> :-(</p>\n\n<p>Music! <a href=\"https://youtu.be/ThmknUWoab4\" rel=\"nofollow noreferrer\">Joan Baez - China</a> || <a href=\"https://youtu.be/6OOlXJs4I8k\