icon&r=PG&f=1'),(2040,101,'2013-10-03T13:51:41.123','chepseskaf',NULL,'2013-10-03T13:51:41.123',NULL,'Paris, France',36,'<p>French software engineer.</p>\n',0,0,0,91741,NULL),(2041,101,'2013-10-04T01:24:27.827','Brian',NULL,'2014-06-24T22:22:29.130','http://BrianByExperience.wordpress.com','Irvine, CA',51,'<p><strong>Intro:</strong> Im not a genius by any means, but I do with what I have, while trying to help others.</p>\n\n<p><strong>Background:</strong></p>\n\n<p>1980s </p>\n\n<ul>\n<li>Assembly - 6502</li>\n<li>C - Intel, DOS </li>\n<li>COBOL - HP Mainframe</li>\n<li>Started my independent biblical studies</li>\n</ul>\n\n<p>1990s</p>\n\n<ul>\n<li>BBx - Intel, DOS</li>\n<li>ANSI Basic - Intel, DOS</li>\n<li>VB/VBA - MS Office, CorelDraw, Windows 3.x</li>\n<li>C/C++ - Windows</li>\n<li>Ordained Christian Minister</li>\n</ul>\n\n<p>2000s</p>\n\n<ul>\n<li>.NET/Mono</li>\n<li>Taught XML at the XML Symposium in Costa Mesa, CA 2003.</li>\n<li>Started Promoting Your New Life in Christ</li>\n</ul>\n\n<p>2010s</p>\n\n<ul>\n<li>.NET/MONO</li>\n<li>.NET MicroFramework</li>\n<li>.NET / Windows 10 IOT</li>\n<li>.NET / CORE</li>\n<li>C / C++ / C# / JavaScript</li>\n<li>Arduino</li>\n<li>Raspberry Pi 2B &amp; 3B</li>\n<li>Angular.js</li>\n<li>Node.js</li>\n<li>TypeScript \n\n<ul>\n<li>For Node.js, because I like my server code to be strongly typed; </li>\n<li>and Angular</li>\n</ul></li>\n<li>CoffeeScript \n\n<ul>\n<li>For Angular</li>\n</ul></li>\n<li>Twitter Bootstrap</li>\n<li>Corel Suite X8</li>\n<li>Architected solutions to take advantage of Azure. </li>\n<li>Though I have worked in Ember.js &amp; Knockout.js, I really dont want to talk about it.</li>\n<li>Continue Preaching Christ Crucified, and Released a Free Ebook called Christian Freedom.</li>\n</ul>\n',0,0,0,3373289,'https://i.stack.imgur.com/VNWlR.png?s=128&g=1'),(2042,1,'2013-10-04T02:24:51.673','KLing',NULL,'2016-11-22T23:56:46.147',NULL,'Canada',NULL,NULL,0,0,0,148215,NULL),(2043,101,'2013-10-04T04:56:31.803','seanomlor',NULL,'2013-10-04T04:56:31.803','http://seanomlor.com','Asheville, NC',41,'<p>Hello, my name is Sean, Im a Ruby on Rails and JavaScript web developer.  </p>\n\n<p>I have over ten years of professional experience.</p>\n\n<p>My focus is building sustainable web applications with Elixir/Phoenix on the backend and React.js/Redux on the frontend.</p>\n',0,0,0,346273,NULL),(2044,11,'2013-10-04T07:47:02.593','Deepak landage',NULL,'2013-10-04T07:47:02.593',NULL,NULL,NULL,NULL,1,0,0,3390807,NULL),(2045,101,'2013-10-04T12:43:26.647','Praveen D',NULL,'2013-10-15T08:00:49.753','http://www.greatym.com','Pune, India',34,'<p>A programmer who specializes PHP, OOP, SOLID Principles, Design Patterns. Keen to learn new and fancy technologies.</p>\n\n<h1>SOreadytohelp</h1>\n\n<p>Experience : 7+ Years<br>\nKnowledge of following technologies<br>\nPHP,<br>\nMySQL<br>\nLinux shell Scripting,<br>\nOOPS<br>\nFrameworks<br>\n    Zend framework<br>\n    Cake PHp<br>\n    CodeIgnitor<br>\nMVC paradigm<br>\nJavasript<br>\n    Jquery<br>\n    AngularJs \n    JSON<br>\nHTML<br>\nCSS</p>\n',0,0,0,3295335,'https://i.stack.imgur.com/9kb3d.jpg?s=128&g=1'),(2046,101,'2013-10-04T18:25:41.203','BD at Rivenhill',NULL,'2013-12-20T00:37:50.230','http://rivenhill.com',NULL,NULL,'<p>Im working on the following projects (not necessarily in order):</p>\n\n<ol>\n<li>Software for automated trading (focusing on both high throughput and low latency)</li>\n<li>Robots</li>\n</ol>\n',0,0,0,77347,'https://i.stack.imgur.com/vIrzV.jpg'),(2047,106,'2013-10-05T00:18:34.777','Scribblenautical',NULL,'2014-09-13T00:33:23.897',NULL,'Bronx, NY',17,'<p><a href=\"http://gaming.stackexchange.com/users/24398/scribblenautical\">\nprofile for Scribblenautical at Arqade, Q&amp;A for passionate videogamers on all platforms http://gaming.stackexchange.com/users/flair/24398.png\n</a></p>\n\n<p>Its been a while. Im a poolee for the Marine Corps. </p>\n\n<p>I am a seior at Brooklyn Technical High School, a specialized high school. 