57614/graduation-site-closure-and-a-clearer-outlook-on-the-health-of-se-sites\">updated our criteria for graduating and closing</a> Q&amp;A sites (shoutout to <a href=\"http://meta.stackexchange.com/users/131713/pops\">Pops</a> on this one)</li>\n<li><a href=\"http://meta.stackexchange.com/questions/263905/design-independent-graduation-is-on-for-early-september\">Design Independent Graduation</a></li>\n<li>The introduction of <a href=\"http://meta.stackexchange.com/questions/278882/lets-experiment-with-town-hall-style-chat-events\">Meta Stack Exchange Town Halls</a></li>\n</ul>\n\n<p>Ive also poked at a lot of my teams back office-y systems and spend a fair amount of time hanging around the <a href=\"http://meta.stackoverflow.com/questions/tagged/jobs\">jobs tag on MSO</a>.</p>\n\n<p>Beyond that...</p>\n\n<p>Im a hobbyist programmer who loves thinking about how systems talk to each other. Ive dabbled with technologies like JavaScript/Node.js, C, Python, Rails, and SQL and have developed a real love for UNIX environments. In the near future, I want to learn more about networking. Im an avid consumer of science fiction, with a special soft spot for all things cyberpunk. Oh, and I just recently began reading comics. Better late than never, right? </p>\n\n<p>Send comic book recommendations to ana (at) stackexchange.com</p>\n',0,0,0,2415655,'https://i.stack.imgur.com/Rwhv1.jpg?s=128&g=1'),(2194,101,'2013-11-04T21:01:35.573','Javier Mr',NULL,'2013-11-04T21:22:19.583',NULL,NULL,NULL,NULL,0,0,0,1316944,NULL),(2195,101,'2013-11-05T02:34:02.680','Franck Dernoncourt',NULL,'2016-08-12T00:11:38.670','http://www.francky.me','MIT, Cambridge, USA',NULL,'<p><a href=\"http://stackexchange.com/users/169656/franck-dernoncourt\"><img src=\"http://stackexchange.com/users/flair/169656.png\" width=\"208\" height=\"58\" alt=\"profile for Franck Dernoncourt on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Franck Dernoncourt on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a></p>\n',0,0,0,169656,'https://i.stack.imgur.com/Z99mk.jpg?s=128&g=1'),(2196,60,'2013-11-05T11:09:21.787','xsnk',NULL,'2015-07-26T12:22:32.173',NULL,NULL,22,'<p>Robotics, AI and Space Enthusiastic</p>\n',1,4,0,1205089,NULL),(2197,1,'2013-11-05T14:58:34.420','strand',NULL,'2013-11-05T14:58:34.420',NULL,NULL,NULL,NULL,0,0,0,3539106,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(2198,108,'2013-11-06T00:06:52.030','jboneca',NULL,'2014-01-21T16:21:12.963',NULL,'Los Angeles, CA',28,'<p>I dont know any fancy frameworks, I just like PHP, JavaScript, jQuery, and Node.js.</p>\n\n<p>I also appreciate Objectivism, statistics and linguistics when time allows.</p>\n\n<p>I was an economics and psychology major at USC.</p>\n',1,0,0,2819229,'https://i.stack.imgur.com/krcTC.jpg'),(2199,1,'2013-11-06T01:35:53.917','vrand',NULL,'2015-03-05T14:26:36.660',NULL,'United States',31,'<p>Aspiring programmer. Geek of computers, gadgets, and Apple. Tech activist and dev wannabe: web, games, graphics, AI. Words do not reflect upon my employer.</p>\n',0,0,0,924332,NULL),(2200,101,'2013-11-06T01:42:01.547','Drop',NULL,'2017-01-07T05:36:30.297',NULL,NULL,NULL,'<p></p>\n',0,0,0,1760079,NULL),(2201,101,'2013-11-06T05:16:18.867','andy mcevoy',NULL,'2016-03-16T22:13:36.730',NULL,NULL,NULL,NULL,0,0,0,1749291,NULL),(2202,185,'2013-11-06T10:00:26.590','Maysam',NULL,'2014-06-12T10:45:38.500',NULL,NULL,31,NULL,6,4,0,352603,NULL),(2203,101,'2013-11-06T11:07:59.213','BrownEyes',NULL,'2013-11-06T11:07:59.213',NULL,'0,0',21,'<p>Enough about me, tell me more about you</p>\n',0,0,0,2006469,'https://i.stack.imgur.com/wdCtk.jpg?s=128&g=1'),(2204,1,'2013-11-06T14:02:49.517','user28594',NULL,'2013-11-06T14:02:49.517',NULL,NULL,NULL,NULL,0,0,0,3544282,'https://graph.facebook.com/1673703778/picture?type=large'),(2205,1,'2013-11-06T14:04:43.353','Funnyboyz Cfc',NULL,'2013-11-06T14:04:43.353',NULL,NULL,NULL,NULL,0,0,0,556618,NULL),(2206,11,'2013-11-06T14: