1827588,NULL),(2217,6,'2013-11-09T12:45:05.877','Berrima Hadj tahar',NULL,'2017-04-03T12:29:57.733',NULL,NULL,NULL,NULL,1,0,0,2935079,NULL),(2218,101,'2013-11-09T20:22:32.893','Cymen',NULL,'2013-11-09T20:22:32.893','http://blog.cymen.org/','Ann Arbor, MI, United States',NULL,'<p>Im a pragmatic developer that currently enjoys working with responsive applications that run in the web browser. I consider myself to be a Software Craftsman by which I am interested in well-crafted software using pragmatic techniques that result in high quality and a sense of a job well done. Part of that is using test-driven development where appropriate. Part of that is avoiding overuse of frameworks and/or avoiding tight coupling between business logic and frameworks. Part of that is making the right trade-offs when implementing a feature. Part of that is realizing when one thing needs to be two things (you might joke, but violating the Single Responsibility Principle is very easy when adding features).</p>\n',0,0,0,42197,'https://i.stack.imgur.com/gBjQD.png?s=128&g=1'),(2219,101,'2013-11-10T01:59:20.563','boruchsiper',NULL,'2013-11-24T18:52:36.047',NULL,NULL,NULL,'<p>ASP.Net Freelance Developer</p>\n',1,0,0,201520,'https://www.gravatar.com/avatar/70fe8e4ef537ccbebecc5bc3ef2d7c11?s=128&d=identicon&r=PG'),(2220,101,'2013-11-10T07:03:35.050','hari_sree',NULL,'2016-01-21T15:17:08.870',NULL,NULL,NULL,NULL,0,0,0,74830,NULL),(2221,101,'2013-11-10T19:09:56.377','crizCraig',NULL,'2013-11-10T19:09:56.377',NULL,NULL,NULL,NULL,0,1,0,45487,'https://www.gravatar.com/avatar/35887d936c9e5c6bac12624021c93b68?s=128&d=identicon&r=PG'),(2222,13,'2013-11-11T01:08:07.567','Orgrim',NULL,'2017-03-19T13:11:54.803',NULL,NULL,NULL,NULL,0,0,0,938303,NULL),(2225,101,'2013-11-11T12:40:24.023','John Dvorak',NULL,'2017-08-26T18:00:54.767',NULL,NULL,NULL,'<p><a href=\"http://dystroy.org/miaou/user/25\" rel=\"nofollow noreferrer\">Jan-Dvorak @ Miaou</a><br>\nHonnza @ gmail.com</p>\n\n<blockquote>\n  <p>\"Havent you heard? Crowdsourcing to stackOverflow is the new trend in basic debugging.\"</p>\n</blockquote>\n\n<p>-- John Dvorak</p>\n\n<blockquote>\n  <p>\"There are only two hard things in Computer Science: cache invalidation, naming things and off-by-one errors\"</p>\n</blockquote>\n\n<p>-- variation of Phil Karltons quote</p>\n',0,0,0,233608,'https://i.stack.imgur.com/PObJM.png?s=128&g=1'),(2226,91,'2013-11-11T16:22:50.630','dlaz',NULL,'2015-04-15T20:53:16.707','',NULL,NULL,'',1,6,0,1749033,NULL),(2227,101,'2013-11-12T00:06:20.033','Craig Cannon',NULL,'2013-11-12T00:06:20.033','http://craigrcannon.com',NULL,NULL,NULL,0,0,0,1210983,'https://i.stack.imgur.com/GjkaP.jpg'),(2228,11,'2013-11-12T06:50:00.757','Juergen',NULL,'2013-11-12T06:50:00.757',NULL,NULL,NULL,NULL,1,0,0,1287862,NULL),(2229,101,'2013-11-12T09:35:30.503','Miikka',NULL,'2014-01-13T11:36:00.260','http://twitter.com/arcatan','Helsinki, Finland',NULL,'<p>Dealing with the abstract.</p>\n',0,0,0,112787,NULL),(2230,1,'2013-11-12T21:11:06.323','comradez',NULL,'2013-11-12T21:11:06.323',NULL,'East Coast',NULL,NULL,0,0,0,3575638,'https://www.gravatar.com/avatar/603c75846e178cd99f576f12a948a819?s=128&d=identicon&r=PG&f=1'),(2231,101,'2013-11-13T07:27:31.047','vinesh',NULL,'2013-11-13T07:27:31.047',NULL,'india',27,'<p>Passionate programmer and love to make your world nicer !!!</p>\n',0,0,0,448274,NULL),(2232,101,'2013-11-13T12:11:37.633','RSFalcon7',NULL,'2013-11-13T12:11:37.633',NULL,'Braga, Portugal',27,NULL,0,0,0,1484158,NULL),(2234,101,'2013-11-14T02:23:32.867','dan_linder',NULL,'2016-11-02T02:16:57.610','http://www.linder.org','Bellevue, NE, United States',46,'<p>An all-around nerd since birth, got hooked on Unix early in college.  Cut my teeth on a SCO Unix system (the \"good\" SCO) and on NeXTSTEP (the NeXT systems OS).  When I started with Linux, the only decision I had to make was what to download first, the \"boot\" or the \"root\" diskette image. :)</p>\n\n<p>My general mantra for work and life in general is \"if I have to do something more than a couple times, automate as much or all as possible.\"  The time saved by having the computer do the boring stuff correctly pays double dividends in keeping mistakes out of the final product AND reducing the operations work of troubleshooting the new problems each time.</p>\n\n<p>BUT that is balanced with the human aspect for both co-workers and family.  It does no good to make a highly automated solution that only one person in the organization can understand much less evolve and support.  Id rather have a half dozen system perform a complex task knowing that they have defined points of contact - not a complicated interaction with no human points for debugging. </p>\n\n<p>Over the past 20 years Ive been a network and security geek on Cisco systems, Ive been a general \"jack-of-all-trades\" consultant in the IT industry, produced Perl and PHP tools (small and large) for customers and personal projects, worked on Solaris, HP, AIX, RedHat, Debian, and too many other Unix systems to mention.  Im directly working on virtualization and system automation tools while dabbling into containerization of applications and systems.</p>\n\n<p>In my spare time Im a father of two intelligent girls, as well as a husband to an intelligent and beautiful wife.  After chores are done, if I need a break I am continuing to teach myself digital electronics using the Arduino platform.</p>\n',0,2,0,63289,NULL),(2235,101,'2013-11-14T10:36:37.793','Murshid Ahmed',NULL,'2013-11-14T10:36:37.793',NULL,'Colombo, Sri Lanka',29,'<h1>SOreadytohelp</h1>\n\n<p><a href=\"https://stackexchange.com/users/445631\">\n<img src=\"https://stackexchange.com/users/flair/445631.png\" width=\"208\" height=\"58\" alt=\"profile for The Dark Knight on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for The Dark Knight on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n\n<p><a href=\"https://stackoverflow.com/users/838203/the-dark-knight\">\n<img src=\"https://stackoverflow.com/users/flair/838203.png\" width=\"208\" height=\"58\" alt=\"profile for The Dark Knight at Stack Overflow, Q&amp;A for professional and enthusiast programmers\" title=\"profile for The Dark Knight at Stack Overflow, Q&amp;A for professional and enthusiast programmers\">\n</a></p>\n',0,0,0,445631,NULL),(2236,121,'2013-11-14T10:48:18.743','Soumyajit',NULL,'2014-03-07T07:27:36.020','','Kolkata, India',27,'',0,1,0,2346511,'https://www.gravatar.com/avatar/73a78cc982e12f7eacfb1fa7244fbb01?s=128&d=identicon&r=PG'),(2237,111,'2013-11-14T15:15:26.990','Conrad C',NULL,'2015-01-01T14:59:04.720','http://N/A',NULL,30,'<p>Electrical Engineering Student (Telecom Option)</p>\n\n<p>My programming interests revolve around C, C++, C# and XHMTL/CSS.</p>\n',1,0,0,1288849,'https://www.gravatar.com/avatar/ab63cf6a6788374ffc3fab61a16e758f?s=128&d=identicon&r=PG'),(2239,1,'2013-11-15T07:54:25.887','York Cleave',NULL,'2013-11-21T18:02:42.993',NULL,NULL,NULL,NULL,0,0,0,1583976,'https://www.gravatar.com/avatar/17cf2c59f1f03bf8eb508598ab010b46?s=128&d=identicon&r=PG'),(2240,101,'2013-11-15T09:23:01.320','fjardon',NULL,'2013-12-05T20:15:30.917',NULL,'Paris, France',NULL,NULL,0,0,0,332406,NULL),(2241,153,'2013-11-15T12:53:32.887','HAL9000',NULL,'2015-08-18T12:27:44.547','http://shahmirj.com','Cambridge, United Kingdom',31,'<p>Shoot first, so you dont have to ask the questions!</p>\n',1,3,0,38291,'https://www.gravatar.com/avatar/3b795577828562c728c898624c920d4e?s=128&d=identicon&r=PG'),(2242,1,'2013-11-15T16:16:44.200','shgurbanov',NULL,'2013-11-15T16:16:44.200','http://blog.kern.sh',NULL,NULL,NULL,0,0,0,3590824,NULL),(2243,101,'2013-11-15T17:30:43.220','Angry Goomba',NULL,'2013-11-15T17:30:43.220',NULL,'Montreal, Canada',27,NULL,0,0,0,2881018,'https://www.gravatar.com/avatar/a4839540e7bb3c1640f9851c951c4539?s=128&d=identicon&r=PG'),(2244,1,'2013-11-15T23:37:15.590','Jordy Dickinson',NULL,'2013-11-15T23:37:15.590',NULL,NULL,NULL,NULL,0,0,0,1260234,'https://www.gravatar.com/avatar/c2ba220369925204d5147a46b2fd5f5c?s=128&d=identicon&r=PG&f=1'),(2245,101,'2013-11-16T16:09:58.047','davidbuttar',NULL,'2013-11-17T15:35:54.400',NULL,NULL,NULL,NULL,0,1,0,190245,'https://www.gravatar.com/avatar/f68ebf7f986547a799dd19a0af8d8a04?s=128&d=identicon&r=PG'),(2246,1,'2013-11-17T03:02:59.997','Ernesto',NULL,'2013-11-17T03:02:59.997',NULL,NULL,NULL,NULL,0,0,0,3447087,'https://www.gravatar.com/avatar/e7b9e97f2bd9796cb60d3898a772f850?s=128&d=identicon&r=PG&f=1'),(2247,111,'2013-11-17T06:08:31.293','Puneet Lamba',NULL,'2013-12-05T17:35:03.580','http://puneetlamba.blogspot.com','Boston, MA',NULL,'<p>Senior architect, program manager, and agile coach. Technology generalist with expertise in all layers of Java and HTML5-based web application development.</p>\n\n<p>My LinkedIn profile: <a href=\"http://www.linkedin.com/in/lamba/\" rel=\"nofollow\">linkedin.com/in/lamba/</a></p>\n\n<p>My resume/portfolio: <a href=\"http://inventica.com\" rel=\"nofollow\">inventica.com</a></p>\n',0,0,0,347913,'https://i.stack.imgur.com/cc6dL.png'),(2248,128,'2013-11-18T02:29:46.630','Jason C',NULL,'2017-05-29T15:37:36.387',NULL,'New York, United States',NULL,'<p>Check out <a href=\"https://stackapps.com/search?tab=active&amp;q=user%3A25350%20is%3Aq%20%5Bscript%5D%20\">my userscripts on StackApps</a>:</p>\n\n<ul>\n<li><a href=\"https://stackapps.com/q/7404/25350\">https://stackapps.com/q/7404/25350</a> - Fully functional top bar for chat rooms with inbox/achievements and room search.</li>\n<li><a href=\"https://stackapps.com/q/7398/25350\">https://stackapps.com/q/7398/25350</a> - Visualize answered status of sidebar questions.</li>\n<li><a href=\"https://stackapps.com/q/7399/25350\">https://stackapps.com/q/7399/25350</a> - Linkifies URLs in revision history comments.</li>\n<li><a href=\"https://stackapps.com/q/7403/25350\">https://stackapps.com/q/7403/25350</a> - Link sharing on steroids.</li>\n<li><a href=\"https://stackapps.com/q/7439/25350\">https://stackapps.com/q/7439/25350</a> - Help ROs clean up chat with auto-select message moving.</li>\n<li><a href=\"https://stackapps.com/q/7442/25350\">https://stackapps.com/q/7442/25350</a> - Unlock message delete ability for ROs.</li>\n</ul>\n\n<hr>\n\n<p>Support the <a href=\"http://area51.stackexchange.com/proposals/109898/memes\">Memes Proposal</a>. Or not. Its an experiment. </p>\n\n<p><strong>Awesome SE sites that you should check out:</strong></p>\n\n<ul>\n<li><a href=\"http://woodworking.stackexchange.com/\">Woodworking Beta</a></li>\n<li><a href=\"http://mechanics.stackexchange.com/\">Motor Vehicle Maintenance &amp; Repair Beta</a></li>\n</ul>\n\n<hr>\n\n<p>I am a freelance programmer based out of NYC. I grew up in Pittsburgh, PA, USA and still consider it my home. I have a background in medical robotics, computer-assisted surgery, and computational biology. I currently specialize in both systems and application programming, augmented reality, simulations, and embedded devices, as well as development project management. Since moving to NYC 11 years ago, Ive fallen in to working primarily with new media and tech artists doing a lot of interactivity and <a href=\"http://thebaylights.org/\" rel=\"nofollow noreferrer\">large-scale lighting installations</a>. I consider my current job to be creating tools that allow artists to naturally express themselves through software without limiting their creativity.</p>\n\n<p>You can generally find me in <a href=\"https://chat.meta.stackexchange.com/rooms/89\">The Tavern</a>.</p>\n\n<hr>\n\n<p>Interesting posts, if I say so myself:</p>\n\n<ul>\n<li><a href=\"https://codegolf.stackexchange.com/a/21950/16504\">How to write</a> programs like <a href=\"http://www.cise.ufl.edu/~manuel/obfuscate/xmas.c\" rel=\"nofollow noreferrer\">Twelve Days of Christmas in C</a>.</li>\n<li><a href=\"https://codegolf.stackexchange.com/q/22144\">Images With All Colors</a> - best CodeGolf.SX contest ever!</li>\n</ul>\n\n<p>Some data analysis and statistics from the very exciting 2015 SO mod elections (server is now defunct, I could reactivate for future elections):</p>\n\n<ul>\n<li><a href=\"https://meta.stackoverflow.com/q/290346\">2015 Election Live Vote Monitor</a></li>\n<li><a href=\"https://meta.stackoverflow.com/q/289995\">2015 Election Candidate Activity Profiles</a></li>\n<li><a href=\"http://disorient.ddns.net/SOVoteMonitor/qa.jsp\" rel=\"nofollow noreferrer\">2015 Candidate Questionnaire Alternate View</a> </li>\n</ul>\n\n<hr>\n\n<p><code>echo &gt; ?c:windowsx.</code></p>\n',2,1,0,305991,'https://i.stack.imgur.com/Yiloe.png?s=128&g=1'),(2249,101,'2013-11-18T03:13:46.740','mushroom',NULL,'2014-07-01T03:48:45.160',NULL,NULL,NULL,NULL,0,0,0,427726,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(2250,1,'2013-11-18T07:26:13.723','TResell',NULL,'2013-11-18T07:26:13.723',NULL,'Norway',NULL,NULL,0,0,0,3600246,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(2251,101,'2013-11-18T08:01:08.350','prosody Vereable Context',NULL,'2013-11-18T08:01:08.350','http://facebook.com/prosody','Baltimore, MD',30,'<p><a href=\"http://webapps.stackexchange.com/questions/39851/is-google-docs-revision-history-a-stable-long-term-audit-trail\">webapps.stackexchange.com/questions/39851/is-google-docs-revision-history-a-stable-long-term-audit-trail</a> is my long term question.</p>\n\n<p>Work and pain and life and what great informaton/works/not/..</p>\n\n<p><a href=\"http://twitter.com/frets\" rel=\"nofollow\">@frets (tweet)</a>\n<a href=\"http://facebook.com/prosody\" rel=\"nofollow\">@prosody (fb)</a>\n<a href=\"http://twitter.com/contechtext\" rel=\"nofollow\">@contechtext</a>\n<a href=\"https://plus.google.com/u/0/117274546554081384648\" rel=\"nofollow\">(google+</a>\n<a href=\"http://twitter.com/tilTrue\" rel=\"nofollow\">@tilTrue</a>\ni$?.<a href=\"http://twitter.com/prettypowerfuli\" rel=\"nofollow\">@prettypowerfuli</a></p>\n\n<ul>\n<li> <a href=\"https://www.facebook.com/bitcism/\" rel=\"nofollow\">https://www.facebook.com/bitcism/</a></li>\n<li> <a href=\"https://www.facebook.com/pages/microempathy/264346700355578\" rel=\"nofollow\">https://www.facebook.com/pages/microempathy/264346700355578</a></li>\n<li> <a href=\"https://www.facebook.com/pages/Microtrauma-/556489644450813\" rel=\"nofollow\">https://www.facebook.com/pages/Microtrauma-/556489644450813</a> </li>\n<li> <a href=\"https://www.facebook.com/groups/bitcism/\" rel=\"nofollow\">https://www.facebook.com/groups/bitcism/</a></li>\n<li> <a href=\"https://www.facebook.com/pages/Trauma-H4CK/833785263318760\" rel=\"nofollow\">https://www.facebook.com/pages/Trauma-H4CK/833785263318760</a></li>\n<li> <a href=\"https://www.facebook.com/groups/485531031588518/\" rel=\"nofollow\">https://www.facebook.com/groups/485531031588518/</a></li>\n<li> <a href=\"https://www.facebook.com/groups/objectification\" rel=\"nofollow\">https://www.facebook.com/groups/objectification</a>? <a href=\"https://www.facebook.com/groups/TraumaFormaSensitive/\" rel=\"nofollow\">https://www.facebook.com/groups/TraumaFormaSensitive/</a></li>\n<li> <a href=\"https://twitter.com/bitcism\" rel=\"nofollow\">https://twitter.com/bitcism</a></li>\n<li> <a href=\"https://twitter.com/microempathy\" rel=\"nofollow\">https://twitter.com/microempathy</a></li>\n<li> <a href=\"https://twitter.com/cryptoempathy\" rel=\"nofollow\">https://twitter.com/cryptoempathy</a></li>\n<li> <a href=\"https://twitter.com/prettypowerfuli\" rel=\"nofollow\">https://twitter.com/prettypowerfuli</a></li>\n<li> <a href=\"https://twitter.com/suitperpower\" rel=\"nofollow\">https://twitter.com/suitperpower</a></li>\n<li> <a href=\"https://www.facebook.com/groups/bitcism/\" rel=\"nofollow\">https://www.facebook.com/groups/bitcism/</a></li>\n<li> <a href=\"https://www.facebook.com/groups/485531031588518/\" rel=\"nofollow\">https://www.facebook.com/groups/485531031588518/</a></li>\n<li> <a href=\"https://www.facebook.com/groups/1494185654189659/\" rel=\"nofollow\">https://www.facebook.com/groups/1494185654189659/</a></li>\n<li> <a href=\"https://www.facebook.com/groups/759071167485830\" rel=\"nofollow\">https://www.facebook.com/groups/759071167485830</a></li>\n<li> <a href=\"https://www.facebook.com/pages/Cryptoempathy/311113889072676\" rel=\"nofollow\">https://www.facebook.com/pages/Cryptoempathy/311113889072676</a></li>\n<li><p> <a href=\"https://www.facebook.com/pages/Cryptotrauma/576218882507723\" rel=\"nofollow\">https://www.facebook.com/pages/Cryptotrauma/576218882507723</a></p></li>\n<li><p><a href=\"https://www.reddit.com/live/tj9dfaicx01d\" rel=\"nofollow\">https://www.reddit.com/live/tj9dfaicx01d</a></p></li>\n</ul>\n\n<p>And tired to put links, so search Facebook to see other pages such as:</p>\n\n<ul>\n<li>Cryptotrauma?</li>\n<li>Cryptoempathy?</li>\n<li>What Would Memory Do?</li>\n<li>What Would Objectification Do?</li>\n<li>What Would Pattern Recognition Do?</li>\n<li>What Would Structure Do?</li>\n<li>What Would Stricture Do?</li>\n<li>What Would Missing Do?</li>\n<li>What Would Mortality Do?</li>\n<li>What Would Help Do?</li>\n<li>What Would Empathy Do?</li>\n</ul>\n\n<p>And personally my own self expression is constantly barred for grammar and constraints related to talking about trauma being so deeply taboo.</p>\n\n<ul>\n<li> <a href=\"https://plus.google.com/u/0/+prosodycontext/\" rel=\"nofollow\">https://plus.google.com/u/0/+prosodycontext/</a></li>\n<li> <a href=\"https://twitter.com/frets\" rel=\"nofollow\">https://twitter.com/frets</a></li>\n<li> <a href=\"https://twitter.com/contechtext\" rel=\"nofollow\">https://twitter.com/contechtext</a></li>\n<li> <a href=\"https://twitter.com/prosodyContext\" rel=\"nofollow\">https://twitter.com/prosodyContext</a></li>\n<li> <a href=\"https://www.facebook.com/prosody\" rel=\"nofollow\">https://www.facebook.com/prosody</a></li>\n</ul>\n\n<p><em>...under careful construction, please read carefully...</em></p>\n\n<p>Im just growing up with complex human equations and trying to fit it together.</p>\n\n<p>i!i!igrow</p>\n',0,0,0,428855,'https://i.stack.imgur.com/Cqp9N.png?s=128&g=1'),(2252,101,'2013-11-18T20:01:08.880','Rush',NULL,'2016-06-18T21:40:37.647','https://www.rushtehrani.com',NULL,NULL,NULL,0,0,0,472869,NULL),(2253,101,'2013-11-18T22:49:01.280','Jeremy',NULL,'2013-12-07T02:08:47.027','http://jeremy.org/','San Francisco, CA',NULL,'<p>(my <em>about me</em> is currently blank)</p>\n',0,1,0,99124,'https://www.gravatar.com/avatar/d630bf06a192014619dd8c9a75c7ade2?s=128&d=identicon&r=PG'),(2254,101,'2013-11-19T02:08:56.150','Eagle',NULL,'2016-06-29T20:33:01.633',NULL,NULL,NULL,NULL,0,2,0,358624,'https://www.gravatar.com/avatar/63062f2b90f865344ca725853b9a5855?s=128&d=identicon&r=PG'),(2255,1,'2013-11-19T05:48:31.613','Krisander Khysov',NULL,'2013-11-19T05:48:31.613','http://manitobaguideservice.ca','Manitoba',NULL,'<p>I love to go hunting and share my knowledge about it. See my page when in need of service on hunting bears, fishing and more.</p>\n',0,0,0,3416793,'https://i.stack.imgur.com/7zYdg.jpg?s=128&g=1'),(2256,101,'2013-11-19T11:09:33.733','gaussblurinc',NULL,'2013-12-05T10:34:08.153',NULL,NULL,NULL,'<p>interesting in: \nC++, C#, Perl, Statistics and Time Series theory.</p>\n\n<p>LinkedIn: <a href=\"https://ru.linkedin.com/in/dmitry-lobanov-49b65278\" rel=\"nofollow\">https://ru.linkedin.com/in/dmitry-lobanov-49b65278</a></p>\n',0,1,0,438383,NULL),(2257,101,'2013-11-19T13:14:29.717','kromuchi',NULL,'2013-11-19T13:14:29.717','http://www.vfalkenhahn.de','Stuttgart, Germany',NULL,'<p>Engineer</p>\n',0,0,0,513963,NULL),(2258,101,'2013-11-19T16:16:43.573','tmwanik',NULL,'2013-11-19T16:16:43.573',NULL,'Nairobi, Kenya',29,NULL,0,0,0,1616803,'https://i.stack.imgur.com/fEiEr.jpg?s=128&g=1'),(2259,101,'2013-11-19T19:48:39.493','sh977218',NULL,'2014-02-05T18:18:27.950','','Maryland',32,'',0,0,0,1550380,'https://www.gravatar.com/avatar/a8f6b784b545f51cf6ee24e3c3576541?s=128&d=identicon&r=PG&f=1'),(2260,1,'2013-11-20T04:43:51.110','Sandy Rivers',NULL,'2013-11-20T04:43:51.110','http://sandyriveroutfitters.ca','Manitoba',NULL,'<p>I ve been hunting since the early 2000 s and have one young son that like to hunt and fish. I love teaching him everything that Ive learned over the years. Nothing is more important to me than my son and luckily I get to share this passion with him.</p>\n',0,0,0,3417047,'https://i.stack.imgur.com/1K26U.jpg?s=128&g=1'),(2261,1,'2013-11-20T05:12:40.047','Andrea',NULL,'2013-11-20T05:12:40.047',NULL,NULL,NULL,NULL,0,0,0,3610597,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(2262,101,'2013-11-20T06:57:42.477','Daniel F',NULL,'2013-12-26T09:37:33.797',NULL,'Stuttgart, Germany',NULL,'<p>All in all, Im super interested in creating views onto data, visualizing data. And, usually as hobby, I also like to build systems which generate data.</p>\n\n<p>HTML, Javascript, WebSocket, Python, MongoDB, RabbitMQ; that kind of stack. I love AngularJS.</p>\n\n<p>I also know (or probably knew) quite a bit about audio programming (down to the last bit, as in multichannel surround sound wav files, surround sound mixing, audio resampling and filtering, in C++, <a href=\"http://www.mayasound.com\" rel=\"nofollow noreferrer\">http://www.mayasound.com</a>) as well as 3D-graphics-stuff. I wanted to create a full-blown audio sequencer in 3D space (and still would like to, but Ive realized that I cant do this without a proper team, which is hard to find). Nowadays that would be awesome considering that stuff like Oculus Rift exists.</p>\n\n<p>Ive played a lot with home automation (12V LED strips, RPi, ESP8266 &amp; Co., down to the power transistor level and Arduino PWM modulation, even <a href=\"https://www.youtube.com/watch?v=QWF8_Mfo1ek\" rel=\"nofollow noreferrer\">ATtiny45 programming</a>, and sensors like temperature, humidity and pressure)</p>\n\n<p>Im a PC (as in \"convinced Windows user\"), but I love Debian and Ubuntu.</p>\n\n<p>Im an Android user and have done my share of programming on that platform as well; thats what Im into at the moment.</p>\n\n<p>Ive also got above average networking experience (routing, subnets, UTM, DNS, SNMP) for someone who isnt in the networking business.</p>\n',0,2,0,103538,'https://i.stack.imgur.com/F0Dwz.png'),(2263,106,'2013-11-20T07:40:26.763','Gonzik007',NULL,'2017-05-05T21:54:15.367',NULL,NULL,NULL,'<p>Electrical Engineer. Sometimes I end up burning things.</p>\n',0,0,0,1035550,'https://i.stack.imgur.com/kAvbf.jpg?s=128&g=1'),(2264,1,'2013-11-20T08:23:36.667','moriarty',NULL,'2016-04-16T16:05:11.780','','Cologne, Germany',NULL,'',0,0,0,376831,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(2265,1,'2013-11-21T00:10:51.103','user2265',NULL,'2013-11-21T14:22:09.910',NULL,NULL,NULL,NULL,0,0,0,3615486,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(2266,11,'2013-11-21T05:03:51.717','akuaku',NULL,'2013-11-21T05:03:51.717',NULL,NULL,NULL,NULL,1,0,0,3616284,NULL),(2267,101,'2013-11-21T16:16:15.833','MechEngineer',NULL,'2017-04-18T18:37:27.490','http://wesg.ca','Ottawa, Canada',29,'<p>Im a mechanical engineer by education, but have stepped out into a more software oriented career path. </p>\n\n<p>I use a variety of code platforms like Swift, Objective-C, Java and C++ with web platforms like PHP, jQuery, HTML and CSS. </p>\n\n<p>I also work for an engineering company building advanced cooling solutions for computers, so my home system is fully water cooled. </p>\n\n<p>Hobbies away from the office include Arduino development, robots using ROS, boating, mountain biking and track driving events.</p>\n',0,0,0,406872,NULL),(2268,1,'2013-11-22T01:55:51.077','user2993737',NULL,'2013-11-22T02:19:09.023','','East Peoria, IL',18,'<p>I want to learn more about robotics.</p>\n',0,0,0,3586727,'https://www.gravatar.com/avatar/0f16e0f73d952d58e48ae9fa0c87a925?s=128&d=identicon&r=PG&f=1'),(2269,106,'2013-11-22T11:55:32.950','Elseine',NULL,'2013-12-12T16:04:00.473',NULL,NULL,NULL,NULL,1,0,0,271192