com/roosemberth/Coptex-Project.SCP-Kernel/commit/bd1465a8b0c32f7da2f19fdd5333f1b47eddfc55\" rel=\"nofollow\">kernel modules programming</a></li>\n<li>Embedded systems development</li>\n</ul>\n',0,4,0,2813036,NULL),(2283,1,'2013-11-25T10:09:41.523','kernelpanic',NULL,'2014-02-05T03:39:27.150',NULL,NULL,NULL,NULL,0,0,0,3635524,'https://www.gravatar.com/avatar/3436cd13460b9204ce88d767533620e4?s=128&d=identicon&r=PG&f=1'),(2284,101,'2013-11-25T12:00:41.583','Frederik H',NULL,'2016-11-09T19:21:17.900',NULL,NULL,27,NULL,0,5,0,1617270,'https://www.gravatar.com/avatar/4d730709e6715dc17df0a9474bfb2fc6?s=128&d=identicon&r=PG'),(2285,1,'2013-11-25T15:59:23.417','WFW',NULL,'2013-12-01T02:16:48.960','http://www.falk-wallace.com','New York, United States',25,NULL,0,0,0,3277535,NULL),(2286,101,'2013-11-25T22:52:00.683','Tom',NULL,'2013-11-26T08:52:49.683',NULL,NULL,NULL,NULL,0,0,0,273094,'https://www.gravatar.com/avatar/4c238809b06966a8dc79d0a2e65f1578?s=128&d=identicon&r=PG'),(2287,101,'2013-11-26T10:04:20.010','SurvMach',NULL,'2013-11-26T10:04:20.010','http://bit.ly/gplusrodrigoteixeira',NULL,NULL,'<blockquote>\n  <p>\"Stand tall bipedal ape.\"</p>\n</blockquote>\n\n<p><a href=\"http://www.radiolab.org/story/91912-in-defense-of-darwin/\" rel=\"nofollow\">http://www.radiolab.org/story/91912-in-defense-of-darwin/</a></p>\n\n<p>THE ORIGIN OF ORDER Pattiann Rogers</p>\n\n<p>Stellar dust has settled.</p>\n\n<p>It is green underwater now in the leaves</p>\n\n<p>Of the yellow crowfoot. Its potentialities</p>\n\n<p>Are gathered together under pine litter </p>\n\n<p>As emerging flower of the pink arbutus.</p>\n\n<p>It has gained the power to make itself again</p>\n\n<p>In the bone-filled egg of osprey and teal.</p>\n\n<p>One could say this toothpick grasshopper</p>\n\n<p>Is a cloud of decayed nebula congealed and perching</p>\n\n<p>On his female mating. The tortoise beetle,</p>\n\n<p>Leaving the stripped veins of morning glory vines</p>\n\n<p>Like licked bones, is a straw-colored swirl</p>\n\n<p>Of clever gases.</p>\n\n<p>At this moment there are dead stars seeing</p>\n\n<p>Themselves as marsh and forest in the eyes</p>\n\n<p>Of muskrat and shrew, disintegrated suns</p>\n\n<p>Making songs all night long in the throats</p>\n\n<p>Of crawfish frogs, in the rubbings and gratings</p>\n\n<p>Of the red-legged locust. There are spirits of orbiting</p>\n\n<p>Rock in the shells of pointed winkles</p>\n\n<p>And apple snails, ghosts of extinct comets caught</p>\n\n<p>In the leap of darting hare and bobcat, revolutions</p>\n\n<p>Of rushing stone contained in the sound of these words.</p>\n\n<p>Maybe the paths of the Pleiades and Coma clusters</p>\n\n<p>Have been compelled to mathematics by the mind</p>\n\n<p>Contemplating the nature of itself</p>\n\n<p>In the motions of stars. The patterns</p>\n\n<p>Of the starry summer night might be identical</p>\n\n<p>To the structure of the summer heavens circling</p>\n\n<p>Inside the skull. I can feel time speeding now </p>\n\n<p>In all directions deeper and deeper into the black oblivion</p>\n\n<p>Of the electrons directly behind my eyes.</p>\n\n<p>Child of the sky, ancestor of the sky, the mind</p>\n\n<p>Has been obligated from the beginning</p>\n\n<p>To create an ordered universe</p>\n\n<p>As the only possible proof</p>\n\n<p>Of its own inheritance.</p>\n',0,0,0,3325033,'https://i.stack.imgur.com/8aeUN.jpg?s=128&g=1'),(2288,101,'2013-11-26T11:56:53.430','LCFactorization',NULL,'2014-09-14T02:47:27.077',NULL,NULL,NULL,NULL,0,0,0,3276436,'https://i.stack.imgur.com/DdT2M.png'),(2289,127,'2013-11-26T12:47:05.680','Marco',NULL,'2017-08-24T13:38:14.393','http://www.debooy.eu',NULL,NULL,'<p>Informatician and chessplayer.</p>\n',1,4,0,3480622,'https://i.stack.imgur.com/8Vlxy.png'),(2290,103,'2013-11-26T18:18:11.373','gtmtg',NULL,'2017-07-09T14:18:30.737','http://mihir.garimella.io',NULL,NULL,NULL,2,8,0,1477871,NULL),(2291,101,'2013-11-27T00:07:44.197','Tianyang Li',NULL,'2013-12-09T00:17:15.637','http://li-tianyang.com',NULL,26,