.png?s=128&g=1'),(2438,103,'2013-12-20T11:55:12.927','Ricardo',NULL,'2015-08-14T18:57:43.327',NULL,'Brazil',43,'<p>Im a Software Engineer with MSc in Computer Science. I currently work in Financial Markets and Banking as a Software and Business Analyst. I have a minor in Computer Engineering, which I completely neglected during college. Now Im trying to catch up. But mostly I consider myself just a hobbyist trying to teach myself electronics.</p>\n\n<p>Things I like the most in electronics:</p>\n\n<ol>\n<li>To design and etch my own PCBs at home (mostly with thru-role components, with an occasional SMD part to spice things up)</li>\n<li>To play with the oscilloscope</li>\n<li>To light up LEDs and 7-segment displays</li>\n<li>To gut toy RC cars and redo their electronics</li>\n<li>To organize my electronics components into neat boxes</li>\n<li>To browse questions and answers here at EE.SE and to edit posts to make them shine (when I can, that is, but Im especially fond of fixing equations formatting using MathJaX)</li>\n</ol>\n',0,2,0,3368906,'https://i.stack.imgur.com/iSJAA.jpg?s=128&g=1'),(2441,101,'2013-12-21T08:37:17.480','Black',NULL,'2013-12-21T08:37:17.480',NULL,NULL,NULL,NULL,0,0,0,3293578,'https://www.gravatar.com/avatar/1e99583e5df621df8d52ce0579a0affd?s=128&d=identicon&r=PG&f=1'),(2442,1,'2013-12-22T01:16:28.383','stjenkins',NULL,'2013-12-22T01:16:28.383','http://www.theelectricguide.com','New Mexico',22,'<p>I am a student computer engineer at New Mexico State University in Las Cruces New Mexico. I am interested in how hardware interfaces with software and enjoy coding things at a very low level.</p>\n',0,0,0,3761516,'https://www.gravatar.com/avatar/e5b931e585463f316961f756936e4409?s=128&d=identicon&r=PG&f=1'),(2444,101,'2013-12-22T17:33:38.767','Guy Coder',NULL,'2017-07-20T15:52:50.350','http://none','East Coast USA',NULL,'<p>My work is here on <a href=\"https://github.com/EricGT\" rel=\"nofollow\">github</a></p>\n\n<p>Currently working on <a href=\"https