L),(2469,101,'2013-12-27T16:20:56.090','Chad',NULL,'2014-08-08T21:16:29.857',NULL,'Peoria, IL',NULL,'<p>Once Upon a time a magical company called MagicDollars (for the sake of brevity for the rest of the answer we will refer to this company by its stock ticker M$) and this company made the most widely used, operating system, internet browser, office productivity suite, and various other products. M$ had this great idea to just integrate all of its software so that they would all work together seamlessly. This would be great for users of this software since this would make doing things like importing a webpage in a Ward processing (because in magicland we have wards instead of words) document, seemlessly and natively.</p>\n\n<p>But this would evidently make the software too good. And we cant have people getting software that is too good. Because then if another company came along with their own version of good software people will be too dumb to install and use that if they have the already integrated versions that were included. So the Neanderthal Union decreed that M$ was using its magical abilities to make things too difficult for smaller developers to create super complex applications that they must give away for free. And said you will no longer make things work together seemlessly.</p>\n\n<p>And instead of extending their middle wand to the NeU and saying fine we shall no longer make software that can be used in the NeU... M$ bowed before the luddites and said ok. So now you can not rename a file from inside of your office productivity suite in Magicland.</p>\n',0,0,0,368463,'https://www.gravatar.com/avatar/d2f14b7c252d0223dffd78b2eab0932f?s=128&d=identicon&r=PG'),(2470,1,'2013-12-27T18:05:06.193','Matt',NULL,'2014-02-21T19:37:05.110',NULL,NULL,NULL,NULL,0,0,0,1138709,'https://www.gravatar.com/avatar/c44a55b48937436d3c1b573c037a5dbe?s=128&d=identicon&r=PG'),(2471,116,'2013-12-28T01:21:44.717','jonathanberi',NULL,'2015-07-06T22:42:15.880','http://www.jonathanberi.com/','San Francisco, CA',NULL,'<p>I eat APIs for breakfast. They go surprisingly well with milk. I work for Nest on the Works with Nest team.</p>\n',0,0,0,92078,NULL),(2472,101,'2013-12-28T03:15:16.020','psxls',NULL,'2013-12-28T03:15:16.020',NULL,NULL,NULL,NULL,0,0,0,2455533,'https://i.stack.imgur.com/88fHl.jpg'),(2473,101,'2013-12-28T05:25:05.060','Henry',NULL,'2017-05-01T18:36:18.793',NULL,'Auburn, NH, United States',NULL,NULL,0,0,0,19551,NULL),(2474,99,'2013-12-28T14:04:44.797','Devgeet Patel',NULL,'2013-12-29T15:24:40.063',NULL,NULL,22,NULL,0,0,0,3733174,'https://www.gravatar.com/avatar/d21067ca0ffdeef6f683a7f4e69bb259?s=128&d=identicon&r=PG&f=1'),(2475,101,'2013-12-28T20:45:55.113','Kevin',NULL,'2013-12-28T21:16:25.680',NULL,NULL,NULL,'<p>It works on my machine.</p>\n',0,0,0,800923,'https://www.gravatar.com/avatar/98c2ae231cd8eedb2a79d9ec45c271fd?s=128&d=identicon&r=PG'),(2476,101,'2013-12-28T20:54:40.160','Zignd',NULL,'2013-12-28T20:54:40.160','http://zignd.github.io','S o Paulo - Brasil',22,NULL,0,0,0,1285227,'https://i.stack.imgur.com/giCRY.jpg'),(2477,101,'2013-12-29T02:55:23.680','Gustavo Carreno',NULL,'2013-12-29T02:55:23.680','http://guscarreno.blogspot.com/','Lancaster, United Kingdom',47,'<p>Im a programmer. That doesnt say much \"per se\". Its the only thing I know...</p>\n',0,0,0,5162,'https://www.gravatar.com/avatar/9ec8b2140e6b316f3c01a4255ee1735b?s=128&d=identicon&r=PG'),(2480,101,'2013-12-30T03:54:15.337','kronenpj',NULL,'2014-10-19T00:58:48.547',NULL,'Florida',NULL,NULL,0,0,0,3275913,'https://www.gravatar.com/avatar/bd2491fdbce6fa9fb8d44418300de846?s=128&d=identicon&r=PG&f=1'),(2481,101,'2013-12-30T08:10:31.173','ankit',NULL,'2013-12-30T08:10:31.173',NULL,'Jaipur, Rajasthan, India',22,'<p>Im a math sophomore at IGNOU who being a distance learner gets to know most of the stuff from internet.</p>\n\n<p>Bachelor of Science (Math): IGNOU (2016-2019)</p>\n\n<p>Master of Science (Math or CS): 2019-202x</p>\n\n<p>I can be found here:</p>\n\n<p><a hr