g, N., Adams, E., Burnett, J., Shin, J. Y., Dik, B. J., &amp; Me. (2010). <a href=\"http://www.michaelfsteger.com/wp-content/uploads/2012/08/Steger-et-al.-PSR-2010.pdf\" rel=\"nofollow\">The quest for meaning: Religious affiliation differences in the correlates of religious quest and search for meaning in life</a>. <em>Psychology of Religion and Spirituality, 2</em>(4), 206-226.</li>\n</ul>\n\n<p><strong>Posters and presentations</strong> (PowerPoints available on <a href=\"http://www.slideshare.net/NickStauner\" rel=\"nofollow\">my SlideShare page</a>)</p>\n\n<ul>\n<li>Me &amp; Ozer, D. J. (2012). <em>Matching goals to values: Correlations follow semantic similarities.</em> 92nd WPA, San Francisco.</li>\n<li>Me. (2012). <em>Existential and psychological health as products of intrinsic goal attainment.</em> Presentation, April 19, UCR.</li>\n<li>Me, Selvam, T., Cheong, R., &amp; Ozer. (2011). <em>Religious differences in the value systems of meaningful (and meaningless) lives.</em> 2nd ARP, Riverside.</li>\n<li>Me &amp; Ozer. (2011). <em>Joint factors of spirituality and religiousness.</em> 91st WPA, Los Angeles.</li>\n<li>Me &amp; Ozer. (2011). <em>Spiritual predictors of the search for meaning in life.</em> 12th SPSP, San Antonio.</li>\n<li>Me. (2010). <em>Current research in existential psychology.</em> Presentation, November 4, UCR.</li>\n<li>Me, Boudreaux, M. J., &amp; Ozer. (2010). <em>Factor structure of the Values Q-Set.</em> 118th APA, San Diego.</li>\n<li>Me &amp; Ozer. (2010). <em>The motive content of meaningful (and meaningless) lives.</em> 15th EAPP, Brno, Czech Republic.</li>\n<li>Me, Stimson, T. S., &amp; Boudreaux. (2010). <em>The curve of the quest for a more meaningful life.</em> 11th SPSP, Las Vegas.</li>\n<li>Me. (2010). <em>The Values Q-Set.</em> Presentation, January 21, UCR.</li>\n<li>Me, Stimson, Boudreaux, &amp; Ozer. (2009). <em>When do personality traits predict personal goals?</em> 1st ARP, Evanston.</li>\n<li>Me. (2009). <em>The factor structure of personal goals.</em> Presentation, June 4, UCR.</li>\n<li>Me, Stimson, &amp; Ozer. (2009). <em>The factor structure of personal goals in an undergraduate population.</em> 10th SPSP, Tampa.</li>\n</ul>\n',0,3,0,2390545,'https://i.stack.imgur.com/5Vkq8.jpg'),(2548,1,'2014-01-07T06:24:05.937','Pankaj Jawale',NULL,'2014-01-07T06:24:05.937',NULL,'India',28,NULL,0,0,0,3482832,'https://www.gravatar.com/avatar/245328f0ad4135080466be407f056eb5?s=128&d=identicon&r=PG&f=1'),(2549,1,'2014-01-07T07:22:26.250','Julio Andryanto',NULL,'2014-01-07T07:22:26.250','http://www.julvicomputer.blogspot.com',NULL,NULL,'<p>in unity android project</p>\n',0,0,0,3818842,'https://www.gravatar.com/avatar/a38f8b8f0b013877e72fd9abef80b10b?s=128&d=identicon&r=PG&f=1'),(2550,1,'2014-01-07T08:22:48.447','Deepak',NULL,'2014-01-07T08:22:48.447',NULL,'India',NULL,NULL,0,0,0,1663835,'https://www.gravatar.com/avatar/3444075a3cccf44d5f7d62c5a72afe99?s=128&d=identicon&r=PG'),(2551,101,'2014-01-07T12:56:20.470','Harsh Goswami',NULL,'2014-01-07T12:56:20.470',NULL,'Mumbai, India',25,NULL,0,0,0,3103902,'https://i.stack.imgur.com/xSPqz.jpg'),(2552,6,'2014-01-07T17:37:26.657','Hugine Perdosh',NULL,'2014-01-09T14:20:12.700',NULL,NULL,NULL,NULL,2,0,0,3822437,'https://www.gravatar.com/avatar/d48024df6c4d61a72b802054044f59b7?s=128&d=identicon&r=PG&f=1'),(2553,101,'2014-01-07T20:30:26.290','tatigo',NULL,'2014-01-07T20:30:26.290','http://www.aucsoftware.com',NULL,NULL,'<h1>SOreadytohelp</h1>\n\n<p>Software Consultant, owner of AUC Software Solutions </p>\n\n<p><a href=\"http://www.aucsoftware.com\" rel=\"nofollow\">www.aucsoftware.com</a></p>\n\n<p><a href=\"http://aucsoftwaresolutions.blogspot.com/\" rel=\"nofollow\">blog</a></p>\n',0,0,0,538061,NULL),(2554,101,'2014-01-07T22:11:47.913','Kae Verens',NULL,'2017-01-10T18:50:03.673','http://verens.com/','Monaghan, Ireland',41,'<p>programmer and owner/manager of kvsites.ie<br />\nauthor of <a href=\"http://www.packtpub.com/jquery-1-3-with-php/book\" rel=\"nof