ckles',NULL,'2014-01-10T19:55:05.333',NULL,'Seattle, WA',42,'<p>Software Engineer focussing on backend technologies, currently Groovy/Grails and MongoDB. Amateur game developer and blacksmith. Currently working for Rally Software.</p>\n',0,0,0,302217,'https://i.stack.imgur.com/XM1iP.png?s=128&g=1?s=128&g=1'),(2580,1,'2014-01-10T20:46:39.907','user2580',NULL,'2014-01-10T20:46:39.907',NULL,NULL,NULL,NULL,0,0,0,3795048,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(2581,21,'2014-01-10T23:41:06.013','user2581',NULL,'2014-01-10T23:41:06.013',NULL,NULL,NULL,NULL,0,0,0,3840614,NULL),(2582,101,'2014-01-11T00:02:19.667','mut1na',NULL,'2014-01-19T22:38:22.123',NULL,'London',NULL,NULL,0,0,0,249377,'https://www.gravatar.com/avatar/ef9c173c286ba4ffefb94517b743d56a?s=128&d=identicon&r=PG'),(2583,101,'2014-01-11T09:39:07.347','Adel Bibi',NULL,'2014-04-04T19:17:33.657',NULL,'Kuwait',NULL,'<blockquote>\n  <p>Computer Vision,\n  Machine Learning,\n  Image Processing,\n  Data Compression,\n  Electronics,\n  Signals Processing,\n  Control and systems, and\n  Arduino.</p>\n</blockquote>\n\n<p>Ill do my best to help!</p>\n',1,0,0,3159967,'https://graph.facebook.com/100000062547813/picture?type=large'),(2584,6,'2014-01-11T13:33:51.077','hedziu',NULL,'2015-04-15T06:57:20.783',NULL,NULL,NULL,NULL,0,0,0,3146453,'https://www.gravatar.com/avatar/1d69a34b18f873920a15f99b03b6be57?s=128&d=identicon&r=PG'),(2585,101,'2014-01-11T14:25:43.140','nkint',NULL,'2016-07-06T09:57:30.647','http://interazioneinnaturale.tumblr.com',NULL,33,'<p>recursive: adjective, see recursive.</p>\n',0,1,0,192504,'https://www.gravatar.com/avatar/1d20b1339a3743da887052b2c6099c0f?s=128&d=identicon&r=PG'),(2586,101,'2014-01-11T14:35:56.653','CLJ',NULL,'2014-01-11T14:35:56.653',NULL,NULL,NULL,NULL,0,0,0,64932,'https://www.gravatar.com/avatar/81fb2a9a72ff28531367baf8cadd2952?s=128&d=identicon&r=PG'),(2587,101,'2014-01-11T17:48:13.803','Sergey Karpushin',NULL,'2014-01-11T17:48:13.803','http://www.eftracker.ru/'