urrent state of devops.</p>\n\n<p>At home in my spare time I tinker with hardware, homebrew beer, play video games, and (of course) write code.</p>\n',0,0,0,30222,NULL),(3768,1,'2014-02-05T05:38:42.043','Mohammad',NULL,'2014-02-05T05:38:42.043','http://mrl-spl.ir','Iran',28,NULL,0,0,0,1209068,'https://www.gravatar.com/avatar/a8495edb26c11e085ae11ce2534889b5?s=128&d=identicon&r=PG'),(3769,6,'2014-02-05T11:19:36.280','Waqas Aslam',NULL,'2014-02-06T10:02:23.710',NULL,NULL,NULL,NULL,2,0,0,2879268,'https://www.gravatar.com/avatar/1134e301178da59b18fc360c0cf8a194?s=128&d=identicon&r=PG'),(3770,1,'2014-02-05T11:36:48.057','yantayga',NULL,'2014-02-05T12:10:09.513','http://yantayga.livejournal.com','Russia',39,'<p>programmer, eternal student</p>\n',0,0,0,325838,'https://www.gravatar.com/avatar/4896699e5b9dd4583b6e80a89bbe5cea?s=128&d=identicon&r=PG'),(3771,1,'2014-02-05T18:21:24.800','chrischarlton',NULL,'2014-02-05T18:21:24.800','http://chrischarlton.us','Los Angeles, CA',NULL,'<p>Author. Contributor. Technologist.</p>\n',0,0,0,485257,'https://www.gravatar.com/avatar/3f498ace608f71e66d7b3f783e75e8e1?s=128&d=identicon&r=PG'),(3773,1,'2014-02-05T23:49:12.203','so_terik',NULL,'2014-02-05T23:49:12.203',NULL,'Costa Mesa, CA',NULL,'<p>I am an experienced developer with 15+ years developing software. I have worked on both internal solutions, and public facing web sites.\nI am competent in designing and developing all layers, and familiar with many of the different tools, technologies, and patterns used to implement them. I have experience building web services (ReST and SOAP), ORMs (NHibernate, Entity Framework, Dapper), unit testing frameworks, MVC6, WebAPI v2, AJAX/JSON/jQuery, and cross-browser compatibility.</p>\n\n<p>I have used TFS, git, GitHub, GitLab, Nuget and npm.\nI have worked on teams that used SCRUMAgile, and Waterfall.\nI believe in DDD, TDD, dependency injection, and SOLID Principles.</p>\n\n<p>My stronger language skill set includes C# 4.5+, Javascript, HTML5, CSS3, Sass, SQL.\nDatabases I have worked with are MSSQL, MongoDB, Redis (Lua), PostgreSQL, Oracle, RavenDB.</p>\n\n<p>Ive been actively developing skills for Electron, Elixir, R(RStudio), and played a bit with Scala and Spark.\nI plan to spend some time this year learning Akka.NET.\nI also have an interest in CD and DevOps (Jenkins, Puppet, Chef, Vagrant, Docker).\nCI using Jenkins, Selenium.</p>\n\n<p>Fairly proficient using es6 with Babel, React, Redux, Connect, Radium, lodash, immutable, NodeJS, Express, Jade, and various other js modules, extensive Gulp and some webpack.</p>\n\n<p>I have recently built a small app using the new ASP.NET Core 1.0 on my MacBook Pro.</p>\n\n<p>I always consider and use best practices for high performance mobile browser networking.\nHave a good understanding about caching all the way from the data layer, to the browser layer (Redis for data layer, edge-control header for edge, cache-control header for intermediaries and browser, and browser data using local-storage).</p>\n\n<p>Function as the team architect, and work closely with the infrastructure and operations teams.</p>\n',0,0,0,412428,NULL),(3774,101,'2014-02-06T03:11:24.880','AaronKlapheck',NULL,'2014-03-08T01:15:18.263','http://www.aaronklapheck.com',NULL,NULL,'',1,0,0,1544664,NULL),(3775,116,'2014-02-06T03:45:45.033','Maxim Zaslavsky',NULL,'2014-02-12T13:29:07.620','http://maximzaslavsky.com','San Diego, CA',20,'<p>Im a computer science student at Princeton University, originally from San Diego, CA. I use machine learning to approach problems in biology and healthcare. My current research applies machine learning to immunology. </p>\n\n<p>I wrote my first app (a VB6-powered word-search solver) when I was 7, and Ive been hooked on programming ever since. I discovered and got involved in the Stack Overflow community in 2009 (when I was 12).</p>\n\n<p><a href=\"http://maximzaslavsky.com\" rel=\"nofollow noreferrer\">Check out my website for more information or to get in touch</a>.</p>\n',4,0,0,44361,NULL),(3776,113,'2014-02-06T16:08:10.103','user1938107',NULL,'2016-08-31T01:21:33.997',NULL,NULL,NULL,'<p>Interested in programming with python.\nLooking to learn more about robots, math, and programming</p>\n',0,2,0,1676077,'https://www.gravatar.com/avatar/4891ea7797cd519a09fe34b8fa32075e?s=128&d=identicon&r=PG'),(3777,101,'2014-02-06T17:17:12.407','CodingDuckling',NULL,'2014-12-22T14:33:22.777','http://www.tanukiteam.com','Dublin, Ireland',29,'<p>Currently working as an IT Project Manager (Mobile Applications and Medical Devices), but still trying to punch in some code on my spare time.</p>\n\n<p>Interested in mobile &amp; wearable apps development, RegEx &amp; machine learning, robotics, and most of all in space exploration.</p>\n\n<p>Would love at some point to enter the space industry.</p>\n\n<p><a href=\"http://stackexchange.com/users/1773438\">\n<img src=\"http://stackexchange.com/users/flair/1773438.png\" width=\"208\" height=\"58\" alt=\"profile for CodingDuckling on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for CodingDuckling on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n\n<hr>\n\n<p><strong>Work Experience:</strong> Most recently worked as an <em>Agile Project Manager</em> and <em>Scrum Master</em> on enterprise software application development (mobile, cloud &amp; web) projects. Prior to that I worked as a <em>Software Developer</em> doing mobile (Android), web (PHP, Python-Django, RoR), and cloud (Salesforce) applications.</p>\n\n<p><strong>Academic Background:</strong> B.Sc. Systems Engineering <strong>|</strong> A.Sc. Analyst Programmer (Web Apps. Development) <strong>|</strong> Certifications: CSM, PMP.</p>\n',0,0,0,1773438,NULL),(3778,101,'2014-02-06T18:17:55.990','FlaSh',NULL,'2014-02-06T18:17:55.990',NULL,NULL,NULL,NULL,0,0,0,3495405,'https://i.stack.imgur.com/6oURX.jpg?s=128&g=1'),(3779,1,'2014-02-06T19:26:56.547','user108569',NULL,'2014-02-06T19:26:56.547',NULL,NULL,NULL,NULL,0,0,0,3576189,'https://www.gravatar.com/avatar/5cae6011f8e85c17656784844342e31c?s=128&d=identicon&r=PG&f=1'),(3780,1,'2014-02-06T22:31:15.370','Ahmed Mohsen',NULL,'2014-02-06T22:31:15.370',NULL,NULL,NULL,NULL,0,0,0,3199402,'https://graph.facebook.com/100002527039594/picture?type=large'),(3781,101,'2014-02-06T23:02:56.383','Robert Lucian Chiriac',NULL,'2017-08-17T12:19:47.763',NULL,'Bucharest, Romania',NULL,'<p><strong>Embedded Systems:</strong></p>\n\n<ol>\n<li>Arduino, Raspberry, Galileo, PIC, Adafruit MCUs, etc</li>\n<li>Xbees, Bluetooth BLE, Radio Communication (2-way), WiFi, Cell Tower Communication (GSM boards), etc</li>\n<li>I2C, UART, SPI, PWM and so on</li>\n<li>Relays, Switches, Power Converters, Muxs, Demuxes, Cameras, Accelerometers, Gyros, GPS, Compass, Light detectors, PIR (motion detectors), etc</li>\n</ol>\n\n<p><strong>Programming:</strong></p>\n\n<ol>\n<li>C/C++, Python, JavaScript, , HTML5, C#, Java, CSS + GSS, Sphinx + ReadTheDocs, following best practices for developing architectures and software solutions, etc</li>\n<li>Familiar w/ Linux, Windows, Android. Work w/ VS Code, JetBrains, Source Control, CodeBlocks, Sublime, Putty, FileZilla, etc</li>\n</ol>\n\n<p><strong>Electronic systems:</strong></p>\n\n<ol>\n<li>Eagle CAD, PCB layout, prototyping, circuit design, etc</li>\n<li>Drawings and Gerber files </li>\n<li>I know the manufacturing process - I also know how to make a board on my own and how to solder components on a board - useful for prototyping</li>\n</ol>\n\n<p><strong>Components/Parts Design:</strong></p>\n\n<ol>\n<li>Solidworks, AutoCAD</li>\n<li>Design mechanical arms, complex structures, gears, etc</li>\n<li>I work with plexiglass, rubberized material, balsa, PLA, ABS, laser-cut, etc</li>\n</ol>\n',4,0,0,2398410,'https://i.stack.imgur.com/4rzYj.png?s=128&g=1'),(3782,103,'2014-02-06T23:34:22.583','T-800',NULL,'2017-01-11T23:33:40.590',NULL,'Karlsruhe, Germany',NULL,NULL,0,0,0,3909795,'https://www.gravatar.com/avatar/f51512bf3c1df03151223787141eb1f7?s=128&d=identicon&r=PG&f=1'),(3783,101,'2014-02-07T02:27:49.043','user123',NULL,'2014-02-07T02:27:49.043',NULL,NULL,NULL,NULL,0,0,0,1398329,'https://www.gravatar.com/avatar/b98c366f5918092c5affa1d24bbf5bdf?s=128&d=identicon&r=PG&f=1'),(3784,1,'2014-02-07T05:07:36.820','Schalk',NULL,'2014-02-07T05:07:36.820','http://www.linkedin.com/in/schalkvanwyk','Cape Town, South Africa',41,'<p>BY DAY: Slave to alien code...</p>\n\n<p>BY NIGHT: Information overloading</p>\n\n<p>FOR FUN: Riding waves in peace</p>\n',0,0,0,13331,NULL),(3785,101,'2014-02-07T15:21:08.203','fpe',NULL,'2014-02-07T15:21:08.203','https://www.xing.com/profile/Francesco_Perrone5?sc_o=mxb_p','Hamburg, Germany',31,'<p>PhD Student in Offshore Wind Energy: focus on reduction of aerodynamic and aerodynamic loads by means of active/passive control strategies.</p>\n\n<p>Mechanical Engineer involved in the Wind Energy Business.</p>\n\n<p>Aero-elastic simulations.</p>\n\n<p>Matlab Passionate.</p>\n\n<p>C++ Learner.</p>\n\n<p>Check my research group web page out if you are interested in wind turbine design and monitoring: <a href=\"http://www.we-sys.uni-oldenburg.de/en/\" rel=\"nofollow\">http://www.we-sys.uni-oldenburg.de/en/</a></p>\n',0,0,0,1117284,'https://i.stack.imgur.com/MWjBA.jpg'),(3786,101,'2014-02-07T18:34:53.743','Nican',NULL,'2014-10-03T21:42:54.177','http://nican.net/','New York, NY',25,NULL,0,0,0,35304,'https://www.gravatar.com/avatar/d4227bb1f45da71fc24ee28a90703c82?s=128&d=identicon&r=PG'),(3787,1,'2014-02-08T03:02:51.390','mdhossain',NULL,'2014-02-12T04:49:46.013',NULL,'Toronto, Canada',NULL,'<p>I love coding, playing/making music, playing outdoor games, socializing. I have a curious mind. I love drinking tea, a lot. I consider myself a Full Stack developer(native mobile including android and ios,  front end using php, angularjs, javascript, css, html, backend using java, php, ruby).</p>\n',0,0,0,3546340,'https://i.stack.imgur.com/XVFvz.jpg?s=128&g=1'),(