0V.png?s=128&g=1'),(3801,101,'2014-02-11T15:56:49.177','Pankaj',NULL,'2014-02-11T15:56:49.177',NULL,'Pune, India',NULL,NULL,0,0,0,2647611,'https://i.stack.imgur.com/4fDTW.jpg?s=128&g=1'),(3802,101,'2014-02-12T04:38:21.140','yakhtarali',NULL,'2014-02-20T03:35:47.087',NULL,'Karachi, Pakistan',26,'<p>With a Bachelors degree in Computer Science from Pakistan, University of Karachi, I have been in IT industry for almost three years. </p>\n\n<p>BY DAY:  I m a software engineer with <a href=\"http://www.gomasterkey.com\" rel=\"nofollow\">Masterkey</a>. Previously I have worked with three different software companies on several software development projects that include .Net and Android development.</p>\n\n<p>BY NIGHT: I used to google latest technologies and learn modern coding techniques.</p>\n',0,0,0,3572360,'https://i.stack.imgur.com/42sbm.jpg'),(3803,101,'2014-02-12T11:07:22.527','winnyboy5',NULL,'2014-05-10T11:29:10.753','http://aswinkrishnamoorthy.in','Coimbatore, India',26,'<p><a href=\"http://stackoverflow.com/users/3251960/winnyboy5\">\n<img src=\"http://stackoverflow.com/users/flair/3251960.png\" width=\"208\" height=\"58\" alt=\"profile for winnyboy5 at Stack Overflow, Q&amp;A for professional and enthusiast programmers\" title=\"profile for winnyboy5 at Stack Overflow, Q&amp;A for professional and enthusiast programmers\">\n</a></p>\n\n<p>Hello,</p>\n\n<p>I am Web Programmer and designer from India, who is obsessed with programming and designing.</p>\n',0,0,0,3935393,NULL),(3804,101,'2014-02-12T12:33:13.137','areyling',NULL,'2014-02-12T12:33:13.137','http://www.linkedin.com/in/andrewreyling','Indianapolis, IN',33,'<p>Currently peeking at mobile application development.</p>\n',0,0,0,69781,NULL),(3805,101,'2014-02-12T14:33:20.203','Felix Yan',NULL,'2015-03-14T16:22:30.497','http://felixc.at','Wuhan, China',26,'<ul>\n<li>Arch Linux Developer</li>\n<li>Python Programmer</li>\n<li>Whistler</li>\n</ul>\n',0,0,0,325510,NULL),(3806,1,'2014-02-12T15:00:35.417','Chor Hatara Hudu Keturi',NULL,'2015-09-08T15:52:47.973',NULL,NULL,NULL,NULL,0,0,0,2977860,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(3807,1,'2014-02-13T00:04:22.677','D--',NULL,'2014-02-13T00:04:22.677',NULL,NULL,NULL,NULL,0,0,0,4010313,'https://www.gravatar.com/avatar/6f911c908d9e6a90c8faea871d892d0f?s=128&d=identicon&r=PG'),(3808,101,'2014-02-13T05:31:15.813','rahulroy9202',NULL,'2014-02-13T05:31:15.813',NULL,NULL,25,NULL,0,0,0,2575000,'https://www.gravatar.com/avatar/ade51833a4bfd59b9df5caa95b15a3df?s=128&d=identicon&r=PG'),(3809,1,'2014-02-13T09:38:17.377','David Aditya',NULL,'2014-03-28T02:04:53.710',NULL,'Indonesia',21,'<p>I love to code, I love to share, I love to solve everything with logic, and stackoverflow is my best friend</p>\n',0,0,0,2569295,'https://www.gravatar.com/avatar/fc24f1903861cf29a542bfe5a7ebb2a0?s=128&d=identicon&r=PG&f=1'),(3810,1,'2014-02-13T11:02:41.193','user26038',NULL,'2014-02-13T11:02:41.193',NULL,NULL,NULL,NULL,0,0,0,3963112,'https://www.gravatar.com/avatar/0bf087ae34f3ce0b5bcd6fae2ae5816e?s=128&d=identicon&r=PG&f=1'),(3811,101,'2014-02-13T11:33:09.100','mhd.math',NULL,'2017-08-10T22:07:58.303',NULL,'Damascus, Syria',NULL,'<p>interested in math and modern physique</p>\n',0,0,0,2253503,'https://i.stack.imgur.com/Vi5Vq.png'),(3813,101,'2014-02-13T17:29:48.540','TommasoF',NULL,'2016-07-26T15:48:47.567',NULL,'Miami, FL',30,NULL,0,0,0,2025293,'https://www.gravatar.com/avatar/2ef7afd5bbc592d0117feef4a9675297?s=128&d=identicon&r=PG'),(3814,101,'2014-02-13T17:41:55.473','Ross',NULL,'2014-02-13T17:41:55.473',NULL,NULL,NULL,'<p></p>\n',0,0,0,1234083,NULL),(3815,1,'2014-02-13T18:32:10.663','user3247400',NULL,'2014-02-13T21:21:37.230',NULL,NULL,NULL,NULL,0,0,0,3927648,'https://www.gravatar.com/avatar/967ba685d47b0d94807c535c2ace544a?s=128&d=identicon&r=PG&f=1'),(3816,101,'2014-02-13T23:00:37.423','Chris Ryding',NULL,'2017-01-11T22:23:51.507','http://www.linkedin.com/pub/chris-ryding/3/599/61b/','Thousand Oaks, CA',44,'<p>Embedded systems engineer.</p>\n',0,3,0,39478,NULL),(3817,1,'2014-02-14T02:07:22.347','Cameron Chaparro',NULL,'2014-03-16T21:16:59.383',NULL,'USA',26,NULL,0,0,0,2593123,NULL),(3818,101,'2014-02-14T05:12:19.427','BeowulfNode42',NULL,'2014-02-14T05:12:19.427',NULL,NULL,NULL,NULL,0,0,0,2901243,'https://www.gravatar.com/avatar/9d4bc60f3ef48f00e3354b7acab85fe1?s=128&d=identicon&r=PG'),(3819,1,'2014-02-14T06:09:17.360','Paresh471',NULL,'2014-02-14T06:09:17.360','http://www.paresh.info','Las Vegas, NV, United States',28,'<p>I have some knowledge about a few programming languages, mainly gearing towards robotics applications. As well as some knowledge about website development and web server administration.</p>\n\n<p>I am actively working on finishing up writing my masters thesis. The topic is: Remote Sensing with multiple collaborative Unmanned Aerial Systems. My primary work is build, test, and collect sensor data over a given area. Also to allow for vehicle-to-vehicle communication which can then be used to perform terrain scanning missions that can be dynamically adjusted without a human in the loop. This basically means get 3 or more hexarotors to fly in a formation, and then scan the terrain with a sensor. The scan results will identify intensity in a specific spectrum, and will allow 1 UAS to adjust the mission of the other UAS platforms to bring them closer to its own flight path so the spectral reading could be triangulated or localized.</p>\n\n<p>This work is being done to fulfill a Department of Energy contract through <a href=\"http://www2.nstec.com/Pages/About.aspx\" rel=\"nofollow\">National Security Technologies (NsTec)</a> at the <a href=\"http://www2.nstec.com/pages/NNSS-Mission.aspx\" rel=\"nofollow\">Nevada National Security Site (NNSS)</a>.</p>\n\n<p>In the recent past I was team lead of the support group for <a href=\"http://www.theroboticschallenge.org/finalist/drc-hubo\" rel=\"nofollow\">Team DRC-Hubo at UNLV</a> for the Defense Advanced Research Projects Agency (DARPA) grand challenge. This particular prize competition was called the <a href=\"http://www.darpa.mil/program/darpa-robotics-challenge\" rel=\"nofollow\">DARPA Robotics Challenge</a> (DRC). Main priorities included but were not limited to electromechanical maintenance of the humanoid robot, logistics, and procurement. If a motor or a control board burns out then it is paramount that the appendage is dissembled to replace the components, and test them prior to operation in the <a href=\"https://www.youtube.com/watch?v=23k1gcnvVgc\" rel=\"nofollow\">staged disaster scene</a>.</p>\n\n<p>For a quick bio about me, please visit the <a href=\"http://www.drc-hubo.com/team-member-spotlight-paresh-brahmbhatt/\" rel=\"nofollow\">Team DRC-Hubo website</a>.</p>\n\n<p>For a quick video of me with a UAV, please visit the <a href=\"http://www.reviewjournal.com/life/technology/unlv-robotics-team-has-eye-the-future-video\" rel=\"nofollow\">Las Vegas Review-Journal</a>.</p>\n',0,0,0,2527946,'https://i.stack.imgur.com/QKGyw.jpg'),(3820,1,'2014-02-14T14:03:28.030','Yoyo',NULL,'2014-02-14T14:03:28.030','http://www.youwang.me/','Wuhan, China',NULL,'<p>Engineer.</p>\n',0,0,0,2898775,'https://i.stack.imgur.com/ZX3HH.jpg'),(3821,146,'2014-02-14T18:32:38.013','Tom Kerkhove',NULL,'2014-02-25T10:41:28.500','https://tomkerkhove.ghost.io','Belgium',NULL,'<p>Azure Consultant @ Codit &amp; Microsoft MVP for Microsoft Azure.</p>\n',1,3,0,401813,NULL),(3822,1,'2014-02-14T19:36:08.510','Sudhir Kumar',NULL,'2014-02-14T19:36:08.510',NULL,NULL,NULL,NULL,0,0,0,271041,'https://graph.facebook.com/505369261/picture?type=large'),(3823,28,'2014-02-14T21:19:53.537','Justin Chang',NULL,'2014-03-02T19:58:10.860',NULL,'Atlanta, GA, United States',17,NULL,0,0,0,2938097,'https://i.stack.imgur.com/TOYsD.png?s=128&g=1'),(3824,101,'2014-02-14T23:01:12.660','thecheech',NULL,'2016-08-19T21:36:32.913',NULL,'Paris, France',33,NULL,0,0,0,3816013,'https://i.stack.imgur.com/nOkCj.jpg'),(3825,1,'2014-02-15T04:21:40.790','h