xtape\" rel=\"nofollow\">http://perlmonks.org/?node=alextape</a></p>\n\n<p>@latest: <a href=\"http://opac.lbs-hildesheim.gbv.de/DB=1/SET=2/TTL=1/MAT=/NOMAT=T/CLK?IKT=1004&amp;TRM=Tebbje,Alexander\" rel=\"nofollow\">Markerless Object Recognition for Augmented Reality Apps</a></p>\n\n<p>@work: i have to use <a href=\"http://www.workrave.org/\" rel=\"nofollow\">http://www.workrave.org/</a> :)</p>\n',0,0,0,1713863,NULL),(3833,101,'2014-02-16T17:32:26.843','Chethan N',NULL,'2014-02-16T17:32:26.843','http://webslam.me','Mangalore, India',24,'<p>Looking to learn new things online!</p>\n',0,0,0,2012201,'https://i.stack.imgur.com/ewDYv.jpg?s=128&g=1'),(3834,1,'2014-02-17T13:12:43.133','user137313',NULL,'2014-02-17T13:12:43.133',NULL,NULL,NULL,NULL,0,0,0,1531527,'https://www.gravatar.com/avatar/69c0f6f02ced8ed4c98cc3ed8d77238c?s=128&d=identicon&r=PG'),(3835,1,'2014-02-17T15:18:16.527','lifetime',NULL,'2014-07-21T08:20:33.757',NULL,NULL,NULL,NULL,0,0,0,435319,'https://www.gravatar.com/avatar/7f23df4be04a1754ddb0d4456fe2b618?s=128&d=identicon&r=PG&f=1'),(3836,1,'2014-02-17T18:13:50.103','user3836',NULL,'2014-02-19T12:23:18.957',NULL,NULL,NULL,NULL,0,0,0,4035822,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(3837,101,'2014-02-17T20:44:49.437','Magnus',NULL,'2014-02-17T20:44:49.437','http://www.harbourfront.se/en/','Stockholm, Sweden',40,'<p>Professional iPhone developer at Harbour Front</p>\n',0,0,0,266915,'https://www.gravatar.com/avatar/3b53a2e616b5fbdb7340f67b31f53dae?s=128&d=identicon&r=PG'),(3838,6,'2014-02-18T09:43:14.393','user3165720',NULL,'2014-03-07T09:50:17.417',NULL,NULL,NULL,NULL,0,0,0,3816455,'https://www.gravatar.com/avatar/c3c8caf8bf69de8e1fb43ef3a819fd5d?s=128&d=identicon&r=PG&f=1'),(3839,1,'2014-02-18T10:08:48.210','meowthsli',NULL,'2014-02-18T10:08:48.210',NULL,NULL,NULL,NULL,0,0,0,1880043,'https://www.gravatar.com/avatar/3bec1ce38878e2f9d24c9f492f141a59?s=128&d=identicon&r=PG'),(3840,15,'2014-02-18T11:03:31.773','LPlates',NULL,'2015-06-02T01: