on), music (performance, composition, listening), musical instrument making (electronic, percussion), cooking (regional/ethnic), homebrewing, mead-making, robotics, hobby electronics.</p>\n\n<p>Skills: computer programming, Java, C, HTML, PHP, JSP/Servlets.</p>\n',0,0,0,4042507,'https://graph.facebook.com/1216936575/picture?type=large'),(3857,113,'2014-02-19T22:00:16.227','Michael Blake',NULL,'2014-05-05T06:45:54.643','https://crowdtalk.org','Oregon',21,'<p>I am just an 18 year old high school student trying to gain knowledge.</p>\n',0,0,0,3187915,'https://www.gravatar.com/avatar/33fad089255c86e4bc887744d6c3920c?s=128&d=identicon&r=PG&f=1'),(3858,26,'2013-12-07T20:34:04.287','user3064497',NULL,'2014-04-20T14:26:34.450',NULL,NULL,NULL,NULL,2,0,0,3679178,'https://graph.facebook.com/1451422188/picture?type=large'),(3859,1,'2014-02-20T08:36:49.543','ZenOokami',NULL,'2014-02-20T08:36:49.543',NULL,NULL,NULL,'<p>College Student: GSU\nPython, Java, C, Digital Logic, WebDev, Web Design.</p>\n',0,0,0,967375,NULL),(3860,101,'2014-02-20T16:52:16.753','Bryan Arbelo - MaG3Stican',NULL,'2014-04-08T20:06:25.397','http://bryanarbelo.com','Melbourne, Victoria, Australia',25,'<p>I usually do meetups for fun, trying to encourage the developer community to feel stronger and try new things!</p>\n\n<p>One of my presentations : </p>\n\n<p><a href=\"https://www.meetup.com/es-ES/Melbourne-F-enders/events/241994239/\" rel=\"nofollow noreferrer\">https://www.meetup.com/es-ES/Melbourne-F-enders/events/241994239/</a></p>\n',0,0,0,1007434,'https://i.stack.imgur.com/XGTfG.png'),(3861,101,'2014-02-20T22:11:41.373','Matthew Rankin',NULL,'2015-01-05T14:14:26.607','http://webmasters.stackexchange.com/users/1925/','Independence, MO',43,NULL,0,1,0,33990,'https://i.stack.imgur.com/utY5u.jpg?s=128&g=1'),(3863,101,'2014-02-21T00:43:46.487','sublucent',NULL,'2014-02-21T00:43:46.487','http://sublucent.com',NULL,NULL,NULL,0,0,0,872774,'https://www.gravatar.com/avatar/5a2edf1d7dc9399bcead1a532785de2d?s=128&d=i