esign for HA environments. Always up for a challenge and enjoy learning new stuff. Looking for work which has a solid basis in design and I always seem to be involved in moving things forward. I enjoy leading and working within a team.</p>\n\n<p>Currently actively interested in the workings of SOA. New technologies (for me) Neo4j, Nodejs, Python, GoLang, RabbitMQ, 0MQ. AWS.</p>\n\n<p>Recent technologies: Sandboxing with Vagrant, chef. Cluster architecture (migrated from single server arch. into cluster infrastructure). Nginx/php-fpm in a cluster.</p>\n\n<p>Spent time at Crowdsurge learning Go from the perspective of a PHP developer.</p>\n\n<p>Experienced in OO PHP, Zend Framework development. Javascript pure and using jQuery, also Nodejs, and some Angularjs. Relational Db: SQL Server, mySql. NoSql using CouchDB and MongoDb, and Lucene.</p>\n\n<p>Agile/Scrum approach. SCM: Git, github, bitbucket, subversion.</p>\n\n<p>Big fan of devops tools such as: etcd, redis, elasticsearch, newrelic and statsd.</p>\n\n<p>Previous experience includes system admin for a disability charity in West London and Web developer at Mediatel Group Ltd in London.</p>\n',0,0,0,75943,NULL),(3887,1,'2014-02-24T21:32:48.410','bign8',NULL,'2014-02-24T21:32:48.410','http://NathanJWoods.com','Helena, MT',26,'<p>Web developer since 2005.  Started programming and \"hacking\" when I was 10.</p>\n',0,0,0,3890550,'https://www.gravatar.com/avatar/f5dc910445775287403d09bf01e713cc?s=128&d=identicon&r=PG'),(3888,101,'2014-02-25T04:55:41.753','tomzx',NULL,'2016-12-04T20:46:48.750','http://blog.tomrochette.com','Montreal, QC, Canada',NULL,NULL,0,0,0,37836,NULL),(3889,1,'2014-02-25T07:35:10.947','Ankur A Sharma',NULL,'2014-02-25T07:35:10.947',NULL,'Clemson, SC, United States',25,NULL,0,0,0,1206899,'https://graph.facebook.com/1802927068/picture?type=large'),(3890,101,'2014-02-25T08:26:00.987','Yana',NULL,'2014-02-25T08:26:00.987',NULL,'Bali, Indonesia',NULL,'<h1>SOreadytohelp</h1>\n',0,0,0,3571272,'https://www.