ersion.</p>\n\n<p><a href=\"http://drupal.stackexchange.com/users/7212/zhilevan\">\n<img src=\"http://drupal.stackexchange.com/users/flair/7212.png?theme=hotdog\" width=\"208\" height=\"58\" alt=\"profile for zhilevan at Drupal Answers, Q&amp;A for Drupal developers and administrators\" title=\"profile for zhilevan at Drupal Answers, Q&amp;A for Drupal developers and administrators\">\n</a></p>\n',0,0,0,1466312,'https://www.gravatar.com/avatar/5585b29ed47df29fb84980381f4d7de5?s=128&d=identicon&r=PG'),(3952,101,'2014-03-03T09:49:36.650','Hitesh',NULL,'2014-03-03T09:49:36.650',NULL,'Bhilai Nagar, India',30,'<p><strong>On the Journey to become better and better everyday</strong></p>\n\n<blockquote>\n  <p><strong>Thank God, I am not where I used to be, i am growing and I am on my way and I am heading toward the ultimate goal :)</strong></p>\n</blockquote>\n\n<p>Aiming to become the best software developer, To develop the best quality and standard products. Love Learning new stuff to improve my skills. </p>\n\n<p>\"Learning to Soar Like an Eagle Even When You Feel Like a Chicken\"</p>\n\n<p>I have just touched the surface of web development, There is so much here and still need to learn swimming  :D</p>\n\n<p>And As They All Say \"<a href=\"http://readme.lk/dont-genius-code/\" rel=\"nofollow noreferrer\">You don t have to be a genius to code!</a>\" ;)</p>\n',0,0,0,2113072,NULL),(3953,101,'2014-03-03T11:49:27.877','evamvid',NULL,'2014-03-03T11:49:27.877','http://evamsharma.finosus.com',NULL,18,'<p>Im a student hoping to go into some kind of tech career. I know basics of Python, HTML, and Javascript/JQuery. I hope to soon learn both PHP and Ruby as well.</p>\n\n<p>I am also an avid supporter of the FLOSS movement, and Linux/Windows hybrid user (I prefer Linux).</p>\n\n<p>Im really excited about 3d Printing.</p>\n\n<p>Im also the only one I know who uses Gist for his assignments because of its versioning and Markdown support =) (although lots of my friends are on Github).</p>\n\n<p>Speaking of which, feel free to check out <a href=\"http://github.com/evamvid\" rel=\"nofollow\">my Github</a>.</p>\n',0,0,0,3216081,'https://i.stack.imgur.com/4HlPf.png'),(3955,46,'2014-03-03T19:38:40.023','dude',NULL,'2014-03-03T19:38:40.023',NULL,NULL,NULL,NULL,0,0,0,4114297,NULL),(3956,101,'2014-03-03T22:13:33.777','Ben Page',NULL,'2017-04-27T16:30:10.283',NULL,'Hertfordshire, United Kingdom',28,'<p>Mainly hacking away in Java on back-office and automation systems for Ocado.</p>\n',0,1,0,14513,NULL),(3957,1,'2014-03-04T01:34:19.423','Devon Cornwall',NULL,'2014-03-04T01:34:19.423',NULL,NULL,NULL,NULL,0,0,0,1758785,'https://www.gravatar.com/avatar/d255abb0fc9e5a06f26f2b06558bf1ae?s=128&d=identicon&r=PG'),(3958,1,'2014-03-04T01:54:47.247','hugelshofer',NULL,'2014-03-04T21:54:49.050','http://hugelshofer.li','Switzerland',NULL,'<p>please participate in the meta.Apple Discussion about tags for <strong>Mac OS X Server</strong> </p>\n\n<p><a href=\"http://meta.Apple.StackExchange.com/q/1977/71997\">correct tags for (Mac) OS X Server</a></p>\n\n<hr>\n',0,0,0,4115311,'https://i.stack.imgur.com/8Td7Z.png'),(3959,101,'2014-03-04T02:05:32.340','StFS',NULL,'2014-03-05T00:01:02.427',NULL,'Iceland',40,NULL,0,0,0,1048512,'https://www.gravatar.com/avatar/0012ec85cf9b697a7adb12b622972214?s=128&d=identicon&r=PG'),(3960,101,'2014-03-04T08:41:17.453','daboross',NULL,'2014-08-31T19:57:54.647','http://daboross.net/','Seattle, WA, United States',19,NULL,0,0,0,2088546,NULL),(3961,101,'2014-03-04T13:25:51.217','hildensia',NULL,'2014-03-04T13:25:51.217','http://www.johanneskulick.net','Berlin, Germany',31,NULL,0,0,0,1317749,NULL),(3963,101,'2014-03-04T21:17:40.650','Jarrod Roberson',NULL,'2014-03-04T21:17:40.650','http://www.vertigrated.com/blog','Atlanta, GA',50,'<p>Technology Professional</p>\n\n<p>A software developer since the mid-80s I ran a successful consulting business for 17 years. I have worked for everything startups and international companies that do billions of dollars a quarter in profit.</p>\n\n<p>As a technology consultant I made a career out of finding the next job, learning more about my clients business than they knew and giving them direction to future successes. I have comprehensive experience with both software and hardware development companies.</p>\n\n<p>I have extensive experience as a hiring manager as well, earned from years of experience building, teaching and managing creative Agile Technical teams.</p>\n\n<p>Extensive Answers are in my <a href=\"https://github.com/jarrodhroberson/Stackoverflow\" rel=\"nofollow\">StackOverflow GitHub Answer Repository</a> and if you are <a href=\"http://wiselike.com/jarrod-roberson\" rel=\"nofollow\">polite you can ask me anything</a> and I might answer.</p>\n',0,0,0,59425,NULL),(3964,1,'2014-03-04T21:46:40.213','darkwisperer',NULL,'2014-03-05T19:42:52.493','http://n/a','United States',28,'<p>Software Engineer and Open Source  Advocate by day. Opensource contributor by night.</p>\n',0,0,0,1618430,'https://www.gravatar.com/avatar/07914bc4176a653e3de6689ad36ea220?s=128&d=identicon&r=PG'),(3965,101,'2014-03-05T06:12:18.537','leonideveloper',NULL,'2014-03-05T06:12:18.537',NULL,NULL,NULL,NULL,0,0,0,2887847,'https://www.gravatar.com/avatar/04ce88e8ab81078ea4b504015afb2b80?s=128&d=identicon&r=PG'),(3967,101,'2014-03-05T16:52:39.427','Filipe.Fonseca',NULL,'2014-03-05T16:52:39.427','http://notyet','Sao Paulo, Brazil',32,'<p>Not much to say, I think.</p>\n',0,0,0,4060459,'https://i.stack.imgur.com/MMody.png?s=128&g=1'),(3968,101,'2014-03-05T18:07:43.503','Christian Stewart',NULL,'2014-03-05T18:07:43.503','http://paral.in',NULL,NULL,'<p>Im a student programmer who does web development, design, game development and design, hardware design and code development (arduino, ARM), mobile programming, and windows + mac programs. My primary focus is in robotics, and their future user-friendliness and reliability.</p>\n\n<p>merge keep</p>\n',0,0,0,191047,NULL),(3969,11,'2014-03-05T19:06:09.467','Tom