 certified counselor for personcentric organisational development.</p>\n\n<p>If you feel something is too complicated, chat with me, Ill explain it in simple terms.</p>\n',1,0,0,44601,NULL),(4079,101,'2014-03-20T19:15:45.900','Victor Oliveira',NULL,'2014-03-20T19:30:48.973',NULL,'Brazil',26,NULL,0,0,0,1715992,'https://i.stack.imgur.com/IVUcu.jpg'),(4080,213,'2014-03-20T22:10:27.643','dgrat',NULL,'2016-04-11T09:13:35.440',NULL,NULL,NULL,NULL,1,5,0,2153782,'https://www.gravatar.com/avatar/1f254bd884cc7ea6217bfd1eaccb9f75?s=128&d=identicon&r=PG'),(4081,16,'2014-03-21T05:00:50.600','user3217310',NULL,'2014-04-04T00:31:09.280','http://sumitresearchwebblog.blogspot.in/','Delhi',26,NULL,0,0,0,3885948,'https://graph.facebook.com/100001569905724/picture?type=large'),(4082,1,'2014-03-21T05:45:48.577','wireless_lab',NULL,'2014-03-21T05:45:48.577',NULL,NULL,NULL,NULL,0,0,0,3616249,'https://www.gravatar.com/avatar/464f6d80e4539015cc41d8474ae2da05?s=128&d=identicon&r=PG&f=1'),(4083,8,'2014-03-21T09:35:02.293','Mr.Jimm',NULL,'2015-10-10T07:29:28.510',NULL,NULL,NULL,NULL,0,0,0,3146142,'https://www.gravatar.com/avatar/c0ba6b49f418bf2f2b5adcf9a882ebe1?s=128&d=identicon&r=PG'),(4084,101,'2014-03-21T11:42:46.407','peSHIr',NULL,'2014-03-21T11:42:46.407','http://about.me/peSHIr','Vleuten, Netherlands',44,'<p>Senior .NET software developer, mostly on backends and on Windows Phone 7+ and Windows 8 apps.</p>\n\n<p>Well known (?) online busy-body. ;-)</p>\n',0,0,0,21042,NULL),(4085,101,'2014-03-21T13:56:58.383','Kevin',NULL,'2014-03-21T13:56:58.383',NULL,'United States',28,'<p>Lets all read some code!</p>\n\n<p><code>#SOreadytohelp</code></p>\n',0,0,0,3599501,NULL),(4086,101,'2014-03-21T19:16:59.577','dkeck',NULL,'2017-06-05T11:57:33.120',NULL,NULL,NULL,NULL,0,0,0,3583623,'https://i.stack.imgur.com/oOUcV.png?s=128&g=1'),(4087,1,'2014-03-21T20:50:18.420','user256085',NULL,'2014-03-21T20:50:18.420',NULL,NULL,NULL,NULL,0,0,0,3679563,'https://www.gravatar.com/avatar/85af88533b8decc93ce5c036b9c73