-14T02:40:30.190','jrcatbagan',NULL,'2016-08-06T03:19:35.053','https://github.com/jrcatbagan','Covina, California',NULL,'<p>I am a computer engineering major with an extensive fascination towards robotics and computers in general.  I am constantly seeking to create the state-of-the-art with diligence and persistence.</p>\n',2,2,0,3640300,'https://i.stack.imgur.com/5yvJp.png'),(4211,1,'2014-04-14T04:53:22.167','Sensor',NULL,'2014-04-14T04:53:22.167',NULL,NULL,NULL,NULL,0,0,0,3882273,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(4212,167,'2014-04-14T12:15:29.873','Joseph Roberts',NULL,'2015-10-14T13:59:20.033',NULL,'London',NULL,'<p>I am a strong all round technologist most interested in robotics and the\nInternet of Things, as they bring hardware and software together, enabling the\ndigital and real worlds to combine and augment each other.</p>\n\n<p>Technology has always fascinated me and from an early age, I have been\ninterested in computers and electronics. For this reason, I have been developing\nsoftware and tinkering with hardware for over 15 years.</p>\n\n<p>I have worked with embedded devices, both Linux based single board computers\nand microcontrollers, writing firmware and integrating with external hardware\nand sensors. I have also developed applications targeting both Windows and\nLinux based desktop environments as well as iOS and Android platforms.</p>\n\n<p>My experience has brought me to work on many different projects using a variety\nof languages such as C++, Golang, Rust, CoffeeScript, C#, and Python. I have\nmanaged projects from start to finish, developed and debugged electronic PCBs and\ndesigned and manufactured small runs of electronic and mechanical components.</p>\n\n<p>Currently, Im a Hardware Engineer at resin.io focused on bringing micro-controller\nsupport to the resin platform.</p>\n\n<p>To keep up to date with technology I regularly attend a Hackerspace, go to\nmeetups and have recently been to helping to run resin hosted hackathons. I\nalso work on projects in my spare time. At the moment Im working on building\na smaller, nimbler Quad Rotor, prototyping a small two wheeled balancing robot\nand developing a Rust command line tool for tracking crypto-currency prices.</p>\n',2,1,0,1345232,'https://i.stack.imgur.com/8aD2x.jpg?s=128&g=1'),(4213,1,'2014-04-14T20:20:42.263','user40367',NULL,'2014-07-03T18:27:16.737',NULL,NULL,NULL,NULL,0,0,0,4326960,'https://www.gravatar.com/avatar/b3868fe0ca2e2576497549a74757c8aa?s=128&d=identicon&r=PG&f=1'),(4214,101,'2014-04-14T23:45:16.517','DarcyThomas',NULL,'2014-04-14T23:45:16.517','http://google.com','Wellington, New Zealand',97,'<p>I am just this dev guy you know?!</p>\n',0,0,0,118544,'https://i.stack.imgur.com/L6oeJ.png?s=128&g=1'),(4215,1,'2014-04-14T23:59:15.277','Max Reeder',NULL,'2015-12-24T06:29:35.207',NULL,NULL,NULL,NULL,0,0,0,1909720,'https://www.gravatar.com/avatar/6a84cd871e9d0b58da82ed7ca4507c99?s=128&d=identicon&r=PG'),(4216,101,'2014-04-15T12:31:32.877','Oded',NULL,'2017-06-28T21:39:43.613','http://OdedCoster.com/blog','London, United Kingdom',44,'<p><a href=\"https://stackoverflow.blog/2013/02/25/max-oded-wendy-val-shefali-and-mike-welcome-to-the-family/\">Stack Overflow employee</a> - developer on the <a href=\"https://meta.stackoverflow.com/questions/351751/meet-team-dag-developer-affinity-growth\">DAG team</a>. Email me on ocoster (at) stackoverflow.com.</p>\n\n<p>I am a C# ASP.NET developer, with a long professional history of work with web and Microsoft technologies.</p>\n\n<p>I am passionate about writing usable and secure software and am constantly learning.</p>\n\n<p>Blog at <a href=\"http://OdedCoster.com/blog\" rel=\"nofollow noreferrer\"><a href=\"http://OdedCoster.com/blog\" rel=\"nofollow noreferrer\">http://OdedCoster.com/blog</a></a>.</p>\n\n<p>I have written a <a href=\"http://odedcoster.com/blog/2010/07/28/getting-good-answers-on-stackoverflow-part-1-of-n/\" rel=\"nofollow noreferrer\">blog series</a> about 