sh',29,'<p>Java, JavaScript, Python, Machine Learning, Machine Translation, Bioinformatics, Linux, Photography, Google Summer of Code, Open Source - thats mostly all about me :)</p>\n',0,0,0,918577,NULL),(4245,113,'2014-04-21T13:36:04.100','BananaCode',NULL,'2017-07-24T15:04:15.087',NULL,NULL,NULL,'<p>I liek to program rofls</p>\n',0,0,0,1687039,'https://www.gravatar.com/avatar/9ded3d2fd5a0674be303522a7f32e1e6?s=128&d=identicon&r=PG&f=1'),(4246,101,'2014-04-21T17:08:53.577','Nathan',NULL,'2016-09-12T03:51:07.353','http://nathankohagen.appspot.com','Redmond, WA',38,'<p>Husband, father, EE - Embedded Systems, Software+Hardware,microcontroller,FPGA;\n Mixed Signal IC Designer at Cypress Semi - PSoC3 , PSoC4, PSoC5, and Gen4 touch;\nBSEE and MSEE</p>\n\n<p>Drop me a message, if you have any interesting hardware or software projects.</p>\n',0,0,0,18100,'https://www.gravatar.com/avatar/a4206e7b4187e3b3a0785951bb99afb1?s=128&d=identicon&r=PG'),(4247,1,'2014-04-21T19:09:18.730','olhur',NULL,'2014-04-23T18:16:48.310',NULL,'Poland',27,'<p>Everyday Linux user; C++ software developer; in free time, a gamer and a gamedev.</p>\n',0,0,0,4360410,'https://www.gravatar.com/avatar/2613c0276d5a10e422fd4cfb8f0a6a6a?s=128&d=identicon&r=PG&f=1'),(4248,101,'2014-04-21T20:25:28.383','Chris Cooper',NULL,'2014-05-07T04:44:12.513','http://github.com/ChrisCooper','Ottawa, Canada',NULL,'<p>I enjoy music, soccer, and especially laughter. I love to learn and teach about all things in computer science.</p>\n\n<p>Recently, I was a software engineer/general CS helper at the <a href=\"http://oicr.on.ca/\" rel=\"nofollow\">Ontario Institute for Cancer Research</a>, but now Im on a quest to use my skills in a new way. I attempt to post occasionally on my <a href=\"http://quixotic-chris.com/\" rel=\"nofollow\">personal website</a>.</p>\n\n<p>I am also the creator of <a href=\"http://qcumber.ca\" rel=\"nofollow\">qcumber.ca</a>.</p>\n',0,2,0,114381,NULL),(4249,408,'2014-04-21T22:00:05.790','marcv81',NULL,'2016-10-16T06:08:12.437',NULL,NULL,NULL,NULL,7,13,1,2914682,'https://www.gravatar.com/avatar/8492b0d6fc3f4efd8c6f79a246dbb2c9?s=128&d=identicon&r=PG'),(4251,26,'2014-04-22T05:35:36.433','user1474918',NULL,'2017-05-03T19:32:53.750',NULL,NULL,NULL,'<p>Newbie to python !! </p>\n',2,3,0,1591720,'https://www.gravatar.com/avatar/30b7e3a7e06b48a6398884d9f68ff4d0?s=128&d=identicon&r=PG'),(4252,1,'2014-04-22T06:06:45.440','Pantalaimon',NULL,'2014-05-13T04:11:16.880',NULL,'India',25,NULL,0,0,0,4335351,'https://www.gravatar.com/avatar/cee4ca2695fc06ad5253e989e099c58d?s=128&d=identicon&r=PG&f=1'),(4253,101,'2014-04-22T06:08:34.353','Palak Bhansali',NULL,'2014-04-22T06:08:34.353','http://palak.dhingu.com','Vadodara, Gujarat, India',33,'<p>I live simple but own personal thoughts on every aspect of life. I am very straight &amp; firm to learn and doing things right.</p>\n',0,0,0,3671174,NULL),(4254,101,'2014-04-22T06:55:02.893','sundar nataraj',NULL,'2014-04-22T06:55:02.893','http://thecodingmunkey.blogspot.in','Bangalore',28,'<p>\"The three chief virtues of a programmer are: Laziness, Impatience and Hubris.\" - Larry Wall</p>\n\n<p>Laziness: Im too lazy to do the same task repeatedly so write scripts to do that task for me. This makes people think I am intelligent.</p>\n\n<p>Impatience: Im too impatient to wait for my code to run so rewrite the code to improve performance. This makes people think I am a good programmer.</p>\n\n<p>Hubris: When someone asks if I can do something I just say Yes, then go find out how to do it (Google!). This makes people think I can do anything.</p>\n\n<p>Ultimately, it means I can make a career out of being Lazy, Impatient, and Hubristic(?).</p>\n\n<p><img src=\"http://i.stack.imgur.com/KjqLh.png\" alt=\"enter image description here\"></p>\n',0,0,0,1681114,NULL),(4255,116,'2014-04-22T07:21:07.207','Trev r Anne Denise',NULL,'2016-12-20T22:48:18.693',NULL,'Strasbourg, France',20,'<p>I am French and I live in Strasbourg.<br>\nI <strong>love the design</strong> (and especially the user interface design), I think that the user experience should always be the most important thing when you are designing something.  </p>\n\n<p>I am also <strong>programming</strong> in web languages and learning how to program on <em>Mac</em> OS X and iOS, Im a big fan of <a href=\"https://developer.apple.com/swift/\" rel=\"nofollow noreferrer\">Swift programming language</a>.</p>\n\n<p>Right now, I am trying to improve my english as much as possible. <strong>Please be indulgent with me if I do some errors ;)</strong></p>\n\n<p>If you want to know more about me :</p>\n\n<ul>\n<li>I have <a href=\"http://500px.com/TrevorAnneDenise\" rel=\"nofollow noreferrer\">a 500px account</a> on which I post some photos.</li>\n<li>I have <a href=\"http://trevorannedenise.tumblr.com\" rel=\"nofollow noreferrer\">a Tumblr</a> on which I reblog some photos that I love.</li>\n<li>I have <a href=\"http://lejournaldetrevor.tumblr.com\" rel=\"nofollow noreferrer\">a blog</a>, which is written in french.</li>\n<li>I have <a href=\"https://twitter.com/adtrevor\" rel=\"nofollow noreferrer\">a Twitter account</a>.</li>\n</ul>\n',1,1,0,3333226,'https://graph.facebook.com/100003531340104/picture?type=large'),(4257,101,'2014-04-22T16:10:06.880','jim',NULL,'2014-04-22T16:10:06.880',NULL,'Connecticut',51,'Programmer dude.',0,0,0,13684,'https://www.gravatar.com/avatar/2e6b6a6acacb16478fea831b632ebdd4?s=128&d=identicon&r=PG'),(4258,131,'2014-04-22T20:14:06.280','Danny Staple',NULL,'2017-08-06T10:40:50.883',NULL,'London, United Kingdom',39,'<p>Ive been coding since I was a kid and I am deeply passionate about it now.\nI professionally use C and Python.\nI dabble with Ruby, Scheme and have no fear of most programming languages.</p>\n\n<p>I am a fan of automated testing, building and CI, as well as refactoring, making readable code, and lots of coffee.</p>\n\n<p>Ive two kids, Im a Lego and Sci Fi fan, and shamelessly a complete geek. I like shiny stuff with LEDs too, especially if I can get them to run Linux.</p>\n',0,4,0,228099,NULL),(4259,1,'2014-04-23T00:29:06.310','Spacy',NULL,'2014-04-23T00:29:06.310',NULL,'Berlin',NULL,NULL,0,0,0,4366983,'https://i.stack.imgur.com/dpfrf.jpg?s=128&g=1'),(4260,101,'2014-04-23T10:15:45.293','atrepp',NULL,'2015-03-18T16:11:43.337','http://www.almandra.com/','Roquecor, France',33,'<p>Independant Web Developer who likes to program in JavaScript and wich to use more Node.JS</p>\n',0,0,0,1645397,'https://www.gravatar.com/avatar/c57ca18e6eefb631032700eab712e78e?s=128&d=identicon&r=PG'),(4261,101,'2014-04-23T15:34:47.463','Anklon',NULL,'2015-06-17T19:52:18.187',NULL,'Dhaka, Bangladesh',NULL,NULL,0,0,0,2626573,'https://i.stack.imgur.com/XqxNT.jpg?s=128&g=1'),(4262,101,'2014-04-24T03:35:26.600','Frazz',NULL,'2014-04-24T03:35:26.600','http://www.microera.it','Italy',51,'<p>Ive started programming when I was 12... and that was way back when computers did not have monitors... over 35 years ago. That actually means Im old :(</p>\n\n<p>Basic, C, ObjectPascal (aka Delphi), Java, JSP, PHP... Ive tried a lot of languages and I still like to learn some new tricks. Ive mostly worked on databases, client-server and multi-tier applications. Ive also done some years on data warehouses, especially in SAS.</p>\n\n<p>I now live in Italy, but I spent some years in England and in the States... and that is where I picked up my only sport passion... baseball :)</p>\n',0,0,0,469800,'https://www.gravatar.com/avatar/67688827097bbe901f2b79d0ef099082?s=128&d=identicon&r=PG'),(4263,1,'2014-04-24T07:08:48.060','DanteAlighieri',NULL,'2014-04-24T07:08:48.060',NULL,NULL,NULL,'<p>Nearly a decade of technology risk experience. Mainly in global financial companies. Interest mainly in IT Security. Like to tinker with my own home server and always curious aboout new gadgets, apps and games!</p>\n\n<p>Extensive finance experience. Qualified Chartered Accountant.</p>\n\n<p>Ironman Triathlete. Exercise enthusiast!</p>\n',0,0,0,4295392,'htt