LL,NULL,'<p>code monkey</p>\n',0,0,0,1070168,'https://graph.facebook.com/1022957737/picture?type=large'),(4306,1,'2014-05-01T05:51:36.113','Ali Kabiri',NULL,'2014-05-01T05:51:36.113','http://kabiri.org','Esfahan, Iran',23,'<p>Im an Android Developer; Team working is one of the most important essentials for a programming team, and as a developer I always try to make the team members work better, happier and more comfortable, emphasizing on finishing the tasks dedicated to me with acceptable results is one of my most important standards, Theres a teaching interest in me too, such as when theres need to teach one of team members, which makes me think a lot about how to teach it better; its always good to know good people :)</p>\n\n<p><a href=\"https://www.linkedin.com/in/akabiri\" rel=\"nofollow\">Find out more about me on LinkedIn</a></p>\n',0,0,0,4255353,NULL),(4307,101,'2014-05-01T07:41:46.900','Naveen Nikhil',NULL,'2014-05-01T07:41:46.900',NULL,'Hyderabad',NULL,'<p>Sr.Software Developer</p>\n',0,0,0,1919035,NULL),(4308,101,'2014-05-01T08:04:55.553','antoniovassell',NULL,'2014-05-01T08:04:55.553','http://www.antoniovassell.com','Jamaica',27,'<p>My objective is to attain international recognition for designing novel solutions for global business operations and maintain a standard of constant revolution.</p>\n\n<p>I am a Bsc. Computer Science graduate with almost 6 years experience as a software/web developer working with a wide range of technologies. I have worked with PHP, CakePHP, C, C++, Java, Python and client side technologies such as CSS2/3, HTML/5, Javascript and Ajax.</p>\n\n<p>To view my complete portfolio, you can visit www.antoniovassell.com/portfolio and for more details about me www.antoniovassell.com/pages/resume. The projects presented on my portfolio were developed by me - along with some time work, from requirements gathering stage to the deployment stage.</p>\n',0,0,0,1053077,NULL),(4309,101,'2014-05-01T18:17:54.687','Manuel Leduc',NULL,'2014-05-01T18:17:54.687',NULL,NULL,NULL,NULL,0,0,0,332310,'https://www.gravatar.com/avatar/5cf503ec035f5c803186c89643a44819?s=128&d=identicon&r=PG'),(4310,386,'2014-05-02T02:00:53.593','xperroni',NULL,'2017-08-09T16:55:58.260','http://xperroni.me','Santo Andr  - State of S o Paulo, Brazil',38,'<p>Professional software engineer who occasionally moonlights in academic positions   or is it the other way around? I like to think of myself as a programmer first, but in truth my interests are far-ranging, including research (in computer vision, robotics and AI) as well as softwware development methods (I was into Agile before SCRUM took it mainstream).</p>\n',2,10,0,219819,NULL),(4311,138,'2014-05-02T04:20:47.367','d.mc2',NULL,'2017-08-01T05:25:56.610',NULL,NULL,NULL,NULL,0,2,0,401775,'https://www.gravatar.com/avatar/0c87fa13d1ce8ea09c3a448fd752b875?s=128&d=identicon&r=PG'),(4312,1,'2014-05-02T09:29:42.130','Noob-o-tron 5000',NULL,'2014-05-02T09:29:42.130',NULL,'England',96,'<p>I like cookies</p>\n',0,0,0,3849581,'https://i.stack.imgur.com/7k3Pa.jpg?s=128&g=1'),(4313,1,'2014-05-02T09:54:31.923','user6177',NULL,'2014-05-02T09:54:31.923',NULL,NULL,NULL,NULL,0,0,0,4413507,'https://www.gravatar.com/avatar/d87c9d3b4f2947605ea6c3e5e0976048?s=128&d=identicon&r=PG&f=1'),(4315,1,'2014-05-02T12:55:58.097','vikiboy',NULL,'2014-05-03T02:44:17.337',NULL,'Kharagpur',24,'<p>noob, learning the way things work around !! </p>\n',0,0,0,3279224,'https://i.stack.imgur.com/ot2uk.jpg'),(4317,101,'2014-05-02T16:03:20.803','nrz',NULL,'2014-05-02T16:03:20.803',NULL,'Helsinki, Finland',NULL,'<p>Real name: Antti Nuortimo.</p>\n\n<p>Interests: Cognitive neuroscience research, reverse engineering, artificial intelligence, 3D graphics programming, data visualization.</p>\n\n<p>Ylikuutio, OpenGL 3D engine (work in progress): <a href=\"https://github.com/nrz/ylikuutio\" rel=\"nofollow\">https://github.com/nrz/ylikuutio</a></p>\n\n<p>ultraELF, multiarchitecture assembler, disassembler and metamorphic engine (work in progress): <a href=\"https://github.com/nrz/ultraelf\" rel=\"nofollow\">https://github.com/nrz/ultraelf</a></p>\n\n<p>Some answers that may be helpful:</p>\n\n<p><a href=\"http://stackoverflow.com/questions/12680303/power-of-in-x86-assembly/12681913#12681913\">http://stackoverflow.com/questions/12680303/power-of-in-x86-assembly/12681913#12681913</a></p>\n\n<p><a href=\"http://stackoverflow.com/questions/15350409/is-there-a-way-to-get-sbcl-to-print-out-the-value-of-a-cpu-register/15374491#15374491\">http://stackoverflow.com/questions/15350409/is-there-a-way-to-get-sbcl-to-print-out-the-value-of-a-cpu-register/15374491#15374491</a></p>\n\n<p><a href=\"http://stackoverflow.com/questions/15596688/gcc-putcharchar-in-inline-assembly/15597769#15597769\">http://stackoverflow.com/questions/15596688/gcc-putcharchar-in-inline-assembly/15597769#15597769</a></p>\n\n<p><a href=\"http://stackoverflow.com/questions/15462807/printing-a-string-without-os/15463548#15463548\">http://stackoverflow.com/questions/15462807/printing-a-string-without-os/15463548#15463548</a></p>\n\n<p><a href=\"http://stackoverflow.com/questions/20506524/can-i-combine-all-the-sections-objdump-s-d-elf-file-generate-into-a-re-assem/20510168#20510168\">http://stackoverflow.com/questions/20506524/can-i-combine-all-the-sections-objdump-s-d-elf-file-generate-into-a-re-assem/20510168#20510168</a></p>\n',0,0,0,1377220,NULL),(4318,1,'2014-05-02T20:09:57.380','neuralBreakPoint',NULL,'2017-02-23T14:48:34.783',NULL,NULL,NULL,NULL,0,0,0,2191292,'https://www.gravatar.com/avatar/e186f1ad26b07924b0dc2b58a3af3376?s=128&d=identicon&r=PG'),(4319,106,'2014-05-02T21:45:47.727','M-T-A',NULL,'2014-07-19T02:26:52.607',NULL,'United Kingdom',NULL,'<p>\"Its the little details that are vital. Little things make big things happen\". John Wooden</p>\n\n<p>Interested in Graph Databases, Spark, Java, Machine Learning and afternoon tea.</p>\n',0,0,0,1006247,'https://i.stack.imgur.com/ryrqT.jpg?s=128&g=1'),(4320,775,'2014-05-03T03:44:11.200','kamek',NULL,'2017-08-23T19:59:55.597','http://marcgallant.ca','Kingston, ON, Canada',32,'<p>Ph.D. candidate at the <a href=\"https://msl.engineering.queensu.ca\" rel=\"nofollow\">Mining Systems Laboratory (MSL)</a> at Queens University. My primary interest is state estimation in robotics; in other words, helping robots answer the big questions, such as \"where am I?\", \"what is my purpose?\", and \"where did I leave my human?\".</p>\n',21,2,1,1049373,'https://i.stack.imgur.com/2HbzK.jpg?s=128&g=1'),(4321,1,'2014-05-03T16:46:43.630','SagarSave',NULL,'2014-05-03T16:46:43.630',NULL,NULL,28,NULL,0,0,0,4371198,'https://i.stack.imgur.com/BU0sZ.jpg?s=128&g=1'),(4322,101,'2014-05-03T18:07:49.363','Nick Williams',NULL,'2014-05-03T18:07:49.363','http://nfletchwilliams.wix.com/osee','Michigan',28,'<p>Open Source and shared knowledge are two important things to me, so I like to participate in the online community. I have a YouTube channel OSEE that presents tutorials for things like FPGAs, Microcontrollers and other embedded things. I am also active on Instructables, posting projects every now and then. Everything I post is usually available for others to use.</p>\n\n<p>I am currently a SW Engineer at Continental for Long Range Radars in ADAS. </p>\n\n<p>Some of my other interests are working out and eating well; cooking and baking; playing older video games; home furnishing.</p>\n\n<p>My strongest domains are Hardware Design, MicroControllers and embedded software/systems.</p>\n',0,0,0,1474863,'https://i.stack.imgur.com/pQ1l1.png?s=128&g=1'),(4323,101,'2014-05-04T05:32:44.337','Leopd',NULL,'2014-05-04T05:32:44.337','http://www.leodirac.com/','Seattle, WA',43,'<p>I look forward to the robots taking over.</p>\n',0,1,0,115401,NULL),(4324,13,'2014-05-04T20:11:03.457','Christopher Valles',NULL,'2014-05-21T20:11:38.130','http://www.christophervalles.com',NULL,NULL,NULL,0,0,0,252838,'https://www.gravatar.com/avatar/f698b3973f768db6401b5ee891089270?s=128&d=identicon&r=PG'),(4325,33