le, high-energy coder with the distinction of executing prestigious Information Technology projects of large magnitude within strict time schedules; targeting challenging assignments in Software Development, Research &amp; Development in IT sector;</p>\n',0,0,0,4381188,NULL),(4334,1,'2014-05-06T17:24:00.627','AsciiWolf',NULL,'2014-05-06T17:24:00.627','http://asciiwolf.com',NULL,NULL,NULL,0,0,0,2754799,'https://www.gravatar.com/avatar/ea9041da95a10e630294c26f8728102d?s=128&d=identicon&r=PG'),(4335,101,'2014-05-07T01:58:05.123','Dutch Jeff',NULL,'2014-05-12T02:06:32.740',NULL,NULL,NULL,NULL,0,0,0,4391567,'https://i.stack.imgur.com/R3EEG.jpg?s=128&g=1'),(4336,101,'2014-05-07T09:05:13.837','Gunnar Sj r arson Knudsen',NULL,'2014-11-20T12:28:23.970',NULL,'Faroe Islands',26,'<p>Currently Data-miner / Business Intelligence developer at Insurance Company and undergrad Comp.sci. student in the Faroe Islands.</p>\n\n<p>Previously studied actuarial mathematics in Copenhagen.</p>\n\n<p>Especially interested in machine-learning algorithms and data-warehouse structures.</p>\n',0,0,0,257879,'https://www.gravatar.com/avatar/a124dbbfc75bc65b56b9dabebd55e77e?s=128&d=identicon&r=PG&f=1'),(4337,1,'2014-05-07T09:09:28.203','Casper',NULL,'2014-05-07T09:09:28.203',NULL,'Netherlands',36,'<p>Mobile and Web apps</p>\n',0,0,0,1614160,'https://www.gravatar.com/avatar/1f953a80f035d3aaabf4bd3efaa1eb49?s=128&d=identicon&r=PG'),(4338,1,'2014-05-07T09:25:43.687','Mr Hallows',NULL,'2017-06-12T09:25:17.827','http://www.autonomicstudios.com','Phoenix, AZ',26,NULL,0,0,0,4321657,'https://i.stack.imgur.com/bpDck.jpg?s=128&g=1'),(4339,101,'2014-05-07T11:54:36.110','Avestron',NULL,'2016-04-22T10:02:39.690',NULL,'Malta',35,'<p>Like many who came before me, and undoubtedly many to come after me, I am an individual who has for almost as long as I can remember been keenly interested in playing and designing games (Its my close Number 2 passion after Changing the World - yeps Ive set myself up for a lifetime of disappointment ^_~).</p>\n\n<p>My personal development since under the age of 10 has been STOS > QuickBASIC > PASCAL... and then apathy took hold (Its not a bad language - but my perspective of it grew dim at the time) and I shifted away from coding. I have since also gained a grasp of basic HTML - and a little SQL.</p>\n\n<p>For a number of years Ive been interested in learning C or Visual BASIC, even Delphi (due to its roots) - and am recently set on C# - I am using YouTube for the purpose of self-learning but to say that I have a basic grasp would be wild optimism on my part.</p>\n\n<p>Areas of game development that I am interested in include:</p>\n\n<ul>\n<li>Game Mechanics</li>\n<li>Pseudo Intelligence (AI)</li>\n<li>World Building</li>\n<li>Digital Weirdness (code is liberty)</li>\n</ul>\n\n<p>What I hope for:</p>\n\n<ul>\n<li>Learning C# (possibly more) without being a burden</li>\n<li>To code a few cool games</li>\n<li>To not give up again</li>\n</ul>\n\n<p>No, I dont wish to be a lone wolf but neither do I feel that my projects have any more worth than anybody elses. What will be will be.</p>\n',0,0,0,4364057,'https://www.gravatar.com/avatar/783e37955588f46322aca39a431f5eb4?s=128&d=identicon&r=PG&f=1'),(4340,16,'2014-05-07T17:39:36.750','user4340',NULL,'2014-05-07T20:08:57.813',NULL,NULL,NULL,NULL,0,0,0,4438013,'https://graph.facebook.com/100001534541543/picture?type=large'),(4341,111,'2014-05-07T22:08:05.393','Cains',NULL,'2014-05-08T05:06:19.407',NULL,NULL,22,NULL,1,0,0,2758530,'https://i.stack.imgur.com/imNA7.png'),(4342,101,'2014-05-08T05:44:21.360','user93',NULL,'2016-10-08T07:25:07.273',NULL,'Chennai, Tamil Nadu, India',NULL,'<p>Im a developer who loves javaScript , Haskell and lot of reading and writing.</p>\n',0,0,0,2641918,'https://i.stack.imgur.com/6bRt9.jpg?s=128&g=1'),(4343,1,'2014-05-08T07:33:43.143','Nitin Soni',NULL,'2014-05-08T07:33:43.143',NULL,NULL,NULL,NULL,0,0,0,2088591,'https://www.gravatar.com/avatar/7d8013d2c015fafed0f41244a9fb013d?s=