lot of code over the years, most of it <em>my own</em>.</p>\n\n<p>First learn to code to the standard, then learn when to break the rules. Every language has a beauty, embrace it. There are tools that will help along this path... finding the right editor or IDE is important for any language, for JavaScript Ive found the <a href=\"http://www.jslint.com/\" rel=\"nofollow\">JSLint</a> -> <a href=\"http://jshint.com/\" rel=\"nofollow\">JSHint</a> -> <a href=\"http://eslint.org/\" rel=\"nofollow\">ESLint</a> evolution, followed by <a href=\"http://yeoman.io/\" rel=\"nofollow\">Yeomans</a> <a href=\"http://gruntjs.com/\" rel=\"nofollow\">Grunt</a> to be really instructive and useful.</p>\n\n<p><a href=\"http://stackexchange.com/users/74542\">\n<img src=\"http://stackexchange.com/users/flair/74542.png\" width=\"208\" height=\"58\" alt=\"profile for Jason Aller on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Jason Aller on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n',0,1,0,74542,'https://www.gravatar.com/avatar/61025b3df4700620a5d9099293f23a5d?s=128&d=identicon&r=PG'),(4398,1,'2014-05-17T02:16:02.257','user186964',NULL,'2014-05-17T02:16:02.257',NULL,NULL,NULL,NULL,0,0,0,3215268,'https://www.gravatar.com/avatar/1eff9e7ff1c356241307d9d9d07da208?s=128&d=identicon&r=PG&f=1'),(4399,122,'2014-05-17T11:33:10.857','libra',NULL,'2017-05-10T05:05:36.093',NULL,NULL,23,NULL,2,3,0,2569041,'https://i.stack.imgur.com/1JsiQ.jpg?s=128&g=1'),(4400,1,'2014-05-18T00:08:45.873','Sunny',NULL,'2014-05-23T17:43:26.790',NULL,NULL,NULL,NULL,0,0,0,4462663,'https://graph.facebook.com/100001257049048/picture?type=large'),(4401,101,'2014-05-18T07:06:06.343','bhekman',NULL,'2014-05-26T05:03:13.720',NULL,NULL,NULL,NULL,0,0,0,1209609,'https://i.stack.imgur.com/zhcdh.jpg?s=128&g=1'),(4402,1,'2014-05-18T13:43:36.247','user21582',NULL,'2014-05-18T13:43:36.247',NULL,NULL,NULL,NULL,0,0,0,4187753,'https://www.gravatar.com/avatar/9268