'Boston, MA',31,'<p>The universe is just a space with stuff in it.  I think the meaning of life is to organize it.</p>\n',0,0,0,4492334,'https://www.gravatar.com/avatar/b380de16d72387dbeb2b9273a371b907?s=128&d=identicon&r=PG&f=1'),(4474,31,'2014-05-27T18:28:29.653','notAlex',NULL,'2015-10-23T00:56:07.623',NULL,NULL,NULL,NULL,0,12,0,3998438,'https://www.gravatar.com/avatar/dbbba1ab87d944b26b859e3bbf43aa05?s=128&d=identicon&r=PG&f=1'),(4475,1,'2014-05-27T18:42:40.827','user2066639',NULL,'2014-06-15T05:14:26.990',NULL,NULL,NULL,NULL,0,0,0,2359633,'https://www.gravatar.com/avatar/6e4a4460ee7e79b512f205e3efcecda0?s=128&d=identicon&r=PG'),(4476,1,'2014-05-27T22:07:26.760','M. Vorobyov',NULL,'2014-05-30T00:17:40.973',NULL,'California',26,'<p>Im a Computer Science undergraduate and the University of California, Irvine. My interests lie in Machine Learning and Artificial Intelligence. I was introduced to ML in my sophomore year here at UCI during a summer program when I was working on an shape recognition project. After taking my introduction to AI course I was convinced that this was what I wanted to study, and was further reassured after taking my first course in ML. </p>\n\n<p>My other interests are in conservation and sustainability. I would really like to see people start making changes in their lives in order to help reverse the environmental damage that our society is creating. I think that people have a lot to learn from nature and that we should pay closer attention to the processes that it has created to solve the same issues that we as a people are struggling with.</p>\n',0,0,0,1698097,'https://www.gravatar.com/avatar/72c114d47681243f013b347e68a1d699?s=128&d=identicon&r=PG'),(4477,101,'2014-05-27T22:32:15.747','iPAS',NULL,'2016-05-25T10:11:31.143',NULL,'Bangkok, Thailand',NULL,NULL,0,0,0,206829,'https://i.stack.imgur.com/NXQM3.jpg?s=128&g=1'),(4478,1,'2014-05-27T22:40:34.530','TechMaster100',NULL,'2014-05-27T22:40:34.530',NULL,NULL,NULL,'<p>I am a junior mathematician and scientist.</p>\n',0,0,0,4330914,'https://www.gravatar.com/avatar/ae214eb7f7595fdb4468796c2f6e511c?s=128&d=identicon&r=PG&f=1'),(4479,1,'2014-05-28T05:24:08.453','adarsha joisa',NULL,'2014-05-28T05:24:08.453','http://www.adarshajoisa.com','Bangalore, India',26,NULL,0,0,0,525089,'https://i.stack.imgur.com/uiKlS.jpg'),(4480,101,'2014-05-28T05:34:04.650','Code0987',NULL,'2014-12-20T18:26:06.780','http://code0987.ilusons.com','India',20,'<p><a href=\"http://stackexchange.com/users/30ffeda568164565ab27ec2ab71bd951\">\n<img src=\"http://stackexchange.com/users/flair/30ffeda568164565ab27ec2ab71bd951.png?theme=dark\" width=\"208\" height=\"58\" alt=\"profile for Neeraj on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Neeraj on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n',0,0,0,232175,NULL),(4481,101,'2014-05-28T07:06:09.227','D.J.Duff',NULL,'2017-07-21T05:17:20.630','http://djduff.net','Istanbul',NULL,'<p><a href=\"http://djduff.net\" rel=\"nofollow noreferrer\">http://djduff.net</a></p>\n',0,0,0,1771563,NULL),(4482,101,'2014-05-28T12:13:01.020','Thabo',NULL,'2014-05-28T12:13:01.020','https://www.linkedin.com/in/thabosivagurunathan','Sri Lanka',30,'<p>\"A passionate learner\"</p>\n',0,0,0,453750,NULL),(4483,43,'2014-05-28T13:13:19.880','manf',NULL,'2014-09-10T12:39:13.277',NULL,NULL,NULL,NULL,0,0,0,1063256,'https://www.gravatar.com/avatar/3567586c941b6dc7411c141981d77053?s=128&d=identicon&r=PG'),(4485,11,'2014-05-28T15:00:19.967','Achu Wilson',NULL,'2014-07-22T08:06:10.127',NULL,NULL,NULL,NULL,0,0,0,1609003,'https://www.gravatar.com/avatar/cca0da4dfa6d167d0fcbbfc137cb0784?s=128&d=identicon&r=PG'),(4486,101,'2014-05-29T09:22:34.820','Mhd.Tahawi',NULL,'2016-05-11T13:27:06.337','http://none','Geneva, Switzerland',26,'<p>Im here to help and learn.</p>\n',0,0,0,1214314,'https://i.stack.imgur.com/GNKPA.jpg?s=128&g=1'),(4487,101,'2014-05-29T14:29:15.447','Edson Medina',NULL,'2014-05-29T16:05:25.477',NULL,NULL,40,NULL,0,0,0,212732,'https://i.stack.imgur.com/tSedM.jpg'),(4488,101,'2014-05-29T14:55:12.277','Marcelo Assis',NULL,'2014-05-29T14:55:12.277','http://www.marcelodeassis.com.br','Rio de Janeiro, Brazil',31,'<p>Im a Object Oriented Programming lover, proficient in C#, Java, ActionScript, Javascript, PHP and Web Development in general, always interested in learning new technologies and languages.</p>\n',0,0,0,294604,'https://www.gravatar.com/avatar/8bad8eaa500f68d0ded3432927115ccd?s=128&d=identicon&r=PG'),(4489,1,'2014-05-29T15:45:47.067','Devinder Singh',NULL,'2014-05-29T15:45:47.067',NULL,'London, United Kingdom',NULL,NULL,0,0,0,151027,'https://lh4.googleusercontent.com/-XQ2SoY8wSI8/AAAAAAAAAAI/AAAAAAAACYI/n2mB9ooMWq0/photo.jpg?sz=128'),(4490,6,'2014-05-30T01:06:11.643','user4490',NULL,'2014-09-14T00:23:59.107',NULL,NULL,NULL,NULL,0,0,0,4536040,'https://www.gravatar.com/avatar/2c6d3e010d50ec2157a270ece23b83d6?s=128&d=identicon&r=PG'),(4491,23,'2014-05-30T07:15:26.797','Dpp_coder',NULL,'2014-11-22T06:06:57.383',NULL,NULL,NULL,NULL,0,1,0,4487548,'https://www.gravatar.com/avatar/2535d3ca4942b92052820dbb42ddf6ab?s=128&d=identicon&r=PG&f=1'),(4493,101,'2014-05-30T14:12:24.910','tdrury',NULL,'2014-05-30T14:12:24.910','http://tdruryjavanotes.blogspot.com/','Atlanta, GA',49,'<p>Tim Drury is a senior software architect at SAP and leading architect for integrations to SAP Manufacturing Execution (SAP ME). Tim has a bachelors degree in electrical engineering from the Georgia Institute of Technology where he studied real-time embedded systems and data acquisition systems. He spent 14 years building embedded systems before realizing is software skills were not on par with his hardware skills. Focusing on software, Tim came to the realization that software development has less expensive, faster development cycles than hardware development - perfect for someone with a short attention span and little patience. Hardware development is now relegated to hobby status along with all things in the realm of motorsports. Tim has spent the last 8 years writing software to integrate applications, machines, and technology now with a focus on manufacturing. On the side he tinkers with race car data acquisition and control systems.</p>\n',0,0,0,1089949,'https://i.stack.imgur.com/BB4eD.jpg'),(4494,1,'2014-05-30T15:19:37.110','javabeano',NULL,'2017-05-22T15:51:03.837',NULL,NULL,NULL,NULL,0,0,0,3083845,NULL),(4495,11,'2014-05-30T22:04:44.843','confused',NULL,'2014-05-31T07:31:21.563',NULL,NULL,NULL,NULL,1,0,0,4546547,NULL),(4497,6,'2014-05-31T14:10:20.103','yavo',NULL,'2014-06-06T13:33:04.827','',NULL,NULL,'',0,0,0,4548613,'https://www.gravatar.com/avatar/0e6dd11ac365913b8be378b346264ce8?s=128&d=identicon&r=PG&f=1'),(4498,1,'2014-05-31T15:16:01.033','sumit_singh',NULL,'2014-05-31T15:16:01.033',NULL,NULL,27,NULL,0,0,0,2978832,'https://graph.facebook.com/100007343344440/picture?type=large'),(4500,101,'2014-05-31T18:55:14.423','konsolebox',NULL,'2014-05-31T19:56:51.817','http://konsolebox.info',NULL,NULL,'<p>A computer adept.</p>\n',0,0,0,199734,NULL),(4501,18,'2014-05-31T21:49:36.600','Archer',NULL,'2015-04-25T18:22:31.157',NULL,'Houston, TX',NULL,NULL,0,0,0,2453981,'https://www.gravatar.com/avatar/d775981b6a13517650813bdca0b34a38?s=128&d=identicon&r=PG&f=1'),(4502,101,'2014-06-01T17:11:08.953','Leland Richardson',NULL,'2014-06-01T17:11:08.953','http://www.intelligiblebabble.com',NULL,NULL,'<p>\n</p>\n\n<p>My name is Leland Richardson. I love learning.  At the time of writing this I am 23 years old and live in Houston, TX.  I was born in West Palm Beach, Florida, grew up in St. Louis, Missouri, and went to school in Houston, Texas at Rice University.</p>\n\n<p>At Rice I received two degrees: one in Physics and one in Mathematics.  I love both.  I never received any formal education on Computer Science, however, you will find that most of this blog will be about programming and web development. Nevertheless, I think being a good programmer is about being good at learning, and thinking logically about how to solve problems - of which I think my educational background has more than covered.</p>\n\n<p>Since high-school, I had found that the easiest way to make money was by programming.  Programming started off as a hobby and small interest, and slowly grew into a passion.</p>\n\n<p>I have recently started working on a new startup here in Houston, TX.  I wont bore you with the details of that just yet, but I am very excited about it and I think we can do big things.  We plan to launch our project this year at SXSW 2013.  What I will say for now, is that we would like to create a company of talented software developers who are similarly ambitious and want to create cool stuff (and have fun doing it).</p>\n',0,0,0,1525890,'https://www.gravatar.com/avatar/a9751ee80ebde5455d9e85cca0021da5?s=128&d=identicon&r=PG'),(4503,101,'2014-06-01T20:05:39.210','w128',NULL,'2016-04-27T20:28:32.020',NULL,NULL,NULL,NULL,0,0,0,475484,'https://www.gravatar.com/avatar/344364fed44a2fe2b4aca232d6d7885b?s=128&d=identicon&r=PG'),(4504,101,'2014-06-02T07:18:18.470','Software_Designer',NULL,'2014-06-02T07:18:18.470',NULL,NULL,NULL,'<p>My programming Articles : \n<a href=\"http://www.codeproject.com/script/Articles/MemberArticles.aspx?amid=3657838\" rel=\"nofollow\">http://www.codeproject.com/script/Articles/MemberArticles.aspx?amid=3657838</a></p>\n\n<p>My Profile :<br>\n<a href=\"http://stackoverflow.com/users/999884/software-developer?tab=answers&amp;sort=newest\">http://stackoverflow.com/users/999884/software-developer?tab=answers&amp;sort=newest</a></p>\n\n<p>Realtime Animation of a Mandelbrot Zoom in a Win32 Console with Visual C++ 6.0 : \n<a href=\"http://www.codeproject.com/Articles/83231/Realtime-Animation-of-a-Mandelbrot-Zoom-in-a-Win\" rel=\"nofollow\">http://www.codeproject.com/Articles/83231/Realtime-Animation-of-a-Mandelbrot-Zoom-in-a-Win</a></p>\n\n<p>My CV : <a href=\"https://topcoder23.files.wordpress.com/2014/08/ron_cv_programmering-malmo-2014-08-18-h10m00.pdf\" rel=\"nofollow\">https://topcoder23.files.wordpress.com/2014/08/ron_cv_programmering-malmo-2014-08-18-h10m00.pdf</a></p>\n\n<p>Snake Game in a Win32 Console : \n<a href=\"http://www.codeproject.com/Articles/85531/Snake-Game-in-a-Win-Console\" rel=\"nofollow\">http://www.codeproject.com/Articles/85531/Snake-Game-in-a-Win-Console</a></p>\n\n<p>Doing multiple functions simultaneously in C++ : \n<a href=\"http://stackoverflow.com/questions/13479587/doing-multiple-functions-simultaneously-in-c/13495708#13495708\">http://stackoverflow.com/questions/13479587/doing-multiple-functions-simultaneously-in-c/13495708#13495708</a></p>\n\n<p>C++ controls for a game running in windows console : \n<a href=\"http://stackoverflow.com/questions/20019945/c-controls-for-a-game-running-in-windows-console/23721063#23721063\">http://stackoverflow.com/questions/20019945/c-controls-for-a-game-running-in-windows-console/23721063#23721063</a></p>\n\n<p>Song Writing  : <a href=\"https://topcoder23.files.wordpress.com/2014/08/songwriting7-2014-08-18.pdf\" rel=\"nofollow\">https://topcoder23.files.wordpress.com/2014/08/songwriting7-2014-08-18.pdf</a></p>\n\n<p>About me:\nI attended programming college </p>\n\n<p>Ive written hundreds of thousands of code  lines of applications and games.</p>\n',0,0,0,979877,'https://i.stack.imgur.com/yuL5q.jpg?s=128&g=1'),(4505,1,'2014-06-02T21:15:00.080','user5906',NULL,'2014-06-02T21:15:00.080',NULL,NULL,NULL,NULL,0,0,0,4544407,'https://www.gravatar.com/avatar/2f84fc997d6f7770dccd2309b98cb1df?s=128&d=identicon&r=PG&f=1'),(4506,101,'2014-06-02T22:41:54.157','Amr',NULL,'2015-12-26T16:14:51.273',NULL,NULL,25,'<p>Ascetic devoted to mathematics</p>\n\n<p><a href=\"http://meta.math.stackexchange.com/questions/5020/mathjax-basic-tutorial-and-quick-reference\">http://meta.math.stackexchange.com/questions/5020/mathjax-basic-tutorial-and-quick-reference</a></p>\n',0,0,0,1410620,'https://www.gravatar.com/avatar/2f4f15fd34567bf53e7e8