ca5149c1642b4dbedc166edbada?s=128&d=identicon&r=PG'),(4540,16,'2014-06-07T09:09:59.163','crystalbass17',NULL,'2017-03-28T07:54:31.950',NULL,NULL,NULL,'<p>I am a Robotics researcher from Germany.</p>\n',0,0,0,1674078,'https://www.gravatar.com/avatar/66164b3f1dfd0746fe9eb78b439310a1?s=128&d=identicon&r=PG'),(4541,11,'2014-06-07T15:32:44.313','Yusuf',NULL,'2015-04-29T15:13:41.260','',NULL,NULL,'',0,0,0,4581184,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(4542,101,'2014-06-07T18:20:39.310','emc',NULL,'2014-06-10T21:58:38.763','http://emc2innovation.com','Victoria, Canada',NULL,'<p>Eric McNiece has been helping businesses dive into the online world since 2006. In 2008 Eric formed his first company, EMC2 Innovation - a creative programming and web development business with a focus on bringing user-friendly content management platforms to clients, friends and family alike. In 2011 Eric finally moved to web development full-time and hasnt looked back since then.</p>\n',0,1,0,909325,NULL),(4543,101,'2014-06-07T18:54:39.847','d_inevitable',NULL,'2014-07-19T20:20:23.640',NULL,'Berlin, Germany',31,NULL,0,1,0,1285608,'https://www.gravatar.com/avatar/fc4206f2ce791ae57423452cf546da30?s=128&d=identicon&r=PG'),(4544,1,'2014-06-07T19:38:06.783','ilijamt',NULL,'2015-08-29T17:55:34.820',NULL,NULL,NULL,NULL,0,0,0,3990615,'https://www.gravatar.com/avatar/c000335bc7daddf29a76ca51ea678121?s=128&d=identicon&r=PG&f=1'),(4545,151,'2014-06-08T01:18:45.063','RoboKaren',NULL,'2017-04-23T00:14:40.660',NULL,'Connecticut, USA',NULL,'<p>Im a tenured college professor of anthropology at a private liberal arts university in the United States.</p>\n',1,25,0,4421710,NULL),(4546,101,'2014-06-08T10:27:36.453','Lorenzo Donati',NULL,'2017-04-27T19:42:11.103','http://stackoverflow.com/users/2633423/lorenzo-donati','South Tyrol, Italy',47,'<p><br/></p>\n\n<ul>\n<li>Former research and teaching assistant.</li>\n<li>Former SW developer in a research institution.</li>\n<li>Currently teacher in a technical high-school. </li>\n</ul>\n\n<p><br/></p>\n\n<hr>\n\n<p>Before you ask a question...: <br></p>\n\n<ul>\n<li><a href=\"http://www.whathaveyoutried.com\" rel=\"nofollow\">What Have You Tried?</a> </li>\n<li><a href=\"http://xyproblem.info/\" rel=\"nofollow\">The XY problem</a></li>\n</ul>\n\n<p>If you enjoy Electronics: <br></p>\n\n<ul>\n<li><a href=\"http://www.eevblog.com/\" rel=\"nofollow\">EEVblog website</a> </li>\n<li><a href=\"http://www.youtube.com/user/EEVblog/videos\" rel=\"nofollow\">EEVblog YouTube channel</a></li>\n<li><a href=\"http://sound.westhost.com/articles.htm\" rel=\"nofollow\">ESP articles</a></li>\n</ul>\n\n<hr>\n\n<p>Should one of my students read this... <img src=\"http://i.stack.imgur.com/WCxBw.gif\" alt=\"enter image description here\"></p>\n\n<p>Yes, I know you can get help <img src=\"http://i.stack.imgur.com/w1WNX.gif\" alt=\"enter image description here\"> for your homework from the Internet <img src=\"http://i.stack.imgur.com/bKZLz.gif\" alt=\"enter image description here\">, but I usually get you ... sooner or later. <img src=\"http://i.stack.imgur.com/eqdlk.gif\" alt=\"enter image description here\"> \n<br/></p>\n\n<p>Once a former student of mine managed to smuggle a smartphone in the classroom during a written test <img src=\"http://i.stack.imgur.com/phpTH.gif\" alt=\"enter image description here\">.  After reading his test <img src=\"http://i.stack.imgur.com/eXUCS.gif\" alt=\"enter image description here\"> it took me about 5 minutes to find the exact URL of the crap <img src=\"http://i.stack.imgur.com/0MARg.gif\" alt=\"enter image description here\"><img src=\"http://i.stack.imgur.com/QBQtI.gif\" alt=\"enter image description here\"> he put on his sheet (20+ years-old pre-standard C++ code with non-standard includes). <img src=\"http://i.stack.imgur.com/lBJNq.gif\" alt=\"enter image description here\">\n<br/></p>\n\n<p><strong>Remember :</strong> Internet is full of free stuff ... and <strong>crappy stuff is particularly free</strong> <img src=\"http://i.stack.imgur.com/NPq5V.gif\" alt=\"enter image description here\">. Thus choose wisely what you are \"borrowing\" <img src=\"http://i.stack.imgur.com/SUx9M.gif\" alt=\"enter image description here\">.\n<br/><br/></p>\n\n<p>Of course feel free to <strong><em>learn</em></strong> from what you find on StackOverflow (and other StackExchange network sites)! You could manage to outsmart me and get better grades! <img src=\"http://i.stack.imgur.com/DsUvy.gif\" alt=\"enter image description here\"></p>\n\n<p>Happy Coding (or SW/HW Hacking)! <img src=\"http://i.stack.imgur.com/IZ1Vx.gif\" alt=\"enter image description here\"></p>\n',0,0,0,3111822,'https://i.stack.imgur.com/KEn6r.jpg?s=128&g=1'),(4547,101,'2014-06-08T13:24:53.257','Shimon Doodkin',NULL,'2014-06-11T18:11:46.473','http://doodkin.com','Israel',33,'<h1>SOreadytohelp</h1>\n\n<p>LOOKING FOR HIGH PAYING JOB (I am rarely found professional I am excellent coder and problems solver, systems thinking etc, more than 17+ exp).</p>\n\n<p>BY DAY: I serve people with their  related to internet software development problems and server configuration.</p>\n\n<p>BY NIGHT: I want to make startups that will make the life of people better.</p>\n\n<p>FOR FUN: Learning, Hiking, Meetups, Walking on Beach.</p>\n\n<p>\"If you see scary things, look for the helpers-youll always see people helping.\"-Fred Rogers</p>\n',0,2,0,213131,NULL),(4548,1,'2014-06-08T16:01:16.020','Danny_Student',NULL,'2014-06-08T16:01:16.020',NULL,NULL,25,NULL,0,0,0,1950787,'https://www.gravatar.com/avatar/f84c992a3936599ac54fb5e0b512926b?s=128&d=identicon&r=PG'),(5547,1,'2014-06-08T18:39:59.360','alexpq',NULL,'2014-08-04T11:33:37.763',NULL,NULL,22,NULL,0,0,0,4572999,'https://www.gravatar.com/avatar/048d7db9732d6ebf3e03a67c30afd0b0?s=128&d=identicon&r=PG&f=1'),(5548,1,'2014-06-09T09:23:23.327','dipeshrijal',NULL,'2014-06-09T09:23:23.327','http://http:www.dipeshrijal.com.np','Kathmandu',26,'<p>An extemely enthuistic person in the field of Programming.</p>\n',0,0,0,3892050,'https://graph.facebook.com/100000789774337/picture?type=large'),(5549,101,'2014-06-09T13:16:12.393','Fuzz',NULL,'2017-07-17T07:00:37.730','http://www.oodar.com.au','Melbourne, Australia',34,'<p>I am an electronics and computer systems engineer by trade. I am a Founding Engineering of an company called <a href=\"http://www.oodar.com.au\" rel=\"nofollow\">Oodar</a> in Melbourne, Australia</p>\n\n<p>My current expertise lies in C++, C, C#, Python, Matlab and Java for research and production applications. A majority of my career was spent working on cross-platform code for Windows, Linux, Mac OS X, and QNX.</p>\n',0,0,0,44083,NULL),(5550,11,'2014-06-09T17:14:45.317','Bob Baller',NULL,'2014-06-13T19:43:28.260',NULL,NULL,NULL,NULL,0,0,0,240791,'https://www.gravatar.com/avatar/750c3cc3eb2d583e9d6bb84f1657a667?s=128&d=identicon&r=PG'),(5551,1,'2014-06-09T21:16:10.573','user156190',NULL,'2014-06-09T21:31:53.103',NULL,NULL,NULL,NULL,0,0,0,4590389,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(5552,1,'2014-06-10T00:33:27.210','user101750',NULL,'2014-08-01T09:50:28.360',NULL,NULL,NULL,NULL,0,0,0,3278610,'https://www.gravatar.com/avatar/76e780f39fc8723629b6939f493fe9a3?s=128&d=identicon&r=PG&f=1'),(5553,1,'2014-06-10T04:14:42.073','Sanket',NULL,'2014-06-10T04:14:42.073',NULL,'India',NULL,NULL,0,0,0,2855524,'https://www.gravatar.com/avatar/3106ebecfd2be2007b6365836da2ebc0?s=128&d=identicon&r=PG&f=1'),(5554,111,'2014-06-10T04:19:01.050','Tom',NULL,'2014-09-28T02:11:39.427',NULL,NULL,NULL,NULL,0,0,0,134617,'https://www.gravatar.com/avatar/18cbe6e7dbbd9885c976b7b0eb46c8df?s=128&d=identicon&r=PG'),(5555,101,'2014-06-10T06:56:48.947','madrang',NULL,'2014-06-10T06:56:48.947',NULL,NULL,27,NULL,0,0,0,385555,'https://www.gravatar.com/avatar/acdf01fe355a443a8b4999dfeafdd944?s=128&d=identicon&r=PG'),(5557,18,'2014-06-10T09:42:53.967','Wilhelm',NULL,'2015-04-21T12:35:01.447',NULL,NULL,NULL,NULL,0,1,0,4276591,'https://i.stack.imgur