4:51.273','spcxplorer',NULL,'2014-10-03T17:35:19.213','',NULL,NULL,'',0,0,0,4663807,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(5631,101,'2014-06-26T06:26:47.837','matthewrdev',NULL,'2014-07-15T05:39:27.343','http://www.mfractor.com/','Sydney, New South Wales, Australia',28,'<p>Creator of MFractor - a mobile-first ReSharper for Visual Studio Mac.</p>\n\n<p>www.mfractor.com.</p>\n',0,0,0,1108155,'https://i.stack.imgur.com/p0VQa.jpg?s=128&g=1'),(5633,106,'2014-06-26T12:55:01.363','Daniel Marschall',NULL,'2016-04-14T19:39:41.997',NULL,'Germany',NULL,'<p>Mein Name ist Daniel Marschall und ich entwickle seit meiner Jugend Software.</p>\n\n<p>Ich wurde am 24. Dezember 1987 in Heidelberg geboren. Nach dem Erwerb der Mittleren Reife 2005 an der Theodor-Heuss-Realschule Heidelberg und der Allgemeinen Hochschulreife 2008 mit Schwerpunkt Biotechnologie an der Marie-Baum-Schule Heidelberg studierte ich zun chst Informatik an der Hochschule Mannheim, das ich krankheitsbedingt abbrechen musste. Im Juli 2015 schloss ich meine Ausbildung als Fachinformatiker in Anwendungsentwicklung bei der Firma RINNTECH e.K. in Heidelberg (Messtechnik f r B ume und H lzer) ab und arbeite derzeit als Anwendungsentwickler bei HickelSOFT Huth GmbH (Kaufm nnische Software f r den Getr nke-Handel).</p>\n\n<p>Neben Musik und Kunst z hlen zu meinen besonderen Interessen Cybersecurity, Steganografie und Kryptografie.</p>\n\n<p>Neben Webseiten erstelle ich vor allem freie Software und arbeite an vielen Projekten unterschiedlichster Art.</p>\n',0,0,0,227089,'https://i.stack.imgur.com/RHurx.jpg');
