//trust-in-soft.com/category/technical/</a></p>\n\n<p>The only owner of the floating-point gold badge that wasnt in the IEEE 754 standardization committee.</p>\n',0,1,0,47225,'https://i.stack.imgur.com/BhJLC.png?s=128&g=1'),(5709,113,'2014-07-09T13:16:25.170','a.toraby',NULL,'2014-11-18T10:58:12.437',NULL,'Tehran Iran',NULL,NULL,0,0,0,399457,'https://i.stack.imgur.com/l9gxA.jpg?s=128&g=1'),(5710,1,'2014-07-09T13:22:10.283','user3754699',NULL,'2014-07-09T13:22:10.283',NULL,NULL,NULL,NULL,0,0,0,4632629,'https://i.stack.imgur.com/UArVA.jpg?s=128&g=1'),(5711,1,'2014-07-09T17:45:06.957','Praveen Raj',NULL,'2014-07-09T17:45:06.957',NULL,'New Delhi, Delhi, India',NULL,'<p>Developer by profession.</p>\n',0,0,0,2534017,NULL),(5712,3,'2014-07-09T18:40:46.297','Michael Downey',NULL,'2016-12-09T23:09:47.840',NULL,'Fairfax, VA',29,NULL,1,0,0,451355,'https://www.gravatar.com/avatar/33c99875849a4d7e40c4555ec78ddb8a?s=128&d=identicon&r=PG'),(5713,218,'2014-07-09T22:09:43.720','JYelton',NULL,'2016-07-18T15:58:25.257',NULL,'Logan, UT, United States',40,'<p>I am a software programmer using C#, C+, and (less often) PHP. I frequently work with SQL, HTML, CSS, Javascript, XML, and JSON.</p>\n\n<p>I own a business for technical consulting, programming, general IT work, and designing custom electronics (usually for costumes and theater/movie prop use).</p>\n\n<p>I enjoy computers, music composition, photography, writing, sci-fi/fantasy, birding, and occasional cooking. (Many of which are topics of SE sites!)</p>\n\n<p><em>A note on capitalization, spelling, and grammar:</em> I care about the quality and <em>readability</em> of the questions and answers on StackExchange sites. I frequently edit for these reasons. I understand that not everyone knows English as their first language. If I leave a comment for you asking you to observe some language-usage convention, its meant as a helpful hint, not as an attack.</p>\n',2,18,3,53862,NULL),(5714,101,'2014-07-09T23:20:45.237','Shane Yost',NULL,'2014-07-09T23:20:45.237',NULL,'Denver, CO',31,'<p><strong>Background Information:</strong></p>\n\n<p>A.S. in Welding Technology (2005-2007)</p>\n\n<p>United States Army (2007-2011)</p>\n\n<p><strong>Current Information:</strong></p>\n\n<p>CURRENTLY majoring in Electronic Engineering.</p>\n\n<p><strong>Short Term Goals:</strong></p>\n\n<p>Maintain 4.0 GPA</p>\n\n<p>Attain Qualified Internship Position before 2014</p>\n\n<p><strong>Long Term Goals:</strong></p>\n\n<p>Complete my Degree </p>\n\n<p>Double Major (Electronic &amp; Computer Engineering)</p>\n\n<p><strong>Additional Long Term Goals:</strong></p>\n\n<p>M.A. in Electronic Engineering</p>\n\n<p>M.A. in Astronautical Engineering</p>\n',0,0,0,2229581,'https://i.stack.imgur.com/zTWuL.jpg?s=128&g=1'),(5715,21,'2014-07-10T01:28:03.793','George',NULL,'2016-02-03T21:34:27.950',NULL,NULL,NULL,NULL,1,0,0,4725976,'https://www.gravatar.com/avatar/0505bde8bd515e7aac10a3acb4d1958a?s=128&d=identicon&r=PG&f=1'),(5716,1,'2014-07-10T02:02:00.280','user5716',NULL,'2015-06-06T22:49:46.923',NULL,NULL,NULL,NULL,0,0,0,3777515,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(5717,101,'2014-07-10T02:53:42.860','ifconfig',NULL,'2016-12-23T09:15:28.777',NULL,'Mountain View, CA',15,'<p>I am a novice Computer Programmer, and a student of Mountain View High School in Mountain View, CA.</p>\n',0,0,0,3920449,'https://i.stack.imgur.com/sROPZ.jpg?s=128&g=1'),(6717,1,'2014-07-10T05:56:57.837','Jennipha-Lauren Nielsen',NULL,'2014-07-10T05:56:57.837','http://www.facebook.com/jenniphanielsen',NULL,NULL,NULL,0,0,0,4727622,'https://graph.facebook.com/139801270/picture?type=large'),(6718,1,'2014-07-10T06:36:10.623','Shourya Kumar Sohaney',NULL,'2014-07-10T06:36:10.623',NULL,NULL,NULL,NULL,0,0,0,1388268,'https://www.gravatar.com/avatar/7c869d8d24f6917a4ca8bb485013c810?s=128&d=identicon&r=PG'),(6719,101,'2014-07-10T07:47:07.957','Thomas Adrian',NULL,'2014-07-10T07:47:07.957','http://www.notessidan.se','Sweden',50,'<p>Have been working with Lotus Notes Domino stuff since 1997. these days I am mostly focused on web development and xPages</p>\n',0,0,0,1195952,'https://i.stack.imgur.com/M5rwr.jpg'),(6720,101,'2014-07-10T12:22:06.993','John U',NULL,'2014-07-10T13:04:55.990',NULL,NULL,NULL,'<p>Embedded engineer - STM, Coldfire, PIC, DaVinci. Mostly C/Linux.</p>\n\n<p>Also tinkering with PHP, HTML, JavaScript/jQuery, Python.</p>\n',0,0,0,1479529,'https://i.stack.imgur.com/XZKfz.png'),(6721,141,'2014-07-10T13:01:06.050','Spehro Pefhany',NULL,'2016-11-23T20:01:39.680',NULL,'Toronto, Canada',NULL,'<p>Leading Advanced-Technology Electronic Product Development and Global Production</p>\n\n<p>Interested in working with established companies as well as funded startups located in North America, Europe or Asia. </p>\n\n<p>A bridge between</p>\n\n<ul>\n<li>R&amp;D and Engineering</li>\n<li>Management and Engineering</li>\n<li>Western Design and Asian Manufacturing</li>\n</ul>\n',1,0,0,3852387,'https://i.stack.imgur.com/jSPZO.jpg?s=128&g=1'),(6722,101,'2014-07-10T18:41:22.387','strugee',NULL,'2014-10-22T23:57:45.887','http://strugee.net','the internet (all cardinal directions)',19,'<p><em>le Area 51 plug</em></p>\n\n<p>Im the proposer of the <a href=\"http://area51.stackexchange.com/proposals/69352/decentralized-federated-networking\">Decentralized and Federated Networking proposal</a> over on Area 51. You should come support it; decentralization and federation are bloody fascinating.</p>\n\n<p><em>le bio</em></p>\n\n<p>Im an aspiring UNIX system administrator and programmer. Im also an operating system design hobbyist.</p>\n\n<p>My favorite kernel is the Linux kernel; my favorite research kernel, Mach; my favorite research operating system, Plan 9 from Bell Labs. My favorite init system is systemd; favorite window manager/desktop environment, Awesome GNOME; favorite UNIX distribution, Arch GNU/Linux. I want to try Gentoo, but Im afraid that Ill like it and end up spending all my time waiting for things to compile. Im more at home in the commandline using coreutils than I am in Nautilus.</p>\n\n<p>I vocally support the free software movement. Im very strongly against DRM. Im a bit of a security enthusiast too - I love encryption.</p>\n\n<p>I know a bit about UX. I spend a lot of my time reading technical documentation (think FreeDesktop, GNOME Wiki, stuff like that), Wikipedia, and articles about GNU/Linux, with a little BSD mixed in.</p>\n\n<p>When I grow up, I probably want to hack on Gecko, join Mozillas IT department and help administer their systems, or do one of those things but for GNU or GNOME. Basically, I want to end up at some awesome organization working on their codebase or their infrastructure. (I used to count Canonical as one of those organizations, but not anymore.)</p>\n\n<p>I have written a short introduction to my computer history on <a href=\"http://meta.unix.stackexchange.com/a/2682/29146\">meta.unix.se</a>.</p>\n',0,0,0,1235176,'https://www.gravatar.com/avatar/7f416144b3a94f142d6b1cb88c4d8008?s=128&d=identicon&r=PG'),(6723,6,'2014-07-10T20:00:15.883','pviglia',NULL,'2014-07-13T22:38:13.713',NULL,NULL,NULL,NULL,0,0,0,4731485,NULL),(6724,116,'2014-07-10T22:24:02.503','Kousha',NULL,'2015-01-07T19:56:16.760',NULL,NULL,NULL,NULL,0,0,0,443053,'https://i.stack.imgur.com/vpxna.jpg?s=128&g=1'),(6725,101,'2014-07-10T23:18:31.623','PunKeel',NULL,'2014-07-10T23:18:31.623','https://www.ungeek.fr/','Paris, France',NULL,'<p>(my <em>about me</em> is currently blank)</p>\n\n<p>Or maybe not.</p>\n\n<p><img src=\"http://se-flair.appspot.com/png/1465298/\" alt=\"My S.O. Flare\"></p>\n',0,0,0,1465298,'https://i.stack.imgur.com/uzomp.jpg'),(6726,101,'2014-07-11T09:24:37.033','ferrangb',NULL,'2014-08-24T11:46:24.747','http://www.agroptima.com','Barcelona, Spain',32,'<p><strong>CTO &amp; founder @Agroptima.</strong> \nWe are creating what we like to call \"The Internet of Fields\", and it will be the future of Agriculture. \n<em>Tags: Agriculture, Python, Django, IoT, robotics, electronics, Arduino, Raspberry Pi, sport, good food, music and traveling.</em>  <a href=\"http://www.agroptima.com\" rel=\"nofollow\">www.agroptima.com</a></p>\n',0,0,0,2571360,NULL),(6728,1,'2014-07-12T17:35:00.393','David BasedMathematician Coven',NULL,'2014-07-12T17:35:00.393','http://covendavid.com','Seattle, WA',23,'<p>A Mechanical Engineer by study, a programmer by night, and an open source, equal opportunity advocate by day! </p>\n\n<p>I like to do web and app development. I am a mathematician at heart, and a scientist in practice. So yeah. </p>\n\n<p>Scholarship Junkie, and front runner at Engineering Expectations ! :)</p>\n',0,0,0,4731765,'https://graph.facebook.com/1425577703/picture?type=large'),(6729,1,'2014-07-12T18:19:03.430','esal26',NULL,'2014-07-20T22:52:25.390',NULL,'Monterrey, Mexico',26,'<p>I am a young, hardware R&amp;D engineer, currently working with RFID technology at a small company in the aerospace field. My primary duty consists in designing applications of this technology to provide solutions for the companys market needs.</p>\n\n<p>I have worked in the hardware R&amp;D field for over 1 year, first as an intern, and now as an engineer. I like the field and what I do because I am always learning more about hardware and electronics as well as firmware and a bit of software development. I really enjoy learning as well as developing.</p>\n\n<p>General speaking, computer engineering is my primary area of interest, but I have diverse interests in it: embedded systems, computer architecture, computer vision and mobile robotics. My professional goal is to use my interest and knowledge of technology to partake in projects that can positively impact people quality of life all around the world.</p>\n\n<p>I have a BS degree in Digital Systems and Robotics Engineering from ITESM.</p>\n\n<p>Outside the hardware world, what I like to do in my free time is in-line skating, learning new languages and spend time with my loved ones.</p>\n',0,0,0,4672682,'https://www.gravatar.com/avatar/f1bd52029d7ba664e84d04c05ef20788?s=128&d=identicon&r=PG&f=1'),(6730,1,'2014-07-12T18:25:22.687','ClintL',NULL,'2016-03-20T20:22:43.390',NULL,NULL,NULL,NULL,0,0,0,3666830,'https://www.gravatar.com/avatar/4ced1b37a3e213a39d2863022efae692?s=128&d=identicon&r=PG&f=1'),(6731,1,'2014-07-12T23:31:24.123','surajravi',NULL,'2014-07-12T23:31:24.123',NULL,NULL,NULL,NULL,0,0,0,1579394,'https://www.gravatar.com/avatar/76ad9f75cba9da1a9f3a0477fa9bc7d9?s=128&d=identicon&r=PG'),(6732,101,'2014-07-13T13:58:04.867','Eric Wang',NULL,'2014-07-13T14:37:27.047',NULL,'Shenzhen, Guangdong, China',NULL,'<p>Eric is a programmer, mainly use <code>Java</code> / <code>Linux</code> / <code>Git</code> / <code>Http</code> / common <code>Algorithms</code>, as well as some <code>Javascript</code> / <code>Database</code> / <code>C</code>, he is always learning to be better.</p>\n\n<p>This guy speaks Chinese <em>(native)</em>, English <em>(fluent)</em>.</p>\n\n<p>The ideal life for this fellow is to do something interesting &amp; useful, while still be happy and free!</p>\n\n<p><br/>\n<a href=\"http://i.stack.imgur.com/dJ3QC.png\" rel=\"nofollow\"><img src=\"http://i.stack.imgur.com/dJ3QC.png\" alt=\"enter image description here\"></a></p>\n',0,0,0,1710481,'https://i.stack.imgur.com/FPSGe.jpg?s=128&g=1'),(6733,1,'2014-07-13T15:32:34.157','user3245023',NULL,'2014-07-18T01:43:05.943',NULL,NULL,NULL,NULL,0,0,0,3923678,'https://graph.facebook.com/100000712045158/picture?type=large'),(6734,101,'2014-07-13T19:39:04.383','Mocialov Boris',NULL,'2017-01-09T21:03:44.377','http://about.me/mocialov','Edinburgh, United Kingdom',28,'<h1>SOreadytohelp</h1>\n\n<p><a href=\"http://www.nerdtests.com/ft_nq.php\" rel=\"nofollow\">\n<img src=\"http://www.nerdtests.com/images/ft/nq/21991e3bef.gif\" alt=\"I am nerdier than 98% of all people. Are you a nerd? Click here to take the Nerd Test, get geeky images and jokes, and talk on the nerd forum!\"></a></p>\n\n<p><a href=\"http://www-inst.eecs.berkeley.edu/~cs161/fa08/papers/stack_smashing.pdf\" rel=\"nofollow\">Smashing the stack for fun and profit</a></p>\n\n<p><a href=\"http://papert.org/articles/EpistemologicalPluralism.html\" rel=\"nofollow\">Epistemological pluralism aka soft/hard approaches in building the knowledge or solving problems</a></p>\n\n<p><a href=\"http://sscce.org\" rel=\"nofollow\">SSCCE</a>\n<br />\n<a href=\"http://en.wikipedia.org/wiki/KISS_principle\" rel=\"nofollow\">KISS</a></p>\n\nBrain Lateralization Test Results<b>Right Brain</b> (46%) The right hemisphere is the visual, figurative, artistic, and intuitive side of the brain.<br><b>Left Brain</b> (68%) The left hemisphere is the logical, articulate, assertive, and practical side of the brain<br>  <a href=\"http://similarminds.com/brain.html\" rel=\"nofollow\">Are You Right or Left Brained?</a><br> <a href=\"http://similarminds.com/personality_tests.html\" rel=\"nofollow\">Personality Test</a> by <a href=\"http://similarminds.com/\" rel=\"nofollow\">SimilarMinds.com</a>\n',0,0,0,453163,NULL),(6735,1,'2014-07-13T23:40:31.940','Trexter',NULL,'2016-03-06T17:58:58.790','http://kevinsheridan.info/','New York, United States',20,'<p>Student at Purdue University.</p>\n\n<p>Tinkerer.</p>\n',1,0,0,4694739,'https://graph.facebook.com/100001917872904/picture?type=large'),(6736,101,'2014-07-13T23:48:51.643','Matthew Haugen',NULL,'2017-08-01T02:05:30.767','http://www.haugenapplications.com','Redmond, WA',22,'<p><a href=\"http://www.linkedin.com/in/mhaugen\" rel=\"nofollow\"><img src=\"http://i.stack.imgur.com/rtnVN.png\" alt=\"View Matthew Haugen&#39;s profile on LinkedIn\"></a></p>\n\n<p>Im a <a href=\"http://blog.stackoverflow.com/2010/07/moderator-pro-tempore/\">Moderator Pro Tem</a> on <a href=\"http://startups.stackexchange.com/\">Startups</a> and <a href=\"http://patents.stackexchange.com\">Ask Patents</a>.</p>\n\n<p>If you have a concern that pertains to moderation on either of those sites and would like to speak with me in private, feel free to flag a post (preferably a related one to your concern, but flagging your own post will do if that doesnt apply) using the \"Other...\" reason and I or one of my fellow moderators can open a private chat room for us.</p>\n\n<p>My amateur radio call sign is KF7WLP.</p>\n\n<p>Ive been programming since I was eight, working on several projects during that time, some for fun and some for pay (which, you know, is also fun). Im now dev lead at Haugen Applications, a company my father founded a while back in Nova Scotia, Canada.</p>\n\n<p>I tend to take the \"a little knowledge about a lot of things\" route in computer science, but Im a quick learner when it comes to new technologies so I find I can get the hang of fairly advanced topics in little enough time that I can pretend I know what Im talking about. With that said, I currently have no formal training in CS so most of what I know is from experience and reading. My working rule of thumb is that Id rather be able to go to university without student loans and for fun than do it because Im supposed to and find myself in huge amounts of debt and at the same job when I get out.</p>\n\n<p>Day-to-day, I use C# and T-Sql mostly with some JavaScript here and there. I also have working proficiency in Java and C++, and Im probably forgetting a few in the mix. Most of what I do these days is web-related, both through writing websites and writing (and on some rare occasions, reading) APIs. I used to live and breathe Windows Forms, but something magical happened at some point in my life and I moved on from them.</p>\n\n<p><a href=\"http://area51.stackexchange.com/proposals/67410/feminism-and-gender-equality?referrer=PGb8oLMzIQVxi6hm5S5lUA2\"><img src=\"http://area51.stackexchange.com/ads/proposal/67410.png\" width=\"220\" height=\"250\" alt=\"Stack Exchange Q&amp;A site proposal: Feminism and Gender Equality\" /></a></p>\n',0,0,0,1325646,'https://graph.facebook.com/1130643655/picture?type=large'),(6737,101,'2014-07-14T04:51:07.340','student1',NULL,'2015-03-29T23:09:46.050',NULL,NULL,NULL,NULL,0,0,0,2495194,'https://www.gravatar.com/avatar/ec723324516c73bca255a1fe4d78398e?s=128&d=identicon&r=PG&f=1'),(6738,1,'2014-07-14T05:13:11.573','user3759645',NULL,'2014-07-14T05:13:11.573',NULL,NULL,NULL,NULL,0,0,0,4639266,'https://www.gravatar.com/avatar/cf8a953cd2efdc0e4b4026774e6fa4c2?s=128&d=identicon&r=PG&f=1'),(6740,1,'2014-07-14T14:20:39.337','user6740',NULL,'2016-11-30T18:04:00.410',NULL,NULL,NULL,NULL,0,0,0,4745903,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(6741,1,'2014-07-14T17:03:01.633','unfettered',NULL,'2014-07-14T17:03:01.633',NULL,NULL,NULL,NULL,0,0,0,3835455,'https://www.gravatar.com/avatar/1b5f251911ed27bec02a87b3d2079a9d?s=128&d=identicon&r=PG&f=1'),(6742,101,'2014-07-14T20:57:29.257','Mohammad Khosravi',NULL,'2014-07-14T20:57:29.257','http://control.ee.ethz.ch/~khosravm/','Switzerland',NULL,'<p>The origin of my interest in math is Mathematics Olympiad. I have been awarded gold medal of National Mathematics Olympiad (the competition for IMO team selection).</p>\n\n<p>I was double major student in electrical engineering and pure mathematics, in my bachelor, and also, I have a postgraduate diploma in pure mathematics.</p>\n\n<p>Currently, I am a graduate student and my main research interest is something on mathematical modeling and analyzing asymptotic behavior of a category of applied dynamical systems.</p>\n\n<p>Various parts of mathematics are interesting to me, such as probability theory, dynamical systems, graph theory, bio-math ...</p>\n',0,0,0,2957234,'https://i.stack.imgur.com/UMqlr.jpg?s=128&g=1'),(6743,1,'2014-07-15T03:57:44.333','nur rohmawadi',NULL,'2014-07-15T04:17:00.713',NULL,'Indonesia',23,NULL,0,0,0,3406441,'https://www.gravatar.com/avatar/916ca58c75c5d6213c38d60346b9474e?s=128&d=identicon&r=PG'),(6745,1,'2014-07-15T14:05:58.197','Matt Jarvis',NULL,'2014-07-15T14:05:58.197','http://www.mattjarvis.co.uk','London, United Kingdom',NULL,NULL,