rer\"><strong>server.js</strong></a> - Make Node.js development super simple and intuitive.</li>\n<li><strong>Space Helmet</strong> - <strong>NASA</strong>s <a href=\"https://2014.spaceappschallenge.org/awards/\" rel=\"nofollow noreferrer\">Space Apps winner</a> with a smart helmet for space tourists</li>\n<li><a href=\"http://picnicss.com/\" rel=\"nofollow noreferrer\"><strong>Picnic CSS</strong></a> - unpack your meal and start coding, a lightweight semantic CSS3 library</li>\n<li><a href=\"http://maify.com/\" rel=\"nofollow noreferrer\"><strong>drive-db</strong></a> - a google drive spreadsheet based simple database.</li>\n</ul>\n\n<p>Experiments. Reinventing the wheel for learning and fun:</p>\n\n<ul>\n<li><a href=\"http://francisco.io/demo/html/\" rel=\"nofollow noreferrer\">HTML preprocessor</a>: shortening the html you have to write.</li>\n<li><a href=\"http://francisco.io/demo/matrix/\" rel=\"nofollow noreferrer\">Matrix in jquery</a>. Everyone should do one.</li>\n<li><a href=\"http://francisco.io/demo/chart/\" rel=\"nofollow noreferrer\">Pure CSS chart</a>. A simple CSS chart.</li>\n</ul>\n\n<p>Others:</p>\n\n<ul>\n<li><a href=\"http://www.upv.es/noticias-upv/noticia-6212-aess-challenge-va.html\" rel=\"nofollow noreferrer\">Robotics Contest 2013 (2nd place)</a></li>\n<li><a href=\"http://www.uv.es/refutura/futura14_15#page=42\" rel=\"nofollow noreferrer\">Physics Olympics 2009 (3rd winner)</a></li>\n</ul>\n',0,6,0,902480,'https://i.stack.imgur.com/aA5kp.jpg?s=128&g=1'),(6823,11,'2014-07-29T18:57:44.413','Manish',NULL,'2017-06-27T16:55:09.813',NULL,'Mumbai, India',21,'<p>B.Tech 2nd Year student at I.I.T. Bombay Aerospace Engineering</p>\n',0,0,0,4365505,'https://graph.facebook.com/100001733591993/picture?type=large'),(6824,6,'2014-07-29T23:16:37.127','Ibizavic',NULL,'2014-07-29T23:16:37.127',NULL,NULL,NULL,NULL,0,0,0,4818155,NULL),(6825,101,'2014-07-30T10:10:00.077','Vish',NULL,'2014-07-30T10:10:00.077',NULL,NULL,24,NULL,0,0,0,333189,'https://i.stack.imgur.