ey',27,'<p>Im an Android Software Developer works on Mobilion. Also a good freelancer and enterpreneur. Contact me if you have awesome projects.\nbatuhan.coskun@outlook.com</p>\n\n<p><a href=\"http://stackoverflow.com/users/2674697/batuhan-co%c5%9fkun\">\n<img src=\"https://stackoverflow.com/users/flair/2674697.png?theme=light\" width=\"208\" height=\"58\" alt=\"profile for Batuhan Co kun at Stack Overflow, Q&amp;A for professional and enthusiast programmers\" title=\"profile for Batuhan Co kun at Stack Overflow, Q&amp;A for professional and enthusiast programmers\">\n</a></p>\n',0,0,0,3164368,'https://i.stack.imgur.com/sDxpl.jpg?s=128&g=1'),(7113,101,'2014-09-18T07:54:53.830','Srinivasan N',NULL,'2014-09-18T07:54:53.830',NULL,NULL,NULL,NULL,0,0,0,413781,'https://www.gravatar.com/avatar/cca62d9624f04a01956380fa552f3f37?s=128&d=identicon&r=PG'),(7114,101,'2014-09-18T16:30:21.030','Martin Frank',NULL,'2014-09-24T18:05:24.480',NULL,'Germany',40,'<p>For nearly 10 years I am developing java software professionally in Z rich. Before doing so I studied Electrical Engineering and Computer Science in Bochum.</p>\n\n<p>After such a long period I got in touch with differenct development processes like agile and testdriven development. The work has been quite challenching, because we have a broad spectrum of technologies, like databases, eclipse, configuration management, native code (jni), or legacy systems. </p>\n\n<p>it has been quite fun until now and i hope for more challenge in the future.</p>\n\n<p>when im not working for my company i am developing android apps, or most favoured i spend time with my family.</p>\n',0,0,0,3477991,'https://i.stack.imgur.com/uavZE.jpg?s=128&g=1'),(7115,1,'2014-09-19T00:20:52.693','Daniel Fitzgerald',NULL,'2014-09-19T00:20:52.693',NULL,NULL,NULL,NULL,0,0,0,1531396,NULL),(7116,21,'2014-09-19T04:01:32.687','user2887044',NULL,'2016-09-02T14:59:26.167',NULL,NULL,NULL,NULL,1,1,0,3446290,'https://www.gravatar.com/avatar/6f32897b269d11c490542452b860730d?s=128&d=identicon&r=PG&f=1'),(7118,1,'2014-09-19T12:33:43.733','LeDon',NULL,'2015-08-29T07:20:51.797',NULL,NULL,NULL,NULL,0,0,0,4980110,'https://i.stack.imgur.com/wDs0r.jpg?s=128&g=1'),(7119,101,'2014-09-19T18:31:42.683','zyl1024',NULL,'2015-05-09T01:04:48.580',NULL,NULL,NULL,NULL,0,0,0,2408004,'https://www.gravatar.com/avatar/9dff5783cb3e895fcdaa9c7ef58a2690?s=128&d=identicon&r=PG&f=1'),(7120,11,'2014-09-19T18:42:54.460','gungor',NULL,'2015-05-27T20:54:31.883',NULL,NULL,NULL,NULL,0,0,0,2721155,NULL),(7121,1,'2014-09-19T20:35:31.910','Dethen',NULL,'2014-09-19T20:35:31.910',NULL,NULL,NULL,NULL,0,0,0,4801106,'https://www.gravatar.com/avatar/b9568f59444d452e1661836b0f211e78?s=128&d=identicon&r=PG&f=1'),(7122,101,'2014-09-20T14:36:01.267','Raj',NULL,'2017-08-17T21:46:12.097','',NULL,NULL,'',0,0,0,4869413,'https://i.stack.imgur.com/r5GBZ.jpg?s=128&g=1'),(7123,101,'2014-09-20T17:57:48.107','polarysekt',NULL,'2014-09-20T17:57:48.107','http://www.kb3c.co.nr','St. Louis, MO, USA',34,'<p>I know what youre thinking... but trust me, its not your fault.</p>\n\n<p>Its only thought is merely a question never answered, just comments left to rot as they stretch out endlessly under the scrutiny of the sun.</p>\n\n<p>Maybe in another world, another place, another universe, another race awaits a mastermind to stand on solid ground, not too blind to sound or sight, unheard.</p>\n\n<p>Her words leave gentle marks across his lips, hips gyrating as his final breath punctuates unevenly, redacted phrases ultimately unsound for the cacophony of robot drones surrounding most all of us now...</p>\n\n<p>And off to rest, forever-like, behest, finally to sleep at night, to live a day, as weeks, quoditiennally cascading down around the last layers of filament strewn between the sheet fabric of time only now having elapsed makes sense of sensory input, as sec, und, secs tick away at the eternal sec--tion array of fibrous tubules aligned carefully in tune with the eternal harmony as harbingers are brought forth empty handed, memories lapsed -</p>\n\n<p>Now just vague reflections cast in the fading aluminium casket fast leaving Earths gravity, lest a prophet or medium should ever uncover their true meaning reminiscent of beauty long gone, bored through by mundane plastic chutes of resin just short of flashpoint, never opposed, expose the underlying weakness that had only been covered by his clothes...</p>\n\n<p>\"Six Schicka Thin\", they cried, \"when will you return?\"</p>\n\n<p>But the masked man knew no more movement, no ordinary automation to fibrillate the wayward gestures cast against the back row as even [name redacted] receded deep into the bleak quiet emptiness of escrow carrying him along now in solemn procession toward the presence that shown no more in the pretense of the singularity....</p>\n\n<p>The possessions were never his, but to learn is in fact to live, at least in theory, as contrived as it sounds now, the final march begun almost without hesitation.</p>\n\n<p>Ill be out now as well, further east, west, nonsensical directional intercourse which some say only makes things more complicated, possibly witchlike...</p>\n\n<p>The time traveller hangs his head in despair as the wall clock now too low in timbre to tone tonight atones only those whose long gone faces exceed even the memory of ages.</p>\n\n<p>Good away and bad bye, on to a new era, free of medicine, cures, or fancy things to keep him happy... swaying casually (naturally) dialing in the frequency of the twang to be heard for more than twenty five million years in the future, only a shard for the eternal sec-tic counter, painted wildly blue and decorated with yard furniture -- as brilliant as it were -- dull, plated matte finish, he gazed one last time at the portrait hanging in what used to be a great castle, now rubble, used, like volcanic embers, once mighty, reduced to ash -- glass -- leaving internal voices reflected back, unable to escape the eminent introspection that was all but too real, concealed in nothing from where everything emerged.</p>\n',0,0,0,4801256,'https://graph.facebook.com/684873665/picture?type=large'),(7124,1,'2014-09-20T19:32:06.067','phdoerfler',NULL,'2014-09-26T17:29:38.410',NULL,NULL,NULL,NULL,0,0,0,941047,'https://www.gravatar.com/avatar/d95aa48801923e720e65f5487cad05d7?s=128&d=identicon&r=PG'),(7125,1,'2014-09-20T20:34:43.893','Rayyaan Mustafa',NULL,'2016-03-29T21:37:12.493',NULL,NULL,NULL,NULL,0,0,0,5060206,'https://lh5.googleusercontent.com/-Cp4-vLuFIOg/AAAAAAAAAAI/AAAAAAAAAQY/P6uf7Pudq5E/photo.jpg'),(7126,1,'2014-09-21T02:23:25.753','Aerozeek',NULL,'2014-12-17T15:50:13.163','http://zeek.ml/','Miami, FL',NULL,NULL,0,0,0,255526,NULL),(7127,1,'2014-09-21T06:50:23.177','IntoDiode',NULL,'2014-09-21T06:50:23.177',NULL,NULL,NULL,NULL,0,0,0,4951305,'https://i.stack.imgur.com/seXUB.jpg?s=128&g=1'),(7128,101,'2014-09-21T13:10:14.203','AndreasT',NULL,'2017-05-02T12:42:30.363',NULL,NULL,NULL,NULL,0,0,0,30334,'https://www.gravatar.com/avatar/d6e08d8fde39d9bd6db46a55bd0e5bd0?s=128&d=identicon&r=PG'),(7129,101,'2014-09-21T16:05:35.090','George Gkirtsou',NULL,'2014-09-21T16:05:35.090',NULL,NULL,NULL,NULL,0,0,0,1356310,'https://i.stack.imgur.com/AWAN4.jpg?s=128&g=1'),(7130,101,'2014-09-21T16:30:32.813','Darqer',NULL,'2015-09-04T20:14:02.473',NULL,NULL,34,NULL,0,0,0,51878,'https://www.gravatar.com/avatar/94d1c365fc5cd209ed995144115355fe?s=128&d=identicon&r=PG'),(7131,28,'2014-09-21T20:33:06.203','user46877',NULL,'2016-12-09T01:54:01.577',NULL,NULL,NULL,NULL,0,4,0,4494161,'https://www.gravatar.com/avatar/7362d9792785d185cba013bccdcfd1ef?s=128&d=identicon&r=PG&f=1'),(7132,1,'2014-09-22T00:45:14.837','paul',NULL,'2016-08-24T04:40:11.923','http://www.myfunplanet.com',NULL,NULL,NULL,0,0,0,1069882,'https://www.gravatar.com/avatar/6b85776e3679a127d0be70bdc814375a?s=128&d=identicon&r=PG'),(7133,186,'2014-09-22T09:13:42.437','Steffen',NULL,'2017-07-21T08:20:55.200',NULL,NULL,NULL,'<p>Hi!</p>\n',3,17,0,5043814,'https://www.gravatar.com/