ade a map for Warcraft III with active joining and leaving as opposed to waiting for all players to be ready and an arbitrary player limit instead of the normal limit of 12 players. In the past few years though, Ive been tinkering with game development and thats how I ended up here.</p>\n\n<p>Outside of that, I also do hobby electronics and robotics on a very amateur level.</p>\n\n<hr>\n\n<ul>\n<li>Want to utilize gamepads in Silverlight? <a href=\"https://github.com/TinkerWorX/silverlight-gamepad-input\" rel=\"nofollow\">Look no further</a>!</li>\n</ul>\n',0,0,0,245010,NULL),(7141,101,'2014-09-23T17:17:56.440','Zeth',NULL,'2014-10-08T06:10:33.803','http://www.zeth.dk','Denmark',28,'<p>Studies computer science, makes websites and play volleyball... Like any other average Joe.</p>\n',0,0,0,1965934,NULL),(7142,36,'2014-09-23T17:25:28.867','aac',NULL,'2014-09-23T21:43:26.167',NULL,NULL,NULL,NULL,0,0,0,5073448,NULL),(7143,26,'2014-09-24T03:02:16.790','Jinkyoo Park',NULL,'2014-11-21T12:32:59.047',NULL,NULL,NULL,NULL,0,0,0,5041875,'https://www.gravatar.com/avatar/d1bef612ad2d73ea09eea470bd9174b2?s=128&d=identicon&r=PG&f=1'),(7144,101,'2014-09-24T12:58:05.683','Onur',NULL,'2017-05-18T12:23:30.907',NULL,'Izmir, Turkey',30,'<ul>\n<li>MSc Mechatronics Engineering Student\n\n<ul>\n<li>Computer Engineer</li>\n<li>Embedded System Developer</li>\n<li>Izmir TR</li>\n</ul></li>\n</ul>\n',0,1,0,309316,NULL),(7145,1,'2014-09-24T14:56:04.847','Mark Lundin',NULL,'2014-09-24T14:56:04.847',NULL,NULL,NULL,NULL,0,0,0,5078547,'https://www.gravatar.com/avatar/1a63dfd4089f292cacc33816c4ffd630?s=128&d=identicon&r=PG&f=1'),(7146,1,'2014-09-25T04:16:55.637','vg123',NULL,'2014-09-25T04:16:55.637',NULL,NULL,NULL,NULL,0,0,0,5081218,'https://www.gravatar.com/avatar/c6de2fa1f2aefc0a872f7ed460bc75fe?s=128&d=identicon&r=PG&f=1'),(7147,1,'2014-09-25T09:18:40.700','zenith and quasar',NULL,'2014-09-27T16:45:39.023',NULL,NULL,NULL,NULL,0,0,0,3362832,'https://www.gravatar.com/avatar/ce88381c80c4594fb220587b