er than an Arduino can supply and so I am now exploring power supplies, and by extension, electronics. </p>\n\n<p>So I have come full circle except that I can now more easily get answers to my questions and I can afford a little more kit :-). </p>\n',3,14,0,4812900,'https://www.gravatar.com/avatar/0df055c41158b47471e24f748a6c4324?s=128&d=identicon&r=PG&f=1'),(7199,101,'2014-10-02T18:09:25.783','Brian Merrell',NULL,'2014-10-09T16:46:48.363',NULL,'The SPACE Coast',37,NULL,0,0,0,187556,NULL),(7200,1,'2014-10-03T04:15:36.880','RFredo',NULL,'2014-10-03T04:15:36.880',NULL,NULL,NULL,NULL,0,0,0,5121187,'https://www.gravatar.com/avatar/dcccc1405673be96fa583ad980748151?s=128&d=identicon&r=PG&f=1'),(7201,111,'2014-10-03T08:08:23.957','Martynas',NULL,'2017-05-25T16:03:12.110',NULL,'Lithuania',29,NULL,1,0,0,4425863,'https://i.stack.imgur.com/2jsii.jpg'),(7202,101,'2014-10-03T12:57:27.557','asachanfbd',NULL,'2014-10-03T12:57:27.557',NULL,'Faridabad, India',29,NULL,0,0,0,1370807,'https://www.gravatar.com/avatar/09572e93377f14944ea1c3cef0cdf80c?s=128&d=identicon&r=PG'),(7203,101,'2014-10-03T17:13:02.520','Jed Daniels',NULL,'2017-07-03T17:42:03.850','http://www.stackoverflow.com','California',39,'\"All right, guys, uh, listen. This is a blues riff in \"B\", watch me for the changes, and try and keep up?\"',0,2,0,110577,'https://www.gravatar.com/avatar/1917ceaa79b7325194854df6456454f6?s=128&d=identicon&r=PG'),(7204,111,'2014-10-03T19:29:55.267','blueintegral',NULL,'2017-05-08T03:11:15.110','http://hscott.net','Atlanta, GA',28,'<p>Computer Engineering Student at Georgia Tech</p>\n',1,0,0,32700,'https://www.gravatar.com/avatar/4af85e02527dc16f88a7b38836739c9c?s=128&d=identicon&r=PG'),(7205,1,'2014-10-03T19:42:05.020','martin k.',NULL,'2014-11-24T20:26:24.680',NULL,'Czech Republic',18,NULL,0,0,0,3908813,'https://www.gravatar.com/avatar/afd571911479aeeb488fcc697e6b3b06?s=128&d=identicon&r=PG&f=1'),(7206,6,'2014-10-04T08:30:59.400','John',NULL,'2014-10-05T06:48:07.670',NULL,NULL,NULL,NULL,0,0,0,5126152,NULL),(7207,101,'2014-10-04T12:39:52.523','Student',NULL,'2014-10-04T12:39:52.523',NULL,NULL,21,'<p>Student</p>\n',1,0,0,2908276,'https://i.stack.imgur.com/mJSlV.jpg'),(7210,16,'2014-10-05T00:52:55.713','Jabbath',NULL,'2014-11-21T02:38:28.350',NULL,NULL,NULL,NULL,0,0,0,3277932,'https://www.gravatar.com/avatar/b6672aeb69a5aa50ec0ba19465b0a4ac?s=128&d=identicon&r=PG&f=1'),(7212,1,'2014-10-05T16:08:56.747','Salvatore La Bua',NULL,'2014-10-07T02:48:40.363','http://www.slblabs.com','Japan',36,'<p>My name is Salvatore and I graduated cum laude with a master s degree in Computer Science Engineering for Intelligent Systems at University of Palermo, Italy, presenting a Thesis in Robotics on Design and Implementation of Modules for the Extraction of Biometric Parameters in an Augmented BCI Framework.\nPreviously graduated with the grade of 110/110 with a degree in Computer Science Engineering, presenting a Thesis in Artificial Intelligence / Latent Semantic Analysis on an Intelligent Interrogation System on official documents of the European Parliament.</p>\n\n<p>Besides Robotics and Artificial Intelligence, I am also interested in Human-Robot Interaction, Machine Learning, Cognitive Robotics, Image processing, 3D Computer Graphics, Mechatronics, Cybernetics, Bionics, Neuroprosthetics, Mathematics, Physics, Cryptography, Algorithms, Networks, Autonomous Vehicles.\nDuring the course of the academic studies I have learned to program in different programming languages, including C, C++, Java, Python, LISP, Matlab. Past experiences also on Basic, QuickBasic, VisualBasic and specific languages such as SQL, Gams, Prolog, S-Golog, UML, XML, AIML.</p>\n\n<p>I am looking forward to starting my PhD, hopefully with interesting opportunities abroad, in particular in Japan: I think it is a wonderful place where I would love to spend my life in.\nI have lived in Kyoto for a month.</p>\n\n<p>I am interested in learning about Japan, the Japanese language, culture, lifestyle and job opportunities. I am especially interested in doing academic and industrial research in Japan, mainly on Robotics and Artificial Intelligence.</p>\n\n<p>I like drawing and I would also like to try painting, sculpting and hand-crafting in general.\nBesides traditional visual fine art, I also enjoy digital drawing/painting/texturing using mainly The GIMP, Photoshop, and 3D modelling using Blender 3D with interest in the possible integration of 3D modelling with educational or gaming platforms. I tend to use free and open source software when possible, though, each tool is suitable for the particular task that it is needed for.</p>\n\n<p>Last but not least, I am interested in photography and architecture, and I am an attentive observer of everything that surrounds me.\nI would like to have time to travel and see places around the world.</p>\n',0,0,0,5097067,'https://lh3.googleusercontent.com/-ikpnGQ4ByZo/AAAAAAAAAAI/AAAAAAAA15g/4tXYgX70fMM/photo.jpg?sz=128'),(7213,1,'2014-10-05T22:59:34.173','Gabriel Masson',NULL,'2014-12-05T18:59:29.137','http://gmasson.com.br/','Araras',25,'<p>Trabalho no mundo da programa o e design arduamente desde 2007, sou Empreendedor, Desenvolvedor <em>Front-END</em>, Professor-sem-memoria e extremamente apaixonado por Marketing e Rock N Roll.</p>\n',0,0,0,5119225,'https://graph.facebook.com/100000494206378/picture?type=large'),(7214,101,'2014-10-06T09:48:18.300','Manish Verma',NULL,'2014-10-06T09:48:18.300',NULL,'India',29,NULL,0,0,0,405272,'https://i.stack.imgur.com/7ZKNo.jpg?s=128&g=1'),(7215,1,'2014-10-06T11:19:48.827','Sebastian Rutkowski',NULL,'2017-02-04T10:58:07.930',NULL,'Anchorage, AK, United States',NULL,NULL,0,0,0,5133610,'https://i.stack.imgur.com/UHpea.png?s=128&g=1'),(7216,1,'2014-10-06T14:46:05.130','zeroknowledge',NULL,'2015-01-16T09:48:59.273',NULL,NULL,NULL,NULL,0,0,0,528661,'https://www.gravatar.com/avatar/9e9b78e0049d7f4940a2db6a0372f579?s=128&d=identicon&r=PG&f=1'),(7217,1,'2014-10-06T18:00:07.897','Tim Maguire',NULL,