nager from the Portland, Oregon area.  I enjoy macOS, iOS, Arduino, and Nintendo Entertainment System programming.</p>\n\n<p>I participate in <a href=\"//chat.stackoverflow.com/rooms/41570\">SO Close Vote Reviewers</a>, where we moderate Stack Overflow in any way we can, <a href=\"//chat.stackexchange.com/rooms/11540\">Charcoal HQ</a>, where we detect and flag spam with <a href=\"//github.com/Charcoal-SE/SmokeDetector\" rel=\"nofollow noreferrer\">SmokeDetector</a>, and <a href=\"//chat.stackoverflow.com/rooms/111347\">SOBotics</a>, where we develop bots to help us moderate the site.  Feel free to join us in any of those rooms!  </p>\n\n<p>If you need to contact me for some reason, just ping me in one of the chat rooms listed above or send me an email at <code>&lt;my username&gt;@sobotics.org</code>.</p>\n',0,4,0,4248202,'https://i.stack.imgur.com/pJGHG.png?s=128&g=1'),(7302,1,'2014-10-18T03:53:52.367','Majed Ali',NULL,'2014-10-18T03:53:52.367',NULL,NULL,NULL,NULL,0,0,0,3462864,'https://www.gravatar.com/avatar/ba9e74ab1cf631eaf2303a5915605aa5?s=128&d=identicon&r=PG'),(7303,101,'2014-10-18T08:52:18.160','a-Jays',NULL,'2016-05-13T21:09:35.967',NULL,NULL,NULL,'<p>Robotics, vision and intelligence.\nAlso, #SOreadytohelp</p>\n',0,2,0,3803348,'https://i.stack.imgur.com/eNeIA.png?s=128&g=1'),(7304,106,'2014-10-18T19:33:25.877','Lakshay Garg',NULL,'2016-11-04T16:31:43.937','http://lakshayg.github.io','India',21,NULL,0,4,0,3638699,'https://www.gravatar.com/avatar/5128fcd3a14587660ea0cb737aa54143?s=128&d=identicon&r=PG&f=1'),(7306,101,'2014-10-18T21:29:18.253','hichris123',NULL,'2017-05-02T22:42:29.723',NULL,NULL,NULL,'<p>Im a student interested in technology.</p>\n\n<p>Also an <a href=\"http://earthscience.stackexchange.com/\">Earth Science</a> moderator. Come check us out!</p>\n',0,0,0,3046327,'https://i.stack.imgur.com/JVj4n.png'),(7307,1,'2014-10-18T21:30:41.240','curiousgeorge',NULL,'2014-10-18T21:30:41.240',NULL,NULL,NULL,NULL,0,0,0,5172015,'https://www.gravatar.com/ava