acebook</a> |\n<a href=\"https://twitter.com/sachinjoseph\" rel=\"nofollow noreferrer\">Twitter</a> |\n<a href=\"http://sachinjoseph.branded.me/\" rel=\"nofollow noreferrer\">branded.me</a>\n<br /><br /></p>\n',0,0,0,1910852,NULL),(7323,101,'2014-10-22T20:26:33.763','Ray',NULL,'2015-10-07T20:24:41.090',NULL,NULL,NULL,'<p>I dabble heavily in Linux/Unix, Mac OSX, Windows, scripting and anything you can thing of networking or computer related.  I also design and build my own electronic circuits / projects.</p>\n',0,1,0,541307,'https://i.stack.imgur.com/RcI5z.jpg'),(7324,101,'2014-10-22T21:10:05.490','hashmuke',NULL,'2017-05-16T19:58:14.433',NULL,NULL,NULL,'<p>merge keep</p>\n',0,0,0,2423567,'https://i.stack.imgur.com/aKDbx.jpg'),(7326,101,'2014-10-22T23:11:55.837','Nathan',NULL,'2017-02-21T21:54:54.707','http://swanstation.tk/','United States',NULL,'<p>Hello! Im a front and back end web developer. I use the CodeIgniter framework.</p>\n\n<p>Projects:</p>\n\n<ol>\n<li><strong>Alphasquare</strong>   Debate the web. <em>[Team project.]</em></li>\n<li><strong><a href=\"http://gifavs.com/\" rel=\"nofollow\">Gifavs</a></strong>   Share, favorite, collect, and comment on your favorite gifs!</li>\n<li><strong><a href=\"http://swanstation.tk/\" rel=\"nofollow\">The Swan Station</a></strong>   Enter the numbers every 108 minutes to save the world, just like Desmond Hume in the TV series LOST!</li>\n<li><strong><a href=\"http://answerspl.us/\" rel=\"nofollow\">Answers+</a></strong>   Ask, answer, and receive points! <em>[on hold indefinitely]</em></li>\n</ol>\n\n<p>Im a big fan of the TV shows Lost, Once Upon a Time, Resurrection, and Motive.</p>\n\n<hr>\n\n<h2>Languages, technologies, &amp; frameworks</h2>\n\n<ol>\n<li>HTML (5)</li>\n<li>CSS (3)</li>\n<li>JavaScript\n<ul>\n<li>jQuery</li>\n<li>AJAX</li>\n<li>JSON</li>\n</ul></li>\n<li>PHP</li>\n<li>SQL \n<ul>\n<li>MySQL/MySQLi</li>\n<li>Prepared Statements</li>\n</ul></li>\n<li>Object-Oriented Programming</li>\n<li>CodeIgniter PHP framework\n<ul>\n<li>MVC - Model, View, Controller </li>\n</ul></li>\n<li>English</li>\n</ol>\n\n<h2>Languages that I plan on learning someday</h2>\n\n<ol>\n<li>C++</li>\n<li>Objective C</li>\n<li>Java</li>\n</ol>\n\n\n',0,1,0,238618,NULL),(7327,1,'2014-10-23T05:22:59.743','Parad0xD9',NULL,'2014-10-23T05:22:59.743',NULL,NULL,23,NULL,0,0,0,5039960,NULL),(7328,101,'2014-10-23T07:50:07.670','Shanthakumar',NULL,'2014-10-23T07:50:07.670','http://5hanth.github.io','13  37.64\"N 80  747.91\"E',23,NULL,0,0,0,2062213,NULL),(7329,101,'2014-10-23T09:39:58.540','Juri Robl',NULL,'2014-10-23T09:39:58.540',NULL,'Augsburg, Germany',29,NULL,0,1,0,103171,'https://www.gravatar.com/avatar/142a2c10c09b1e753b13af790719862e?s=128&d=identicon&r=PG'),(7330,1,'2014-10-23T12:28:33.577','Miykoll',NULL,'2017-08-03T19:15:23.723',NULL,'Netherlands',26,'<p>Student\nCurrent: Master System and Control.</p>\n\n<p>Degrees:\nBachelor of Applied Engineering in Applied Physics</p>\n',0,0,0,4243401,'https://www.gravatar.com/avatar/d2e996507144a59cf2d53bbbe413af3d?s=128&d=identicon&r=PG&f=1'),(7331,1,'2014-10-23T21:01:37.007','user27886',NULL,'2016-01-08T01:24:42.980',NULL,NULL,NULL,NULL,0,0,0,2537180,'https://www.gravatar.com/avatar/cc0e3e94e2da8abf943004453500fd2f?s=128&d=identicon&r=PG&f=1'),(7332,31,'2014-10-24T00:17:09.163','Mauricio',NULL,'2014-10-24T00:17:09.163',NULL,NULL,NULL,NULL,0,0,0,5223226,NULL),(7333,101,'2014-10-24T01:54:47.077','Bennett Yeo',NULL,'2016-10-03T21:24:03.057',NULL,'192.168.1/16 Block',20,'<p>Developer and Intermediate level computer programmer with an intermediate-advanced grasp of code architecture. Fluent in C#, Java, JavaScript, Hyper Text Markup Language, C and Java and Extensible Markup Language. I have also programmed lego robots throughout my preteen years and moved into tetrix robots and RobotC. I was the lead developer and computer systems analyst within my First Technical Challenge team and developed a never-done-before first person control system interface for the wifi controllers. I currently attend the University of Wisconsin Madison programming a vehicle dynamics simulator under Professor David Noyce and Kelvin Santiago for the Civil Engineering Department.</p>\n\n<p>\"I am a program that converts caffine into code\"</p>\n',0,0,0,3273853,'https://i.stack.imgur.com/p7Fwh.png?s=128&g=1'),(7334,1,'2014-10-24T03:11:13.983','Aniello Manganelli',NULL,'2014-10-24T03:11:13.983',NULL,NULL,NULL,NULL,0,0,0,5219681,'https://i.stack.imgur.com/ukoZr.png?s=128&g=1'),(7335,1,'2014-10-24T06:03:29.653','RYP',NULL,'2014-10-24T06:20:00.860',NULL,NULL,NULL,'<p>Exploring code through mobile applications</p>\n',0,0,0,3504581,'https://i.stack.imgur.com/SqA4h.jpg?s=128&g=1'),(7336,1,'2014-10-24T11:47:30.553','Avisek',NULL,'2014-11-28T07:55:25.957',NULL,'Kolkata, India',27,NULL,0,0,0,2610045,'https://www.gravatar.com/avatar/cda7b643adb00d8ebaa7121334ec7461?s=128&d=identicon&r=PG'),(7337,324,'2014-10-24T13:08:51.280','goncalo luis',NULL,'2015-12-07T14:33:35.727','',NULL,NULL,'',6,8,0,4481434,'https://i.stack.imgur.com/0L1e1.jpg'),(7338,26,'2014-10-24T19:03:05.600','kevin',NULL,'2014-10-24T19:03:05.600',NULL,NULL,NULL,NULL,0,0,0,5227309,NULL),(7339,101,'2014-10-25T01:53:11.587','J. Musser',NULL,'2014-11-13T22:52:05.947','http://gardening.stackexchange.com/','Lancaster, Pennsylvania',NULL,'<p>Heres a shout-out to the <a href=\"http://stackexchange.com/users/current\"><strong>hero of Stack Exchange</strong></a>! Youre the best!</p>\n\n<p>Feel free to contact me (@J.Musser) in our site chat room, <a href=\"http://chat.stackexchange.com/rooms/546/the-garden-shed\"><strong>The Garden Shed</strong></a>, if you have something you want to tell me, or just want to chat. Or you can email me at <strong>frank.j.musser@gmail.com</strong> if you want to contact me personally for any reason (take that literally :D). I only use that email for Stack Exchange, so expect a slight reply delay. </p>\n\n<p>pm me here:</p>\n\n<p><img src=\"https://i.imgflip.com/z7eiv.gif\" width=\"421\" ></p>\n\n<p>Heres my network flair (if you are a member of Stack Exchange, find your flair <a href=\"http://stackexchange.com/users/current?tab=flair\">here</a>) It shows some of your accomplishments:</p>\n\n<p><a href=\"http://stackexchange.com/users/531689/jmusser\"><img src=\"http://stackexchange.com/users/flair/531689.png\" width=\"208\" height=\"58\" alt=\"profile for jmusser on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for jmusser on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a></p>\n\n<hr>\n\n<h3>Because Im a landscaper/plant health care guy, heres a brief description of my local area and climate:</h3>\n\n<ul>\n<li><strong>Location:</strong> Lancaster, Pennsylvania, United States </li>\n<li><strong>USDA hardiness zone:</strong> 6b</li>\n<li><strong>Frost dates:</strong> (1st frost) November 1st (last frost) April 30th</li>\n<li><strong>Yearly Precipitation:</strong>  43.64 inches, avg</li>\n<li><strong>Soil Type:</strong> Mostly heavy clay, some areas of sand or silt. Decent variable topsoil</li>\n<li><strong>Average high/low temperatures:</strong> (high) 86 F. (low) 24 F. </li>\n</ul>\n\n<hr>\n\n<p>I have been gardening all my life, and have knowledge in lawn care, tree and shrub care, general landscaping, edibles, nursery, and indoor gardening, as well as other variable aspects of horticulture.</p>\n\n<p>I also have a fairly good knowledge of basic biological concepts, and have fun learning about it on our [<strong>Biology</strong><a href=\"http://biology.stackexchange.com\">2</a> site. I enjoy outdoor activities, such as horse riding, hiking, camping, etc, when I can get around to them. </p>\n\n<hr>\n\n<p>Plants doing cool plant things: </p>\n\n<p><a href=\"https://media3.giphy.com/media/IaqlNUXfacG52/200.gif\" rel=\"nofollow\"><img src=\"https://media3.giphy.com/media/IaqlNUXfacG52/200.gif\" height=\"150\" /></a>\n<a href=\"https://media0.giphy.com/media/TLsYiql3w4u7m/200.gif\" rel=\"nofollow\"><img src=\"https://media0.giphy.com/media/TLsYiql3w4u7m/200.gif\" height=\"150\" /></a>\n<a href=\"https://media4.giphy.com/media/B5ilCD3qpysta/200.gif\" rel=\"nofollow\"><img src=\"https://media4.giphy.com/media/B5ilCD3qpysta/200.gif\" height=\"150\" /></a>\n<a href=\"https://media4.giphy.com/media/Wy5yWQD9bUZ2/200.gif\" rel=\"nofollow\"><img src=\"https://media4.giphy.com/media/Wy5yWQD9bUZ2/200.gif\" height=\"150\" /></a>\n<a href=\"https://media2.giphy.com/media/129giMCPtxY46I/200.gif\" rel=\"nofollow\"><img src=\"https://media2.giphy.com/media/129giMCPtxY46I/200.gif\" height=\"150\" /></a>\n<a href=\"https://media1.giphy.com/media/SqCwRBphjzFQc/200.gif\" rel=\"nofollow\"><img src=\"https://media1.giphy.com/media/SqCwRBphjzFQc/200.gif\" height=\"150\" /></a></p>\n',0,0,0,531689,'https://i.stack.imgur.com/XDA2o.jpg'),(7340,101,'2014-10-25T11:42:03.970','Greg Woods',NULL,'2014-10-28T11:15:08.857','http://www.gregwoods.co.uk','Lancaster, United Kingdom',47,'<p>Im a web application developer working in Lancaster, UK. Im obsessed with good design in everything around me.</p>\n',0,1,0,36908,'https://i.stack.imgur.com/tA9ER.jpg?s=128&g=1'),(7341,1,'2014-10-26T02:51:28.717','Jyotirmoy Ray',NULL,'2014-10-27T02:36:26.467',NULL,NULL,NULL,NULL,0,0,0,5232185,'https://lh4.googleusercontent.com/-1yEC7ejeltU/AAAAAAAAAAI/AAAAAAAAAbw/ZYrHUg4Cb4A/photo.jpg'),(7342,1,'2014-10-26T03:40:40.380','Cat Fancy Fembot',NULL,'2014-10-26T03:40:40.380','http://scifipartyline.com','Ithaca, NY',NULL,'<p>My Twitter handle is <a href=\"https://twitter.com/fancyfembot\" rel=\"nofollow\">@fancyfembot</a>. I like science fiction, costuming, wine, and fashion. I podcast about science fiction TV shows and film. Im currently an undergrad.</p>\n',0,0,0,5188168,'https://graph.facebook.com/1440703036/picture?type=large'),(7343,106,'2014-10-27T16:04:45.960','Kukanani',NULL,'2016-09-26T01:10:06.490','http://allevato.me','Texas',NULL,'<h1>SOreadytohelp</h1>\n',0,0,0,879277,'https://i