torbike with approximately the same power output as a combined 4x4 matrix of hamsters</p>\n',0,0,0,33795,'https://www.gravatar.com/avatar/5390c4b0654937c072c4540eab964113?s=128&d=identicon&r=PG'),(7368,21,'2014-10-29T20:25:13.493','Paul G. Chapman MInstLM G4IJL',NULL,'2014-10-29T20:25:13.493',NULL,NULL,NULL,NULL,0,0,0,5251772,NULL),(7369,1,'2014-10-29T20:47:28.383','Mighty Ferengi',NULL,'2014-11-05T21:47:29.240',NULL,'Texas',40,'<p>Full-time IT Manager, full-time Trekkie, father and husband, avid strategy video gamer, Palladium Books collector.</p>\n',0,0,0,5239507,'https://i.stack.imgur.com/mIo64.jpg?s=128&g=1'),(7371,46,'2014-10-30T08:05:38.227','Hossein',NULL,'2015-09-16T06:39:00.317',NULL,NULL,NULL,NULL,1,1,0,2281937,'https://www.gravatar.com/avatar/d8ae16516f0c1dc2df29d532a818b981?s=128&d=identicon&r=PG&f=1'),(7372,1,'2014-10-30T09:27:41.483','White Chocolate',NULL,'2017-07-26T13:58:00.787',NULL,NULL,NULL,NULL,0,0,0,4112813,'https://www.gravatar.com/avatar/e64bc328d63ffb3593bc26fd261c5cef?s=128&d=identicon&r=PG&f=1'),(7373,101,'2014-10-30T11:22:39.550','Kuzon',NULL,'2014-11-02T10:03:08.140','http://adf.ly/1rgxL','Sky Land',20,'<p>I am just a young guy interested in programming... and need help</p>\n\n<p>As many of us know, through life we can often be branded with nicknames. Mine was Kuzon, he is a character for the tv seires Avatar, The Last Airbender.</p>\n\n<p>Kuzon was the second son of Fire Lord Izuma and Jiroh and the younger brother of Fire Lord Sozin. In his youth, he was also a good friend of Avatar Aang. Although he was appointed Commander of the first Fire Nation Armored Division by Sozin at age 18, and commanded these tanks during Sozins assault on the Southern Air Temple, Kuzon could not tolerate his brothers plan to completely destroy the Air Nomad race. When he discovered what Sozin planned to do, Kuzon freed several Air Nomads from their cells in the camp. He was promptly discovered by Sozin, and barely escaped the battle with his life. Branded a traitor by his home country, Kuzon had nowhere to go but the community of refugee airbenders. He joined a group of airbenders who chose to covertly fight the Fire Nation and assist the Earth Kingdom and Water Tribe forces. Though he was once captured and brought back to the Fire Nation to face execution, he escaped with the help of his airbender compatriotsTaro and Kunchen, and spent the rest of his life helping to stem the tide of Fire Nation onslaught.</p>\n',0,0,0,418546,'https://www.gravatar.com/avatar/f1423940471ac726170b6d7c6c2a4f04?s=128&d=identicon&r=PG'),(7375,1,'2014-10-30T15:08:28.783','JeremyVS',NULL,'2014-10-30T15:08:28.783',NULL,'Massachusetts',36,'<p>Senior Software Engineer</p>\n',0,0,0,1711063,'https://www.gravatar.com/avatar/85ea159cc6928cec810537c349cb66df?s=128&d=identicon&r=PG'),(7376,16,'2014-10-30T16:28:50.917','Grim',NULL,'2017-08-13T07:47:38.410',NULL,NULL,NULL,NULL,0,0,0,5057594,'https://www.gravatar.com/avatar/b944601354405e1eead724d78c541970?s=128&d=identicon&r=PG&f=1'),(7377,101,'2014-10-30T19:22:13.443','Ali',NULL,'2016-01-08T19:13:12.853','http://ali.moeeny.com','Washington, DC',39,'<p>I love to build things that people love to use.<br>\nI like scientific data analysis.<br>\nIve spent most of my life in medicine and neuroscience!<br>\nI like: vim, zsh, golang, debian, python\nI am addicted to writing code! and learning new things!!</p>\n',0,7,0,226674,'https://www.gravatar.com/avatar/9e8dd06976ead4082d2181f3807117e1?s=128&d=identicon&r=PG'),(7378,1,'2014-10-30T19:48:48.867','milad',NULL,'2015-06-20T03:46:57.227',NULL,NULL,NULL,NULL,0,0,0,5257565,'https://www.gravatar.com/avatar/237e231bdc22b95c0fc74b3a7e1f3616?s=128&d=identicon&r=PG&f=1'),(7379,1,'2014-10-31T03:57:19.013','Siege_Engineer',NULL,'2014-10-31T03:57:19.013',NULL,NULL,NULL,'<p>Spaceships, Robots and Trebuchets.</p>\n',0,0,0,3834394,'https://www.gravatar.com/avatar/a48bb698f2c13518011b58d2b46ffcde?s=128&d=identicon&r=PG&f=1'),(7380,1,'2014-10-31T09:08:59.110','Ayberk Halac',NULL,'2014-11-01T15:52:30.230','http://www.ayberkhalac.com','Turkey',24,'<p>Software Engineer</p>\n',0,0,0,5225141,'https://graph.facebook.com/100000153465541/picture?type=large'),(7381,101,'2014-10-31T18:35:59.573','Riot',NULL,'2014-10-31T18:35:59.573',NULL,'Manchester, United Kingdom',33,NULL,0,0,0,1852162,NULL),(7382,1,'2014-11-01T13:12:32.763','Mark du Preez',NULL,'2017-03-06T13:34:32.940',NULL,NULL,NULL,NULL,0,0,0,2127172,'https://lh3.googleusercontent.com/-WoXDBJutbP4/AAAAAAAAAAI/AAAAAAAAAHA/P0Ikr7Uvm38/photo.jpg?sz=128'),(7383,120,'2014-11-01T19:54:52.037','Adam',NULL,'2017-04-25T13:06:41.923',NULL,NULL,NULL,NULL,1,1,0,3974171,'https://i.stack.imgur.com/GnLUb.jpg?s=128&g=1'),(7384,6,'2014-11-01T20:50:02.667','Patz',NULL,'2014-11-10T20:18:07.953',NULL,NULL,NULL,NULL,0,0,0,5266241,NULL),(7385,1,'2014-11-01T22:13:51.810','Alex Mitrevski',NULL,'2016-10-21T13:35:42.920',NULL,NULL,NULL,NULL,0,0,0,1556115,NULL),(7386,101,'2014-11-02T04:11:57.070','CopperKettle',NULL,'2014-11-02T04:11:57.070','http://en.wiktionary.org/wiki/User:CopperKettle','Yekaterinburg, Russia',39,'<p>A freelance translator, born and living in Russia.</p>\n\n<p>Useful links:<br>\n<a href=\"http://meta.stackoverflow.com/editing-help\">StackExchange Markdown help</a>  </p>\n\n<p>\"Nothing more true than not to trust your senses; And yet what are your other evidences?\"</p>\n\n<p>To read up:<br>\n1. True Light Verb vs. Vague Action Verb<br>\n2. <a href=\"http://ell.stackexchange.com/tags/aspect/info\">aspect</a> - In English the perfect construction does not express perfective aspect; that is expressed by the simple past form.  The name perfect for the <em>HAVE</em>+past participle construction is a misleading historical accident.\n3. PEU 90 - be with auxiliary do (CGEL: \"lexical <em>be</em>\"; Quirk et al - ? )<br>\n4. Actionsart<br>\n5. NICE auxiliaries criteria: negation, inversion, emphasis and code.<br>\n6.  Quirk et al. p.839 - optative mood<br>\n7. <a href=\"https://en.wikipedia.org/wiki/Veridicality\" rel=\"nofollow\">Veridicality</a><br>\n8. I doubt this (all) <a href=\"http://ell.stackexchange.com/questions/38977/more-vs-the-more-i-doubt-this-the-more-because\">the more</a> - <strong>the</strong> <a href=\"http://english.stackexchange.com/questions/3944/what-are-sentences-like-the-longer-x-the-more-y-called-and-can-they-be-used-i/3945#3945\">as modifier or adverb</a></p>\n',0,0,0,3083107,'https://i.stack.imgur.com/qHvmd.jpg'),(7387,1,'2014-11-02T09:18:17.140','Stefan Mallia',NULL,'2015-04-25T19:28:01.823',NULL,NULL,NULL,NULL,0,0,0,5113799,'https://www.gravatar.com/avatar/f638816192e72f9d12ddaf76829bc43f?s=128&d=identicon&r=PG&f=1'),(7389,1,'2014-11-02T13:41:07.380','Reza Saidafkan',NULL,'2015-03-08T19:10:45.727',NULL,'Iran',30,NULL,0,0,0,1259578,'https://www.gravatar.com/avatar/4614418edf4dfd2c89f72c8cc0aa59eb?s=128&d=identicon&r=PG'),(7390,106,'2014-11-02T14:04:22.683','Mister Myst re',NULL,'2017-06-28T10:29:12.690',NULL,NULL,NULL,'<p>Young space mechatronics engineer</p>\n',0,2,0,153248,'https://i.stack.imgur.com/aDzqZ.gif'),(7391,1,'2014-11-02T23:56:37.157','vinaykumar',NULL,'2017-03-22T19:55:31.160','','Los Angeles, California',27,'<p>Robotics, Embedded Systems, Microcontrollers</p>\n',0,0,0,3596357,NULL),(7392,1,'2014-11-03T00:15:44.120','Walter Kuhn',NULL,'2014-11-03T00:15:44.120',NULL,NULL,NULL,NULL,0,0,0,5270208,'https://lh6.googleusercontent.com/-iBOrhJnE5us/AAAAAAAAAAI/AAAAAAAAAHM/pwpgzia99MA/photo.jpg?sz=128'),(7393,1,'2014-11-03T03:48:17.463','Alagon Granster',NULL,'2014-11-03T03:48:17.463',NULL,'Kyoto',28,'<p>A huge fan in artificial intelligence and literature.\nGonna improve my English as well...</p>\n',0,0,0,5270694,'https://www.gravatar.com/avatar/15dcb424646e6b39814ca7e1aa5165f2?s=128&d=identicon&r=PG&f=1'),(7394,1,'2014-11-03T07:16:08.437','rahul1193',NULL,'2014-11-03T07:16:08.437',NULL,'Kharagpur',24,NULL,0,0,0,4180586,'https://www.gravatar.com/avatar/9525d2346361e1c11f68ede119d2ef7c?s=128&d=identicon&r=PG&f=1'),(7395,101,'2014-