er for the <a href=\"http://brooklyn.incubator.apache.org/\" rel=\"nofollow\">Apache Brooklyn</a> project.</p>\n',0,1,0,33128,NULL),(7434,101,'2014-11-07T12:57:20.533','Unihedron',NULL,'2014-12-26T06:02:02.143','http://unihedro.github.io/','Earth, Alpha Centauri',NULL,'<p>08/12/16</p>\n',1,0,0,4451090,NULL),(7436,1,'2014-11-07T18:41:46.170','Michael ',NULL,'2017-07-23T18:09:56.443',NULL,NULL,NULL,NULL,0,0,0,2836910,'https://www.gravatar.com/avatar/5924f33095fd4f04a37f2db1f08a56da?s=128&d=identicon&r=PG&f=1'),(7437,97,'2014-11-08T05:29:51.213','ghosts_in_the_code',NULL,'2014-11-18T16:59:09.127',NULL,'New Delhi',16,'<p>Last updated: 9 April 2016, after 3 Nov 2015</p>\n\n<p><strong>A few things to know about me:</strong></p>\n\n<ol>\n<li><p>Im a school student.</p></li>\n<li><p>I sometimes write posts in a massive hurry, and often make careless mistakes.</p></li>\n<li><p>I have two objectives on this site:</p>\n\n<ul>\n<li>Learn more interesting things.</li>\n<li>Earn as much rep as possible. <em>I guess this objective has faded with time.</em></li>\n</ul></li>\n<li><p>I love this site (SE).</p></li>\n<li><p>Im waiting for the day this site makes a popular site worldwide, just like Wikipedia. Im also waiting for the day Puzzling becomes a full-fledged site (Its currently in Beta). <em>It seems that this will happen soon!</em></p></li>\n<li><p>I offer bounties quite often. As of today <s>(3 Nov 2015)</s>, I have <s>2015</s> 2370 rep in my account and <s>1250</s> 1750 rep in offered bounties on Puzzling SE.</p></li>\n</ol>\n\n<p><strong>What I am known for:</strong></p>\n\n<p>Simple questions which have no solution till date:</p>\n\n<p><em>Check out the list at <a href=\"http://meta.puzzling.stackexchange.com/questions/4399/list-of-bounties-with-no-deadlines\">http://meta.puzzling.stackexchange.com/questions/4399/list-of-bounties-with-no-deadlines</a> It is updated and more reliable.</em></p>\n\n<p><s>\nOn Puzzling SE (I can promise a minimum <strong>250 rep bounty</strong> for solving any of these five, or even improving on the current best score)</p>\n\n<ul>\n<li><a href=\"http://puzzling.stackexchange.com/questions/11780/sudoku-net-that-is-always-solvable\">http://puzzling.stackexchange.com/questions/11780/sudoku-net-that-is-always-solvable</a> (do better than 33)</li>\n<li><a href=\"http://puzzling.stackexchange.com/questions/9155/variant-of-lion-and-100-zebras\">http://puzzling.stackexchange.com/questions/9155/variant-of-lion-and-100-zebras</a> (find a formal proof)</li>\n<li><a href=\"http://puzzling.stackexchange.com/questions/9875/rigged-casino-that-prevents-pairs\">http://puzzling.stackexchange.com/questions/9875/rigged-casino-that-prevents-pairs</a> (do better than 17)</li>\n<li><a href=\"http://puzzling.stackexchange.com/questions/10769/maximize-chains-in-a-sudoku\">http://puzzling.stackexchange.com/questions/10769/maximize-chains-in-a-sudoku</a> (do better than 27)</li>\n<li><a href=\"http://puzzling.stackexchange.com/questions/10269/block-the-snake-from-reaching-points\">http://puzzling.stackexchange.com/questions/10269/block-the-snake-from-reaching-points</a> (no bounty for this one)</li>\n</ul>\n\n<p>On Math SE</p>\n\n<ul>\n<li><p><a href=\"http://math.stackexchange.com/questions/1268509/how-long-does-one-remain-in-the-square\">http://math.stackexchange.com/questions/1268509/how-long-does-one-remain-in-the-square</a></p></li>\n<li><p><a href=\"http://math.stackexchange.com/questions/1193615/probability-of-another-3-integers-with-same-sum-and-product-as-the-first-3-integ\">http://math.stackexchange.com/questions/1193615/probability-of-another-3-integers-with-same-sum-and-product-as-the-first-3-integ</a></p></li>\n<li><p><a href=\"http://math.stackexchange.com/questions/1129004/create-the-most-stressful-tennis-game-ever\">http://math.stackexchange.com/questions/1129004/create-the-most-stressful-tennis-game-ever</a>\n</s></p></li>\n</ul>\n\n<p><strong>Some things I would like:</strong> (Please ignore.)</p>\n\n<ol>\n<li><em>Total rep = Earned rep</em>, not <em>Total rep = Earned rep - Spent rep</em>. Spent rep should be accounted separately so that the bounties you put equal the rep you have earned. For example, if you have earned 2000 and spent 400, your total rep is still 2000 and your leftover spending rep is 1600.</li>\n</ol>\n\n<p><s>\n2. Id like the process of creating a new site (Private and Public Beta) to be a bit faster. I cant understand one good reason why Puzzling SE should be called a beta site. Does beta mean there is something missing?</s></p>\n\n<p><em>3. I would like the question ban on me on Meta SE to be removed. I know SE doesnt handle such requests manually, but I do believe I deserve another chance, after all, its been over a year. Moreover, I have asked more good questions than bad on the site-specific metas.</em></p>\n',0,0,0,4377344,'https://www.gravatar.com/avatar/03a5a4e159e8bdc13e009eb507e916d2?s=128&d=identicon&r=PG&f=1'),(7438,101,'2014-11-08T20:15:22.590','Deduplicator',NULL,'2015-12-25T04:26:40.647',NULL,NULL,NULL,NULL,0,1,0,3868683,'https://www.gravatar.com/avatar/72fe23156f94de243c9985aaec857e5d?s=128&d=identicon&r=PG&f=1'),(7439,101,'2014-11-08T22:18:41.280','JamCon',NULL,'2014-11-08T22:18:41.280','http://bailiwick.io','Cincinnati, OH',42,'<p>Interests include: Distributed computing, natural language processing, machine learning</p>\n\n<h1>SOreadytohelp</h1>\n',0,0,0,2368347,'https://i.stack.imgur.com/JoUzN.gif?s=128&g=1'),(7440,1,'2014-11-09T01:52:40.243','Brayton',NULL,'2014-11-09T01:52:40.243',NULL,'Gold Coast,Australia',NULL,'<p>Hi, Im Brayton, an Australian High School student. \nDepending upon my mood, surroundings and previous days, my interests will vary, though some leitmotif include Buddhism, Science(especially Physics), strategy games and Maths.\nI hope to study some combination of Maths, Physics and Computing at Uni in 2017. \nThe miraculous marvel of Human conscious is pretty awesome too. \nJust considering the whole \"86B neurons lending itself to <em>this</em>...\", yeah, I like thinking about that. </p>\n\n<p>Im currently trying to learn the basics of LaTeX.\nI have a fondness for Python, though my skills are underdeveloped. </p>\n\n<p>My immediate mathematical endeavor is exploring the low hanging fruit of Category Theory</p>\n',0,0,0,3021886,NULL),(7441,133,'2014-11-09T02:17:16.063','Klik',NULL,'2017-08-15T16:07:20.233',NULL,NULL,NULL,NULL,0,2,0,1502793,'https://www.gravatar.com/avatar/f09da7bd9ee09af592d7d6a64b9dbc8a?s=128&d=identicon&r=PG'),(7442,173,'2014-11-09T04:30:23.920','David Lechner',NULL,'2017-02-01T17:09:28.973','http://lechnology.com','Oklahoma',NULL,NULL,1,0,0,2242071,'https://www.gravatar.com/avatar/058022a25fc0d063e6e02548e2c7fd29?s=128&d=identicon&r=PG'),(7444,179,'2014-11-09T06:50:57.730','Kenneth .J',NULL,'2016-07-10T11:04:08.747',NULL,NULL,NULL,NULL,3,2,0,2595372,'https://www.gravatar.com/avatar/e7cce9a32d3afd5fcb77f0dbc565fe7d?s=128&d=identicon&r=PG'),(7445,1,'2014-11-09T07:53:27.330','col_ard',NULL,'2014-11-09T07:53:27.330',NULL,NULL,NULL,NULL,0,0,0,4620061,'https://www.gravatar.com/avatar/c3a45ecebcca41559f1e01a461a375d0?s=128&d=identicon&r=PG&f=1'),(7446,21,'2014-11-09T15:13:36.187','Saking',NULL,'2015-04-11T04:24:21.110',NULL,NULL,NULL,NULL,0,0,0,5304054,'https://www.gravatar.com/avatar/d8e2e448e3f3f61fd7d1229b46b5b543?s=128&d=identicon&r=PG&f=1'),(7447,1,'2014-11-09T19:23:59.570','LFITS',NULL,'2014-12-04T15:57:11.077','http://leonid-fot.info','Cologne, Germany',NULL,'<p>IT-Consulting, Solution Architecture, Service Management, Project Management, DevOps, UAV &amp; Robotics, Prototyping, Visual Design</p>\n',0,0,0,5305076,'https://i.stack.imgur.com/2S0zb.jpg?s=128&g=1'),(7448,1,'2014-11-09T22:54:54.703','Axiom_shuvo',NULL,'2014-11-09T22:54:54.703','http://www.axiomshuvo.com','Dhaka, Bangladesh',NULL,NULL,0,0,0,4730183,'https://i.stack.imgur.com/fvyWV.jpg?s=128&g=1'),(7449,101,'2014-11-10T04:02:17.140','Greg Miller',NULL,'2014-11-29T02:35:52.173',NULL,NULL,NULL,NULL,0,0,0,44623,'https://www.gravatar.com/avatar/3d5db3650db36f1a2661abb1912774b9?s=128&d=identicon&r=PG'),(7450,1,'2014-11-10T06:04:52.040','Christopher Schank',NULL,'2014-11-10T08:14:31.673',NULL,NULL,NULL,NULL,0,0,0,5302948,'https://i.stack.imgur.com/Sk0AY.png?s=128&g=1'),(7451,1,'2014-11-10T09:40:11.373','Zipporobotics',NULL,'2014-11-16T18:21:32.380','http://www.zipporobotics.com/','London, United Kingdom',NULL,NULL,0,0,0,4097922,'https://www.gravatar.com/avatar/a21d526768aebab0a1ed8e8d3864184a?s=128&d=identicon&r=PG&f=1'),(7452,103,'2014-11-10T11:34:18.150','Drew Noakes',NULL,'2014-11-10T18:23:22.553','https://drewnoakes.com','London, United Kingdom',NULL,NULL,0,2,0,12585,NULL),(7453,118,'2014-11-10T11:38:04.363','Willmore',NULL,'2015-08-05T04:00:50.423',NULL,'Lithuania',34,'<p><a href=\"http://hackhands.com/spookiecookie\" rel=\"nofollow noreferrer\"><img src=\"https://v41.imgup.net/button2c170.png\" /></a>\n<a href=\"https://www.youracclaim.com/badges/13f15801-c50b-43d0-88db-ba8f5eb51fb9/public_url\" rel=\"nofollow noreferrer\">\n<img src=\"https://acclaim-production-app.s3.amazonaws.com/images/9a059197-f042-430c-870b-edd629c10b31/oracle_associate.png\" width=\"75\" height=\"75\" alt=\"\"></a><img src=\"https://acclaim-production-app.s3.amazonaws.com/images/7b186204-144b-4d7c-99d2-fef259500220/e3b2ef746594ace57b855a3aed8adc9f831dc09d.png\" width=\"75\" height=\"75\"/><a href=\"http://www.ticklingistorture.org\" rel=\"nofollow noreferrer\"><img src=\"https://www.internationalanimalrescue.org/sites/default/files/styles/large/public/Tickling%20Logo.PNG?itok=p6ZroOdB\" width=\"85\" height=\"75\" /></a></p>\n',0,1,0,1927754,'https://i.stack.imgur.com/OiS8P.jpg?s=128&g=1'),(7454,101,'2014-11-10T14:48:46.210','dotancohen',NULL,'2015-04-30T09:23:57.173','http://dotancohen.com',NULL,40,'<p>I currently develop and support the backends of a few LAMP-stack based web applications for BSS (Business Support Services) that my company specializes in.</p>\n\n<p>I have experience in software project management, business process development, and I ran a software development business for a short time (actually twice). I have been using <a href=\"http://stackoverflow.com/questions/tagged/php\">PHP</a> since 1998 or 99, and Im reasonably competent in the associated client-side technologies, especially <a href=\"http://stackoverflow.com/questions/tagged/javascript\">Javascript</a>. I find myself using <a href=\"http://stackoverflow.com/questions/tagged/python\">Python</a> often, mostly for my own personal projects, Im quite poetic in <a href=\"http://stackoverflow.com/questions/tagged/vim\">VIM</a>, and of course <a href=\"http://stackoverflow.com/questions/tagged/git\">Git</a> has been a cornerstone of my development for about three or four years.</p>\n\n<p>Lately I have been experimenting with machine learning, mostly with <a href=\"http://scikit-learn.org/\" rel=\"nofollow\">scikit-learn</a>.</p>\n\n<h1>SOreadytohelp</h1>\n',0,11,0,138391,NULL),(7455,101,'2014-11-10T19:53:55.680','Chris S',NULL,'2014-11-10T19:53:55.680','http://stoneyforest.net','Grand Rapids, MI',36,'<p>Hello, my name is Chris. Im a husband, father, and son; work as a <a href=\"http://nuwavepartners.com\" rel=\"nofollow\">Systems Engineer</a>; and help my friends and family at every opportunity. Perhaps its best to leave this short, and say Im someone whos glad to meeting you and hope I can help with whatever technology problems you may be facing.</p>\n\n<p>Im a Windows and Cisco Engineer by day; but my first passion is <a href=\"http://freebsd.org\" rel=\"nofollow\">FreeBSD</a> and Open Source Software. I <a href=\"http://freebsdfoundation.com/donate\" rel=\"nofollow\">put my money where my mouth is</a> on a quarterly basis. Im inspired everyday by my peers, their abilities, drive, and passion for competent applications of technology and supporting operationals. As a <a href=\"http://typelogic.com/intj.html\" rel=\"nofollow\">Myers-Briggs INTJ</a> and <a href=\"https://www.discinsights.com/whatisdisc#c\" rel=\"nofollow\">DISC C/D</a> I value Quality highly and at times can be a purist. Incomplete jobs are loans with high interest (see <a href=\"http://en.wikipedia.org/wiki/Technical_debt\" rel=\"nofollow\">Technical Debt</a>).</p>\n',0,0,0,74476,NULL),(7456,101,'2014-11-10T20:43:21.160','K. Brian Kelley',NULL,'2014-11-10T20:43:21.160','http://www.truthsolutions.com','Columbia, SC',43,'Brian is a SQL Server author, columnist, and Microsoft MVP focusing primarily on SQL Server security. He currently serves as a database administrator / architect for AgFirst Farm Credit Bank. He formerly served as a systems and security architect for AgFirst Farm Credit Bank where he worked on Active Directory, Windows security, VMware, Citrix, and of course, SQL Server. In the technical community, Brian is part of the Midlands PASS Chapter, an official chapter of PASS, where he currently serves as president. Brian is also a junior high youth minister at Spears Creek Baptist Church in Elgin, SC. ',0,0,0,14224,'https://www.gravatar.com/avatar/70351e44f031f245f8e822897ea2fadd?s=128&d=identicon&r=PG'),(7457,1,'2014-11-10T22:32:10.283','user3805290',NULL,'2016-09-03T17:57:07.067',NULL,NULL,NULL,NULL,0,0,0,4701939,'https://www.gravatar.com/avatar/d2aaf6c2d97b913fe859d0a595918b5b?s=128&d=identicon&r=PG&f=1'),(7458,1,'2014-11-10T22:54:31.803','Richard Sim',NULL,'2014-11-10T23:25:18.410',NULL,NULL,NULL,NULL,0,0,0,5291806,'https://www.gravatar.com/avatar/752c7af0159917cdbc653335edcee0f8?s=128&d=identicon&r=PG&f=1'),(7459,101,'2014-11-11T02:54:01.453','Kahini Wadhawan',NULL,'2014-12-09T01:51:57.147',NULL,NULL,28,'<p>Software Developer(Java)</p>\n',0,0,0,1138832,'https://i.stack.imgur.com/6C2MA.jpg'),(7460,101,'2014-11-11T05:12:50.767','Andrew Mao',NULL,'2014-11-18T01:49:59.457','http://www.andrewmao.net','New York, United States',30,'<p>Researcher at Microsofts New York City lab.</p>\n\n<p>See some of my public work: <a href=\"https://github.com/mizzao\" rel=\"nofo