d my knowledge in the fields of Computer vision, Embedded Systems, Pattern Recognition, Signal Processing and Machine Learning. At the same time, I was able to obtain good analytical and research skills, which provides me with theoretical as well as practical insights into issues related to Computer Science. During these years I developed high skills in software development, using high or low level languages, with particular emphasis to embedded systems programming and micro-controllers. My recent field of interest is in Deep Learning techniques in Computer Vision applications.</p>\n\n<p>Portfolios :\n-- <a href=\"https://github.com/kmonachopoulos\" rel=\"nofollow noreferrer\">https://github.com/kmonachopoulos</a> --\n-- <a href=\"https://gist.github.com/kmonachopoulos\" rel=\"nofollow noreferrer\">https://gist.github.com/kmonachopoulos</a> --</p>\n',2,0,0,2560060,'https://i.stack.imgur.com/dzFjL.png?s=128&g=1'),(7658,11,'2014-12-10T22:22:53.277','Master Chief',NULL,'2014-12-10T22:22:53.277',NULL,NULL,NULL,NULL,0,0,0,5467330,'https://i.stack.imgur.com/neg7m.jpg'),(7659,6,'2014-12-11T02:11:22.353','Doug Marsden',NULL,'2014-12-11T02:11:22.353',NULL,NULL,NULL,NULL,0,0,0,5468007,NULL),(7660,101,'2014-12-11T07:55:51.967','Micha  Walenciak',NULL,'2014-12-11T07:55:51.967',NULL,'Poland',31,'<p>C++ programmer, linux user and open source enthusiast.</p>\n',0,0,0,1944205,'https://i.stack.imgur.com/PqPOy.png?s=128&g=1'),(7661,1,'2014-12-11T10:02:46.620','ReactByte',NULL,'2014-12-11T10:02:46.620',NULL,NULL,NULL,NULL,0,0,0,5469584,'https://www.gravatar.com/avatar/9df827d2bcb87e6bd2c1dc4d8179e458?s=128&d=identicon&r=PG&f=1'),(7663,101,'2014-12-11T11:42:51.393','Ragesh S',NULL,'2017-08-07T15:43:28.503',NULL,'Kochi, India',NULL,'<p><strong>Welcome</strong>, my name is Ragesh. I am a software developer from Cochin India who loves to write software to build great products and help businesses succeed with their goals. \nI really encourage good design and I am seeing its importance more