>By day:</strong> I like jumping up and down on tile floors and junk like that.</p>\n\n<p><strong>By not day:</strong> I usually sleep quite soundly, thank-you-very-much for asking.</p>\n\n<p>To my knowledge, Ive only been banned from chat once, so I would consider myself a law abiding citizen.\nBtdubs im writing a blog about logic bricks, so check it out (its not done yet) <a href=\"https://vincentscalia.wordpress.com/\" rel=\"nofollow\">https://vincentscalia.wordpress.com/</a></p>\n\n<p>I could write a different bio for each stack-exchange site that I participate in, but its more fun to do it this way:</p>\n\n<p>Blender: ive been using blender for about a year, and i really like the game engine and the grease pencil.\n<a href=\"http://i.stack.imgur.com/Yyfog.gif\" rel=\"nofollow\"><img src=\"http://i.stack.imgur.com/Yyfog.gif\" alt=\"raindrop\"></a></p>\n\n<p>Sciencefiction/fantasy: i do starwars. thats pretty much it.\nSometimes DR. Who also, but only when im in the mood.</p>\n\n<p>Engineering: you guys suck. (just kidding, youve actually helped alot. :)\n<a href=\"http://i.stack.imgur.com/NoGfp.gif\" rel=\"nofollow\"><img src=\"http://i.stack.imgur.com/NoGfp.gif\" alt=\"enter image description here\"></a></p>\n\n<p>English language learners: I natively speak american. No, that is not the same as english.\n<a href=\"http://i.stack.imgur.com/98M9O.gif\" rel=\"nofollow\"><img src=\"http://i.stack.imgur.com/98M9O.gif\" alt=\"enter image description here\"></a> </p>\n\n<p>and somemore gifs, jus cause:</p>\n\n<p><a href=\"http://i.stack.imgur.com/H2Zab.gif\" rel=\"nofollow\"><img src=\"http://i.stack.imgur.com/H2Zab.gif\" alt=\"enter image description here\"></a>\n<a href=\"http://i.stack.imgur.com/3yyXC.gif\" rel=\"nofollow\"><img src=\"http://i.stack.imgur.com/3yyXC.gif\" alt=\"enter image description here\"></a></p>\n',1,3,0,5141110,'https://i.stack.imgur.com/Wj1Fw.png'),(7673,1,'2014-12-12T19:55:34.927','svdc',NULL,'2015-04-21T10:59:43.337',NULL,NULL,NULL,NULL,1,0