nt at (can do quite a few things, and at least a few higher level things, including: guis, ribbons(xml), graphics, audio, system control operations (with out causing any errors)):</p>\n\n<p>C++ | C# | Visual Basic | Visual Basic.net | VBA | Java | Python |</p>\n\n<hr>\n\n<p>Languages I am able to code in on a moderate level (can do guis, ribbons(xml), basic applications,):</p>\n\n<p>VBScript | JavaScript | C | MEL (\"Autodesks\" \"Maya\" language) | MAXSCRIPT (\"Autodesks\" \"3DS Max\" language) | PHP | PEARL | RUBY | UNITY | SQL |</p>\n\n<hr>\n\n<p>Languages and Concepts I have Experienced only a little bit (not able to answer anything that is not basic):</p>\n\n<p>XML | XAML | HTML | CSS | LUA | Game Maker Language | Delphi | BOO | BASIC | BERTRAND | MATHML |</p>\n',0,0,0,5476151,'https://www.gravatar.com/avatar/a63c858115ab57c6c614de6317b0af14?s=128&d=identicon&r=PG&f=1'),(7706,1,'2014-12-17T02:53:29.497','Carl',NULL,'2014-12-17T02:53:29.497',NULL,NULL,NULL,NULL,0,0,0,5386113,'https://www.gravatar.com/avatar/814d8a8c44d4b6a5d69c05f890525a2c?s=128&d=identicon&r=PG&f=1'),(7707,126,'2014-12-17T07:23:33.897','Zeph',NULL,'2015-12-31T02:11:04.617',NULL,'1 hr north of San Francisco, CA',NULL,'<p>Long time bit twiddler</p>\n',0,0,0,4383835,'https://www.gravatar.com/avatar/3a9d34619bb65e7f992dc0598f4b19ae?s=128&d=identicon&r=PG&f=1'),(7708,1,'2014-12-17T10:33:25.143',' ukasz Specja ',NULL,'2017-08-24T17:40:50.967',NULL,NULL,NULL,NULL,0,0,0,5035146,'https://lh5.googleusercontent.com/-rQw5wA9MbDM/AAAAAAAAAAI/AAAAAAAABvA/fNwZJ-k9cQs/photo.jpg?sz=128'),(7709,136,'2014-12-17T14:04:59.520','John',NULL,'2015-12-25T23:54:21.207',NULL,NULL,NULL,NULL,2,0,0,3034837,'https://www.gravatar.com/avatar/80f61b8a19222d2053c8acdaa18456c8?s=128&d=identicon&r=PG'),(7710,101,'2014-12-17T15:33:27.483','davidbates',NULL,'2014-12-17T17:36:21.337','http://dlbates.com','Greensboro, NC',35,'<p>David Bates has been hacking hardware and software for over 20 years, starting with a pioneering project for Dow Corning and IBM involving software controlled robotic arms. He has since become proficient in a dozen languages and APIs; has programmed on just about every type of device phone, desktop, and embedded devices; and is currently lead developer for a leading manufacturer of IC products. He is well-known in the community for using tools such as Arduino and Netduino to hack everyday objects, transforming them into something fun. He has conducted extensive research into hacking the Kinect to expand its applications in computer control, robotics, security, and related markets.</p>\n',0,3,0,1262314,'https://www.gravatar.com/avatar/0a3becc4991bf3095778b798a3408ab1?s=128&d=identicon&r=PG'),(7711,11,'2014-12-17T17:13:35.897','fady basem',NULL,'2014-12-17T23:35:44.830',NULL,NULL,NULL,NULL,1,0,0,5502259,NULL),(7712,1,'2014-12-17T20:13:58.330','Dmitry Yershov',NULL,'2016-04-08T13:31:33.037',NULL,NULL,NULL,NULL,0,0,0,5501849,'https://www.gravatar.com/avatar/f17fe510b3b4e9a9dc7cb437c1b9e909?s=128&d=identicon&r=PG&f=1'),(7713,101,'2014-12-17T20:53:00.367','Mast',NULL,'2015-11-26T10:48:01.687',NULL,'Netherlands',NULL,'<p>Mostly active on <a href=\"http://codereview.stackexchange.com\">Code Review</a> and I can usually be found in their chat (<a href=\"http://chat.stackexchange.com/rooms/8595/the-2nd-monitor\">The 2nd Monitor</a>).</p>\n\n<p>My preferred languages are C++ and Python (2.7), but Ive dabbled in quite some others on the side.</p>\n',0,4,0,999385,'https://i.stack.imgur.com/990x8.jpg?s=128&g=1'),(7714,1,'2014-12-17T23:44:58.573','Sriram',NULL,'2014-12-17T23:44:58.573',NULL,NULL,NULL,NULL,0,0,0,3517987,'https://www.gravatar.com/avatar/2d205e8b0a71cbf194b0bd90c7398cf8?s=128&d=identicon&r=PG&f=1'),(7715,1,'2014-12-18T03:24:38.007','Paula',NULL,'2016-01-27T20:31:43.123',NULL,'Cambridge, MA, United States',NULL,'<p>Student at MIT</p>\n',0,0,0,5503258,'https://www.gravatar.com/avatar/9b28bc46477586881c453fe6e2015048?s=128&d=identicon&r=PG&f=1'),(7716,1,'2014-12-18T11:32:13.