ue? N o importa o que voc  fa a, nunca vai parecer mais do que uma m sera gota num oceano infinito..</p>\n\n<p>-- O que   o oceano, se n o uma infinidade de gotas?\" </p>\n\n<p>(Cloud Atlas)</p>\n\n<blockquote>\n  <p>Algumas regras para a vida:</p>\n  \n  <ul>\n  <li>Questione a autoridade.</li>\n  <li>Nenhuma ideia   verdadeira s  porque algu m diz que  , incluindo eu.</li>\n  <li>Pense por si pr prio, questione a si pr prio.</li>\n  <li>N o acredite em algo s  porque quer acreditar, acreditar em algo n o o torna verdadeiro.</li>\n  <li>Teste ideias pelas evidencias adquiridas, pela observa o e experimenta o.</li>\n  <li>Se uma ideia prevalecente falhar num teste bem desenvolvido, esta errada. Supere.</li>\n  <li>Siga as evid ncias onde quer que elas levem, se n o houver evid ncias, evite julgamento. E talvez a regra mais importante de\n  todas:</li>\n  <li>Lembre-se, voc  pode estar errado.</li>\n  </ul>\n</blockquote>\n\n<p>Neil deGrasse Tyson</p>\n',0,0,0,4890190,'https://i.stack.imgur.com/b4FrL.jpg?s=128&g=1'),(8888,3,'2015-01-16T13:14:10.140','An Orphan',NULL,'2015-01-27T19:30:32.793',NULL,NULL,NULL,NULL,0,0,0,5634427,'https://www.gravatar.com/avatar/d5d2a96811bcea2dc82db412372c4086?s=128&d=identicon&r=PG&f=1'),(8889,101,'2015-01-16T14:38:43.430','LvB',NULL,'2015-01-16T14:38:43.430',NULL,'The Netherlands',32,NULL,0,0,0,5522569,'https://www.gravatar.com/avatar/caabaf8621b43ab55ce89ef97099c3d9?s=128&d=identicon&r=PG&f=1'),(8890,1,'2015-01-16T18:57:56.880','Plaz',NULL,'2015-01-16T18:57:56.880',NULL,NULL,NULL,NULL,0,0,0,5637963,'https://www.gravatar.com/avatar/72b247f4b2a1983da95b1a6e39291fde?s=128&d=identicon&r=PG&f=1'),(8891,101,'2015-01-16T19:05:49.503','Juderb',NULL,'2015-12-12T05:36:49.430',NULL,NULL,NULL,NULL,0,0,0,5017762,'https://www.gravatar.com/avatar/fb960f2df5c4505686ac88911d6bf712?s=128&d=identicon&r=PG&f=1'),(8892,1,'2015-01-16T19:09:03.577','AknorJaden',NULL,'2015-03-06T15:50:12.507',NULL,NULL,NULL,NULL,0,0,0,2515355,'https://www.gravatar.com/avatar