ticon&r=PG'),(9021,101,'2015-02-04T10:51:29.727','Bjarke Freund-Hansen',NULL,'2017-07-29T09:10:09.603',NULL,'Denmark',NULL,NULL,0,0,0,29974,'https://www.gravatar.com/avatar/af71f16ab6f9b3ea889fd65429734650?s=128&d=identicon&r=PG'),(9022,103,'2015-02-04T12:11:05.477','David Pfeffer',NULL,'2015-03-10T16:09:29.087','http://www.bytenik.com/','New Jersey',31,'<p><a href=\"http://www.funnelfire.com/\" rel=\"nofollow\">Im the CTO of the startup company FunnelFire</a>, where we build a sophisticated real-time sales intelligence platform. <a href=\"http://www.stevens.edu/compsci/people/faculty_profile.php?faculty_id=1692&amp;DavidPfeffer\" rel=\"nofollow\">Im also an adjunct professor of Computer Science at Stevens Institute of Technology</a>, where I teach a variety of courses from Introduction to C++11, to Data Structure and Algorithms, to TCP/IP Networking (an advanced programming course where students re-implement the network stack).\n<br/><br/>\nI graduated in 2009 from Stevens Institute of Technology with a bachelors and masters of science in Computer Science, a minor in Law &amp; Public Policy, and graduate certificates in Computer Systems, Databases &amp; Service Oriented Architecture, Distributed Systems, Enterprise Computing, Quantitative Software Engineering, and Service Oriented Computing.\n<br/><br/>\nI got my start programming at a very young age, writing QBasic programs to display colorful circles on the screen while sitting on my dads lap when I was 3 years old. My first big projects were a Super Mario World clone for GameBoy, a MUD called HybridMOO, and a home automation package called IntellHome (which I still use!).\n<br/><br/>\nIm actively involved in a number of open source initiatives, including an open-source middleware tool called PushoverQ.\n<br/><br/>\nI am interested in hiking, exploration of abandoned or neglected sites and buildings, photography (particularly of those abandoned sites, but also glamour/editorial), cooking, snowshoeing, and New Jer