without any sacrifice of quality and robustness. Design and automation are keys to achieve this goal: thoughtful upfront system design makes software easier to extend and maintain whereas automation is essential to eliminate defects that are inherent in any complex system. </p>\n\n<p>But my quest has not finished yet: Functional Programming paradigm has taught me why current state-of-the-art of software development produces fragile systems. Continuous study in functional languages such as erlang and ocaml brings me both joy of learning and practical insight into building better software.</p>\n',0,0,0,23249,'https://i.stack.imgur.com/vHpI7.jpg?s=128&g=1'),(9281,113,'2015-03-14T05:34:10.563','KalleMP',NULL,'2015-11-03T23:50:41.337',NULL,'Lahti, Finland',50,'<p>Electrical engineer interested in old technology and new stuff.  The list includes letterpress printing, relief prints, analogue and alternative photography, Laser engravers and cutters, 3D printing, HAM radio, weaving, chemistry, X-rays and stuff.</p>\n\n<p>Work experience is digital communications.</p>\n\n<p><em>Marv Mills</em> wrote a poem for me on ELU, to cheer me up, when I had asked a question in the wrong place, I copy it and others here because the question and answers may go away.</p>\n\n<p>There once was a Poster did dare,<br>\nAsk for rhyming with Pear, Pair and Pare.<br>\nBut Edwin chastised,<br>\nThe OP was denied,<br>\nAnd the rhyming did not appear there.     </p>\n\n<p>He also had a go at the original question proper with </p>\n\n<p>Said the peer who pares pears it appears,<br>\nthat while paring your pears on a pier,<br>\nif preparing to pare,<br>\nor just pairing a pear,<br>\nat your pairs and your pears you must peer.    </p>\n\n<p><em>Mark Banister</em> came up with this one</p>\n\n<p>There once was a Finnish au pair,<br>\nWho sliced two fruits on a dare,<br>\nHer host was a lord,<br>\nSo she took a sharp sword,<br>\nThen that au pair pared a peers pear pair.   </p>\n\n<p><em>Papa Poule</em> suggested trying the following after some drinks<br>\nThe pair of aux pairs in Paris repaired the pair of poorly pared pears and prepared and paired them nicely with a Dom-P r d avant-guerre.</p>\n',0,5,0,4868463,'https://i.stack.imgur.com/yNu5Z.png'),(9282,101,'2015-03-14T11:00:54.347','TV Mohini',NULL,'2015-03-14T11:00:54.347',NULL,NULL,NULL,NULL,0,0,0,5743870,'https://i.stack.imgur.com/FXKT6.jpg?s=128&g=1'),(9283,101,'2015-03-14T13:02:54.587','Florin',NULL,'2015-03-14T13:02:54.587','http://twitter.com/florin555','Cluj-Napoca, Romania',29,'<p>Trying to improve</p>\n',0,4,0,126739,'https://www.gravatar.com/avatar/ff8f916c7e4acf155fa491f226aa111c?s=128&d=identicon&r=PG'),(9284,1,'2015-03-14T20:07:36.943','Andrew',NULL,'2017-06-12T18:11:14.140',NULL,NULL,NULL,NULL,0,0,0,1310179,'https://www.gravatar.com/avatar/f24e39a21cd42e5eb10422bce5e47d8e?s=128&d=identicon&r=PG'),(9285,101,'2015-03-14T20:26:23.143','greenoldman',NULL,'2015-03-14T20:26:23.143','http://aboutskila.wordpress.com/',NULL,NULL,'<p>I am interested in such topics: </p>\n\n<ul>\n<li>usability and accessibility of user interfaces,  </li>\n<li>design of programming languages,  </li>\n<li>natural language processing,  </li>\n<li>machine translation, </li>\n<li>data mining.</li>\n</ul>\n\n<p>Currently I am developing compiler and programming language Skila -- read more at <a href=\"http://aboutskila.wordpress.com/\" rel=\"nofollow\">aboutskila.wordpress.com</a>.</p>\n',0,2,0,72937,'https://www.gravatar.com/avatar/7412dfe0e7374347dda68aff0c4943fa?s=128&d=identicon&r=PG'),(9286,1,'2015-03-14T21:00:28.670','Dhruv Kakadiya',NULL,'2016-12-13T01:46:56.307',NULL,'San Jose, CA, United States',NULL,NULL,0,0,0,5173057,'https://lh5.googleusercontent.com/-Yk4V-giXVy8/AAAAAAAAAAI/AAAAAAAAASY/PVv-Xgv7rsQ/photo.jpg?sz=128'),(9287,101,'2015-03-15T00:09:59.383','alainlompo',NULL,'2015-03-15T00:09:59.383',NULL,NULL,NULL,NULL,0,0,0,5601774,'https://i.stack.imgur.com/iV5TX.jpg?s=128&g=1'),(9288,1,'2015-03-15T19:35:59.760','Robert Forbes',NULL,'2015-03-15T23:40:53.293','http://www.roboticdinosaur.co.uk','London, United Kingdom',35,'<p>Web Designer/Developer, Mr Nobody with an opinion on the internet. I am RoboticDinosaur</p>\n',0,0,0,3042528,'https://i.stack.imgur.com/PuOAC.jpg'),(9289,101,'2015-03-15T22:01:34.857','John Max',NULL,'2015-03-15T22:01:34.857',NULL,NULL,NULL,'<p>Only God can make someone CEO of several Organizations. For It does not, therefore, depend on human desire or effort, but on Gods mercy (Rom 9:16).\nTo God be all the Glory.</p>\n',0,0,0,3261671,'https://graph.facebook.com/100004005747278/picture?type=large'),(9290,1,'2015-03-16T01:49:55.963','anjchang',NULL,'2015-03-16T01:49:55.963','http://anjchang.com','Boston, MA, United States',NULL,'<p>interested in sharing and tinkering with code.</p>\n',0,0,0,1394251,NULL),(9291,101,'2015-03-16T02:19:19.197','COLD ICE',NULL,'2017-07-11T11:46:21.133',NULL,NULL,NULL,'<p>Say Hi, I dont bite ;)</p>\n',0,3,0,1369238,'https://www.gravatar.com/avatar/5689ee3113b5786b16b968b50c89fe38?s=128&d=identicon&r=PG'),(9292,101,'2015-03-16T02:48:34.383','lopezdp',NULL,'2017-08-16T18:42:45.907','http://www.davidplopez.com','Miami, FL',NULL,'<p>\"Joel on Software\". Great read.</p>\n',0,0,0,4803457,'https://i.stack.imgur.com/bZ24O.jpg?s=128&g=1'),(9293,1,'2015-03-16T04:08:17.043','Yang Wang',NULL,'2015-03-16T04:08:17.043',NULL,NULL,NULL,NULL,0,0,0,5945106,'https://www.gravatar.com/avatar/9b93dca799fbf01c34a3bfbbf3f82d81?s=128&d=identicon&r=PG&f=1'),(9294,1,'2015-03-16T19:18:50.580','Naman91',NULL,'2015-12-25T19:25:40.533',NULL,NULL,NULL,NULL,0,0,0,2934513,NULL),(9295,101,'2015-03-16T20:19:07.613','kleineg',NULL,'2017-06-28T21:31:49.423','http://www.linkedin.com/pub/eli-klein/52/606/596/',NULL,NULL,'<p>Eli Klein works as a data analyst for a small veteran owned company which supports the Clean Air Markets Division of the United States Environmental Protection Agency by completing contracts with alacrity and a high level of domain knowledge and professional integrity. </p>\n\n<p>He believes that the ability to combine computer based simulation modeling with data analysis helps drive policy decisions and business needs, and that his skills and the work he puts into honing them makes him well placed to be able to assist his customer directly increase performance. </p>\n\n<p>He is committed to continuous improvement and lifelong learning, whether by perusing and obtaining higher education, participating in many communities at StackOverflow, reading books and blogs about programming and data analysis, and taking free online courses in those same fields.</p>\n\n<p>Eli strongly believes that people in technical fields should hold to a code of ethics, especially in what they produce and how it benefits society. He upholds that ideal by striving to improve societys well being. He is committed to guarding against unintended consequences by considering all the stakeholders, the life cycle of the project, performing risk analysis, and performing through testing to minimize errors. And he is careful to consider his impact on the social structure of the workplace and society, seeking to improve and make it welcoming.</p>\n',0,1,0,3832470,NULL),(9296,1,'2015-03-16T22:21:55.930','andrewhunter',NULL,'2015-03-16T22:21:55.930',NULL,'Connecticut',27,NULL,0,0,0,5269855,'https://i.stack.imgur.com/m9ref.jpg?s=128&g=1'),(9298,111,'2015-03-17T09:46:20.753','Aphire',NULL,'2017-07-27T15:32:05.423',NULL,'Uk',27,'<h1>SOreadytohelp</h1>\n',5,1,0,4070161,'https://i.stack.imgur.com/CR12b.jpg?s=128&g=1'),(9299,1,'2015-03-17T14:52:08.373','per thoresson',NULL,'2015-03-17T14:52:08.373',NULL,'Sydney',41,NULL,0,0,0,5948690,'https://i.stack.imgur.com/MDPsC.jpg?s=128&g=1'),(9300,1,'2015-03-17T14:56:37.730','Greg',NULL,'2015-04-02T08:08:46.263',NULL,NULL,NULL,NULL,0,0,0,5174608,'https://www.gravatar.com/avatar/1e98ae91dc015c446c4052ba69b34727?s=128&d=identicon&r=PG&f=1'),(9301,101,'2015-03-17T18:55:14.893','ModularSynth',NULL,'2016-06-07T11:53:20.200',NULL,'Electric City, Washington, Stati Uniti',NULL,'<h1>SOreadytohelp</h1>\n\n<hr>\n\n<p>Im writing programs since <code>1984</code>.  </p>\n\n<p>I started with MSX Basic, then QuickBasic (and also AmigaBasic, then AMOS) and then VB.\nFinally I embraced <strong>VB.NET</strong> (Im an <code>MCP</code>).</p>\n\n<p>Im developing on <strong>Android</strong> since 2010.</p>\n\n<hr>\n\n<p>I like playing with <strong>Arduino</strong>. Mostly:</p>\n\n<ul>\n<li>Small <strong>Robots</strong>  </li>\n<li><strong>Synthesizers</strong> and  </li>\n<li><strong>Sequencers</strong>   </li>\n<li>...</li>\n</ul>\n\n<hr>\n\n<p>Since 2014 I fell in love with <strong>Blender 3D</strong> and Im developing an ever growing passion for this open source and very powerful 3D graphics software.</p>\n\n<hr>\n\n<p>Recently, Ive been trapped into the really expensive but amazingly fun world of <code>Modular Synthesizers</code> (I choosed the popular <strong>Eurorack</strong> format)...<br>\n<code>Generative Music</code> is now my obsession.</p>\n',0,3,0,3131299,'https://i.stack.imgur.com/n2t7K.png?s=128&g=1'),(9302,116,'2015-03-17T19:30:46.873','Tob',NULL,'2017-04-04T19:18:53.683','http://-','Germany',36,'<p>Active PMP</p>\n\n<p>Open source SW projects:\n<ul>\n<li>https://sourceforge.net/projects/jacond/</li>\n<li>https://sourceforge.net/projects/httpplayer/</li>\n<li>https://sourceforge.net/projects/knxhsd/</li>\n</ul></p>\n',0,1,0,3275697,'https://i.stack.imgur.com/iGvgT.jpg?s=128&g=1'),(9303,3,'2015-03-18T01:19:51.407','Max Isom',NULL,'2016-01-07T18:45:00.293','http://bacccon.com',NULL,17,'<p>Coder and developer.</p>\n',0,0,0,2441373,NULL),(9304,101,'2015-03-18T07:14:49.990','Kaya311',NULL,'2016-07-24T07:44:18.637',NULL,NULL,NULL,NULL,0,0,0,3042644,'https://www.gravatar.com/avatar/2ba75d8569792e3cf4cc827840d8f760?s=128&d=identicon&r=PG&f=1'),(9305,122,'2015-03-18T09:36:27.033','Nur',NULL,'2015-11-11T09:55:58.470',NULL,'Indonesia',25,'<p>Im using 13.10 32 bit right now. Using Ubuntu for daily needs.</p>\n',0,2,0,2247129,'https://i.stack.imgur.com/bk2V0.jpg?s=128&g=1'),(9306,101,'2015-03-18T11:29:24.413','3kstc',NULL,'2017-02-23T02:47:56.010',NULL,NULL,NULL,'<p>Robotics and Mechatronics Engineer</p>\n',0,0,0,5699451,'https://i.stack.imgur.com/UXiNf.png'),(9307,1,'2015-03-18T12:28:25.773','Faris',NULL,'2015-03-19T09:45:30.923',NULL,NULL,NULL,NULL,0,0,0,5679723,'https://www.gravatar.com/avatar/3c43808827a0c476f3744e664ddebddd?s=128&d=identicon&r=PG&f=1'),(9308,1,'2015-03-18T17:00:09.563','Muhammad Turawa',NULL,'2015-03-18T17:00:09.563',NULL,NULL,NULL,NULL,0,0,0,4570870,'https://lh5.googleusercontent.com/-wz8QLl8tujo/AAAAAAAAAAI/AAAAAAAADcI/Coee_tWf9cM/photo.jpg?sz=128'),(9309,1,'2015-03-18T17:07:02.457','verdery',NULL,'2017-02-26T12:37:45.780',NULL,NULL,NULL,NULL,0,0,0,945168,'https://i.stack.imgur.com/48xBa.png?s=128&g=1'),(9311,191,'2015-03-18T19:23:44.130','Ali',NULL,'2015-10-09T17:46:06.180',NULL,NULL,NULL,NULL,0,4,0,2815644,'https://www.gravatar.com/avatar/6d59debad28bdfbab44ea28afb881277?s=128&d=identicon&r=PG'),(9312,1,'2015-03-18T19:29:38.177','BlueRebel',NULL,'2015-03-18T19:29:38.177',NULL,'Okemos, MI',38,NULL,0,0,0,2176031,'https://www.gravatar.com/avatar/064a6a16b3e6af85850edeb986a158c7?s=128&d=identicon&r=PG'),(9313,1,'2015-03-18T19:57:48.570','Soumya Prakash Mishra',NULL,'2015-03-18T19:57:48.570',NULL,NULL,NULL,NULL,0,0,0,5961740,'https://lh6.googleusercontent.com/-idnxekPQWbs/AAAAAAAAAAI/AAAAAAAAAIo/xddzDw_cAWU/photo.jpg?sz=128'),(9314,265,'2015-03-18T21:41:05.540','Ryan Loggerythm',NULL,'2017-06-20T01:10:36.083',NULL,NULL,NULL,'<pre><code>10  HOME\n20  SWEET\n30  GOTO 10\n</code></pre>\n',6,49,2,1535708,'https://i.stack.imgur.com/L78cF.jpg?s=128&g=1'),(9315,11,'2015-03-19T09:50:50.433','gerd',NULL,'2015-03-19T13:49:11.130',NULL,NULL,NULL,NULL,0,0,0,5965152,NULL),(9316,1,'2015-03-19T10:50:30.947','N Shaikh',NULL,'2015-03-19T10:50:30.947',NULL,NULL,NULL,NULL,0,0,0,5965273,'https://www.gravatar.com/avatar/0145481bd600520d28cca86ff457226f?s=128&d=identicon&r=PG&f=1'),(9317,118,'2015-03-19T11:15:05.247','dim_tz',NULL,'2017-06-29T18:10:55.690',NULL,NULL,NULL,NULL,0,3,0,1540760,'https://www.gravatar.com/avatar/5f80f0b81d0c3186a7be0e4ff372ffdd?s=128&d=identicon&r=PG'),(9318,101,'2015-03-19T13:52:13.417','Dave Newton',NULL,'2017-04-10T18:34:18.247','http://buckybits.blogspot.com','NY and NJ, United States',48,'<p>Ruby/JavaScript/Java/Groovy generalist; web, app, embedded, firmware.</p>\n\n<p>\"Microconsulting\" available: short-term, rapid turnaround for a variety of problem types. davelnewton at gmail dot com for details, quotes, etc.</p>\n\n<p>Get me something nice:</p>\n\n<ul>\n<li><a href=\"http://www.adafruit.com/wishlists/368289\" rel=\"nofollow\">Adafruit Wish List</a></li>\n<li><a href=\"https://www.sparkfun.com/wish_lists/37306\" rel=\"nofollow\">Sparkfun Wish List</a></li>\n<li><a href=\"http://www.makershed.com/apps/giftregistry/wishlist/1705\" rel=\"nofollow\">Maker Shed Wish List</a></li>\n<li><a href=\"https://www.pololu.com/wishlist/1J7719\" rel=\"nofollow\">Pololu Wish List</a></li>\n<li><a href=\"https://www.shapeways.com/designer/davelnewton/wishlist\" rel=\"nofollow\">Shapeways Wish List</a></li>\n<li><a href=\"http://amzn.com/w/2YPB5V3244FYW\" rel=\"nofollow\">Amazon Wish List</a></li>\n</ul>\n\n<p>Sometimes I write stuff:</p>\n\n<ul>\n<li><a href=\"http://buckybits.blogspot.com/\" rel=\"nofollow\">Bucky Bits</a> (general dev blog)  </li>\n<li><a href=\"http://twitter.com/#!/dave_newton\" rel=\"nofollow\">Twitter @dave_newton</a></li>\n<li><em><a href=\"http://codeaverse.blogspot.com/\" rel=\"nofollow\">Code.averse</a> (code elegance; nascent)</em></li>\n</ul>\n',0,0,0,195854,'https://i.stack.imgur.com/QouOz.jpg'),(9319,101,'2015-03-19T14:37:38.157','Christian Hummeluhr',NULL,'2015-03-19T14:37:38.157','http://hummeluhr.org','Department of Nonsense',30,'<p>Mercenary for the forces of evil by day, madman with a Notebook by night.</p>\n\n<blockquote>\n  <p> _( )_/  hey.</p>\n</blockquote>\n\n<p><strong>definitely the best words youll read today</strong></p>\n\n<ul>\n<li>Googles likes numbers and mauling small businesses. Keep that in mind.</li>\n<li>The  giant tiger land snail , also known as the  giant Ghana snail , is the largest land snail in the world.</li>\n<li>Dont feed the Notebook after midnight. Trust me. You really dont want to do that. </li>\n</ul>\n\n<blockquote>\n  <p> _( )_/  I push buttons. I turn dials. I read numbers. </p>\n  \n  <p> _( )_/  Sometimes I make up little stories in my head about what the numbers mean.</p>\n</blockquote>\n\n<p><strong>some more words I just thought of. writing them right down here</strong></p>\n\n<p>Im a former grad student in statistics and psychometrics, at the University of Groningen in the Netherlands. My research interests laid with the development and use of mathematical models of human behavior, and the role of memory as a theoretical bridge point between perception and action. While theres no love lost between institutional science and myself, I kept my unsavory love for Bayes factors and dynamical systems theory.</p>\n\n<blockquote>\n  <p> _( )_/  see you later alligator.</p>\n</blockquote>\n',0,0,0,2366269,NULL),(9320,1,'2015-03-19T16:09:44.090','pjshap',NULL,'2015-03-19T16:09:44.090',NULL,NULL,NULL,'<p>Focusing on NLP. Strongest programming languages are Python and Java. Also some experience with Matlab/Octave, C/C++, Haskell, SML, perl, and shell scripting.</p>\n',0,0,0,4789661,'https://www.gravatar.com/avatar/3ca5f585910c619a32ca103c41f046a9?s=128&d=identicon&r=PG&f=1'),(9321,33,'2015-03-19T17:34:23.500','Akshay Nagarajan',NULL,'2015-05-09T18:44:39.657',NULL,NULL,NULL,NULL,0,2,0,5785205,'https://lh3.googleusercontent.com/-8i8FSM3cDvk/AAAAAAAAAAI/AAAAAAAABWU/_6hDSfXF_mI/photo.jpg?sz=128'),(9322,24,'2015-03-19T18:31:12.140','Jack',NULL,'2015-06-06T00:14:40.717',NULL,NULL,NULL,NULL,0,0,0,5967976,NULL),(9323,101,'2015-03-20T05:05:19.170','bhavikkumar',NULL,'2015-03-20T05:05:19.170','http://androidpo