ou everywhere.\"</p>\n',0,0,0,5688235,'https://i.stack.imgur.com/03fub.jpg?s=128&g=1'),(9471,1,'2015-04-10T03:34:58.497','user71922',NULL,'2015-04-10T03:34:58.497',NULL,NULL,NULL,NULL,0,0,0,6114770,'https://www.gravatar.com/avatar/d72d8a3a44ebd5080cca6218ae12b735?s=128&d=identicon&r=PG'),(9472,1,'2015-04-10T06:56:07.953','Simon M. Laube',NULL,'2015-05-16T17:33:09.040','https://medium.com/@simon_m_laube','Austria',21,'<p>Im an electrical engineering student from Austria, who has been using LaTeX for about three years now. After my first week with LaTeX I got infected with\nthe TeX-virus and just about a year later, I started to write my first small packages.</p>\n\n<p>My greatest breakthrough so far has been a LaTeX template-package for the diploma project documentation for our school, which is now featured on <a href=\"http://www.ctan.org/pkg/etdipa\" rel=\"nofollow\">CTAN</a>. Ive also already taught about 100 people how to get started with LaTeX.</p>\n\n<p>Further Im involved in a project that aims to bring LaTeX into upper secondary schools, mainly in Austria. Its called <em>TeX4Schools</em> and started in 2015.</p>\n',0,0,0,5977621,'https://i.stack.imgur.com/2bCLn.png?s=128&g=1'),(9473,101,'2015-04-10T11:37:26.623','Ivan Bartsov',NULL,'2015-04-10T11:37:26.623',NULL,NULL,31,NULL,0,0,0,157752,'https://www.gravatar.com/avatar/95429ca3f85e6b0e9ac0ecd587c3cae3?s=128&d=identicon&r=PG'),(9474,11,'2015-04-10T12:35:46.407','Aaron Kracht',NULL,'2016-01-06T14:45:10.403',NULL,NULL,NULL,NULL,0,0,0,6119806,'https://www.gravatar.com/avatar/bab5aedd5a1736ec0a3d83cecdcb2395?s=128&d=identicon&r=PG&f=1'),(9475,1,'2015-04-10T12:49:51.237','JIoJIaJIu',NULL,'2015-04-10T12:49:51.237',NULL,NULL,NULL,NULL,0,0,0,224620,'https://www.gravatar.com/avatar/08f92cb5ad43d93785f49f1c732245f7?s=128&d=identicon&r=PG'),(9476,1,'2015-04-10T18:16:59.593','Josh K.',NULL,'2015-04-18T22:53:24.120',NULL,NULL,32,NULL,0,0,0,6119836,'https://i.stack.imgur.com/NXCNw.png?s=128&g=1'),(9477,1,'2015-04-10T19:58:59.950','Ashish',NULL,'2015-04-10T19:58:59.950','https://www.ashishdungdung.com','India',21,'<p>Im a blogger by passion and an app dev. Although Im much more into finance, I wonder how much technology can alter the way we handle finances. I like to debug things, especially when I dont know what and how they are. Yes, I like learning things, but I can be lazy at times. </p>\n\n<p>I like solitude and prefer working in a closed environment, yet having a company feels great if they know what they are doing. Im here to find answers to questions that intrigue me. Sometimes I come across things that I cant solve, hence I seek help from others.</p>\n\n<p>Other than that, I like to contribute what I know. Need any help, just drop by my profile or reach me through any official channels.</p>\n',0,0,0,5437285,'https://i.stack.imgur.com/bisiX.jpg?s=128&g=1'),(9478,101,'2015-04-10T20:09:22.910','Jim W',NULL,'2015-04-18T15:30:51.490','https://plus.google.com/u/0/111857648526495945406/posts/p/pub','BC',NULL,'<p>Several years ago I washed up on a North Pacific island, cast-away.  With only my computer and a broadband connection, Ive managed to survive.  Access to 1st world employment, transportation and shopping has helped ease the burden somewhat...</p>\n',0,0,0,1283606,'https://i.stack.imgur.com/HXf7n.jpg?s=128&g=1'),(9479,101,'2015-04-10T21:03:06.667','Alistair Buxton',NULL,'2015-04-13T14:08:56.557','http://al.robotfuzz.com/',NULL,NULL,NULL,0,0,0,494467,'https://i.stack.imgur.com/ejPFH.jpg?s=128&g=1'),(9480,131,'2015-04-11T00:18:10.473','Michelle',NULL,'2017-08-27T03:19:32.000','http://normalhuman.github.io',NULL,73,'<p>I am a normal human typing with my human hands.</p>\n\n<p><a href=\"https://en.wikipedia.org/wiki/Elephant_(2003_film)\" rel=\"nofollow noreferrer\">Avatar source</a></p>\n',2,562,89,4412195,'https://i.stack.imgur.com/2GSch.jpg'),(9481,13,'2015-04-11T02:38:03.247','dalton',NULL,'2015-10-18T22:48:27.870','',NULL,NULL,NULL,0,0,0,2160596,NULL),(9482,1,'2015-04-11T06: