8cac1b6?s=128&d=identicon&r=PG&f=1'),(9590,103,'2015-04-27T14:13:56.703','Ethan Bierlein',NULL,'2017-07-15T18:03:09.980',NULL,'0x0000000',17,'<p><sub>All of my code contributions in the form of answers across the Stack Exchange network are free to use, share and change even commercially without the requirement of attribution. If, however, you choose to use code from a question that I have posted, attribution is required.</sub></p>\n\n<blockquote>\n  <p><a href=\"https://stackexchange.com/users/4280743/ethan-bierlein\"><img src=\"https://stackexchange.com/users/flair/4280743.png\" width=\"208\" height=\"58\" alt=\"profile for Ethan Bierlein on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Ethan Bierlein on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a></p>\n  \n  <p>Just a developer looking for cool projects. Im always open to working on other smaller projects in my spare time.</p>\n  \n  <p>If you need/want to contact me, I can be reached at <code>ebr4d@live.com</code>. If you truly need to contact me by voice or video call, send me an email and we can talk about preferred communication methods.</p>\n  \n  <p><em>\"What do you mean?\", he said. \"Do you wish me a good monking, or mean that it is a good monking whether I want it or not; or that you feel good this monking; or that it is a monking to be good on?\"</em></p>\n  \n  <p>- <em>The Wizard of Stack, Unilandalf</em></p>\n</blockquote>\n',0,4,0,4280743,'https://i.stack.imgur.com/ZjM7v.gif?s=128&g=1'),(9591,2,'2015-04-27T17:05:00.417','Adnan',NULL,'2017-06-18T11:54:54.807',NULL,NULL,NULL,NULL,0,0,0,5634419,'https://www.gravatar.com/avatar/d452e90bd62319c31f228112421be76a?s=128&d=identicon&r=PG'),(9593,11,'2015-04-27T21:46:45.287','Andr ',NULL,'2015-04-27T21:46:45.287',NULL,NULL,NULL,NULL,0,0,0,6219396,NULL),(9594,101,'2015-04-28T06:01:29.920','lmiguelvargasf',NULL,'2016-10-12T19:53:33.093','http://www.mathsistor.com','Puyo, Pastaza Province, E