s industry as a freelancer for over 6 years now and I had been a hobbyist game artist &amp; designer in my spare time prior to that for approximately 5 additional years.</p>\n\n<p>Im an artist first but I have some basic programming knowledge that Ive had to obtain to carry certain developments through to stop them from failing in the past and most recently to carry my startup through the initial phases of development until the right programmer is found, that can step in. </p>\n\n<p><strong>I use a variety of software but here are the important few:</strong></p>\n\n<ul>\n<li>Maya</li>\n<li>MODO</li>\n<li>Zbrush</li>\n<li>Substance Designer</li>\n<li>Photoshop / Krita</li>\n<li>Unreal Engine 4 / Cryengine 3</li>\n<li>PyxelEdit</li>\n<li>ArtRage 4</li>\n<li>And many more that are not essential to my workflow.</li>\n</ul>\n\n<p><strong>Programming Languages:</strong></p>\n\n<ul>\n<li>Python</li>\n<li>MEL</li>\n<li>LUA</li>\n<li>C++ (basics)</li>\n<li>Ruby On Rails (basic to intermediate)</li>\n<li>HTML/CSS &amp; JS</li>\n</ul>\n\n<p>Feel free to get in touch :)</p>\n',0,0,0,6302536,'https://i.stack.imgur.com/c4uvb.jpg?s=128&g=1'),(9699,101,'2015-05-13T19:24:36.667','henning77',NULL,'2015-05-13T19:24:36.667',NULL,'Munich, Germany',40,'<p>My main interests currently are mobile app development, embedded programming, and cloud services programming (e.g. App Engine).</p>\n',0,0,0,24883,'https://www.gravatar.com/avatar/3566766db124176f4b880e65fa301131?s=128&d=identicon&r=PG'),(9700,1,'2015-05-13T22:40:50.950','Coding noob',NULL,'2015-06-04T10:25:08.540',NULL,NULL,NULL,NULL,0,0,0,6285819,'https://www.gravatar.com/avatar/8f137a00c38acf2344de6ab699640378?s=128&d=identicon&r=PG&f=1'),(9701,1,'2015-05-14T01:53:50.140','kourouklides',NULL,'2015-05-14T01:53:50.140','http://www.kourouklides.com','London, United Kingdom',NULL,'<p><a href=\"http://www.kourouklides.com\" rel=\"nofollow\">http://www.kourouklides.com</a></p>\n',0,0,0,2768941,'https://i.stack.imgur.com/c2LmY.jpg'),(9702,1