\n\n<p>Im a long-time IBMer, having worked on the IBM and Apache XML/XPath/XSLT code and been involved in some of the W3C efforts (DOM Working group primarily but that interacted with some of the others). Ive contributed at least one article to IBMs DeveloperWorks website. More recently Ive been working on the back-end code of the WebSphere Application Server, mostly the Liberty profile. </p>\n\n<p>Feel free to consider me biased in favor of IBM -- and even more biased in favor of industry standards, whenever possible -- but I make every attempt to be fair and honest.</p>\n',0,1,0,3768354,'https://i.stack.imgur.com/dqdWI.gif?s=128&g=1'),(9713,1,'2015-05-15T03:37:32.880','Gabriel Rossini Martins',NULL,'2015-05-15T03:37:32.880','http://gabriel.martins.ml/',NULL,NULL,'<p>I have approximate knowledge of many things.</p>\n',0,0,0,1782940,'https://i.stack.imgur.com/ZWWwg.jpg?s=128&g=1'),(9714,1,'2015-05-15T10:38:37.917','Georgie',NULL,'2015-05-15T10:38:37.917','http://pentame.com','India',29,'<p>All Geared up for Technology... Open-Source is the only way forward. :)</p>\n',0,0,0,4927764,'https://i.stack.imgur.com/FoTeQ.jpg?s=128&g=1'),(9715,6,'2015-05-15T10:39:27.773','Arshdeep',NULL,'2015-05-19T07:39:12.180',NULL,NULL,NULL,NULL,0,0,0,6312334,NULL),(9716,3,'2015-05-15T12:19:11.823','Harm',NULL,'2015-05-15T21:21:50.030','http://pooled-mining.com',NULL,NULL,'<p>Something something, grumble grumble...</p>\n',0,0,0,6181406,'https://www.gravatar.com/avatar/3c1b8029d839b71081357a2c15bf9b57?s=128&d=identicon&r=PG&f=1'),(9717,1,'2015-05-15T14:51:26.660','Qutaiba',NULL,'2015-05-19T13:17:05.907',NULL,NULL,NULL,NULL,0,0,0,6266762,'https://www.gravatar.com/avatar/94331ee27e7686ece09f852aa2d820ef?s=128&d=identicon&r=PG&f=1'),(9718,1,'2015-05-15T17:36:17.720','devcline',NULL,'2015-05-15T17:36:17.720',NULL,'France',NULL,NULL,0,0,0,1458880,'https://i.stack.imgur.com/Sc9yC.jpg'),(9719,6,'2015-05-15T19:38:45.420','Katzenklavier',NULL,'2015-08-20T19:53:10.247',NULL,NULL,NULL,NULL,0,0,0,6314