rskning og turistn ring hatt sterkest vekst. Fra 1601 var det engelske og nederlandske hvalfangst-stasjoner p   yene i nordvest, senere ogs  lengre s r   blant annet med en norsk sommerstasjon i Green Harbour. Pomor-perioden med russisk fangst hadde sin storhetstid p  1800-tallet. Utfordringer med sj is og kommunikasjoner har medf rt at det aldri har v rt landbaserte fiskerier her, alt fiske har historisk v rt landet i Europa. I nyere tid er fisket sterkt beskyttet av Fiskerivernsonen rundt Svalbard.</p>\n',0,0,0,3643147,'https://i.stack.imgur.com/HgHsD.png?s=128&g=1'),(9762,101,'2015-05-21T20:03:02.960','Kaganar',NULL,'2015-05-21T20:03:02.960',NULL,'Baton Rouge, LA',33,'<p>Ill have a dash of C++ on my C, please!</p>\n',0,0,0,468100,'https://www.gravatar.com/avatar/344697d54c0db06b0a9a426f6e319374?s=128&d=identicon&r=PG'),(9764,1,'2015-05-22T05:56:58.713','marco-andarcia',NULL,'2015-05-22T05:56:58.713',NULL,NULL,NULL,NULL,0,0,0,6310301,'https://lh3.googleusercontent.com/-j_gXCbj02pI/AAAAAAAAAAI/AAAAAAAAABU/Aal7FzkG1As/photo.jpg?sz=128'),(9765,101,'2015-05-22T19:12:10.843','Secoe',NULL,'2015-07-12T19:35:13.460',NULL,NULL,NULL,NULL,0,0,0,261902,'https://www.gravatar.com/avatar/6d836e1cc671532fb7bd00e88283e985?s=128&d=identicon&r=PG'),(9766,1,'2015-05-22T19:24:13.917','Kir Novak',NULL,'2015-05-22T19:24:13.917','http://kirnovak.com',NULL,29,'<p>Ive been started as front-end developer to understand how to make marvelous applications that solves real problems. Last 5 years I wrote quality-oriented JavaScript code. Last half of year Iv developed my skills on backend as a NodeJS developer.   </p>\n\n<p>Ive worked both with complex web applications solving business problems for larger organisations and small startups.  </p>\n\n<p>I can design and implement product from scratch, refactor your code and improve existing app infrastructure.   I am focus on:  JavaScript (includes ES2015), Angular, HTML5,  css3/sass/less/compass,  NodeJs, ExpressJs framework, MongoDb  Unit Tests :