t of time to adjust with anybody</b>..It s My Strength Rather. <b>I don t underestimate anyone</b>.</p>\n\n<p>I <b>love to live with my friends</b> and for friendship I don t consider their any previous achievements. I love all those who feel comfortable with me and who make me feel comfortable with them  <b>I always think positive > </b>Which have never helped me to achieve anything, but still it has become a habit. <b>I forgive people soon</b>, as I feel this life as too short and have no time to keep on proving others as wrong and we the only perfect! I love innovative things. And often Call me as <i>HiFi</i>. I love to be <strong>Honest</strong>. And one thing I have observed about myself is,I don t go behind famous people, as it would be an extra burden to them. I don t like to disturb anybody I <b>enjoy the company of people</b> who are FREE. I too love to live freely! I am always found stuck with computer. And it s my Passion. I always want to be a successful <em>Ethical Hacker</em>.</p>\n\n<p>I believe that people won t understand the importance of the other person until that person is found dead. And I am not an important person, can you guess Y ?<a href=\"http://dict.hinkhoj.com/words/meaning-of-BUDDHU-in-english.html\" rel=\"nofollow\"> buddu</a> . because I am still alive.</p>\n\n<p>I <b>respect each and every person</b> on this earth. I like to be a <b>free spirit</b>. Some dont like that, but thats the way I am.</p>\n\n<p>I Love each and every person on this earth..and in very rare cases people get confused about the colour of my Love  For those who doesn t like me, I don t have any comments, because its their life and I am no one to poke my nose.. And for those who hate me .hope I am not soooo bad.<b> I never think bad for anyone</b> .etc!</p>\n\n<p>I guess, you are my friend..Because you read until here, soooo long. Do you know . Friendship isn t about whom you have known the Longest .who came 1st or who Cares the Best Its all about Who came and Never Left and I am one of those kinds.</p>\n\n<p><i>I love animals a lot ..in zoo. But some of my friends prefer to live in Home. hahah..Oops, Sorry .I know, its a bad joke!</i></p>\n',0,0,0,4810219,'https://www.gravatar.com/avatar/065cc3e18ea11be95c2618b5f2d0ce2c?s=128&d=identicon&r=PG'),(9785,101,'2015-05-25T09:51:33.113','Jaimin Soni',NULL,'2015-05-25T12:33:56.537',NULL,'Ahmedabad',25,NULL,0,0,0,4851193,'https://i.stack.imgur.com/3O1DZ.jpg?s=128&g=1'),(9786,1,'2015-05-25T10:26:24.037','Testing360',NULL,'2015-05-25T10:26:24.037',NULL,NULL,NULL,'<ul>\n<li>Baby steps. Lets improve! </li>\n<li>Live life in \"Day-tight compartments\" as read in \"How to Stop Worrying and Start Living\" by Dale Carnegie</li>\n</ul>\n',0,0,0,2278943,'https://i.stack.imgur.com/XHO6p.jpg?s=128&g=1'),(9787,6,'2015-05-25T13:57:30.707','Eric',NULL,'2015-05-28T18:40:07.510',NULL,NULL,NULL,NULL,0,0,0,5128441,'https://lh5.googleusercontent.com/-dHOmwpkQPyI/AAAAAAAAAAI/AAAAAAAAAFk/R6dqfX2pUDI/photo.jpg?sz=128'),(9789,1,'2015-05-25T18:29:10.127','sajjad',NULL,'2015-05-25T18:29:10.127',NULL,NULL,NULL,NULL,0,0,0,6014519,'https://www.gravatar.com/avatar/e5ac0d44abe4cb09bf07dfbb25cef641?s=128&d=identicon&r=PG&f=1'),(9791,101,'2015-05-26T03:44:14.097','eymen',NULL,'2016-07-20T21:42:14.907','http://egunay.com','Milan, Italy',29,NULL,0,0,0,339180,NULL),(9792,1,'2015-05-26T14:35:15.430','Hackaholic',NULL,'2015-05-26T14:35:15.430',NULL,NULL,20,'<p>Student. Always Learning. </p>\n\n<p>Great Minds Discuss Ideas;\nAverage Minds Discuss Events;\nSmall Minds Discuss People.</p>\n',0,0,0,6349874,'https://lh4.googleusercontent.com/-ntvEGhuNSYA/AAAAAAAAAAI/AAAAAAAAABE/ZBp47J7iwUU/photo.jpg'),(9793,1,'2015-05-26T14:35:38.293','user9793',NULL,'2015-05-26T14:35:38.293',NULL,NULL,NULL,NULL,0,0,0,6367404,'https://www.gravatar.com/avatar/6f94303e36639163dec3ae50754ae75e?s=128&d=identicon&r=PG&f=1'),(9794,1,'2015-05-26T17:37:06.047','Amine RAHJ',NULL,'2015-05-26T17:37:06.047',NULL,NULL,NULL,NULL,0,0,0,6367770,'https://lh6.