oc in the UCLA department of radiation oncology developing algorithms for radiation treatment planning.</p>\n',0,0,0,1834330,'https://i.stack.imgur.com/HVb34.jpg'),(9817,18,'2015-05-30T21:50:12.983','asriraman93',NULL,'2015-09-06T18:12:12.583',NULL,NULL,NULL,NULL,0,0,0,3060157,'https://www.gravatar.com/avatar/2d15a75997b8b7baeb8ff28a3ffeb10e?s=128&d=identicon&r=PG'),(9818,101,'2015-05-30T22:28:40.843','LamonteCristo',NULL,'2015-06-01T13:24:48.617','http://www.val-id.com','New York, NY',41,'<p>The following message is null encrypted:</p>\n',0,1,0,129668,'https://i.stack.imgur.com/1xXXw.jpg?s=128&g=1'),(9820,101,'2015-05-31T03:39:09.557','Eric Leschinski',NULL,'2015-05-31T04:57:38.437',NULL,NULL,NULL,'<p>I want to put my recent machine learning degree toward the goal of advancing artificial intelligence, computer vision, and building interface software between computer disk boolean storage and the human short-term long term memory potassium ion wave form voltage gated ion channel storage system. </p>\n\n<p>The goal is to be able to plug a human brain into a computer and plugin as much knowledge and intelligence as you need for the task at hand.  Like giving an Excavator to a construction worker or a JSF VTOL to a pilot.  Education itself is about to be suddently disrupted when the brain-computer barrier is cracked.</p>\n\n<p><a href=\"http://machinesentience.com/profile.html\" rel=\"nofollow noreferrer\">\n<img src=\"https://github.com/sentientmachine/stackoverflowprofile/blob/master/profile.png?raw=true\"/>\n</a></p>\n\n<p>Krewella, alive:</p>\n\n<p><a href=\"https://www.youtube.com/watch?v=S7dcA_N6EmQ\" rel=\"nofollow noreferrer\">https://www.youtube.com/watch?v=S7dcA_N6EmQ</a></p>\n',0,0,0,199671,'https://i.stack.imgur.com/qGH9X.jpg?s=128&g=1'),(9822,1,'2015-05-31T12:26:01.630','FBaralli',NULL,'2015-06-11T11:53:58.380',NULL,'Italy',44,NULL,0,0,0,224408,'https://www.gravatar.com/avatar/68fb5c5c3b690a848f1637596e71fcbf?s=128&d=identicon&r=PG'),(9823,1,'2015-05-31T12:35:56.903','Jeroen Akershoek',NULL,'2015-05-31T12:35:56.903',NULL,NULL,NULL,NULL,0,0,0,5580764,'https://i.stack.imgur.com/BysDV.jpg?s=128&g=1'),(9824,6,'2015-05-31T13:16:38.387','Ledom',NULL,'2015-06-02T07:59:53.913',NULL,NULL,NULL,NULL,1,0,0,6350523,'https://www.gravatar.com/avatar/cdbb51974237230dabe4e7c37c55287b?s=128&d=identicon&r=PG&f=1'),(9825,1,'2015-05-31T15:36:37.157','KANTAK.P.M',NULL,'2015-06-01T19:20:46.667',NULL,NULL,NULL,NULL,0,0,0,6393568,NULL),(9826,1,'2015-06-01T08:33:53.253','JJT',NULL,'2017-04-21T11:41:00.750',NULL,NULL,NULL,'<p>I like learning new things and would like to continue learning forever :)</p>\n',0,0,0,3757831,'https://www.gravatar.com/avatar/7257868ad21d3fe733ba18bd334eaa64?s=128&d=identicon&r=PG&f=1'),(9827,113,'2015-06-01T09:09:50.560','Cesar',NULL,'2015-07-31T09:43:50.697',NULL,NULL,NULL,NULL,0,4,0,125264,'https://www.gravatar.com/avatar/9848e3448b991c07c02e74f44da81629?s=128&d=identicon&r=PG'),(9828,3,'2015-06-01T10:10:12.970','Cerberus',NULL,'2017-04-09T18:31:04.520',NULL,NULL,NULL,NULL,1,0,0,5434984,'https://www.gravatar.com/avatar/1c43eee2172dbe6b1150defcfc245e80?s=128&d=identicon&r=PG&f=1'),(9829,1,'2015-06-01T10:44:57.790','Rahul Verma',NULL,'2015-06-01T10:44:57.790',NULL,'Hyderabad, India',25,'<p>I am working in Moschip Semiconductors Technology.\nI am a dynamic and enthusiastic person. I have completed P.G. Diploma in Embedded System Design CDAC, ACTS Pune. I have completed my B.Tech in Electronics and Communication from  FET, RBS, College Agra affiliated to Gautam Buddha Technical University ,Lucknow.</p>\n\n<p>In my diploma as a project I have written a device driver in Embedded C , bit banging SPI over parallel port. In which I transformed a parallel port (X86)   as an SPI bus. I have also presented an international paper on  Speech Compression Using DCT  in ICEEE 2013 in Rasipuram, Salem Tamilnadu, Also I have completed many online courses and this has enabled me to explore more about the field. I am comfortable with Linux environment, device driver, Embedded OS, RTOS, and microcontrollers (ARM,AVR)  I also have passion for coding which has helped me to look at problems in a logical way. I am confident that I will make an active, open minded and useful member to your team. I am therefore very excited in working in your company and pursuing my cherished wish of working on enhancing projects and knowledge.</p>\n',0,0,0,5141328,'https://lh4.googleusercontent.com/-3jOfF6S-93A/AAAAAAAAAAI/AAAAAAAAAA8/lltgD_y8D8U/photo.jpg'),(9830,1,'2015-06-01T15:05:10.227','LPA',NULL,'2015-06-02T22:59:20.757',NULL,NULL,NULL,NULL,0,0,0,6398287,'https://www.gravatar.com/avatar/20edf00ed346447411472f7024f4f9fd?s=128&d=identicon&r=PG&f=1'),(9831,101,'2015-06-01T16:10:30.233','aim100k',NULL,'2015-06-01T16:10:30.233',NULL,NULL,20,'<p>If you wield your sword well, you dont have to handle it much.</p>\n\n<hr>\n\n<p>When one person teaches, at least 2 people learn.</p>\n\n<hr>\n\n<p>No matter who you are, no matter how bad or good your current situation is, you <strong>must thrive</strong>, you must keep doing the hard work. <strong>Respect</strong> the other person you are talking to, because you do not know how hard time he is going through.</p>\n\n<p>And I believe, if you want to get more, <em>you need to deserve more</em>. Life will give you what you deserve, nothing more, nothing less.</p>\n\n<hr>\n\n<p>Ive stopped arguing with people on SE because everyone is so righteous. Please people: calm down, and open your mind a bit.</p>\n\n<p>On many of the large SE sites such as SuperUser and StackExchange, you have to go through three ass holes to find one person who is truly willing to help.</p>\n\n<p><sub>from SpongeBob, user700</sub></p>\n\n<hr>\n\n<blockquote>\n  <p><sup>quoted from user1723893, nullPointer</sup></p>\n  \n  <p>A Good advice by <strong><a href=\"http://chat.stackoverflow.com/transcript/message/5565018#5565018\">Gordon</a></strong> If you want to become an expert programmer, google SOLID, buy GOF, buy POEAA, buy Clean Code, learn Refactoring, lookup GRASP, DDD, CQRS, DCI   but dont ask for PHP books. Thats the most reasonable suggestion I can give you when you ask for Expert PHP books really.</p>\n  \n  <p>You may start from <strong><a href=\"http://www.ustream.tv/recorded/22783515\" rel=\"nofollow\">This talk</a></strong> : <em>by</em> <a href=\"http://blog.ircmaxell.com/\" rel=\"nofollow\">Anthony Ferrara</a> (<a href=\"http://stackoverflow.com/users/338665/ircmaxell\">ircmaxell</a>)</p>\n  \n  <hr>\n  \n  <p>Useful Things</p>\n  \n  <ul>\n  <li><a href=\"http://phpjs.org/functions/\" rel=\"nofollow\">http://phpjs.org/functions/</a></li>\n  <li>awesome html/css/jquery tutorial <a href=\"http://www.codeschool.com/\" rel=\"nofollow\">http://www.codeschool.com/</a></li>\n  <li>good php <a href=\"http://www.tuxradar.com/practicalphp\" rel=\"nofollow\">http://www.tuxradar.com/practicalphp</a> (by Gordon)</li>\n  </ul>\n</blockquote>\n',0,0,0,5625339,'https://www.gravatar.com/avatar/8ef3b6d593e070069ac64e030693737d?s=128&d=identicon&r=PG&f=1'),(9832,101,'2015-06-01T18:15:02.720','branoholy',NULL,'2016-01-13T01:34:59.333','http://careers.stackoverflow.com/branoholy','Czech Republic',28,NULL,0,0,0,228192,'https://www.gravatar.com/avatar/bc0bf34420783524924b1e02c4252194?s=128&d=identicon&r=PG'),(9833,6,'2015-06-01T19:38:04.230','Zero',NULL,'2017-08-04T21:14:11.930','','Eindhoven, Netherlands',27,'<p>just an enthusiast</p>\n',1,0,0,5864605,'https://i.stack.imgur.com/poDWU.jpg?s=128&g=1'),(9834,1,'2015-06-02T10:52:28.127','Divan',NULL,'2015-06-02T10:52:28.127','http://dvisagie.blogspot.com/','EAX',NULL,NULL,0,0,0,2382995,'https://www.gravatar.com/avatar/40968ca3bac6cce0b4d1b2c991999c56?s=128&d=identicon&r=PG'),(9835,101,'2015-06-02T14:54:24.153','alexander barakin',NULL,'2016-02-23T09:57:33.210',NULL,' - ,  ',47,'<p>       .</p>\n',0,1,0,6109120,'https://lh3.googleusercontent.com/-8dJKxUdAvb4/AAAAAAAAAAI/AAAAAAAAAFs/wI3wHcp39eA/photo.jpg?sz=128'),(9836,101,'2015