es',NULL,NULL,0,0,0,2593029,NULL),(9972,134,'2015-06-21T20:11:40.827','user14042',NULL,'2017-05-27T21:06:00.137',NULL,NULL,NULL,NULL,0,23,0,1938688,'https://www.gravatar.com/avatar/4520abefad7dce768388125393d9f78a?s=128&d=identicon&r=PG'),(9973,1,'2015-06-21T20:52:44.963','muca',NULL,'2015-06-21T20:52:44.963',NULL,'Boituva, Brazil',29,NULL,0,0,0,5691139,'https://i.stack.imgur.com/YajUH.jpg?s=128&g=1'),(9974,1,'2015-06-22T01:17:11.940','Derek Kuether',NULL,'2016-02-10T17:21:43.437','http://www.linkedin.com/in/derekkuether','College Station, TX',25,'<p><strong>Background:</strong></p>\n\n<p>I am currently an aerospace engineering graduate research assistant &amp; student at Texas A&amp;M. I have a background in oil and manufacturing industrial controls. I am classified as an EIT.  I primarily work in Eclipse IDE with C++ &amp; MATLAB.  I have experience with OpenCV, Boost, &amp; mySQL.</p>\n\n<p><strong>Interests:</strong></p>\n\n<p>I have an interest in GNC (Guidance, Navigation, &amp; Control), Robotics, and System Integration.  Current work includes SLAM and image processing.  Will be pursuing a career in a related field in May 2016.</p>\n\n<p><strong>Contact:</strong></p>\n\n<p>Feel free to contact me by email at:</p>\n\n<p>Email: Kuether.derek@gmail.com</p>\n\n<p>LinkedIn: <a href=\"http://www.linkedin.com/in/derekkuether\" rel=\"nofollow\">Profile</a></p>\n',0,0,0,5092292,'https://lh4.googleusercontent.com/-XEfxsEmLXAA/AAAAAAAAAAI/AAAAAAAAEmA/OwphvCv1Pik/photo.jpg?sz=128'),(9975,1,'2015-06-22T02:42:58.923','Pietro',NULL,'2015-06-22T02:42:58.923','http://italian-bakery-gz.com','Guangzhou, China',57,'<p>NI (Natural Intelligence) versus AI (Automatic Idiocy). \nAI will win, but Natural Idiots will help a lot.</p>\n\n<p>In the process I enjoy and share with fellow NI</p>\n',0,0,0,2436775,'https://i.stack.imgur.com/BGavh.jpg'),(9976,1,'2015-06-22T04:20:56.987','Stamat Stamatov',NULL,'2015-06-22T04:20:56.987',NULL,NULL,NULL,NULL,0,0,0,201349,'https://www.gravatar.com/avatar/bacb305a7af1e8c47f9f078a54937acf?s=128&d=identicon&r=PG&f=1'),(9977,101,'2015-06-22T05:39:20.917','amr',NULL,'2015-06-22T05:39:20.917',NULL,NULL,NULL,NULL,0,0,0,37751,'https://www.gravatar.com/avatar/ceef6ad68b4acee6921daa07308a5b56?s=128&d=identicon&r=PG'),(9979,101,'2015-06-22T12:14:51.977','Dave Durbin',NULL,'2015-09-03T12:53:15.167','http://about.me/davedurbin','Sydney, New South Wales, Australia',NULL,'<p>By day, CTO At Moroku, making banking fun and bringing financial literacy to the masses.</p>\n\n<p>By night, PhD candidate at UTS researching 3D reconstruction of deformable surfaces with RGBD cameras</p>\n\n<p>On public transit, completing the Udacity VR nano-degree</p>\n\n<p>In my dreams, creating awesome Augmented Reality Experiences from my cliffside mansion overlooking the ocean.</p>\n\n<p>Amongst all of this raising two great children, growing a beard and trying to stay the right side of barrel shaped.</p>\n',0,0,0,455497,'https://i.stack.imgur.com/7Lk8b.png?s=128&g=1'),(9980,1,'2015-06-22T14:21:56.393','bOSKE',NULL,'2017-01-04T05:49:00.997',NULL,NULL,NULL,NULL,0,0,0,3950785,'https://www.gravatar.com/avatar/?s=128&d=identicon&r=PG&f=1'),(9981,1,'2015-06-22T20:38:43.430','SlickMcRunFast',NULL,'2015-11-17T16:21:55.947',NULL,'USA',NULL,'<p>I do the C++s and the Pythons. Getting back into the Webs. Use Linuxs.</p>\n',0,0,0,59990,NULL),(9982,101,'2015-06-22T23:33:15.613','Minebomber',NULL,'2017-02-05T02:56:58.653',NULL,'Los Gatos, CA',NULL,'<p>I got into coding in about 2012. I started with BASIC, and made a good few programs. Then I moved on to python, and made a few games like rock, paper ,scissors and tic tac toe. Now I code for ios and mac, making stuff that amuses me or can help in my daily life. I made a small timer to run in my menu bar for when I need a timer. I know some lua, java and html, but havent learned them fully. I am hoping to get into java so I can make some games.</p>\n',0,0,0,5670360,'https://lh4.googleusercontent.com/-RKaob2dc1MI/AAAAAAAAAAI/AAAAAAAAABE/x8WTTxAqZrk/photo.jpg?sz=128'),(9983,1,'2015-06-23T07:40:05.387','Giacomo Bonatti',NULL,'2015-06-23T18:09:37.427',NULL,NULL,NULL,NULL,0,0,0,6512351,'https://www.gravatar.com/avatar/ca80d3c77a8bc0bbda393470ad93fe8d?s=128&d=identicon&r=PG&f=1'),(9984,101,'2015-06-23T09:11:02.277','Kaveh Rassoulzadegan',NULL,'2015-06-23T09:11:02.277',NULL,NULL,NULL,NULL,0,0,0,1761052,'https://i.stack.imgur.com/TQ9RF.jpg?s=128&g=1'),(9986,46,'2015-06-23T11:33:03.867','Martin Felis',NULL,'2015-07-14T08:41:21.387','http://fysx.org','Karlsruhe, Germany',NULL,'<p>Author of <a href=\"http://rbdl.bitbucket.org\" rel=\"nofollow\">RBDL - the Rigid Body Dynamics Library</a>, PhD student in Mathematics in the research group <a href=\"http://orb.iwr.uni-heidelberg.de\" rel=\"nofollow\">Optimization in Robotics and Biomechanics</a>, at <a href=\"http://www.uni-heidelberg.de\" rel=\"nofollow\">Heidelberg University</a>. Also, I <a href=\"http://fysx.org/games\" rel=\"nofollow\">make games</a>.</p>\n',2,0,0,1305011,'https://lh5.googleusercontent.com/-ODwj5OqPVoE/AAAAAAAAAAI/AAAAAAAAAKk/lbf_SMbCK5g/photo.jpg?sz=128'),(9987,81,'2015-06-23T16:15:08.977','Trinadh venna',NULL,'2017-03-04T14:04:41.323','http://www.coderubix.com','Connecticut',24,'<p>Graduate Student in Robotics.</p>\n',3,2,0,6505041,'https://lh4.googleusercontent.com/-56KYjEF_6u0/AAAAAAAAAAI/AAAAAAAABjU/imoP2c1p-BI/photo.jpg'),(9988,101,'2015-06-23T17:41:00.293','Jailbroken',NULL,'2015-06-23T17:41:00.293',NULL,NULL,38,'<p>Mobility Architect. I am reachable at vishal.jhala@gmail.com</p>\n',0,0,0,1937775,'https://i.stack.imgur.com/WbgKu.png?s=128&g=1'),(9989,101,'2015-06-23T18:17:15.900','cluemein',NULL,'2015-06-23T18:17:15.900',NULL,NULL,NULL,NULL,0,0,0,3465916,'https://www.gravatar.com/avatar/638f735abf47b48fa3cd7b43c1d72341?s=128&d=identicon&r=PG&f=1'),(9990,1,'2015-06-23T19:20:43.117','rureddy88',NULL,'2015-06-23T19:20:43.117',NULL,'Boston, MA',29,'<p>Hey, I am Rocky</p>\n',0,0,0,4017996,'https://lh6.googleusercontent.com/-OuVE8ptaBC8/AAAAAAAAAAI/AAAAAAAALnU/n_h2NeKmAE0/photo.jpg?sz=128'),(9992,1,'2015-06-23T21:22:34.673','rkreddy8080',NULL,'2015-06-23T21:22:34.673',NULL,'Los Angeles, CA, United States',29,'<p>Hi, I am Rakesh</p>\n',0,0,0,3485196,NULL),(9993,101,'2015-06-23T22:37:27.270','missimer',NULL,'2016-05-01T19:26:53.933','http://cs-people.bu.edu/missimer','Boston, MA',NULL,'<p>I started programming by teaching myself in the hopes of making a video game.  I have instead decided to do the more difficult task of creating my own <strong>useful</strong> operating system.  I enjoy being challenged in my job and I am happiest when working on a project with ambitious goals.  I am continually trying to learn new things; either by continuing my formal education (currently working towards my Ph.D.), reading or better yet just trying something new.</p>\n\n<p>I enjoy low level programming: kernels, systems programming, robotics, etc. I prefer C or assembly but I can do C++ and if I have to make a GUI application C#. I am familiar with both Linux and Windows userspace and kernel development. I enjoy being challenged, especially when it comes to interacting with hardware. I find only a few things more satisfying than getting that one bit correct which makes the entire thing run because the hardware says that bit has to be that way. Dont get me wrong its maddening up to the point when you fix it, and you start to try to convince yourself that the hardware is broken, and a few rare times it is, but getting it to finally work is extremely satisfying.</p>\n\n<p>I am currently a Hypervisor Engineer at Barkly Protects Inc. and am working on finishing my PhD.</p>\n',1,0,0,1760603,NULL),(9995,1,'2015-06-24T02:58:50.587','black_cnfsd',NULL,'2015-07-06T05:08:37.230',NULL,NULL,NULL,NULL,0,0,0,6517580,NULL),(9997,101,'2015-06-24T09:38:13.143','U ur Aldanmaz',NULL,'2015-06-24T09:38:13.143','http://bilprog.org','Turkey',29,NULL,0,0,0,1696136,'https://www.gravatar.com/avatar/22e1de9cce108caee9822c3151f3ae23?s=128&d=identicon&r=PG&f=1'),(9998,8,'2015-06-24T10:27:14.790','Lama Sonmez',NULL,'2015-10-11T16:46:01.807',NULL,NULL,NULL,'<p>Undergraduated student .</p>\n\n<h1>SOreadytohelp</h1>\n',1,0,0,6442155,'https://www.gravatar.com/avatar/1b29825a1614d4699ab60df02f588cc6?s=128&d=identicon&r=PG&f=1'),(9999,101,'2015-06-24T11:44:12.767','jackk',NULL,'2015-06-24T11:44:12.767',NULL,'Istanbul',30,NULL,0,0,0,1800179,'https://i.stack.imgur.com/s9QLF.jpg?s=128&g=1'),(10000,1,'2015-06-24T13:17:09.223','Jibrilat',NULL,'2015-06-24T13:17:09.223',NULL,NULL,NULL,NULL,0,0,0,2392222,'https://www.gravatar.com/avatar/25661203fdf680ef2b2f23bca98809b4?s=128&d=identicon&r=PG'),(10001,1,'2015-06-24T14:01:12.590','Rhubarb',NULL,'2017-06-07T00:54:49.073',NULL,'Pittsburgh, PA',NULL,'<p>A roboticist (both professional and as a hobby) with a primary focus on high-level software.</p>\n',0,0,0,6520526,'https://i.stack.imgur.com/iYcAB.jpg'),(10003,111,'2015-06-24T17:44:47.750','Brian Dolan',NULL,'2016-12-02T15:06:39.243','http://www.qurius-inc.com','Los Angeles, CA',NULL,'<p>I am a mathematician who struggles with every line of code I write...</p>\n',0,0,0,2319681,'https://www.gravatar.com/avatar/9610ddf29620bd2cea4f69476e375471?s=128&d=identicon&r=PG'),(10004,11,'2015-06-24T18:39:19.967','MrDeepPurple',NULL,'2017-02-27T22:24:36.210',NULL,NULL,NULL,NULL,2,0,0,6522014,'https://lh4.googleusercontent.com/-d4oBvP7bbMw/AAAAAAAAAAI/AAAAAAAAB24/VAwLko3aXMM/photo.jpg'),(10005,101,'2015-06-24T18:41:52.087','M rcio Gonzalez',NULL,'2015-06-24T18:41:52.087',NULL,'Brazil',32,NULL,0,0,0,318070,'https://i.stack.imgur.com/cUQWv.png?s=128&g=1'),(10006,101,'2015-06-25T02:27:23.323','Bougret',NULL,'2015-08-03T08:24:04.083',NULL,'Japan',NULL,NULL,0,0,0,6369786,'https://www.gravatar.com/avatar/dabe1e7c872fe05d1937a275b2fb46a4?s=128&d=identicon&r=PG&f=1'),(10007,1,'2015-06-25T06:46:06.167','zefram',NULL,'2017-07-16T07:57:30.977',NULL,'UK',NULL,'<p>1st PC! was ZX81 in erm.... 1981</p>\n',0,0,0,3297533,'https://www.gravatar.com/avatar/cdc15d02c65c885fe7ce1367fa6ff992?s=128&d=identicon&r=PG&f=1'),(10009,101,'2015-06-25T13:24:38.197','jefflunt',NULL,'2015-06-25T13:24:38.197','http://jefflunt.com','Evanston, IL',38,'<p>Im that guy who fundamentally loves to tinker and build stuff. I code because its the single greatest creative outlet Ive ever discovered, and I cant get enough of it.</p>\n',0,0,0,90696,NULL),(10010,1,'2015-06-25T14:14:34.883','MJAFort',NULL,'2015-07-29T17:03:18.183',NULL,'Needham, MA',22,'<p>Im an electrical engineering student interested in coding for personal and professional uses.  My introduction was in Matlab, but I spend most of my time in Python.  Im looking into learning some lower level languages like C#.  Ive been having tons of fun writing a genetic algorithm for circuit development.</p>\n',0,0,0,4698005,'https://www.gravatar.com/avatar/ff64476420f889c33c97bf7fe48e0c9e?s=128&d=identicon&r=PG&f=1'),(10011,101,'2015-06-25T21:54:06.083','teawithfruit',NULL,'2015-06-25T21:54:06.083','http://blog.teawithfruit.com','Germany',NULL,NULL,0,0,0,274783,'https://www.gravatar.com/avatar/6ec115bbb53652c9a330e8ad40eaae20?s=128&d=identicon&r=PG&f=1'),(10012,11,'2015-06-25T22:45:48.420','Little Sheep Balloon',NULL,'2015-06-25T23:17:04.747',NULL,NULL,NULL,NULL,0,0,0,6364008,'https://lh6.googleusercontent.com/-czV1cR4t6E4/AAAAAAAAAAI/AAAAAAAAABU/YEbStv1la1s/photo.jpg'),(10013,101,'2015-06-25T23:16:25.633','techSultan',NULL,'2017-07-20T15:27:07.707',NULL,NULL,NULL,NULL,0,1,0,4561590,'https://i.stack.imgur.com/1rK1f.jpg?s=128&g=1'),(10014,1,'2015-06-26T02:31:46.457','zhidayat',NULL,'2016-01-30T00:55:45.223',NULL,NULL,NULL,NULL,0,0,0,364870,'https://www.gravatar.com/avatar/55f78f7d4e3a23ad252be60d8be87377?s=128&d=identicon&r=PG'),(10015,101,'2015-06-26T05:02:15.183','Idle001',NULL,'2015-06-26T05:02:15.183',NULL,NULL,NULL,'<p><a href=\"https://i.stack.imgur.com/X6v7T.jpg\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/X6v7T.jpg\" alt=\"enter image description here\"></a></p>\n\n<p>^^ My city, my inspiration, my life !</p>\n\n<p>Annnndddd .... This is me most of times ....</p>\n\n<p><a href=\"https://i.stack.imgur.com/RsbIK.gif\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/RsbIK.gif\" alt=\"enter image description here\"></a></p>\n\n<p>This is me after 5 cups of coffee :p  ....</p>\n\n<p><a href=\"https://i.stack.imgur.com/xr1it.gif\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/xr1it.gif\" alt=\"enter image description here\"></a></p>\n\n<p><strike>I see the shade of my deadline right there, i try to lie to my brain and sometimes walk slowly to not reach it, i hope it can work!</strike> There is no line here, I can trace a line wherever I want, and I have a spare mind !</p>\n\n<blockquote>\n  <p>Monsieur le president, Cest avec un coeur lourd que je maddresse   vous, ces quelques phrases dun condamn , etancheront peut-etre la soif des individus opprim s, je maddresse a vous avec une langue emprunt e, pour vous dire simplement et clairement, que letat na jamais et  la patrie, dapres bakounine, cest labstraction metaphysique, juridique, mystique, politique de la patrie, les masses populaires aiment profond ment leurs patries, mais cest un amour r el, naturel, pas une id e, mais un fait, et cest pour cela que je me sens franchement le patriote de toutes les patries opprim es.</p>\n</blockquote>\n',0,0,0,5785241,'https://i.stack.imgur.com/yJHES.jpg?s=128&g=1'),(10016,113,'2015-06-26T07:19:43.910','Dimitri Dewaele',NULL,'2016-12-05T08:31:37.760','http://www.softwarelab.be','Belgium',43,'<p>Senior software engineer in a wide variety of business applications. Particularly interested in Java development, cloud computing, server performance and stability. Also passionate about android technology as official android publisher. Always interested in new technologies, as well as close interaction with the Open Source community.</p>\n',0,2,0,3087409,'https://i.stack.imgur.com/f7N8Y.jpg?s=128&g=1'),(10017,101,'2015-06-26T08:13:46.807','Thomas Orozco',NULL,'2015-06-26T08:13:46.807',NULL,'Paris, France',27,'<p>My top interests here are:</p>\n\n<ul>\n<li>Python</li>\n<li>Django</li>\n<li>Software security</li>\n</ul>\n\n<p>In the past, I used <code>python</code> and <code>django</code> to develop a payment solution at <a href=\"https://www.my-bee.fr/pro/\" rel=\"nofollow\">MyBee</a> - Im glad theyre still going strong today! I also worked at <a href=\"http://scalr.com/\" rel=\"nofollow\">Scalr</a> as a Product Manager, and at <a href=\"http://www.accenture.com/\" rel=\"nofollow\">Accenture</a> as a consultant on business / IT projects.</p>\n\n<p>Personal email: <code>thomas@orozco.fr</code></p>\n',0,0,0,467632,NULL),(10018,1,'2015-06-27T13:57:18.833','Nafis',NULL,'2016-09-09T21:00:27.377','','Dhaka University, Dhaka, Dhaka Division, Bangladesh',24,'<p>Studying Electrical Engineering. Interested in programming and robotics.</p>\n',0,0,0,5784246,'https://lh3.googleusercontent.com/-F3XYCUpb6HA/AAAAAAAAAAI/AAAAAAAAABQ/5TTrZEIYrLI/photo.jpg?sz=128'),(10019,1,'2015-06-27T16:43:45.160','Ajay T',NULL,'2015-06-27T16:43:45.160',NULL,NULL,NULL,NULL,0,0,0,5533609,'https://graph.facebook.com/100000093426660/picture?type=large'),(10020,101,'2015-06-27T17:24:35.417','Misha Brukman',NULL,'2017-06-03T18:33:10.640',NULL,NULL,NULL,'<p>My interests and hobbies include languages (both human and computer), compilers, VMs, music, design and photography.</p>\n\n<p>I work at Google on the <a href=\"https://cloud.google.com/\" rel=\"nofollow noreferrer\">Google Cloud Platform</a>. My opinions are my own and do not necessary reflect those of my employer.</p>\n\n<p>Co-founded the <a href=\"http://janusgraph.org\" rel=\"nofollow noreferrer\">JanusGraph</a> open-source graph database project.</p>\n',0,0,0,4445146,'https://www.gravatar.com/avatar/74d6de60c4b944a7553eb0d0e023f32e?s=128&d=identicon&r=PG&f=1'),(10022,1,'2015-06-28T05:37:20.337','jsk',NULL,'2015-09-04T23:26:58.010',NULL,