on   Assembly instructions   Jigs\nSkills: \n  CAD Design Software: SolidWorks, AutoCAD, CimatronE \n  Manufacturing Technologies: Die Extrusion, Machining, Sheet Metal \n  Business Suite Software: ERP, PDM, SAP, MFG-PRO, Office, Priority </p>\n\n<p>SKILLS: Solidworks;Autocad;SAP;ERP;Mechanical Engineering;Project Management; Product Development and Management</p>\n',0,0,0,6544455,'https://lh3.googleusercontent.com/-qzw7MDPZEz8/AAAAAAAAAAI/AAAAAAAAGko/5uNqZRFm8Ng/photo.jpg?sz=128'),(10032,101,'2015-06-29T13:02:11.213','Marjan Nikolovski',NULL,'2015-06-29T13:02:11.213','http://www.emitknowledge.com','Skopje, Macedonia',NULL,'<p>Leader, engineer and father. Passionate for building teams, knowledge sharing and product development. Actively involved in tech, open source and start up communities as a speaker and contributor. </p>\n\n<p>Founder and CEO of Emit Knowledge, research and product development startup company, utilizing knowledge, creativity and the right set of technologies to provide businesses with progressive solutions. </p>\n\n<p>Open for collaboration and interesting challenges. \nIf you have a challenge worth solving, lets get in touch at marjan@emitknowledge.com</p>\n\n<p>Current responsibilities:</p>\n\n<ul>\n<li>Leading Emit Knowledge as CEO;</li>\n<li>Company product development;</li>\n<li>Business development as sales architect;</li>\n<li>Board member of MKDOT.NET;</li>\n<li>Tech speaker;</li>\n</ul>\n\n<p>Achievements:</p>\n\n<ul>\n<li>End to end delivery for Fokker real-time sales reporting;</li>\n<li>Delivering Enercon sensor data processing configuration tool;</li>\n<li>Planning and delivering Social Spot   Facebook for business SaaS;</li>\n<li>Market research, planning and releasing our latest company product Envoice   Invoicing app that let you get paid;</li>\n</ul>\n',0,0,0,404106,'https://i.stack.imgur.com/9m4IH.jpg?s=128&g=1'),(10033,101,'2015-06-29T14:08:22.697','GPS',NULL,'2015-06-29T14:08:22.697',NULL,NULL,NULL,NULL,0,0,0,6514557,'https:/