endor.com/','Near the Edge of the World..!',30,'<p><br><strong>Always find the reasons for your failure, to succeed</strong><br>\n&nbsp; &nbsp; &nbsp; <a href=\"http://venomvendor.blogspot.com/\" rel=\"nofollow noreferrer\">Blog</a> <br>\n&nbsp; &nbsp; &nbsp; <a href=\"https://play.google.com/store/apps/developer?id=VenomVendor\" rel=\"nofollow noreferrer\">Apps in Android Market</a> <br>\n&nbsp; &nbsp; &nbsp; <a href=\"http://venomvendor.blogspot.com/2013/01/how-to-view-source-code-of-android-apk.html\" rel=\"nofollow noreferrer\">How to View Source of an Android *.APK</a> <br></p>\n',0,0,0,990928,NULL),(10040,1,'2015-06-30T09:10:43.367','John Niezen',NULL,'2015-06-30T09:10:43.367',NULL,'Netherlands',54,'<p>By day: Product trainer at LG Electronics Service Academy Europe at Amstelveen. Off work: Coach of junior basketball team in Almere, volunteer at Bataviawerf Lelystad.</p>\n',0,0,0,5582992,'https://www.gravatar.com/avatar/ac8ef35e533020d067f4ebd00ed955f9?s=128&d=identicon&r=PG&f=1'),(10041,250,'2015-06-30T09:35:24.157','agold',NULL,'2017-03-17T17:00:03.000',NULL,NULL,NULL,'<p>I am a PhD students in Robotics, and I have an interest in (among others) Artificial Intelligence, Robotics, Machine learning, and programming (C++, Python and Java).</p>\n\n<blockquote>\n  <p>Programmers know that any modification of the source code has a danger of introducing errors, so it is a good rule to change as little as possible in a program that works.</p>\n</blockquote>\n\n<p><sub>H.P. Langtangen, A Primer on Scientific Programming with Python. Texts in Computational Science and Engineering 6,  Springer-Verlag Berlin Heidelberg 2012 \n137</sub></p>\n',0,117,7,1973010,'https://i.stack.imgur.com/5m0gd.jpg?s=128&g=1'),(10042,1,'2015-06-30T15:02:35.690','Fikri',NULL,'2015-06-30T15:02:35.690',NULL,NULL,NULL,NULL,0,0,0,6551834,NULL),(10043,101,'2015-06-30T15:55:16.490','Nick',NULL,'2015-06-30T15:55:16.490',NULL,NULL,NULL,'<p>I work at Catalog Data Solutions as a Python Developer!</p>\n