r',NULL,'2015-07-09T15:27:46.750',NULL,NULL,NULL,NULL,0,0,0,2833862,'https://www.gravatar.com/avatar/67db09e9c1a4c9ee28287b4f4cb14643?s=128&d=identicon&r=PG&f=1'),(10110,1,'2015-07-09T20:19:23.230','Nick Sporich',NULL,'2015-07-13T21:18:14.173',NULL,NULL,NULL,NULL,0,0,0,6149162,'https://i.stack.imgur.com/YVqTG.jpg?s=128&g=1'),(10111,101,'2015-07-09T22:02:31.377','Malipivo',NULL,'2016-08-01T07:04:31.743','http://www.striz.cz/en/','Bu ovice, Czech Republic, Central Europe',38,'<blockquote>\n  <p>TeX, Python etc. are my hobbies, sort of...</p>\n</blockquote>\n\n<p>I quit all the mailing lists in 2012, because it wasnt to my liking anymore as I needed to preserve my emails to my work, I have also lost interest in Google Groups for the same reason. This format of TeX.SX suits me well, I wish I found it earlier, I was wondering where TeXists share their experiments and unfinished work next to CTAN, TUGboat, CSTUG Zpravodaj etc. where rather finished work is presented.</p>\n\n<p>My contributions in the TeX world: </p>\n\n<ul>\n<li>I helped Michal M dr with translation and polishing of the <a href=\"http://ctan.org/pkg/lshort-czech\" rel=\"nofollow\">lshort-czech</a> manual.</li>\n<li>My family and I helped Jano Kula &amp; comp. with organizing the <a href=\"http://meeting.contextgarden.net/\" rel=\"nofollow\">ConTeXt meetings</a> in 2010 and 2013 hold in Brejlov near Prague.</li>\n<li>My colleagues (Zden k Wagner, Milo  Brejcha, Jan  ustek and many more), my family and I with support of <a href=\"http://www.cstug.cz/\" rel=\"nofollow\">CSTUG</a> have organized the <a href=\"http://www.cstug.cz/konference/\" rel=\"nofollow\">TeXperience</a> conferences since 2008 (it has been rather local gathering of Czech and Slovak TeXists). I have no plans organizing it again (2014+). I used all my ideas and I think TeXists could go to a pub without my intervention.</li>\n<li>I helped with <a href=\"http://bulletin.cstug.cz/\" rel=\"nofollow\">Zpravodaj</a> of the CSTUG.</li>\n<li>These days I am responsible for the TeX section of the <a href=\"http://ossconf.soit.sk/\" rel=\"nofollow\">OSSConf conference</a> which will take place in  ilina, Slovakia, July, 1-3, 2015. I am doing so since 2010 with Ale  Kozub k, present chief organizer of the conference.</li>\n<li>I was teaching TeX and friends at university in Zl n since around 2004. The faculty management cancelled my course in 2012 without noticing me in advance, so I left university after I had finished what needed to be accomplished.</li>\n<li>I published some <a href=\"http://striz7.fame.utb.cz/courses/dep/soubory/tex-and-friends.rar\" rel=\"nofollow\">books</a> and articles about TeX, but the topics are not important.</li>\n<li>I was working on a book on TikZ+pgfplots, a small collection of older snippets is available at <a href=\"http://striz7.fame.utb.cz/courses/dep/\" rel=\"nofollow\">http://striz7.fame.utb.cz/courses/dep/</a>, but I wasnt sure if it is a good idea to work on it anymore after discovering <a href=\"http://texample.net/\" rel=\"nofollow\">TeXample</a>.</li>\n</ul>\n\n<p>In my work, I am mixing the LaTeX format with the TeX primitives frequently. I keen to LuaLaTeX. I like that idea of learning modern programming language and doing some TeXing at the same time. My first testing project of computing something like 1200! used <a href=\"http://oss.digirati.com.br/luabignum/\" rel=\"nofollow\">BigNum and BigRat</a> libraries.</p>\n\n<p>I am using all major graphics engines at a certain level: Metapost, PSTricks, Asymptote and TikZ+pgfplots. I welcomed tikzDevice library in R, TikZ3, I like export options in GeoGebra. I like many packages and dirty tricks.</p>\n\n<p>The Python world: I like Sage, Sage notebook and an idea of the SageTeX created by Robert Ma k from Brno, the Czech Republic.</p>\n\n<p>Now, lets get back to the (Lua)TeX world...</p>\n\n<p>P.S. I can be reached at my display name at gmail dot com.</p>\n',0,0,0,4178143,'https://i.stack.imgur.com/MJbDR.jpg?s=128&g=1'),(10112,1,'2015-07-09T23:39:59.927','rootscript',NULL,'2015-07-10T00:01:50.590',NULL,'London, United Kingdom',NULL,NULL,0,0,0,2439106,'https://i.stack.imgur.com/o1nHt.png'),(10113,118,'2015-07-10T00:58:53.047','Lennart Rolland',NULL,'2017-07-18T18:14:45.253','http://blog.octomy.org',NULL,NULL,'<p>I work as a IT consultant for a small but capable consulting firm in Bergen, Norway.</p>\n\n<p>I also enjoy technology in my spare time. My latest project is <a href=\"http://octomy.org\" rel=\"nofollow noreferrer\">http://octomy.org</a></p>\n',0,1,0,678346,NULL),(10114,1,'2015-07-10T03:42:55.640','Dasha  Kotova',NULL,'2015-07-10T03:42:55.640',NULL,NULL,NULL,NULL,0,0,0,6603799,'https://graph.facebook.com/1595803057337851/picture?type=large'),(10116,101,'2015-07-10T14:47:55.513','Brian Mansfield',NULL,'2015-07-10T14:47:55.513',NULL,'San Francisco Bay Area/Chicago',26,'<p><p>Consultant @ a Salesforce Platinum Partner. <br /></p>\n\n<p>I was introduced to Force.com as a software engineer in Silicon Valley. </p>\n\n<p>All views and opinions expressed on this forum are mine and in no way reflect that of my employer.</p>\n',0,0,0,1319357,'https://i.stack.imgur.com/6IzsS.jpg?s=128&g=1'),(10117,1,'2015-07-10T16:05:19.137','Shubham Deshmukh',NULL,'2016-06-05T15:48:23.450',NULL,'Nagpur, Maharashtra, India',NULL,'<p>Computer Science student, currently studying Engineering in 3rd Year. I have deep curiosity &amp; interest in Artificial Intelligence &amp; Robotics.</p>\n\n<p>Other times, I love detective &amp; suspense films. If you like fiction, I am a huge Iron Man fan, can talk a lot about it.</p>\n\n<p>Hey! I am also on <a href=\"https://www.quora.com/Shubham-Deshmukh-12\" rel=\"nofollow\">Quora</a> ,  I sometimes give great answers and like solving things. :)</p>\n',0,0,0,5618250,'https://www.gravatar.com/avatar/7977184c9e1c426e014a645345b2f8da?s=128&d=identicon&r=PG&f=1'),(10118,1,'2015-07-10T19:36:25.123','victorhrs',NULL,'2015-07-10T19:36:25.123',NULL,'Brazil',26,'<p>Um prototipo 