ing or designing, I would probably be hanging out with my daughter for some photography session or maybe tinkering with Arduino and some DIY stuff. \nI hardly find time to spend time with my bike, but riding or perfecting my bike would be my next favorite pass time.</p>\n',0,0,0,1341808,'https://www.gravatar.com/avatar/9f08d0a0e78ac736caa90b8ef7c1b8f9?s=128&d=identicon&r=PG'),(10296,1,'2015-08-06T22:18:55.400','Daniel Guimar es Costa',NULL,'2015-08-06T22:18:55.400',NULL,NULL,NULL,NULL,0,0,0,5029707,'https://lh3.googleusercontent.com/-QA0--RZ9uac/AAAAAAAAAAI/AAAAAAAAENQ/A3nEc1dsU0c/photo.jpg'),(10297,108,'2015-08-07T04:28:31.877','SeanVDH',NULL,'2015-11-09T16:49:04.300','http://N/A','Canada',25,'<p>Mechatronics Engineering Student at University of Waterloo, programming since 2005.</p>\n',0,2,0,300991,'https://www.gravatar.com/avatar/31cea9121d990c1faeff384f248209f9?s=128&d=identicon&r=PG'),(10298,1,'2015-08-07T07:58:01.477','R.J. Jones',NULL,'2015-08-07T07:58:01.477',NULL,'Seattle, WA',31,NULL,0,0,0,6751008,'https://i.stack.imgur.com/FSNDB.jpg?s=128&g=1'),(10299,1,'2015-08-07T08:17:19.647','freecity',NULL,'2015-08-07T08:17:19.647',NULL,'Switzerland',NULL,NULL,0,0,0,1649415,NULL),(10300,101,'2015-08-07T15:11:30.083','AndrewSmiley',NULL,'2015-08-07T15:11:30.083',NULL,'Cincinnati, OH',24,'<h1>SOreadytohelp</h1>\n\n<p><code>print \"hello, world!\"</code></p>\n',0,0,0,3348612,'https://i.stack.imgur.com/OGt4K.jpg'),(10301,101,'2015-08-07T16:34:43.503','Vanni',NULL,'2015-08-07T16:34:43.503','http://www.ingtotaro.it','Bari, Italy',37,'<p><strong>IT Engineer</strong>, Italian, born 1980.</p>\n\n<p>Started coding at 5 on a VIC 20 :)</p>\n\n<p>See my <a href=\"http://careers.stackoverflow.com/totaro\">Careers 2.0 profile on Stack Overflow</a>.</p>\n\n<p>I would like to <strong>collaborate remotely</strong> with <strong>great startups</strong>.</p>\n\n<p><strong><a href=\"http://www.ingtotaro.it\" rel=\"nofollow\">Contact me!</a></strong></p>\n',0,0,0,152068,NULL),(10302,101,'20