uced using ideas I sketched out in an article back in 2012 titled Bezier Curves with a Romantic Twist.</p>\n',0,0,0,3777854,'https://i.stack.imgur.com/2cqsA.jpg?s=128&g=1'),(10320,101,'2015-08-10T03:58:29.120','Vladislav Martin',NULL,'2016-06-14T04:12:41.463',NULL,'Alexandria, VA',21,'<p>Young software developer / computer programmer, researcher, and web developer. My main interests lie in both analog and digital signal processing, wireless communications, and image / video processing. I spend a lot of time taking photos of things and reading.</p>\n\n<hr>\n\n<p>Junior undergraduate student at Northeastern University, Class of 2018. Pursuing a major in Electrical Engineering and a minor in Physics.</p>\n\n<hr>\n\n<ul>\n<li>Undergraduate member of the WiNES (Wireless Networks and Embedded\nSystems) Lab at Northeastern University. </li>\n<li>Former member of the\nNSF-funded Molecular Biophysics REU as a software engineering\nassistant in the Carey Lab at Princeton University &amp; in the  eha Lab at the Center for Nanobiology &amp; Structural Biology, Czech National Academy of Sciences.</li>\n<li>Former radar systems and simulations engineering co-op at the Air Force Research Laboratory.</li>\n<li>Current systems and simulations engineering co-op at RKF Engineering Solutions, Inc.</li>\n</ul>\n\n<hr>\n\n<p>Well... I guess thats all Ive got to say about myself. :)</p>\n',0,0,0,6764049,'https://i.stack.imgur.com/doSfi.jpg'),(10321,101,'2015-08-10T06:38:01.743','Arun Rama Balan.G',NULL,'2015-08-10T06:38:01.743','http://arunramabalan.blogspot.com','Aruppukkottai, India',34,'<p>My name is <strong>Arun Rama Balan.G</strong>. </p>\n\n<p>I am a Techno Functional - Full Stack developer with smart skills. </p>\n\n<blockquote>\n  <p>Past 9+ years, I have worked in PHP, Mysql, Oracle, Javascript, jQuery, Angular JS, Node JS, Twitter Bootstrap, AJAX, Smarty, Codeignitor, Wordpress, Joomla, VBulletin, phpBB,\n  Magento, Drupal and SAP Webdynpro</p>\n</blockquote>\n',0,0,0,1286850,NU