/li>\n<li>Electronics hobbyist.</li>\n<li>Certified Scrum Master</li>\n</ul>\n\n<p><a href=\"http://linkedin.com/in/robindaugherty\" rel=\"nofollow noreferrer\">My LinkedIn Profile</a></p>\n',0,0,0,294141,NULL),(10534,9,'2015-09-07T01:20:48.400','jon',NULL,'2015-11-28T19:32:52.503',NULL,NULL,NULL,NULL,0,0,0,2150883,'https://www.gravatar.com/avatar/85dbc53bd9071d6fb1dca0f18369b0cc?s=128&d=identicon&r=PG'),(10535,1,'2015-09-07T02:58:47.950','yuliia',NULL,'2015-09-07T02:58:47.950',NULL,NULL,NULL,NULL,0,0,0,4097767,'https://www.gravatar.com/avatar/1586db30849986074a6a884bb9e7f030?s=128&d=identicon&r=PG&f=1'),(10536,13,'2015-09-07T05:58:53.887','Ameer Hamza',NULL,'2017-06-10T17:26:56.483',NULL,'Gujranwala, Pakistan',25,'<p>I am an electric engineer, and currently pursuing higher studies in the field of robotics. I am a mathematics enthusiast. Electrical engineering is my profession but mathematics is my passion. I want to learn mathematics and share my knowledge to help spread the spirit of mathematics.</p>\n',2,0,0,3675671,'https://lh5.googleusercontent.com/-PBkyv60WyhU/AAAAAAAAAAI/AAAAAAAAAE0/8aYjASv8VOk/photo.jpg?sz=128'),(10537,1,'2015-09-07T07:35:24.850','Vishal',NULL,'2015-09-07T07:35:24.850',NULL,'Delhi, India',NULL,'<p>Currently working on an embedded project. Using stm32f4 board. </p>\n\n<p>Normally, I work with C/C++ and Python. </p>\n',0,0,0,6808291,'https://www.gravatar.com/avatar/a7e64c3e7efba57eeacd78ad3c6aa851?s=128&d=identicon&r=PG&f=1'),(10538,1,'2015-09-07T08:00:25.213','Ilshat Karazbaev',NULL,'2015-09-07T08:00:25.213',NULL,NULL,NULL,NULL,0,0,0,6912728,'https://graph.facebook.com/10204991754662140/picture?type=large'),(10539,348,'2015-09-07T09:29:29.427','galtor',NULL,'2017-08-25T08:58:41.850','',NULL,NULL,'<p>Mechanical engineer, currently working on robotics and model simulations</p>\n',1,12,7,3302113,'https://www.gravatar.com/avatar/91b017eb2c1e0b6940c7d6b7596df878?s=128&d=identicon&r=PG&f=1'),(10540,1,'2015-09-07T09:52:35.890','PunyViking',NULL,'201