s://i.stack.imgur.com/4Koia.jpg'),(10545,1,'2015-09-08T10:11:02.880','Maurice Manning',NULL,'2015-09-08T10:11:02.880',NULL,'Swindon',43,'<p>By day I am now a Google for Work Professional, working for Googles UK Premier Enterprise Partner.</p>\n\n<p>I have programming knowledge although i would call me a scripter rather than a programmer.</p>\n\n<p>Former roles include Infrastructure Manager, Telecoms Manager, Disaster Recovery and High availability consultant and BPM/ITIL Solutions Architect.</p>\n\n<p>By night, I like to challenge my self with new things, my current projects are to do with home automation using Voice control and Raspberry Pi2.</p>\n',0,0,0,6916230,'https://lh4.googleusercontent.com/-ZjkUDf_UxWM/AAAAAAAAAAI/AAAAAAAAKM0/FTxtWzVwEv8/photo.jpg?sz=128'),(10546,1,'2015-09-08T10:46:01.113','Himel Mazumder',NULL,'2015-09-09T04:08:18.807',NULL,NULL,NULL,NULL,1,0,0,6916015,'https://www.gravatar.com/avatar/731089e3db6cfbb66fe73aaa230af6e3?s=128&d=identicon&r=PG&f=1'),(10547,422,'2015-09-08T14:27:19.567','JJM Driessen',NULL,'2017-08-12T20:17:23.487',NULL,'Netherlands',NULL,'<p>Im a roboticist with a background in mechanical engineering.</p>\n',3,13,2,3597177,'https://www.gravatar.com/avatar/ef87290065ac1f837f8a145801ed89a5?s=128&d=identicon&r=PG&f=1'),(10548,1,'2015-09-08T14:38:53.027','fazkan',NULL,'2016-12-28T03:03:29.893',NULL,NULL,NULL,NULL,0,0,0,5371501,'https://www.gravatar.com/avatar/df36453b2dbe67514ddc5f794a246b45?s=128&d=identicon&r=PG&f=1'),(10549,101,'2015-09-08T18:26:46.793','darron',NULL,'2015-10-06T03:14:56.007','http://www.griffin.net/','United States',NULL,NULL,0,0,0,8741,'https://www.gravatar.com/avatar/3443224e0c1f39b7641a285e6d6cc9d9?s=128&d=identicon&r=PG'),(10550,101,'2015-09-08T22:14:52.687','ewmstaley',NULL,'2015-09-27T16:01:22.210',NULL,NULL,NULL,NULL,0,0,0,6725176,'https://www.gravatar.com/avatar/4c5883671789fd50834f1e96cddf9ce8?s=128&d=identicon&r=PG&f=1'),(10551,101,'2015-09-09T08:47:04.817','Gin Uchiha',NULL,'2015-09-09T08:47:04.81