ere</p>\n\n<p>Favorite Q/As, articles:</p>\n\n<ul>\n<li><a href=\"http://stackoverflow.com/questions/1673841/examples-of-gof-design-patterns\">http://stackoverflow.com/questions/1673841/examples-of-gof-design-patterns</a></li>\n<li><a href=\"http://Lessons%20learned%20and%20misconceptions%20regarding%20encryption%20and%20cryptology\" rel=\"nofollow noreferrer\">Lessons learned and misconceptions regarding encryption and cryptology</a></li>\n<li><a href=\"http://www.codinghorror.com/blog/2012/04/learn-to-read-the-source-luke.html\" rel=\"nofollow noreferrer\">Learn to Read the Source, Luke</a></li>\n<li><a href=\"http://www.codinghorror.com/blog/2011/02/how-to-write-without-writing.html\" rel=\"nofollow noreferrer\">How to Write Without Writing</a></li>\n<li><a href=\"http://www.codinghorror.com/blog/2008/10/programming-is-hard-lets-go-shopping.html\" rel=\"nofollow noreferrer\">Programming Is Hard, Lets Go Shopping!</a></li>\n<li><a href=\"http://fake-jeff.blogspot.com/2007/10/hibernate-sucks.html\" rel=\"nofollow noreferrer\">Hate speech about Hibernate :)</a></li>\n<li><a href=\"http://www.ibm.com/developerworks/java/library/j-eaed1/index.html\" rel=\"nofollow noreferrer\">Evolutionary architecture and emergent design: Investigating architecture and design</a></li>\n<li><a href=\"http://www.joelonsoftware.com/articles/fog0000000018.html\" rel=\"nofollow noreferrer\">Dont Let Architecture Astronauts Scare You</a></li>\n<li><a href=\"http://joelonsoftware.com/items/2009/09/23.html\" rel=\"nofollow noreferrer\">The Duct Tape Programmer</a></li>\n<li><a href=\"http://prezi.com/dr3on1qcajzw/www-world-wide-wait-devoxx-edition/\" rel=\"nofollow noreferrer\">(Outstanding) Performance Comparison of Java Web Frameworks - Devoxx 2011</a></li>\n<li><a href=\"http://thejoysofcode-blog.tumblr.com/post/48862417454/when-we-program-without-design-patterns\" rel=\"nofollow noreferrer\">When we program without design patterns</a></li>\n<li><a href=\"http://www.raizlabs.com/blog/2006/09/25/ten-reasons-why-css-sucks\" rel=\"nofollow noreferrer\">10 Reasons why CSS sucks</a></li>\n<li><a href=\"http://mrjoelkemp.com/2013/12/developers-vs-engineers/\" rel=\"nofollow noreferrer\">Developers vs. Engineers</a></li>\n</ul>\n',0,4,0,1079937,NULL),(10684,101,'2015-09-25T17:32:07.760','M.Sameer',NULL,'2015-10-12T14:05:19.063',NULL,'Cairo, Egypt',41,'<p>I had my BSc degree in Engineering in 1999 and gained 15+ years of experience in Software Development and Architecture, R&amp;D, Project Management from working in reputable software houses. </p>\n\n<p>Specialties: Software Architecture, Java, Android, C#, .Net, Delphi, UNIX/Linux, CMMi, Project management</p>\n',0,2,0,257450,'https://i.stack.imgur.com/qBVKk.jpg?s=128&g=1'),(10685,1,'2015-09-25T18:48:16.177','olls',NULL,'2015-10-02T18:54:46.193','http://oliverfaircliff.com','United Kingdom',21,'<p>I like building graphical terminal games :D</p>\n\n<p>Languages:</p>\n\n<ul>\n<li>Python</li>\n<li>Node</li>\n<li>C/C++</li>\n<li>Java</li>\n<li>Maze</li>\n</ul>\n',0,0,0,2065903,'https://www.gravatar.com/avatar/6605be6c54e001a8d4a7395bc9868075?s=128&d=identicon&r=PG'),(10686,101,'2015-09-25T20:35:55.347','Tom M',NULL,'2015-09-25T20:35:55.347',NULL,NULL,NULL,NULL,0,3,0,3818954,'https://www.gravatar.com/avatar/733b168bbb2aca39d38b3d94f3b08db9?s=128&d=identicon&r=PG&f=1'),(10687,101,'2015-09-25T23:30:45.510','Insane',NULL,'2016-04-11T14:00:25.917',NULL,'Ontario, Canada',NULL,'<p><strong>Computer</strong> enthusiast who enjoys working with <strong>technology</strong>. Interests vary further into <strong>Law</strong>, the <strong>English</strong> language, <strong>Economics</strong>, and more. </p>\n\n<hr>\n\n<p>Currently studying <code>Computer Science</code> and Economics at University.</p>\n\n<p>Thanks for stopping by!</p>\n',0,0,0,1515169,'https://i.stack.imgur.com/B6F0u.jpg?s=128&g=1'),(10688,1,'2015-09-26T07:40:34.137','user3012466',NULL,'2015-09-26T07:40:34.137',NULL,NULL,NULL,NULL,0,0,0,3611609,'https://www.g