w\">Laboratory for Information and Decision Systems (LIDS)</a> at MIT.\nI have a PhD in Control &amp; Dynamical Systems from Caltech. \nSee my research webpage <a href=\"http://censi.mit.edu/\" rel=\"nofollow\">here</a>.</p>\n\n<p>Recent hobby programming projects:</p>\n\n<ul>\n<li><a href=\"http://andreacensi.github.com/contracts/\" rel=\"nofollow\">PyContracts</a>, a contracts library for Python.</li>\n<li><a href=\"http://compmake.org\" rel=\"nofollow\">Compmake</a>, a parallel \"make\" for Python computations.</li>\n</ul>\n',0,0,0,133425,'https://www.gravatar.com/avatar/503cc380969ca5cfbdee5acb44090faf?s=128&d=identicon&r=PG'),(10705,1,'2015-09-28T12:07:50.243','Nico R.',NULL,'2015-10-05T10:29:58.880',NULL,NULL,27,'<p>master student in medical computer science</p>\n',0,0,0,6814923,'https://www.gravatar.com/avatar/6a2a0ba79a6fb6848a2689989fe7cab9?s=128&d=identicon&r=PG&f=1'),(10707,101,'2015-09-28T13:26:50.003','Carl Alberto',NULL,'2015-09-28T13:26:50.003','https://carl.alber2.com','Philippines',NULL,'<p> WordPress Community Helper from the Philippines</p>\n\n<p> Full Stack Web Mechanic </p>\n\n<p>Drone Aerial Photographer Wannabe</p>\n\n<p> Baby sitter to Unix and Mac</p>\n',0,0,0,5134084,'https://lh3.googleusercontent.com/-4AdERYOf5H0/AAAAAAAAAAI/AAAAAAAAAEw/eD2jQaqNm-o/photo.jpg?sz=128'),(10708,1,'2015-09-28T21:10:07.597','Shiprex',NULL,'2017-03-14T04:08:42.250',NULL,NULL,NULL,NULL,0,0,0,5539727,'https://lh6.googleusercontent.com/-LuXzmRmKHxE/AAAAAAAAAAI/AAAAAAAAjOs/If8GHDu8Cpw/photo.jpg?sz=128'),(10710,101,'2015-09-28T22:12:06.530','Ivan Balashov',NULL,'2015-11-16T17:12:12.540',NULL,NULL,NULL,NULL,0,2,0,332422,'https://i.stack.imgur.com/SAt1h.jpg?s=128&g=1'),(10712,1,'2015-09-29T07:00:23.030','Csum17',NULL,'2015-11-18T19:44:43.250',NULL,NULL,NULL,NULL,0,0,0,7031532,'https://i.stack.imgur.com/gqOUk.png?s=128&g=1'),(10714,1,'2015-09-29T11:11:50.250','mohammad',NULL,'2015-09-30T10:20:38.230',NULL,NULL,NULL,NULL,0,0,0,7032968,NULL),(10715,1,'2015-09-29T12:46:53.1