ing, I developed a strong passion for AI, Machine Learning and Robotics and I started implementing in Java and C++ dozens of algorithms I encountered during my studies. Finally I started discovering Mathematical programming field as a way for calculating optimal decisions. While I was ending my Thesis in Computational Game Theory I worked for more than one year programming in C++ for a company in the fields of full flight simulators. Now Im discovering the Android world while Im looking around for a real job in the fields of AI or Robotics or Machine learning or Mathematical programming.</p>\n\n<p><a href=\"http://it.linkedin.com/pub/stefano-conti/5b/82b/908\" rel=\"nofollow\">LinkedIn</a></p>\n',0,0,0,2128234,'https://www.gravatar.com/avatar/77c9378bf28336a823c5bf47b6376d3c?s=128&d=identicon&r=PG'),(10801,1,'2015-10-10T19:34:43.733','Xavo',NULL,'2015-11-04T10:11:47.587',NULL,NULL,NULL,NULL,0,0,0,5730658,'https://www.gravatar.com/avatar/2f7080d5f168bd05be106131f3d54a31?s=128&d=identicon&r=PG'),(10802,1,'2015-10-11T00:01:08.007','FORE',NULL,'2015-10-11T00:01:08.007',NULL,NULL,24,'<p>Im going to be the greatest programmer ever.</p>\n\n<p>:D</p>\n',0,0,0,7100448,'https://i.stack.imgur.com/K410f.png?s=128&g=1'),(10803,11,'2015-10-11T02:17:13.367','CHIANG',NULL,'2015-10-11T13:33:38.287',NULL,NULL,NULL,NULL,0,0,0,7061615,NULL),(10805,1,'2015-10-11T05:51:44.510','AmolN',NULL,'2016-03-16T06:01:24.073',NULL,'Pune, Maharashtra, India',NULL,NULL,0,0,0,7101173,'https://lh6.googleusercontent.com/-VJ4p1FDDmaU/AAAAAAAAAAI/AAAAAAAAAB0/Xc6aBL0AuTM/photo.jpg'),(10806,11,'2015-10-11T07:23:03.527','Alessandro',NULL,'2015-10-22T05:51:28.947',NULL,NULL,NULL,NULL,0,0,0,7101381,'https://www.gravatar.com/avatar/71fea70eda25c7eedd69bf5f2fcdf4f9?s=128&d=identicon&r=PG&f=1'),(10807,32,'2015-10-11T07:55:05.357','user3699039',NULL,'2017-06-19T09:36:36.667',NULL,NULL,NULL,NULL,0,4,0,4555074,'https://www.gravatar.com/avatar/db10212db3b45b6b3a28832c951fb053?s=128&d=identicon&r=PG&f=1'),(10808,1,'20