l.\" (<a href=\"https://en.wikiquote.org/wiki/George_E._P._Box#Empirical_Model-Building_and_Response_Surfaces_.281987.29\" rel=\"nofollow\">George Box</a>)</p>\n',0,0,0,1375047,NULL),(10859,101,'2015-10-16T20:35:45.670','Wilf',NULL,'2016-06-09T23:31:57.887',NULL,'United Kingdom',NULL,'\n\n<p>It is important to remember the difference between mythical trolls and internet trolls. One sort is ugly, stupid and bad-tempered - the other sort is imaginary.</p>\n',0,5,0,3097819,'https://i.stack.imgur.com/Prcng.png?s=128&g=1'),(10860,101,'2015-10-16T21:15:41.660','Ben Sandeen',NULL,'2015-12-06T08:21:24.620',NULL,NULL,NULL,'<p>Interested in the intersection of physics and computer science.  Enjoy wondering \"what if\".  Excited by making things more efficient.  Passionate about the environment.</p>\n',0,0,0,4960121,'https://graph.facebook.com/100000391593910/picture?type=large'),(10861,1,'2015-10-17T03:42:52.673','PTiger17',NULL,'2015-10-17T03:42:52.673',NULL,'Princeton, New Jersey',NULL,NULL,0,0,0,5788964,'https://www.gravatar.com/avatar/9596f57b533758a0acd33e35f4093654?s=128&d=identicon&r=PG&f=1'),(10862,1,'2015-10-17T04:55:44.623','Ryan.L',NULL,'2015-10-17T04:55:44.623',NULL,NULL,NULL,NULL,0,0,0,7136878,'https://i.stack.imgur.com/OSOPH.jpg?s=128&g=1'),(10863,123,'2015-10-17T10:09:45.090','Ortix92',NULL,'2017-08-19T09:15:50.983','http://exo-l.com',NULL,25,NULL,0,2,0,1298129,'https://www.gravatar.com/avatar/e85f0521e95f34c082c45467b731dc5d?s=128&d=identicon&r=PG'),(10864,1,'2015-10-17T15:40:34.747','Abinash Meher',NULL,'2015-10-17T15:40:34.747','http://abinashmeher999.github.io','Kharagpur, India',21,'<p>By Day: I an undergraduate student in Indian Institute of Technology Kharagpur. By Night: I am a student developer for Ruby Science Foundation and contribute to Open Source.</p>\n',0,0,0,4869959,'https://www.gravatar.com/avatar/1260f67f7edb00afccc51767b1b55de2?s=128&d=identicon&r=PG&f=1'),(10865,1,'2015-10-17T21:22:47.673','Moonyoung Lee',NULL,'2016-10-14T14:58:23.987',NULL,