www.gravatar.com/avatar/797564ac9ec019cfc3cd7b30588dda29?s=128&d=identicon&r=PG'),(10877,1,'2015-10-19T20:57:38.953','Jim',NULL,'2015-10-28T23:51:24.033',NULL,NULL,NULL,NULL,0,0,0,7150276,NULL),(10878,1,'2015-10-20T02:51:18.877','Adge',NULL,'2015-10-20T03:12:38.690',NULL,NULL,NULL,NULL,0,0,0,7026419,'https://www.gravatar.com/avatar/aa9dd9ec54a02fbf7daf13747a86ebce?s=128&d=identicon&r=PG&f=1'),(10880,101,'2015-10-20T06:58:13.630','Mego',NULL,'2017-02-08T11:16:39.253',NULL,'Texas',NULL,'<p>I like Python and C++. I dislike Java, but Ill use it if I have to. Ambivalent towards .NET. Baffled by Pyth and CJam. Intrigued by Brainfuck.</p>\n\n<p>I like puzzles. Math is cool. Math puzzles are great. Math puzzles solved by programming are my jam.</p>\n\n<p>Im creating <a href=\"https://github.com/Mego/Seriously\" rel=\"nofollow noreferrer\">Seriously</a>, a programming language that looks like Perl, acts like CJam, and will (hopefully) win a lot of golfs. Im only slightly regretting using almost the entirety of CP437.</p>\n\n<p>Speaking of CP437, Ive created <a href=\"http://mego.github.io/CodePageKeyboard/\" rel=\"nofollow noreferrer\">a website</a> that allows you to enter CP437 (and lots of other encodings!) text by clicking buttons. Its really nice. Ok, not yet, but Im working on it.</p>\n\n<p>I do my best to keep an eye on the solutions to my challenges and keep the accepted answer updated. If I ever miss one, feel free to give me a shout in <a href=\"http://chat.stackexchange.com/rooms/240/the-nineteenth-byte\">The Nineteenth Byte</a>.</p>\n\n<p><a href=\"https://stackexchange.com/users/2927268\">\n<img src=\"https://stackexchange.com/users/flair/2927268.png\" width=\"208\" height=\"58\" alt=\"profile for Mego on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Mego on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n\n<p><a href=\"https://www.codementor.io/mego?utm_source=github&amp;utm_medium=button&amp;utm_term=mego&amp;utm_campaign=github\" rel=\"nofollow noreferrer\"><img src=\"https://cdn.codementor.io/badges/i_am_a_codementor_dark.svg\" alt=\"I am a codementor\"/></a></p>\n\n<pre><code>-----BEGIN PUBLIC KEY-----\nMIIBIjANBgkqhkiG9w0BAQEFAAOCAQ8AMIIBCgKCAQEApOuVydcQeLZ8YNIdef+0\nj96mhvhDFg2rwZtQwATI6UdZ4zJbeJ8eGaRiy/wjFioe77HLpnEZEG9OjzlTzLuh\nmJPIEjNNJMtm7lUsRSj9gpeliRRGosP2hqbtCXr/j59gTpeoB8WYnWzRm5ClsAqU\nQCOAU/L8zR2PPX7SehQYcuRNvPAGDkDZV4kdkUwc8ZqwZNyYnmOgoRg2naeWx+pc\nwck1M1R1cr1sH2SdI20OYnokgzf9heCdOL0YbCvxkmwcshGCaiq+ylc0QGjov9h+\nEk2k+CxyDPmq+kxciqEUS3WxzHKBLIDcdegij9cU7Mxom+PoVuBve3/U3i1kFIjL\naQIDAQAB\n-----END PUBLIC KEY-----\n</code></pre>\n\n<p>Verification:</p>\n\n<p>The following is a base64-encoded message containing my PPCG.SE profile URL (<code>https://codegolf.stackexchange.com/users/45941</code>), signed with the RSA private key corresponding to the above RSA public key:</p>\n\n<pre><code>Z5JuA08ieCeb1C9VRkOM7HeBq0eVUqKUIKb36hvOfXWppry+EsVHZX4lR+kLalN77b/wJmoPG5K9\ne5XQwteGkj3nChiH7S2U5IxUDkb+2mvZLzrzSjFtqlG983ZlmDXrdjeMRz+sjxn9eYZl0P6P5ZoW\nCsHiOQFSZNTpDzXP+BKMza6NDYvrThRSf09ZkHxhhA7x0jRjXJqH2vmAxWGYxsIMP2nEAyWmmYd/\nnFFC4I739V+tXndcHm/UOAyfF7DDVRBblUSpAPh83gRwvahDUd2jo9bPTiheP7qQLn1B/HkH/Ooo\n3qhyPcMtP1qDa47WNKAgkv4Rlhon+jB/z8/chQ==\n</code></pre>\n',0,0,0,2927268,NULL),(10881,3,'2015-10-20T11:14:14.123','Nafees',NULL,'2016-07-20T14:43:09.453',NULL,'Dhaka, Bangladesh',26,NULL,0,0,0,1624950,'https://www.gravatar.com/avatar/c3d38088497a370f54416eed1b11fc08?s=128&d=identicon&r=PG'),(10882,3,'2015-10-20T11:19:21.487','Karthik',NULL,'2016-01-01T14:23:41.840','http://gaininfos.blogspot.com','Puducherry',22,'<p>Am a beginner, not awesome AHHH SOMEEEE means developing myself, self-dependent person.</p>\n',1,0,0,5787188,'https://i.stack.imgur.com/4U24t.jpg'),(10883,13,'2015-10-20T13:37:41.210','Anupu',NULL,'2017-07-14T11:03:42.297',NULL,NULL,NULL,NULL,0,0,0,1416092,'https://www.gravatar.com/avatar/9f91094227fdebb46af863aa85acb87a?s=128&d=ident