/sirinath\" rel=\"nofollow\">https://www.linkedin.com/in/sirinath</a></p></li>\n<li><p>Twitter: <a href=\"https://twitter.com/sirinath\" rel=\"nofollow\">https://twitter.com/sirinath</a></p></li>\n<li><p>Facebook: <a href=\"https://twitter.com/sirinath\" rel=\"nofollow\">https://twitter.com/sirinath</a></p></li>\n<li><p>G+: <a href=\"https://plus.google.com/u/0/+SumindaDharmasena\" rel=\"nofollow\">https://plus.google.com/u/0/+SumindaDharmasena</a></p></li>\n<li><p>Reddit: <a href=\"https://www.reddit.com/user/sirinath/\" rel=\"nofollow\">https://www.reddit.com/user/sirinath/</a></p></li>\n<li><p>Voat: <a href=\"https://voat.co/user/sirinath\" rel=\"nofollow\">https://voat.co/user/sirinath</a></p></li>\n<li><p>Github: <a href=\"https://github.com/sirinath\" rel=\"nofollow\">https://github.com/sirinath</a></p></li>\n<li><p>Bitbucket: <a href=\"https://bitbucket.org/sirinath/\" rel=\"nofollow\">https://bitbucket.org/sirinath/</a></p></li>\n<li><p>GitLab: <a href=\"https://gitlab.com/u/sirinath\" rel=\"nofollow\">https://gitlab.com/u/sirinath</a></p></li>\n<li><p>Medium: <a href=\"https://medium.com/@sirinath\" rel=\"nofollow\">https://medium.com/@sirinath</a></p></li>\n<li><p>Sutta Central: <a href=\"https://discourse.suttacentral.net/users/sirinath\" rel=\"nofollow\">https://discourse.suttacentral.net/users/sirinath</a></p></li>\n<li><p>StackOverflow Careers: <a href=\"https://careers.stackoverflow.com/sirinath\">https://careers.stackoverflow.com/sirinath</a></p></li>\n</ul>\n\n<p>Also a practitioner of <a href=\"https://en.wikipedia.org/wiki/Samatha\" rel=\"nofollow\">Samatha</a> and <a href=\"https://en.wikipedia.org/wiki/Vipassan%C4%81\" rel=\"nofollow\">Vipassana</a> a form of <a href=\"https://en.wikipedia.org/wiki/Buddhism\" rel=\"nofollow\">Buddhist</a> <a href=\"https://en.wikipedia.org/wiki/Meditation\" rel=\"nofollow\">meditation</a> mainly from the <a href=\"https://en.wikipedia.org/wiki/P%C4%81li_Canon\" rel=\"nofollow\">P li Canon</a> (<a href=\"https://en.wikipedia.org/wiki/Theravada\" rel=\"nofollow\">Therav da</a>). Also a non sectarian practitioner of <a href=\"https://en.wikipedia.org/wiki/Dharma\" rel=\"nofollow\">Dhamma</a> largely influenced by <a href=\"https://www.dhamma.org/en/index\" rel=\"nofollow\">meditation as taught</a> by <a href=\"https://en.wikipedia.org/wiki/S._N._Goenka\" rel=\"nofollow\">S.N.Goenka</a> and writings of <a href=\"https://en.wikipedia.org/wiki/Piya_Tan\" rel=\"nofollow\">Piya Tan</a>, moderately influenced by <a href=\"http://www.dhammasukha.org/ven-bhante-vimalaramsi.html\" rel=\"nofollow\">Ven. Bhante Vimalaramsi</a>, <a href=\"https://en.wikipedia.org/wiki/Thanissaro_Bhikkhu\" rel=\"nofollow\">Thanissaro Bhikkhu</a> and <a href=\"https://en.wikipedia.org/wiki/Buddhadasa\" rel=\"nofollow\">Buddhadasa Bhikkhu</a>, mildly influenced by <a href=\"https://en.wikipedia.org/wiki/Mun_Bhuridatta\" rel=\"nofollow\">Ven. Mun Bhuridatta</a>, <a href=\"https://en.wikipedia.org/wiki/Ajahn_Maha_Bua\" rel=\"nofollow\">Ajahn Maha Bua</a>, <a href=\"https://en.wikipedia.org/wiki/Ajahn_Chah\" rel=\"nofollow\">Ajahn Chah</a>, (<a href=\"https://en.wikipedia.org/wiki/Thai_Forest_Tradition\" rel=\"nofollow\">Thai Forest Traditions</a>) <a href=\"http://www.paaukforestmonastery.org/abbot.htm\" rel=\"nofollow\">Venerable Pa-Auk Tawya Sayadaw</a>, <a href=\"https://en.wikipedia.org/wiki/U_Vimala\" rel=\"nofollow\">Mogok Sayadaw</a>, <a href=\"https://en.wikipedia.org/wiki/Sujiva\" rel=\"nofollow\">Ven. Sujiva</a>, <a href=\"https://en.wikipedia.org/wiki/Nanavira_Thera\" rel=\"nofollow\">Ven.  av ra Thera</a>, etc.</p>\n',0,0,0,344368,NULL),(10995,1,'2015-11-04T08:59:12.123','willanth',NULL,'2015-11-04T08:59:12.123','http://www.unisa.edu.au','Adelaide, Australia',37,'<p>Product developer specializing in ruggedized products and operations in austere environments, slowly migrating to Applied Physics/Aerospace Engineering fields.</p>\n',0,0,0,2683771,'https://www.gravatar.com/avatar/237bbda07d035c9dd4da1