=\"https://keybase.io/\" rel=\"nofollow noreferrer\">Keybase</a>. I am <a href=\"https://keybase.io/artofcode\" rel=\"nofollow noreferrer\">artofcode</a> on Keybase, and I am signing the following string using the PGP key identified on my Keybase profile:</p>\n\n<pre><code>3457374\n</code></pre>\n\n<p>which generates the following signed message:</p>\n\n<pre><code>-----BEGIN PGP SIGNED MESSAGE-----\nHash: SHA512\n\n3457374\n-----BEGIN PGP SIGNATURE-----\nVersion: Keybase OpenPGP v2.0.60\nComment: https://keybase.io/crypto\n\nwsBcBAABCgAGBQJYTR8AAAoJENTaEQHLAqUVqiIH/iJFL30KspzR+X7wQgGlA0/F\n+lAnnWh2QGzyGel2Bz4BnUiHIs7T0AXgpp5Tu1vacRD8G2BY8HaVCpQmAHFMRJY9\n0kPaN/bZzYEHS9daA/r37AsuxIGFt2Pmhf6pqqokVIwLg+twKXK8OGZERmG68KCu\nfpbipUBEjsNxmg1saxMe0+ODhCyX1hVLrvt6m0Tflxn/nUILBei9KWUCc06hAZwd\nwWtecmyc8nJ6vrnRpy4QTXX+0xIiPEym5jcHAdlC0O6H5Bi4bAV49eo/gF8e9mxj\nz9o6sPIBlvGDA3oTyapi3lOzvctHTKvpDQSAXpllIjDIflZpCpM5awTlrTbB7MA=\n=Hcr/\n-----END PGP SIGNATURE-----\n</code></pre>\n\n<p>You can paste the above text into <a href=\"https://keybase.io/verify\" rel=\"nofollow noreferrer\">Keybases verification prompt</a> to verify that artofcode on Keybase signed the text.</p>\n',0,0,0,3457374,'https://i.stack.imgur.com/UO0Wf.png'),(11025,1,'2015-11-08T12:52:42.540','Eduen',NULL,'2016-07-29T06:36:59.450',NULL,'Spain',NULL,'<p>Passionate about theory of computation, robotics, and every close field to computer science.</p>\n\n<p>I am in love with Haskell and the funtional programming itself.</p>\n',0,0,0,6243874,'https://www.gravatar.com/avatar/c98e9b00d02d7d17a78b6c6a69f1ac05?s=128&d=identicon&r=PG&f=1'),(11026,1,'2015-11-08T13:19:16.917','code_not_yet_complete',NULL,'2017-07-05T12:36:33.900',NULL,NULL,NULL,NULL,0,0,0,6268794,'https://www.gravatar.com/avatar/140da0c1add4001e02bd7c59dd7b3a39?s=128&d=identicon&r=PG&f=1'),(11027,1,'2015-11-08T18:04:16.580','S.Reuter',NULL,'2015-11-08T18:04:16.580',NULL,NULL,NULL,NULL,0,0,0,7264630,'https://www.gravatar.com/avatar/58ad91f08729062ced36ad63d8e68