XP) etc</p>\n',0,0,0,5235951,'https://i.stack.imgur.com/Bx2V4.jpg?s=128&g=1'),(11218,1,'2015-12-02T05:08:23.220','Sukhpreet Singh',NULL,'2016-02-09T04:19:09.083',NULL,'India',24,'<p>Tech Geek, Photographer. Loves exploring the world of technology, web-space and programming. Java and Python professional.</p>\n',0,0,0,6701580,'https://www.gravatar.com/avatar/77900d25c6af10f8f54e09b1344657e7?s=128&d=identicon&r=PG&f=1'),(11219,101,'2015-12-02T05:39:03.627','Chimango Chisuwo',NULL,'2016-07-06T14:26:56.270',NULL,NULL,21,NULL,0,0,0,6538806,'https://i.stack.imgur.com/1qIvZ.jpg'),(11220,101,'2015-12-02T07:43:55.573','tonys',NULL,'2017-08-25T08:48:16.830','http://www.twyst.co.za','Johannesburg, South Africa',NULL,NULL,0,1,0,16342,'https://www.gravatar.com/avatar/c99d027e3da3a80fa9e7af16f386f5d0?s=128&d=identicon&r=PG'),(11221,13,'2015-12-02T13:48:10.057','Shivendra Singh Vishen',NULL,'2017-07-24T17:03:41.773',NULL,NULL,NULL,NULL,0,0,0,6369172,'https://graph.facebook.com/852972631423899/picture?type=large'),(11222,13,'2015-12-02T15:01:10.253','thomas_567',NULL,'2016-12-04T15:03:22.117',NULL,'Germany',23,'<p>CS student</p>\n',1,0,0,3801858,'https://www.gravatar.com/avatar/9c7ea942714047aee1c0de723aded153?s=128&d=identicon&r=PG'),(11223,101,'2015-12-02T15:14:39.400','Alex Nevidomsky',NULL,'2015-12-02T15:14:39.400',NULL,NULL,NULL,NULL,0,0,0,473554,'https://www.gravatar.com/avatar/7bbcbea420fc82670b3c249fca28ec7d?s=128&d=identicon&r=PG'),(11225,1,'2015-12-02T18:48:07.700','DeividP',NULL,'2015-12-05T10:56:50.310',NULL,'Vienna, Austria',23,'<p>Why do Java programmers wear glasses?</p>\n\n<p>Because they dont C#</p>\n\n<p>:P</p>\n',0,0,0,7401557,'https://lh6.googleusercontent.com/-ozRP2ZmYexk/AAAAAAAAAAI/AAAAAAAAABQ/qTQkb4bfHFg/photo.jpg?sz=128'),(11226,101,'2015-12-02T19:28:59.420','costrom',NULL,'2016-09-23T15:29:10.777',NULL,NULL,NULL,NULL,0,14,0,6959289,'https://www.gravatar.com/avatar/99ede44e0ee074c5e30a3615856fcce4?s=128&d=identicon&r=PG'),(11227,1,'2015-12-02T19:46:58.343','agalal',NULL,'2015-12-02T19:46:58.343',NULL,NULL,NULL,NULL,0,0,0,6747641,'https://i.stack.imgur.com/4Bbnz.png'),(11228,1,'2015-12-02T20:37:48.720','Stephen Cernota',NULL,'2016-10-04T15:18:49.550','http://stephencernota.com/','Austin, TX, United States',27,'<p>\"If I have seen further it is by standing on the shoulders of giants\"</p>\n\n<p>\"Whether you think you can or cannot, you are right.\"</p>\n\n<p>\"Good judgement comes from experience, and a lot of that comes from bad judgement\"</p>\n\n<p> The best code is no code at all. Every new line of code you willingly bring into the world is code that has to be debugged, code that has to be read and understood, code that has to be supported. Every time you write new code, you should do so reluctantly, under duress, because you completely exhausted all your other options. </p>\n\n<p>\"All problems in computer science can be solved by another level of [abstraction]\"<br>\n\"...except for the problem of too many layers of [abstraction].\"</p>\n',0,0,0,2308045,'https://i.stack.imgur.com/0vlTA.jpg?s=128&g=1'),(11229,11,'2015-12-03T00:12:27.583','Remy',NULL,'2015-12-04T00:08:31.703','',NULL,NULL,'',0,0,0,7402976,'https://www.gravatar.com/avatar/0c33042ee6e6a50909a358430c678f57?s=128&d=identicon&r=PG&f=1'),(11230,1,'2015-12-03T04:00:00.403','mahi',NULL,'2016-12-26T22:04:33.447',NULL,NULL,NULL,NULL,0,0,0,7265156,'https://lh6.googleusercontent.com/-vWEgFrZalPU/AAAAAAAAAAI/AAAAAAAACJs/DnjgRu3fdMw/photo.jpg'),(11232,1,'2015-12-03T09:38:27.150','Anima',NULL,'2015-12-03T09:38:27.150',NULL,NULL,27,NULL,0,0,0,7405159,NULL),(11233,101,'2015-12-03T14:56:11.427','Atilla Filiz',NULL,'2017-04-12T12:44:29.400',NULL,NULL,NULL,NULL,0,2,0,18658,'https://www.gravatar.com/avatar/405f80d55cb9bbab4ad3b4173e874e11?s=128&d=identicon&r=PG'),(11234,128,'2015-12-03T15:48:49.570','Tanishq Jaiswal',NULL,'2017-06-27T05:24:50.767',NULL,NULL,NULL,NULL,0,6,0,4364153,'https://graph.facebook.com/100002798395152/picture?type=large'),(11235,101,'2015-12-03T20