pfenberg, Austria',26,'<p>Masters student in Advanced Electronics at FH Joanneum university of applied sciences</p>\n',0,2,0,5584977,'https://www.gravatar.com/avatar/27bb39ab951f6bcf29afacbd653f437d?s=128&d=identicon&r=PG&f=1'),(11384,1,'2015-12-22T08:13:12.463','FelixFortis',NULL,'2016-01-08T12:19:00.927',NULL,NULL,NULL,'<p>Wannabe Ruby and Rails hacker</p>\n',0,0,0,1768073,'https://www.gravatar.com/avatar/919809f815e7501a83848e34942a3b72?s=128&d=identicon&r=PG'),(11385,10,'2015-12-22T10:56:46.440','Ven Nilson',NULL,'2017-03-26T21:00:21.537',NULL,NULL,NULL,NULL,0,0,0,6272139,'https://www.gravatar.com/avatar/0480eb483dfd1d5cb47e42f6bad53d6e?s=128&d=identicon&r=PG&f=1'),(11386,101,'2015-12-22T13:57:04.533','Captain Cranium',NULL,'2015-12-22T15:20:38.690',NULL,'UK',53,'<p>Practising university teacher in genre, literature across media, and narrative structures.  Background in administration, theatrical production and project management. Surprisingly scientific and mathematical, for a Humanities guy.</p>\n\n<p>Cranium:  <em>the thing that always hits the wall first</em>.</p>\n\n<p>Systems analyst, actively interested in the theory and practice of synthesis across disciplines.  Constantly finding new things.</p>\n\n<p>Audio technician, experienced programmer, and builder of PCs.  They tell me that I have a larger accumulation of distinct screwdrivers than most people have tools of any sort.</p>\n\n<p>Cyclist and windsurfer.  Taoism for discipline.</p>\n\n<p>First degree in English Language and Literature, with emphasis on Old and Middle English, a specialism in drama, and a dissertation on the Gothic Revival.</p>\n\n<p>Two MAs:  Education, and History.</p>\n\n<p>PhD concerning genre studies, and approaches to fantastic visual narrative (science fiction, fantasy, supernatural horror, surrealism).</p>\n\n<p>Absurdly varied non-fiction library, and a constant struggle with my backlog of visual material to study.  Sometimes I even enjoy it.</p>\n\n<p>Thinking about formulating a solid research project concerning fantastic narratives in audio media.  The clich   The pictures are better on the radio  is a clich  for a good reason.</p>\n\n<p>With all of that said, I could still really do with a hand getting all of these penguins out of my bathroom.</p>\n',0,0,0,7507034,'https://i.stack.imgur.com/Fhg51.jpg?s=128&g=1'),(11387,36,'2015-12-22T14:18:50.493','Tanay Shah',NULL,'2016-05-24T11:55:15.280',NULL,NULL,NULL,NULL,0,0,0,5904489,'https://www.gravatar.com/avatar/af260482cd5e9109f939f02046f7091f?s=128&d=identicon&r=PG&f=1'),(11388,1,'2015-12-22T19:15:42.033','XTC TitleNinety Nine',NULL,'2016-01-13T18:03:37.393',NULL,NULL,NULL,NULL,0,0,0,7514705,'https://www.gravatar.com/avatar/6b276109194e8d37d4c5efd4c540ac4a?s=128&d=identicon&r=PG&f=1'),(11389,1,'2015-12-22T22:03:06.653','Blau',NULL,'2015-12-22T22:03:06.653',NULL,NULL,NULL,NULL,0,0,0,2420224,'https://www.gravatar.com/avatar/1dacf146c2dd25da661631d035ac9321?s=128&d=identicon&r=PG'),(11390,1,'2015-12-22T22:50:22.067','eichin',NULL,'2015-12-22T22:50:22.067','http://www.thok.org/bloggery',NULL,NULL,NULL,0,0,0,270240,'https://www.gravatar.com/avatar/0a7491bf837a49b62e7fea7647609b9d?s=128&d=identicon&r=PG'),(11391,101,'2015-12-22T23:04:47.617','t q',NULL,'2015-12-23T18:36:41.953',NULL,NULL,NULL,'<p>here to learn</p>\n',0,0,0,1053899,'https://i.stack.imgur.com/yzlJX.jpg?s=128&g=1'),(11392,135,'2015-12-23T07:19:02.020','Kar',NULL,'2017-04-22T01:21:12.230',NULL,NULL,NULL,NULL,1,12,0,83374,'https://i.stack.imgur.com/22IuH.jpg?s=128&g=1'),(11393,1,'2015-12-23T10:44:45.040','user46418',NULL,'2015-12-23T11:36:08.530',NULL,NULL,NULL,NULL,0,0,0,7517776,'https://www.gravatar.com/avatar/88ca5a4803bba2c35f28a200d5467e76?s=128&d=identicon&r=PG&f=1'),(11394,101,'2015-12-23T11:00:01.947','Termininja',NULL,'2016-02-14T15:12:46.953',NULL,'Sofia, Bulgaria',NULL,'<p> </p>\n',0,1,0,4445012,'https://i.stack.imgur.com/9OcLQ.jpg'),(11395,23,'2015-12-23T11:30:04.457','Samuel Fraga Mateos',NULL,'2016-09-14T08:14:12.703