nd hours tweaking my kernel when the fire had not yet been invented. I also enjoy racking my brain with <a href=\"https://www.root-me.org/Xabier?inc=score\" rel=\"nofollow noreferrer\">security challenges</a>.</p>\n\n<p>However Im far for being a pro and Im here more to learn than to teach. If you are curious, see <a href=\"https://github.com/zuazo\" rel=\"nofollow noreferrer\">my GitHub profile</a>. PRs, ideas for bizarre projects and job offers are welcome. No recruiters, please.</p>\n\n<p><a href=\"//stackexchange.com/users/3983364/zuazo\"><img src=\"//stackexchange.com/users/flair/3983364.png\" width=\"208\" height=\"58\" alt=\"profile for zuazo on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for zuazo on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a></p>\n',0,0,0,3983364,NULL),(11502,1,'2016-01-07T06:17:44.420','Z Engstrom',NULL,'2016-05-31T14:26:48.917',NULL,'Illinois, United States',NULL,'<p>Education: Electrical engineering student at Bradley University</p>\n\n<p>Career: Practicum employee at Caterpillar Inc. working as a software developer and a controls engineer</p>\n\n<p>Interests: Robotics, Artificial Intelligence, Controls</p>\n\n<p>Coding Experience: C, Matlab, VBA, Python (Currently trying to learn)</p>\n',0,0,0,7586970,'https://www.gravatar.com/avatar/ab745198f57554360dd1135824257fd9?s=128&d=identicon&r=PG&f=1'),(11503,1,'2016-01-07T06:37:16.997','Avinash',NULL,'2016-01-07T06:37:16.997',NULL,NULL,NULL,NULL,0,0,0,7587133,'https://www.gravatar.com/avatar/e77637e17be83b42a54e27a1755c67dc?s=128&d=identicon&r=PG&f=1'),(11504,1,'2016-01-07T12:17:06.883','Rousnay',NULL,'2016-01-07T12:17:06.883','http://mr.rousnay.com','Dhaka, Bangladesh',27,NULL,0,0,0,2322649,'https://www.gravatar.com/avatar/3e19fcf5331ef8725a3de0edc8d7542d?s=128&d=identicon&r=PG'),(11506,101,'2016-01-07T12:52:30.893','Len Holgate',NULL,'2016-01-07T12:52:30.893','http://www.lenholgate.com','Guildford, United Kingdom',50,'<p>Im a freelance C++ programmer, based in Guildford in the UK.\n<br/>\n<br/>\nI have a technical blog at <a href=\"http://www.lenholgate.com\" rel=\"nofollow\">http://www.lenholgate.com</a>.\n<br/></p>\n\n<p>I have developed a highly scalable, high performance, Windows, I/O completion port based client/server networking framework: <a href=\"http://www.serverframework.com\" rel=\"nofollow\">http://www.serverframework.com</a>.\n<br/>\n<br/>\nI have developed some lock inversion detection and deadlock prevention tools for unmanaged Windows code over at <a href=\"http://www.lockexplorer.com\" rel=\"nofollow\">http://www.lockexplorer.com</a>.\n<br/>\n<br/>\nI also have a blog for my current hobby project, building a hexapod robot from scratch with firmware written in AVR assembler at <a href=\"http://www.lhexapod.com\" rel=\"nofollow\">http://www.lhexapod.com</a>.</p>\n',0,0,0,5054,'https://i.stack.imgur.com/zFiIO.png'),(11507,1,'2016-01-07T14:14:24.777','Robert White',NULL,'2016-01-07T14:14:24.777',NULL,NULL,NULL,NULL,0,0,0,7585395,'https://lh3.googleusercontent.com/-rmb4wSpdvoY/AAAAAAAAAAI/AAAAAAAABYk/XS9IZg8po5c/photo.jpg?sz=128'),(11508,21,'2016-01-07T14:40:28.407','Bakesril',NULL,'2016-01-15T13:06:23.930',NULL,NULL,NULL,NULL,1,0,0,7590131,NULL),(11509,101,'2016-01-07T14:42:40.900','DK_',NULL,'2016-01-07T15:07:17.860',NULL,'Tokyo, Japan',NULL,NULL,0,3,0,292329,'https://i.stack.imgur.com/CZcYj.png'),(11510,101,'2016-01-07T15:01:53.203','Matthew Sanders',NULL,'2016-01-08T15:11:47.083',NULL,'Portland, OR, United States',34,'<p>I am a father of an amazing boy.  </p>\n\n<p>A Software Architect and Maker of things.</p>\n',0,0,0,2410443,'https://i.stack.imgur.com/A8kiD.jpg?s=128&g=1'),(11512,1,'2016-01-07T16:35:57.380','hasaru shamikara',NULL,'2016-01-07T16:35:57.380',NULL,NULL,23,'<p>mmm.. nothin to say too much. bt i wil help u if i can.. let me see what u want</p>\n',0,0,0,7345903,'https://lh4.googleusercontent.com/-juDmklARo78/AAAAAAAAAAI/AAAAAAAACHw/PbtfHQWBmhM/photo.jpg