8&g=1'),(11660,101,'2016-01-22T15:28:01.280','DFord',NULL,'2016-03-08T14:23:47.763','http://none','Trumbull, CT',32,'<p>ASP.NET and C#.NET developer. Going to school for an MS in Computer Science.</p>\n',0,1,0,342120,'https://www.gravatar.com/avatar/bddf9d4986c841bfa063884e5d2a449c?s=128&d=identicon&r=PG'),(11661,1,'2016-01-22T16:56:22.513','Mesco',NULL,'2016-07-11T10:36:15.767',NULL,'Warszawa, Polska',24,'<p>Helo! </p>\n\n<p>One day in the summer of 2016 I fancied become a programmer. Started with Python and falled in love in vim &lt;3</p>\n\n<p>Little experience in: English, C, Python, Perl, SQL, LaTeX, LabView, Mathematica, making home-made PCBs, playing piano and oriental drums.</p>\n',0,0,0,7691185,'https://i.stack.imgur.com/K27dr.png?s=128&g=1'),(11664,1,'2016-01-23T07:49:22.260','Ajith P Venugopal',NULL,'2016-01-23T07:49:22.260',NULL,'Bengaluru, India',28,'<p>ON WEEKDAYS : Software Engineer and working on the Embedded System domain.</p>\n\n<p>ON WEEKENDS : Hobbyist Photographer.</p>\n\n<p>TAG LINE : Software engineer by profession, Human being by Ethics!</p>\n',0,0,0,7694022,'https://lh5.googleusercontent.com/-D_FG258ML8I/AAAAAAAAAAI/AAAAAAAABy0/n1xvtUazn6w/photo.jpg?sz=128');
INSERT INTO `Users` VALUES (11665,1,'2016-01-23T11:00:47.000','Giandomenico Lombardi',NULL,'2016-01-23T11:00:47.000','http://Lombardit.IT','Fasano, Italy',31,'<p><strong>BY DAY</strong>: working @ <a href=\"http://Lombardit.IT\" rel=\"nofollow\" title=\"Home\"><strong>Lombardit.IT</strong></a> - <a href=\"https://www.facebook.com/Lombardit.IT/info\" rel=\"nofollow\" title=\"Info\">Information</a> <a href=\"http://www.listal.it/event/categoria/musica-elettronica/techno/\" rel=\"nofollow\" title=\"Techno\"><strong>Techno</strong>logy</a>, <a href=\"http://www.ListaL.IT/dove/\" rel=\"nofollow\" title=\"Fasano, Brindisi, Puglia, Italy\">Fasano</a></p>\n\n<p><strong>BY NIGHT</strong>: I write code for <strong>Websites</strong> &amp; <strong>Applications</strong>. I take care of the <strong>Marketing</strong> of <a href=\"http://www.ListaL.IT/event/\" rel=\"nofollow\" title=\"TOP Events\"><strong>Events</strong></a> in <a href=\"http://www.listal.it/event/categoria/puglia/\" rel=\"nofollow\" title=\"a Land to Love\"><strong>Puglia</strong></a>, where I <strong>Eat</strong>, sometimes <strong>Drink</strong>, <strong>Dance</strong> and do <strong>Good Love</strong> <em>(say)</em>. Sometimes I sleep...</p>\n\n<p><strong>FOR FUN</strong>: Women study, the way they do, to think, to act, to relate to the world, and in the minds most beautiful I dig a deep hot niche near the heart. &lt;3</p>\n\n<p><strong>PASSION</strong>: many, too many to write. Im just in love with the life, of this great adventure, which I wish would never end for any<a href=\"http://eter9.com/g\" rel=\"nofollow\" title=\"ETER9: Living CyberSpace\">one</a>.</p>\n\n<p>As soon as I can, I answer on <strong>Stack Exchange</strong>, <a href=\"https://Telegram.me/Giando\" rel=\"nofollow\" title=\"Telegram\">Telegram</a>, <a href=\"http://tel://+393339446827\" rel=\"nofollow\" title=\"WhatsApp\">WhatsApp</a>, Giando[at]Lombardit[dot]IT, <a href=\"https://github.com/LombardIT\" rel=\"nofollow\" title=\"GitHub\">GitHub</a>, <a href=\"https://www.linkedin.com/in/GiandomenicoLom\" rel=\"nofollow\" title=\"LinkedIn\">LinkedIn</a>, <a href=\"https://twitter.com/Lombardit_IT\" rel=\"nofollow\" title=\"Twitter\">Twitter</a>, <a href=\"https://plus.google.com/+GiandomenicoLombardi\" rel=\"nofollow\" title=\"Google Plus\">Google+</a>, <a href=\"https://www.facebook.com/Lombardit.IT\" rel=\"nofollow\" title=\"Facebook\">Facebook</a> &amp; <strong>t</strong>h<em>e</em> <strong>s</strong>m<em>o</em>k<strong>e</strong> <em>s</em>i<strong>g</strong>n<em>a</em>l<strong>s</strong>.</p>\n\n<blockquote>\n  <p>\"The problems arise, for the resolution.\"-<a href=\"http://GiandomenicoLombardi.IT\" rel=\"nofollow\" title=\"Giandomenico Lombardi\">G.L.</a></p>\n  \n  <p>\"Consider ye the seed from which ye sprang;\n  Ye were not made to live like unto brutes,\n  But for pursuit of virtue and of knowledge.\"-<a href=\"https://en.wikipedia.org/wiki/Dante_Alighieri\" rel=\"nofollow\" title=\"Dante Alighieri\">Dante Alighieri</a></p>\n</blockquote>\n',0,0,0,405391,'https://i.stack.imgur.com/j4dz0.jpg?s=128&g=1'),(11666,1,'2016-01-23T12:45:39.043','Bachir Diop',NULL,'2016-01-23T12:45:39.043',NULL,NULL,NULL,NULL,0,0,0,7677495,'https://lh4.googleusercontent.com/-Gv-ZxePTXpk/AAAAAAAAAAI/AAAAAAAABnI/x0eK0uNcn0E/photo.jpg?sz=128'),(11667,51,'2016-01-23T13:28:05.570','xavier22',NULL,'2016-04-30T02:24:56.220',NULL,NULL,NULL,NULL,1,0,0,7695495,'https://www.gravatar.com/avatar/78fab87a4a733e9d522c2548553eeee9?s=128&d=identicon&r=PG&f=1'),(11668,101,'2016-01-23T14:40:39.323','Chef Cyanide',NULL,'2016-01-23T14:40:39.323',NULL,NULL,NULL,'<p>A Software Engineer and two of his friends are out for a drive together in the country side, when the engine of their car starts to sputter, and smoke starts pouring out of the hood:</p>\n\n<blockquote>\n  <p>Friend #1: <em>\"Well, Ill go pop the hood and see if theres anything I can do to fix it...\"</em><br/><br/>\n  Friend #2: <em>\"Ill see if I have enough cell service out here to call a tow truck...\"</em><br/><br/>\n  Software Engineer: <em>\"Hey, heres an idea! Why dont we just open up all the doors, slam them shut, and see if everything works again!\"</em></p>\n</blockquote>\n\n<p><br/><br/>\nAn infinite number of mathematicians walk into a bar:</p>\n\n<blockquote>\n  <p>Mathematician #1: <em>\"Id like a beer please\"</em><br/><br/>\n  Mathematician #2: <em>\"Id like 1/2 of a beer please\"</em><br/><br/>\n  Mathematician #3: <em>\"Id like 1/4 of a beer please\"</em><br/><br/>\n  Mathematician #4: <em>\"Id like 1/8 of a beer please\"</em><br/><br/>\n  Bartender: <strong>*Sigh*</strong> <em>\"Youre all idiots.\"</em> <strong>*Pours 2 beers*</strong></p>\n</blockquote>\n',0,0,0,7241071,'https://i.stack.imgur.com/VEp21.png?s=128&g=1'),(11669,101,'2016-01-23T14:47:36.340','Vadym Fedyukovych',NULL,'2016-01-23T14:47:36.340',NULL,NULL,NULL,NULL,0,1,0,5345595,'https://www.gravatar.com/avatar/165676d431c5aebb1fe7a85b7f8b86cb?s=128&d=identicon&r=PG&f=1'),(11670,1,'2016-01-23T16:14:07.707','Samuel Engel',NULL,'2016-01-23T16:14:07.707',NULL,NULL,NULL,NULL,0,0,0,7696137,'https://lh4.googleusercontent.com/-cRKzEN9tCYk/AAAAAAAAAAI/AAAAAAAAAEs/ZTgQZngVi30/photo.jpg?sz=128'),(11672,1,'2016-01-23T17:48:33.193','Lehooo',NULL,'2016-01-23T17:48:33.193','http://lehoism.net/','Stockholm, Sweden',33,'<p>I dont have <em>delusions</em> of grandeur, I have <strong>insight</strong> of grandeur!<br />\n<br />\n<strong>L</strong>EHOOO:<br />\n<strong>E</strong>nigmatic<br />\n<strong>H</strong>ero!<br />\n<strong>O</strong>mnipotent,<br />\n<strong>O</strong>mniscient,<br />\n<strong>O</strong>mnibenevolent!<br />\n<br />\n<a href=\"http://lehoism.net/\" rel=\"nofollow\" title=\"LEHOism\">LEHOism</a> - Logical yet Eclectic while Heeding Ockham.</p>\n',0,0,0,109475,'https://www.gravatar.com/avatar/bd367250852d0d7b8fafa66f7442d999?s=128&d=identicon&r=PG'),(11673,101,'2016-01-23T17:50:20.300','D n Caan',NULL,'2016-05-05T22:41:29.687',NULL,'Edinburgh, United Kingdom