eloping sustainable IoT systems that integrate with transportation systems to detect and classify vehicles in addition to calculate travel time and sense roadway activities in real time manners.</p>\n\n<p>The Projects I worked on so far increased my experience in software development and big data analysis. I m skilled in developing customized embedded linux systems that can communicate with various types of devices and transfer their data to the cloud using websockets. And working my way to enhance my  knowledge in data analytics using R and Python to apply machine learning algorithms to have a better understanding of the Big Data which IoT systems generate.</p>\n\n<p>you can find my resume here\n<a href=\"http://su-ideas.com/wp-content/uploads/2016/12/CV-16.pdf\" rel=\"nofollow noreferrer\">http://su-ideas.com/wp-content/uploads/2016/12/CV-16.pdf</a></p>\n',0,0,0,5325328,'https://i.stack.imgur.com/siViD.jpg'),(11739,101,'2016-01-28T20:38:58.230','carl_h',NULL,'2016-09-20T14:13:38.717','http://carlhinkle.com','Tolland, CT, United States',NULL,'<p>During the day I write cross-platform code for CAD apps, and at night I study for my Masters Degree in Robotics Engineering.</p>\n',0,0,0,457456,NULL),(11740,1,'2016-01-28T20:49:31.147','NW.v02Beta',NULL,'2016-01-28T20:49:31.147',NULL,NULL,NULL,NULL,0,0,0,7730951,'https://www.gravatar.com/avatar/10407ad9b2f8bd84c0fd99e8463bf5a4?s=128&d=identicon&r=PG&f=1'),(11741,1,'2016-01-28T21:25:40.180','Accentrix',NULL,'2016-06-11T23:28:47.583',NULL,'New Jersey',NULL,'<p>BY DAY: IT Guy / Electrical Engineer</p>\n\n<p>BY NIGHT: Robotics Developer / Programmer / DIY / Tinkerer</p>\n',0,0,0,7663093,'https://i.stack.imgur.com/N9lPV.jpg?s=128&g=1'),(11742,1,'2016-01-29T00:50:12.580','Sander Lathouwers',NULL,'2016-01-29T02:33:36.610',NULL,NULL,NULL,NULL,0,0,0,7727303,'https://www.gravatar.com/avatar/f0a72d257df193fba7e41beeb2623ee2?s=128&d=identicon&r=PG&f=1'),(11743,101,'2016-01-29T00:54:22.417','Jasen',NULL,'2016-01-29T00:54:22.417',NULL,N