ong></KBD></p></li>\n  <li><p><KBD><strong><code>I throw IT projects around everyday and sometimes when I have time I help people for free for fun or if I feel like being challenged or learning something new myself, etc.</code></strong></KBD></p></li>\n  <li><p><KBD><strong><code>Im a jack of many programming languages, and I will try any language for any task regardless even if I know nothing about it if it can get the job done.</code></strong></KBD></p></li>\n  <li><p><KBD><strong><code>Im a MySQL Server and Microsoft SQL Server Database Administrator; I automate many SQL related processes from Server DBA tasks, report querying, ETL operations, and so on .</code></strong></KBD> </p></li>\n  <li><p><KBD><strong><code>Im not scared to admit it if/when Im wrong; I stay accountable for my own actions.</code></strong></KBD></p></li>\n  <li><p><KBD><strong><code>Addicted to reading and/or learning about anything that interests me, not only limited to, but especially things related to Information Technology, Computer and Data Science.</code></strong></KBD></p></li>\n  </ul>\n</blockquote>\n',0,0,0,6805198,'https://i.stack.imgur.com/nHMT7.png?s=128&g=1'),(11775,1,'2016-02-01T05:14:44.317','Beardy21',NULL,'2016-02-01T05:14:44.317',NULL,NULL,NULL,NULL,0,0,0,7747505,'https://i.stack.imgur.com/xr2XG.png?s=128&g=1'),(11776,16,'2016-02-01T05:29:59.233','user44506',NULL,'2017-02-17T22:00:48.813',NULL,NULL,NULL,NULL,0,0,0,3791633,'https://www.gravatar.com/avatar/05656fbdb925fedf99b5113ce60a3536?s=128&d=identicon&r=PG&f=1'),(11777,1,'2016-02-01T06:51:17.193','Muhammad Hassaan Bashir',NULL,'2016-03-28T09:52:36.627',NULL,NULL,25,NULL,0,0,0,6955765,'https://lh6.googleusercontent.com/-N-GYQgk-Pgw/AAAAAAAAAAI/AAAAAAAAEB8/PzC0lNdtUAw/photo.jpg?sz=128'),(11778,1,'2016-02-01T12:03:27.267','ffurrer',NULL,'2017-07-07T15:48:44.137',NULL,'Zurich, Switzerland',31,NULL,0,0,0,2457247,'https://www.gravatar.com/avatar/b4b09d874026ebb17a303fefc1c42a99?s=128&d=identicon&r=PG'),(11779,1,'2016-02-01T1