m as part of that. So far going good! :)</p>\n',0,0,0,3444850,'https://i.stack.imgur.com/FqnK1.jpg?s=128&g=1'),(12950,1,'2016-02-19T09:17:15.640','hitcm',NULL,'2017-03-08T06:56:02.697',NULL,NULL,NULL,NULL,0,0,0,7530613,'https://lh6.googleusercontent.com/-HMzR0XD2pdE/AAAAAAAAAAI/AAAAAAAAABk/9MLpdtemdHg/photo.jpg'),(12951,1,'2016-02-19T12:02:55.843','Naoki Shibuya',NULL,'2016-03-28T12:25:04.117','https://hk.linkedin.com/in/naokishibuya',NULL,NULL,'<p>At the age of 10, I started programming in Basic language, typing on very hard keyboard buttons, saving and loading programs from cassette tapes, and printing source code on dot printers. At the same time, I was dreaming about one day seeing the world where humanoid robots are integrated into our daily life, inspired by \"Astro Boy\" cartoons.</p>\n\n<p>Fast forward to today: Im a senior programmer using C++, Python, and SQL in a Linux environment, working for investment banks and trading firms for automated trading systems. But how about that robot dream... Have I grown up to forget childish aspirations?</p>\n\n<p>Well, Im a pragmatic person who loves test-driven software development and problem solving in general. I have a Masters degree in Applied Finance and a Bachelors degree in Physics. I shouldnt be day-dreaming about a sci-fi world full of robots.... Of course not, right?</p>\n\n<p>Well, almost, but not quite.</p>\n\n<p>I firmly believe that smart robots and devices can help improve the quality of life. They can be part of our families, watching for security, monitoring our health, cooking our meals, educating and assisting every aspect of our activities. Yes, I am very enthusiastic about machine learning and robotics, equipped with years of experience in C++, Python and algorithmic trading system development.</p>\n\n<p>The world is ready for artificial intelligence, and Im ready to go for it.</p>\n',0,0,0,7600990,'https://lh5.googleusercontent.com/-8LnqwqM08u4/AAAAAAAAAAI/AAAAAAAABF4/BJZ6c1SG0iE/photo.jpg?sz=128'