ftwarehelp.solutions/','Sydney, New South Wales, Australia',50,'<p><a href=\"https://gist.github.com/yvettec/e8c1fb032bec023f816c\" rel=\"nofollow noreferrer\">my auto comments</a></p>\n\n<p><a href=\"https://stackoverflow.com/election/9#post-45156034\">My Stack Overflow Moderator Nomination</a> - I ran 3rd in the latest election</p>\n\n<ul>\n<li>member of <a href=\"https://chat.stackexchange.com/rooms/11540/charcoal-hq\">Charcoal HQ</a></li>\n<li>and <a href=\"https://chat.stackoverflow.com/rooms/41570/so-close-vote-reviewers\">SO Close Vote Reviewers</a>  </li>\n<li>moderator on <a href=\"https://pets.stackexchange.com/\">Pet.Se</a>    </li>\n</ul>\n\n<p>My <a href=\"https://meta.stackexchange.com/users/316125/ada\">chatbot account</a> - havent been doing anything with it.</p>\n\n<p><a href=\"https://meta.stackoverflow.com/questions/290297/how-much-change-to-the-question-is-too-much\">How much change to the question is too much? </a>    </p>\n\n<p><a href=\"https://i.stack.imgur.com/RYBzT.png\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/RYBzT.png\" alt=\"enter image description here\"></a><a href=\"https://i.stack.imgur.com/sGOB1.jpg\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/sGOB1.jpg\" alt=\"enter image description here\"></a></p>\n\n<p><a href=\"https://i.stack.imgur.com/bB8u2.png\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/bB8u2.png\" alt=\"enter image description here\"></a> <a href=\"https://i.stack.imgur.com/qAxtP.jpg\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/qAxtP.jpg\" alt=\"enter image description here\"></a> <a href=\"https://i.stack.imgur.com/42DAN.jpg\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/42DAN.jpg\" alt=\"enter image description here\"></a>  </p>\n\n<p>I stole this image from a  500? page error on Stack Exchange<br>\n<a href=\"https://i.stack.imgur.com/WK9Ot.jpg\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/WK9Ot.jpg\" alt=\"enter image description here\"></a></p>\n\n<p><em>and if youve gotten this far:</em></p>\n\n<p><a href=\"https://www.facebook.com/notes/yvette-colomb/why-im-not-a-vet/258299824670284/\" rel=\"nofollow noreferrer\">Why Im not a vet</a></p>\n',0,0,0,4911344,'https://i.stack.imgur.com/fgpp1.jpg?s=128&g=1'),(13096,101,'2016-03-05T11:22:39.313','Iacchus',NULL,'2016-03-05T11:22:39.313',NULL,NULL,NULL,NULL,0,0,0,154891,NULL),(13097,1,'2016-03-05T16:48:13.297','Felix Brucker',NULL,'2016-03-05T16:48:13.297',NULL,NULL,NULL,NULL,0,0,0,3224087,'https://www.gravatar.com/avatar/2856df2915f6ba71f0a4e9ac28fed055?s=128&d=identicon&r=PG&f=1'),(13099,1,'2016-03-05T19:13:52.377','user13099',NULL,'2016-03-05T19:13:52.377',NULL,NULL,NULL,NULL,0,0,0,7982419,'https://www.gravatar.com/avatar/7f2ba04d24cd9ed035c13b9e179b7a24?s=128&d=identicon&r=PG&f=1'),(13100,101,'2016-03-06T01:26:40.897','ar2015',NULL,'2016-12-10T05:37:13.720',NULL,NULL,NULL,'<p>Tex is full of fools.</p>\n',0,3,0,5856106,'https://www.gravatar.com/avatar/e0e17eb1840f30ff4acc5b1556a39531?s=128&d=identicon&r=PG&f=1'),(13101,101,'2016-03-06T02:43:12.883','Max Barfuss',NULL,'2017-08-02T19:38:02.597',NULL,'Logan, UT',43,'<p>I have been a software engineer, manager, director, software engineer, manager, then director again. I enjoy crafting quality code, automating team workflows, and working with other developers. I also understand the necessity of good leadership, salesmanship and the ability to communicate with non-technical people. My areas of expertise are C++11/14, ROS, .NET (C#) / XAML, and SQL Server (MSSQL).  I am really into robotics and automation, but Ill write the occasional business app too.</p>\n',0,2,0,288041,NULL),(13102,101,'2016-03-06T11:46:45.170','Patrick Trentin',NULL,'2016-03-06T11:46:45.170','http://www.patricktrentin.com','Italy',29,'<p>Im here to learn from other people.</p>\n\n<hr>\n\n<p><strong>Favourite Quotes</strong></p>\n\n<hr>\n\n<blockquote>\n  <p>When you stand before God, you cannot say, <em>\"But I was told by others to do thus,\"</em> or that virtue was not convenient at the time. This will not suffice. Remember that.</p>\n  \n  <p>[King Baldwin IV, Kingdom of Heaven]</p>\n</blockquote>\n\n<hr>\n\n<blockquote>\n  <p>Allow yourself to think only those thoughts that match your principles and can bear the bright light of day. Day by day, your choices, your thoughts, your actions fashion the person you become. Your integrity determines your destiny. </p>\n  \n  <p>[Heraclitus]</p>\n</blockquote>\n\n<hr>\n\n<blockquote>\n  <p>If you dont like something change it; If you cant change it, change the way you think about it.</p>\n  \n  <p>[Mary Engelbreit]</p>\n</blockquote>\n\n<hr>\n\n<blockquote>\n  <p>Actions of men are the best interpreters of their thoughts.</p>\n  \n  <p>[John Locke]</p>\n</blockquote>\n\n<hr>\n\n<blockquote>\n  <p>Fail to prepare, prepare to fail.</p>\n  \n  <p>[Benjamin Franklin]</p>\n</blockquote>\n\n<hr>\n\n<blockquote>\n  <p>Think well, Speak well, Act well.</p>\n  \n  <p>[Zara u tra]</p>\n</blockquote>\n\n<hr>\n\n<blockquote>\n  <p>Live long and prosper.</p>\n  \n  <p>[Vulcan salute]</p>\n</blockquote>\n',0,0,0,7983874,'https://lh4.googleusercontent.com/-uiRWa4coXLs/AAAAAAAAAAI/AAAAAAAAJUs/5BxfhSS1bUY/photo.jpg?sz=128'),(13103,1,'2016-03-06T20:39:40.267','DevNull0',NULL,'2016-03-06T20:39:40.267',NULL,NULL,NULL,NULL,0,0,0,7984175,'https://i.stack.imgur.com/E5ixW.jpg?s=128&g=1'),(13104,1,'2016-03-06T22:51:53.827','Margus Waffa',NULL,'2016-03-06T22:51:53.827',NULL,NULL,NULL,NULL,0,0,0,2391555,'https://graph.facebook.com/1135161043/picture?type=large'),(13105,1,'2016-03-07T02:42:02.093','Weiwei',NULL,'2016-11-29T06:37:59.153',NULL,NULL,NULL,NULL,0,0,0,5479264,'https://www.gravatar.com/avatar/b5491a021e370001fe8f8a10ff6b6cfe?s=128&d=identicon&r=PG&f=1'),(13106,1,'2016-03-07T07:24:15.727','opetany93',NULL,'2016-03-07T07:24:15.727',NULL,'Warsaw, Poland',NULL,NULL,0,0,0,7922074,'https://www.gravatar.com/avatar/4e3b2bf7f901d68