3174,101,'2016-03-14T17:48:09.533','user3659052',NULL,'2017-03-06T15:43:11.690',NULL,NULL,NULL,'<p>In school, they only taught you how to use the tools. </p>\n\n<p>In actual project you learn their business and apply the tools you have learned. </p>\n\n<p>Everyone wants you to have a big box of tools but that does not mean you are good at using it.</p>\n\n<p>I have seen experienced developer that developed software that has many bugs due to bad practices. I also seen good developer from San Francisco that able to write good code without any bug, or compile errors on the first try. </p>\n\n<p>People who care about quality are usually the ones that able to deliver the best and stable release than the ones that tries to hurry and not manage or test their code properly.</p>\n\n<p>--</p>\n',0,0,0,4500391,'https://www.gravatar.com/avatar/c0b4802abd3a19ef158b23936ddf9d83?s=128&d=identicon&r=PG&f=1'),(13175,1,'2016-03-14T17:52:01.257','Ran Levy',NULL,'2016-03-14T17:52:01.257',NULL,NULL,NULL,NULL,1,0,0,2677819,NULL),(13178,1,'2016-03-15T10:31:33.013','user1212708',NULL,'2016-03-16T19:03:45.000',NULL,NULL,NULL,NULL,0,0,0,1252607,'https://www.gravatar.com/avatar/b1bb75f22757be0fc8bacf0a49c40964?s=128&d=identicon&r=PG'),(13179,1,'2016-03-15T10:51:39.133','ogfizzle',NULL,'2016-03-15T10:51:39.133',NULL,NULL,34,'<p>Computers,Internet,Engineering,Sports,Traveling,Electronic Music</p>\n',0,0,0,1344522,'https://www.gravatar.com/avatar/52f95e08261312b55b2345901e5e804a?s=128&d=identicon&r=PG'),(13180,1,'2016-03-15T11:34:36.100','user50768',NULL,'2016-03-15T11:34:36.100',NULL,NULL,NULL,NULL,0,0,0,8045822,'https://www.gravatar.com/avatar/b9024bd9134f6a58181d5a4033ed8937?s=128&d=identicon&r=PG&f=1'),(13181,1,'2016-03-15T12:39:45.673','DRussell',NULL,'2016-03-15T12:39:45.673',NULL,NULL,NULL,NULL,1,0,0,3866118,'https://www.gravatar.com/avatar/a832b68cac5f03b42c982784abeefc4c?s=128&d=identicon&r=PG&f=1'),(13182,1,'2016-03-15T16:00:54.040','mcousin',NULL,'2016-03-15T16:00:54.040','https://www