','Seattle, WA',NULL,'<p>Ive been programming for 35 years and Im still learning new things. My major interests recently are programming models and methods for concurrency, applications of functional programming, and doing interesting things with Mathematica.</p>\n\n<p>BTW, #SOreadytohelp</p>\n',0,0,0,391098,'https://i.stack.imgur.com/iux9g.png?s=128&g=1'),(13404,1,'2016-04-10T01:43:35.297','Andreas Orthey',NULL,'2016-04-10T01:59:26.967',NULL,NULL,NULL,NULL,0,0,0,1067744,'https://www.gravatar.com/avatar/b6500b00e180474ebaff2fefeda48cf0?s=128&d=identicon&r=PG'),(13405,101,'2016-04-10T04:36:03.283','Blaszard',NULL,'2017-08-27T00:05:08.280','http://None','All over the world',NULL,'<p>Im here to gain knowledge and insights on a variety of fields Im interested in.</p>\n\n<p>Specifically,</p>\n\n<ul>\n<li>Programming &amp; Software Development (Python and R, sometimes JavaScript/node.js; no longer use Swift)</li>\n<li>Data Science, Machine Learning, AI, &amp; statistics</li>\n<li>Travel (Im a perpetual traveler)</li>\n<li>Language (Mandarin, Spanish, Italian; sometimes Russian and Korean)</li>\n<li>Politics, Economics, and Finance (pretty new to this field so must learn a lot)</li>\n</ul>\n\n<p>Currently (in 2017), my primary interest is in Deep Neural Network and Mandarin</p>\n\n<hr>\n\n<p>PS: Im not a native English speaker; if you find some of my grammars and expressions wrong, dont hesitate to correct it. Ill appreciate it </p>\n',0,0,0,2738792,'https://www.gravatar.com/avatar/dffc6592b036726df9ef4c1e8beeea1f?s=128&d=identicon&r=PG&f=1'),(13406,1,'2016-04-10T06:40:19.087','Scott. A',NULL,'2016-05-13T17:55:29.850',NULL,NULL,NULL,NULL,0,0,0,8217454,'https://www.gravatar.com/avatar/2e7d7a30c6e637b7e05b7adf21625e3d?s=128&d=identicon&r=PG&f=1'),(13407,21,'2016-04-10T08:52:28.383','hck3r',NULL,'2016-08-30T11:33:28.687',NULL,NULL,NULL,NULL,0,1,0,5403070,'https://www.gravatar.com/avatar/822bd42bb328cf1507bfd16118797618?s=128&d=identicon&r=PG&f=1'),(13408,1,'2016-04-10T18:47:30.857','Assaf',NULL,'2016-04-11T04:42:22.470',NULL,NULL,NULL,NULL,0,0,0,8220380,'https://www.gravatar.com/avatar/334488c29f4829d64a7c52d96b731244?s=128&d=identicon&r=PG&f=1'),(13409,1,'2016-04-10T20:44:07.657','TaijaQ',NULL,'2016-04-10T20:44:07.657',NULL,NULL,NULL,'<h3>How did I get here?</h3>\n\n<p>A year ago I was collaborating on a small motion control project, learning new things, and now, without any real educattion or experience in the field, Ive been working as a Software Developer since the Spring of 2016. I guess some times dreams do come true? Right now, Im pretty much a workaholic, but I enjoy it so I dont mind. I have lots of personal projects unfinished or in planning, and many other passions outside just coding.</p>\n\n<p>Like..\n* Video games\n* Productivity maximization\n* Weird shows like Rick and Morty\n* Virtual reality, AR and automation\n* Nature and biology\n* DYI projects and random tech</p>\n',0,0,0,8219494,'https://i.stack.imgur.com/JpFLq.jpg?s=128&g=1'),(13410,1,'2016-04-10T23:07:59.800','Sire_Clifford ',NULL,'2016-05-03T04:13:19.323',NULL,NULL,NULL,NULL,0,0,0,7011193,'https://i.stack.imgur.com/G77d1.jpg'),(13411,101,'2016-04-11T02:34:29.427','Nick',NULL,'2016-04-11T02:34:29.427',NULL,NULL,NULL,'<p>Programmer by day, Saving lives at night and most weekends volunteering at sea rescue.</p>\n\n<p>Winner of the Australian national DDLS Powershell competition.</p>\n',0,0,0,7185404,'https://i.stack.imgur.com/VPiCC.png?s=128&g=1'),(13412,101,'2016-04-11T08:36:55.063','Wai Ha Lee',NULL,'2016-10-31T09:01:47.207',NULL,'Nottingham, United Kingdom',NULL,'<p></p>\n',0,0,0,1445276,'https://www.gravatar.com/avatar/2d106de3dec9586b56ed7f110497689e?s=128&d=identicon&r=PG'),(13413,1,'2016-04-11T09:37:40.220','Josho Kratos',NULL,'2016-04-11T10:59:28.613',NULL,NULL,NULL,NULL,0,0,0,8224907,'https://graph.facebook.com/224837611207247/picture?type=large'),(13414,101,'2016-04-11T09:50:25.407','Igor Stoppa',NULL,'2016-05-24T20:41:34.960',NULL,NULL,NULL,NULL,1,4,0,2