hilosophic mind with thoughts of existence on a daily basis. A person who wants to learn Latin fluently and unravel the wonders of mystery.</p>\n',0,0,0,8287199,'https://i.stack.imgur.com/AR5O7.jpg'),(13500,1,'2016-04-20T22:07:54.140','Zuhaib Ahmad',NULL,'2016-04-20T22:07:54.140','http://zuhaibahmad.com','Karachi, Pakistan',23,'<p>I am a passionate and curiosity-driven Computer Science graduate offering more than 2 years  hands-on experience of android application development. I like building software that adds value to peoples lives. Be it a mobile application helping them finding their best deals in town or a video game providing some quality entertainment after a hard day. </p>\n\n<p>After devoting last 3 years learning and working on professional projects with most of the widely used technologies, currently seeking a career in the field of information technology as Mobile Application and/or Software Developer in an innovative Learning-Organization. </p>\n\n<p>My fields of interest include Android Application Development and Unity3D Game Development.\nAfter having several successful projects on the freelance market and a long-running partnership with an international startup; currently looking for experience and reputation in the discipline with new ideas in contemplation. Moreover, exploring opportunities for Social Entrepreneurship.</p>\n',0,0,0,2846688,'https://i.stack.imgur.com/7K6fU.jpg'),(13501,1,'2016-04-21T00:14:15.927','user49381',NULL,'2016-10-12T12:43:24.457',NULL,NULL,NULL,NULL,0,0,0,7656834,'https://www.gravatar.com/avatar/14f17648209766915d997fd984727326?s=128&d=identicon&r=PG'),(13502,18,'2016-04-21T01:07:03.550','Catch.Me',NULL,'2017-06-28T17:56:00.743',NULL,NULL,NULL,NULL,1,0,0,7099025,'https://www.gravatar.com/avatar/01a810abccc0afb6dedcdcf7f645260e?s=128&d=identicon&r=PG&f=1'),(13503,1,'2016-04-21T06:14:50.183','Sanket',NULL,'2017-05-25T15:24:14.247',NULL,NULL,NULL,NULL,0,0,0,6548863,'https://lh4.googleusercontent.com/-3k-gTvtmBe4/AAAAAAAAAAI/A