=128&d=identicon&r=PG&f=1'),(13512,6,'2016-04-21T20:48:09.070','VeryAwkwardCake',NULL,'2016-08-06T19:35:38.603',NULL,NULL,NULL,'<p>Likes modding OSes, like putting an autorun Tkinter GUI on Raspbian, then disabling ctrl+alt+delete for task manager. (Bit of a nerd!) #SOreadytohelp Stack Overflow has saved me several hours and lots of stress, not to mention invited me into a world of helpful &amp; kind developers!</p>\n',0,0,0,4804841,'https://i.stack.imgur.com/gh3Jg.png?s=128&g=1'),(13513,6,'2016-04-22T02:03:53.960','lejiang',NULL,'2016-04-24T04:42:58.907',NULL,NULL,NULL,NULL,0,0,0,8299294,NULL),(13514,1,'2016-04-22T06:48:04.987','Juracy Emanuel',NULL,'2016-04-22T06:48:04.987',NULL,NULL,NULL,NULL,0,0,0,3218607,'https://www.gravatar.com/avatar/ff373f2d2f28ccb6ee8aa345e632c88e?s=128&d=identicon&r=PG&f=1'),(13515,1,'2016-04-22T07:03:01.960','Isura Nimalasiri',NULL,'2016-04-22T07:03:01.960',NULL,NULL,NULL,NULL,0,0,0,5139928,'https://graph.facebook.com/100000740982477/picture?type=large'),(13516,1,'2016-04-22T09:49:40.663','Rama Gowtham',NULL,'2016-11-21T13:50:33.797',NULL,NULL,NULL,NULL,0,0,0,7604492,'https://graph.facebook.com/10208057542586341/picture?type=large'),(13517,1,'2016-04-22T13:00:09.773','Sanjiv',NULL,'2016-04-22T13:00:09.773',NULL,NULL,NULL,NULL,0,0,0,8153176,'https://www.gravatar.com/avatar/8b4bb7981004e286b64f653d9fae1204?s=128&d=identicon&r=PG&f=1'),(13518,1,'2016-04-22T14:03:43.267','Samuel Milligan',NULL,'2016-04-22T14:03:43.267',NULL,NULL,NULL,NULL,0,0,0,7845326,'https://lh5.googleusercontent.com/-h0PZX_bcq1Q/AAAAAAAAAAI/AAAAAAAABNA/pkvjJFe5wp4/photo.jpg?sz=128'),(13519,1,'2016-04-22T15:52:26.383','InfiniteMonkeys',NULL,'2016-04-22T15:52:26.383',NULL,NULL,NULL,NULL,0,0,0,87212,'https://www.gravatar.com/avatar/e50325c75b401f959192e713f9ce3b0a?s=128&d=identicon&r=PG'),(13520,1,'2016-04-22T16:50:19.597','nosn',NULL,'2016-04-22T16:50:19.597',NULL,NULL,NULL,NULL,0,0,0,8255986,'https://www.gravatar.com/avatar/de5e0239dd28d5f53b7c35cc5b3ec61b?s=128&d=identicon&r=PG&f=1'),(13521,6,'2016-04-22T17:30:35.500','cabama',NULL,'2017-04-16T23:27:45.243',NULL,'Spain, Cuenca',25,NULL,1,0,0,3661319,'https://www.gravatar.com/avatar/e1d78b1389268d541125f83ae786ba27?s=128&d=identicon&r=PG&f=1'),(13522,1,'2016-04-23T12:32:40.920','Dimitris Papadakis',NULL,'2016-04-23T12:32:40.920',NULL,'Athens, Greece',33,'<p>A scholar, a culinary arts expert, a musician, a sportsman.</p>\n\n<p>I work mainly through an office in Athens, Greece by using a workstation computer with 3 monitors. I am mathematician with strong interest on logic and foundations, on mathematical modelling and with a taste for history of mathematics and generally of science. </p>\n\n<p>I work mostly on MATLAB and Microsofts .NET cluster of technologies. I also use Autodesks applications and Adobes Creative Suite and through the years Ive developed extensive expertise on Free and Open Source Software.</p>\n\n<p>To stay informed I am subscribed to Springers, Oxfords, Elseviers newsletters and those of other institutes or organizations. For news stories I consult mainly Reuters and Google news.</p>\n',0,0,0,6282384,'https://graph.facebook.com/387161644802281/picture?type=large'),(13523,101,'2016-04-23T17:55:15.977','eakkas',NULL,'2016-04-24T16:18:16.433','http://www.globalme.net','Vancouver, BC',38,'<p>I am a localization professional. I have spent most of my professional career in localization and worked in small translation agencies to large enterprise. My positions have more commonly been on the technical and consulting side of localization.</p>\n\n<p>I currently run Globalme Language &amp; Technology which I co-founded. Globalme is a language solutions provider. If you ask \"what kind of solution a language could require?\", that most likely means you have not met with localization. You will know when you do and thats the time you want to contact Globalme.</p>\n\n<p>My main responsibility at Globalme is developing the strategy for our technology offerings and the company vision.</p>\n',0,0,0,41148,'https://www.gravatar.com/avatar/f6b273d2f86af82167629fccb1c57e51?s=128&d=identicon&r=PG'),(13524,1,'2016-04-23T19:06:58.737','Che Oshn',NULL,'2016-04-23T19:06:58.737',NULL,NULL,NULL,NULL,0,0,0,6246022,'https://lh4.googleusercontent.com/-J8NN44zKY90/AAAAAAAAAAI/AAAAAAAACFw/0my4k20VKd0/photo.jpg?sz=128'),(13525,1,'2016-04-23T20:40:40.570','user850760',NULL,'2016-04-23T20:40:40.570',NULL,NULL,NULL,NULL,0,0,0,453647,'https://www.gravatar.com/avatar/a88ad15cbbfa122d73cf284dd9e262d9?s=128&d=identicon&r=PG'),(13526,1,'2016-04-24T00:28:02.387','Ben Holfeld',NULL,'2016-04-24T00:28:02.387','http://holfeld.com',NULL,NULL,'<p>Creating Apps for Business and Education</p>\n',0,0,0,1171464,'https://i.stack.imgur.com/7TCOn.jpg?s=128&g=1'),(13527,1,'2016-04-24T06:23:26.047','Luigi',NULL,'2016-04-24T06:23:26.047',NULL,'Irvine, CA, United States',NULL,NULL,0,0,0,1173792,'https://i.stack.imgur.com/OUEg4.png'),(13528,101,'2016-04-24T08:17:27.357','Marius',NULL,'2016-04-25T13:57:36.183',NULL,'Berlin, Germany',NULL,NULL,0,0,0,2824647,'https://www.gravatar.com/avatar/c9478ead772612f9f06480dfa5b6429d?s=128&d=identicon&r=PG'),(13529,103,'2016-04-24T08:44:19.477','YakovL',NULL,'2016-04-24T09:54:49.873','','Moscow, Russia',NULL,'',0,1,0,4965921,'https://www.gravatar.com/avatar/54754c59e35649b7d22d70b72ce2989a?s=128&d=identicon&r=PG&f=1'),(13530,1,'2016-04-24T13:49:33.770','Kevin Joseph',NULL,'2016-04-24T13:49:33.770',NULL,NULL,NULL,NULL,0,0,0,5797320,'https://lh4.googleusercontent.com/-XwJSwjN2wWk/AAAAAAAAAAI/AAAAAAAAApY/rvtLV5O8LXk/photo.jpg?sz=128'),(13531,1,'2016-04-24T16:56:02.490','Sahil Sharma',NULL,'2016-04-24T17:15:23.247',NULL,NULL,NULL,NULL,0,0,0,7408009,'https://lh6.googleusercontent.com/-N1KahPb4u8w/AAAAAAAAAAI/AAAAAAAAACU/AmJrZR5DoeI/photo.jpg?sz=128'),(13532,1,'2016-04-25T01:47:07.913','Danielh Carranza',NULL,'2016-04-25T01:47:07.913',NULL,NULL,NULL,NULL,0,0,0,8315689,'https://www.gravatar.com/avatar/84fdd106994e7a65f712108689e0b9c0?s=128&d=identicon&r=PG