rrently support the development of Android/Windows applications for subject data collection and participant interaction, for the Army Research Labs Cognition and Neuroergonomics Collaborative Technology Alliance (CAN CTA).</p>\n\n<h1>SOreadytohelp</h1>\n',0,1,0,4945567,'https://i.stack.imgur.com/DRJID.png'),(13540,118,'2016-04-26T05:50:09.307','Eilia',NULL,'2017-04-20T14:48:49.490',NULL,NULL,NULL,NULL,2,5,0,5545296,'https://i.stack.imgur.com/NWYXq.jpg?s=128&g=1'),(13541,11,'2016-04-26T06:11:07.977','prappolt',NULL,'2016-10-11T00:52:39.940',NULL,'San Francisco, CA, United States',NULL,'<p>Need to get more active on here...</p>\n',0,0,0,4165039,'https://i.stack.imgur.com/ftXJF.png?s=128&g=1'),(13542,1,'2016-04-26T09:00:54.733','langki05',NULL,'2016-04-26T09:00:54.733',NULL,'Mysore, India',27,'<p>An explorer and a dreamer.</p>\n',0,0,0,4349603,'https://www.gravatar.com/avatar/9aaf89f23a1d85eb626d72bda9972802?s=128&d=identicon&r=PG&f=1'),(13544,101,'2016-04-26T12:50:27.440','rraallvv',NULL,'2017-08-15T16:38:37.487',NULL,NULL,NULL,NULL,0,0,0,1541936,'https://i.stack.imgur.com/UNm8H.png'),(13545,101,'2016-04-26T13:25:17.447','holocronweaver',NULL,'2016-04-26T13:25:17.447',NULL,'United States',NULL,NULL,0,2,0,158106,NULL),(13546,1,'2016-04-26T17:10:17.973','Albert Xu',NULL,'2016-04-26T17:10:17.973',NULL,NULL,NULL,NULL,0,0,0,6675773,'https://lh3.googleusercontent.com/-ykiUIZ5peBg/AAAAAAAAAAI/AAAAAAAABgI/09KFYEco5Do/photo.jpg?sz=128'),(13547,6,'2016-04-26T17:32:24.723','Rishabh',NULL,'2016-04-27T16:10:22.510',NULL,NULL,NULL,NULL,0,0,0,7819995,'https://www.gravatar.com/avatar/d79286ac01fbf55bc27f5531b694f175?s=128&d=identicon&r=PG&f=1'),(13548,1,'2016-04-26T19:35:59.653','55 Cancri',NULL,'2016-04-27T01:30:10.527',NULL,NULL,NULL,NULL,0,0,0,8089346,'https://i.stack.imgur.com/WhgwA.jpg?s=128&g=1'),(13549,1,'2016-04-26T21:04:58.800','user2026580',NULL,'2016-04-26T21:04:58.800',NULL,NULL,NULL,NULL,0,0,0,2307633,'https://www.gravatar.com/avatar/42b00bb86152d8795397f2bdaa770314?s=12