r Science. I love programming in Java.</p>\n',0,0,0,6181005,'https://lh3.googleusercontent.com/-ArDOPEtYeyE/AAAAAAAAAAI/AAAAAAAAAAA/YeWau6kWbA0/photo.jpg?sz=128'),(13605,101,'2016-05-04T00:25:06.473','Trevor Hickey',NULL,'2016-05-04T00:25:06.473','https://github.com/luxe','Pittsburgh, PA, United States',25,'<p>Im a big fan of legos and literature, so you can imagine me in front of a computer.</p>\n',0,0,0,809083,'https://i.stack.imgur.com/etRsI.jpg?s=128&g=1'),(13606,1,'2016-05-04T11:54:15.383','th3int3rn',NULL,'2016-05-11T07:26:37.103',NULL,NULL,NULL,NULL,0,0,0,8377449,'https://www.gravatar.com/avatar/9c1d0e60e7d421b219e1684e1185c9e4?s=128&d=identicon&r=PG&f=1'),(13607,1,'2016-05-04T12:01:32.220','Ravi  Prakash Yadav',NULL,'2017-04-07T21:09:59.180',NULL,'Bangalore, Karnataka, India',23,'<p>I am Nobody, Ask Me Anything!</p>\n',0,0,0,7951057,'https://i.stack.imgur.com/FZPMM.jpg?s=128&g=1'),(13609,1,'2016-05-04T15:31:34.200','albseb',NULL,'2016-11-24T11:32:54.273',NULL,'Deep Sea, Newport Beach, CA, United States',NULL,'<p>Thinker to a point. Doer after that.</p>\n',0,0,0,8335560,'https://www.gravatar.com/avatar/3fcc67fba78aac3dc5e9742a1015b51e?s=128&d=identicon&r=PG&f=1'),(13610,1,'2016-05-04T16:36:56.003','DeusXMachina',NULL,'2017-03-27T19:36:42.050',NULL,NULL,NULL,NULL,0,0,0,4955209,'https://www.gravatar.com/avatar/7ab77d3f35620ef1ee5efdf54a4d19bc?s=128&d=identicon&r=PG&f=1'),(13611,101,'2016-05-04T18:13:37.697','Guus',NULL,'2016-05-04T18:13:37.697',NULL,'Netherlands',50,'<p>Software developer.\nElectronics hobbyist.</p>\n',0,1,0,143382,NULL),(13612,101,'2016-05-04T23:55:35.023','nitsua60',NULL,'2016-05-04T23:55:35.023',NULL,'Northeast USA',NULL,'<p>Elected moderator on RPGSE: if you have <em>any</em> concerns, kudos, suggestions, questions, please find me in RPG General Chat.</p>\n\n<p><strong>Playing:</strong> CoS w/ high-schoolers (Ftr1/ClX super-radiant frontliner), T3 AL modules (Ro5/Ftrx Sharpshooter extraordinaire)</p>\n\n<p><strong>Running:</strong> 5e Starter Set for 8 year-olds, 5e Sunless Citadel for co-workers</p>\n\n<p><strong>Prepping:</strong> ToA for AL in the fall, two student-DMs to take the reins in the HS group, and an <a href=\"http://theangrygm.com/category/megadungeon/\" rel=\"nofollow noreferrer\">Angry Megadungeon</a></p>\n\n<p><strong>Current &amp; Last 6 Books:</strong> Lipscomb, <em>The King is Dead: The Last Will and Testament of King Henry VIII</em>; Child, <em>Night School</em>; Buckley, <em>The Relic Master</em>; Reinhart &amp; Rogoff, <em>This Time is Different</em>; Scott, <em>Ancient Worlds</em>; Gaiman, <em>Norse Mythology</em>. (Oh, and Petersons <em>Playing at the World</em> and Herodotus <em>Histories</em> are perennially \"current\" reads.)</p>\n',0,0,0,6656817,'https://i.stack.imgur.com/eeiKk.png?s=128&g=1'),(13614,1,'2016-05-05T00:36:44.190','JBOND',NULL,'2016-05-05T00:58:13.617',NULL,NULL,NULL,NULL,0,0,0,7685350,'https://www.gravatar.com/avatar/5a872c38a4ee5e90b1dd3838d7e56af7?s=128&d=identicon&r=PG&f=1'),(13616,101,'2016-05-05T15:14:02.007','Wrzlprmft',NULL,'2017-01-30T20:46:40.113',NULL,'Germany',NULL,'<p>PHD student of physics dealing with complex systems, chaos theory, scientific computing, networks, analysis methods, and extreme events. To get an idea what I am doing, take a look at <a href=\"http://arxiv.org/find/all/1/au:+Ansmann%5fGerrit/0/1/0/all/0/1\" rel=\"nofollow noreferrer\">my publications</a> or <a href=\"http://idw-online.de/de/news646752\" rel=\"nofollow noreferrer\">this journalistical report on my work</a>.</p>\n\n<p>Blackletter enthusiast. <a href=\"http://typography.guru/seven-questions-for/gerrit-ansmann-unifraktur-maguntia/\" rel=\"nofollow noreferrer\">Here</a> is an interview with me on my work on <a href=\"http://unifraktur.sourceforge.net/\" rel=\"nofollow noreferrer\">Unifraktur Maguntia</a>.</p>\n\n<p>My username is pronounced [ v l p m ft] (the first <em>r,</em> the <em>l,</em> and the <em>m</em> are vocalic) and comes from a list of names you should not give to your child, which in turn got it from <a href=\"http://en.wikipedia.org/wiki/Karl_Valentin\" rel=\"nofollow noreferrer\">this guy</a>.</p>\n',0,0,0,2437491,'https://i.stack.imgur.com/CXBjS.png'),(13619,1,'2016-05-05T17:56:58.910','Alex',NULL,'2016-07-24T16:11:30.887',NULL,NULL,NULL,NULL,0,0,0,6572688,'https://www.gravatar.com/avatar/bc8bfecad02423ae6a908876358f85f5?s=128&d=identicon&r=PG&f=1'),(13620,1,'2016-05-05T18:57:43.167','Bronan',NULL,'2016-05-05T18:57:43.167',NULL,NULL,NULL,NULL,0,0,0,8387264,'https://www.gravatar.com/avatar/d7c72ccdf7ea511092b52017f9909682?s=128&d=identicon&r=PG&f=1'),(13621,1,'2016-05-05T22:12:33.433','Alrekr',NULL,'2016-05-11T21:51:24.233',NULL,'Denmark',NULL,NULL,0,0,0,1944354,'https://www.gravatar.com/avatar/b551f1bc4243bc5fbf1f4346ed795543?s=128&d=identicon&r=PG'),(13622,1,'2016-05-06T00:58:54.730','Free Debreuil',NULL,'2016-05-06T00:58:54.730',NULL,NULL,NULL,NULL,0,0,0,6395621,'https://lh3.googleusercontent.com/-N0UwX_X7t9k/AAAAAAAAAAI/AAAAAAAAEkw/29sQBNdDJj0/photo.jpg?sz=128'),(13623,1,'2016-05-06T01:43:27.350','davi101',NULL,'2016-05-06T01:43:27.350',NULL,NULL,NULL,NULL,0,0,0,8388796,'https://www.gravatar.com/avatar/8c8d9ee9a08a50c7f8f3890cad7f3cc4?s=128&d=identicon&r=PG&f=1'),(13624,101,'2016-05-06T11:16:57.743','Martin v. L wis',NULL,'2017-06-02T09:25:06.400','http://prof.beuth-hochschule.de/loewis/','Berlin, Germany',47,NULL,0,0,0,15562,'https://www.gravatar.com/avatar/3acb8bae5a2b5a28f6fe522a4ea9b873?s=128&d=identicon&r=PG'),(13625,1,'2016-05-06T11:26:06.680','Syed Ali Hamza',NULL,'2016-05-06T13:39:32.733','https://syedalihamza.wordpress.com/','Lahore, Punjab, Pakistan',NULL,'<p>Physics. Computers. Overthinking. Linux. Loving. Hating. Caring. Ignoring. Science. Maths. Religion.</p>\n',0,0,0,7021037,'https://graph.facebook.com/893741277328491/picture?type=large'),(13626,1,'2016-05-06T11:29:59.507','anoxis',NULL,'2016-05-06T11:29:59.507','http://linkedin.com/in/apohilko',NULL,NULL,NULL,2,0,0,4403175,'https://www.gravatar.