atskul',NULL,'2017-08-18T05:23:31.003',NULL,'Pittsburgh, PA',35,NULL,0,0,0,37371,NULL),(13715,1,'2016-05-16T17:49:46.970','American pie',NULL,'2017-08-02T09:19:35.837',NULL,NULL,NULL,NULL,0,0,0,6359924,'https://www.gravatar.com/avatar/2153ab01cc8dc7e4fe2bdf2c8cf5685c?s=128&d=identicon&r=PG&f=1'),(13716,101,'2016-05-17T05:14:23.277','Stanley',NULL,'2016-06-21T09:29:39.153',NULL,NULL,NULL,'<p>Apart from being a tech enthusiast, I think we should not consume endangered species of fish and land animals for food or other purposes.  There are always lots of alternatives ... </p>\n\n<p>Would also bring along my own bags when go shopping so that I don t have to consume unnecessary plastic bags.  It wouldn t help much as most of the things are already over prepackaged.  But it s a comforting feeling knowing that an extra bag is saved from being a pollutant.</p>\n\n<hr>\n\n<p>Although having only been an Apple Fan for around a year, upon hearing news about Mr Steve Jobs passing feels like loosing a close relative. May his good work, commitment to practical but elegant designs be carried on by the good people and teams at Apple indefinitely.</p>\n',0,0,0,268227,'https://www.gravatar.com/avatar/378581a71c050619930cf1f9fd44fb60?s=128&d=identicon&r=PG'),(13717,1,'2016-05-17T06:06:59.967','user340140',NULL,'2016-10-20T23:18:41.060',NULL,NULL,NULL,NULL,0,0,0,8457087,'https://www.gravatar.com/avatar/220c672d8e7eccc018503d4e29a3c3f6?s=128&d=identicon&r=PG'),(13718,1,'2016-05-17T06:47:56.813','Ssekiziyivu Godfrey',NULL,'2016-11-09T08:39:40.840',NULL,'Uganda',22,'<p>Am still the best software student for 2014 at Bugema University and by the time I will complete, I will be far with codes.</p>\n\n<p>I love coding and my first projects will be out soon.</p>\n\n<p>Am setting up a computer and Robotics Company : Gramaxic Limited</p>\n',0,0,0,7944424,NULL),(13719,101,'2016-05-17T09:46:22.100','vsz',NULL,'2016-10-03T17:54:52.077',NULL,'Romania',32,'<p></p>\n',0,4,0,414546,'https://www.gravata