, but I happen to like it.\"</p>\n</blockquote>\n\n<p><del>And take your Google Chrome with you! You havent got a leg to stand on and you know it!</del><br>\nLike Arthur Dents house, IE has finally been demolished. Now, what happened to the bypass and the Earth?</p>\n',0,0,0,6784526,NULL),(13765,108,'2016-05-22T17:20:05.200','A. Sarid',NULL,'2016-10-30T13:58:42.840','https://linkedin.com/in/asaf-sarid-78463464','Beersheba, Israel',NULL,'<p>Purple watermelon.</p>\n',0,3,0,3769610,'https://www.gravatar.com/avatar/6873ee643c6e04fa734682dc57104b5c?s=128&d=identicon&r=PG&f=1'),(13766,101,'2016-05-22T22:11:04.240','ev3commander',NULL,'2016-09-15T01:02:27.813',NULL,NULL,NULL,'<p>My first username was ev3commander<br>\nMy second username was blockcoder1392</p>\n',0,0,0,7116541,'https://i.stack.imgur.com/SVEIY.jpg?s=128&g=1'),(13768,1,'2016-05-23T11:21:05.173','Dronavatorvenky',NULL,'2016-05-24T06:36:39.813','http://www.zuppa.io/','Chennai, Tamil Nadu, India',23,NULL,0,0,0,8496289,'https://i.stack.imgur.com/NcirB.jpg'),(13769,1,'2016-05-23T12:08:30.937','Mathew Jonathan Kelly',NULL,'2016-05-23T12:08:30.937',NULL,NULL,NULL,NULL,0,0,0,8496509,'https://www.gravatar.com/avatar/9ca985c893cbbf1b3a999b2c5d5f7fd4?s=128&d=identicon&r=PG&f=1'),(13770,1,'2016-05-24T01:40:55.410','allons16y',NULL,'2016-05-24T01:40:55.410',NULL,NULL,NULL,NULL,0,0,0,8500517,'https://www.gravatar.com/avatar/1335a73648ea1525cc335ee78030a342?s=128&d=identicon&r=PG&f=1'),(13771,1,'2016-05-24T03:53:38.803','Tom OConnell',NULL,'2016-05-24T03:53:38.803',NULL,NULL,NULL,NULL,0,0,0,3287948,'https://www.gravatar.com/avatar/1a42c530207a2ca286c80061e447a4cd?s=128&d=identicon&r=PG&f=1'),(13772,101,'2016-05-24T04:14:17.960','TRiNE',NULL,'2016-05-24T04:14:17.960','http://quota.wearetrying.info','Sri Lanka',NULL,'<p>My ambition is to be the <em>light</em>.</p>\n\n<blockquote>\n  <p><strong>Everything has been made visible by invisible light.</strong></p>\n</blockquote>\n',1,0,0,4700831,'https://i.stack.imgur.com/fauwH.png?s=128&g=1'),(13773,101,'2016-05-24T06:01:14.817','Arnfinn',NULL,'2016-11-28T20:46:34.920',NULL,'Newcastle, New South Wales, Australia',NULL,'<p>I could be happy if I believed a lot of rubbish.</p>\n',0,0,0,8466056,'https://lh6.googleusercontent.com/-BkE9TH3P2lU/AAAAAAAAAAI/AAAAAAAAFl0/YRdspp5AP0E/photo.jpg?sz=128'),(13774,6,'2016-05-24T08:16:48.987','siddiqui_902003',NULL,'2017-08-17T10:20:48.043',NULL,NULL,NULL,NULL,0,0,0,7363277,'https://www.gravatar.com/avatar/10225cafb355c7fded28a5ff466557da?s=128&d=identicon&r=PG&f=1'),(13775,321,'2016-05-24T09:06:53.457','Mark',NULL,'2016-08-25T20:51:10.870',NULL,'Long Beach, CA, United States',NULL,'<p>Geek-for-Hire, specializing in exorbitant rates.</p>\n',1,6,0,8259797,'https://i.stack.imgur.com/VeNph.jpg?s=128&g=1'),(13776,1,'2016-05-24T17:40:29.103','Ragnor',NULL,'2016-05-24T17:40:29.103',NULL,'Denmark',31,'<p>I am just some guy looking to satisfy my own curiosity while doing what I enjoy the most in this world - helping others. Science and technology are my strong points, but I have <em>some</em> knowledge about pretty much anything, and a good intuition about how things work.</p>\n\n<p>I am pretty good at relaying information, having done so most of my life. For instance, at the age of 6 or 7 I explained to my grandmother how pneumatics/hydraulics works including how varying cylinder dimensions affect the power transfer, after having figured it out myself playing with Lego Technic.</p>\n\n<p>In my posts I value being concise quite highly, and if there is anything I would like to share that I am not completely sure about, I will state so clearly, or do a fact check before posting.</p>\n\n<p>Oh, by the way, I should add the standard <em>\"Sorry for my language, Im not native in English\"</em> here. ;-)</p>\n',0,0,0,4117549,'https://www.gravatar.com/avatar/cb36df2355805ce6f7f96d9aae36d452?s=128&d=identicon&r=PG&f=1'),(13777,1,'2016-05-24T18:38:04.317','AAA',NULL,'2017-03-31T10:35:24.787',NULL,NULL,NULL,NULL,1,0,0,3391910,