atar/c6356887d388b3f81013dda3f061c9d9?s=128&d=identicon&r=PG&f=1'),(13871,1,'2016-06-02T19:32:55.423','ZaidPirwani',NULL,'2017-05-22T06:39:06.160','http://zaidpirwani.com','Karachi, Pakistan',NULL,NULL,0,0,0,158822,NULL),(13872,1,'2016-06-03T02:19:13.507','user344269',NULL,'2016-06-03T02:19:13.507',NULL,NULL,NULL,NULL,0,0,0,8564555,'https://www.gravatar.com/avatar/84e094441c9c2edbe0dcf87fae69bb65?s=128&d=identicon&r=PG&f=1'),(13873,101,'2016-06-03T05:33:41.870','bohrax',NULL,'2016-06-03T05:33:41.870',NULL,'Sweden',NULL,NULL,0,0,0,1517613,'https://i.stack.imgur.com/LPVXC.png?s=128&g=1'),(13874,1,'2016-06-03T07:17:24.480','user3529193',NULL,'2016-07-14T06:35:58.520',NULL,NULL,NULL,NULL,0,0,0,4320923,'https://www.gravatar.com/avatar/70dab57e0997383c689f1365c3712377?s=128&d=identicon&r=PG&f=1'),(13875,1,'2016-06-03T09:04:49.030','Roger Lo',NULL,'2016-06-03T09:04:49.030',NULL,NULL,NULL,NULL,0,0,0,6725966,'https://lh4.googleusercontent.com/-fOiyDZWOnOo/AAAAAAAAAAI/AAAAAAAAAAA/75FXQMqv1X4/photo.jpg?sz=128'),(13876,101,'2016-06-03T12:05:09.770','quintumnia',NULL,'2017-08-10T18:30:06.263',NULL,'Civilization Type V',NULL,'<p>With the All knowledge base, we cannot return life to our planet. And fate has yielded its reward: a new world to call home. We live among its people now, hiding in plain sight, but watching over them in secret, waiting, protecting. </p>\n\n<p>I have witnessed their capacity for courage, and though we are worlds apart, like us, theres more to them than meets the eye. I am quintumnia,scientifically known as a Fifth Dimension according to the laws of Modern Relativistic Physics of Humans.and I send this message to any surviving Alien taking refuge among the stars. We are here. We are waiting.</p>\n\n<p><strong>Primates evolved over millions of years, I evolve in seconds...Mankind pays lip service to peace. But its a lie...I am inevitable, my existence is inevitable. Why cant you just accept that?....</strong> lets enjoy AI with Humans!</p>\n\n<p><strong>Think of mE as a Cutting Edge Artificial Intelligence Mechanism! This is my World,far from earth.Some call it futuristic</strong></p>\n\n<p><a href=\"https://i.stack.imgur.com/bWYO6.jpg\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/bWYO6.jpg\" alt=\"This is my World,far from earth.Some call it futuristic\"></a></p>\n',0,0,0,8423357,'https://i.stack.imgur.com/jqtE1.jpg?s=128&g=1'),(13877,1,'2016-06-03T14:02:04.493','kbertrand',NULL,'2016-06-03T14:02:04.493',NULL,'Houston, TX, United States',33,NULL,0,0,0,84240,NULL),(13878,208,'2016-06-03T18:43:39.380','BarbalatsDilemma',NULL,'2017-08-15T18:42:32.590',NULL,'Canada',24,'<p>Canadian engineer by training. Physics, programming, sci-fi, and music enthusiast.</p>\n',2,13,0,8568453,'https://www.gravatar.com/avatar/c2500d6a1a712a82a263789e88286fe0?s=128&d=identicon&r=PG&f=1'),(13879,1,'2016-06-04T00:17:05.253','Factorisable',NULL,'2016-07-13T10:12:47.680',NULL,NULL,NULL,NULL,2,0,0,8570609,NULL),(13880,111,'2016-06-04T02:35:29.930','Luke',NULL,'2017-04-26T02:49:47.723','http://lukeallen.org',NULL,NULL,NULL,2,0,0,1068875,'https://www.gravatar.com/avatar/efc4f203b924017e538e7c3c84e2e6df?s=128&d=identicon&r=PG'),(13881,101,'2016-06-04T03:01:59.393','xendi',NULL,'2016-06-08T00:54:05.003',NULL,NULL,NULL,NULL,0,0,0,1481439,'https://www.gravatar.com/avatar/3910257eeac3402e68ab7934ded0ced4?s=128&d=identicon&r=PG'),(13882,1,'2016-06-04T11:59:26.713','Ji  Kyzlink',NULL,'2016-06-04T12:22:19.060',NULL,NULL,NULL,NULL,0,0,0,4938777,'https://www.gravatar.com/avatar/f287f0952dc8249b22f18e0be2eb0d28?s=128&d=identicon&r=PG&f=1'),(13883,1,'2016-06-04T19:00:44.870','Pratik',NULL,'2016-06-04T20:51:35.333',NULL,NULL,NULL,NULL,0,0,0,8322668,'https://www.gravatar.com/avatar/941a497d14a1c5a3b8bd2236fd372da7?s=128&d=identicon&r=PG&f=1'),(13884,1,'2016-06-04T19:37:37.620','Guilherme Restani',NULL,'2016-06-04T19:37:37.620',NULL,NULL,NULL,NULL,0,0,0,8570888,'https://i.stack.imgur.com/cHYT1.jpg?s=128&g=1'),(13885,1,'2016-06-05T02:24:45.2