 and Java, but also fairly long exposure to\nprocedural programming in C, which I have been using in both linux kernel and user space.\nMultithreaded/multi-core exposures? I ve also been working on real-time scheduling algorithms and\nintegrating them in OS schedulers of different RTOS.\nMy past experiences gave me the opportunity to develop independence and autonomy although at\nthe moment, I am appreciating how rewarding can be to work in a team spread across different countries,\nlearning from more skilled people and mentoring new hired employees.\nI strongly believe that knowledge and experience must flow within the company through\ncommunication, a company is made by people and if they grow so the company does. That s why I am\nseeking a company that can give me the possibility to challenge my technical background and to keep\nmy communication skills sharpened. I always face problems looking for the best solution within the\ndeadline. Organizing priorities is a must, agile methodologies provide the appropriate recipe to reach the\nbest solution.</p>\n',0,0,0,711630,'https://www.gravatar.com/avatar/b85d82892117a94973cc28eb6fdd959d?s=128&d=identicon&r=PG'),(13966,1,'2016-06-14T11:42:04.850','Riyad',NULL,'2016-06-14T11:42:04.850',NULL,'Comilla, Chittagong Division, Bangladesh',23,'<p>Open source enthusiast and problem solver.</p>\n',0,0,0,5953503,'https://i.stack.imgur.com/D0MKO.png?s=128&g=1'),(13967,52,'2016-06-14T12:25:38.930','Sandesh',NULL,'2017-07-19T15:07:58.933','','Bangalore, Karnataka, India',20,'',4,6,0,7595376,'https://graph.facebook.com/1088759157825684/picture?type=large'),(13968,101,'2016-06-14T13:30:13.237','modest and cute girl',NULL,'2016-06-14T13:30:13.237',NULL,NULL,NULL,NULL,0,0,0,1598019,'https://www.gravatar.com/avatar/ed03c320be7dd00f0bf74fc76ba430ee?s=128&d=identicon&r=PG'),(13969,31,'2016-06-14T14:27:08.957','jash101',NULL,'2017-07-21T12:21:49.390','',NULL,NULL,'',0,0,0,8634352,'https://www.gravatar.com/avatar/b7925e90d848c50410f48160c74d