-06-15T00:35:05.183',NULL,'Texas',NULL,'<p>Trained as a chemist, but computer aficionado since birth. Ive been tinkering with GNU/Linux since Slackware 7.1 was a thing, and have been slowly learning more with every passing day.</p>\n',0,1,0,269396,'https://www.gravatar.com/avatar/847c52297ef306858e270e903bee8897?s=128&d=identicon&r=PG'),(13978,16,'2016-06-15T05:24:07.167','Will',NULL,'2017-07-16T12:19:12.637',NULL,'NC, United States',NULL,NULL,0,0,0,8638310,'https://www.gravatar.com/avatar/07813eed96206bae7fd71189af57816d?s=128&d=identicon&r=PG&f=1'),(13979,101,'2016-06-15T05:41:04.533','Tom',NULL,'2016-06-15T05:41:04.533',NULL,NULL,NULL,'<p>Hi,  </p>\n\n<p>Im John Tom and I hope that I help everybody if I can.</p>\n',0,0,0,5546939,'https://www.gravatar.com/avatar/b3c7029e4eca8e09c9b5949218b8b5ee?s=128&d=identicon&r=PG&f=1'),(13980,1,'2016-06-15T07:36:57.627','johan',NULL,'2016-06-15T07:36:57.627',NULL,NULL,NULL,NULL,0,0,0,8148679,'https://graph.facebook.com/10209378492129199/picture?type=large'),(13981,1,'2016-06-15T11:32:43.047','user15460',NULL,'2016-06-15T11:32:43.047',NULL,NULL,NULL,NULL,0,0,0,4302549,'https://www.gravatar.com/avatar/8959ab01e64e05f92fb40250975324d6?s=128&d=identicon&r=PG&f=1'),(13982,3,'2016-06-15T12:07:56.903','Y.K Hong',NULL,'2016-08-02T11:35:59.060',NULL,NULL,NULL,NULL,0,0,0,8640702,'https://www.gravatar.com/avatar/7f70f0b0f11f37af5a7d1850b40119e6?s=128&d=identicon&r=PG&f=1'),(13983,1,'2016-06-15T15:15:29.803','Marshall Mueller',NULL,'2016-06-15T15:51:07.667',NULL,NULL,NULL,NULL,0,0,0,8641909,'https://www.gravatar.com/avatar/d04e756d674579c1a6564fdb4d209f75?s=128&d=identicon&r=PG&f=1'),(13987,101,'2016-06-15T22:41:22.937','wittrup',NULL,'2016-06-15T22:41:22.937',NULL,'Norway',32,'<p>Jack of all trades, master of none.</p>\n',0,0,0,2311890,'https://i.stack.imgur.com/sXass.jpg?s=128&g=1'),(13988,1,'2016-06-16T01:58:24.473','kenhow',NULL,'2016-06-17T01:09:01.527','http://kennychadhoward.com',NULL,NULL,'<p>I am a JavaScript developer who is very passionate about technology (especially web technologies).</p>\n',0,0,0,5559350,'https://www.gravatar.com/avatar/b9ac0c6a5ea643857788cdf1827f7506?s=128&d=identicon&r=PG'),(13989,1,'2016-06-16T03:20:24.130','tzhenghao',NULL,'2016-06-16T03:20:24.130','https://zhenghaotan.com','Chicago, IL, United States',23,'<p>Aspiring tech entrepreneur.\nPassionate about technological advancements for the betterment of humanity.\nI may not be the smartest, but I will work really hard for you.</p>\n\n<p>Personal Website: <a href=\"https://zhenghaotan.com/\" rel=\"nofollow noreferrer\">https://zhenghaotan.com/</a></p>\n\n<p>GitHub Profile: <a href=\"https://github.com/tzhenghao\" rel=\"nofollow noreferrer\">https://github.com/tzhenghao</a></p>\n\n<p>LinkedIn Profile: <a href=\"https://www.linkedin.com/in/zhenghaotan\" rel=\"nofollow noreferrer\">https://www.linkedin.com/in/zhenghaotan</a> </p>\n\n<p>StackOverflow Profile: <a href=\"http://stackoverflow.com/cv/tzhenghao\">http://stackoverflow.com/cv/tzhenghao</a></p>\n',0,0,0,3803206,'https://i.stack.imgur.com/nnwzZ.jpg?s=128&g=1'),(13990,1,'2016-06-16T12:56:39.320','aphorhythmic',NULL,'2016-06-16T12:56:39.320',NULL,NULL,NULL,NULL,0,0,0,8648189,'https://lh5.googleusercontent.com/-mJxrEGMfZiY/AAAAAAAAAAI/AAAAAAAAABA/4WkSaZO7EKc/photo.jpg?sz=128'),(13991,101,'2016-06-16T13:28:21.697','ChaseHardin',NULL,'2016-06-16T13:28:21.697',NULL,'Des Moines, IA',24,'<p><strong>BY DAY</strong> Im that nerdy kid who loves developing web based applications with ASP.NET, C#, MVC, TDD, and AngularJS.</p>\n\n<p><strong>BY NIGHT:</strong> I spend my evenings playing the electric guitar and building web applications.</p>\n\n<p><strong>FOR FUN:</strong> Program, Play Foosball, Listen to blues music, Gig, and play electric guitar.</p>\n\n<p><em>\"Its hard to beat a person who never gives up.\"</em> <em>- Babe Ruth</em></p>\n',0,0,0,4088110,'https://i.stack.imgur.com/Jppwd.jpg?s=128&g=1'),(13992,1,'2016-06-16T17:40:06.590','sarim_xyz',NULL,'2016-10-04T17:07:50.547',NULL,NULL,NULL,NULL,0,0,0,8642833,'https://www.gravatar.com/avatar/83b29d85a45c6873ddbc91df4cc0921d?s=128&d=identicon&r=PG&f=1'),(13993,101,'2016-06-16T18:44:22.010','Simon',NULL,'2016-06-21T04:15:23.437',NULL,NULL,NULL,NULL,1,0,0,542290,'https://www.gravatar.com/avatar/a0472ca9286504946d2ea00e843da505?s=128&d=identicon&r=PG'),(13994,101,'2016-06-16T18:44:43.743','user1863152',NULL,'2016-06-16T20:24:16.233',NULL,NULL,NULL,'<p>Stay polite folks. </p>\n\n<p>If any of my answers are not relevant to your specific problem please dont be impolite and mark it down. Rather annoying trying to help people here and getting nasty comments and negative feedback as a thank you. Be reminded people get to questions via google, and many others with the same problem will find the question they want answers to. </p>\n\n<p>For example, if someone asks about an issue in Win7, and I reply saying it also applies to XP, I DO NOT expect a snidey remark and a down vote, and I am not about to try and duplicate the question. </p>\n\n<p>Another issue I have is people here being downright rude to others and closing questions for supercilious reasons when again ignoring the probability that (a) the best answer is wrong or can be improved and (b) people arriving from google often find the exact question they can relate to, only to find it wasnt answered and it was closed.  </p>\n\n<p>Ie: There is a lot of intellectual snobbery and impoliteness on here and it is very trying. I dont know why the supervisors dont clamp down on it. On the other hand, I know the site is trying hard to keep it from descending into a badly run forum where the most common annoyance is people asking more questions or jamming the forum with daft replies. </p>\n\n<p>Moderation in all things and to those also trying to do others a favor, thank you!</p>\n',0,0,0,2093965,NULL),(13995,1,'2016-06-16T18:56:01.950','David OBrien',NULL,'2016-06-27T14:44:03.743',NULL,NULL,NULL,NULL,0,0,0,8649948,'https://www.gravatar.com/avata