g</p>\n',0,0,0,8281175,'https://lh3.googleusercontent.com/-tYRRGqRJkv8/AAAAAAAAAAI/AAAAAAAAAKw/2dvLW-q-2uE/photo.jpg?sz=128'),(14138,1,'2016-07-02T07:16:15.440','Fuzzy Dingo',NULL,'2016-07-02T07:16:15.440',NULL,NULL,NULL,NULL,0,0,0,7204506,'https://i.stack.imgur.com/0Vcb0.jpg?s=128&g=1'),(14139,6,'2016-07-02T12:12:51.553','Singee',NULL,'2016-07-27T12:37:19.080',NULL,NULL,NULL,NULL,0,0,0,7695452,'https://www.gravatar.com/avatar/658dbb5f7480adefcfbf7a9d367814e9?s=128&d=identicon&r=PG&f=1'),(14140,1,'2016-07-02T12:26:05.047','Lin Xiaobo',NULL,'2016-12-29T15:25:06.783',NULL,NULL,NULL,NULL,0,0,0,8746314,'https://lh4.googleusercontent.com/-wh1MJWjyhQE/AAAAAAAAAAI/AAAAAAAAADk/pTeMsQKhEdQ/photo.jpg'),(14141,1,'2016-07-02T17:21:58.703','Palomar',NULL,'2016-07-02T17:21:58.703',NULL,NULL,NULL,NULL,0,0,0,8747332,'https://www.gravatar.com/avatar/0f1d7fe6b2a75e1f8d89ce4f8d37def5?s=128&d=identicon&r=PG&f=1'),(14142,101,'2016-07-02T20:01:43.730','Fine Man',NULL,'2017-02-25T22:57:13.323',NULL,'not at Los Alamos working on the Atomic Bomb',NULL,'<p>Im a 16 y.o. teen (kind of a bit slightly redundant -ish), who studies math, physics, electronics, and programming (OK, maybe a bit of history and politics). Im inspired by John von Neumann, Richard Feynman, Nikola Tesla (not Elon Musk, though), and Steve Jobs.</p>\n\n<p><em>If you need a few quotes by The Great Explainer, see below.</em></p>\n\n<hr>\n\n<p>I hate rigorous proofs, but I know theyre good for me. Heres why:</p>\n\n<blockquote>\n  <h2>The first principle is that you must not fool yourself and you are the easiest person to fool.</h2>\n  \n  <p>Richard P. Feynman</p>\n</blockquote>\n\n<hr>\n\n<p>Examples dont only improve understanding, they help validate it:</p>\n\n<blockquote>\n  <h2>It doesnt matter how beautiful your theory is, it doesnt matter how smart you are. If it doesnt agree with experiment, its wrong.</h2>\n  \n  <p>Richard P. Feynman</p>\n</blockquote>\n\n<hr>\n\n<p>Im an ignorant teen. Not to worry, for Im a curious teen as well!</p>\n\n<blockquote>\n  <h2>It is in the admission of ignorance and the admission of uncertainty that there is a hope for the continuous motion of human beings in some direction that doesnt get confined, permanently blocked, as it has so many times before in various periods in the history of man.</h2>\n  \n  <p>Richard P. Feynman</p>\n</blockquote>\n\n<hr>\n\n<p>If your still on first principles like I am, dont feel too bad.</p>\n\n<blockquote>\n  <h2>If you keep proving stuff that others have done, getting confidence, increasing the complexities of your solutions - for the fun of it - then one day youll turn around and discover that nobody actually did that one!</h2>\n  \n  <p>Richard P. Feynman</p>\n</blockquote>\n\n<hr>\n\n<p>You havent lived if you cant relate to this quote:</p>\n\n<blockquote>\n  <h2>If I get stuck, I look at a book that tells me how someone else did it. I turn the pages, and then I say, Oh, I forgot that bit, then close the book and carry on. Finally, after youve figured out how to do it, you read how they did it and find out how dumb your solution is and how much more clever and efficient theirs is!</h2>\n  \n  <p>Richard P. Feynman</p>\n</blockquote>\n\n<hr>\n\n<p>I study like this, too:</p>\n\n<blockquote>\n  <h2>Its the way I study - to understand something by trying to work it out or, in other words, to understand something by creating it. Not creating it one hundred percent, of course; but taking a hint as to which direction to go but not remembering the details. These you work out for yourself.</h2>\n  \n  <p>Richard P. Feynman</p>\n</blockquote>\n',0,0,0,5063475,'https://i.stack.imgur.com/9Wh3i.jpg?s=128&g=1'),(14143,13,'2016-07-02T20:23:31.537','namster',NULL,'2017-01-27T14:27:23.810',NULL,NULL,NULL,NULL,2,0,0,8747968,'https://www.gravatar.com/avatar/cc277b261cf4e829c99ec0210d5b04aa?s=128&d=identicon&r=PG&f=1'),(14144,101,'2016-07-02T21:10:12.857','Ogglas',NULL,'2016-08-05T06:37:36.533','https://www.linkedin.com/profile/view?id=147119403&trk=nav_responsive_tab_profile','Malmo, Sweden',28,'<p>My biggest interest in life is technology, primarily computers. It started out with a general computer interest and the need to know how and why something works. This interest has continued to grow but instead of dissecting computer hardware and removing viruses from friends computers all day long my focus has changed to IT security and programming. The programming language that I prefer is C#. On my spare time I like to do small (and large) technology projects. This can be everything from creating an RFID-reader or 3D printer using an Arduino to participating in vulnerability bounty programs. </p>\n\n<p>Another big interest is also my entrepreneurial side. I like to see something grow and instead of just seeing obstacles I try to see possibilities. After being a part of several start-ups and having an amazing time working with different projects I look forward to bring my competence and drive into a larger company where I can focus and evolve.</p>\n',0,2,0,4763663,'https://www.gravatar.com/avatar/b2b9eece8c493ba7ddcff82f845ff2af?s=128&d=identicon&r=PG&f=1'),(14146,11,'2016-07-03T20:38:08.703','Lubo',NULL,'2016-07-24T13:18:25.003',NULL,NULL,NULL,NULL,1,0,0,5162841,'https://graph.facebook.com/100006359864263/picture?type=large'),(14147,1,'2016-07-03T22:09:12.713','Ebony Maw',NULL,'2016-07-03T22:34:15.670',NULL,NULL,NULL,NULL,0,0,0,2586446,'https://i.stack.imgur.com/EBfpz.png?s=128&g=1'),(14148,160,'2016-07-03T23:39:34.423','Dinesh Lama',NULL,'2017-07-30T13:23:30.553',NULL,'Bangalore, Karnataka, India',23,'<p>I love making robots intelligent and make them do what only humans can do, like doing human works both physically and non physically. Currently i am Learning ROS, Gazebo and also doing research in computer vision and robotics by using them. Cool isnt it. yea.</p>\n',6,7,0,6670261,'https://graph.facebook.com/292733161062071/picture?type=large'),(14149,101,'2016-07-04T00:12:26.153','101',NULL