ow\">HTML</a>, <a href=\"http://www.w3.org/css\" rel=\"nofollow\">CSS</a>, <a href=\"http://www.javascript.org\" rel=\"nofollow\">Javascript</a>, <a href=\"http://www.typescriptlang.org\" rel=\"nofollow\">TypeScript</a>, <a href=\"http://www.asp.net\" rel=\"nofollow\">ASP.NET</a>, <a href=\"http://jquery.org\" rel=\"nofollow\">jQuery</a>, <a href=\"http://angularjs.org\" rel=\"nofollow\">AngularJS</a>, <a href=\"http://perl.org\" rel=\"nofollow\">Perl</a>, JSP, JNI, sed, awk, Lisp, <a href=\"http://www.xemacs.org/\" rel=\"nofollow\">XEmacs</a>, <a href=\"http://www.gnu.org/software/emacs/\" rel=\"nofollow\">Emacs</a>, vi, data structures, compiler design, parsing theory, lexical analysis, finite automata, language design, <a href=\"http://en.wikipedia.org/wiki/LR_parser\" rel=\"nofollow\">LR(k) grammars</a>, lex, yacc, multiprocessing, database, digital fax, digital logic, artificial intelligence, SCCS, RCS, CVS, Subversion, Intel&nbsp;8080, x86, 6502, MC&nbsp;68000, IBM/370, z/390, digital logic, RTL, <a href=\"http://en.wikipedia.org/wiki/Cryptography\" rel=\"nofollow\">cryptography</a>, encryption, AES, PKI, <a href=\"http://pgp.com\" rel=\"nofollow\">PGP</a>, compression, FTP, SMTP, IPC, sockets, threads, network, client/server, <a href=\"http://opengroup.org/unix\" rel=\"nofollow\">Unix</a>, POSIX, MS-DOS, <a href=\"http://msdn.microsoft.com/en-us/library/windows/desktop/hh920508.aspx\" rel=\"nofollow\">Windows</a>, Win32, TOPS-20, Apple II, TRS-80, MIDI, AI, graphics, 3D math, document storage, workflow, Unicode, EBCDIC, JCL, CICS, PL/I, COBOL, Assembler, FORTRAN, BASIC, <i>to name just a few</i>.</p>\n\n<p>Knowledge of <a href=\"http://en.wikipedia.org/wiki/Number_theory\" rel=\"nofollow\">number theory</a>, foundations, <a href=\"http://en.wikipedia.org/wiki/Set_theory\" rel=\"nofollow\">set theory</a>, <a href=\"http://en.wikipedia.org/wiki/Abstract_Algebra\" rel=\"nofollow\">abstract algebra</a>.</p>\n',0,1,0,56888,'https://www.gravatar.com/avatar/4d9f7a30