ching people how to get into entry level/hobby robotics and embedded design (PCB, software, 3D design).</p>\n\n<p>I have designed a 3KW LED strobe light array, control boards for interfacing with robot computers and rotating sensors, remote sensor control boards, small data loggers, a flea-weight robot sumo style robot with custom ARM Cortex M3 board, and a few C++ (and for use in Robot Operating System [ROS]) and C# engineering related programs.</p>\n',0,0,0,4200321,'https://graph.facebook.com/683998024/picture?type=large'),(14435,91,'2016-08-10T08:03:18.643','Gil',NULL,'2017-05-26T05:30:26.670',NULL,NULL,NULL,NULL,0,2,0,8985473,'https://www.gravatar.com/avatar/2f57358276d1c6fff00d64e91d0f5827?s=128&d=identicon&r=PG&f=1'),(14436,1,'2016-08-10T11:59:27.493','vad babushkin',NULL,'2016-08-10T11:59:27.493',NULL,'Chelyabinsk Oblast, Russia',45,'<p>mprove.io developer\nJava, Groovy, Scala, Python, C, Matlab, GCE, AWS programmer\nLinux, GCE, AWS, DigitalOcean, Alicloud sysadmin\nMysql, Postgres, Oracle DBA\nDevOps</p>\n',0,0,0,1580261,NULL),(14437,1,'2016-08-10T12:00:07.383','Lamichhane88',NULL,'2016-08-10T12:00:07.383',NULL,'Lalitpur Sub-Metropolitan City, Central Region, Nepal',17,'<p>I am a beginner here. I have just completed my high school.\nI wish to stretch my further field of study in physics.\nI like theoretical physics and cosmology.</p>\n',0,0,0,7844255,'https://www.gravatar.com/avatar/c1b21ca82decdc259412c0328f0d6501?s=128&d=identicon&r=PG&f=1'),(14438,101,'2016-08-10T12:04:14.517','Bjorn Reppen',NULL,'2016-08-10T12:04:14.517','http://twitter.com/breppen','Trondheim, Norway',47,'<p>Hacker</p>\n',0,0,0,1908,'https://i.stack.imgur.com/8WBMQ.png?s=128&g=1'),(14439,1,'2016-08-10T14:59:34.930','Andr  Filipe',NULL,'2016-09-23T10:25:37.387',NULL,NULL,NULL,NULL,0,0,0,6570227,'https://lh4.googleusercontent.com/-b1_8XjsA94I/AAAAAAAAAAI/AAAAAAAAAKg/N-B1cwwINIc/photo.jpg?sz=128'),(14440,1,'2016-08-10T14:59:57.950','af-silva',NULL,'2016-11-08T14:32:20.753','http://introsys.eu','Portugal',29,'<p>Im a Researcher (Ninja) and so a very curious person. I enjoy solving problems, especially when envolves Robotic (I will create Skynet) and Computer Vision. I support the open source philosophy and think that great software can be achieved by means of collaboration between teams of programmers world wide (i dont have money, thats way...). Im also a Linux enthusiast, with much to learn but...</p>\n\n<p>I love to bike and run, and I try to be a active person when I can. \nIm a very distracted guy and I forget easily of things (thats way I \"love\", appreciate, stackoverflow (okok, I \"love\" (now seems like im programming LISP))), sometimes I even forgot when is my birthday, its normal...</p>\n\n<p>I enjoy helping other people when a can and if a can, and I love to learn knew things.</p>\n\n<p>Other Things:</p>\n\n<p>Languages that I love: C/C++, Python, Java and a bit of SQL.\nLanguages that I dont like: PHP, Javascript (I know is everywhere)</p>\n\n<p>Operating system of choice to work: Linux (Ubuntu/Debian)\nOperating system for personal use: Windows (I like to game then there is no other way, dam you Microsoft you know how to play us)</p>\n\n<p>I think its enough ... </p>\n\n<p>Im just a regular guy, i think :)</p>\n',0,0,0,3088784,'https://i.stack.imgur.com/AMmdh.png?s=128&g=1'),(14442,1,'2016-08-10T23:41:20.573','Elspin',NULL,'2016-08-11T00:31:59.307',NULL,NULL,NULL,NULL,0,0,0,1604522,'https://www.gravatar.com/avatar/c1493228c029898b78d70130622ee1c5?s=128&d=identicon&r=PG'),(14443,101,'2016-08-11T03:23:56.243','FloatingKiwi',NULL,'2016-08-11T03:23:56.243',NULL,'New Zealand',36,'<p>Global roamer and yacht delivery skipper. But this is what pays the bills.</p>\n',0,0,0,8760363,'https://graph.facebook.com/10155019107554488/picture?type=large'),(14444,1,'2016-08-11T03:23:58.327','matt',NULL,'2016-09-13T02:33:50.170','http://www.crowdmob.com','San Francisco, CA',NULL,'<p>Co-Founder of CrowdMob Inc.</p>\n',0,0,0,154694,'https://www.gravatar.com/