a data scientist &amp; developer.</p>\n\n<p>BRIEF INTRO:\nI seek to connect with the next generation thought-leaders to create a sustainable business model through digital strategies. As an experienced Digital Strategist &amp; Developer with over 15 years of senior industrial exposures, advanced academic standing &amp; wide professional contacts, I am passionate about using digital solutions for commercial, not-for-profit, academic, research &amp; charitable causes.</p>\n\n<p>  Business Growth Hacks specialization focused on:\n  PRODUCT/SERVICE MARKET FIT\n  DIGITAL &amp; ANALYTIC SOLUTIONS\n  ONLINE TO OFFLINE (O2O) BUSINESS INTEGRATION</p>\n\n<p>  In any commissioned projects, I regularly collaborate globally with government leaders, celebrities, musicians, industry experts/specialists, researchers, MNCs, companies, developers, creative agencies, brands, media planners, independent professionals.</p>\n\n<p>  Getting in touch in professional &amp; non-professional capacity? Please feel free to drop by at this email:</p>\n\n<p>  5STARSDAY@SINA.CN  </p>\n\n<p>        5STARSDAY@GMAIL.COM >> Googles Gmail access is restricted in China        </p>\n',0,0,0,7686632,'https://www.gravatar.com/avatar/dc1ef1c2ecb7d68916f93ec8944d097d?s=128&d=identicon&r=PG'),(14531,26,'2016-08-24T05:28:41.380','Ashwin Pajankar',NULL,'2016-08-26T16:22:05.153','https://in.linkedin.com/in/ashwinpajankar','Nashik, India',31,'<p>By Day: I am Automation Architect in an expanding startup in a nondescript town in India.</p>\n\n<p>By Night: I am a budding author on the hot trends like IoT, Visualization and Machine Learning. I have already got 2 books published in my name and I also have reviewed 3 books on the topics mentioned above. I am working on couple of more \"free books for everyone\" projects in collaboration with various researchers.</p>\n',0,1,0,7060637,'https://graph.facebook.com/746876205424599/picture?type=large'),(14532,1,'2016-08-24T08:50:39.900','Harsha',NULL,'2016-08-24T08:50:39.900