.imgur.com/iEV1q.png?s=128&g=1'),(14638,101,'2016-09-05T02:37:03.193','mattfryercom',NULL,'2016-09-05T02:37:03.193','http://mattfryer.com','Colliers Wood, London, United Kingdom',32,'<p>Matt Fryer</p>\n\n<p>Managing Technical Director at Remote Studios</p>\n\n<p>Technical Director at Deft Design</p>\n\n<p>BSc (Hons) Information Technology Management for Business at the University of Exeter</p>\n\n<p>Im seeking Web Application Development and Web Development opportunities, either as a freelance professional or as a lead for my company Remote Studios. I am a seasoned LAMP Web Developer and have experience with both backend and frontend projects using open source technologies, industry standard applications and frameworks. I often work with WordPress and have built websites and web apps using many frameworks and applications including those I have built. My work is highly bespoke due to my ability to adapt most open source applications hosted on LAMP, which I have a good understanding of and Im no stranger to a terminal. My preferred programming language is PHP but I am competent in a range of others such as JavaScript, (My)SQL, lower-level languages such as Java and associated frameworks and APIs with most of the languages I am competent with.</p>\n\n<p>I studied Computer Science at the University of Exeter where I gained a knowledge of best practice concerning Software Development, Developer Collaboration, Object Oriented Programming (OOP) and Software Design Patterns. I employ and teach this knowledge in my day to day projects. I have experience working remotely on a range of outsourced web development projects from marketing agencies, clients I have obtained directly or through my company. I also studied Business Management at the University of Exeter which has enabled me to start and run my own business. During my Degree I completed a placement at SAS, the worlds largest, privately-owned software company and I was offered a position of Solution Lead at Hewlett Packard.</p>\n\n<p>I am the Managing Technical Director at Remote Studios where I am constantly on the lookout for opportunities for collaboration and to take on new clients. We consist of a small team of Web Developers, Graphic Designers and skilled marketing professionals, all operating remotely, based in various locations throughout the UK and elsewhere. Although we work remotely, the company is London based.</p>\n',0,0,0,1295986,'https://i.stack.imgur.com/aZJEp.jpg?s=128&g=1'),(14639,6,'2016-09-05T02:51:17.210','Apoorv',NULL,'2017-07-04T19:30:47.193',NULL,'Blacksburg, VA',29,'<p>Im an embedded systems enthusiast and have worked on various platforms PIC, AVR, ARM &amp; x86.</p>\n',0,0,0,1823658,'https://www.gravatar.com/avatar/d8e2253a439cce3e8913b0ce6df6ba0b?s=128&d=identicon&r=PG'),(14640,1,'2016-09-05T07:30:56.097','Seun Akappo',NULL,'2016-09-05T07:30:56.097',NULL,NULL,NULL,NULL,0,0,0,9135512,'https://lh5.googleusercontent.com/-a8_KOCAtu3U/AAAAAAAAAAI/AAAAAAAAAEA/I8Rta3KqvjU/photo.jpg?sz=128'),(14641,1,'2016-09-05T11:58:59.023','Emiliano Borghi',NULL,'2017-01-26T11:15:46.350',NULL,NULL,NULL,NULL,0,0,0,8859446,'https://lh3.googleusercontent.com/-KNXJYmzbr5I/AAAAAAAAAAI/AAAAAAAAAfA/hnXxOMH_FK4/photo.jpg?sz=128'),(14642,101,'2016-09-05T12:26:18.377','Thomas Ibbotson',NULL,'2016-09-05T12:26:18.377',NULL,'Cambridge, United Kingdom',NULL,'<p>Im a software developer at <a href=\"http://www.mathworks.com\" rel=\"nofollow\">MathWorks</a> working on the Parallel Computing Toolbox.</p>\n\n<p>In my spare time I do a lot of <a href=\"http://www.rscds.org\" rel=\"nofollow\">Scottish Country dancing</a>.</p>\n',0,0,0,180084,'https://www.gravatar.com/avatar/aad320921fa3818cd538362d74c42f93?s=128&d=identicon&r=PG'),(14644,106,'2016-09-05T12:45:41.493','Josyula Krishna',NULL,'2017-08-10T20:41:10.773',NULL,NULL,NULL,NULL,1,0,0,931968,'https://www.gravatar.com/avatar/0e50143dbe2090c3447daeea877ce8c3?s=128&d=identicon&r=PG'),(14645,1,'2016-09-05T15:13:41.660','lawrence123456',NULL,'2