ava as well as python.</p>\n',0,0,0,6548244,'https://i.stack.imgur.com/RNn7D.jpg'),(14790,101,'2016-09-20T18:24:27.887','Daniel Paczuski Bak',NULL,'2016-09-21T16:32:15.583',NULL,NULL,NULL,NULL,0,0,0,5355950,'https://graph.facebook.com/730410991/picture?type=large'),(14791,1,'2016-09-20T19:11:05.577','R Rob',NULL,'2016-11-07T22:31:16.360',NULL,NULL,NULL,NULL,0,0,0,8806371,'https://www.gravatar.com/avatar/0bacbdff8b66a3872ef349c5cd852729?s=128&d=identicon&r=PG&f=1'),(14792,1,'2016-09-21T01:00:38.143','user8106',NULL,'2017-08-01T17:28:31.297',NULL,NULL,NULL,NULL,0,0,0,9229322,'https://www.gravatar.com/avatar/dfa254708b081149217f78f02ff0bddd?s=128&d=identicon&r=PG&f=1'),(14793,1,'2016-09-21T06:03:24.950','ARB',NULL,'2016-09-21T06:03:24.950','https://www.linkedin.com/in/awais-riaz-butt-87374354?trk=nav_responsive_tab_profile',NULL,26,'<p>In my current capacity as a Software Quality Assurance Engineer. I am responsible for making sure that all industrial control software operates properly and efficiently.</p>\n\n<p>My strong sense of accountability and responsibility make me the ideal candidate for this position. I welcome a direct inquiry into my qualifications at any time and look forward to setting up a personal interview at your convenience.</p>\n',0,0,0,5843558,'https://i.stack.imgur.com/xWRn0.jpg?s=128&g=1'),(14794,1,'2016-09-21T13:32:16.217','user6858628',NULL,'2016-09-21T13:32:16.217',NULL,NULL,NULL,NULL,0,0,0,9232734,'https://www.gravatar.com/avatar/f2ee9cdae1b6e758a8635ba646d8b2a6?s=128&d=identicon&r=PG&f=1'),(14795,1,'2016-09-21T15:36:03.847','Frangipanes',NULL,'2016-09-21T15:36:03.847',NULL,'United Kingdom',NULL,NULL,0,0,0,6631808,'https://lh5.googleusercontent.com/-crq9Ddaokws/AAAAAAAAAAI/AAAAAAAAAms/dBY42ywD27c/photo.jpg?sz=128'),(14796,1,'2016-09-21T16:24:54.473','Sajal',NULL,'2016-10-05T14:46:40.410',NULL,NULL,NULL,NULL,0,0,0,1369199,'https://www.gravatar.com/avatar/585731208a661c93a4fc97476a11de92?s=128&d=identicon&r=PG&f=1'),(14798,1,'2016-09-21T18:05:13