3,'https://www.gravatar.com/avatar/64851a443acf1b71d4b6b7eac8c9d25e?s=128&d=identicon&r=PG&f=1'),(14809,1,'2016-09-23T00:40:40.740','Ankur Sharma',NULL,'2016-09-23T00:40:40.740',NULL,NULL,NULL,NULL,0,0,0,9017345,'https://lh6.googleusercontent.com/-hTl6U99BsOE/AAAAAAAAAAI/AAAAAAAABLo/q8VGRZow_Do/photo.jpg?sz=128'),(14810,101,'2016-09-23T01:04:55.080','redShadow',NULL,'2016-09-23T01:04:55.080','http://www.hackzine.org','Italy',27,'<p>Developer, using primarily OpenSource technologies.</p>\n\n<h3>Short list of known/used stuff</h3>\n\n<ul>\n<li><strong>Operating systems:</strong> Linux (Gentoo, Debian, Fedora, Ubuntu)</li>\n<li><strong>Programming languages:</strong> Python, JavaScript, CoffeeScript, BashScript, PHP, (some) C, (some) C++, (a bit of) Java</li>\n<li><strong>Frameworks and CMS:</strong> Django (Python), jQuery (JavaScript), Drupal (PHP), web2py (Python), SQLAlchemy (Python)</li>\n<li><strong>Web development languages:</strong> HTML, CSS, SCSS, LESS</li>\n<li><strong>Databases:</strong> MySQL, PostgreSQL, SQLite, MongoDB, OpenLDAP, Redis</li>\n<li><strong>Geographical systems:</strong> MapServer, MapScript (with Python, PHP), PostGIS</li>\n<li><strong>Standard Linux/Posix tools:</strong> sed, grep, awk, ...</li>\n<li><strong>Version control systems:</strong> git, mercurial, svn, cvs (used some times)</li>\n<li><strong>Professional IDEs:</strong> Emacs, PyCharm, Eclipse</li>\n<li><strong>Some sysadmin skill:</strong> Apache, Nginx, Bind, Postfix, Bacula, iptables, dhcpd, openvpn .. but thats not my primary job</li>\n<li>Also, Im doing some electronics experiments with (and without) arduino &amp; co.</li>\n</ul>\n',0,0,0,49932,'https://www.gravatar.com/avatar/0a9dbf11e725f19a1fc5601f958cbcf1?s=128&d=identicon&r=PG'),(14811,1,'2016-09-23T05:00:07.963','Jonn Jonzz',NULL,'2016-09-23T05:00:07.963',NULL,NULL,NULL,NULL,0,0,0,8792744,'https://www.gravatar.com/avatar/54649616d7c03ad68e9fc9e4036fd4f3?s=128&d=identicon&r=PG&f=1'),(14812,1,'2016-09-23T09:36:23.770','Ranjith',NULL,'2017-04-17T06:38:48.407',NULL,NULL,NULL,'<p>Embedded Firmware Engineer</p>\n',0,0,0,8935081,'https://www.gravatar.com/avatar/0f55d6583aec2a3559652e04493a3520?s=128&d=identicon&r=PG&f=1'),(14813,1,'2016-09-23T13:10:36.107','terentz_hexadec',NULL,'2016-09-23T13:10:36.107',NULL,'Sydney, Australia',41,'<p>Im a versatile mid-level software engineer primed in PHP, JavaScript, Java, and C/C++.  Ive a Bachelor of Computer Science from La Trobe University, and more recently, Zend PHP Engineer certification. </p>\n\n<p>My current projects include a specialised graphics tool for web designers and my own personal website.  Currently seeking work (mostly contracts atm) as a PHP Full Stack Developer, though  Im also interested in meeting coders (preferably in Sydney) who might be interested in collaboration on anything that sounds interesting.</p>\n\n<p>Im *nix savvy, and prefer the environment.  Despite that, Im running my dev environments in VMware Workstation 10, under Windows 8.1 (yeah, I know, ok!)  Ive tinkered with a few Linux flavours, but am pretty happy with Mint. </p>\n\n<p>I delight in complex systems and problem solving.  I love software design, whiteboard warrior-hood, and enthusiastic people with whom to share it.  Im a deeply philosophical person, for whom mathematics is the closest thing I have to religion.</p>\n',0,0,0,4598054,'https://i.stack.imgur.com/bfXid.jpg?s=128&g=1'),(14814,101,'2016-09-23T17:50:56.090','Forral',NULL,'2016-09-23T17:50:56.090',NULL,NULL,NULL,'<p>New father, new IT guy, new to Stack Exchange....</p>\n',0,0,0,8422425,'https://i.stack.imgur.com/Y1SoY.gif?s=128&g=1'),(14815,1,'2016-09-23T18:48:09.693','user197733',NULL,'2016-09-23T18:48:09.693',NULL,NULL,NULL,NULL,0,0,0,9251770,'https://www.gravatar.com/avatar/6dce812c233ad5369efecdc6fd90d832?s=128&d=identicon&r=PG&f=1'),(14816,1,'2016-09-23T21:12:30.203','nstefan1992',NULL,'2017-03-23T03:38:56.090',NULL,NULL,NULL,NULL,0,0,0,5348797,'https://www.gravatar.com/avatar/99442a2a192e87e7d3b8b504af3fdc6a?s=128&d=identicon&r=PG&f=1'),(14817,101,'2016-09-23T21:22:53.987','JayC',NULL,'2016-09-23T21:22:53.987',NULL,NULL,NULL,NULL,0,0,0,233406,'https://www.gravatar.com/avatar/f724048846b4152321700fd9d89d4002?s=128&d=identicon&r=PG'),(14819,1,'2016-09-24T01:00:40.077','famousperson',NULL,'2016-09-24T01:44:22.957',NULL,NULL,NULL,NULL,0,0,0,9253212,'https://www.gravatar.com/avatar/0252e47cece8dd39b76e2fc3f5ca9532?s=128&d=identicon&r=PG&f=1'),(14820,1,'2016-09-24T04:13:18.820','Kpaw',NULL,'2016-09-24T04:13:18.820','','Pleasant Grove, UT, United States',50,'<p>I am a fifth generation builder. My father and grandfather were old school master craftsmen, and I have learned the proper way of building. I have over 30 years of experience in the construction industry. My hobbies include woodworking, i.e. cabinets and heir loom furniture. I also dabble in electronics and engineering. I am in the process of designing and building a CNC machine.</p>\n\n<p>I am currently making jigs for my guitar building project. I am in the process of building a thickness sander for the top &amp; backs of the guitar. Ive told I am a bit of a structure freak. Everthing I build is probably over built, but at least it is strong.</p>\n',0,0,0,9253527,'https://i.stack.imgur.com/eICku.jpg'),(14821,1,'2016-09-24T06:27:54.597','handsomejack',NULL,'2016-09-24T06:27:54.597',NULL,NULL,NULL,'<p>find me hunched over a laptop at 3am running on caffeine and sheer willpower alone</p>\n',0,0,0,9254121,'https://i.stack.imgur.com/c94tU.png?s=128&g=1'),(14822,11,'2016-09-24T10:36:39.320','ReiJin ThunderKeg',NULL,'2016-11-12T19:05:03.487',NULL,NULL,NULL,NULL,0,0,0,5829075,'https://i.stack.imgur.com/rSywI.png?s=128&g=1'),(14824,1,'2016-09-24T14:40:41.473','yakuza1993',NULL,'2016-09-24T18:06:15.903','http://indianthought.in/','Beijing, China',24,'<ul>\n<li>My name is Yakuza,</li>\n<li>Currently I am working in AADI E&amp;IT PVT. LTD. as Sr. Android Engineer.\nThat s all about myself..</li>\n</ul>\n',0,0,0,6356427,'https://i.stack.imgur.com/TTyvv.jpg'),(14825,6,'2016-09-25T15:05:48.013','Dimitry M',NULL,'2016-10-01T03:24:48.290','http://None','Ohio, United States',NULL,'<p>Hi!</p>\n\n<p>Im a student from Ohio who enjoys programming... </p>\n\n<p><em>A LOT</em></p>\n\n<p>Okay, maybe not that obsessed.</p>\n\n<p>But still, I enjoy programming. I joined StackOverflow because I have recently begun some of the problems on Project Euler.\nFor those who do not know, Project Euler is a website that provides mathematical problems that require you to write an algorithm to solve it.</p>\n\n<p>Apart from Programming, I try to mess around with Electrical Engineering, and a bit of Mechanical.\nBut my main passion is Robotics Engineering, the mixture of them all.</p>\n\n<p>I also like photography, wood carving, flute playing, and other strange things that one might expect a nerd to enjoy.</p>\n\n<p>Heres a link to my 500px page (photography)!</p>\n\n<p><a href=\"https://500px.com/dmtrmlnk\" rel=\"nofollow\">https://500px.com/dmtrmlnk</a></p>\n',0,0,0,8890948,'https://lh6.googleusercontent.com/-kulwx8n4dFQ/AAAAAAAAAAI/AAAAAAAABbo/tWuv_T61UcY/photo.jpg?sz=128'),(14826,1,'2016-09-25T18:01:42.243','Vijith Vijay',NULL,'2016-09-25T18:01:42.243',NULL,'India',31,NULL,0,0,0,9261865,'https://i.stack.imgur.com/MDbGG.jpg?s=128&g=1'),(14827,121,'2016-09-25T22:35:26.180','Mahe Sirius',NULL,'2017-08-10T19:51:52.633',NULL,'Chennai',25,NULL,0,0,0,4754447,'https://www.gravatar.com/avatar/14b67954c811b93169e2175388938a75?s=128&d=identicon&r=PG&f=1'),(14828,101,'2016-09-26T05:13:15.877','Amro',NULL,'2016-09-26T05:31:46.853','http://stackoverflow.com/users/97160/amro',NULL,32,'<p>Email: amro<a href=\"http://www.google.com/recaptcha/mailhide/d?k=013RZCvdACI2twUHLZS3qEbg==&amp;c=Je8bq7dCjojcYCz22Xur9ERyzl2Ni8-z5nR131i1UF4=\" rel=\"nofollow\" title=\"Reveal this e-mail address\">...</a>@gmail.com</p>\n',0,0,0,34382,'https://www.gravatar.com/avatar/4b8ce2e5dff7e913642c84213353f6a3?s=128&d=identicon&r=PG'),