orking on all aspects of automation including robotics. Very experienced in both Java and C#. Currently working on problems related to automating tests which require manual interaction, such as the pushing of a button or swiping a credit card.</p>\n\n<p>I am especially interested in OOP and design patterns as they apply to automated testing at the functional and system test levels.</p>\n\n<p>I am also an amateur blacksmith, knife-maker, avid fisherman, and devoted father.</p>\n',0,0,0,2383721,'https://graph.facebook.com/1433960798/picture?type=large'),(14923,71,'2016-10-04T23:23:02.130','AustinTronics',NULL,'2017-08-08T03:53:07.640','https://www.youtube.com/channel/UCcF1FVllWmtUZAolnE3eoQA',NULL,NULL,'<p>Started a competitive robotics club back in college called <a href=\"http://www.sdsumechatronics.org/about/officers/\" rel=\"nofollow noreferrer\">Mechatronics</a>. We competed in international competitions, and even became world champs, woo! You can read more about it <a href=\"http://www.sdsumechatronics.org/about/\" rel=\"nofollow noreferrer\">here</a>.</p>\n',0,1,0,9326380,'https://i.stack.imgur.com/T1Imx.png?s=128&g=1'),(14924,1,'2016-10-05T12:02:53.413','user14924',NULL,'2016-11-11T12:11:55.597',NULL,NULL,NULL,NULL,0,0,0,9330207,'https://www.gravatar.com/avatar/969d8a1776c2a55f760d4f4ac996e692?s=128&d=identicon&r=PG&f=1'),(14925,1,'2016-10-05T15:16:03.157','Rajiv',NULL,'2017-03-09T18:20:40.320',NULL,NULL,NULL,NULL,1,0,0,9331685,'https://www.gravatar.com/avatar/7ab3db9d712380de2334de47d5df12dc?s=128&d=identicon&r=PG&f=1'),(14926,101,'2016-10-05T17:11:49.573','Sdghasemi',NULL,'2016-10-05T17:11:49.573',NULL,'I.R.Iran',23,'<p>Filling the empty half of the glass...</p>\n\n<p>SMILEUPPS-A0F3325044</p>\n',0,0,0,5544002,'https://i.stack.imgur.com/Qcmua.jpg?s=128&g=1'),(14927,101,'2016-10-06T04:38:52.100','Chetan Bhargava',NULL,'2016-10-20T01:16:23.783','http://www.bhargavaz.us','San Francisco, CA',NULL,'<p><a href=\"http://stackexchange.com/users/1794085/chetan-bhargav