ics management, following a major turn-around of the high-values logistics operations, I was hired to manage, I was presented with the opportunity to join R &amp; D as a junior developer.   Over the years, I ve learned to leverage my values, emotional intelligence, engineering discipline, and provide value and direction to software development. </p>\n\n<p>KEY COMPETENCIES:\n .Enterprise Software Design and Implementation\n  NET language is C# \n  Service Implementation (WCF, Web.Api, ASMX web services)<br>\n  Service Orientated Architecture (SOA)\n  SQL Server, PostgreSQL, SQL Azure, and MySQL\n  OAuth2, OpenID, JWT security \n  Leadership, Professional, &amp; Business Development\n  Agile project management</p>\n',0,0,0,7669153,'https://i.stack.imgur.com/pUPHV.jpg'),(15109,1,'2016-10-26T18:00:50.730','Hemang Purohit',NULL,'2017-02-17T19:23:10.020',NULL,NULL,NULL,NULL,0,0,0,5994390,'https://www.gravatar.com/avatar/ee5dc491719fe4824f55c3edae04121b?s=128&d=identicon&r=PG&f=1'),(15110,11,'2016-10-26T18:41:32.983','user15110',NULL,'2016-10-26T18:41:32.983',NULL,NULL,NULL,NULL,0,0,0,9522370,NULL),(15111,3,'2016-10-26T18:46:06.470','Jean-Marie Melanson',NULL,'2016-10-27T12:16:40.577','','Dieppe, NB, Canada',NULL,'<p>By day:  I work in clinical engineering deprtment at a local hospital.</p>\n\n<p>By night: I feed my curiosity about science, programming and electronics.</p>\n',0,0,0,1609459,'https://lh3.googleusercontent.com/-YIm_LDCk0ok/AAAAAAAAAAI/AAAAAAAAAxY/4SfZLo54HBQ/photo.jpg?sz=128'),(15112,111,'2016-10-26T20:28:16.843','Fran ois Pilote',NULL,'2017-04-12T20:45:15.957',NULL,'Quebec, Canada',NULL,NULL,0,1,0,201267,'https://lh4.googleusercontent.com/-2Qno7yN6oNU/AAAAAAAAAAI/AAAAAAAAANM/EhBzf-jt2vI/photo.jpg?sz=128'),(15113,1,'2016-10-26T21:55:10.720','   ',NULL,'2016-10-26T21:55:10.720',NULL,NULL,NULL,NULL,0,0,0,7741156,'https://www.gravatar.com/avatar/ea7fd7c3cc690a483ecd6fbd20366d8a?s=128&d=identicon&r=PG&f=1'),(15114,3,'2016-10-26T22:01:00.563','sam_t',NULL,'2017-04