ttp://stackexchange.com/users/7034529/magisch\"><img src=\"http://stackexchange.com/users/flair/7034529.png\" width=\"208\" height=\"58\" alt=\"profile for Magisch on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Magisch on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a></p>\n\n<p>Im active and reachable usually in these chatrooms:</p>\n\n<ul>\n<li><a href=\"http://chat.stackexchange.com/rooms/11540/charcoal-hq\">Charcoal HQ</a></li>\n<li><a href=\"http://chat.stackoverflow.com/rooms/41570/so-close-vote-reviewers\">SOCVR</a></li>\n<li><a href=\"http://chat.stackoverflow.com/rooms/111347/sobotics\">SOBotics</a></li>\n</ul>\n',0,0,0,7034529,'https://i.stack.imgur.com/JUi4S.png?s=128&g=1'),(15162,101,'2016-10-31T08:46:17.310','angussidney',NULL,'2017-08-26T07:14:54.823',NULL,'Australia',NULL,'\n\n<p>Hobbyist developer, gamer, and RPG player. Currently learning Node.js and Rails.</p>\n\n<p><a href=\"https://stackexchange.com/users/5869449\">\n<img src=\"https://stackexchange.com/users/flair/5869449.png?theme=clean\" width=\"208\" height=\"58\" alt=\"profile for Angus Atkinson on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Angus Atkinson on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n\n<p>You can contact me by emailing the following address (where you replace <code>potato</code> with my username):</p>\n\n<blockquote>\n  <p>potato17 (at) gmail (dot) com</p>\n</blockquote>\n\n<p>Profile pictures by <a href=\"http://lorcblog.blogspot.com/\" rel=\"nofollow noreferrer\">Lorc</a> and <a href=\"http://delapouite.com/\" rel=\"nofollow noreferrer\">Delapouite</a>. Available on <a href=\"http://game-icons.net/\" rel=\"nofollow noreferrer\">game-icons.net</a>.</p>\n',0,0,0,5869449,'https://i.stack.imgur.com/56f0m.png?s=128&g=1'),(15163,28,'2016-10-31T15:09:57.760','Arvin Rasoulzadeh',NULL,'2017-07-14T13:44:15.653',NULL,'Vienna, Austria',28,'<p>Im a PhD student of technical mathematics in \"Kinematics\" at \"Vienna University of Technology\". Currently researching on the singularity analysis of \"Pentapod\" parallel robot. \nIm also deeply interested in \"Module Theory\",\"Computational Algebraic Geometry\", \"Kinematics\" and of course the intersection of these topics with Robotics.</p>\n',0,2,0,5547293,'https://i.stack.imgur.com/jNPYM.jpg?s=128&g=1'),(15164,1,'2016-10-31T15:20:05.120','Unattainable',NULL,'2016-11-14T20:47:00.907',NULL,NULL,NULL,NULL,0,0,0,9552014,'https://www.gravatar.com/avatar/3bfd8816430dada00e2564cad3249fc7?s=128&d=identicon&r=PG&f=1'),(15165,1,'2016-10-31T17:57:57.270','kobuki',NULL,'2016-10-31T17:57:57.270','http://kelestemur.com','Ankara, Turkey',NULL,NULL,0,0,0,4515084,'https://www.gravatar.com/avatar/373cec2afce147d96f5d3d6597e1b39b?s=128&d=identicon&r=PG&f=1'),(15166,1,'2016-10-31T17:58:50.467','lonnykight',NULL,'2016-10-31T17:58:50.467',NULL,NULL,NULL,NULL,0,0,0,9548645,'https://www.gravatar.com/avatar/b384395a35b18c76f4f951f504766d62?s=128&d=identicon&r=PG&f=1'),(15167,101,'2016-11-01T00:38:25.340','Robert Columbia',NULL,'2017-08-14T23:11:06.557',NULL,NULL,NULL,NULL,0,0,0,8643622,'https://www.gravatar.com/avatar/afe54d3c421faa969c7ca7c93eda682a?s=128&d=identicon&r=PG&f=1'),(15168,101,'2016-11-01T00:45:07.793','gigi',NULL,'2016-11-28T20:16:21.557',NULL,NULL,NULL,NULL,0,0,0,8793729,'https://www.gravatar.com/avatar/2978ebff6889a3b25cccc12375a7f753?s=128&d=identicon&r=PG&f=1'),(15169,1,'2016-11-01T00:55:17.627','Matthew Meredith',NULL,'2016-11-01T00:55:17.627',NULL,NULL,NULL,NULL,0,0,0,9554785,'https://www.gravatar.com/avatar/1b522454bfe95f029f2ab0e967c95746?s=128&d=identicon&r=PG&f=1'),(15170,1,'2016-11-01T04:35:15.340','Venky Govind',NULL,'2016-11-01T04:35:15.340',NULL,NULL,NULL,NULL,0,0,0,5119490,'https://lh4.googleusercontent.com/-DFOj993cPvU/AAAAAAAAAAI/AAAAAAAAAJA/NA2G9XJF7KE/photo.jpg?sz=128'),(15171,1,'2016-11-01T05:58:14.533','Adam Ryason',NULL,'2016-11-01T05:58