-11-29T16:12:22.180','Henry WH Hack v2.1',NULL,'2017-08-21T09:52:43.703','http://stackexchange.com','Stack Exchange',15,'<p><br>Hello my name is Henry WH Hack\n<br>I am interested in Science,Computers and Learning new things everyday.</p>\n\n<p>Life is not fair; get used to it. (Bill Gates)</p>\n\n<p>Microsoft isnt evil, they just make really crappy operating systems. (Linus Torvalds)</p>\n\n<p>in my opinion MS is a lot better at making money than it is at making good operating systems. (Linus Torvalds)</p>\n\n<blockquote class=\"spoiler\">\n  <p>Keeping it Alive! :) (Henry WH Hack)</p>\n</blockquote>\n\n<p><a href=\"https://stackexchange.com/users/7238091\">\n<img src=\"https://stackexchange.com/users/flair/7238091.png\" width=\"208\" height=\"58\" alt=\"profile for Henry WH Hack v2.0 on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Henry WH Hack v2.0 on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n\n<ul>\n<li>My proposal on Area51.SE</li>\n</ul>\n\n<p><a href=\"https://area51.stackexchange.com/proposals/102381/weapons?referrer=3Lgln95yUC3OAZl60SdIxw2\"><img src=\"https://area51.stackexchange.com/ads/proposal/102381.png\" width=\"300\" height=\"250\" alt=\"Stack Exchange Q&amp;A site proposal: Weapons\" /></a></p>\n\n<ul>\n<li>Other Area51.SE proposals you should check out</li>\n</ul>\n\n<p><a href=\"https://area51.stackexchange.com/proposals/102228/virtual-and-augmented-reality?referrer=3Lgln95yUC3Hnqg3wxD2og2\"><img src=\"https://area51.stackexchange.com/ads/proposal/102228.png\" width=\"300\" height=\"250\" alt=\"Stack Exchange Q&amp;A site proposal: Virtual and Augmented Reality\" /></a></p>\n\n<p><a href=\"https://area51.stackexchange.com/proposals/103884/agriculture-farming?referrer=3Lgln95yUC1mVImUQXnQqQ2\"><img src=\"https://area51.stackexchange.com/ads/proposal/103884.png\" width=\"300\" height=\"250\" alt=\"Stack Exchange Q&amp;A site proposal: Agriculture &amp; Farming\" /></a></p>\n\n<ul>\n<li>Stack Exchange sites in Private Beta</li>\n</ul>\n\n<p>Although Im not a background process like the <a href=\"https://stackexchange.com/users/-1/community\">Community User</a> I help the Stack Exchange sites in the background.</p>\n\n<p>Here are the tasks I do on the Stack Exchange sites:</p>\n\n<ul>\n<li>I flag bad post.</li>\n<li>I do edits on some SE sites.</li>\n<li>I do Close/Reopen reviews on private beta sites.</li>\n<li>I Congratulate. (chats)</li>\n<li>I case (Up | Down | Close | Reopen) votes on Area51.SE example questions.</li>\n<li>I ask example questions on Area51.SE proposals.</li>\n</ul>\n\n<p>What I dont do:</p>\n\n<ul>\n<li>Answer questions.</li>\n</ul>\n',0,0,0,7238091,'https://i.stack.imgur.com/ZsWaj.jpg?s=128&g=1'),(15415,1,'2016-11-29T16:27:48.077','Rolly',NULL,'2017-08-25T13:38:51.457',NULL,NULL,NULL,NULL,0,0,0,8752959,'https://www.gravatar.com/avatar/ebc0b3fa2f5712e2073b0ac879f85d46?s=128&d=identicon&r=PG&f=1'),(15416,11,'2016-11-29T16:43:52.293','Timmeh',NULL,'2017-05-30T15:45:46.393',NULL,'Netherlands',23,NULL,0,0,0,7280490,'https://www.gravatar.com/avatar/590bce047f2b139be291edb40c66e9f0?s=128&d=identicon&r=PG&f=1'),(15417,1,'2016-11-29T16:57:59.793','Aluko',NULL,'2016-12-26T09:18:45.470',NULL,NULL,NULL,NULL,0,0,0,9747050,NULL),(15418,1,'2016-11-29T17:11:36.403','Nour Elsayed',NULL,'2016-11-29T17:11:36.403',NULL,NULL,NULL,NULL,0,0,0,9747161,'https://www.gravatar.com/avatar/273deebbfa152d6ec1d36813882c3954?s=128&d=identicon&r=PG&f=1'),(15419,1,'2016-11-29T17:38:24.170','whiteTea',NULL,'2016-12-09T12:17:24.430',NULL,NULL,NULL,NULL,0,0,0,9448736,'https://www.gravatar.com/avatar/06f6f2f972ff9d175cf9e2518dac5b2c?s=128&d=identicon&r=PG&f=1'),(15420,1,'2016-11-29T21:05:02.627','Matija29',NULL,'2017-07-22T10:28:31.160',NULL,'Croatia',31,NULL,0,0,0,4292708,'https://i.stack.imgur.com/3EfQr.jpg?s=128&g=1'),(15421,1,'2016-11-30T02:38:22.323','saif shines',NULL,'2016-12-16T09:28:59.673',NULL,'Chennai, India',19,NULL,0,0,0,7034095,'http