1,'2016-12-15T23:28:10.177','user137000',NULL,'2017-03-09T17:18:07.087',NULL,NULL,NULL,NULL,0,0,0,9701484,'https://www.gravatar.com/avatar/60f8dacf2713d884f649d52abe00bb45?s=128&d=identicon&r=PG&f=1'),(15570,101,'2016-12-16T02:39:27.623','raspi',NULL,'2016-12-16T02:39:27.623','http://raspi.fi','Finland',34,'Buzzwords: PHP, SQL, Python, C#, TCL, Bash, XHTML, XML, CSS, Linux, DNS, VMWare',0,0,0,27314,'https://www.gravatar.com/avatar/1f00d9aa3c469deb0e21156954f2be2b?s=128&d=identicon&r=PG'),(15571,1,'2016-12-16T11:30:12.620','B.M',NULL,'2016-12-22T12:05:57.843',NULL,NULL,NULL,NULL,0,0,0,8723321,'https://www.gravatar.com/avatar/4f9d7de4d21e8a67158bd138216b4122?s=128&d=identicon&r=PG&f=1'),(15572,101,'2016-12-16T13:06:47.957','Quidam',NULL,'2016-12-16T13:06:47.957',NULL,'Paris, France',NULL,'<p>I see StackEchange as everything but a welcoming community. Too many people here who likes to mock other people, harsh comments, downvoting as a sport, marking questions duplicate without reading or trying to understand what the person is really asking. A lot of people doesnt like to help other, but seems to be here to collect reputation points. Downvoting, downvoting, downvoting, and closing questions... If you are a beginner in a topic, how to avoid asking noob questions? I wonder!!! This reputation point system prevents people to be more friendly. Neutrality is a lie.</p>\n\n<p>The reason I still use it is that it teach me many things, because a lot of rude people, but some very specialized persons can be found here, and theres a lot to learn. Its the (very) positive side. There are some hidden treasures to learn many new things! I learned a lot.</p>\n\n<p>If the community (in general) was not so hostile, with a negative state of mind, it would be the perfect site.</p>\n\n<p>My English is not always perfect, but I try. :kof:</p>\n\n<p>Im almost a polyglot able to read and write in 6 languages now, maybe a real polyglot later. I hope so, and Im working on it.</p>\n',0,0,0,472604