47c015215b152f?s=128&d=identicon&r=PG&f=1'),(15660,1,'2016-12-27T11:08:05.527','Yaroslav Havrylovych',NULL,'2016-12-27T11:08:05.527',NULL,'Kyiv, Ukraine',26,'<p>Android and Java developer</p>\n',0,0,0,4729358,'https://i.stack.imgur.com/DdG2r.jpg?s=128&g=1'),(15661,1,'2016-12-27T11:19:14.343','Nino Pereira',NULL,'2017-02-09T16:52:36.407',NULL,'Swindon, UK',NULL,'<p>Im an enthusiastic engineer with more than 10 years of industrial experience working in highly innovative companies developing complex and robust systems in the field of electronics, software and robotics. I like challenging projects and working with a motivated team.\nI engage with my colleagues and team members in order to make sure we keep on track with the project, its deadlines and budget. </p>\n\n<p>My core competences lie in product development, simulations, algorithms and integration of complex systems.</p>\n\n<p>My recent role includes:\n- Developing new algorithms\n- Profiling and optimizing C++ libraries;\n- Testing and cauterization of the high-level behaviors in the platform\n- Integration of navigation algorithms, obstacle avoidance, path planning, sensor placement, etc.\n- Supporting other teams with tools and technologies;\n- Mentoring junior team members;</p>\n\n<p>Interests:\nArtificial intelligence, Machine learning, Path Planning and Motion Control\nProduct Development, Robotics\nSensing systems, Computer Vision\nElectronics Engineering.</p>\n\n<p>Experience:\nProduct developer, algorithms and software developer</p>\n\n<p>Projects:\nNext generation of robotic vaccum cleaners\nDyson 360 Eye \nGolf Ball Picker Robot\nOmnidireccional Wheelchair\nBotn Roll ONE Educational Robot</p>\n',0,0,0,5709360,'https://lh3.googleusercontent.com/-sTDDVp249rE/AAAAAAAAAAI/AAAAAAAAAjA/9gp4tQYLRCw/photo.jpg?sz=128'),(15662,1,'2016-12-27T11:32:08.043','saeedeh',NULL,'2016-12-27T11:32:08.043',NULL,NULL,NULL,NULL,0,0,0,9847603,'https://i.stack.imgur.com/6odhD.png'),(15663,1,'2016-12-27T13:03:24.653','Philipp T