"},\n\n    Platform(\"WindowsPhone\",\"WPF\",\"WinForms\"),\n\n};\n</code></pre>\n',0,1,0,3562199,'https://graph.facebook.com/569231248/picture?type=large'),(15792,1,'2017-01-13T14:11:01.847','Rud Qertz',NULL,'2017-07-20T15:46:31.940',NULL,NULL,NULL,NULL,0,0,0,9143320,'https://graph.facebook.com/112339995889756/picture?type=large'),(15793,101,'2017-01-13T22:06:37.280','warren',NULL,'2017-03-14T16:02:32.010','http://antipaucity.com','Lily, KY',36,'<p>Im a hobbyist programmer, part-time sysadmin, and full-time data center management, automation, and cloud computing architect and delivery engineer.</p>\n\n<p>I have experience with myriad editors, shells, and OSes. While I have my [strong] preferences, am pretty much beyond the religious wars of \"whats best\" when it comes to platform, editor, or toolset: if it works for the problem at hand, and you know it, its [probably] worthwhile :)</p>\n',0,0,0,3110,'https://i.stack.imgur.com/sQFX6.jpg?s=128&g=1'),(15794,1,'2017-01-14T05:58:55.913','jinyu0310',NULL,'2017-01-14T05:58:55.913',NULL,'Hangzhou, Zhejiang, China',NULL,NULL,0,0,0,6170100,'https://i.stack.imgur.com/Qbmpk.png?s=128&g=1'),(15795,101,'2017-01-14T12:14:59.590','Ryder',NULL,'2017-08-19T03:58:19.540',NULL,NULL,NULL,NULL,0,0,0,4669595,'https://i.stack.imgur.com/U3aER.png?s=128&g=1'),(15796,1,'2017-01-14T12:40:46.643','Gabrielus',NULL,'2017-06-07T10:47:14.427',NULL,'Outta this world',NULL,'<pre><code>while (true)\n{\n   if(time == TIME.DAY)\n      {\n      this.me = \"Student\";\n      }\n   else if(time == TIME.NIGHT)\n      {\n      this.me = \"tired Student\";\n      this.sleep = false;\n      }\n}\n</code></pre>\n',0,0,0,3714255,'https://www.gravatar.com/avatar/61074b2c4024ac946f69aa333e99fe8e?s=128&d=identicon&r=PG&f=1'),(15797,1,'2017-01-14T15:08:27.130','ValeGreen',NULL,'2017-01-17T06:13:21.397','http://www.valegreen.com','Boston, VA, United States',55,'<p>My main CV can be found at <a href=\"http://linkedin.com/in/billsadler\" rel=\"nofollow noreferrer\">http://linkedin.com/in/billsadler</a> - but heres the short of it:</p>\n\n<p><strong>Im a Maker</strong> - mostly software, most recently Artificial Intelligence / Machine Vision on nVidia CUDA, but also embedded stuff and some minor robotics with drones and the sensors and tech around them. Ive 30+ years of software development experience ranging from Intel 8000 assembly through AWS and enterprise clouds and everything in-between. Security stuff as well, I particularly enjoy penetration testing - its the expression on the faces of the system owners when you get em.</p>\n\n<p>Ive done ALL types of programming languages, and used many of the instantiations (but not all!). New languages are just syntax now. I much prefer Linux over windows, but work in both. What a Mac? Some kind of hamburger?</p>\n\n<p><strong>Im a Teacher</strong> - Ive found that one of the most satisfying things is to teach something to the point where the light bulb to come on over a students head. Its also the best way to learn stuff. I figured this out in college where I was a Teaching Assistant and later a Graduate Teaching Assistant. Heres the list of stuff Ive taught or teach:</p>\n\n<ul>\n<li>Mathematics / Computer Science (TA / GTA in College and classes / tutoring for homeschooled kids)</li>\n<li>Photography at the Showcase School in Atlanta</li>\n<li>PADI Open Water SCUBA Instructor\n\n<ul>\n<li>Underwater Photography Specialty Instructor</li>\n</ul></li>\n<li>NRA instructor in the following disciplines:\n\n<ul>\n<li>Rifle, Pistol, Shotgun</li>\n<li>Personal Protection</li>\n<li>Inside the Home</li>\n<li>Outside the Home</li>\n</ul></li>\n<li>Utah Bureau of Criminal Identification Concealed Carry Permit Instructor</li>\n<li>Virginia Department of Game and Inland Fisheries Hunting Instructor</li>\n</ul>\n',0,0,0,10025903,'https://i.stack.imgur.com/BJKpZ.jpg?s=128&g=1'),(15798,31,'2017-01-14T17:06:02.900','Telepresence',NULL,'2017-01-27T18:24:04.357',NULL,'Nebraska, United States',NULL,'<p>I am a Computer Science student.</p>\n',0,0,0,7668296,'https://www.gravatar.com/avatar/3daa10171eb5c4c504f7a839395b80e2?s=128&d=identicon&r=PG&f=1'),(15799,1,'2017-01-14T21:08:27.493','pcods',NULL,'2017-06-14T14:06:45.407',NULL,NULL,NULL,NULL,0,0,0,10023818,'https://www.gravatar.com/avatar/c2887677fc26c227725a8a0df52eb8b4?s=128&d=identicon&r=PG&f=1'),(15800,1,'2017-01-14T21:52:06.787','David Jiang',NULL,'2017-01-14T21:52:06.787',NULL,NULL,NULL,NULL,0,0,0,7546383,'https://lh5.googleusercontent.com/-3Z1qcIxC__s/AAAAAAAAAAI/AAAAAAAAAm8/8DDy7gs9Xq8/photo.jpg?sz=128'),(15801,106,'2017-01-15T02:39:48.473','MoneyBall',NULL,'2017-06-12T07:55:59.513',NULL,'United States',28,'<p>BY DAY: Alt-Rock Ninja Cowgirl at Verifidan Dyanmics</p>\n\n<p>BY NIGHT: I write code and code rights for penalcoders.example.org, an awesome n\non-profit that will totally take your money at that link. My kids are cuter than\n yours.</p>\n\n<p>FOR FUN: C+ Jokes, Segway Roller Derby, NYT Sat. Crosswords (in Sharpie!), Ostri\nch Grooming.</p>\n\n<p>\"If you see scary things, look for the helpers-youll always see people helping.\n\" -Fred Rogers</p>\n',0,2,0,6738075,'https://i.stack.imgur.com/ckLj6.png?s=128&g=1'),(15802,1,'2017-01-15T10:07:51.403','hirobit',NULL,'2017-01-16T10:19:54.173',NULL,NULL,NULL,NULL,0,0,0,10036738,NULL),(15803,1,'2017-01-15T10:39:57.560','Cerberus',NULL,'2017-01-15T10:39:57.560',NULL,NULL,NULL,NULL,0,0,0,6771027,'https://www.gravatar.com/avatar/3c42947f1bd60ea49b0e605c7d78526d?s=128&d=identicon&r=PG&f=1'),(15804,1,'2017-01-15T16:00:43.267','L4ncelot',NULL,'2017-08-24T14:56:05.840','','Prague, Czech Republic',NULL,'',0,0,0,3995590,'https://graph.facebook.com/100006434409773/picture?type=large'),(15805,101,'2017-01-15T19:17:54.120','Photon',NULL,'2017-07-16T14:02:08.340',NULL,NULL,NULL,NULL,0,0,0,1812195,'https://www.gravatar.com/avatar/62cf1e1d4cec3b8f1a03570bb0e55d05?s=128&d=identicon&r=PG'),(15806,1,'2017-01-15T21:18:05.397','Steve Short',NULL,'2017-01-16T19:12:28.110',NULL,NU