ore',27,'<p>Creative geek with an <strong>entrepreneurial mindset</strong> and a <strong>quick learner</strong> with abilities to work in a <em>team environment</em>. Interested in challenging, growth oriented position in a progressive and innovative Organization that will utilize my knowledge, skills and, interests in <strong>Test Automation</strong> and also provide an opportunity to get involved in implementing <strong>innovative ideas</strong> with <strong>quality</strong> standards and <strong>next generation technologies</strong>.</p>\n\n<p><strong>Core Qualifications</strong>  </p>\n\n<ul>\n<li>Certified <strong>Scrum Developer</strong> and <strong>Scrum Master</strong>.  </li>\n<li>More than 2 year experience in <strong>automation framework outlining</strong> and\n<strong>script coding</strong>.</li>\n<li>Strong expertise in use of <strong>stress testing tools</strong> and <strong>software\ntesting methodologies</strong>.</li>\n<li>Sound knowledge of <strong>quality assurance procedures</strong> and <strong>testing Embedded\napplications</strong>.</li>\n<li>Good skills in <strong>Python</strong> and <strong>shell scripting</strong> and Knowledge in C,C++.   </li>\n<li>Hands on experience in <strong>Manual Testing</strong> &amp; <strong>Automation Testing</strong> and\nvarious testing techniques like <strong>User Interface Testing</strong>, <strong>Functionality\nTesting</strong>, <strong>Regression Testing</strong> and <strong>System Integration Testing</strong>.   </li>\n</ul>\n\n<p><strong>SKILLS SET</strong> </p>\n\n<p><strong>Software Testing</strong>   </p>\n\n<ul>\n<li>Acquainted with <strong>Software Test Life cycle</strong> (STLC) &amp; <strong>Software\nDevelopment Life Cycle</strong> (SDLC).</li>\n<li>Good in <strong>Automation testing</strong>.</li>\n<li>Well versed with all testing concepts and methodologies and good experience in preparation, review and execution of test cases.  </li>\n<li>Understanding &amp; knowledge in preparing <strong>Requirements</strong> &amp; <strong>Test Plan</strong>\nDocuments.</li>\n<li>Good in communicating with Business stakeholders, Other Vendors &amp; User\nAcceptance Testing Team.</li>\n<li>Good Knowledge in Preparation of <strong>Test Cases</strong> (Functional,System &amp; Validation).</li>\n<li>Good Knowledge in executing Testing Process and Testing Methodologies.</li>\n<li>Ability to take initiatives, has vision and drives that vision to a\nbetter Quality Organization.</li>\n<li>Good experience in different types of testing ( Functional,\nRegression, Scenario &amp; Progression Testing, Integration and System).    </li>\n</ul>\n\n<p><strong>Quality Assurance</strong></p>\n\n<ul>\n<li>Defining and managing the Quality Assurance program in the\norganization.</li>\n<li>Actively involved in reviewing of Test Plan.</li>\n<li>Overseeing metrics data collection and calculation, reporting to the\nmanagement on a regular basis for the same.</li>\n<li>Writing and reviewing of Test cases using Test Case Design\nTechniques.</li>\n<li>Knowledge of Atlassian tools(<code>JIRA</code>,<code>BITBUCKET</code> and <code>Confluence</code>) and\n<strong>Jenkins</strong> Automation tool for regularly monitoring the software\nquality.</li>\n</ul>\n',0,0,0,5105372,'https://graph.facebook.com/100000368544115/picture?type=large'),(15815,101,'2017-01-16T19:08:09.170','Wes Modes',NULL,'2017-01-16T19:08:09.170','http://modes.io','Santa Cruz, CA',51,'<p>Wes Modes is a Santa Cruz artist and art researcher working in the Digital Art and New Media program at the University of California Santa Cruz. In various lives, he is a sculptor, writer, performer, community organizer, programmer, geek, and mischief-maker.</p>\n\n<p>Current projects:</p>\n\n<p><em>Secret History</em> is a journey to discover and collect the lost narratives of people who live and work on the river from the deck of a recreated shantyboat and present these stories through web-based digital archives and a touring art installation. <a href=\"http://peoplesriverhistory.us\" rel=\"nofollow\">http://peoplesriverhistory.us</a></p>\n\n<p><em>Co-related Space</em> is a digitally-enhanced environment that highlights participants  active engagement and experimentation with sound and light, including complex direct and indirect behavior and relationships. Using motion tracking, laser light projection and a generative soundscape, it encourages interactions between participants, visually and sonically transforming a regularly trafficked space. <a href=\"http://corelatedspace.com\" rel=\"nofollow\">http://corelatedspace.com</a></p>\n',0,0,0,2369089,'https://www.gravatar.com/avatar/d67924e6b62cc61114a38493dff3a576?s=128&d=identicon&r=PG'),(15816,1,'2017-01-16T19:31:36.887','PallavBakshi',NULL,'2017-03-23T05:42:18.887',NULL,'Hong Kong',23,NULL,0,0,0,7320231,'https://www.gravatar.com/avatar/3b6a7529a9e538c83d703817c56080b4?s=128&d=identicon&r=PG&f=1'),(15817,101,'2017-01-16T20:58:29.233','ORooney',NULL,'2017-01-16T20:58:29.233','http://aaronlawrence.fastmail.fm','New Zealand',NULL,'<p>Co-discoverer of the East Pole.</p>\n',0,3,0,389829,'https://www.gravatar.com/avatar/104e10275d2658c4b1d974521e20d53e?s=128&d=identicon&r=PG'),(15818,1,'2017-01-16T21:42:49.803','1st',NULL,'2017-01-17T06:34:56.413',NULL,NULL,NULL,NULL,0,0,0,8257825,'https://i.stack.imgur.com/1ttE3.jpg?s=128&g=1'),(15819,1,'2017-01-17T01:22:59.160','Jeevs Jeevan',NULL,'2017-02-08T13:52:48.627',NULL,NULL,NULL,NULL,0,0,0,10047070,'https://lh3.googleusercontent.com/--_YUBH2vJ5M/AAAAAAAAAAI/AAAAAAAAAio/nBXTp9huofM/photo.jpg'),(15820,1,'2017-01-17T02:33:31.107',' ',NULL,'2017-08-07T02:19:16.993',NULL,NULL,NULL,NULL,0,0,0,10047329,'https://www.gravatar.com/avatar/112281f36557d65cee7ade4b500e3869?s=128&d=identicon&r=PG&f=1'),(15821,101,'2017-01-17T08:13:22.253','Paul Michalik',NULL,'2017-03-21T11:22:13.257',NULL,'Munich, Germany',NULL,'<p>Software engineer and craftsman</p>\n',0,0,0,196526,'https://lh6.googleusercontent.com/-lS2ynA6Li3s/AAAAAAAAAAI/AAAAAAAA