<p>Hello,  \n Im a young German guy interested in computers, science, art, music (heavy metal, rock, classical - in that order) and many other things.<br>\nI love Ubuntu and most Linux distributions in general, but I can also do some Windows magic if needed. Additionally I have pretty good programming skills in Python, Java, C# and Bash; basic skills in JavaScript, HTML+CSS, C, C++, Scheme, Basic, etc...  </p>\n\n<p>You can easily contact me in the <a href=\"http://chat.stackexchange.com/rooms/201/ask-ubuntu-general-room\">Ask Ubuntu General Room</a> or the <a href=\"http://chat.stackoverflow.com/rooms/22091/teenage-programmers-chatroom\">Teenage Programmers Chatroom</a>, as I at least have a quick peek in there most days. I also play chess, so feel free to send me a <a href=\"http://en.lichess.org/@/ByteCommander\" rel=\"nofollow noreferrer\">lichess.org challenge</a>.</p>\n\n<p></p>\n\n<p><sub><del>PS: My profile picture is derived from <a href=\"http://haskditex.deviantart.com/art/Wolf-Tribals-267898705\" rel=\"nofollow noreferrer\">\"Wolf Tribals\" by user HaskDitex (DeviantArt.com)</a>, which is under <a href=\"http://creativecommons.org/licenses/by/3.0/\" rel=\"nofollow noreferrer\">creative Commons 3.0 License</a>.</del>\n<br/>\nCurrently Im using the character \"Dregg Morriss\" from the game \"Medieval Cop\" by Vasant Jahav (\"Gemini Gamer\"). <del>It can be found <a href=\"http://medieval-cop.wikia.com/wiki/Dregg_Morris\" rel=\"nofollow noreferrer\">here</a>.</del>\n</sub></p>\n\n\n',0,0,0,5612515,'https://i.stack.imgur.com/m8DYH.jpg?s=128&g=1'),(16206,101,'2017-02-25T13:48:33.107','Gluttton',NULL,'2017-06-29T04:38:44.080','http://gluttton.gitlab.io',NULL,NULL,'<p><a href=\"https://gitlab.com/u/Gluttton/projects\" rel=\"nofollow noreferrer\"><img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/1/18/GitLab_Logo.svg/210px-GitLab_Logo.svg.png\" width=\"64\" height=\"64\"/></a></p>\n',0,0,0,3829514,'https://i.stack.imgur.com/agIDd.jpg?s=128&g=1'),(16207,1,'2017-02-25T14:54:25.237','MasterOfPuppets',NULL,'2017-06-16T06:53:10.637',NULL,NULL,NULL,NULL,0,0,0,10037883,'https://www.gravatar.com/avatar/2e6778c9b2bf9cc69950484ee8dad8d1?s=128&d=identicon&r=PG&f=1'),(16208,101,'2017-02-25T18:56:27.273','Honda',NULL,'2017-03-18T01:07:49.640',NULL,'Ontario, Canada',NULL,'<p>Curiosity brought me here</p>\n',0,0,0,9484412,'https://i.stack.imgur.com/ZQDZ1.jpg'),(16209,23,'2017-02-25T19:44:25.793','Guubi',NULL,'2017-02-26T09:27:47.700',NULL,'Dhaka',18,'<p>Dumb but curious.</p>\n',0,0,0,10333998,'https://lh6.googleusercontent.com/-SHVfURqxAKk/AAAAAAAAAAI/AAAAAAAAAG4/8LpXGWp1Pzs/photo.jpg?sz=128'),(16210,1,'2017-02-25T20:09:21.583','Y. Pan',NULL,'2017-02-25T20:09:21.583',NULL,NULL,NULL,NULL,0,0,0,10334174,'https://www.gravatar.com/avatar/c202609a09108b046e185f20b282087d?s=128&d=identicon&r=PG&f=1'),(16211,1,'2017-02-25T22:41:12.123','Samuel Duffy',NULL,'2017-02-25T22:56:14.880',NULL,NULL,NULL,NULL,0,0,0,10334738,'https://lh4.googleusercontent.com/-TK3PG-Jv2Ow/AAAAAAAAAAI/AAAAAAAAAZM/uC1emtLoIfM/photo.jpg'),(16212,101,'2017-02-26T10:11:04.757','yati sagade',NULL,'2017-02-26T12:01:03.873',NULL,'Amsterdam, Netherlands',NULL,NULL,0,2,0,351165,'https://i.stack.imgur.com/SNsXy.jpg?s=128&g=1'),(16213,1,'2017-02-26T13:32:56.110','charles',NULL,'2017-02-26T13:32:56.110',NULL,NULL,NULL,NULL,0,0,0,10337876,'https://www.gravatar.com/avatar/24aaebf7f4191068dc4fd5f95852617b?s=128&d=identicon&r=PG&f=1'),(16214,1,'2017-02-26T15:31:20.997','Alex Smirnov',NULL,'2017-02-26T15:31:20.997','https://www.linkedin.com/in/alekseismirnov','Moscow',24,'<p>Hello everyone!\nIm Alex, I graduated Department of Mathematics and Mechanics of Moscow State University. Currently Im a postgraduate student doing research in the field of inertial and satellite navigation. I also have extensive experience in the field of Software Development, Data Analysis, Computer Modeling, Signal Processing.</p>\n\n<p>Im mostly focused on developing different kinds of indoor navigation algorithms and solutions, either industrial, such as navigation of firefighters, or extensive navigational solutions for mobile platforms. Currently Im Head of R&amp;D in <a href=\"http://www.navigine.com\" rel=\"nofollow\">Navigine corp.</a>, where I lead research and development of a wide range of projects.</p>\n',0,0,0,4477219,'https://i.stack.imgur.com/zDzwP.jpg?s=128&g=1'),(16215,1,'2017-02-26T15:36:32.157','1Somebody5',NULL,'2017-02-26T15:36:32.157',NULL,NULL,NULL,NULL,0,0,0,10338315,'https://i.stack.imgur.com/bZgpm.jpg?s=128&g=1'),(16216,101,'2017-02-26T17:19:30.690','Redanium',NULL,'2017-08-13T22:17:53.890',NULL,'Algeria',NULL,'<p>Do the evolut!on</p>\n',0,0,0,163529,'https://i.stack.imgur.com/Cdagh.gif?s=128&g=1'),(16217,1,'2017-02-26T17:32:25.450','Cyborg-X1',NULL,'2017-03-23T09:57:00.040',NULL,'Bellenberg, Germany',34,NULL,0,0,0,1831874,'https://i.stack.imgur.com/cRy6O.jpg?s=128&g=1'),(16218,101,'2017-02-26T19:16:55.933','Arpit Sisodia',NULL,'2017-02-26T19:16:55.933','http://machinelearningstories.blogspot.in/','Bangalore, Karnataka, India',29,'<p>A simple data scientist focuses more on research and predictive model building.\nMy core competencies are time series forecasting, state space modelling, structure Equation modelling, Conjoint Analysis and deep learning.</p>\n\n<p>You can read my blogs here- <a href=\"http://machinelearningstories.blogspot.in\" rel=\"nofollow noreferrer\">http://machinelearningstories.blogspot.in</a><br>\nYou can also connect with me on Linkedin at <a href=\"https://www.linkedin.com/in/arpitsisodia\" rel=\"nofollow noreferrer\">https://www.linkedin.com/in/arpitsisodia</a></p>\n\n<p>I am fun loving person and like to play tennis, and spend time with my friends and family when i am not doing deeper/deepest learning :P</p>\n',0,0,0,6770666,'https://i.stack.imgur.com/Pndg0.jpg?s=128&g=1'),(16219,1,'2017-02-26T19:26:30.823','khaoula Maatoug',NULL,'2017-04-10T17:00:40.720',NULL,NULL,NULL,NULL,0,0,0,5619398,'https://i.stack.imgur.com/avAwS.jpg'),(16220,1,'2017-02-26T19:44:24.313','Andrew King',NULL,'2017-08-06T07:06:45.497','http://andrewking.io','Athens, GA, United States',NULL,'<p>I am an artificial intelligence graduate student with a passion for deep learning and neuroevolution.</p>\n',0,0,0,7351760,NULL),(16221,101,'2017-02-26T19:53:46.623','KARTHIKEYAN.A',NULL,'2017-03-21T07:49:36.590','https://in.linkedin.com/in/karthikeyan-a','Chennai, Tamil Nadu, India',26,'<p>Indian Mathematician and Researcher | Big Data, Machine Learning, Cognitive IoT |  Research, Teaching, Design and Development.</p>\n\n<p>I can dedicate and explore myself to the best there by contributing to the\ncompany s growth and developing myself in the personal and Professional front.</p>\n\n<p><strong>Profession:</strong> Associate Consultant Developer, Software Developer,  Web Developer Trainee, Teaching assistant, Mathematician and Researcher.</p>\n\n<p><strong>Education :</strong> B.E.,M.Tech-Computer Science and Engineering,</p>\n\n<pre><code>Honor Code Certifications: 14+,\nResearch Projects: 8+,\nWorkshop : 7+,\nConferences : 3+,\nTraining Courses: 19+,\nPublications: 2+,\nHonor &amp; Award : 1+,\nVolunteer experience &amp; causes: 3+,\nHobbies: Research, Teaching, Design and Development.\n</code></pre>\n\n<p><strong>Programming Languages:</strong> Scala, JavaScript, Python, Bash, C and Java.</p>\n\n<p><strong>Research Area:</strong> Big Data, Machine Learning, Internet of Things, Visualization, Data Analytics, Healthcare.</p>\n\n<p><strong>Technologies:</strong> Apache Hadoop, Apache Spark, Apache Hive, Apache Kafka, Apache Zookeeper, Infiniflux DB, Spark Job Server, MySQL, SBT, Scalatra,  MongoDB, NodeJS, Node-red, Nam, HTML, CSS,  Bootstrap,  Express, Mongoose, AngularJS, D3.js,  Jetty Web Server, REST Service Development, Object Oriented Programming, CentOS, Ubuntu, Github, Amazon Web Services,  Bottle, pymongo, pyspark, tkInter, nltk, PIL, Image, base64, TextBlob, nltk, re, Ipython, numpy, Scipy, cx_oracle, Ns2, xGraphs.</p>\n\n<p><strong>Operating System :</strong> Windows XP, 7, 8.1, Ubuntu 12.04.</p>\n\n<p><strong>My Active Research and Development activities are:</strong></p>\n\n<ul>\n<li>Recommendation system for Online Shopping websites,</li>\n<li>Sentiment Classification for Online Blog Reviews,</li>\n<li>Image Enhancement Technique in Digital Image Processing,</li>\n<li>Hadoop Application Development using Python and Javascript,</li>\n<li>Scalabe Algorithm Development for Solving Real time problems,</li>\n<li>Big Data Analytics in Network Monitoring,</li>\n<li>Robotics Application Development for optimizing the monitoring system in military applications,</li>\n<li>Embedded Application Development for remote sensor streaming data analysis,</li>\n<li>Robotics Vision implementation using Digital Image Processing,</li>\n<li>IOT Application Development for health care sector,</li>\n<li>Scalable Machine Learning Application Development</li>\n</ul>\n',0,0,0,5913142,'https://i.stack.imgur.com/ZuHoy.jpg?s=128&g=1'),(16222,1,'2017-02-26T20:02:45.580','Usman Ishtiaq',NULL,'2017-02-27T05:01:12.380',NULL,NULL,NULL,NULL,0,0,0,10339800,'https://lh3.googleusercontent.com/-O5zmbNfZhXc/AAAAAAAAAAI/AAAAAAAAAG8/E4FAz7AXfY0/photo.jpg'),(16223,1,'2017-02-26T20:21:40.293','bgr',NULL,'2017-02-26T21:35:34.940',NULL,NULL,NULL,NULL,0,0,0,458703,'https://www.gravatar.com/avatar/875b72562f5c586a38c282c456ae49b4?s=128&d=identicon&r=PG'),(16224,101,'2017-02-26T23:28:02.333','Alfredo Osorio',NULL,'2017-02-27T00:57:16.620','http://www.sempresariales.com/','Monterrey, Mexico',32,'<p>Living in Monterrey, Mexico.</p>\n\n<p><a href=\"http://www.sempresariales.com/\" rel=\"nofollow\">Soluciones Empresariales Regiomontanas</a></p>\n\n<h1>SOreadytohelp</h1>\n',0,1,0,178757,'https://i.stack.imgur.com/8Trx9.jpg?s=128&g=1'),(16225,1,'2017-02-27T09:18:02.857','naswanziq',NULL,'2017-04-06T08:15:51.310',NULL,NULL,NULL,NULL,0,0,0,10343161,'https://www.gravatar.com/avatar/b660e58464c9c19bb015cd285a4fbf54?s=128&