irst is a tutoring component in which I work with K12 and adult learners in a variety of subject areas.  This allows me to stay connected to real-world education issues and to use my talents as a STEM educator.  The second branch is assessment and evaluation.  Within this thread, I serve as both an internal and external evaluation and assessment expert on a variety of projects ranging from NIH and NSF grants, to assessing impacts of a certain curriculum of student learning.  The third and final branch is data science consulting.  Within this trajectory, I work with scientists, educators, PIs, and institutions of higher education, government, and business to meet their data science needs.  Whether I am cleaning data, running stats in R, or serving in an advisory role, data science concepts and methodologies drive this branch of my business.</p>\n',0,0,0,10362749,'https://i.stack.imgur.com/t22an.jpg?s=128&g=1'),(16260,1,'2017-03-02T03:27:07.110','Rishi Acharya',NULL,'2017-03-02T03:27:07.110',NULL,'India',16,NULL,0,0,0,9555479,'https://lh5.googleusercontent.com/-uPeMhgiatPY/AAAAAAAAAAI/AAAAAAAAB2U/Von1vBSaXdo/photo.jpg?sz=128'),(16261,101,'2017-03-02T07:12:23.740','Vivek Maru',NULL,'2017-03-02T07:12:23.740',NULL,'Jaipur, Rajasthan, India',24,'<p>BY DAY: code in php.</p>\n\n<p>BY NIGHT: sleep well!</p>\n',0,0,0,5628953,'https://i.stack.imgur.com/8IG5B.jpg?s=128&g=1'),(16262,1,'2017-03-02T09:00:42.897','Murat CAN',NULL,'2017-03-02T09:00:42.897',NULL,NULL,NULL,NULL,0,0,0,6567342,'https://lh4.googleusercontent.com/-Y1gh4oaROXk/AAAAAAAAAAI/AAAAAAAAABM/mUJ-nkGQeFY/photo.jpg?sz=128'),(16263,101,'2017-03-02T10:33:52.347','Osman Villi',NULL,'2017-03-20T10:22:08.187',NULL,'Turkey',25,'<ul>\n<li>Neural Network </li>\n<li>Image Processing </li>\n<li>Arduino  </li>\n<li>Software Engineering</li>\n</ul>\n',0,0,0,3052641,'https://graph.facebook.com/1115259043/picture?type=large'),(16264,1,'2017-03-02T11:02:20.297','Alex',NULL,'2017-03-02T11:02:20.297',NULL,NULL,NULL,NULL,0,0,0,973879,'https://i.stack.imgur.com/MAZbd.jpg?s=128&g=1'),(16265,1,'2017-03-02T12:11:45.203','Sanjeev Kumar Goswami',NULL,'2017-03-02T12:11:45.203','http://skgoswami.blogspot.com','New Delhi ,India',29,'<p>I am Technical Architecture and having Seven years experience with different domain like -Ecommerce, E-learning ,Hospital and Hotel management kinds project .</p>\n\n<p>Solving a problem is my first love, and code is just a way to do that!</p>\n',0,0,0,5462660,NULL),(16266,1,'2017-03-02T15:28:30.080','Dami13',NULL,'2017-03-02T15:28:30.080',NULL,'Rzesz w, Polska',NULL,NULL,0,0,0,10370427,'https://www.gravatar.com/avatar/b6379a4cc0554907bdf8479821c0fd29?s=128&d=identicon&r=PG&f=1'),(16267,1,'2017-03-02T16:22:17.117','rapsoulCecil',NULL,'2017-03-02T16:22:17.117',NULL,'Ann Arbor, MI, United States',NULL,NULL,0,0,0,6440507,'https://www.gravatar.com/avatar/9207158041d22d9a42d7bafb3e44b23d?s=128&d=identicon&r=PG&f=1'),(16268,3,'2017-03-02T18:38:33.923','JWAspin',NULL,'2017-04-13T16:56:47.953','http://www.jwaspin.com','Earth',NULL,'<p>Currently, I am looking for a job in the programming world, so when Im not applying for jobs, Im learning by programming this and that. Ive been working on developing my first website, so in the past couple months I have learned HTML, CSS, Javascript, PHP, and SQL. I am also working on my little rover based on the Wild Thumper chassis. I am working out some hardware/wiring issues while getting started on the basic control system. Long term, I hope to make it fully autonomous, but stage one is getting it driving wirelessly and integrating on board collision detection sensors. Beyond that, I am also putting together an algorithms library that I hope to use as an educational tool (on Github).</p>\n',1,0,0,10093686,'https://www.gravatar.com/avatar/34c5a887a3babe4dd1453f6fa9572479?s=128&d=identicon&r=PG&f=1'),(16269,101,'2017-03-02T20:30:59.510','CalvT ',NULL,'2017-08-27T02:17:32.223','http://browsers.wtf','Buenos Aires',21,'\n\n<p><img src=\"https://stackexchange.com/users/flair/1245478.png\"></p>\n\n<p>Want to talk to me? Im most often found in the <a href=\"http://chat.stackexchange.com/rooms/11540/charcoal-hq\">Charcoal HQ</a>.</p>\n\n<p>Why is your post being downvoted? Because of <a href=\"/users/current\">this user</a>.</p>\n\n<p>I do a lot of spam flagging, current stats are <strong>2801 helpful</strong> across the network. <em>3rd of August 2017</em></p>\n\n<p>What does the symbol in my name mean? Apparently it translates to <em>Byus</em>. Here are some more:  </p>\n\n<p>Just because I was last seen a few hours ago, it doesnt mean Im around. There are various AIs using my account, and not just Smokey. Heck I may even be AI. We all might be!</p>\n\n<p>If youre surprised by my badges, thats <a href=\"https://meta.stackexchange.com/questions/296849\">explained here</a>.</p>\n\n<p>I like most things aviation related, but am very much an <em>ignoramus</em> on the subject. I have flown around a bit though:</p>\n\n<p><a href=\"https://my.flightradar24.com/CalvT\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/wGpda.png\" width=\"250\" /></a></p>\n\n<p>The moon is 384,400kms away, and my aim is to cover that distance! Still got quite a way to go though... <em>43% percent complete</em></p>\n\n<p>Editing to test for Secret Hats!</p>\n\n<p>PS: The edit worked ;)</p>\n\n<p><img src=\"https://i.stack.imgur.com/i7o1v.png\" alt=\"\"></p>\n',0,0,0,1245478,'https://i.stack.imgur.com/moGq1.png?s=128&g=1'),(16270,1,'2017-03-02T23:17:27.630','tom aldridge',NULL,'2017-03-08T12:46:00.977',NULL,NULL,NULL,NULL,0,0,0,9966712,'https://www.gravatar.com/avatar/1d1d9a7d4e51fd212bd422b678587b7f?s=128&d=identicon&r=PG'),(16271,1,'2017-03-03T03:08:30.883','Mazen Alotaibi',NULL,'2017-03-03T03:08:30.883','https://www.linkedin.com/in/iamalotaibi','Corvallis, OR, United States',21,NULL,0,0,0,7744135,'https://graph.facebook.com/975909105779461/picture?type=large'),(16272,1,'2017-03-03T06:42:39.033','Darren Gibson',NULL,'2017