NULL,'',1,2,0,10403994,'https://i.stack.imgur.com/ll21H.png'),(16317,1,'2017-03-07T10:22:50.473','Girmi',NULL,'2017-08-18T11:00:25.567',NULL,'Belgium',26,NULL,0,0,0,4185564,'https://www.gravatar.com/avatar/2299258869dfd856d1282650a54af66a?s=128&d=identicon&r=PG&f=1'),(16318,1,'2017-03-07T10:44:22.757','Drews Latenko',NULL,'2017-03-14T08:12:11.067',NULL,NULL,NULL,NULL,0,0,0,10404404,'https://www.gravatar.com/avatar/8995244aec519c2918b7d95ada8bd072?s=128&d=identicon&r=PG&f=1'),(16319,101,'2017-03-07T10:45:33.830','M.A.R.',NULL,'2017-05-12T17:25:22.720',NULL,'Tabriz, Iran',19,'<p>Ill keep a consistent name from now on. (/     )/  ~  </p>\n\n<p>BTW, Im <strong>neither a chemist nor a linguist</strong>. Never hesitate to take my advice with a grain of salt if you felt you should.</p>\n\n<p>Remarkable previous names:  . . ., I , TIPS</p>\n\n<hr>\n\n<h3>List of 2016 names:</h3>\n\n<p>I , PhMgBr, TIPS, DEAD, Rubisco</p>\n\n<hr>\n\n<h3>Interesting stuff:</h3>\n\n<ul>\n<li><a href=\"http://meta.stackexchange.com/a/263858\">Why does Stack Exchange have to feel so unfriendly now?</a></li>\n<li><a href=\"http://meta.chemistry.stackexchange.com/questions/3044/hidden-points-of-editing-you-probably-dont-know\">Hidden points of editing you probably dont know</a> (meta.chem)</li>\n<li>You never know what you can do with Mathjax. <a href=\"http://meta.chemistry.stackexchange.com/q/111/\">Sandbox</a> (meta.chem)</li>\n<li>Surprisingly many dont know that a <a href=\"http://data.stackexchange.com/\" rel=\"nofollow noreferrer\">Stack Exchange data explorer</a> exists. Dont speculate, go find the stats out!</li>\n<li><a href=\"http://meta.ell.stackexchange.com/q/2630/\">How can I write a better title for my question?</a> (meta.ell, but the rationale goes for all types of questions in all fields)</li>\n<li>For those who take downvotes as death threats: <a href=\"http://meta.stackexchange.com/a/33949\">Second</a> and <a href=\"http://meta.stackexchange.com/a/53297\">third</a> most downvoted posts of all time in Stack Exchange are from Jeff Atwood.</li>\n</ul>\n\n<hr>\n\n<h3>Some things:</h3>\n\n<ul>\n<li><a href=\"http://meta.chemistry.stackexchange.com/questions/2940/the-great-retagging-event-episode-1-the-one-taggers\">TRE</a> (meta.chem)</li>\n<li><a href=\"http://meta.ell.stackexchange.com/questions/2632/title-cleanup-event-tce-an-invitation\">TCE</a> (meta.ell)</li>\n<li><a href=\"http://meta.chemistry.stackexchange.com/a/2968/7448\">The tag test</a></li>\n</ul>\n\n<p>Profile pic from <a href=\"https://d3mian.myportfolio.com/breaking-bad-illustrations\" rel=\"nofollow noreferrer\">https://d3mian.myportfolio.com/breaking-bad-illustrations</a>\n</p>\n',0,0,0,3841881,NULL),(16320,101,'2017-03-07T10:55:26.420','Bart',NULL,'2017-03-07T10:55:26.420','http://bart.kevelham.com','Switzerland',NULL,'<p>I am currently a software developer at OZWE Games. </p>\n\n<p>As a researcher and software developer I enjoy working on the R&amp;D of (particularly Unity-based) interactive multimedia solutions for both desktop and mobile platforms, AR and VR, as well as physical simulations.</p>\n\n<p>My Website: <a href=\"http://bart.kevelham.com\" rel=\"nofollow\">http://bart.kevelham.com</a><br>\nOnline Resume: <a href=\"http://bkevelham.github.io\" rel=\"nofollow\">http://bkevelham.github.io</a><br>\nMy LinkedIn Profile: <a href=\"http://ch.linkedin.com/in/bartkevelham\" rel=\"nofollow\">http://ch.linkedin.com/in/bartkevelham</a></p>\n',0,0,0,227164,'https://www.gravatar.com/avatar/91aef7668303115d1faecbc3fb582253?s=128&d=identicon&r=PG'),(16321,86,'2017-03-07T13:30:02.683','Kerry',NULL,'2017-07-20T12:40:22.623','','Philadelphia, PA, United States',NULL,'<p>BY DAY:  Systems engineer with a focus on motion control and dynamics</p>\n\n<p>BY NIGHT:  Mentor to FIRST Team 3167</p>\n\n<p>FOR FUN:  Programming, robotics, making stuff, music and birding</p>\n',0,1,0,3340900,'https://www.gravatar.com/avatar/3ccc002dcb502c2ac15cee8ad75b9903?s=128&d=identicon&r=PG&f=1'),(16322,1,