site Development</a>, <a href=\"http://www.stepin-solutions.com/services-mobile-app-development\" rel=\"nofollow noreferrer\">Mobile App Development</a>, <a href=\"http://www.stepin-solutions.com/services-drupal-development\" rel=\"nofollow noreferrer\">Drupal Development Services</a>, <a href=\"http://www.stepin-solutions.com/services-cms-solutions\" rel=\"nofollow noreferrer\">CMS Solutions</a>, <a href=\"http://www.stepin-solutions.com/services-oscommerce-development\" rel=\"nofollow noreferrer\">eCommerce Website development</a>, <a href=\"http://www.stepin-solutions.com/services-magento-development\" rel=\"nofollow noreferrer\">Magento Web Development</a>, etc. Using Agile project Management we make sure clients website or mobile app delivered successfully.</p>\n',0,0,0,4542719,'https://www.gravatar.com/avatar/4f8aac4715dfe1406f45b1b1069a4fed?s=128&d=identicon&r=PG'),(16501,11,'2017-03-27T12:37:36.407','vu2aeo',NULL,'2017-05-17T04:37:04.933','http://bayesianadventures.wordpress.com','India',NULL,'<p>Ex-submariner, now a school teacher.</p>\n',0,0,0,10537897,'https://i.stack.imgur.com/yHJrA.png?s=128&g=1'),(16502,1,'2017-03-27T12:58:23.713','vismay.vakharia',NULL,'2017-06-09T12:06:46.293',NULL,NULL,21,NULL,0,0,0,9627169,'https://www.gravatar.com/avatar/215125215cfd82a081a3d1436ac05ea3?s=128&d=identicon&r=PG&f=1'),(16503,1,'2017-03-27T13:22:52.200','Gurpreet Singh Kakar',NULL,'2017-03-27T13:22:52.200',NULL,'Hoboken, NJ, United States',NULL,NULL,0,0,0,6888306,'https://graph.facebook.com/1167796783265200/picture?type=large'),(16504,101,'2017-03-27T16:08:08.503','Alexandre Mazel',NULL,'2017-04-28T13:26:50.993','http://mangedisque.com/Alma/CV/CVAM_rd_en.php','Paris France',43,'<p>Like to program graphics, sounds, robots &amp; fun.</p>\n',0,0,0,1085636,'https://www.gravatar.com/avatar/acb7a53fa3588f212cb3a6824c67196b?s=128&d=identicon&r=PG'),(16505,1,'2017-03-27T21:01:40.197','jgvictores',NULL,'2017-05-31T15:39:52.773',NULL,NULL,NULL,NULL,0,0,0,10554941,'https://www.gravatar.com/avatar/c43db844c412ac81469735418072e0db?s=128&d=identicon&r=PG&f=1'),(16506,1,'2017-03-27T21:33:46.223','Richard Brockbank',NULL,'2017-07-15T17:00:10.710','','Bishops Stortford, United Kingdom',40,'<p>Welcome!</p>\n\n<p>Robotics specific profile:</p>\n\n<p>Ive studied 10 credits worth of robotics at university level, being introduced to topics such as driverless vehicles, space robotics, and the theory and practice behind robot design and programming. I bought a 4tronix Pi2Go robot on the recommendation of my tutor and my next task is to learn Python, because the programs supplied failed to compile and/or run.</p>\n\n<p>StackExchange global profile:</p>\n\n<p>Im studying BSc (Hons) Computing &amp; IT at Open University (UK), due to graduate in 2021.  The university pioneered higher education distance learning back in the 1960s and its become one of the most respected universities in the UK, as well as being the largest by far. The courses are delivered online with some face-to-face tutorials or residential schools to complement the online content.</p>\n\n<p>Im looking for work and fun projects in IT   so feel free to tweet me a proposal or suggestion. I have 4 months experience in tech support with mainly Windows systems but   dont be fooled   this limited experience doesnt do justice to my knowledge about computing.</p>\n\n<p>I enjoy music with a particular focus on classical and opera and I can sing and play the piano tolerably well, but not spectacularly by any stretch of the imagination. I read all kinds of fiction and non-fiction, take in interest in visual art and films/movies, play games on my iMac, take photos (mainly landscape), go running for fitness, and I like a good party   house, garden, LAN, or why not all three at once!</p>\n',0,0,0,5334244,'https://lh3.googleusercontent.com/-ao_LDCEkvAI/AAAAAAAAAAI/AAAAAAAAAKU/2Zw1aAAZiPY/photo.jpg?sz=128'),(16507,6,'2017-03-28T00:37:31.620','BAMercury',NULL,'2017-07-01T23:08:32.500',NULL,NULL,NULL,NULL,