5?s=128&d=identicon&r=PG&f=1'),(16853,101,'2017-05-04T07:45:58.287','Thush-Fdo',NULL,'2017-05-04T08:50:55.853',NULL,'Sri Lanka',29,'<p>Developer. Spend most of the time for developing and learning. Well versed in Java. Learning Ruby on Rails, Python, Android and Cordova.</p>\n',0,0,0,7726317,'https://i.stack.imgur.com/S5r1S.jpg'),(16854,1,'2017-05-04T09:32:09.227','Yassine Yassine',NULL,'2017-05-06T14:05:45.687',NULL,NULL,NULL,NULL,0,0,0,10799596,'https://graph.facebook.com/1948091595420886/picture?type=large'),(16855,108,'2017-05-04T10:04:08.533','tampe125',NULL,'2017-05-11T08:30:25.710',NULL,'Montecatini Terme, Italy',NULL,NULL,0,1,0,225007,'https://www.gravatar.com/avatar/b8ab15aaf86df76e18c4068e447dbf01?s=128&d=identicon&r=PG'),(16856,3,'2017-05-04T11:34:05.983','Octavarium',NULL,'2017-05-10T15:01:28.537',NULL,'Europa',36,'<p>I am an amateur electric guitar player. I am mostly interested in composing and improvising. I want to better music and to improve home recording. I hope I might call myself a \"real\" musician someday. I love piano and cello too and I am musically eclectic.</p>\n',0,0,0,8112534,'https://www.gravatar.com/avatar/3158556974fe937b24edefded54b11db?s=128&d=identicon&r=PG&f=1'),(16857,1,'2017-05-04T15:38:18.667','trait vinoth',NULL,'2017-05-05T06:03:13.770',NULL,NULL,NULL,NULL,0,0,0,10829200,'https://www.gravatar.com/avatar/e132f9d1b960efb2f05218438d0cf80b?s=128&d=identicon&r=PG&f=1'),(16858,101,'2017-05-04T16:04:12.110','Archibald',NULL,'2017-05-04T16:04:12.110',NULL,'Poland',31,NULL,0,0,0,389300,'https://www.gravatar.com/avatar/398f3c3a9750fc13e1036751b4a2bd8b?s=128&d=identicon&r=PG'),(16859,108,'2017-05-04T17:36:15.343','Troels Larsen',NULL,'2017-08-14T10:52:12.460',NULL,'Denmark',36,'<p>By day, I fix NotImplementedExceptions, mostly in C#, but also in Javascript, Python or whatever comes my way.</p>\n\n<p>By night, I dabble in building a home automation system using various bits and pieces like Arduino, ESP8266, Raspberry Pi. Im having fun wi