SS3, HTML5, PhoneGap</p>\n',0,1,0,134364,'https://www.gravatar.com/avatar/756925a85b0bfd97b9f7007e1809eb3b?s=128&d=identicon&r=PG'),(17203,1,'2017-06-06T18:15:58.817','tdnvl',NULL,'2017-08-23T11:43:04.027','http://www.thomasdeneuville.com','Ithaca, NY',40,'<p>Work in progress.</p>\n',0,0,0,3457963,'https://www.gravatar.com/avatar/edbc57ddea1536b95b9461820b025eed?s=128&d=identicon&r=PG'),(17204,101,'2017-06-06T19:29:20.890','Poorna',NULL,'2017-06-10T21:10:59.727',NULL,'Ulm, Germany',NULL,NULL,0,0,0,5072,'https://www.gravatar.com/avatar/3448218a52de9d5adf5a8810e4c990b9?s=128&d=identicon&r=PG&f=1'),(17205,38,'2017-06-07T02:35:42.273','Aniket Sharma',NULL,'2017-07-30T13:06:27.680','http://codedating.blogspot.in/','Surat, Gujarat, India',NULL,'<p>Undergraduate Electrical engineer at SVNIT, Surat and a maker at Drishti - technical club of the college. I know things about control systems, embedded systems and  microcontrollers. Familiar with C, MATLAB, C++ and Python. Other than that, huge anime fan!</p>\n',0,1,0,6348626,'https://lh4.googleusercontent.com/-P5C99YQh6PM/AAAAAAAAAAI/AAAAAAAAGJA/l8Wz5B8tnvs/photo.jpg?sz=128'),(17206,1,'2017-06-07T09:15:43.033','Alejandro Lorenzo',NULL,'2017-08-03T12:19:52.743',NULL,NULL,NULL,NULL,0,0,0,11064286,'https://www.gravatar.com/avatar/11f86a251b840ac3277e402243813721?s=128&d=identicon&r=PG&f=1'),(17207,1,'2017-06-07T09:47:22.687','Exodus5656',NULL,'2017-06-08T20:00:52.910',NULL,NULL,NULL,NULL,0,0,0,6656573,'https://www.gravatar.com/avatar/bff29c58c1426a9e654e4acab26b0774?s=128&d=identicon&r=PG&f=1'),(17208,1,'2017-06-07T10:42:41.227','emanuilov',NULL,'2017-08-12T10:55:39.223','https://techr.eu','Bulgaria',18,NULL,0,0,0,4862356,'https://www.gravatar.com/avatar/2f41b48a539fd59e65fea9880c88b453?s=128&d=identicon&r=PG&f=1'),(17209,1,'2017-06-07T11:28:38.433','Igor Gallon',NULL,'2017-06-07T11:28:38.433',NULL,'S o Jos  dos Campos - State of S o Paulo, Brazil',23,'<p>Computer Engineer student.</p>\n\n<p>Learning all the time!</p>\n',0,0,0,8062200,'https://graph.facebook.com/974295519313119/picture?type=large'),(17210,16,'2017-06-07T13:31:48.553','soheil',NULL,'2017-08-21T07:57:50.290',NULL,NULL,NULL,NULL,0,0,0,11066195,'https://www.gravatar.com/avatar/e2b394f2676c397edd2c9e47a2fcb3ae?s=128&d=identicon&r=PG&f=1'),(17211,1,'2017-06-07T16:45:40.630','Legend  Mai Gaming',NULL,'2017-06-07T16:45:40.630',NULL,NULL,NULL,NULL,0,0,0,10861246,'https://lh4.googleusercontent.com/-SaiaMvnykzk/AAAAAAAAAAI/AAAAAAAAAPw/RiwC-UfuYB4/photo.jpg?sz=128'),(17212,1,'2017-06-07T17:41:12.447','Hai Tran',NULL,'2017-06-07T17:41:12.447',NULL,'Seattle',NULL,NULL,0,0,0,3369470,'https://www.gravatar.com/avatar/5f70ce97f02e5c3c4802dcf2ddd4fb61?s=128&d=identicon&r=PG&f=1'),(17213,101,'2017-06-07T20:54:21.900','user50222',NULL,'2017-06-07T21:48:21.700',NULL,NULL,NULL,NULL,0,2,0,2067178,'https://www.gravatar.com/avatar/908feb0fd5f8821ebd73c5a053ffd4a4?s=128&d=identicon&r=PG'),(17214,1,'2017-06-07T21:35:06.313','zergb',NULL,'2017-06-30T16:15:19.887',NULL,'Toronto, Canada',NULL,NULL,0,0,0,3550749,'https://www.gravatar.com/avatar/5198266b9fc810c16c6c66dbc2a0927d?s=128&d=identicon&r=PG&f=1'),(17215,101,'2017-06-08T02:16:59.210','Jenna Sloan',NULL,'2017-06-08T02:16:59.210','http://www.sloan4.com','West Fargo, ND, United States',NULL,'<p>I am a software engineering student at Valley City State University. I took computer science and AP computer science in high school.</p>\n',0,0,0,9461593,'https://lh4.googleusercontent.com/-nL0cN4c3sY4/AAAAAAAAAAI/AAAAAAAAACM/zdZW0RFyMFM/photo.jpg?sz=128'),(17216,1,'2017-06-08T04:58:07.823','Hobadee',NULL,'2017-06-08T04:58:07.823','http://eric.kincl.net',NULL,32,NULL,0,0,0,1219432,'https://www.gravatar.com/avatar/efc01093f85cff3c99fe2051633e7978?s=128&d=identicon&r=PG'),(17217,1,'2017-06-08T06:22:55.860','Nishan Samarasinghe',NULL,'2017-06-08T06:22:55.860',NULL,NULL,NULL,NULL,0,0,0,11071616,'https://lh5.googleusercontent.com/-KRuXoKTMbnc/AAAAAAAAAAI/AAAAAAAABV4/fOBkf9soyoo/photo.jpg'),(17218,1,'2017-06-08T07:55:40.347','Radex  Ical Cradox',NULL,'2017-07-26T12:58:11.453',NULL,NULL,NULL,'<h2><em>Engineer by profession, Scientist in Heart (I mean the spirit, indeed), Mathematician at Conscience;</em></h2>\n\n<blockquote>\n  <p>{Probably exaggerating! But thats how I see myself. Nothing more, nothing less.} </p>\n</blockquote>\n\n<hr>\n\n<blockquote>\n  <p>\"People Live their Lives bound by what they accept as correct and\n  true. That is how they define Reality. But what does it mean to be\n  correct or true? They are merely vague concepts... Their Reality\n  may all be a mirage. Can we consider them to be simply living in their\n  own world, shaped by their beliefs?\"</p>\n  \n  <p>-<strong>Itachi Uchiha</strong> [fictional character.]</p>\n  \n  <p><a href=\"http://animequote.wikia.com/wiki/Itachi_Uchiha\" rel=\"nofollow noreferrer\" title=\"For more quotes by the same.\">For more quotes by the same.</a></p>\n</blockquote>\n\n<p>I specialize in Robotics Automation, Machine Vision and [UAV] flight vehicle dynamics.</p>\n\n<p>In pure love with Applied Mathematics and Computational Science.</p>\n\n<p>I love pretty much anything to do with machines, be it a MotoX two stroke thumper or the Rotor dynamics of a Tandem Helicopter.</p>\n\n<p><em>Unfortunately, I code like a pro.(You know what I mean. I like my codebase messed-up but apparently, my work ethics &amp; habits wont let my repository reflect the same.)</em></p>\n\n<p>Contributing member of Linux kernel mailing list (LKML) and maintains a fork of some odd legacy drivers &amp; ATA/ AHCI security extensions that nobody uses these days.</p>\n\n<p>Sometimes I get torn between Philosophical thoughts and Scientific explanation, but always settled down for the later.</p>\n\n<hr>\n\n<p><em>My religious views are so convoluted that I happen to worship only Mathematicians, Scientists and their works.</em></p>\n\n<p><strong>Daily Routines:</strong> <em>Study, Sleep, Eat, Ride and get back to my Univ. laboratory.</em></p>\n\n<blockquote>\n  <p><strong><em>Had been lurking here on SE since my underGrad. But lately getting addicted to SE communities, that Im planning on sparing some time in contributing as well.</em></strong></p>\n</blockquote>\n',0,0,0,9958148,'https://lh4.googleusercontent.com/-k_hX-0uVwOg/AAAAAAAAAAI/AAAAAAAAABA/_whxP_tSM6k/photo.jpg?sz=128'),(17219,101,'2017-06-08T08:23:15.137','Ghilas BELHADJ',NULL,'2017-06-08T08:23:15.137',NULL,'Tizi Ouzou, Algeria',24,'<p>Data Scientist</p>\n',0,0,0,1681830,'https://i.stack.imgur.com/o9dcW.png?s=128&g=1'),(17220,1,'2017-06-08T13:16:24.053','hasgtomn',NULL,'2017-06-08T13:16:24.053',NULL,NULL,NULL,NULL,0,0,0,10447853,'https://www.gravatar.com/avatar/ccf15c0f60a57549c7e281c35cd9de52?s=128&d=identicon&r=PG&f=1'),(17221,111,'2017-06-08T13:27:31.460','winston',NULL,'2017-06-20T02:46:54.267',NULL,NULL,NULL,NULL,0,0,0,7066288,'https://www.gravatar.com/avatar/dd63e82501fb44908738d0e446ac249f?s=128&d=identicon&r=PG&f=1'),(17222,1,'2017-06-08T17:53:17.253','tien',NULL,'2017-06-08T17:53:17.253',NULL,NULL,NULL,NULL,0,0,0,11076419,'https://www.gravatar.com/avatar/97c161f5750aab127d898b1e04f93eb3?s=128&d=identicon&r=PG&f=1'),(17223,1,'2017-06-08T20:52:45.263','Uranusly',NULL,'2017-06-19T20:01:06.967',NULL,'Belfort, France',NULL,'<p>Ph.D Candidate in University of Technology Belfort Montbeliard</p>\n',0,0,0,247027,'https://i.stack.imgur.com/C7b7c.jpg?s=128&g=1'),(17224,1,'2017-06-08T21:15:30.097','Embedded Music',NULL,'2017-07-09T00:17:38.183',NULL,NULL,NULL,NULL,0,0,0,2601150,'https://www.gravatar.com/avatar/04a94a1449d46e8408875608043cdf05?s=128&d=identicon&r=PG&f=1'),(17225,1,'2017-06-08T23:59:29.923','Joseph P',NULL,'2017-06-08T23:59:29.923',NULL,NULL,NULL,NULL,0,0,0,8623900,'https://lh4.googleusercontent.com/-W5NHaR7zsCQ/AAAAAAAAAAI/AAAAAAAAAq0/9D0Ods4TTBs/photo.jpg?sz=128'),(17226,1,'2017-06-09T18:42:00.420','user151637',NULL,'2017-06-09T18:42:00.420',NULL,NULL,NULL,NULL,0,0,0,11084589,'https://www.gravatar.com/avatar/a08f9ccc8a915aeb6b5981079e7ba1