-06-13T11:44:38.143',NULL,NULL,NULL,NULL,0,0,0,11100582,'https://www.gravatar.com/avatar/a28ee68136c3400d330c0dd32c1b82bd?s=128&d=identicon&r=PG&f=1'),(17246,1,'2017-06-12T15:44:56.227','JoshThunar',NULL,'2017-06-13T13:58:02.110',NULL,NULL,NULL,'<p>.</p>\n',0,0,0,10099459,'https://www.gravatar.com/avatar/23b9008a922abba541591d89015423f8?s=128&d=identicon&r=PG&f=1'),(17247,8,'2017-06-12T18:26:02.243','ATeisseire',NULL,'2017-07-06T22:47:07.823',NULL,NULL,NULL,NULL,0,0,0,11102336,'https://www.gravatar.com/avatar/e734a595aacf6dd0c78785cd7c5c13ad?s=128&d=identicon&r=PG&f=1'),(17248,1,'2017-06-13T06:41:49.883','Oguz',NULL,'2017-06-13T06:41:49.883',NULL,NULL,NULL,NULL,0,0,0,7173254,'https://www.gravatar.com/avatar/46dc4a5929c86e357f7d5a629f6d8ce0?s=128&d=identicon&r=PG&f=1'),(17249,1,'2017-06-13T15:35:38.100','alandooz',NULL,'2017-06-13T15:35:38.100',NULL,NULL,NULL,NULL,0,0,0,11109105,'https://www.gravatar.com/avatar/70bf56aca8324303fd2a176e9dd7b801?s=128&d=identicon&r=PG&f=1'),(17250,106,'2017-06-13T15:47:43.783','mkamioner',NULL,'2017-08-02T10:18:37.973',NULL,NULL,NULL,NULL,0,1,0,170504,'https://www.gravatar.com/avatar/fa7b86db8cc98fd13a7d77400445362e?s=128&d=identicon&r=PG'),(17251,1,'2017-06-13T20:05:12.087','Victor Tango',NULL,'2017-06-13T20:05:12.087',NULL,NULL,NULL,NULL,0,0,0,11110999,'https://lh6.googleusercontent.com/-dga6IQhtwHs/AAAAAAAAAAI/AAAAAAAAAGk/Bd_jJJZh9AI/photo.jpg?sz=128'),(17252,62,'2017-06-13T21:21:46.543','Daniel M rtensson',NULL,'2017-08-15T11:36:44.097',NULL,NULL,NULL,NULL,1,5,0,991116,'https://www.gravatar.com/avatar/6ccd4b1f51d2727927ac4f091cb71009?s=128&d=identicon&r=PG'),(17253,1,'2017-06-14T03:24:25.277','vamsichivukula',NULL,'2017-06-14T03:24:25.277','http://www.linkedin.com/in/vamsichivukula',NULL,NULL,'<p>As a Research Assistant in the Man-Machine Systems Lab., I attempt to determine the immersiveness of visual displays and effectiveness of Man-Machine Interaction in Virtual Reality systems. In order to do so, it is necessary to define objective metrics that define the perception of ego-motion in humans for which, I did the following:</p>\n\n<p>  Develop and calibrate the eye-tracking sensor that tracks eye movements of the subjects in real-time when they drive the simulator\n  Use computer vision (OpenCV Library) to track head movement of subjects in real-time\n  Analyze the data that is generated by the sensors</p>\n\n<p>The sensors employ various filters (LPF, MAF) to improve the signal to noise ratio. The eye-tracking sensor is capable of sensing minute artefacts like blinks and saccades (eye movements that reach up to 400 to 600 degrees/sec).</p>\n\n<p>Based on the control behavior and involuntary physiological response of the subject in the simulator a predictive model is developed using parameter identification using the ARX algorithm. The vehicle dynamics are modeled as a hardware-in-the-loop (HIL) simulation and the overall system is modeled as a human-in-the-loop (HITL) feedback control loop.</p>\n\n<p>My research required me to develop skills beyond control systems like instrumentation, embedded systems, data acquisition, signal processing, and data analytics to build the sensors, acquiring and cleaning the data from the data acquisition system (DAQ). I use data analytics to identify and remove the trends in data, correlate using regression analysis. I use MATLAB, LabVIEW, and C/C++ extensively in my research.</p>\n\n<p>I am the principal author of a conference paper that reported my research on the design of VR systems and was presented in AIAA Modeling and Simulation Technologies conference in June 2016. I also co-authored a conference paper that was presented in Dayton, Ohio in July 2015.</p>\n',0,0,0,6517573,'https://www.gravatar.com/avatar/455e44dc7897464ca67dc28accaff8b0?s=128&d=identicon&r=PG&f=1'),(17254,101,'2017-06-14T07:26:04.723','NoWiS',NULL,'2017-08-04T10:11:25.190',NULL,NULL,NULL,NULL,0,0,0,3165006,'https://www.gravatar.com/avatar/849e65df24e402b9a2f7c3655326b42b?s=128&d=identicon&r=PG'),(17255,1,'2017-06-14T08:39:28.580','vikrant saxena',NULL,'2017-06-14T08:39:28.580',NULL,'India',NULL,NULL,0,0,0,10608852,'https://www.gravatar.com/avatar/5dcd517d1f5ab4d63194f4e2228b6133?s=128&d=identicon&r=PG&f=1'),(17256,1,'2017-06-14T10:24:38.637','Guzman de LHotellerie',NULL,'2017-06-14T15:44:29.813',NULL,NULL,NULL,NULL,0,0,0,11115354,NULL),(17257,1,'2017-06-14T13:20:35.890','ajay',NULL,'2017-06-14T14:38:56.897',NULL,NULL,NULL,NULL,1,0,0,11116557,NULL),(17258,101,'2017-06-15T03:00:51.217','Miles Alden',NULL,'2017-06-15T03:00:51.217','http://www.milesalden.com','Bay Area, CA',NULL,NULL,0,0,0,690984,'https://i.stack.imgur.com/TixPe.jpg'),(17259,1,'2017-06-15T04:02:20.873','brelstad',NULL,'2017-06-20T13:16:22.807',NULL,NULL,NULL,NULL,0,0,0,1297302,'https://www.gravatar.com/avatar/ffc6b0faef16a8c53d972e334fcf4b17?s=128&d=identicon&r=PG'),(17260,1,'2017-06-15T04:29:46.363','con-man',NULL,'2017-06-15T04:29:46.363',NULL,NULL,NULL,NULL,0,0,0,4631749,'https://www.gravatar.com/avatar/457c8d27d22c974cd068abc0874114dc?s=128&d=identicon&r=PG&f=1'),(17261,101,'2017-06-15T04:54:28.263','Azat',NULL,'2017-06-15T04:54:28.263',NULL,'Los Angeles, CA, United States',31,NULL,0,0,0,63881,'https://i.stack.imgur.com/esBfR.png?s=128&g=1'),(17262,1,'2017-06-15T06:32:24.933','Huy Nguyen',NULL,'2017-07-26T04:22:33.393','',NULL,NULL,'',0,0,0,3405762,'https://www.gravatar.com/avatar/970c36e54223153393a65bf04db6bede?s=128&d=identicon&r=PG&f=1'),(17263,1,'2017-06-15T07:01:57.450','henry',NULL,'2017-07-16T22:39:00.473',NULL,NULL,NULL,NULL,0,0,0,11121966,'https://lh4.googleusercontent.com/-hycrExegrMc/AAAAAAAAAAI/AAAAAAAAABY/D3nGJx_oWm0/photo.jpg'),(17264,1,'2017-06-15T08:43:06.660','Vi Kas',NULL,'2017-06-17T09:14:07.013',NULL,NULL,NULL,NULL,0,0,0,7334398,'https://www.gravatar.com/avatar/a0855ed5d7faadb846a54f83604d7dc5?s=128&d=identicon&r=PG&f=1'),(17265,101,'2017-06-15T09:51:27.303','sob',NULL,'2017-06-17T13:50:31.400',NULL,NULL,NULL,'<p>Developer by the day, have exposure on Modem