35:12.360',NULL,NULL,NULL,NULL,0,0,0,11165338,'https://www.gravatar.com/avatar/b8e27db08ff19c1484a3368d44342f1e?s=128&d=identicon&r=PG&f=1'),(17325,101,'2017-06-21T15:39:56.297','fearless_fool',NULL,'2017-06-26T12:39:58.403','https://www.linkedin.com/in/robertpoor','California',NULL,'<p>Embedded Processor Wizard, well seasoned and steeped in the MIT Media Lab culture of building cool things.</p>\n\n<p>For the last several decades, Ive thrived on cramming lots of functionality into tiny processors.  One of my specialities is exploiting the properties of single chip devices (e.g. GPIO ports, PWM timers, etc) to create robust designs with minimal parts count.</p>\n\n<hr>\n\n<p>My first startup, Ember Corporation (bought by Silicon Labs) ushered in the Internet of Things by releasing the first microcontrollers with embedded wireless mesh networking.  Long before Ember, I made 6502, Z80 and PIC processors jump through hoops to control laser printers, environmental sensors, audio devices, lighting systems and electronic whoopee cushions.</p>\n\n<p>More recently, Ive been working with RPi, various Arduino (including Intel Arduino 101), Freescale/NXP KL2xx, and I look forward creating new things on the ESP32, GR8, AM335x and/or nRF52 family of processors.</p>\n\n<p>My work doesnt stop at the microcontroller level: I use C, C++, Python, Javascript/Node, Ruby and other languages to connect the microcontrollers into cloud-based applications.</p>\n',0,0,0,269349,'https://www.gravatar.com/avatar/3f4a1073df397d894cf3ae596988b687?s=128&d=identicon&r=PG'),(17326,1,'2017-06-21T15:41:05.557','Brendan Thorpe',NULL,'2017-06-21T15:41:05.557',NULL,NULL,NULL,NULL,0,0,0,11166840,'https://lh5.googleusercontent.com/-LVPayfqXUzY/AAAAAAAAAAI/AAAAAAAABcE/1NPxHbqX2CU/photo.jpg?sz=128'),(17327,1,'2017-06-21T15:43:13.130','Ahmed M.Zahran',NULL,'2017-07-31T09:17:40.953',NULL,'Alexandria Governorate, Egypt',NULL,NULL,0,0,0,10273575,'https://i.stack.imgur.com/pgAHv.jpg?s=128&g=1'),(17328,1,'2017-06-2