OOST::BGL and QT.\nI am also very interested in the new C++11 standards, and parallel programming with CUDA. But I never had to test these technologies for the moment.</p>\n\n<p>I also have good skill in linux system administration.</p>\n',0,0,0,1220390,'https://www.gravatar.com/avatar/6c6b52fb03d3429a66270984e2affbbf?s=128&d=identicon&r=PG'),(17337,1,'2017-06-22T10:11:06.763','astrea',NULL,'2017-06-22T10:11:06.763',NULL,NULL,NULL,NULL,0,0,0,11172396,'https://www.gravatar.com/avatar/98ab4034805557f9fc1810dddcb1090b?s=128&d=identicon&r=PG&f=1'),(17338,1,'2017-06-22T10:35:21.443','gg99',NULL,'2017-06-22T10:35:21.443',NULL,NULL,NULL,NULL,0,0,0,5327810,'https://www.gravatar.com/avatar/2e8dff9e8aa9f72a508991979b759728?s=128&d=identicon&r=PG&f=1'),(17339,1,'2017-06-22T12:43:06.947','t l maque',NULL,'2017-06-22T12:43:06.947',NULL,'United States',47,'<p>I extract information from images and video using image processing techniques &amp; machine learning. I suppose this could be done without Python on a Linux system, but I wouldnt want to do it.</p>\n',0,0,0,6332081,'https://www.gravatar.com/avatar/38ee6eec6edbdc339571308df35f4c6f?s=128&d=identicon&r=PG&f=1'),(17340,1,'2017-06-22T12:55:14.080','Mike',NULL,'2017-07-25T08:53:27.797',NULL,'Spain',18,'<p>Im just a typical robot entuthiast. I like to work with Arduino and Raspberry Pi. Im planning on studying robotic engineering.</p>\n',0,0,0,9435761,'https://www.gravatar.com/avatar/73305194c815a08f3370a5375e2a7c81?s=128&d=identicon&r=PG&f=1'),(17341,1,'2017-06-22T13:43:53.423','haniyeh alighanbari',NULL,'2017-06-22T13:43:53.423',NULL,NULL,NULL,'<p>[we(shia muslim) are ((((((((((((((((not)))))))))))))))))))))) \n((((((((((((((((terrorist))))))))))))))))\nHaniyeh alighanbari(born:islamic republic of iran)==>22july2017]</p>\n',0,0,0,11169670,'https://i.stack.imgur.com/fDCNV.jpg'),(17342,1,'2017-06-22T17:09:03.567','sawreals',NULL,'2017-06-23T14:54:39.643',NULL,'Calgary, AB, Canada',22,'<p>I like Unix.</p>\n',0,0,0,8163928,'https://i