ing My Paper Programming So I Can Work On My New Home.</p>\n\n<p>For Fun: I Would Sit Down And Have Family Time With My Siblings. . .</p>\n\n<p>i Would Like To Discover New Things So My Family Can Live Well ....................</p>\n',0,0,0,11179883,'https://www.gravatar.com/avatar/39ee03ba649bbab951ff8c06c6cf050e?s=128&d=identicon&r=PG&f=1'),(17352,1,'2017-06-24T07:38:18.210','PSing',NULL,'2017-06-24T07:38:18.210',NULL,NULL,NULL,NULL,0,0,0,8802069,'https://www.gravatar.com/avatar/85b1c9cda6e63ffc3ddb7b9e3230906a?s=128&d=identicon&r=PG&f=1'),(17353,1,'2017-06-24T12:06:31.237','daogilvie',NULL,'2017-06-24T12:06:31.237',NULL,NULL,NULL,NULL,0,0,0,9725652,'https://lh3.googleusercontent.com/-tLJ1QTFCKxU/AAAAAAAAAAI/AAAAAAAAACI/rCJKM_ux2h8/photo.jpg?sz=128'),(17354,101,'2017-06-24T14:21:57.083','Entrepreneur',NULL,'2017-08-16T16:37:46.963',NULL,NULL,NULL,NULL,0,0,0,10837024,'https://www.gravatar.com/avatar/6854d7acc4e2817551be9d46418da167?s=128&d=identicon&r=PG&f=1'),(17355,1,'2017-06-24T15:58:18.547','morzack',NULL,'2017-06-24T15:58:18.547',NULL,'North Carolina, United States',NULL,'<p>\"The best preparation for tomorrow is doing your best today.\"</p>\n\n<p>-H Jackson Brown, Jr.</p>\n',0,0,0,8225316,'https://i.stack.imgur.com/jwlhQ.jpg?s=128&g=1'),(17356,1,'2017-06-24T16:29:15.813','Rajat Rao',NULL,'2017-06-24T16:29:15.813',NULL,'Mumbai, Maharashtra, India',22,'<p>Interested in Competitive Programming , Developing Web and Mobile apps and Security,Learning new things.</p>\n',0,0,0,11188009,'https://www.gravatar.com/avatar/20296035b8e1c975dad4f51fba23913f?s=128&d=identicon&r=PG&f=1'),(17357,1,'2017-06-24T23:28:51.633','Chris Dyno',NULL,'2017-06-24T23:45:10.037',NULL,NULL,NULL,NULL,0,0,0,11189530,'https://graph.facebook.com/1381691565258307/picture?type=large'),(17358,1,'2017-06-24T23:51:38.787','Niomie Sterling Watt',NULL,'2017-06-24T23:51:38.787',NULL,NULL,NULL,NULL,0,0,0,11184690,'https://www.gravatar.com/avatar/eaf14bfdc842810112ab6712d190a95a?s=128&d=identicon&r=PG&f=