States',17,NULL,0,0,0,7534538,'https://www.gravatar.com/avatar/7dbec251b913bca9ccc09bc3aee3fccf?s=128&d=identicon&r=PG&f=1'),(17368,1,'2017-06-26T04:52:19.890','Nithin Shrivatsav',NULL,'2017-06-26T04:52:19.890',NULL,NULL,NULL,NULL,0,0,0,11195010,'https://www.gravatar.com/avatar/b99f4bc063392153c6ffa087f181c9cb?s=128&d=identicon&r=PG&f=1'),(17369,1,'2017-06-26T05:48:10.743','Lilibete',NULL,'2017-06-26T07:22:50.487',NULL,'Seattle, WA',38,'<p>BY DAY: I navigate the sea of requirements and safety hazards between the gargantuan regulators and evil genius test engineers. I can untangle instrumentation channels as well as federal, state and local electrical regulations better than anybody. And these days, I watch out for the risk. In all seriousness, I manage a growing electrical safety and regulatory compliance program in a division of lab testing.</p>\n\n<p>BY NIGHT: Part ring-master, part short-order cook for three superheroes... aka MOMMY!!</p>\n\n<p>FOR FUN: I power-up at strategic locations near and far, acquire supplies, uptake caffeine, and capture and sustain knowledge. Ill let you deduce this one.</p>\n',0,0,0,7617860,'https://www.gravatar.com/avatar/7bbac6208e6c5cd7ac13d4bad781c490?s=128&d=identicon&r=PG&f=1'),(17370,101,'2017-06-26T08:31:34.600','Gypsy Spellweaver',NULL,'2017-06-26T08:31:34.600','https://nationalzoo.si.edu/animals/news/6807','Kentucky, United States',55,'<p>Ancient computer nerd who likes digging and learning. Cut my teeth on UNIVAC-timeshare and was hooked for life. Useful results, if any, are secondary to the fun.</p>\n\n<p>Ancient (relatively) system as well (AMD FX62 @ 5.6GHz). Soon hope to replace it with a new build (never bought one) - as funds, and wife, allow.</p>\n\n<p>First home computer: 1984 home-built IBM-PC/XT 8086, 640KB RAM, MS-DOS 1.25, Dual 5-  Floppy, 20MB HDD, Hercules Graphics.</p>\n\n<p>First programming contract: 1986, Borland Turbo Pascal, Cotton gin product tracking (seed to graded bale)</p>\n\n<p>Current main OS: Leap 42.2</p>\n\n<p>Favorite Languages: Pascal, HTML/CSS/JS, Fortran, Perl, Shell script(Bash mostly), PHP</p>\n\n<p>Favorite Hobbies: Learning, Computers, Reading</p>\n\n<p>Fan of <a href=\"https://twitter.com/@RustyThePanda\" rel=\"nofollow noreferrer\">Rusty</a></p>\n',0,0,0,9933161,'https://i.stack.imgur.com/xWmPd.jpg?s=128&g=1'),(17371,1,'2017-06-26T13:22:57.627','user3059976',NULL,'2017-06-26T13:22:57.627',NULL,NULL,NULL,NULL,0,0,0,3673354,'https://www.gravatar.com/avatar/fd526ddc1b87683de4a4628597f3be99?s=128&d=identicon&r=PG&f=1'),(17372,66,'2017-06-26T16:06:12.043','Cyberdine',NULL,'2017-07-22T09:37:50.117','',NULL,NULL,'<p>Mechatronic and control system engineer</p>\n',0,0,0,3677789,'https://i.stack.imgur.com/cAxTM.gif?s=128&g=1'),(17373,13,'2017-06-26T20:43:16.267','JustAGuy',NULL,'2017-08-04T22:08:50.677',NULL,'Hessen, Germany',NULL,'<p>Im just a student interested in physics, programming and artificial intelligence/machine learning.</p>\n\n<p>Im actually not very good at programming and often dont finish projects, but when I do they at least work out.</p>\n',1,0,0,9993000,'https://i.stack.imgur.com/swvJ8.jpg?s=128&g=1'),(17374,16,'2017-06-26T23:50:21.107','M Russell',NULL,'2017-06-28T17:36:10.853',NULL,NULL,NULL,'<p>I want to learn everything and be able to build anything</p>\n',0,0,0,10444475,'https://www.gravatar.com/avatar/1ef0c47cb367229ad4256a173abd0c15?s=128&d=identicon&r=PG&f=1'),(17375,1,'2017-06-27T04:19:03.003','Ilyas Alo',NULL,'2017-06-27T04:19:03.003',NULL,NULL,NULL,NULL,0,0,0,6683585,'https://www.gravatar.com/avatar/b0ea1132edd3697687e9517108d51b32?s=128&d=identicon&r=PG&f=1'),(17376,101,'2017-06-27T07:03:10.960','Amorpheuses',NULL,'2017-07-05T18:14:55.107',NULL,NULL,NULL,NULL,0,1,0,7920346,'https://www.gravatar.com/avatar/688353da6deb0ac1d22eb9d42e032269?s=128&d=identicon&r=PG'),(17377,1,'2017-06-27T07:56:39.030','Sayan Seth',NULL,'2017-06-27T07:56:39.030',NULL,'Kolkata, West Bengal, India',21,NULL,0,0,0,9911333,'https://i.stack.imgur.com/k5Dj