s competing in national Lindy Hop competitions with his wife and dance partner, Gemma.</p>\n',0,0,0,10980027,'https://i.stack.imgur.com/9uNzq.jpg?s=128&g=1'),(17402,101,'2017-06-29T21:57:32.760','Scott Lawson',NULL,'2017-08-16T22:50:20.757',NULL,NULL,NULL,NULL,0,0,0,2495881,'https://i.stack.imgur.com/dgT5B.jpg?s=128&g=1'),(17403,31,'2017-06-29T22:13:13.057','Abdull',NULL,'2017-08-21T11:58:17.553',NULL,NULL,NULL,NULL,0,0,0,11224092,'https://www.gravatar.com/avatar/03dbf051dbdf32b33afb4dd93fe90543?s=128&d=identicon&r=PG&f=1'),(17404,101,'2017-06-30T05:51:33.020','stormist',NULL,'2017-06-30T05:51:33.020',NULL,NULL,NULL,NULL,0,0,0,44062,'https://www.gravatar.com/avatar/be248ab8fe8ab0678b09c9803633712b?s=128&d=identicon&r=PG'),(17405,1,'2017-06-30T06:47:28.457','Pravin Work',NULL,'2017-06-30T06:47:28.457',NULL,'Nagpur, Maharashtra, India',25,'<p>Ninja Developer at Night.\nBy day calm developer</p>\n',0,0,0,11014881,'https://www.gravatar.com/avatar/9296a13cf94cdc13f8de6a70bdc95d8b?s=128&d=identicon&r=PG&f=1'),(17406,11,'2017-06-30T08:52:01.167','hackkato',NULL,'2017-07-05T08:35:42.630',NULL,NULL,NULL,NULL,0,0,0,5378669,'https://www.gravatar.com/avatar/604f28c275d13ec7fb763d6449a1f944?s=128&d=identicon&r=PG&f=1'),(17407,1,'2017-06-30T18:05:39.973','wisemonkeys',NULL,'2017-06-30T18:05:39.973',NULL,NULL,NULL,NULL,0,0,0,6213219,'https://lh6.googleusercontent.com/-5pf29L_hfy4/AAAAAAAAAAI/AAAAAAAAABg/uIHE-9mgKGE/photo.jpg?sz=128'),(17408,1,'2017-06-30T19:26:10.323','Rafael Marinho',NULL,'2017-06-30T19:49:02.033',NULL,NULL,NULL,NULL,0,0,0,9529666,'https://www.gravatar.com/avatar/9bd0cb4731fde749347dfd9750a7af47?s=128&d=identicon&r=PG&f=1'),(17409,6,'2017-06-30T21:37:28.470','Patrick Gallagher',NULL,'2017-08-11T19:43:33.890',NULL,NULL,NULL,NULL,0,0,0,11231318,NULL),(17410,1,'2017-07-01T03:21:12.843','user17410',NULL,'2017-07-01T03:21:12.843',NULL,NULL,NULL,NULL,0,0,0,11232243,'https://www.gravatar.com/avatar/ed3741257e867edf45107126ceda8c4a?s=128&d=identicon&r=PG&f=1'),(17411,6,'