ticon&r=PG'),(17465,1,'2017-07-07T07:07:12.103','Hanthony Tagam',NULL,'2017-07-07T07:07:12.103','http://none','Cagayan de Oro, Northern Mindanao, Philippines',24,'<p>By Day: i am a wanderer of the unknown. searching for the things that i like and fortunately liking the things that i have searched. Passionate to drive on challenging world of technology and hoping that it will let me gain valuable experiences that i can use as my strenght for the future.\nBy Night: i am an owl surfing the net, streaming the YTube, enhancing my coding skills and literacy, i feel so free when the night comes it feels like no one is bugging around nor warm feeling of sunshine.</p>\n',0,0,0,5241247,'https://i.stack.imgur.com/ZvxLA.jpg?s=128&g=1'),(17466,101,'2017-07-07T10:24:15.513','Paolo Fulgoni',NULL,'2017-07-07T10:24:15.513',NULL,'Italy',34,NULL,0,0,0,126748,'https://www.gravatar.com/avatar/4a7b83db61482a8f0e4d1c1109eec123?s=128&d=identicon&r=PG'),(17467,1,'2017-07-07T13:38:41.523','Mahmoud Almostafa RABBAH',NULL,'2017-08-03T16:26:06.923','http://www.rabbahsoft.ma','Casablanca, Grand Casablanca, Morocco',35,'<p>Engineer in Computer Science, and big fun of Robotics and AI, my motto is enjoying new technologies and sharing\nthis passion with my behavior. Specialties: IT, Robotics, AI</p>\n',0,0,0,11231710,'https://lh6.googleusercontent.com/-oXxaJCc56-8/AAAAAAAAAAI/AAAAAAAABEA/91gLkSv8jQM/photo.jpg?sz=128'),(17468,1,'2017-07-07T15:21:57.703','AggressiveGeek',NULL,'2017-07-07T15:21:57.703',NULL,NULL,NULL,NULL,0,0,0,11278225,'https://lh6.googleusercontent.com/-TUC6Mp1v1Qo/AAAAAAAAAAI/AAAAAAAAABI/CS_nNPseO8M/photo.jpg'),(17469,101,'2017-07-07T21:11:54.993','TonyH',NULL,'2017-07-12T03:55:41.600',NULL,'New York, NY, United States',NULL,'<p>Internal Development Tools and Systems Engineer. I love solving problems using out-of-the box thinking.</p>\n\n<hr>\n\n<p>Very curious and interested in all things science related. Ive worked in a plant genetics lab, molecular biology labs, and x-ray crystallography labs. Also have been an active coder in various languages for about 15 years. I particularly enjoy machine learning, AI and various image processing techniques.</p>\n\n<hr>\n\n<p>Im also an expert on the ERP system <strong><em>NetSuite</em></strong>. I also know some: </p>\n\n<pre><code>Python          Bash\nJavaScript      Coffeescript\nC#              Java\nPuppet\n</code></pre>\n\n<p>Ive been known to alter and compile a few <em>C</em> programs when necessary.\nLearning:</p>\n\n<pre><code>Ruby        Groovy\nGo          C\nHaskell     Eiffel\nRust        Scala\n</code></pre>\n\n<p>Yeah, <em>thisll happen</em> ;)</p>\n',0,1,0,332449,NULL),(17470,6,'2017-07-07T23:12:53.493','AndyM',NULL,'2017-07-14T20:24:50.987','','Kosovo Polje, Republika Srpska, Bosnia and Herzegovina',NULL,'',0,0,0,11280685,'https://lh6.googleusercontent.com/-HL-v7908Mo8/AAAAAAAAAAI/AAAAAAAAACM/06P_KFyBZ9A/photo.jpg?sz=128'),(17471,1,'2017-07-08T00:55:17.173','rangoju kittu',NULL,'2017-07-08T00:55:17.173',NULL,NULL,NULL,NULL,0,0,0,10441638,'https://www.gravatar.com/avatar/b71388247ac8eb832ad94c05ba3d1842?s=128&d=identicon&r=PG&f=1'),(17472,11,'2017-07-08T01:56:09.233','Nicholas Adrian',NULL,'2017-08-15T06:15:06.640',NULL,NULL,NULL,NULL,0,0,0,9598310,'https://graph.facebook.com/10211500447893655/picture?type=large'),(17473,101,'2017-07-08T03:04:58.953','dibs',NULL,'2017-07-08T03:04:58.953','http://mycu.bz','Wellington, New Zealand',40,'<p>I like to make websites!</p>\n\n<p>#SOreadytohelp</p>\n',0,1,0,243322,'https://www.gravatar.com/avatar/826822f9fea796a6612737cc056022f0?s=128&d=identicon&r=PG'),(17474,1,'2017-07-08T03:54:09.377','solaremperor',NULL,'2017-07-08T03:54:09.377',NULL,'Los Angeles, CA',25,'<p>The only developer in the Lonely Server</p>\n',0,0,0,2847388,'https://www.gravatar.com/avatar/ce9ad9e658cb85c262646fdb82415fc7?s=128&d=identicon&r=PG'),(17475,1,'2017-07-08T15:10:43.817','Vikas Yadav',NULL,'2017-07-17T15:28:57.673',NULL,NULL,NULL,NULL,0,0,0,11285251,'https://www.gravat