e immediately saved it to the cassette drive, of course.</p>\n\n<p>I was drawn to computer programming. Nothing would have stopped me from getting into it.</p>\n\n<p>I love math, electronics, robotics, design, and all science, but programming takes up all my time.</p>\n\n<p>Feel free to send me one million dollars:</p>\n\n<p><a href=\"http://i.stack.imgur.com/bomlQ.png\" rel=\"nofollow\"><img src=\"http://i.stack.imgur.com/bomlQ.png\" alt=\"enter image description here\"></a></p>\n',0,0,0,1039488,'https://www.gravatar.com/avatar/a373ba8a6075c8647dab8ef37c160870?s=128&d=identicon&r=PG'),(17504,31,'2017-07-11T07:25:02.423','Priyanka Rao',NULL,'2017-08-26T12:03:27.207','','Indian Institute Of Technology, Chennai, Tamil Nadu, India',NULL,'<p>A newbie, looking to evolve with respect to a body fixed frame of reference</p>\n',0,3,0,10381892,'https://www.gravatar.com/avatar/5494b705c54d37d0211403c0e652dd4e?s=128&d=identicon&r=PG&f=1'),(17505,101,'2017-07-11T08:16:45.033','JedatKinports',NULL,'2017-07-11T08:16:45.033',NULL,NULL,NULL,NULL,0,0,0,9706671,'https://i.stack.imgur.com/6SC4J.png?s=128&g=1'),(17506,1,'2017-07-11T10:04:45.353','tcarlander',NULL,'2017-08-15T06:04:32.903','http://www.wfp.org','Bangkok, Thailand',48,'<p>Systems &amp; Applications Architect @ WFP BKK</p>\n',0,0,0,299455,'https://www.gravatar.com/avatar/a202f74c866d04b09dc318d2866e0738?s=128&d=identicon&r=PG'),(17507,101,'2017-07-11T10:56:26.753','Harshith Thota',NULL,'2017-07-11T10:56:26.753',NULL,'India',22,'<p>Im currently studying Electronics and Communication Engineering but have recently found out my passion in the Network Security Domain. So, right now Im exploring Python and am working on a certain script.</p>\n\n<p>Follow me on GitHub if you are interested in the script Im talking about and feel free to contribute.</p>\n',0,0,0,11282084,'https://i.stack.imgur.com/Vs1ua.jpg?s=128&g=1'),(17508,1,'2017-07-11T16:17:27.213','phaeries',NULL,'2017-08-10T17:09:15.447','',NULL,NULL,'',0,0,0,9601134,'https: