ub.com/StrangeTcy','St. Petersburg, Russia',28,'<p>A student of C/C++ (and perl too now!),  aspiring to learn from the best, actually learning from anywhere I can get my hands onto, aiming for low-level core-friendliness - thence _asm snippets.\nUPD: a fan of Big Data now (Apache Hadoop and everything related)\nUPD: a student of artificial intelligence and neuroevolution</p>\n\n<p><a href=\"http://www.nerdtests.com/ft_nq.php\" rel=\"nofollow\">\n<img src=\"http://www.nerdtests.com/images/ft/nq/30ad9f68f8.gif\" alt=\"I am nerdier than 94% of all people. Are you a nerd? Click here to take the Nerd Test, get geeky images and jokes, and write on the nerd forum!\"></a></p>\n',0,2,0,1764640,'https://www.gravatar.com/avatar/16b01bba5dacce95be27888670b7d218?s=128&d=identicon&r=PG'),(17739,1,'2017-08-01T21:13:52.223','Dogs',NULL,'2017-08-01T21:13:52.223',NULL,NULL,NULL,NULL,0,0,0,2696602,'https://www.gravatar.com/avatar/0975d012758cb800877d25e7f55b2dbd?s=128&d=identicon&r=PG&f=1'),(17740,1,'2017-08-01T21:43:29.217','badministrator',NULL,'2017-08-01T21:43:29.217',NULL,NULL,19,NULL,0,0,0,5498983,'https://i.stack.imgur.com/kKzWM.png?s=128&g=1'),(17741,1,'2017-08-02T05:19:05.270','lab11',NULL,'2017-08-02T05:19:05.270',NULL,NULL,NULL,NULL,0,0,0,6830632,'https://www.gravatar.com/avatar/bfd1071d284e3b1ad5ed7a3409b6ceae?s=128&d=identicon&r=PG&f=1'),(17742,1,'2017-08-02T13:30:19.763','Nick Taylor',NULL,'2017-08-02T13:30:19.763',NULL,NULL,NULL,NULL,0,0,0,11458471,'https://www.gravatar.com/avatar/f1ec0f0ba2b838c4b454131fb15ffbd0?s=128&d=identicon&r=PG&f=1'),(17743,1,'2017-08-02T13:55:20.593','Rajib Bahar',NULL,'2017-08-02T13:55:20.593','http://www.rajib-bahar.com',NULL,NULL,'<p>Over the course of his 16+year career, Rajib Bahar has been a creative problem solver, finding innovative solutions to clients  data questions, issues and challenges. He works primarily in Business Intelligence, and Data analytics practice with experience in BigData, DataScience, &amp; Cloud computing environments. His career initially started in the unix world submitting perl and fortran jobs to super-computers back in 2000. This was before Big Data and distributed computing got Big. Later on, he moved on to .NET application development roles, and worked with variety of Database systems such as MS Sql Server, MySQL, PostgresSQL, DB2, &amp; Oracle. Around 2008, he started working in Business Intelligence and/or Datawarehousing practice utilizing both Ralph Kimball and Inmon methodologies. Currently, he is working in Big Data platforms and connecting it with SQL Server 2016, R, Python, and building POCs on Data Science for BI projects. He also enjoys working with visualization tools such as Power BI, Tablue, and QlikView. His recent venture in the Data world includes a podcast on BigData, Data Science, DBMS, analytics, and cloud computing. The podcast is also syndicated across iTunes and YouTube. The link to podcast is <a href=\"http://www.soundcloud.com/data-podcast\" rel=\"nofollow noreferrer\">http://www.soundcloud.com/data-podcast</a>.</p>\n\n<p>He has also served as a Board of Members of directors at KFAI radio, PASSMN, and various other non-profits. His expertise in data have led to savings at KFAI radio on expensive software license costs, reduced paper expense via online voting. Currently, he spends time contributing to the Data Visualization challenge the station faces. </p>\n\n<p>Feel free to connect with Rajib @rajib2k5 or linkedin.com/in/rajibb</p>\n',0,0,0,11468107,'https://lh5.googleusercontent.com/-yUP1BXUndaA/AAAAAAAAAAI/AAAAAAAAB1k/vaGARqpQQqk/photo.jpg?sz=128'),(17744,11,'2017-08-02T15:58:34.480','Mepix',NULL,'2017-08-25T17:25:30.327',NULL,'California, United States',NULL,'<p>Im \"that engineer with a camera.\"  Working on robotics R&amp;D may be my day job, but I tinker with 3D printers and work on film sets in my free moments.</p>\n',1,0,0,11200563,'https://www.gravatar.com/avatar/9d029e9daf3054a5e838148663ee1836?s=128&d=identicon&r=PG&f=1'),(17745,1,'2017-08-02T16:57:32.580','Vik',NULL,'2017-08-02T16:57:32.580',NULL,NULL,NULL,NULL,0,0,0,10173569,'https://www.gravatar.com/avatar/7080908badd49bcd29ac96eab1fefdde?s=128&d=identicon&r=PG&f=1'),(17746,1,'2017-08-02T20:48:48.583','Parasara Sarma',NULL,'2017-08-02T20:48:48.583',NULL,NULL,NULL,NULL,0,0,0,11471156,'https://www.gravatar.com/avatar/0ccf587d616cdf9a4e32afefb9dc8990?s=128&d=identicon&r=PG&f=1'),(17747,1,'2017-08-03T03:33:35.420','Javi Llerenas',NULL,'2017-08-03T03:33:35.420','http://linkedin.com/in/jvllerenas','Las Vegas, NV, United States',NULL,NULL,0,0,0,8059546,'https://i.stack.imgur.com/7JPS7.jpg?s=128&g=1'),(17748,1,'2017-08-03T05:25:07.673','Blaz Stojanovic',NULL,'2017-08-25T11:05:37.243',NULL,NULL,NULL,NULL,0,0,0,6791703,'https://www.gravatar.com/avatar/6330fbce3bfc8ffed21251f4570b7de7?s=128&d=identicon&r=PG'),(17749,101,'2017-08-03T06:06:42.360','Maxime Franchot',NULL,'2017-08-03T06:06:42.360',NULL,'Tokyo, Japan',20,'<p><strong>Summer Intern:</strong> Writing scripts in Powershell for Windows Server R2 2008 at Valeo Japan, Automating profile and group creations on ActiveDirectory. (At the moment, I have very mixed opinions on Powershell..)</p>\n\n<p><strong>Studying Computer Science:</strong> At the University of York in the U.K, just finished first year. Loving the course and the subject.</p>\n\n<p>Also do plenty of programming stuff on the side, at the moment I am focusing on making games on the beautiful Unreal Engine 4.</p>\n\n<p><strong>Other Interests:</strong> I love music, art, science, and whatever else I can learn on youtube. I really love thinking about the philosophy and logic of things. Am in total support of the human race getting eradicated by paperclip-manufacturing A.I.</p>\n',0,0,0,11377900,'https://www.gravatar.com/avatar/3a9a56a4ff1f12e123524106f5fb695b?s=128&d=identicon&r=PG&f=1'),(17750,1,'2017-08-03T07:20:19.163','Maja',NULL,'2017-08-03T07:20:19.163',NULL,NULL,NULL,NULL,0,0,0,8205985,'https://www.gravatar.com/avatar/d65bcfdab5cd5f