France',27,'<p>I am a PhD student at LAAS-CNRS (France), with main study fields being motion-planning for manipulator robots in Human-Robot Interaction (HRI) and link between task and motion planning. I mainly use C++ and Python languages, I am also an user of Linux and ROS.</p>\n',0,0,0,3441792,'https://www.gravatar.com/avatar/d6e00f10fe75db800410e75850ebe678?s=128&d=identicon&r=PG&f=1'),(17802,1,'2017-08-10T10:38:41.780','AER',NULL,'2017-08-25T15:29:22.127',NULL,NULL,NULL,'<p>Un apasionado de la ciencia y el saber en general, la inform tica y todo lo que tenga que ver en concreto.</p>\n',0,0,0,10628940,'https://www.gravatar.com/avatar/52ddcb53281b3e564ec74ce682084e44?s=128&d=identicon&r=PG&f=1'),(17803,1,'2017-08-10T14:39:23.123','Methark',NULL,'2017-08-10T14:39:23.123','http://www.methark.com','Richmond, VA, United States',36,'<p>Methark is a Business, Marketing &amp; Technology Development and Research Outsource company.</p>\n',0,0,0,8950298,'https://lh4.googleusercontent.com/-51PCgwogYRk/AAAAAAAAAAI/AAAAAAAAAts/VzyJytvuJm0/photo.jpg?sz=128'),(17804,1,'2017-08-10T16:48:28.190','Hossein',NULL,'2017-08-17T03:16:04.703','http://www.Rondbook.com',NULL,NULL,'<p>I have an M.S. in Artificial Intelligence And Robotics from IUT, Iran. In addition, My B.S. is in the field of Software Engineering. These two fields could be really nice when they mix.</p>\n\n<p>I also have more than 7 years of experience in software development. I have a really deep knowledge and experience in different programming languages and technologies including ASP.Net MVC5, JQuery, JavaScript, CSS,HTML, C#, C/C++, Entity-Framework, MS SQL Server and some others.</p>\n\n<p>Its really interesting for me to develop software. But adding some intelligent features using Computer Vision and Machine learning algorithms makes it really exciting for me. I also have worked with OpenCV, LibSVM, PCL(Point clouds library) etc.</p>\n',0,0,0,2330344,'https://i.stack.imgur.com/XRSho.jpg?s=128&g=1'),(17805,1,'2017-08-