oratory where I can play with embedded computers and electronic devices and develop some home automation, intelligent assistance and IoT solutions. While same girl who caused me to dive me in this pool, is getting jealous of my divided attention to my wife-to-be and my interest in technology. :D</p>\n',2,0,0,10273976,'https://i.stack.imgur.com/Fx8E9.jpg?s=128&g=1'),(17813,1,'2017-08-11T14:40:59.960','Devendra',NULL,'2017-08-11T14:40:59.960',NULL,NULL,NULL,NULL,0,0,0,11533038,'https://www.gravatar.com/avatar/3d66402cbb8b506dd2a38f002edcabe4?s=128&d=identicon&r=PG&f=1'),(17814,1,'2017-08-11T16:56:03.620','SoloCrowd',NULL,'2017-08-14T12:16:31.757',NULL,NULL,NULL,NULL,0,0,0,1204378,'https://www.gravatar.com/avatar/2823ba91eadc78d6c14f7f8a5758fbf9?s=128&d=identicon&r=PG'),(17815,1,'2017-08-11T18:35:56.723','shair akber',NULL,'2017-08-11T18:35:56.723',NULL,NULL,NULL,NULL,0,0,0,11534447,'https://lh3.googleusercontent.com/-Naee2qmoOlY/AAAAAAAAAAI/AAAAAAAAADE/poyNAgO3T40/photo.jpg'),(17816,1,'2017-08-12T08:20:34.300','RHOMBRIC ADAMS',NULL,'2017-08-12T08:20:34.300',NULL,NULL,NULL,NULL,0,0,0,11537097,'https://graph.facebook.com/268198593683839/picture?type=large'),(17817,1,'2017-08-12T09:44:21.917','Nimish',NULL,'2017-08-17T03:54:20.957',NULL,NULL,NULL,NULL,0,0,0,11537506,'https://www.gravatar.com/avatar/41322bfc844dfff669bdf51db669b7e4?s=128&d=identicon&r=PG&f=1'),(17818,1,'2017-08-12T09:54:04.017','lost1',NULL,'2017-08-19T17:37:40.460','',NULL,NULL,'',0,0,0,11537414,'https://www.gravatar.com/avatar/00e491a90f02b1cb065d02d7c27c1cf7?s=128&d=identicon&r=PG&f=1'),(17819,1,'2017-08-12T14:13:08.263','Joe Vocker',NULL,'2017-08-12T14:13:08.263',NULL,NULL,NULL,NULL,0,0,0,11538575,'https://www.gravatar.com/avatar/129a3cd70d2fad3e601ab42214a688a4?s=128&d=identicon&r=PG&f=1'),(17820,1,'2017-08-12T23:49:33.087','NerdEngine',NULL,'2017-08-12T23:49:33.087',NULL,NULL,NULL,NULL,1,0,0,4736904,'https://www.gravatar.com/avatar/ead93f287c6fab53a9983746dbe96e37?s=128&d=identicon&r=PG&f=1'),(17821