4:03.113','http://www.fabiandeitelhoff.de','Germany',34,'<p>Student, Author, Pluralsight, Speaker, Software Developer and addicted to nearly everything in the Software Business.</p>\n\n<p>Working on compiler stuff and loving the LEGO Mindstorms EV3.</p>\n',0,0,0,2345895,'https://www.gravatar.com/avatar/ce6fd8bd6d8780aade0bbc9acd5a3372?s=128&d=identicon&r=PG'),(17865,138,'2017-08-17T19:13:11.897','Tony Stewart',NULL,'2017-08-17T21:57:57.683','http://none','Markham, Canada',65,'<pre><code>Life can be application of Ohms Law and Heisenburg Uncertainty Principle.\n\nGot 10 yrs experience in my 1st 5 yrs in R&amp;D after education. then switched jobs and got 40 yrs experience in the next 20 yrs. (long hours and hard work) and after working for 6 different companies I decided to retire @ 55 so it was very satisfying, but I never got wealthy after 30 yrs.. until I retired.\n\nIf you need a part-time consultant, just ask me. Experience is worth every penny, which is more than they pay us on this site  :)   gmail:  tony.sunnysky\n\nStarted life as EE grad in 1975 designing VLF doppler nav receiver for unmanned floating Automated Weather Station (world 1st) then Aerospace Doppler tracking receiver with ultra stable VCXO in both ground station and airborne rocketsource, then nuclear instrumentati built to survide 100g drop, 50 g spin and 10g acceleration, with 15g vibration -50C~+70C. Designed Nuclear robotic scanning sub-system for Eddy Current probes in 2ndary heat exchanger tubes , went on to production and OEM HDD disk drive testing, Test Engineer Mgr, Design T1 tewst equipment for another world 1st SCADA ISDN BroadBand WAN T1 to 100 home trial in 1982, also was Network debug mgr., component testing for magnetic heads, Xtals to design 1 ppm TCXO out of a 50ppm Xtal for under 1$, Designed NTSC &amp; VGA Video head mounted display using Kopin AMLCD chip, Designed power over ethernet distribution box contract design for AVAYA (nee Lucent in Denver), contract mfg Eng Mgr, Design Services Mgr. for EMS companies and created virtual Eng Organization for design.\n\njust a few highlites......\n\nLots of fun, then got out working for someone else after 30 yrs and retired.;)\nIf you see me with a beard., that was me on holidays in Cuba on CAYO CAYO Island \n</code></pre>\n\n<p>Location\n    Richmond Hill, ON, Canada </p>\n\n<p>Interests\n    Helping others, golf, cooking , gardening woodwork, &amp; puters, house renovation, LED luminaire design </p>\n\n<p>Occupation\n    Retired, aka unemployed</p>\n',1,0,0,503251,'https://lh3.googleusercontent.com/-nzHpZnYDBZc/AAAAAAAAAAI/AAAAAAAAH58/ozM3fEdpVvc/photo.jpg?sz=128'),(17866,16,'2017-08-17T20:20:11.823','Renan Monteiro',NULL,'2017-08-24T05:52:44.093',NULL,NULL,NULL,NULL,1,0,0,5509323,'https://graph.facebook.com/100003564619949/picture?type=large'),(17867,1,'2017-08-17T21:51:54.920','eidimon',NULL,'2017-08-17T21:51:54.920',NULL,NULL,NULL,NULL,0,0,0,1526447,'https://www.gravatar.com/avatar/a3fd1b91edce8b916ab2e30dc44e8455?s=128&d=identicon&r=PG'),(17868,1,'2017-08-17T22:14:41.207','user166659',NULL,'2017-08-17T22:14:41.207',NULL,NULL,NULL,NULL,0,0,0,6149666,'https://www.gravatar.com/avatar/102b06ecfd59e1e87984ecb9450af715?s=128&d=identicon&r=PG&f=1'),(17869,1,'2017-08-17T22:43:20.823','robotics1',NULL,'2017-08-23T11:51:37.377',NULL,NULL,NULL,NULL,0,0,0,8029483,'https://www.gravatar.com/avatar/2c5e069ede2a2e717124de37b6da7b81?s=128&d=identicon&r=PG'),(17870,1,'2017-08-17T22:45:17.497','bill97420',NULL,'2017-08-17T22:45:17.497',NULL,'Coos Bay, OR, United States',64,'<p>By Day I am IT support for a small place. Only IT so I do a little of everything. All Windows with AD. Moving more of the applications out to the cloud. Non-work hours I like to play with micro-controllers, rebuild old computers and try to run ubuntu.</p>\n',0,0,0,11575078,'https://www.gravatar.com/avatar/12c6b4968aa851df25a824061d40d2de?s=128&d=identicon&r=PG&f=1'),(17871,6,'2017-08-17T23:30:15.777','Ryan Lee',NULL,'2017-08-20T08:52:32