ruitt, Sydney, NSW, Australia.\nIntend to continue to a BSc(Maths/Physics) &amp; B Eng Elec/Aerospace</p>\n\n<p>Dec, 2012 - present:\nEngineering Technical Officer/Intern with Mostyn Enterprises (Technologies) P/L, St Clair, NSW.\nEE CAD/CAM - Eagle CAD, Sonnet, Circuitmaker 2000, LTSpiceIV, 4Nec2, SciLab, Euler; RF/ w  Systems development and test - Microstrip filter design, construction and test; Power supply design, construction and test; Embedded system development - PIC, AVR; Automatic HF antenna matching unit - RF design &amp; simulation; RF switch matrix - demonstrator build, test; Hi power DC-DC boost converter - design, simulation, prototype; Writing trade media press releases and technical/sales documentation; Li-ion battery management system and dual DCDC buck converter - design; VHF/UHF Variable BPF- design, simulation</p>\n\n<p>Student Memberships:\nEngineers Australia - Electrical Colleges, WSRG;\nIEEE - MTTS, Antenna &amp; Propagation Soc, Photonics Soc, Circuits &amp; Systems Soc, Solid-State Circuits Soc, Electron Devices Soc, Communications Soc; Power Electronics Soc.;\nSPIE, Aust Optical Soc;\nAmerican Telemedicine Assoc.;\nAustralian TeleHealth Soc.; \nAssoc. of Old Crows;\nInstitute of Instrumentation, Control and Automation Australia;\nTelecommunications Assoc.</p>\n\n<p>Member: Royal Aeronautical Society of Australia, (Friend of); National Space Society of Australia; Sydney Space Frontier Society</p>\n\n<p>Interests:\nSydney PC User Gp; Sydney Linux UG; amateur radio operator VK2UKR - 2m, radio astronomy; NSW Nordic Ski Club; Nat Parks Assoc. of NSW; Bushwalking, snowcamping; Plast Ukrainian Scouts NSW - assets officer; NSW Schizophrenia Fellowship - Parramatta Schizophrenia Support Group - assistant convenor; NSW Mental Health Assoc.; mathematics; Mathematica, Euler &amp; SciLab, 4NEC2; SCADA, industrial networks telecoms security; DSP + digital filters; FPGAs; FPAAs; Microcontrollers; C, C++, Ada, Fortran 2008, Modula, Modelica; Millimetre wave-TeraHertz technologies; Photonics; Neural networks; Fuzzy logic systems; EW, Radar and Sonar systems and assoc signal processing; Languages; Telemedicine applications to rural and remote area mental healthcare; Semiconductor fabrication and manufacturing; chaotic behaviour in SMPS; nanophotonics; feedback control systems analysis and synthesis;</p>\n',0,1,0,2683002,'https://www.gravatar.com/avatar/218e39cb927b5d3eebffa65623bbaf8d?s=128&d=identicon&r=PG'),(17939,1,'2017-08-24T11:43:03.480','user3713940',NULL,'2017-08-24T12:48:23.863',NULL,NULL,NULL,NULL,0,0,0,4575360,'https://www.gravatar.com/avatar/9fe6acfe2e623ce557b1a1a8960dca9a?s=128&d=identicon&r=PG&f=1'),(17940,101,'2017-08-24T15:54:44.970','soham.m17',NULL,'2017-08-25T14:49:18.490','http://cs-people.bu.edu/soham1/','Boston, MA, United States',26,'<p>Coding in C, C++, Python, Javascript, Bash, and of course in Assembly.</p>\n',0,0,0,551103,'https://www.gravatar.com/avatar/a969fb182387e71891f077768aad7ff9?s=128&d=identicon&r=PG'),(17941,1,'2017-08-24T16:17:58.337','Parth_Patel',NULL,'2017-08-24T16:17:58.337',NULL,NULL,NULL,NULL,0,0,0,11621587,'https://lh6.googleusercontent.com/-DcgUqiuEA0I/AAAAAAAAAAI/AAAAAAAASs8/ciRXzVxHe0U/photo.jpg?sz=128'),(17942,1,'2017-08-24T16:52:43.333','Amit rai',NULL,'2017-08-24T16:52:43.333',NULL,NULL,NULL,NULL,0,0,0,11621847,'https://www.gravatar.com/avatar/d7f339db23d544db20599917f049ee30?s=128&d=identicon&r=PG&f=1'),(17943,1,'2017-08-24T19:46:05.740','himanshu',NULL,'2017-08-24T20:01:13.167','',NULL,NULL,'',0,0,0,11622762,'https://www.gravatar.com/avatar/10b2f25c44c5cc2428804c634f37dd11?s=128&d=identicon&r=PG&f=1'),(17944,1,'2017-08-24T21:30:43.230','user17944',NULL,'2017-08-24T21:30:43.230',NULL,NULL,NULL,NULL,0,0,0,4436130,'https://www.gravatar.com/avatar/8f43a450799eaf25a21e0a385ca09832?s=128&d=identicon&r=PG&f=1'),(17945,1,'2017-08-25T04:02:36.563','moosesauce',NULL,'2017-08-25T04:02:36.563',NULL,'USA',NULL,'<p>Hello world!</p>\n',0,0,0,11624566,'https://i.stack.imgur.com/c